import{_ as g,o as t,c as n,a as i,t as u,C as h,M as _,U as k,f as p,F as w,p as b,e as v,q as f}from"./chunks/framework.B1z0IdBH.js";const D={name:"PoemCard",props:{poem:{type:Object,required:!0}},methods:{handleImageError(a){a.target.src="/images/logo.svg"}}},y={class:"entry-container"},B={class:"entry"},A={class:"entry-image"},j=["src","alt"],z={class:"entry-content"},C={class:"entry-title"},E=["href"],S={class:"entry-description"};function x(a,e,s,m,o,r){return t(),n("div",y,[i("div",B,[i("div",A,[i("img",{src:s.poem.image_url,alt:s.poem.page_title,onError:e[0]||(e[0]=(...d)=>r.handleImageError&&r.handleImageError(...d))},null,40,j)]),i("div",z,[i("h2",C,[e[1]||(e[1]=i("span",{class:"title-icon"},null,-1)),i("a",{href:s.poem.page_url,target:"_blank"},u(s.poem.page_title),9,E)]),i("p",S,u(s.poem.context_page_description),1)])])])}const P=g(D,[["render",x],["__scopeId","data-v-490da3fc"]]),M=JSON.parse(`[{"page_url":"https://no.wikipedia.org/wiki/Roan_kirke","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Roan_kirke_fra_RA.jpg","page_title":"Roan kirke","context_page_description":"Roan kirke er en langkirke fra 1702 i Åfjord kommune, Trøndelag fylke.\\nByggverket er i stein og har 400 plasser.\\nDet er kirkegård ved kirken."},{"page_url":"https://en.wikipedia.org/wiki/Denges-Echandens_railway_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Denges-Echandens_railway_station.jpg","page_title":"Denges-Echandens railway station","context_page_description":"Denges-Echandens railway station is a railway station in the municipality of Denges, in the Swiss canton of Vaud. It is located at the junction of the standard gauge Jura Foot and Lausanne–Geneva lines of Swiss Federal Railways, although no trains on the former stop here."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BD%D1%80%D0%B0%D0%B4,_%D0%94%D0%B6%D0%BE%D0%B7%D0%B5%D1%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Joseph_Conrad.PNG","page_title":"Конрад, Джозеф","context_page_description":"Джо́зеф Ко́нрад, настоящее имя Юзеф Теодор Конрад Коженёвский, в устаревшей передаче Феодор Иосиф Конрад Корженевский — английский писатель польского происхождения, мастер морского романа."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%B8%D0%B1%D0%BE%D1%80%D0%B8_%D0%9F%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82%D0%B0_%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B8_2014","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Oleh_Tyahnybok_2014.jpg","page_title":"Вибори Президента України 2014","context_page_description":"Вибори Президента України 2014 — позачергові вибори Президента України, що відбулися 25 травня 2014 року. Спочатку були заплановані як чергові на 2015 рік, але призначені на раніший термін у зв'язку з самоусуненням Віктора Януковича з поста Президента України 22 лютого 2014 року.\\nОрієнтовна кількість виборців, які мали право голосу на президентських виборах 2014, становить 35,5 млн осіб, кількість виборців, внесених до списку виборців на момент закінчення голосування — 30 099 246 осіб, кількість виборчих дільниць — 33674.\\nЗа офіційними даними, після опрацювання 100,00 % протоколів: Петро Порошенко набрав 54,70 % серед тих, хто взяв участь у голосуванні, Юлія Тимошенко — 12,81 %, Олег Ляшко — 8,32 %, Анатолій Гриценко — 5,48 %."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B5%D1%80%D0%B5%D0%BF%D0%B8%D1%81_%D1%83_%D0%92%D0%B8%D1%84%D0%BB%D0%B5%D1%94%D0%BC%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Pieter_Bruegel_the_Elder_-_The_Census_at_Bethlehem_%28detail%29_-_WGA03381.jpg","page_title":"Перепис у Вифлеємі","context_page_description":"«Перепис у Вифлеємі» — картина пізнього періоду творчості, яку створив нідерландський художник Пітер Брейгель Старший.\\nКартину відносять до біблійних творів митця. Мимоволі поєднують у єдиний цикл картини «Перепис у Вифлеємі» та «Винищення немовлят». На обох картинах події відбуваються взимку, стривожені мешканці покинули власні домівки, бо в дрімотний плин життя втрутилася влада. І це втручання не несе нічого безпечного, навпаки. В «Перепису у Вифлеємі» це ще досить спокійне втручання, що нагадує збори податків. В картині «Винищення немовлят» вже трагедія — бо це каральна кампанія в нідерландському поселенні, є кати і є перші покарані — діти.\\nПітер Брейгель Старший — з тих нідерландських митців, що створив подорож до Італії. Небезпечний і довгий шлях митця проліг через Францію до порту в Марселі, а далі вітрильником — до Неаполя. Лише малюнки автора та картини з портом Неаполя дозволяють гіпотетично представити шлях і зупинки майстра на шляху до славнозвісного мистецького центру — Риму. Отже, Брейгель був у Італії, але не у Палестині, тобто, не міг на власні очі бачити Вифлеєм. І події у власних так званих біблійних картинах переніс в невеличке нідерландське поселення."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%81%E3%83%A3%E3%83%BC%E3%83%AB%E3%82%BA%E3%83%BB%E3%82%B7%E3%83%A3%E3%83%8E%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Charles_de_Sousy_Ricketts_by_Charles_Haslewood_Shannon.jpg","page_title":"チャールズ・シャノン","context_page_description":"チャールズ・シャノンはイギリスの画家、版画家である。肖像画で知られ、作品はナショナル・ポートレート・ギャラリーなどに収められている。"},{"page_url":"https://nl.wikipedia.org/wiki/Otis_(geslacht)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Otis_tarda_%28Kiev_zoo%29.jpg","page_title":"Otis (geslacht)","context_page_description":"Otis is een monotypisch geslacht van vogels uit de familie trappen. De enige soort is:\\nOtis tarda"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A1%9E%E7%BA%B3%E6%B2%B3%E7%95%94%E9%98%BF%E5%B8%83%E9%9A%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Map_commune_FR_insee_code_94001.png","page_title":"塞纳河畔阿布隆","context_page_description":"塞纳河畔阿布隆是法国法兰西岛大区马恩河谷省的一个市镇，属于克雷泰伊区。该市镇2009年时的人口为5,785人。"},{"page_url":"https://ro.wikipedia.org/wiki/Tut%C3%B3ia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Brasao-Tutoia.png","page_title":"Tutóia","context_page_description":"Tutóia este un oraș în unitatea federativă Maranhão, Brazilia."},{"page_url":"https://es.wikipedia.org/wiki/V%C3%A1lvula_hidr%C3%A1ulica","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Cryogenic-gate-valve-The-Alloy-Valve-Stockist.JPG","page_title":"Válvula hidráulica","context_page_description":"Una válvula hidráulica es un mecanismo que sirve para regular el flujo de fluidos.​\\nLas válvulas que se utilizan en obras hidráulicas son un caso particular de válvulas industriales ya que presentan algunas características únicas y por tanto merecen ser tratadas de forma separada."},{"page_url":"https://cs.wikipedia.org/wiki/Martin_Moudr%C3%BD_(varhan%C3%ADk)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Martin_Moudr%C3%BD_2010.JPG","page_title":"Martin Moudrý (varhaník)","context_page_description":"Martin Moudrý je český varhaník."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E6%BB%B2%E9%80%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Osmotic_pressure_on_blood_cells_diagram.svg","page_title":"滲透","context_page_description":"滲透（粵拼：sam³ tau³，英文：osmosis）係擴散嘅一種，指啲水分子會由高水勢嘅地方滲去低水勢嘅地方，直到細胞內外嘅濃度平衡為止嘅現象。"},{"page_url":"https://fi.wikipedia.org/wiki/James_Gosling","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/00/James_Gosling_2005.jpg","page_title":"James Gosling","context_page_description":"James Gosling O.C., Ph.D. on tietokoneohjelmien kehittäjä. Gosling on tunnettu Java-ohjelmointikielen alkuperäisestä kehityksestä."},{"page_url":"https://it.wikipedia.org/wiki/Monaca_di_Monza","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/I_promessi_sposi_-_Monaca_di_Monza.jpg","page_title":"Monaca di Monza","context_page_description":"Marianna de Leyva, divenuta Suor Virginia Maria ma meglio nota come la Monaca di Monza, è stata una religiosa italiana, protagonista di un famoso scandalo che sconvolse Monza agli inizi del XVII secolo.\\nFiglia primogenita di un nobile spagnolo, il conte di Monza Martino de Leyva y de la Cueva-Cabrera, a tredici anni fu costretta dal padre a entrare come novizia nell'Ordine di San Benedetto; a sedici anni pronunciò i voti e diventò la monaca suor Virginia Maria, dal nome della defunta madre. A fare scalpore fu la sua relazione con un uomo, il conte Gian Paolo Osio, dalla quale nacquero almeno due figli, un maschio nato morto o deceduto durante il parto e una bambina, che Osio riconobbe come propria figlia, Alma Francesca Margherita, affidata alla nonna paterna, ma vista sovente dalla madre.\\nL'amante di suor Virginia, che già in precedenza era stato condannato per omicidio, uccise tre persone per nascondere la tresca, ma fu scoperto, condannato a morte in contumacia e poi assassinato il giorno prima della sua condanna da un uomo che egli riteneva suo amico."},{"page_url":"https://az.wikipedia.org/wiki/M2_n%C3%B6mr%C9%99li_avtomobil_yolu_(Az%C9%99rbaycan)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/M2_Azerbaijan.JPG","page_title":"M2 nömrəli avtomobil yolu (Azərbaycan)","context_page_description":"M2 — Azərbaycanda Bakı ilə ölkənin şimal-şərq hissəsini birləşdirən avtomobil yolu. E-119 Avropa marşrutunun tərkib hissəsidir. Uzunluğu təxminən 210 km. Yol Bakıda Tbilisi prospektində başlayır və sonra şimal-qərb istiqamətində Sumqayıt, Siyəzən, Şabran və Quba ilə davam edərək, Rusiya Federasiyası ilə dövlət sərhədində bitir. Örtüyü asfalt-betondu. Eni hər tərəfdən 2-3 zolağdan ibarətdir."},{"page_url":"https://de.wikipedia.org/wiki/Regimini_militantis_ecclesiae","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Regimini_militantis_Ecclesiae.jpg","page_title":"Regimini militantis ecclesiae","context_page_description":"Mit der Gründungsbulle Regimini militantis ecclesiae vom 27. September 1540, durch Papst Paul III., wurde der Jesuitenorden endgültig bestätigt."},{"page_url":"https://de.wikipedia.org/wiki/Oskar_Bloch","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Erweiterungsbau_Wilhelmsruhe_in_Heilbronn-Sontheim.jpeg","page_title":"Oskar Bloch","context_page_description":"Oskar Bloch, auch Oscar Bloch, war ein deutscher Architekt schweizerischer Herkunft. Er arbeitete selbständig in Bürogemeinschaft mit Ernst Guggenheimer in Stuttgart."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Le_Po%C3%ABt-C%C3%A9lard","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Ch%C3%A2teau_du_Po%C3%ABt-Celard.jpg","page_title":"Le Poët-Célard","context_page_description":"Le Poët-Célard sī ūi-tī Hoat-kok Rhône-Alpes tōa-khu Drôme séng ê chi̍t-ê commune."},{"page_url":"https://en.wikipedia.org/wiki/Pyrzyce","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Pyrzyce_town_walls_2007.jpg","page_title":"Pyrzyce","context_page_description":"Pyrzyce, is a town in Pomerania, north-western Poland, with 13,331 inhabitants.\\nCapital of the Pyrzyce County in West Pomeranian Voivodeship, previously in Szczecin Voivodeship."},{"page_url":"https://nl.wikipedia.org/wiki/Ziduri","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Ziduri_jud_Buzau.png","page_title":"Ziduri","context_page_description":"Ziduri is een Roemeense gemeente in het district Buzău. Ziduri telt 4730 inwoners."},{"page_url":"https://pt.wikipedia.org/wiki/Pilote","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Philippe_Druillet_en_1973.jpg","page_title":"Pilote","context_page_description":"Pilote foi uma revista de quadrinhos francesa publicada de 1959 a 1989. Contando com a maioria dos principais talentos dos quadrinhos franco-belgas da época, a revista apresentou grandes séries como Astérix, Barbe-Rouge, Blueberry, Achille Talon e Valérian et Laureline. Roteiristas de quadrinhos de renome como René Goscinny, Jean-Michel Charlier, Greg, Pierre Christin e Jacques Lob foram apresentados na revista, assim como artistas como Jijé, Morris, Albert Uderzo, Jean Giraud, Enki Bilal, Jean-Claude Mézières Jacques Tardi, Philippe Druillet, Marcel Gotlib, Alexis e Annie Goetzinger.\\nPilote também publicou vários talentos internacionais, como Hugo Pratt, Frank Bellamy e Robert Crumb."},{"page_url":"https://en.wikipedia.org/wiki/Old_Fortress,_Corfu","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Old_Fortress_Contrafossa_and_Bridge.jpg","page_title":"Old Fortress, Corfu","context_page_description":"The Old Fortress of Corfu is a Venetian fortress in the city of Corfu. The fortress covers the promontory which initially contained the old town of Corfu that had emerged during Byzantine times.\\nBefore the Venetian era the promontory, which lies between the Gulf of Kerkyra to the North and Garitsa Bay to the south, was defended by Byzantine fortifications which the Venetians largely replaced with fortifications of their own design. As part of their defensive plans the Venetians separated the promontory from the rest of the city of Corfu by creating the Contrafossa, a moat which is a sea channel connecting the Gulf of Kerkyra to the North with the Bay of Garitsa to the South, converting the citadel into an artificial island. The fort successfully repulsed all three major Ottoman sieges: the great siege of 1537, the siege of 1571 and the second great siege of Corfu in 1716.\\nThe town of Corfu got its Western name from the twin peaks of the fortress."},{"page_url":"https://en.wikipedia.org/wiki/Military_ranks_of_the_Swiss_Armed_Forces","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/OF-1a_CH_camo.png","page_title":"Military ranks of the Swiss Armed Forces","context_page_description":"The military ranks of the Swiss Armed Forces have changed little over the centuries, except for the introduction, in 2004, of a new set of warrant officers. The rank insignia for all personnel are worn on shoulder boards with the appropriate background colour. The exception is that, in all services, rank insignia is not worn by recruits; it is however worn by privates once they have finished recruit school. Designations are given here in German, French, Italian and Romansh, with an English translation which is used during overseas missions. In the chart below, NATO codes are used for comparison purposes only; Switzerland is not a member of NATO, and the rank structure in the senior officer region can be seen to diverge significantly from other armies'."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D8%B3%D9%83%D9%88%D8%A7%D8%B4_%D9%81%D9%8A_%D9%85%D8%B5%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Karim_Abdel_Gawad_2017.jpg","page_title":"اسكواش في مصر","context_page_description":"تعتبر لعبة الاسكواش رياضة شهيرة في مصر وذات تقليد طويل في البلاد منذ ثلاثينيات القرن الماضي، بتصنيف 8 لاعبين ضمن أفضل لاعبي اسكواش في العالم على رأسهم المصنف الأول عالميا محمد الشوربجي. ويعتقد أن الرئيس السابق حسني مبارك كان لاعبا متحمس لهذه الرياضة ما حدى به لإعطائها دفعة اهتمام قوية في التسعينات. كما قيل أن النجاح الحالي هو نتيجة للاستثمار في رياضة المجتمع المصري ككل.\\nاعتبارا من عام 2018، هيمن العديد من اللاعبين المصريين ذوي التصنيف العالمي على لعبة الإسكواش للرجال والسيدات."},{"page_url":"https://pl.wikipedia.org/wiki/Eguenigue","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Eguenique-90-mairie.jpg","page_title":"Eguenigue","context_page_description":"Eguenigue – miejscowość i gmina we Francji, w regionie Burgundia-Franche-Comté, w departamencie Territoire-de-Belfort.\\nWedług danych na rok 1990 gminę zamieszkiwały 292 osoby, a gęstość zaludnienia wynosiła 117 osób/km²."},{"page_url":"https://hu.wikipedia.org/wiki/Upton_Sinclair","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Upton_Beall_Sinclair_Jr.jpg","page_title":"Upton Sinclair","context_page_description":"Upton Beall Sinclair Jr. amerikai Pulitzer-díjas regényíró volt, aki több műfajban közel száz könyvet írt."},{"page_url":"https://vi.wikipedia.org/wiki/Hemaris_fuciformis","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Hemaris_fuciformis-03_%28xndr%29.jpg","page_title":"Hemaris fuciformis","context_page_description":"Hemaris fuciformis, được gọi là the Broad-bordered Bee Hawk-moth, là một loài bướm đêm thuộc họ Sphingidae. Nó được tìm thấy ở Bắc Phi, châu Âu và miền trung và Đông Á.\\nSải cánh dài 38–48 milimét. The moth gặp ở tháng 4 đến tháng 9 tùy theo địa điểm.\\nẤu trùng ăn các loài kim ngân và Galium."},{"page_url":"https://pl.wikipedia.org/wiki/Parafia_Mi%C5%82osierdzia_Bo%C5%BCego_w_Su%C5%82kowicach","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/POL_Su%C5%82kowice_%C5%81%C4%99g_Ko%C5%9Bci%C3%B3%C5%82_2.jpg","page_title":"Parafia Miłosierdzia Bożego w Sułkowicach","context_page_description":"Parafia pod wezwaniem Miłosierdzia Bożego w Sułkowicach – parafia rzymskokatolicka znajdująca się w Sułkowicach-Łęgu. Należy do dekanatu Andrychów diecezji bielsko-żywieckiej.\\nErygowana 24 czerwca 1996 roku.\\nZobacz też: Parafia św. Jana Chrzciciela w Sułkowicach"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B8%D0%BD%D0%BD%D0%B8%D1%86%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/%D0%92%D1%83%D0%BB._%D0%90%D1%80%D1%85%D1%96%D1%82%D0%B5%D0%BA%D1%82%D0%BE%D1%80%D0%B0_%D0%90%D1%80%D1%82%D0%B8%D0%BD%D0%BE%D0%B2%D0%B0%2C_21_DSC_9674.JPG","page_title":"Винница","context_page_description":"Ви́нница — город, административный центр Винницкой области Украины."},{"page_url":"https://nn.wikipedia.org/wiki/Frank_Buchser","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Frank_Buchser_Il_divino_porcaio_1882.jpg","page_title":"Frank Buchser","context_page_description":"Frank Buchser var ein sveitsisk målar og eventyrar. Han var fødd i\\nFeldbrunnen-St. Niklaus i kantonen Solothurn og døydde same staden."},{"page_url":"https://en.wikipedia.org/wiki/Travel_Air_5000","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Travel_Air_5000_with_National_Air_Transport_in_flight.jpg","page_title":"Travel Air 5000","context_page_description":"The Travel Air 5000 was an early high-wing monoplane airliner and racing monoplane designed by Clyde Cessna and is chiefly remembered for being the winner of the disastrous Dole Air Race from California to Hawaii."},{"page_url":"https://lmo.wikipedia.org/wiki/Primula","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/59/Primula_vulgaris.jpg","page_title":"Primula","context_page_description":"Primula l'è 'n zèner de piànte anöàle o perèni de dimensiù pesène che fà par de la famìa de le Primulaceae. Le spéci de chèsto zèner le crès spontànee en töt l'emisfér nòrt e le g'ha fòie bazài a rözèta, con o sènsa gambì, fiùr bèi culuràcc reünìcc en ombrèle, capulì, gratilìne o vertezèi surapunìcc, con töt entùren le bràtee, che crès ensìma dei gamb de sòlet bei lónch. I fröcc de sòlet i è dele capsule. El zèner primula el töl dét de piö de 1500 spéci acetàde segont el sit del Missouri Botanical Garden."},{"page_url":"https://fr.wikipedia.org/wiki/Moka_(Maurice)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Saint_Pierre_%C3%A8s_Liens%2C_1909.jpg","page_title":"Moka (Maurice)","context_page_description":"Moka est un village de l'île Maurice, chef-lieu du district de Moka au centre de l'île. Selon le recensement effectué par Statistics Mauritius en 2011, la population était de 8 846 habitants. La partie ouest du village se trouve également dans le district de Plaines Wilhems. Le village est administré par le Conseil du village de Moka sous l'égide du Conseil de district de Moka. L'altitude est de 203 mètres et peut aller jusqu'à 425 mètres à certains endroits. Le village est bordé par la majestueuse chaîne de Moka comprenant notamment les montagnes emblématiques du Pouce et de Pieter Both. Réduit est une banlieue du village où se trouvent la State House et l'Université de Maurice. Le village abrite également la Mauritius Broadcasting Corporation et le Mahatma Gandhi Institute.\\nHistoriquement village agricole, Moka s’est graduellement transformée depuis 2008 en l’une des régions résidentielles les plus prisées du pays. Depuis 2017, le groupe ENL y développe une ville intelligente sous le cadre légal du Smart City Scheme."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%82%D8%A7%D9%88%D8%B1%DB%8C%D9%84%D8%A7_%D8%AF%D8%B1%DA%98%D8%A7%D9%88%DB%8C%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Derzhavin_by_Borovikovsky_%281811%2C_Pushkin_museum%29.jpg","page_title":"قاوریلا درژاوین","context_page_description":"قاوریلا درژاوین شاعیر و یازیچی - ۱۴ ژولای ۱۷۴۳ تاریخیندا دۆنیایا گؤز آچیب. ۷۳ ایل عومر ائله‌ییب و ۲۰ ژوئیه ۱۸۱۶ میلادی تاریخیندا وفات ائدیب."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BD%D5%A1%D5%B4%D5%A5%D5%BD_%D5%8C%D5%B8%D5%A4%D6%80%D5%AB%D5%A3%D5%A5%D5%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Brazil_and_Colombia_match_at_the_FIFA_World_Cup_2014-07-04_%2823%29.jpg","page_title":"Խամես Ռոդրիգես","context_page_description":"Խամես Դավիդ Ռոդրիգես Ռուբիո, հայտնի որպես Խամես Ռոդրիգես կամ պարզապես Խամես, կոլումբիացի ֆուտբոլիստ, ով խաղում է Ռեալ Մադրիդի կազմում և Կոլումբիայի ազգային հավաքականում։\\nԽաղում է և հարձակվողի և հարձակվողական կիսապաշտպանի դիրքում։ Խամեսը համարվում է աշխարհի լավագույն երիտասարդ ֆուտբոլիստներից մեկն աշխարհում: Ունի լավ տեխնիկա, դրիբլինգ և փլեյմեյքերի հմտություններ։\\n2014 թ. Խամեսը տեղափոխվեց Ռեալ Մադրիդ և դարձավ աշխարհում ամենաթանկ ֆուտբոլիստներից մեկը:\\nԽամեսն իր ելույթները Կոլումբիայի հավաքականում սկսել է մինչև 20 տարեկան հավաքականից, որտեղ նա ավագն էր Տուլուն մրցաշարի ընթացքում։ Նա նաև հավաքականի ավագն էր 2011 թվականի մինչև 20 տարեկանների աշխարհի առաջնությանը, որը նրան հնարավորություն տվեց դառնալ թիմի առանցքային ֆուտբոլիստներից մեկը։\\nՆա խաղաց նաև աշխարհի 2014 թվականի առաջնություն և լքեց պայքարը 1/4 եզրափակչից՝ պարտվելով Բրազիլիային 2-1 հաշվով։ 2012 թվականին Խամեսը միացավ Պորտուին և ճանաչվեց Պորտուգալիայի Պրեմիեր Լիգայի լավագույն ֆուտբոլիստ՝ ստանալով պորտուգալական ոսկե գնդակը և դառնալով ամենաերիտասարդ ֆուտբոլիստը երբևէ, ով ստացել է այն։"},{"page_url":"https://en.wikipedia.org/wiki/Paleogeography_of_the_India%E2%80%93Asia_collision_system","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Misc_pollen_colorized.jpg","page_title":"Paleogeography of the India–Asia collision system","context_page_description":"The paleogeography of the India–Asia collision system is the reconstructed geological and geomorphological evolution within the collision zone of the Himalayan orogenic belt. The continental collision between the Indian and Eurasian plate is one of the world's most renowned and most studied convergent systems. However, many mechanisms remain controversial. Some of the highly debated issues include the onset timing of continental collision, the time at which the Tibetan plateau reached its present elevation and how tectonic processes interacted with other geological mechanisms. These mechanisms are crucial for the understanding of Mesozoic and Cenezoic tectonic evolution, paleoclimate and paleontology, such as the interaction between the Himalayas orogenic growth and the Asian monsoon system, as well as the dispersal and speciation of fauna. Various hypotheses have been put forward to explain how the paleogeography of the collision system could have developed. Important ideas include the synchronous collision hypothesis, the Lhasa-plano hypothesis and the southward draining of major river systems."},{"page_url":"https://vi.wikipedia.org/wiki/B%E1%BA%AFc_Trung_B%E1%BB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Bautro.jpg","page_title":"Bắc Trung Bộ","context_page_description":"Bắc Trung Bộ là phần phía bắc của Trung Bộ Việt Nam có địa bàn từ phía nam Ninh Bình tới phía bắc Đèo Hải Vân. Vùng Bắc Trung Bộ là một trong 7 vùng kinh tế được Chính phủ giao lập quy hoạch tổng thể kinh tế xã hội.\\nVề mặt quốc phòng thì các tỉnh này do Bộ Tư lệnh, Quân khu 4 trách nhiệm và quản lý."},{"page_url":"https://sv.wikipedia.org/wiki/Friedrich_von_Adelung","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/%D0%90%D0%B4%D0%B5%D0%BB%D1%83%D0%BD%D0%B3_%D0%A4%D1%91%D0%B4%D0%BE%D1%80_%D0%9F%D0%B0%D0%B2%D0%BB%D0%BE%D0%B2%D0%B8%D1%87.jpg","page_title":"Friedrich von Adelung","context_page_description":"Friedrich von Adelung, född den 25 februari 1768 i Stettin, död den 18 januari 1843, var en tysk språk- och hävdaforskare, brorson till Johann Christoph Adelung.\\nvon Adelung studerade i Leipzig, företog därefter under flera år arkivforskningar i Rom och bosatte sig slutligen i Sankt Petersburg, där han 1824 blev direktör för orientaliska institutet samt 1825 president för vetenskapsakademien. Han utgav åtskilliga skrifter av lingvistiskt och arkeologiskt innehåll, Bibliotheca sanscrita och Uebersicht aller bekannten Sprachen und ihrer Dialekte med flera, samt författade även flera arbeten om de utländska källorna till Rysslands historia."},{"page_url":"https://uz.wikipedia.org/wiki/Chattanooga_(Tennessee)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Chattanooga%2C_Tennessee.jpg","page_title":"Chattanooga (Tennessee)","context_page_description":"Chattanooga AQShning Tennessee shtatida joylashgan shahardir. Hamilton okrugi tarkibiga kiradi."},{"page_url":"https://es.wikipedia.org/wiki/Distrito_de_Rendsburg-Eckernf%C3%B6rde","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Wappen_Kreis_Rendsburg-Eckernfoerde.svg","page_title":"Distrito de Rendsburg-Eckernförde","context_page_description":"El Distrito de Rendsburg-Eckernförde es uno de los distritos con mayor superficie en el estado federado de Schleswig-Holstein en Alemania. La capital de distrito es la ciudad de Rendsburg."},{"page_url":"https://en.wikipedia.org/wiki/Tunguska_event","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Tunguska_and_Chelyabinsk_meteoroid_size.png","page_title":"Tunguska event","context_page_description":"The Tunguska event was a massive explosion that occurred near the Podkamennaya Tunguska River in Yeniseysk Governorate, Russia, on the morning of 30 June 1908. The explosion over the sparsely populated Eastern Siberian Taiga flattened an estimated 80 million trees over an area of 2,150 km² of forest, and eyewitness reports suggest that at least three people may have died in the event. The explosion is generally attributed to the air burst of a stony meteoroid about 100 metres in size. It is classified as an impact event, even though no impact crater has been found; the object is thought to have disintegrated at an altitude of 5 to 10 kilometres rather than to have hit the surface of the Earth.\\nOwing to the remoteness of the site and the limited instrumentation available at the time of the event, modern scientific interpretations of its cause and magnitude have relied chiefly on damage assessments and geological studies conducted many years after the fact. Studies have yielded different estimates of the meteoroid's size, of the order of 50 to 190 metres, depending on whether the body entered with a low or high speed."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%93%D1%83%D0%B4%D0%BB%D0%B0%D0%BD%D0%BA%D1%83%D1%80_%D0%BB%D0%B5_%D0%9F%D1%98%D0%B5%D1%80%D0%BF%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Goudelancourt-l%C3%A8s-Pierrepont_%28Aisne%29_mairie-%C3%A9cole.JPG","page_title":"Гудланкур ле Пјерпон","context_page_description":"Гудланкур ле Пјерпон насеље је и општина у североисточној Француској у региону Пикардија, у департману Ен која припада префектури Лаон.\\nПо подацима из 2011. године у општини је живело 152 становника, а густина насељености је износила 17,41 становника/km². Општина се простире на површини од 8,73 km². Налази се на средњој надморској висини од 105 метара."},{"page_url":"https://fr.wikipedia.org/wiki/Monument_d%27Archibald_Reiss","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/%D0%A1%D0%BF%D0%BE%D0%BC%D0%B5%D0%BD%D0%B8%D0%BA_%D0%90%D1%80%D1%87%D0%B8%D0%B1%D0%B0%D0%BB%D0%B4%D1%83_%D0%A0%D0%B0%D1%98%D1%81%D1%83_%28%D1%81%D0%B0%D0%BC%D0%BE_%D0%B1%D0%B8%D1%81%D1%82%D0%B0_%D0%BA%D1%80%D1%83%D0%BF%D0%BD%D0%B8%D1%98%D0%B5%29.jpg","page_title":"Monument d'Archibald Reiss","context_page_description":"Le monument d'Archibald Reiss, est un monument situé dans la municipalité de Savski venac et dans le parc de Topčider à Belgrade en Serbie. Il est inscrit sur la liste des monuments culturels protégés de la République de Serbie et sur la liste des biens culturels de la ville de Belgrade."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%92%B2%E5%8F%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/PoToi4.jpg","page_title":"蒲台","context_page_description":"蒲台島是香港離島區的蒲台群島的主要島嶼，面積達3.69平方公里。蒲台島位處香港的東南部。蒲台島地勢平坦，在海上看似一個浮台，蒲台島故得其名。"},{"page_url":"https://en.wikipedia.org/wiki/Grade_I_listed_buildings_in_Northamptonshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Harringworth_Cross_-_geograph.org.uk_-_138503.jpg","page_title":"Grade I listed buildings in Northamptonshire","context_page_description":"There are more than 9,000 Grade I listed buildings in England. This page is a list of these buildings in the county of Northamptonshire, by local government district."},{"page_url":"https://en.wikipedia.org/wiki/Massey_Lopes","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/LopesArms.png","page_title":"Massey Lopes","context_page_description":"Sir Lopes Massey Lopes, 3rd Baronet, PC, known as Massey Franco until 1831, of Maristow in the parish of Tamerton Foliot, Devon, was a British Conservative politician and agriculturalist."},{"page_url":"https://nl.wikipedia.org/wiki/Notre-Dame-des-Champs_(metrostation)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Metro_Paris_-_Ligne_12_-_Station_Notre-Dame-des-Champs_-_Quais.jpg","page_title":"Notre-Dame-des-Champs (metrostation)","context_page_description":"Notre-Dame-des-Champs is een station van de metro in Parijs langs metrolijn 12 in het 6de arrondissement. Het station is genoemd naar de Notre Dame de Champs in Montparnasse."},{"page_url":"https://fr.wikipedia.org/wiki/The_MUSSEL_project","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Anodonta_anatina1.jpg","page_title":"The MUSSEL project","context_page_description":"Le MUSSEL project est un projet scientifique, initié en 2003, consacré aux moules d'eau douce."},{"page_url":"https://cy.wikipedia.org/wiki/Hever,_Caint","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Hever_Church.JPG","page_title":"Hever, Caint","context_page_description":"Pentref a phlwyf sifil ar lan afon Eden yng Nghaint, De-ddwyrain Lloegr, ydy Hever. Fe'i lleolir yn ardal an-fetropolitan Sevenoaks.\\nMae'r plwyf yn cynnwys pentrefi Four Elms, Hever ei hun, a Markbeech, ac roedd ei boblogaeth yn 2011 yn 1,136."},{"page_url":"https://pt.wikipedia.org/wiki/Su%C3%A1bia_(Baviera)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Augsburg_Fronhof_Alter_Bischofssitz.jpg","page_title":"Suábia (Baviera)","context_page_description":"A Suábia é uma região administrativa do Estado alemão da Baviera, cuja capital é a cidade de Augsburgo.\\nA Suábia é uma região histórica da Alemanha com um dialecto local chamado schwäbisch, ou suábio. O território histórico abrangia grande parte do estado de Baden-Württemberg bem como a região administrativa bávara da Suábia. Na Idade Média, a maioria da actual Suíça e da Alsácia também faziam parte da Suábia."},{"page_url":"https://es.wikipedia.org/wiki/Antoine_Duhamel","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Antoine_Duhamel_at_the_Cin%C3%A9math%C3%A8que_fran%C3%A7aise.jpg","page_title":"Antoine Duhamel","context_page_description":"Antoine Duhamel fue un compositor, director de orquesta y profesor de música francés."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%A4%A9%E7%A5%9E%E7%A4%BE_(%E5%A5%88%E8%89%AF%E5%B8%82%E9%AB%98%E7%95%91%E7%94%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Naramachi_Tenjin_Reisai_Togyo_Nara_4.jpg","page_title":"天神社 (奈良市高畑町)","context_page_description":"天神社は、奈良県奈良市高畑町にある神社。奈良町天神社とも呼ばれる。北天満の天神社で、境内地は約1,000平方メートル。"},{"page_url":"https://it.wikipedia.org/wiki/Half-adder","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Figura_HA.jpg","page_title":"Half-adder","context_page_description":"L'half adder, detto anche semisommatore, è un componente elettronico digitale che esegue la somma di due bit A e B e la presenta sull'uscita S; inoltre viene calcolato anche il riporto C, senza tener conto però di un riporto precedente. La somma binaria di due bit si calcola allo stesso modo della somma di due numeri decimali, per cui il riporto è generato se e solo se i due addendi sono pari a 1. L'insieme di due half-adder e una porta logica OR, opportunamente collegati, restituisce un full-adder.\\nLa seguente tabella della verità mostra la relazione tra gli ingressi e le uscite dell'unità.\\nIl circuito è costituito, di conseguenza, da una porta AND e una porta XOR."},{"page_url":"https://de.wikipedia.org/wiki/Danville_(Illinois)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Danville_Public_Library_%28Illinois%29.png","page_title":"Danville (Illinois)","context_page_description":"Danville ist eine Stadt mit 31.597 Einwohnern in Illinois. Sie liegt 52 km östlich von Champaign, 132 km nordwestlich von Indianapolis, 191 km südlich von Chicago, 178 km südöstlich von Peoria, 175 km nordöstlich von Springfield und 276 km nordöstlich von St. Louis in deren Ballungsraum und gehört zum Vermilion County, dessen County Seat Danville innehat.\\nAbraham Lincoln praktizierte von 1841 bis 1859 als Anwalt in Danville. Die Schauspieler Dick Van Dyke und Jerry Van Dyke wuchsen in der Stadt auf, Gene Hackman verbringt hier seinen Ruhestand."},{"page_url":"https://id.wikipedia.org/wiki/Kabinet_Indonesia_Maju","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/KIM_Airlangga_Hartato.jpg","page_title":"Kabinet Indonesia Maju","context_page_description":"Kabinet Indonesia Maju adalah kabinet pemerintahan Indonesia pimpinan Presiden Joko Widodo dan Wakil Presiden Ma'ruf Amin. Susunan kabinet ini berasal dari kalangan profesional, usulan partai politik pengusung pasangan Jokowi-Amin pada Pilpres 2019 yang tergabung dalam Koalisi Indonesia Kerja ditambah Partai Gerindra yang bergabung setelahnya, serta tim sukses pasangan Jokowi-Amin pada Pilpres 2019. Susunan kabinet diumumkan oleh Presiden Jokowi pada 23 Oktober 2019 dan resmi dilantik pada hari yang sama. Presiden Jokowi dan Wapres Ma'ruf Amin membacakan susunan kabinetnya di pelataran tangga Istana Negara. Dalam kesempatan itu, Jokowi menghadirkan para menterinya yang mengenakan kemeja batik. Kabinet Indonesia Maju terdiri dari 4 menteri koordinator dan 30 menteri."},{"page_url":"https://hsb.wikipedia.org/wiki/Zadr%C4%9Bwkaty_drapalc","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Dipsacus_laciniatus_MHNT.BOT.2013.22.48.jpg","page_title":"Zadrěwkaty drapalc","context_page_description":"Zadrěwkaty drapalc je rostlina ze swójby drapalcowych rostlinow."},{"page_url":"https://ru.wikipedia.org/wiki/Citro%C3%ABn_Traction_Avant","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Citroen_Traction_Avant_body-chassis_unit_%28Autocar_Handbook%2C_13th_ed%2C_1935%29.jpg","page_title":"Citroën Traction Avant","context_page_description":"Citroën Traction Avant — один из первых в мире серийных переднеприводных автомобилей с несущим кузовом, выпускавшийся французским автопроизводителем Citroën с 1934 по 1957 годы.\\n«Traction Avant», что по-французски и означает «передний привод», был спроектирован Андре Лефебром и Фламинио Бертони в конце 1933 — начале 1934 гг. Автомобиль был одним из наиболее успешных с передним приводом в 1940-х годах.\\nВсего было изготовлено около 760 тыс. автомобилей."},{"page_url":"https://sv.wikipedia.org/wiki/Eritrea","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/EritreaInstituteOfTechnology.jpg","page_title":"Eritrea","context_page_description":"Eritrea, formellt Staten Eritrea, är en stat i Östafrika, vid Röda havet. Landet gränsar till Djibouti, Etiopien och Sudan. Namnet Eritrea kommer från den grekiska benämningen för Röda havet, Erythra thalassa. Asmara är Eritreas huvudstad.\\nEritrea utropade sin självständighet från Etiopien den 29 maj 1991 och fick sin självständighet erkänd den 24 maj 1993. Landet är presidentiell republik och har haft samma president sedan självständigheten, Isaias Afewerki, som är både stats- och regeringschef samt talman i landets parlament. Eritrea har inte hållit några allmänna val sedan landet blev självständigt och inga politiska partier förutom partiet som presidenten tillhör, Folkets front för demokrati och rättvisa, är tillåtna i landet. Landet har det sjunde lägsta HDI-värdet 2018 av samtliga länder, den tredje lägsta rankningen om pressfrihet av Reportrar utan gränser, plats 177 av 180 på Heritage Foundation och The Wall Street Journals index över ekonomisk frihet. 2020 uppskattas landet ha en BNP per capita på cirka $1300 amerikanska dollar."},{"page_url":"https://en.wikipedia.org/wiki/Potito_Starace","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/PotitoStarace.jpg","page_title":"Potito Starace","context_page_description":"Potito Starace is an Italian retired professional tennis player on the ATP Tour. He achieved a career-high singles ranking of world no. 27 on October 15, 2007. He was a clay court specialist, and was coached by Umberto Rianna.\\nStarace was banned from tennis for life by the Italian Tennis Federation and by the Tennis Integrity Unit for betting offences."},{"page_url":"https://en.wikipedia.org/wiki/Jarra_Central","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f6/Lower_River_districts.png","page_title":"Jarra Central","context_page_description":"Jarra Central is one of the six districts of the Lower River Division of the Gambia."},{"page_url":"https://de.wikipedia.org/wiki/Lautignac","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/35/Mairielautignac.jpg","page_title":"Lautignac","context_page_description":"Lautignac ist eine französische Gemeinde mit 271 Einwohnern im Département Haute-Garonne in der Region Okzitanien. Lautignac gehört zum Arrondissement Muret und zum Kanton Cazères. Die Einwohner werden Altinacois und Lautignacais genannt."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Dreitausender_in_der_Silvretta","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Pass_Futsch%C3%B6l_Fluchthorn.jpg","page_title":"Liste der Dreitausender in der Silvretta","context_page_description":"Die Liste der Dreitausender in der Silvretta listet alle Dreitausender der Silvretta in der Schweiz und Österreich auf.\\nDie sortierbare Tabelle enthält neben der Höhe und der genauen Lage auch die Parameter Dominanz und Schartenhöhe. In der Tabelle werden sämtliche Gipfel über 3000 Meter Höhe berücksichtigt, die eine Schartenhöhe von mindestens 70 Metern aufweisen. Weitere Dreitausender mit weniger als 70 m Schartenhöhe finden sich unterhalb der Tabelle."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B5%D5%B2%D5%A5%D5%A3%D5%AB%D5%BD%D5%AB_%D5%BA%D5%A1%D5%BF%D5%B4%D5%B8%D6%82%D5%A9%D5%B5%D5%A1%D5%B6_%D6%87_%D5%B4%D5%B7%D5%A1%D5%AF%D5%B8%D6%82%D5%B5%D5%A9%D5%AB_%D5%A1%D5%B6%D5%B7%D5%A1%D6%80%D5%AA_%D5%B0%D5%B8%D6%82%D5%B7%D5%A1%D6%80%D5%B1%D5%A1%D5%B6%D5%B6%D5%A5%D6%80%D5%AB_%D6%81%D5%A1%D5%B6%D5%AF_(%D5%8E%D5%A1%D5%B5%D5%B8%D6%81_%D5%B1%D5%B8%D6%80%D5%AB_%D5%B4%D5%A1%D6%80%D5%A6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Hermon_Monastery_12.JPG","page_title":"Եղեգիսի պատմության և մշակույթի անշարժ հուշարձանների ցանկ (Վայոց ձորի մարզ)","context_page_description":"Այս հոդվածը ներկայացնում է Վայոց ձորի մարզի Եղեգիս գյուղի պատմության և մշակույթի հուշարձանների ցանկը, որը 2002 թ․ հաստատվել է ՀՀ կառավարության կողմից։ Ցանկում ներառված է ընդամենը 101 հուշարձան ։"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D1%82%D0%B8%D1%86_%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Northern_Shrike%2C_Arvada%2C_Jefferson%2C_Colorado.jpg","page_title":"Список птиц Украины","context_page_description":"Список птиц Украины — список всех видов птиц, которые были зарегистрированы на территории Украины."},{"page_url":"https://fr.wikipedia.org/wiki/Gare_de_Rouffach","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Gare_de_Rouffach_2.jpg","page_title":"Gare de Rouffach","context_page_description":"La gare de Rouffach est une gare ferroviaire française de la ligne de Strasbourg-Ville à Saint-Louis, située sur le territoire de la commune de Rouffach dans le département du Haut-Rhin en région Grand Est.\\nElle est mise en service en 1841 par la Compagnie du chemin de fer de Strasbourg à Bâle. C'est une halte voyageurs de la Société nationale des chemins de fer français du réseau TER Grand Est, desservie par des trains express régionaux."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1978","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6c/Kevin_Hulsmans.jpg","page_title":"Lijst van personen geboren in 1978","context_page_description":"Dit is een lijst van personen die geboren zijn in 1978.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://hr.wikipedia.org/wiki/Ahemenidsko_Perzijsko_Carstvo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Statue_darius.jpg","page_title":"Ahemenidsko Perzijsko Carstvo","context_page_description":"Ahemenidsko Perzijsko Carstvo bilo je prvo Perzijsko Carstvo koje je od 550. do 330. pr. Kr. obuhvaćalo prostor Velikog Irana, odnosno druga iranska carska dinastija. Na vrhuncu svoje moći iransko Ahemenidsko Carstvo protezalo se na 10,7 milijuna km² što ga čini najvećim carstvom u povijesti starog vijeka. Također, carstvo je u to doba obuhvaćalo oko 46% svjetske populacije.\\nAhemenidsko Perzijsko Carstvo osnovao je Kir Veliki koji ga je proširio na veći dio azijskog dijela Bliskog istoka, dok su ga njegovi nasljednici Kambiz II. i Darije Veliki proširili i na Afriku odnosno Europu, što ga čini prvim carstvom koje se protezalo na tri kontinenta. Teritorij carstva osim Irana obuhvaćao je dijelove današnje Indije i Pakistana, područja Središnje Azije, Male Azije, Trakije, veći dio obala Crnog mora, Mezopotamiju, sjever Arapskog poluotoka, Levant, Siriju, te sjeveroistočni dio Afrike uključujući Egipat, Libiju, Sudan i Etiopiju."},{"page_url":"https://de.wikipedia.org/wiki/Boriwo_de_Tarant","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/30/RomanischerGrabsteinFoerdergersdorf280310FotoAndreKaiser.JPG","page_title":"Boriwo de Tarant","context_page_description":"Boriwo de Tarant, auch Boriwo de Tharant, war Burgvogt von Tharandt.\\nBoriwo soll zumindest bis zum Schiedsspruch des Markgrafen von Meißen zwischen dem Meißner Bischof und dem Burggrafen von Dohna um die Burg Thorun von 1206 Vasall des Meißner Bischofs mit einem Herrensitz in Grumbach und auf dem Rittergut Kleinopitz gewesen sein.\\nUrkundlich erwähnt wurde er 1216 bis 1242. Als Vasall des Markgrafen von Meißen, Dietrichs des Bedrängten, war er Burghauptmann der Tharandter Burg, die errichtet wurde, um die Gebietsansprüche der Wettiner gegen die Burggrafen von Dohna mit Wehranlagen in Rabenau und Ruppendorf durchzusetzen. Jene beherrschten das Weißeritz- und Müglitzgebiet und versuchten ebenfalls weitere Gebiete zu besiedeln, indem sie Waldhufendörfer auch nördlich der Weißeritz anlegen ließen.\\nDie genaue Entstehungszeit der Tharandter Burg ist nicht bekannt, jedoch ist zu vermuten, dass sie zwischen 1206 und 1215 errichtet wurde, da sie am 21. Januar 1216 mit Boriwo de Tarant erstmals urkundlich erwähnt wird. Am 9."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%95%D7%9C%D7%93%D7%A1%D7%9E%D7%95%D7%91%D7%99%D7%9C_%D7%A1%D7%98%D7%90%D7%A8%D7%A4%D7%99%D7%99%D7%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/1962_Oldsmobile_Starfire_Convertible%2C_front_left%2C_Greenwich_2018.jpg","page_title":"אולדסמוביל סטארפייר","context_page_description":"אולדסמוביל סטארפייר היא מכונית קופה מתוצרת חטיבת הרכב אולדסמוביל בקונצרן הרכב האמריקאי ג'נרל מוטורס, אשר יוצרה בין השנים 1960–1966, ובין השנים 1974–1980 בארצות הברית וקנדה.\\nמלבד לשם הדגם \\"אולדסמוביל סטארפייר\\" וליצרן \\"אולדסמוביל\\" לא היה כל קשר במבנה, במפרט, במכלולים, בעיצוב, ובמנוע בין הדגמים שיוצרו ב-2 הדורות. הדור השני יוצר 8 שנים לאחר סיום ייצור הדור הראשון. דגמי הדור הראשון הוגדרו \\"Full-size car\\", לעומת דגם הדור השני שהוגדר כ\\"סוב-קומפקטי\\"."},{"page_url":"https://ja.wikipedia.org/wiki/GD-%E9%AB%98%E9%80%9F%E9%81%93%E8%B7%AF%E3%82%B4%E3%82%B7%E3%83%83%E3%82%AFJA","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Tomei_Expwy_Route_Sign.svg","page_title":"GD-高速道路ゴシックJA","context_page_description":"GD-高速道路ゴシックJAは、コンピュータ用の無償のフォントセットの1つである。\\n本項では、このフォントセットのベースとなった、日本の高速道路の案内標識に用いられてきたオリジナルフォントについても記す。"},{"page_url":"https://ca.wikipedia.org/wiki/Kurabiye","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Ghorabiyeh.JPG","page_title":"Kurabiye","context_page_description":"Kurabiye és galeta en llengua turca. La paraula turca kurabiye és el nom genèric de totes les galetes tradicionals en la cuina turca i es reflecteix també en altres galetes com Cevizli kurabiye o Fındıklı kurabiye. Segons Sevan Nişanyan, etimòleg turc, la paraula ha evolucionat des de gul ab en llengua persa. La paraula original persa és un cert tipus de galeta amb ametlles i mantega. El mot persa qurabiya ha passat a diversos idiomes dels països de l'Orient Mitjà i el Caucas com l'àzeri, l'àrab, l'albanès, el grec o el búlgar."},{"page_url":"https://en.wikipedia.org/wiki/Spectroscopy","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/UVES_on_UT2-KUEYEN.jpg","page_title":"Spectroscopy","context_page_description":"Spectroscopy, is the study of the electromagnetic spectrum of a source of electromagnetic radiation. Generally the spectrum is the analysis, the decomposition of a physical quantity in the energy domain, or in the frequency, the wavelength, etc..\\nSpectroscopy is the study of the interaction between matter and electromagnetic radiation as a function of the wavelength or frequency of the radiation. Historically, spectroscopy originated as the study of the wavelength dependence of the absorption by gas phase matter of visible light dispersed by a prism. An elementary description of absorption, emission and scattering spectroscopy is given in Chapter 1 of a student level text book. We can also consider matter waves and acoustic waves as forms of radiative energy, and recently gravitational waves have been associated with a spectral signature in the context of the Laser Interferometer Gravitational-Wave Observatory."},{"page_url":"https://ko.wikipedia.org/wiki/%EA%B0%9C%EA%B8%88%EA%B3%A0%EB%93%B1%ED%95%99%EA%B5%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/%EA%B0%9C%EA%B8%88%EA%B3%A0%EB%93%B1%ED%95%99%EA%B5%90.jpg","page_title":"개금고등학교","context_page_description":"개금고등학교는 부산광역시 부산진구 개금동에 있는 공립 고등학교이다."},{"page_url":"https://en.wikipedia.org/wiki/Tr%C3%A4skofiol","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/X6029_-_Tr%C3%A4skofiol_-_ok%C3%A4nd_tillverkare_-_foto_Mikael_Bodner.jpg","page_title":"Träskofiol","context_page_description":"The träskofiol or clog fiddle is a traditional musical instrument from northern Skåne province, Sweden, consisting of a violin neck and soundboard added to the body of a clog wooden shoe.\\nThe instrument is one of the limited number of traditional instruments upon which musicians can play in competition for the Zorn Prize to be awarded the title of riksspelman."},{"page_url":"https://sk.wikipedia.org/wiki/1947","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Coelhopaulo26012007-1.jpg","page_title":"1947","context_page_description":"3. január – začatý dvojročný plán hospodárskej výstavby\\n25. február – rozhodnutím spojeneckej kontrolnej komisie oficiálne zaniká Pruský štát\\n1. marec – MMF začal finančné operacie\\n11. marec – vyhlásená Trumanova doktrína\\n5. jún – prvý raz formulovaná téza Marshallovho plánu\\n7. jún – založený rumunský futbalový klub FC Steaua Bukurešť\\n11. júl – prijatý zákon č. 149/1947 sb. o národnej bezpečnosti, ktorý okrem iného zriadil zložku ŠtB\\n15. august – vyhlásená slobodná rozdelená India\\n11. september – podpísaná konvencia o WMO\\n18. september – oficiálny vznik americkej Ústrednej spravodajskej služby CIA\\n14. október – Chuck Yeager na experimentálnom lietadle Bell X-1 ako prvý prekročil rýchlosť zvuku\\n20. november – britská princezná Elisabeth si vo Westminsterskom opátstve v Londýne vzala gréckeho princa Philipa Mountbattena, ktorý sa stal vojvodom z Edinburghu\\n29. november – Valné zhromaždenie OSN prijalo plán na rozdelenie Palestíny medzi Židov a Arabov\\nZaložená Medzinárodná organizácia pre normalizáciu"},{"page_url":"https://sh.wikipedia.org/wiki/Manastir_Horezu","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Horezu_gate_interior.jpg","page_title":"Manastir Horezu","context_page_description":"Manastir Horezu osnovao je vlaški knez Constantin Brâncoveanu u mjestu Horezu, u vlaškom dijelu Rumunjske 1690. godine. On se smatra remek-djelom tzv. \\"Brankovanskog stila\\" koji je poznat po arhitektonskoj čistoći i ravnoteži, bogatstvu plastičnih ukrasa, tretmanu vjerskih kompozicija, votivnim portretima i oslikanim dekoracijama.\\n„Brankovanski stil, koji se može pronaći na više crkava i samostana u Vlaškoj, je jedini pravi i originalni rumunjski stil. Nazvan je prema vladaru koji je u vremenu kada je njegova država bila u neprestanim sukobima s velikim Silama svog vremena, stavio kulturni razvoj zemlje ispred svega ostalog i učinio ga svojim životnim ciljem.“\\nŠkola zidnog i ikono-slikarstva koja je osnovana u manastiru Horezu u 18. stoljeću je postala slavna na cijelom Balkanu. Manastir je teško stradao u Austrijsko-Turskom i Rusko-Turskom ratu kada su sve građevine izvan manastirskih zidina uništene."},{"page_url":"https://fr.wikipedia.org/wiki/%C5%A0enov_u_Nov%C3%A9ho_Ji%C4%8D%C3%ADna","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/%C5%A0enov_NJ_1.JPG","page_title":"Šenov u Nového Jičína","context_page_description":"Šenov u Nového Jičína est une commune du district de Nový Jičín, dans la région de Moravie-Silésie, en Tchéquie. Sa population s'élevait à 2 073 habitants en 2017."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A8%D8%AF%D9%84%DB%8C%D8%8C_%D9%86%D9%88%D8%B1%D8%AB%E2%80%8C%D9%87%D9%85%D9%BE%D8%AA%D9%88%D9%86%E2%80%8C%D8%B4%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Badby-Church_Hill_-_geograph.org.uk_-_933599.jpg","page_title":"بدلی، نورث‌همپتون‌شر","context_page_description":"بدلی، نورث‌همپتون‌شر یک روستا و محله مدنی در بریتانیا است که در دونتری واقع شده‌است. بدلی ۶۳۲ نفر جمعیت دارد."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_familles_contemporaines_de_la_noblesse_belge","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Armes_de_Kervyn.png","page_title":"Liste des familles contemporaines de la noblesse belge","context_page_description":"Cette liste des familles contemporaines de la noblesse belge ne retient que les familles subsistantes faisant partie officiellement de la noblesse belge avec un principe légal de noblesse héréditaire, à l'exclusion des familles de nationalité belge de noblesse non reconnue ou de noblesse étrangère n'ayant pas introduit une requête d'incorporation dans la noblesse auprès de S.M. le roi des Belges.\\nCette liste non exhaustive est reprise de façon plus complète dans l’État présent de la noblesse belge, qui, quoiqu'il ne soit pas une publication officielle, n'en présente pas moins, malgré certaines erreurs, un caractère relativement fiable."},{"page_url":"https://tr.wikipedia.org/wiki/Callan_McAuliffe","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Callan_McAuliffe_at_the_Chivas_Regal_GQ_Men_of_the_Year_Awards%2C_November_2012.jpg","page_title":"Callan McAuliffe","context_page_description":"Callan Ryan Claude McAuliffe Avustralya'lı aktör, Bryce Loski rolleri ile tanınan Flipped filmi ve Sam Goode'un I Am Number Four, Amerikan uzun metrajlı filmleri. Genç 2013 yılında Muhteşem Gabsty filminde göründü. Kasım 2013'te McAuliffe'nin UNICEF Avustralya'ya ulusal büyükelçisi olarak katılacağı açıklandı."},{"page_url":"https://cs.wikipedia.org/wiki/Kol%C3%ADnsk%C3%A9_t%C5%AFn%C4%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Kolinske_tune_6.JPG","page_title":"Kolínské tůně","context_page_description":"Kolínské tůně je přírodní památka ev. č. 861, která se nachází východně od města Kolín v okrese Kolín vzniklá na slepém rameni Labe, které původně bylo meandrem. Památka je tvořena jednou větší a jednou menší tůní. Správa AOPK Praha.\\nDůvodem ochrany je lokalita vodní flóry a fauny. Botanický průzkum z roku 1986 na místě zaznamenal 157 druhů vyšších rostlin, z toho tři chráněné. Jde o stulík žlutý, leknín bílý a kosatec žlutý. V oblasti roste také silně ohrožená jarva žilnatá."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_d%27%C5%93uvres_d%27Andrea_Mantegna","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/St._Lucas_altarpiece.jpg","page_title":"Liste d'œuvres d'Andrea Mantegna","context_page_description":"La liste d'œuvres d'Andrea Mantegna présente, dans la mesure du possible et dans l'état actuel des connaissances, un panorama chronologique en images des peintures, fresques, dessins et gravures du peintre renaissant Andrea Mantegna, qui vécut principalement à Padoue puis Mantoue."},{"page_url":"https://pl.wikipedia.org/wiki/Dyskografia_Aleksa_Christensena","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Alex_C.jpg","page_title":"Dyskografia Aleksa Christensena","context_page_description":"Dyskografia Aleksa Christensena – niemieckiego muzyka – obejmuje album studyjny, live miks, dziesięć singli i teledysków."},{"page_url":"https://pt.wikipedia.org/wiki/Cemit%C3%A9rio_Municipal_de_Bra%C3%A7o_do_Norte","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/Palco_Multiuso_-_Enerzon_Xuxa_Harger.jpg","page_title":"Cemitério Municipal de Braço do Norte","context_page_description":"O Cemitério Municipal de Braço do Norte é um cemitério localizado em Braço do Norte.\\nOs primeiros sepultamentos ocorreram em 1951, quando foi iniciada a trasladação dos restos mortais do antigo cemitério, localizado na rua atrás da casa paroquial de Braço do Norte. Na segunda metade da década de 1970 alguns sepultamentos do cemitério luterano de Braço do Norte foram transferidos para o Cemitério Municipal de Braço do Norte, quando houve um plano de urbanização da região onde o então cemitério luterano estava localizado. Sem preocupação nem compromisso das autoridades com a preservação da história, foram demolidos a igreja luterana e seu cemitério contíguo."},{"page_url":"https://ast.wikipedia.org/wiki/San_Antonio_Spurs","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Spurs_vs._Lakers.jpg","page_title":"San Antonio Spurs","context_page_description":"San Antonio Spurs ye un equipu de baloncestu de la NBA con base en San Antonio, Texas. Xueguen de llocal nel AT&T Center y utilicen indumentaria blanca y negra.\\nLos Spurs son l'únicu equipu procedente de l'ABA capaz de ganar un aniellu de campeón de la NBA, consiguiéndolo en cinco causes. Anguaño ye l'equipu con meyor porcentaxe de victories de la hestoria de la lliga, con casi un 62%, y col títulu de 2014, son l'equipu con meyor porcentaxe de victories nes Finales de la NBA Finales de la NBA. Desque llegaron a la NBA en 1976, San Antonio solo perdióse los playoffs en cuatro causes.\\nNos sos trenta y nueve temporaes na NBA los Spurs llograron venti títulos de división, siendo l'equipu que más títulos de división llogró nestos trenta y nueve años, siguíu de los Lakers con catorce. Son l'únicu equipu de la NBA con un récor empatáu o meyor contra cualquier equipu activu en temporada regular.\\nEn 2015, el tríu formáu por Tony Parker, Emanuel Ginóbili y Tim Duncan convertir nel tríu de xugadores que más partíos xugaron xuntos na hestoria de la NBA, superando al de los Boston Celtics de los años 80, formáu por Bird, Parish y McHale."},{"page_url":"https://cs.wikipedia.org/wiki/Prel%C3%A1t%C5%AFv_pramen","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Prel%C3%A1t%C5%AFv_pramen.JPG","page_title":"Prelátův pramen","context_page_description":"Prelátův pramen leží v Pottově údolí a jeho minerální vody jsou nejníže položenými prameny Mariánských Lázní. Zdejší slabě mineralizovaná kyselka je složením podobná Ambrožovým pramenům. Původní jímaní bylo v roce 1920 prohloubeno do hloubky 6 metrů a pramen byl následně vyveden pro uhličité koupele v lázních a také do přepadu v nově postaveném altánu.\\nOtevírací doba: Pramen je volně přístupný."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_ministres_sud-africains_de_l%27Eau","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Edna_Molewa.jpg","page_title":"Liste des ministres sud-africains de l'Eau","context_page_description":"Les ministres de l'Eau d'Afrique du Sud sont compétents pour tous les sujets relevant de la gestion de l'accès et de la ressource en eau ainsi que des installations sanitaires.\\nLe département ministériel de l'eau a été créé en 1912 et d'abord géré par le ministère des terres.\\nSes premiers titulaires prirent le titre de ministres de l'irrigation et furent chargés des barrages nationaux.\\nParfois associés ou dissociés du ministère des terres, des forêts ou de celui de l'agriculture, le département ministériel de l'hydrologie a gagné progressivement en autonomie. En 2009, il a été amalgamé avec le ministère de l'environnement dans le département de l'eau et des affaires environnementales.\\nDepuis mai 2014, il est de nouveau autonome en tant que ministère de l'eau et des affaires sanitaires\\nIl est situé au 185 Francis Baard Street à Pretoria."},{"page_url":"https://pl.wikipedia.org/wiki/Ja%C5%BAwiny_(wojew%C3%B3dztwo_podkarpackie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Zesp%C3%B3%C5%82_Szk%C3%B3%C5%82_w_Ja%C5%BAwinach.jpg","page_title":"Jaźwiny (województwo podkarpackie)","context_page_description":"Jaźwiny – wieś w Polsce położona w województwie podkarpackim, w powiecie dębickim, w gminie Czarna, w graniczącej z Pogórzem Ciężkowickim części Kotliny Sandomierskiej i Rynny Podkarpackiej. Wieś rozciąga się na niewielkim, bezleśnym wzniesieniu.\\nW latach 1975–1998 miejscowość administracyjnie należała do województwa tarnowskiego."},{"page_url":"https://de.wikipedia.org/wiki/Sainville","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Sainville-FR-28-%C3%A9glise-04.jpg","page_title":"Sainville","context_page_description":"Sainville ist eine französische Gemeinde mit 1.013 Einwohnern im Département Eure-et-Loir in der Region Centre-Val de Loire; sie gehört zum Arrondissement Chartres und ist Teil des Kantons Auneau."},{"page_url":"https://sv.wikipedia.org/wiki/Berliner_Verkehrsbetriebe","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Stra%C3%9Fenbahn_Berlin_GT6N.jpg","page_title":"Berliner Verkehrsbetriebe","context_page_description":".\\nBerliner Verkehrsbetriebe, BVG, är Berlins kommunala lokaltrafikbolag. BVG bedriver Berlins tunnelbana, Berlins spårväg samt mesta delen av den lokala busstrafiken. Det är Tysklands största lokaltrafikbolag."},{"page_url":"https://fr.wikipedia.org/wiki/USS_Darter_(SS-227)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/USS_Darter%3B227launch.jpg","page_title":"USS Darter (SS-227)","context_page_description":"L'USS Darter (SS-227) est un sous-marin de classe Gato construit pour l'United States Navy pendant la Seconde Guerre mondiale.\\nConstruit au chantier naval Electric Boat de Groton dans le Connecticut, sa quille est posée le 20 octobre 1942, il est lancé le 6 juin 1943 ; parrainé par Mᵐᵉ E. B. Wheeler, épouse d’Edwin B. Wheeler, directeur du chantier naval Electric Boat ; et mis en service le 7 septembre 1943, sous le commandement du commander William Shirley Stovall, Jr.."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9F%D0%B8%D0%B2%D0%BE%D0%B2%D0%B0%D1%80%D0%BD%D0%B0_%D0%90%D1%80%D0%B8%D0%B0%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Proschekovo_pivo_Pilsner.jpg","page_title":"Пивоварна Ариана","context_page_description":"„Пивоварна Ариана“ АД е акционерно дружество – бивша пивоварна фабрика в София, България, основано през 1881 г. от братята Иржи Прошек и Богдан Прошек под името СД „Братя Прошекови“, и прекратило самостоятелното си съществуване през 2003 г., когато се влива в Загорка АД.\\nДружеството е правоприемник на Събирателно дружество „Братя Прошекови\\", Пивоварна фабрика „Витоша\\", Пивоварен завод „Софийско пиво“, Държавна фирма „Софийско пиво“. През 1996 г. дружеството се преименува в „Пивоварна Ариана“ АД, а през 2003 г. се влива в „Загорка“ АД.\\n."},{"page_url":"https://en.wikipedia.org/wiki/Application_Portability_Profile","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/APP_Service_Areas_and_the_Open-System_Environment.jpg","page_title":"Application Portability Profile","context_page_description":"The Application Portability Profile is a 1990s framework for Open-System Environment designed by the NIST for use by the U.S. Government. It contains a selected suite of specifications that defines the interfaces, services, protocols, and data formats for a particular class or domain of applications.\\nThe Application Portability Profile offers structure to \\"integrate US federal, national and international, and other specifications to provide the functionality necessary to accommodate the broad range of US federal information technology requirements.\\""},{"page_url":"https://de.wikipedia.org/wiki/Neil_Hamilton_(Schauspieler)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Neil_Hamilton_by_Russell_Ball.jpg","page_title":"Neil Hamilton (Schauspieler)","context_page_description":"James Neil Hamilton war ein US-amerikanischer Schauspieler."},{"page_url":"https://vo.wikipedia.org/wiki/%C5%A0akiai","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Sakiai_COA.gif","page_title":"Šakiai","context_page_description":"Šakiai binon zif in grafän: Marijampolė, in Lietuvän.\\nŠakiai labon belödanis 6 605."},{"page_url":"https://eo.wikipedia.org/wiki/Palmovino","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Gambia_palmwein.JPG","page_title":"Palmovino","context_page_description":"Palmovino signifas fermentitan palmosukon, alkoholan trinkaĵon faritan el diversaj palmoj en la tropikaj landoj. Ĝi aparte popularas en Barato kaj marborda Afriko.\\nLa produktado de palmovino el Arenga saccharifera [arenga sakariFEra] okazas el la vira florospadikoj ĉe unua apero de frukto, kiun oni vipas per bastoneto dum tri tagoj kaj poste oni detranĉas de la bazo. La elfluanta sukerriĉa suko gustas kiel freŝa mosto kaj ĝi baldaŭ iomete fermentiĝas, pro naturaj, enaeraj mikroorganismoj. Jam du horojn freŝa suko entenas ĝis 4 % da alkoholo. Per pli longa fermentado, ĝis unu tago, la palmovino akiras malpli dolĉan kaj pli fortan-acidan guston, kia plaĉas al kelkaj trinkantoj. Per eĉ pli daŭra fermentado la vino fariĝas vinagro. Palmovinon oni trinkas sufiĉe baldaŭ post produktado, ĉar ĉi trinkaĵo ne bone stokeblas.\\nĈinoj vivantaj sur hindiaj insuloj faras el tiu palmovino per distilado arakon.\\nAnkaŭ la florospadikoj de Cocos nucifera [kokos nukiFEra] donas agrable gustan sukon, kiu rapide fermentiĝas. Oni povas produkti per distilado 25 galjonojn da arko el 100 galjonoj da palmovino."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%B8%E0%B1%8D%E0%B0%AA%E0%B1%86%E0%B0%AF%E0%B0%BF%E0%B0%A8%E0%B1%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/EspDens2.jpg","page_title":"స్పెయిన్","context_page_description":"స్పెయిన్ దక్షిణ ఐరోపా ఖండంలోని ఇబెరియన్ ద్వీపకల్పంలో ఉన్న ఒక దేశము. దీని అధికార నామం రెయినో దే ఎస్పాన్యా. ఈ దేశ రాజధాని మాడ్రిడ్ నగరం. మధ్యధరా సముద్రంలోని బాలెరిక్ ద్వీపాలు, ఆఫ్రికన్ అట్లాంటిక్ తీరంలోని కానరీ ద్వీపాలు, రెండు నగరాలు, సెయుటా, మెలిల్ల, ఆఫ్రికాలోని ప్రధాన భూభాగంలో, అనేక పెద్ద ద్వీప సమూహాలు కూడా ఉన్నాయి. ఆఫ్రికన్ తీరానికి సమీపంలో అల్బొరాన్ సముద్రంలో చిన్న ద్వీపాలు స్పెయిన్ దేశంలో భాగంగా ఉన్నాయి. దేశం ప్రధాన భూభాగం దక్షిణ, తూర్పు సరిహద్దులలో మధ్యధరా సముద్రం, ఒక చిన్న భూభాగం సరిహద్దుగా గిబ్రాల్టర్, ఉత్తర, ఈశాన్య సరిహద్దులో ఫ్రాన్స్, అన్డోరా, బిస్కే, పశ్చిమ, వాయువ్య సరిహద్దులో పోర్చుగల్, అట్లాంటిక్ మహాసముద్రం ఉన్నాయి. ఆఫ్రికన్ దేశానికి, ఆఫ్రికన్ భూభాగం దాదాపు 5% జనాభా కానరీ ద్వీపాలు, సియుట, మెలిల్లలో కూడా సరిహద్దు కలిగి ఉన్న ఏకైక ఐరోప దేశంగా ఉంది.\\n5,05,990 చ.కి.మీ విస్తీర్ణంతో దక్షిణ ఐరోపాలో స్పెయిన్ అతి పెద్ద దేశం, పశ్చిమ ఐరోపా, ఐరోపా సమాఖ్యలో రెండవ అతిపెద్ద దేశం, ఐరోపా ఖండంలోని నాల్గవ అతిపెద్ద దేశంగా ఉంది. జనాభాలో యూరోప్ ఐరోపాలో ఐదవ అతిపెద్ద, ఐరోపా సమాఖ్యలో ఐదో స్థానంలో ఉంది. స్పెయిన్ రాజధాని, అతిపెద్ద నగరం మాడ్రిడ్. బార్సిలోనా, వాలెన్సియా, సెవిల్లె, బిల్బావు, మాలాగా వంటి ఇతర ప్రధాన పట్టణ ప్రాంతాలు ఉన్నాయి."},{"page_url":"https://sv.wikipedia.org/wiki/Gr%C3%BCnewaldvillan","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Gr%C3%BCnewaldvillan_February_2013_01.jpg","page_title":"Grünewaldvillan","context_page_description":"Grünewaldvillan är en villa vid Saltsjöpromenaden 8 i Saltsjöbaden i Nacka kommun, Stockholms län. Villan ritades 1893 av arkitekt Ferdinand Boberg och har därefter byggts om och till. Bland ägarna märks konstnären Isaac Grünewald som levde och verkade här mellan 1936 och 1946. Idag nyttjas villans stora ateljé och ytterligare några rum som konferens- och utställningslokaler."},{"page_url":"https://hu.wikipedia.org/wiki/Sariac-Magnoac","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Sariac-Magnoac_3.JPG","page_title":"Sariac-Magnoac","context_page_description":"Sariac-Magnoac település Franciaországban, Hautes-Pyrénées megyében. Lakosainak száma 153 fő. +/- Sariac-Magnoac Chélan, Mont-d’Astarac, Aries-Espénan, Betbèze, Castelnau-Magnoac, Casterets és Thermes-Magnoac községekkel határos."},{"page_url":"https://es.wikipedia.org/wiki/4-6-4","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/NYC_Hudson2.jpg","page_title":"4-6-4","context_page_description":"De acuerdo con la notación Whyte, las locomotoras del tipo 4-6-4 presentan una configuración con cuatro ruedas delanteras, seis ruedas motrices acopladas entre sí, y cuatro ruedas traseras. En Francia, donde este tipo de locomotoras se utilizó por primera vez, se conocen como Baltic, mientras que en la mayor parte de América del Norte se denominan Hudson.​"},{"page_url":"https://en.wikipedia.org/wiki/Pomacea_maculata","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Pomacea_insularum_shell_3.jpg","page_title":"Pomacea maculata","context_page_description":"Pomacea maculata is a species of large freshwater snail with an operculum, an aquatic gastropod mollusk in the family Ampullariidae, the apple snails.\\nCommon name of its synonymous name Pomacea insularum is the island applesnail.\\nTogether with Pomacea canaliculata it is the most invasive species of the family Ampullariidae. It is considered as about the 58th the worst alien species in Europe."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%97%A5%E6%9C%AC%E5%9C%8B%E9%90%B5EF30%E5%9E%8B%E9%9B%BB%E5%8A%9B%E6%A9%9F%E8%BB%8A","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/JNR_truck_DT117.jpg","page_title":"日本國鐵EF30型電力機車","context_page_description":"EF30型電力機車是日本國有鐵道的電力機車車型之一，也是世界上第一種投入量產和運用的交直流兩用電力機車，適用於供電制式為1500伏直流電和20千伏60赫茲的工頻單相交流電的電氣化鐵路， 由三菱電機、新三菱重工業於1960年研製成功。"},{"page_url":"https://war.wikipedia.org/wiki/Thessaloniki","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/75/Thessaloniki_Municipal_Flag.png","page_title":"Thessaloniki","context_page_description":"An Thessaloniki o Tesalonica amo an kapital ha periferya han Butnga nga Macedonia ha nasod han Gresya."},{"page_url":"https://eu.wikipedia.org/wiki/Yorkeko_katedrala","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/York_Minster_from_M%26S.JPG","page_title":"Yorkeko katedrala","context_page_description":"Yorkeko katedrala Ingalaterrako iparraldean dagoen Iparraldeko Yorkshire konderriko York hiriko katedral gotiko bat da."},{"page_url":"https://fr.wikipedia.org/wiki/Litt%C3%A9rature_britannique","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/William_Shakespeare_Chandos_Portrait.jpg","page_title":"Littérature britannique","context_page_description":"La littérature britannique désigne la littérature du Royaume-Uni, de l'île de Man et des Îles Anglo-Normandes. Elle comprend la littérature anglaise, d'Irlande du Nord, écossaise et galloise. Par extension on peut aussi y inclure la littérature produite dans l'ensemble des îles Britanniques, c'est-à-dire également la littérature irlandaise, bien que cette question puisse prêter à controverse. En effet les écrivains irlandais ont joué un rôle important dans le développement de la littérature en Angleterre et en Écosse, et l'Irlande a été associée à la Grande-Bretagne au sein d'une même entité politique, le Royaume-Uni de Grande-Bretagne et d'Irlande pendant la totalité du XIXᵉ siècle et jusqu'à la fin de 1922, correspondant à une période de productivité littéraire intense.\\nUne vaste majorité de la littérature britannique a été écrite en langue anglaise, cette dernière tendant à s'étendre géographiquement en raison de son utilisation dans les anciennes colonies britanniques."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8C%97%E5%90%8D%E5%8F%A4%E5%B1%8B%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Kodenji.jpg","page_title":"北名古屋市","context_page_description":"北名古屋市は、愛知県の北西部に位置する市。"},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D0%B5%D0%B9%D0%BB%D0%B5%D0%BC_(%D0%90%D1%80%D1%8D%D0%B3%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/ORCap3.JPG","page_title":"Сейлем (Арэгон)","context_page_description":"Сейлем, Салем — горад на паўночным захадзе ЗША, адміністрацыйны цэнтр штата Арэгон. Насельніцтва 154,6 тыс. чалавек. Сейлем знаходзіцца ў паўночна-цэнтральнай частцы даліны Віламет, у акругах Мэрыян і Полк. Праз горад праходзіць 45-я паралель паўночнай шыраты. Згодна з бюро перапісу насельніцтва ЗША, агульная плошча горада — 120 км², з якіх: 118,4 км² — зямля і 1,6 км² — вада."},{"page_url":"https://en.wikipedia.org/wiki/Acer_negundo","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Acer_negundo_2018-05-01_9940.jpg","page_title":"Acer negundo","context_page_description":"Acer negundo, the box elder, boxelder maple, Manitoba maple or ash-leaved maple, is a species of maple native to North America. It is a fast-growing, short-lived tree with opposite, compound leaves. It is sometimes considered a weedy or invasive species, and has been introduced to and naturalized throughout much of the world, including in South America, Australia, New Zealand, South Africa, much of Europe, and parts of Asia."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_municipis_de_les_Illes_F%C3%A8roe","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Nor%C3%B0rag%C3%B8ta%2C_Faroe_Islands_%282%29.JPG","page_title":"Llista de municipis de les Illes Fèroe","context_page_description":"En la divisió administrativa de les Illes Fèroe de l'1 de gener de 2019 hi consten 29 municipis, amb al voltant de 120 poblacions.\\nA les darreres dècades la tendència ha estat la reducció de municipis, ja que fins al 31 de desembre del 2004 hi va haver 48 municipis a tot l'arxipèlag, i fins al 31 de desembre del 2008 n'hi va haver 34. En els propers anys, es preveu que el nombre de municipis a les Fèroe disminueixi encara més a causa de la despoblació d'algunes zones i a la redistribució dels serveis. Des del començament dels anys 1990, diversos governs han volgut reduir el nombre de municipis. El 1998, una comissió designada pel govern va proposar un requisit mínim recomanat de 2.000 residents per existir com a municipi independent. Tanmateix, el govern feroès ha decidit no realitzar agregacions forçades, i deixa el procés a la lliure voluntat dels municipis.\\nEls municipis de les Illes Fèroe formen part de l'organització Kommunufelagið, creada el 2014 fruit de la unió de les associacions Føroya Kommunufelag i Kommunusamskipan Føroya."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_lic%C3%A8nids_de_la_pen%C3%ADnsula_Ib%C3%A8rica_i_Balears","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Polyommatus_violetae_en_Onobrychis_argentea.jpg","page_title":"Llista de licènids de la península Ibèrica i Balears","context_page_description":"En aquesta llista de licènids de la península Ibèrica i Balears hi figuren la totalitat de les espècies de licènids que es poden trobar a la península Ibèrica i les Illes Balears, així com la seva distribució al món, la seva localització al territori peninsular i balear, el seu hàbitat i el seu estat de conservació."},{"page_url":"https://eo.wikipedia.org/wiki/Riederalp","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8f/Riederalp.jpg","page_title":"Riederalp","context_page_description":"Riederalp estas komunumo en la distrikto Orienta Rarono en Kantono Valezo, Svislando. Ĝi havis 529 loĝantojn je la 31-a de decembro 2012."},{"page_url":"https://sh.wikipedia.org/wiki/Nuklearna_fisija","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/ThermalFissionYield.svg","page_title":"Nuklearna fisija","context_page_description":"Nuklearna fisija je ona vrsta nuklearne reakcije, koja nastaje kad se jezgra atoma nekog kemijskog elementa cijepa na dva fisijska produkta ilifisiona fragmenta sličnih masa, uz emisiju jednog ili više neutrona, te velike količine energije. Tijekom procesa fisije dolazi do oslobađanja energije, jer je manje energije potrebno za formiranje dvije lakše jezgre nego jedne teže jezgre. Spontana fisija jezgre događa se vrlo sporo, no kod nekih teških jezgri moguće je inicirati bržu reakciju fisije djelovanjem sporih neutrona s tom jezgrom. Takve jezgre koje su podložne fisiji sporim neutronima nazivamo fisilnim jezgrama. Osim jezgara izotopa uranija-233 i uranija-235, te plutonija-239, fisibilna je i jezgra izotopa plutonija-241. Jedini fisilni izotop koji postoji u prirodi je izotop uranija-235. Energija oslobođena fisijom uranija-235 iznosi približno 200 MeV. Dvije lakše jezgre koje nastaju fisijom radioaktivne su i zovu se fisijski fragmenti ili fisijski produkti.\\nDa bi se nuklearna fisija mogla koristiti kao energetski izvor potrebno je stvoriti uvjete u kojima će se ta reakcija događati kontinuirano."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%AA%D8%A7%D8%B4%DA%A9%D9%86%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Tashkent_History_1965.jpg","page_title":"تاشکند","context_page_description":"تاشکند — اوزبکیستانین باشکندی. مساحتی ۳۳۴،۸ کیلومتر مۆربع و اهالی‌سی ۲،۲ میلیون نفردیر. مرکزی آسیادا یئرآلتی متروسو اوْلان تکجه شهردیر.\\nشهرین سو احتیاجلارینی تأمین ائتمک اۆچون اونون یاخین‌لیغیندا دوزَلمیش جاوراک گؤلو یارادیلمیش‌دیر. ۲۰۰۹-جو ایله اوْلان بیلگیلره گؤره شهرین اهالی‌سی ۲ میلیون ۲۲۱ مین نفردیر. شهر ۱۱ سیاسی قیسمته بؤلونور.\\nتاشکند اورتا آسیانین ان بؤیوک شهری‌دیر. ۸-جی میلادی عصرده عربلر حمله‌سی ایله توتولدو؛ داها سوْنرا مۆسلمان دؤولت‌لر، موغول‌لار، تیموری‌لر، شیبانلی‌لار، خوقند خانلیغی و روسیه الینه دوشدو."},{"page_url":"https://fr.wikipedia.org/wiki/Manono_(Samoa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Manono.JPG","page_title":"Manono (Samoa)","context_page_description":"Manono est une île des Samoa située entre Savai'i et Upolu, à l'intérieur du récif corallien de cette dernière. Avec une superficie de seulement 3 km², elle est considérablement moins grande que ces deux îles."},{"page_url":"https://en.wikipedia.org/wiki/Les_Femmes_d%27Alger","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Pierre-Auguste_Renoir_-_Parisiennes_in_Algerian_Costume_or_Harem_-_Google_Art_Project.jpg","page_title":"Les Femmes d'Alger","context_page_description":"Les Femmes d'Alger is a series of 15 paintings and numerous drawings by the Spanish artist Pablo Picasso. The series, created in 1954–1955, was inspired by Eugène Delacroix's 1834 painting The Women of Algiers in their Apartment. The series is one of several painted by Picasso in tribute to artists that he admired.\\nThe entire series of Les Femmes d'Alger was bought by Victor and Sally Ganz from the Galerie Louise Leiris in Paris for $212,500 in June 1956. Ten paintings from the series were later sold by the Ganz's to the Saidenberg Gallery, with the couple keeping versions \\"C\\", \\"H\\", \\"K\\", \\"M\\" and \\"O\\".\\nMany of the individual paintings in the series are now in prominent public and private collections."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%BB%9D%E9%87%8E_(%E6%9C%AD%E5%B9%8C%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/MOAI_image.JPG","page_title":"滝野 (札幌市)","context_page_description":"滝野は北海道札幌市南区にある地名。同区内の南東の一角を占める。\\n滝野は隣接する清田区有明と並んで滝が多い。滝野周辺は約4万年前に支笏湖を形成した火山からの火砕流堆積物が厚く、その一部は溶結凝灰岩となっている。強溶結の部分は堅くて川の下方浸食を受けにくいので、やわらかい火山灰地層との境目で高低差ができ、滝が形成される。その滝が強溶結を削りながら後退していく過程で、川の本流と支流の合流点を越えると、本流に加えて支流にも新たに滝ができる。一帯に滝が多いのはこうした理由によると考えられる。"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%B4%D8%B1%D8%B7%D8%A9_%D8%A7%D9%84%D8%A7%D8%AA%D8%AD%D8%A7%D8%AF%D9%8A%D8%A9_(%D8%A7%D9%84%D9%85%D9%83%D8%B3%D9%8A%D9%83)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/88/S4ehecatl1.jpg","page_title":"الشرطة الاتحادية (المكسيك)","context_page_description":"الشرطة الاتحادية أو عُرفت سابقاً بإسم الشرطة الإتحادية الوقائية. شرطة مكسيكية تابعة للأمانة العامة للداخلية. ويطلق على منتسبيها بالعامية اسم \\"فيديراليس\\"، غالباً مايكون منتسبيها مدججين بالسلاح ويرتدون بزات عسكرية باللون الأزرق الداكن أو الأسود.\\nأسست الشرطة الإتحادية بدمج أربع منظمات إتحادية في عام 1998 و 1999، من أجل تنسيق أفضل بين الوكالات ضد خطر العصابات المنظمة المتنامي. دُمجت شرطة الطرق السريعة، الشرطة المالية، وحدة التحقيق السرية في وزارة الداخلية ومركز الأمن الوطني لتشكل الوكالة الحالية. كما يوجد قسم تحقيقات في الشرطة الإتحادية. للتحقيق في الجرائم الإتحادية تديرهُ وكالة الشرطة الإتحادية الوزارية تحت إدارة النائب العام في المكسيك."},{"page_url":"https://et.wikipedia.org/wiki/Porgand","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Daucus_carota_subsp._maximus_MHNT.BOT.2007.40.407.jpg","page_title":"Porgand","context_page_description":"Porgand ehk aedporgand ehk söögiporgand on sarikaliste sugukonda porgandi perekonda kuuluv kaheaastane rohttaim.\\nEestis peetakse söögiporgandit tähtsaks köögiviljaks."},{"page_url":"https://cs.wikipedia.org/wiki/Skotsk%C3%BD_parlament","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Her_Majesty_Queen_Elizabeth_II_at_the_opening_of_the_Scottish_Parliament.jpg","page_title":"Skotský parlament","context_page_description":"Skotský parlament je autonomní jednokomorová zákonodárná instituce Skotska, která sídlí v hlavním městě Edinburghu. Má 129 poslanců, kteří jsou voleni na čtyřleté období. Poslední volby proběhly 5. května 2016.\\nPůvodní Skotský parlament byl zákonodárným sborem nezávislého Skotského království, který existoval od počátku 13. století až do doby kdy se roku 1707 Skotské království, na základě zákonů přijatých parlamenty obou království, sloučilo s Anglickým královstvím a vzniklo tak Království Velké Británie. Důsledkem sloučení byl zánik obou původních parlamentů a vytvoření jednotného parlamentu Velké Británie.\\nPo referendu konaném roku 1997, kdy Skotové souhlasili s jeho vznikem, byl zákonem britského parlamentu z roku 1998, který definoval jeho pravomoci, ustanoven Skotský parlament. Zákon decentralizoval určité oblasti zákonodárné moci tím, že specifikoval pravomoci, které zůstaly v náplni britského parlamentu a ostatní oblasti tak automaticky náleží do správy Skotského parlamentu. Britský parlament si stále zachoval právo omezit nebo rozšířit pravomoci Skotského parlamentu."},{"page_url":"https://et.wikipedia.org/wiki/Lokulaud","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Julius_Brus%2C_lokulaud_tulekahju_signaaliabin%C3%B5una%2C_ERM_Fk_907_179_1.jpg","page_title":"Lokulaud","context_page_description":"Lokulaud on heli tegemise vahend, mis koosneb kahest püstpostist ja nende peale pandud põikpuust, mille küljes ripub laud. Heli tekitamiseks lüüakse seda rippuvat lauda puidust vasaraga."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%8A%E0%A4%A8%E0%A4%BE_%E0%A4%9A%E0%A5%88%E0%A4%AA%E0%A4%B2%E0%A4%BF%E0%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Oona_Chaplin_2013.jpg","page_title":"ऊना चैपलिन","context_page_description":"ऊना कैस्टीला चैपलिन एक स्पेनिश अभिनेत्री हैं। वह अंग्रेजी फिल्म स्टार चार्ली चैपलिन की पोती व गेराल्डिन चैपलिन की बेटी है, और अमेरिकी नाटककार यूजीन ओ'नील की महान पोती हैं। उन्हें जाना जाता हैं एचबीओ सीरीज के शो \\"गेम ऑफ़ थ्रोंस\\" में टेलिसा स्टार्क की भूमिका के लिए।"},{"page_url":"https://en.wikipedia.org/wiki/Lucius_Munatius_Plancus","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Bust_of_Plancus_IMG_9753.jpg","page_title":"Lucius Munatius Plancus","context_page_description":"Lucius Munatius Plancus was a Roman senator, consul in 42 BC, and censor in 22 BC with Lucius Aemilius Lepidus Paullus. Along with Talleyrand eighteen centuries later, he is one of the classic historical examples of men who have managed to survive very dangerous circumstances by constantly shifting their allegiances."},{"page_url":"https://fi.wikipedia.org/wiki/W._C._Handy","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3f/WCHandy_w_A%26M_College_band_1900.jpg","page_title":"W. C. Handy","context_page_description":"William Christopher Handy oli yhdysvaltalainen bluessäveltäjä ja -muusikko. Handyä pidetään yhtenä vaikutusvaltaisimmista amerikkalaisista lauluntekijöistä ja häntä kutsutaan usein ”bluesin isäksi”.\\nHandy ei ollut ensimmäinen, joka julkaisi musiikkia bluesin muodossa, mutta hän toi bluesin paikallisesti suositun musiikkilajin Mississippi Deltalta kansalliseen tietoisuuteen. Hän oli koulutettu mies, joka hyödynsi paljon kansanmusiikkia omissa sävellyksissään."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Game_of_Thrones_characters","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Michielhuisman2015_%28cropped%29.jpg","page_title":"List of Game of Thrones characters","context_page_description":"The characters from the medieval fantasy television series Game of Thrones are based on their respective counterparts from author George R. R. Martin's A Song of Ice and Fire series of novels. Set in a fictional universe that has been referred to so far as \\"The Known World\\", the series follows a civil war for the Iron Throne of the continent of Westeros, fought between the rival royal and noble families and their respective supporters."},{"page_url":"https://cs.wikipedia.org/wiki/Sign%C3%A1ln%C3%AD_v%C4%9B%C5%BE_Pike_Hill","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Pike-Hill-Signal-Tower-Remains.jpg","page_title":"Signální věž Pike Hill","context_page_description":"Signální věž Pike Hill byla jednou z celé řady signálních stanic, které byly postaveny při římské silnici Stanegate v severní Británii na začátku 2. století. Věž byla později začleněna do Hadriánova valu. Nachází se v hrabství Cumbria na severozápadě Anglie. Zbývá z ní část jihovýchodní zdi o délce 2 metry. Věž je mezi věžičkou 51B a věžičkou 52A, přičemž pevnost Banna se nachází na východ od ní."},{"page_url":"https://de.wikipedia.org/wiki/Tretjakow-Galerie","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Ilya_Repin_Unexpected_visitors.jpg","page_title":"Tretjakow-Galerie","context_page_description":"Die Staatliche Tretjakow-Galerie ist ein Kunstmuseum in Moskau. Mit rund 140.000 Werken der Malerei, der Graphik und der Bildhauerei ist sie neben der St. Petersburger Eremitage eine der größten und berühmtesten Kunstsammlungen Russlands. Diese Werke umfassen den Zeitraum vom 11. bis zum 20. Jahrhundert. Das Hauptgebäude der Galerie befindet sich in der Lawruschinski-Gasse im historischen Stadtteil Samoskworetschje, nahe der Metro-Station Tretjakowskaja."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AB%D9%88%D9%85_%D8%A3%D8%A8%D8%B1%D8%A7%D9%85%D8%B2%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Allium_abramsii_%28Abrams%27_allium%29_%2832729116760%29.jpg","page_title":"ثوم أبرامزي","context_page_description":"ثوم أبرامزي هو نوع من النباتات يتبع جنس الثوم من الفصيلة النرجسية."},{"page_url":"https://de.wikipedia.org/wiki/%C3%89l%C3%A9onore_Duplay","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Eleonoreduplay.jpg","page_title":"Éléonore Duplay","context_page_description":"Éléonore Duplay, genannt Cornélie ist eine historische Person im Zusammenhang mit der Französischen Revolution. Angeblich war sie die Verlobte des Politikers Maximilien de Robespierre."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_%C3%84btissinnen_und_%C3%84bte_von_M%C3%BCnsterschwarzach","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Wa_Judas_Thadd%C3%A4us_Siegerst_MS.jpg","page_title":"Liste der Äbtissinnen und Äbte von Münsterschwarzach","context_page_description":"Die Liste der Äbtissinnen und Äbte von Münsterschwarzach enthält die Namen der Äbte und Äbtissinnen des Benediktinerklosters Münsterschwarzach von seiner Gründung bis zur Gegenwart. Die Klostergeschichte wird in der Forschung in vier große Abschnitte unterteilt, die auch anhand der Prälatinnen- und Prälatenliste nachvollzogen werden kann.\\nZunächst etablierte sich im 8. Jahrhundert ein Frauenkloster in Schwarzach, das als Versorgungsinstitut für die zweitgeborenen Töchter eines ostfränkischen Adelsgeschlechts, wohl der Mattonen, gelten kann. Die Äbtissinnen entstammten allesamt dem fränkischen Hochadel und waren häufig sogar mit den Königen des Frankenreichs verwandt. Erst mit dem Fortzug der Äbtissin Bertha um das Jahr 877 endete die Geschichte des Schwarzacher Frauenklosters.\\nZeitgleich, ab dem Jahr 816, hatte sich im Steigerwald das Kloster Megingaudshausen ebenfalls als Konvent der Mattonen etabliert. Hier allerdings wurden die nachgeborenen Söhne untergebracht."},{"page_url":"https://de.wikipedia.org/wiki/Bahnhof_M%C3%BCnchen-Giesing","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Giesinger_Bahnhof_Muenchen-2.jpg","page_title":"Bahnhof München-Giesing","context_page_description":"Der Bahnhof München-Giesing ist ein Bahnhof im Stadtteil Obergiesing der bayerischen Landeshauptstadt München und eine Station der S- und U-Bahn München. Er befindet sich an der Bahnstrecke München Ost–Deisenhofen, der Bahnstrecke München-Giesing–Kreuzstraße, die etwa auf Höhe des Friedhofs am Perlacher Forst von der Strecke München Ost–Deisenhofen Richtung Osten abzweigt, und an der zweiten Stammstrecke der U-Bahn München. Der Bahnhof wird täglich von etwa 280 Zügen der S-Bahn München bedient."},{"page_url":"https://en.wikipedia.org/wiki/Rwenzori_batis","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Ruwenzori_Batis_RWD.jpg","page_title":"Rwenzori batis","context_page_description":"The Rwenzori batis is an endemic bird native to the Albertine Rift montane forests, where it inhabits altitudes of 1,340–3,300 m."},{"page_url":"https://en.wikipedia.org/wiki/Earth_Day","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/NASA-14147-EarthDay20140422-GlobalSelfie-20140522.jpg","page_title":"Earth Day","context_page_description":"Earth Day is an annual event celebrated around the world on April 22 to demonstrate support for environmental protection. First celebrated in 1970, it now includes events coordinated globally by the Earth Day Network in more than 193 countries.\\nIn 1969 at a UNESCO Conference in San Francisco, peace activist John McConnell proposed a day to honor the Earth and the concept of peace, to first be celebrated on March 21, 1970, the first day of spring in the northern hemisphere. This day of nature's equipoise was later sanctioned in a proclamation written by McConnell and signed by Secretary General U Thant at the United Nations. A month later a United States Senator Gaylord Nelson proposed the idea to hold a nationwide environmental teach-in on April 22, 1970. He hired a young activist, Denis Hayes, to be the National Coordinator. Nelson and Hayes renamed the event \\"Earth Day.\\" Under the leadership of labor leader Walter Reuther, the United Auto Workers was the most instrumental outside financial and operational supporter of the first Earth Day. According to Hayes, \\"Without the UAW, the first Earth Day would have likely flopped!\\""},{"page_url":"https://no.wikipedia.org/wiki/De_norske_kronregaliene","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Johannes_flintoe_crown_for_norwegian_prince_1846.jpg","page_title":"De norske kronregaliene","context_page_description":"De norske kronregaliene, også kalt riksregaliene, er en norsk statseid kunstsamling med kronregalier som utgjør kongemaktens verdighetstegn."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%89%B9%E5%AE%9A%E5%BB%BA%E7%AF%89%E7%89%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Tokyo_Metropolitan_Government_Building_no1_Tocho_06_7_December_2003.jpg","page_title":"特定建築物","context_page_description":"特定建築物は、「建築物における衛生的環境の確保に関する法律」に基づき、特定用途に利用される部分の面積が、3000m²以上の建築物と定義されている。\\n維持管理権原者は、衛生的・快適に使用できるよう、建築物環境衛生管理基準に従って維持管理を行い、建築物環境衛生管理技術者を選任し監督させ、その基準に適合させるための意見を尊重する義務がある。また、特定建築物でない建築物においても、多数の者が使用・利用するものについては同様の管理を行うよう努めなければならないとされている。\\n日本国内の特定建築物の数は、事務所17,660棟、店舗7,284棟、百貨店2,135棟、興行場1,215棟、学校3,140棟、旅館5,966棟、その他3,638棟の計41,038棟を数える。"},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D8%B1%D8%B3%D9%8A%D8%AF%D8%B3_%D8%A8%D9%8A%D9%86%D8%AA%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Mercedes_Pinto.jpg","page_title":"مرسيدس بينتو","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nمرسيدس بينتو كانت صحفيه من اسبانيا."},{"page_url":"https://cs.wikipedia.org/wiki/Hotel_Adlon","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Bundesarchiv_Bild_183-S93250%2C_Berlin%2C_Unter_den_Linden%2C_Hotel_%22Adlon%22.jpg","page_title":"Hotel Adlon","context_page_description":"Hotel Adlon je hotel na ulici Unter den Linden, hlavním bulváru v centru Berlína, přímo naproti Braniborské bráně."},{"page_url":"https://en.wikipedia.org/wiki/Jessie_Macgregor","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Jessie_Macgregor_-Jephthah.jpg","page_title":"Jessie Macgregor","context_page_description":"Jessie Macgregor was a British painter.\\nMacgregor first learned drawing at the drawing academy in Liverpool run by her grandfather Andrew Hunt. Her parents went to live in London and she began to study painting there, becoming a pupil at the Schools of the Royal Academy where her teachers were Lord Leighton, P. H. Calderon, R.A., and John Pettie, R.A.\\nShe won a gold medal at the Royal Academy for history painting in 1871. She was the second woman after Louisa Starr's gold medal in 1867, and the last woman to do so until 1909. She beat Julia Cecilia Smith and Julia Bracewell Folkard. It was noted how these three women's achievements revealed the silliness of the rules that excluded women from becoming full members of the Royal Academy.\\nMacgregor exhibited her work at the Palace of Fine Arts at the 1893 World's Columbian Exposition in Chicago, Illinois.\\nHer painting In the Reign of Terror was included in the 1905 book Women Painters of the World."},{"page_url":"https://de.wikipedia.org/wiki/Amerikanischer_Bison","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/Buffalo%2Bmeat%2Bcans.jpg","page_title":"Amerikanischer Bison","context_page_description":"Der Amerikanische Bison, oft auch als Büffel bezeichnet, ist ein in Nordamerika verbreitetes Wildrind und zugleich das größte Landsäugetier der Region. Ob er zusammen mit dem in Europa vorkommenden, ihm ähnlichen Wisent eine eigene Gattung der Bisons bildet, ist in der Forschung umstritten. Heute werden beide aber häufig zu den Eigentlichen Rindern gestellt.\\nDer Lebensraum des Präriebisons liegt im offenen Grasland der nordamerikanischen Prärien, derjenige des Waldbisons in nördlichen Waldgegenden. Ihre Nahrung besteht fast ausschließlich aus Süßgräsern und Sauergrasgewächsen, die die Wiederkäuer beim langsamen Grasen aufnehmen.\\nBisonkühe und Kälber leben in Herden, die für gewöhnlich um fünfzig Tiere umfassen. Die Bullen leben entweder als Einzelgänger oder in eigenen kleinen Gruppen. Während der Brunft zwischen Juli und August schließen die Bullen sich den Kühen an und halten sich eng an deren Seite, bevor es zur Paarung kommt. Im April und Mai bringen die Kühe ihre Kälber zur Welt, die bis zu einem Alter von 4 bis 6 Monaten von der Mutter gesäugt werden."},{"page_url":"https://es.wikipedia.org/wiki/Presidente_Franco","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/34/Bandera_de_Presidente_Franco.PNG","page_title":"Presidente Franco","context_page_description":"Presidente Franco es un municipio y ciudad portuaria fronteriza en Paraguay, localizada en el sector oriental del país, a orillas del río Paraná, en el departamento de Alto Paraná. Es conocida como la ciudad de las Tres Fronteras y de los Saltos del Monday, ya que allí, junto con la ciudad, convergen los territorios de Puerto Iguazú, Argentina, y Foz de Iguazú, Brasil. Su nombre es en honor al Dr. Manuel Franco, presidente del Paraguay en el periodo 1916-1919."},{"page_url":"https://fr.wikipedia.org/wiki/Marguerite_Volant","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Chapelle%2C_Saint-Paulin.jpg","page_title":"Marguerite Volant","context_page_description":"Marguerite Volant est une mini-série québécoise en onze épisodes de 45 minutes, basée sur une histoire fictive créée par Jacques Jacob et Monique H. Messier, réalisée par Charles Binamé et diffusée entre le 26 septembre et le 5 décembre 1996 à la télévision de Radio-Canada. Le tout a été tourné en grande partie à Saint-Paulin, sur les terrains de l'auberge Le Baluchon, en Mauricie."},{"page_url":"https://es.wikipedia.org/wiki/Programa_Explorers","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Thor-Able_III_Explorer_6.jpg","page_title":"Programa Explorers","context_page_description":"El programa Explorers es un programa de exploración espacial de los Estados Unidos, que da oportunidades de investigar mediante las sondas espaciales, sobre física, geofísica, heliofísica y astrofísica en el espacio.​ Más de 90 misiones espaciales se han realizado desde el año 1958 y sigue aumentando el número. Dio comienzo con el lanzamiento del satélite Explorer 6 el 7 de agosto de 1959, controlado desde la NASA, teniendo colaboración regular de un gran número de instituciones, nacionales como internacionales."},{"page_url":"https://fi.wikipedia.org/wiki/Meriel%C3%A4m%C3%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Hawaii_turtle_2.JPG","page_title":"Merielämä","context_page_description":"Merielämä käsittää kaikki kasvit, eläimet ja muut eliöt, jotka elävät merien suolaisessa merivedessä. Merielämä perustuu sinne kohdistuvaan auringonvaloon ja vedessä oleviin ravinteisiin ja kemiallisiin yhdisteisiin, jotka mahdollistavat biologisen perustuotannon. Maapallon elämän katsotaan syntyneen meressä lähes neljä miljardia vuotta sitten."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%BC%97%E6%9C%97%E7%B4%A2%E7%93%A6%C2%B7%E9%9F%A6%E8%BE%BE","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7e/Catherine_de_Parthenay.jpg","page_title":"弗朗索瓦·韦达","context_page_description":"弗朗索瓦·韋達，16世紀法國最有影響的數學家之一。他的研究工作為近代數學的發展奠定了基礎。他也是名律師，是皇家顧問，曾為亨利三世和亨利四世效力。\\n1540年，韋達生於法國普瓦圖地區，今旺代省的豐特奈－勒孔特，早年在普瓦捷學習法律，後任律師。數學是他的業餘愛好。他是第一個有意識地、系統地使用符號的人。他不僅用字母表示未知量和未知量的乘冪，而且用來表示一般的係數。他把符號代數稱為類的算術，以別於數的算術。他還發現了代數方程根與係數的關係的韋達定理。韋達對三角學也更進一步將已有的三角學系統化。在他對三角法研究的第一本著作《應用於三角形的數學法則》中，就有解直角三角形、斜三角形等的詳述，並且還有平面三角形的正切定理、球面鈍角三角形的餘弦定理、許多三角恆等式以及差化積定理等。他並有系統地發展了利用全部六種三角函數求解各種平面與球面三角形的方法。1603年12月13日韋達在巴黎病逝。\\n著有《應用於三角形的數學定律》、《分析方法入門》。\\n韋達最早明確給出有關圓周率的無窮運算式，而且創造了一套十進分數表示法，促進了記數法的改革。之後，韋達用代數方法解決幾何問題的思想由笛卡兒繼承，發展成為解析幾何。"},{"page_url":"https://en.wikipedia.org/wiki/Southern_Terminal,_Knoxville,_Tennessee","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f6/Southern-terminal-ne-tn1.jpg","page_title":"Southern Terminal, Knoxville, Tennessee","context_page_description":"The Southern Terminal is a former railway complex located at 306 West Depot Avenue in Knoxville, Tennessee, USA. The complex, which includes a passenger terminal and express depot adjacent to a large railyard, was built in 1903 by the Southern Railway. Both the terminal and depot were designed by noted train station architect Frank Pierce Milburn. In 1985, the terminal complex, along with several dozen warehouses and storefronts in the adjacent Old City and vicinity, were listed on the National Register of Historic Places as the Southern Terminal and Warehouse Historic District.\\nDuring the 1850s, the arrival of the railroad— namely the East Tennessee, Virginia and Georgia Railroad and its predecessor lines— transformed Knoxville from a small river town of just over 2,000 residents to one of the southeast's major wholesaling centers. Wholesaling firms built dozens of large warehouses along Jackson Avenue and adjacent streets, where smalltown merchants from across East Tennessee would purchase goods and supplies to resell at rural general stores. In 1894, the ETV&G was absorbed by the Southern Railway, which in turn became part of the Norfolk Southern Railway in 1982."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89piaire_officinale","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/41/Stachys_officinalis2.jpg","page_title":"Épiaire officinale","context_page_description":"L'Épiaire officinale, Bétoine officinale ou simplement Bétoine est une plante herbacée vivace de la famille des Lamiacées. Son intérêt médicinal était connu dans l'Antiquité, par un traité attribué à Antonius Musa, médecin d'Auguste. Le mot bétoine semble être une altération du latin vettonica, d'origine gauloise.\\nSynonyme : Betonica officinalis L., 1753"},{"page_url":"https://ca.wikipedia.org/wiki/Meillant","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Ch%C3%A2teau_de_Meillant_%281503%29.jpg","page_title":"Meillant","context_page_description":"Meillant és un municipi francès, situat al departament de Cher i a la regió de Centre – Vall del Loira. L'any 2007 tenia 784 habitants."},{"page_url":"https://en.wikipedia.org/wiki/Detroit_United_Railway","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Detroit_united_railway_map-1904.PNG","page_title":"Detroit United Railway","context_page_description":"The Detroit United Railway was a transport company which operated numerous streetcar and interurban lines in southeast Michigan. Although many of the lines were originally built by different companies, they were consolidated under the control of the Everett-Moore syndicate, a Cleveland-based group of investors. The company incorporated on December 31, 1900, and continued to expand into the early 1920s through new construction and the acquisition of smaller concerns. After the DUR acquired the Detroit-Jackson line in 1907, it operated more than 400 miles of interurban lines and 187 miles of street city street railway lines.\\nBeginning in 1922, however, the DUR began a process of devolution when it sold the local Detroit, Michigan streetcar system to the city, under the management of the Department of Street Railways. The company continued to abandon or sell properties throughout the 1920s; on September 26, 1928, the remainder was reorganized as the Eastern Michigan Railways.\\nThe Eastern Michigan operated an interurban line from Detroit to Toledo where it connected with Ohio interurbans."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%8F%E0%A6%AE-%E0%A7%A9%E0%A7%A9%E0%A7%A7_(%E0%A6%AE%E0%A6%BF%E0%A6%B6%E0%A6%BF%E0%A6%97%E0%A6%BE%E0%A6%A8_%E0%A6%B9%E0%A6%BE%E0%A6%87%E0%A6%93%E0%A6%AF%E0%A6%BC%E0%A7%87)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Michigan_331_map.png","page_title":"এম-৩৩১ (মিশিগান হাইওয়ে)","context_page_description":"এম-৩৩১ যুক্তরাষ্ট্রের মিশিগানে অবস্থিত একটি অলিখিত রাজ্য ট্রাঙ্কলাইন মহাসড়ক। ৩.৩৬৩ মাইল দীর্ঘ রাস্তাটি কালামাজো শহরে অবস্থিত। এর শুরুটা হয় কালামাজো পোর্টেজ শহরের প্রান্তের কিলগারো রোড থেকে। এম-৩৩১ ছিল ১৯৯৮ সালে গভর্নর জন এনলারের সময় তৈরী হওয়া অনেকগুলো ট্রাঙ্কলাইন মহাসড়কের একটা। রাস্তাটির নাম এম-৩৩১ হওয়ার পূর্বে এটি ছিল ইউএস ১৩১ এর অংশ বিশেষ, যখন শহরতলীতে বিকল্প সড়ক তৈরী হয়নি।"},{"page_url":"https://sk.wikipedia.org/wiki/Kayl","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Coat_of_arms_kayl_luxbrg.png","page_title":"Kayl","context_page_description":"Kayl je luxemburská obec, ktorá sa nachádza v kantóne Esch-sur-Alzette v okrese Luxemburg."},{"page_url":"https://it.wikipedia.org/wiki/La_Nuova_Cricca","image_url":"https://upload.wikimedia.org/wikipedia/it/9/92/Mary_Di_Pietro_ed_Enrico_Ciacci.jpg","page_title":"La Nuova Cricca","context_page_description":"La Nuova Cricca è stato un gruppo musicale beat italiano, nato sulle ceneri di un precedente gruppo chiamato La Cricca. Di entrambi i gruppi è stato bandleader Enrico Ciacci, chitarrista, fratello di Little Tony."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E8%83%A1%E9%87%8C%E5%AE%89%E9%A0%8C%E6%AD%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Ugarit_Corbel.jpg","page_title":"胡里安頌歌","context_page_description":"胡里安颂歌是一组刻在泥板上的楔形文字歌曲，发掘于亚摩利人-迦南人居住的乌加里特古城，文物年份介于公元前1400年左右。其中一块泥板相当完整，板上刻有《胡里安的尼卡尔女神颂》，也可以称作为《胡里安礼拜诗》、《致众神的札鲁兹》或简称《h.6》，它是世界上最古老相对完整存留的记谱音乐作品。虽然有一部分碎片标有作曲家，但《h.6》上没有标示出作曲者的名字。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%B5%D0%BF%D0%B5%D1%80%D0%B5%D1%80%D0%B2%D0%BD%D0%B0_%D1%81%D0%B8%D0%BC%D0%B5%D1%82%D1%80%D1%96%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/%D0%A3%D0%B7%D0%BE%D1%80%D1%8B-%D0%91%D0%B5%D0%BB%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D1%81%D0%BA%D0%BE%D0%B9-%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D0%B8_%D0%97%D0%B5%D0%BC%D0%BD%D0%B0%D1%8F-%D1%82%D0%B2%D0%B5%D1%80%D0%B4%D1%8C.jpg","page_title":"Неперервна симетрія","context_page_description":"Неперервна симетрія — інтуїтивне поняття, що означає симетрію, тобто незмінність, щодо неперервного сімейства перетворень. Цим це поняття відрізняється від дискретної симетрії, наприклад, симетрії відображення, інваріантної щодо одного, декількох або дискретного сімейства перетворень.\\nПрикладом неперервної симетрії є кругова симетрія, тобто обертальна симетрія на будь-який кут. Трансляційна симетрія на довільні вектор в заданому напрямку також є неперервною. У тривимірному просторі прикладом неперервної симетрії є сферична симетрія, яка означає, що вигляд тіла не зміниться, якщо його обертати в просторі на довільні кути, зберігаючи одну точку на місці."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B8%D1%87%D1%83%D0%B3%D0%B8%D0%BD,_%D0%98%D0%B2%D0%B0%D0%BD_%D0%9F%D0%B0%D0%B2%D0%BB%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/ru/8/84/Pichugin_IP.jpg","page_title":"Пичугин, Иван Павлович","context_page_description":"Иван Павлович Пичугин — советский военачальник, генерал-майор."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B8%D0%BD%D0%B3%D0%B4%D0%BE%D0%BD-%D0%A3%D0%BE%D1%80%D0%B4,_%D0%A4%D1%80%D1%8D%D0%BD%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Primula_florindae_form.jpg","page_title":"Кингдон-Уорд, Фрэнк","context_page_description":"Фрэнк Ки́нгдон-Уорд — британский путешественник и ботаник в Восточной Азии, ведущий автор по коллекционированию растений."},{"page_url":"https://lv.wikipedia.org/wiki/Sports_Latvij%C4%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Schweden-Lettland_bei_der_WM_2005.jpg","page_title":"Sports Latvijā","context_page_description":"Latvijā ir profesionālas hokeja, basketbola un futbola līgas. Latvijas hokeja izlase ir piedalījusies četrās Olimpiskajās spēlēs un visos Pasaules čempionātos augstākajā divīzijā kopš 1997. gada. Spēcīgākajā hokeja līgā — NHL, līdz 2008. gadam, bija spēlējuši jau 14 latvieši hokejisti. 1996. gadā prestižāko balvu hokejā Stenlija kausu kopā ar Kolorādo \\"Avalanche\\" izcīnīja Sandis Ozoliņš. Latvijas futbola izlase piedalījās 2004. gada Eiropas čempionāta finālturnīrā. Spēcīgākajā basketbola līgā — NBA ir spēlējuši septiņii latviešu basketbolisti — Gundars Vētra, Kristaps Porziņģis, Dāvis Bertāns, Anžejs Pasečņiks, Rodions Kurucs, Dairis Bertāns un Andris Biedriņš. Vētra nospēlēja 13 spēles 1993. gadā, bet Biedriņš NBA, līdz 2008. gadam, bija nospēlējis jau 2 sezonas. Kristaps Porziņģis vēl šobrīd spēlē NBA klubā Dalasas \\"Mavericks\\" un Dāvis Bertāns Sanantonio \\"Spurs\\". Rīgas hokeja komanda Rīgas \\"Dinamo\\" 2008. gadā tika atjaunota un uzsāka cīņu par Gagarina kausu Kontinentālajā hokeja līgā.\\nTenisā veiksmīgākie latviešu sportisti ir Aļona Ostapenko un Ernests Gulbis. Latvijā ir arī daudzi veiksmīgi bobsleja, kamaniņu un skeletona braucēji, kas izcīnījuši olimpiskās medaļas."},{"page_url":"https://sv.wikipedia.org/wiki/Bridelia_stipularis","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Bridelia_stipularis_01.JPG","page_title":"Bridelia stipularis","context_page_description":"Bridelia stipularis är en emblikaväxtart som först beskrevs av Carl von Linné, och fick sitt nu gällande namn av Carl Ludwig von Blume. Bridelia stipularis ingår i släktet Bridelia och familjen emblikaväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://it.wikipedia.org/wiki/Distretto_di_R%C4%97%C4%8Dica","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Belarus%2C_Homie%C4%BAskaja_voblas%C4%87%2C_Re%C4%8Dycki_rajon.png","page_title":"Distretto di Rėčica","context_page_description":"Il distretto di Rėčica è un distretto della Bielorussia appartenente alla regione di Homel'."},{"page_url":"https://eo.wikipedia.org/wiki/Ligo_de_Whitehead","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Whiteheadlink.png","page_title":"Ligo de Whitehead","context_page_description":"En noda teorio, la ligo de Whitehead, estas unu el la plej bazaj ligoj.\\nĜi estis esplorita de J.H.C. Whitehead. J.H.C. Whitehead penis en la 1930-aj jaroj pruvi la konjekton de Poincaré. En 1934 la ligo de Whitehead estis uzita kiel parto de lia konstruado de la dukto de Whitehead, kiu nuligis lian antaŭa proponitan pruvon de la konjekto."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9A%CE%BB%CE%AC%CE%BF%CF%85%CE%B4%CE%B9%CE%B1_%CE%86%CE%BB%CE%B2%CE%B1%CF%81%CE%B5%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Claudia_%C3%81lvarez_%2827132127909%29.jpg","page_title":"Κλάουδια Άλβαρες","context_page_description":"Η Κλάουδια Άλβαρες ισπανική προφορά ΔΦΑ: [ˈklauðja ˈalβaɾes] είναι μεξικάνα ηθοποιός και μοντέλο, γεννημένη στις 6 Οκτωβρίου 1981, στην πόλη του Μεξικού. Το ντεμπούτο της ήταν το 2004 στη σαπουνόπερα Las Juanas το 2006 στο ρόλο Χουάνα Προυδένσια."},{"page_url":"https://sv.wikipedia.org/wiki/Strandv%C3%A4gen,_Nyn%C3%A4shamn","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Strandv%C3%A4gen%2C_Nyn%C3%A4shamn%2C_2017f.jpg","page_title":"Strandvägen, Nynäshamn","context_page_description":"Strandvägen är en gata i Nynäshamn, Nynäshamns kommun, Stockholms län. Gatan, som även kallas Ringvägen i folkmun, är en slingrande kustväg längs Gårdsfjärden med höga natur- och upplevelsevärden. En körbar väg anlades i samband med de Olympiska sommarspelen 1912. Strandvägen räknas idag till en av de vackraste bilvägarna i Nynäshamnstrakten.\\nStrandvägen är dessutom en populär åskådarplats för Nynäs Offshore Race, en av Sveriges mest populära, årliga motorbåtstävlingar som går av stapeln i slutet av augusti."},{"page_url":"https://de.wikipedia.org/wiki/Verzinken","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Barbed-wire-6904.jpg","page_title":"Verzinken","context_page_description":"Beim Verzinken wird Stahl mit einer dünnen Schicht Zink versehen, um ihn vor Korrosion zu schützen.\\nIm Gegensatz zu nichtmetallischen Beschichtungen bewirkt die Zinkschicht einen aktiven Korrosionsschutz, indem sie gegenüber dem edleren Eisen als Opferanode wirkt.\\nDie kathodische Wirkung des Zinküberzuges verhindert die Korrosion des Eisens bis zu einem Abstand von etwa 5 mm, so dass auch Fehlstellen in der Zinkschicht und bloßliegende Schnittkanten geschützt sind. Die resultierende Bimetallkorrosion bewirkt jedoch einen beschleunigten Abtrag der angrenzenden Zinkschicht."},{"page_url":"https://en.wikipedia.org/wiki/List_of_provincial_parks_in_Nova_Scotia","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Lennox_Passage_Provincial_Park_and_Grandique_Point_Lighthouse_02.jpg","page_title":"List of provincial parks in Nova Scotia","context_page_description":"This is a list of provincial parks in the Canadian province of Nova Scotia. These provincial parks are maintained by the Nova Scotia Provincial Parks branch of the Department of Natural Resources."},{"page_url":"https://it.wikipedia.org/wiki/Arte_assira","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Human-headed_Winged_Bulls_Gate_-_Louvre.jpg","page_title":"Arte assira","context_page_description":"L'arte assira si diffuse in tre fasi storiche determinate: il periodo Paleoassiro o Antico Impero, compreso del periodo di sottomissione alla potenza babilonese, il periodo Medioassiro o Medio Impero e il periodo Neoassiro o Nuovo Impero.\\nLe opere di arte assire giunte sino ai nostri giorni appartengono, nella maggior parte dei casi, al periodo del Nuovo Impero, mentre l'arte dei periodi precedenti, sviluppatasi soprattutto nella città di Assur, sono sopravvissuti solo pochi frammenti e le raffigurazioni dei sigilli, tramite i quali gli studiosi hanno potuto ricostruire scenari storici e artistici, secondo i quali, le città dell'epoca erano caratterizzate da numerosi santuari in stile mesopotamico, spesso completati da enormi ziggurat. Le pareti interne degli edifici erano impreziosite da decorazioni."},{"page_url":"https://de.wikipedia.org/wiki/Arqamani","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Sudan_Meroe_Pyramids_30sep2005_11.jpg","page_title":"Arqamani","context_page_description":"Arqamani war ein nubischer König, der um 200 v. Chr. regierte."},{"page_url":"https://fr.wikipedia.org/wiki/Prix_du_Mus%C3%A9e_d%27Orsay","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Martin_nancy1894.jpg","page_title":"Prix du Musée d'Orsay","context_page_description":"Le prix du Musée d'Orsay est un prix décerné annuellement par le musée d'Orsay à Paris depuis 2006."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%B1%D9%81%DB%8C%D8%B9_%D8%A8%D9%86_%D8%AD%D8%B1%D8%AB%D9%85%DB%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Tahirid_Khurasan_ca_836_AD.svg","page_title":"رفیع بن حرثمہ","context_page_description":"رفیع بن حرثمہ ایک فوجی تھا جو اجرت لیکر جنگ میں شریک ہوتا تھا۔ 9ویں صدی میں بھاری الٹ پھیر کے بعد وہ خراسان کا حکمران بن گیا جہاں اس نے 882ء سے 892ء تک حکومت کی۔"},{"page_url":"https://sv.wikipedia.org/wiki/Syrinx_(nymf)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Godecharle_Pan_poursuivant_Syrinx.jpg","page_title":"Syrinx (nymf)","context_page_description":"Syrinx var i grekisk mytologi en nymf från Arkadien som uppskattade jakt. Hon var en följeslagare till jaktens och kyskhetens gudinna Artemis och likt henne ville Syrinx behålla sin oskuld. Syrinx blev dock förföljd av en erotiskt intresserad Pan. Hon flydde till floden Ladon i Arkadien där hon med gudarnas hjälp förvandlades till vassrör för att undkomma den oönskade tillbedjaren. Dessvärre skar Pan av rören och gjorde därav en panflöjt. Pan använde senare denna flöjt när han utmanade Apollon i en musiktävling."},{"page_url":"https://en.wikipedia.org/wiki/Grudzi%C4%85dz_Granaries","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Grudzi%C4%85dz_Granaries_2009.JPG","page_title":"Grudziądz Granaries","context_page_description":"Grudziądz Granaries is a unique 14th-century fortification complex of river bank granaries on the Vistula river in Grudziądz, Poland."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%AF%D8%A7%DA%A9_%D9%BE%D8%A4_%D8%B6%D9%84%D8%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/An_Khe_District.png","page_title":"داک پؤ ضلع","context_page_description":"داک پؤ ضلع ویتنام کا ایک رہائشی علاقہ جو وسطی سطح مرتفع میں واقع ہے۔"},{"page_url":"https://tr.wikipedia.org/wiki/Soyuz_(uzay_arac%C4%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Cheology_of_Soyuz.png","page_title":"Soyuz (uzay aracı)","context_page_description":"Soyuz bugün hala hizmette olan 1960'larda Korolyov Tasarım Bürosu tarafından Sovyet uzay programı için tasarlanmış bir uzay aracı serisidir. Soyuz, Voskhod uzay aracının başarılı bir ardılı olarak aslında Sovyet İnsanlı Ay programının bir parçası olarak inşa edilmiştir. Soyuz uzay aracı bugüne kadar dünyada bir Soyuz roketi üzerinde en çok kullanılan ve en güvenilir fırlatma aracı olmuştur. Soyuz roketi tasarımı sırayla 8K74 ya da R-7A Semyorka gibi bir Sovyet kıtalararası balistik füzesi olan Vostok fırlatıcısına dayanmaktadır. Tüm Soyuz uzay araçları Kazakistan'daki Baykonur Uzay Üssünden fırlatılmıştır."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8A%E3%82%B7%E3%83%A7%E3%83%90%E3%82%BA%E3%82%AD%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Nashoba%27s_Key_Del_Mar_Stall.jpg","page_title":"ナショバズキー","context_page_description":"ナショバズキー は、アメリカ合衆国のサラブレッド競走馬。4歳という非常に遅いデビューから、半年足らずでGI優勝馬となった。"},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%B8%E0%A5%88%E0%A4%82%E0%A4%9F%E0%A4%BF%E0%A4%AF%E0%A4%BE%E0%A4%97%E0%A5%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Plano_de_Santiago%2C_por_Nicol%C3%A1s_Bolo%C3%B1a.jpg","page_title":"सैंटियागो","context_page_description":"सैंटियागो या सैंतियागो, दक्षिण अमेरिका के चिली देश की राजधानी है। यह देश के केन्द्रीय घाटी में समुद्र तल से लगभग ५२० मी की उंचाई पर स्थित है। लगभग दो दशकों की निर्बाध आर्थिक प्रगति ने लातिनी अमरीका में सैंटियागो को सबसे आधुनिक शहरों में शुमार कर दिया है और आज यहां दर्जनों शॉपिंग मॉल एवं सैकड़ों उंची इमारते हैं।"},{"page_url":"https://eu.wikipedia.org/wiki/Remilly-en-Montagne","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Remilly-en-Montagne.jpg","page_title":"Remilly-en-Montagne","context_page_description":"Remilly-en-Montagne Frantziako udalerria da, Côte-d'Or departamenduan dagoena, Borgoina-Franche-Comté eskualdean. 2013an 143 biztanle zituen."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%81%93%E3%81%AE%E9%A7%85%E5%B7%9D%E5%A0%B4%E7%94%B0%E5%9C%92%E3%83%97%E3%83%A9%E3%82%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Kawaba2.JPG","page_title":"道の駅川場田園プラザ","context_page_description":"道の駅川場田園プラザは、群馬県利根郡川場村にある群馬県道64号平川横塚線の道の駅である。通称「田プラ」。平成27年度全国モデル道の駅に選定された。\\n関東好きな道の駅第1位に選ばれている。\\n毎年11月頃に祭りが開催され、それにあわせて全国各地からクラシックカーが集まる。創意工夫で進化を遂げ、年間120万人が訪れる。\\n土木学会デザイン賞 2017 奨励賞 受賞。"},{"page_url":"https://no.wikipedia.org/wiki/Livet_er_vidunderlig","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/It%27s_a_Wonderful_Life.png","page_title":"Livet er vidunderlig","context_page_description":"Livet er vidunderlig er en amerikansk romantisk drama- og fantasyfilm fra 1946 produsert og regissert av Frank Capra og løst basert på Philip Van Doren Sterns novelle The Greatest Gift.\\nHovedfiguren George Bailey har blitt en viktig del av amerikansk filmhistorie, og det amerikanske filminstituttet har kåret figuren til filmhistoriens 9. beste helteskikkelse. De har også kåret herr Potter til filmhistoriens 6. beste skurkeskikkelse.\\nI Norge er den også vist under tittelen Det er deilig å leve."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B8%89%E5%86%85%E4%B8%B8%E5%B1%B1%E9%81%BA%E8%B7%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/140913_Sannai-Maruyama_site_Aomori_Japan03s.jpg","page_title":"三内丸山遺跡","context_page_description":"三内丸山遺跡は、青森県青森市大字三内字丸山にある、縄文時代前期中頃から中期末葉の大規模集落跡。沖館川右岸の河岸段丘上に立地する。2000年に国の特別史跡に指定。遺跡には住居群、倉庫群のほか、シンボル的な3層の掘立柱建物が再現されており、資料や出土品の展示施設「縄文時遊館」もある。青森県教育庁文化財保護課三内丸山遺跡保存活用推進室が発掘調査を行っている。"},{"page_url":"https://zh.wikipedia.org/wiki/%E8%99%8E%E8%B1%B9%E5%88%A5%E5%A2%85_(%E9%A6%99%E6%B8%AF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Tiger_Balm_Garden%2C_Hong_Kong%2C_1953.jpg","page_title":"虎豹別墅 (香港)","context_page_description":"虎豹別墅和毗鄰的萬金油花園是由已故商人胡文虎在香港建造的一座別墅及花園，位於香港島大坑的大坑道，鄰近勵德邨住宅群，現被列為一級歷史建築。"},{"page_url":"https://kk.wikipedia.org/wiki/%D2%9A%D0%BE%D1%81%D0%BC%D0%B5%D0%BA%D0%B5%D0%BD%D0%B4%D1%96%D0%BB%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Amphibians.png","page_title":"Қосмекенділер","context_page_description":"Қосмекенділер немесе Амфибиялар – хордалылар типі, омыртқалылар тип тармағының бір класы.\\nҚосмекенділердің 2 класс тармағы: доғаомыртқалылар жұқаомыртқалылар, 3 отряды, 25 – 30 тұқымдасына бірігетін 4 мыңнан астам түрі белгілі. Тропиктік, субтропиктік және қоңыржай аймақтарда таралған. Көпшілік түрлері сырттай ұрықтанады, ал дернәсілдері суда тіршілік етеді, тек түрленіп дамығаннан кейін оларда ересектеріне тән морфология-физиологиялық ерекшеліктер қалыптасады. Дернәсілдерінің анатомиялық құрылыстары балықтарға ұқсас. Ересектері өкпе және терісі арқылы тыныс алады. Қосмекенділер жоғары девонда саусаққанатты балықтардан пайда болған, балықтар мен “нағыз” құрлықтағы омыртқалылардың арасынан орын алады. Бұларға жерде жүруге бейімделген буыны шар тәрізді, бірнеше бөлімдерден тұратын, бес саусақты жұп аяқтар тән. Бас қаңқасы аутостилиялық. Қосмекенділерде үлкен қан айналу шеңберінен басқа кіші қан айналу шеңбері пайда болған. Жүрегі екі жүрекше мен бір қарыншадан тұрады. Сол жақ жүрекшеде таза артерия қаны, ал оң жақ жүрекшеде вена қаны мен теріден келетін артерия қаны болады. Қарыншада артерия және вена қандары араласады."},{"page_url":"https://de.wikipedia.org/wiki/W%C5%82adys%C5%82aw_I._Ellenlang","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Pieczec_Wladyslawa_Lokietka.jpg","page_title":"Władysław I. Ellenlang","context_page_description":"Władysław I. Ellenlang war als Władysław IV. ab 1306 Princeps von Polen, und ab 1320, als Władysław I., König von Polen; aus der Dynastie der kujawischen Piasten.\\nVor seiner Krönung zum polnischen König 1320 stand Herzog Władysław mit anderen männlichen Vertretern der Piastenlinie und dem böhmischen Königshaus der Přemysliden bei der Einigung des Königreichs Polen in Konkurrenz. Den Beinamen Ellenlang oder der Ellenlange erhielt er aufgrund seiner kurzen Statur."},{"page_url":"https://it.wikipedia.org/wiki/Marco_della_Repubblica_Democratica_Tedesca","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/20_Pfennig_DDR_Wertseite.JPG","page_title":"Marco della Repubblica Democratica Tedesca","context_page_description":"Il Marco della Repubblica Democratica Tedesca era la valuta della Repubblica Democratica Tedesca, ed è stato sostituito dal Marco della Germania Federale con la riunificazione del 1990.\\nIl suo codice ISO 4217 era DDM. La moneta è stata ufficialmente denominata Deutsche Mark fino al 1964, Mark der Deutschen Notenbank fino al 1967 e Mark der DDR in seguito; era chiamata colloquialmente Mark. Era divisa in 100 Pfennig.\\nNella Germania Federale era anche chiamato Ostmark."},{"page_url":"https://ru.wikipedia.org/wiki/SMS_Szent_Istv%C3%A1n_(1914)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Modell_der_SMS_Szent_Istv%C3%A1n.jpg","page_title":"SMS Szent István (1914)","context_page_description":"SMS «Szent István» — австро-венгерский линкор типа «Вирибус Унитис», воевавший в составе флота Австро-Венгрии в Первую мировую войну.\\nНазван в честь венгерского короля, сделавшего христианство официальной религией Венгрии.\\nСтроительство корабля велось в Фиуме на Дунайских верфях компании Ganz & Company’s Danubius. Оно задерживалось из-за начала Первой мировой войны, но корабль был успешно принят в состав флота в декабре 1915 года. Большую часть он провёл на якоре в Поле, покидая гавань только для учений. Первое и единственное крупное плавание корабль начал 9 июня 1918 с целью патрулирования пролива Отранто и обстрела побережья Италии — этот поход стал роковым для корабля, поскольку его утром 10 июня обнаружили итальянские торпедные катера MAS и пустили ко дну. Корабль получил два торпедных попадания, которые пришлись в котельную — туда мгновенно хлынула вода, и корабль затонул в течение трёх часов. Из 1094 человек экипажа 89 погибли."},{"page_url":"https://es.wikipedia.org/wiki/Tercera_Divisi%C3%B3n_A_de_Chile_2014","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/600px_Arancione_e_Nero_%28Bordato%29.png","page_title":"Tercera División A de Chile 2014","context_page_description":"La Tercera División A de Chile 2014 o Campeonato Nacional de Tercera División A 2014 fue la 35.º edición de la cuarta categoría del fútbol de Chile, correspondiente entre la temporada 2013-2014 y 2014-2015. Se jugó desde el 26 de abril hasta el 13 de diciembre de 2014.\\nSu organización estuvo a cargo de la Asociación Nacional de Fútbol Amateur de Chile y contó con la participación de catorce equipos. La competición se disputó por primera vez bajo el sistema de todos contra todos, en dos ruedas, abandonando el sistema de división en grupos.\\nEl campeón fue Colchagua CD, que se adjudicó su tercer título de la Tercera División A. En esta edición, al igual que la temporada anterior, ascendieron dos equipos a la Segunda División Profesional de Chile, mientras que los dos equipos que finalizaran en las últimas dos posiciones, jugarán liguillas de promoción contra dos equipos de la Tercera División B.\\nSe integraron seis equipos en la competición: mientras el equipo de Deportes Rengo regresó a la división después de dos campeonatos, Unión Casablanca hizo su estreno tras darle otro nombre al equipo tercerista de Defensor de Casablanca, que siguió con su propio en su asociación."},{"page_url":"https://nl.wikipedia.org/wiki/Stemtoon","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Stimmgabel90degree.jpg","page_title":"Stemtoon","context_page_description":"De stemtoon of normaaltoon, ook met kamertoon of diapason aangeduid, is in de muziektheorie de toon a' uit het eengestreept octaaf, met de wetenschappelijke benaming A₄, waarvan internationaal de toonhoogte in mei 1939 in Londen vastgesteld is op een frequentie van 440 Hz. Dit gebeurde door een groep wetenschappers en musici uit Duitsland, Engeland, Frankrijk, Italië en Nederland. Zwitserland en de Verenigde Staten namen schriftelijk aan de bijeenkomst deel.\\nDe stemtoon wordt gebruikt voor het onderling op elkaar afstemmen van muziekinstrumenten en is van groot belang voor de bouwers van deze instrumenten. De stemtoon is op eenvoudige wijze beschikbaar in de vorm van een stemvork die deze toon voortbrengt."},{"page_url":"https://pt.wikipedia.org/wiki/Taquarituba","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/34/Taquarituba_2.jpg","page_title":"Taquarituba","context_page_description":"Taquarituba é um município brasileiro do estado de São Paulo. Localiza-se na latitude 23º31'59\\" sul e na longitude 49º14'40\\" oeste. A cidade esta a uma altitude de 618 metros e sua uma área territorial é de 448,14 km². Sua população, conforme estimativas do IBGE de 2018, era de 23 180 habitantes."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%98%D1%81%D0%BA%D1%80%D1%8F%D1%89%D0%BE_%D0%BA%D0%BE%D0%BB%D0%B8%D0%B1%D1%80%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Selasphorus_scintilla.jpg","page_title":"Искрящо колибри","context_page_description":"Искрящото колибри е вид птица от семейство Колиброви."},{"page_url":"https://ms.wikipedia.org/wiki/Wilhelm_Frick","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Wilhelm_Frick_72-919.jpg","page_title":"Wilhelm Frick","context_page_description":"Wilhelm Frick ialah seorang tokoh politik Jerman dari Parti Nazi, yang berkhidmat sebagai Menteri Dalam Negeri Reich dalam Kabinet Hitler dari tahun 1933 hingga 1943. Selepas Perang Dunia II, beliau telah dibicarakan kerana jenayah perang di Perbicaraan Nuremberg dan dihukum mati."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%97%D0%BD%D0%B0%D0%BC%D0%B5_%D0%BD%D0%B0_%D0%9D%D0%BE%D0%B2_%D0%97%D0%B5%D0%BB%D0%B0%D0%BD%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Flag_of_New_Zealand.svg","page_title":"Знаме на Нов Зеланд","context_page_description":"Знамето на Нов Зеланд е со темно сина основа, на која во горниот лев агол се наоѓа знамето на Обединетото Кралство, а на која десна страна се наоѓаат четири ѕвезди кои го симболизираат соѕвездјето јужен крст. Знамето е усвоено на 24 мат, 1902, а во употреба е од 1869."},{"page_url":"https://en.wikipedia.org/wiki/Nantclwyd_y_Dre","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Nantclwyd_y_Dre_12.JPG","page_title":"Nantclwyd y Dre","context_page_description":"Nantclwyd y Dre is a Grade 1 listed house in Ruthin, Denbighshire. It is Wales's oldest dated timbered town house, and is owned by the County and open to the public as a historic house museum."},{"page_url":"https://es.wikipedia.org/wiki/Ciudad_desaparecida","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Intihuatanaytemplos.jpg","page_title":"Ciudad desaparecida","context_page_description":"Las ciudades perdidas o ciudades desaparecidas a veces tuvieron una existencia real comprobada y otras, en cambio, sólo pertenecen a la imaginación popular.\\nMuchas de las ciudades perdidas eran áreas extensas, prósperas y abundantemente pobladas, que desaparecieron bruscamente, por acciones de la naturaleza o alguna guerra devastadora, o que declinaron progresivamente hasta desaparecer.\\nLa mayoría de las ciudades perdidas conocidas han sido estudiadas intensamente por los científicos, principalmente arqueólogos. Los sitios urbanos abandonados de origen relativamente reciente se refieren generalmente como a ciudades fantasma.\\nLas ciudades perdidas pueden dividirse en tres amplias categorías:\\nAquellas cuya desaparición ha sido tan completa que ningún conocimiento de la ciudad existió hasta la época de su redescubrimiento y estudio.\\nDe las que se ha perdido su localización, pero cuya memoria se ha conservado en el contexto de mitos y de leyendas.\\nDe las que se ha conocido siempre su existencia y localización, pero que dejaron de estar habitadas durante un largo periodo."},{"page_url":"https://pl.wikipedia.org/wiki/Ugljan","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b5/Croatia_-_Ugljan.PNG","page_title":"Ugljan","context_page_description":"Ugljan – wyspa u wybrzeży Chorwacji, leżąca w Archipelagu Zadarskim, sąsiadująca z wyspami Pašman, Rivanj i Sestrunj. Jej powierzchnia wynosi 51,05 km² a długość linii brzegowej 78,7 km. Administracyjnie należy do żupanii zadarskiej. Od kontynentu oddzielony jest Zadarskim kanalem, z wyspą Pašman połączony jest natomiast mostem. Jest jedną z najgęściej zaludnionych wysp chorwackich. Na wyspie są następujące miejscowości: Preko, Poljana, Sutomišćica, Lukoran, Ugljan, Kali, Kukljica. Nazwa wyspy może pochodzić od oliwy lub od węgla."},{"page_url":"https://de.wikipedia.org/wiki/St-Thurien_(Plogonnec)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Plogonnec_%C3%89glise_Saint-Thurien_Vitrail_Baie_7_342.jpg","page_title":"St-Thurien (Plogonnec)","context_page_description":"Die katholische Pfarrkirche Saint-Thurien in Plogonnec, einer Gemeinde im Département Finistère der französischen Region Bretagne, wurde zum großen Teil im 16. Jahrhundert errichtet. Die Kirche ist dem heiligen Thurien geweiht, einem bretonischen Heiligen aus dem 7./8. Jahrhundert und Bischof von Dol. In der Kirche sind Bleiglasfenster aus der Bauzeit erhalten. Im Jahr 1922 wurde die Kirche einschließlich ihrer Umfriedung und ihres Triumphtors als Monument historique in die Liste der Baudenkmäler in Frankreich aufgenommen."},{"page_url":"https://it.wikipedia.org/wiki/Distretto_di_Bang_Yai","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/MRT_purple_line_from_Central_Westgate_parking_building_-_panoramio.jpg","page_title":"Distretto di Bang Yai","context_page_description":"Il distretto di Bang Yai è un distretto della Thailandia situato nella provincia di Nonthaburi."},{"page_url":"https://ro.wikipedia.org/wiki/Turismul_%C3%AEn_Rom%C3%A2nia","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Neptun_Romania_bgiu.jpg","page_title":"Turismul în România","context_page_description":"Turismul în România se concentrează asupra peisajelor naturale și a istoriei sale bogate. Traversată de apele Dunării, România are un scenariu sensibil, incluzând frumoșii și împăduriții Munți Carpați, Coasta Mării Negre și Delta Dunării, care este cea mai mare deltă europeană atât de bine păstrată. Cu rolul de a puncta peisajele naturale sunt satele, unde oamenii de acolo trăiesc și mențin pentru sute de ani tradițiile. În România este o abundență a arhitecturii religioase și a orașelor medievale și a castelelor, ce accentuează și valorifică potențialul turistic al României."},{"page_url":"https://en.wikipedia.org/wiki/Morphological_typology","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Logji.png","page_title":"Morphological typology","context_page_description":"Morphological typology is a way of classifying the languages of the world that groups languages according to their common morphological structures. The field organizes languages on the basis of how those languages form words by combining morphemes. Analytic languages contain very little inflection, instead relying on features like word order and auxiliary words to convey meaning. Synthetic languages, ones that are not analytic, are divided into two categories: agglutinative and fusional languages. Agglutinative languages rely primarily on discrete particles for inflection, while fusional languages \\"fuse\\" inflectional categories together, often allowing one word ending to contain several categories, such that the original root can be difficult to extract. A further subcategory of agglutinative languages are polysynthetic languages, which take agglutination to a higher level by constructing entire sentences, including nouns, as one word.\\nAnalytic, fusional, and agglutinative languages can all be found in many regions of the world. However, each category is dominant in some families and regions and essentially nonexistent in others."},{"page_url":"https://fr.wikipedia.org/wiki/Liban","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Baskinta_village.jpg","page_title":"Liban","context_page_description":"Le Liban, en forme longue la République libanaise, est un État du Proche-Orient. En grande partie montagneux, il partage ses frontières avec la Syrie au nord et à l'est sur 376 km, Israël au sud sur 79 km et, au large de ses 220 km de côtes dans le bassin levantin à l'ouest, avec Chypre. Beyrouth en est la capitale.\\nLa langue officielle est l'arabe. Le français, ayant perdu ce statut, est la langue secondaire, employée notamment dans l'enseignement. La monnaie officielle est la livre libanaise.\\nDu fait de sa composition pluriconfessionnelle, le Liban est doté d'un système politique fondé sur une répartition du pouvoir proportionnelle au poids de chaque communauté religieuse, c'est le confessionnalisme.\\nComme entité géopolitique et tel qu'il existe dans ses frontières actuelles, l'État libanais est créé en 1920 sous le nom de Grand Liban par la France par adjonction au territoire du Moutassarrifat du Mont-Liban de territoires qui appartenaient aux deux Wilaya ottomans de Beyrouth et de Damas. La France avait été alors, à la suite du démantèlement de l'Empire ottoman, mandatée par la Société des Nations pour développer et moderniser certains territoires ex-ottomans."},{"page_url":"https://de.wikipedia.org/wiki/The_Click","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/E-40.jpg","page_title":"The Click","context_page_description":"The Click ist eine US-amerikanische Hip-Hop-Gruppe aus Vallejo. Ihre Musik wird den Stilrichtungen Westcoast-Hip-Hop, Gangsta-Rap und G-Funk zugerechnet."},{"page_url":"https://id.wikipedia.org/wiki/Paul_Collier","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Paul_Collier_World_Economic_Forum_2013.jpg","page_title":"Paul Collier","context_page_description":"Sir Paul Collier, CBE adalah dosen ekonomi dan kebijakan umum di Blavatnik School of Government di Universitas Oxford.\\nIa juga merupakan direktur International Growth Centre, direktur Centre for the Study of African Economies, dan anggota St Antony's College, Oxford.\\nSejak 1998 sampai 2003, ia menjabat sebagai direktur Development Research Group di Bank Dunia. Majalah Foreign Policy memasukkan Collier ke daftar pemikir global terbaik tahun 2010 dan 2011. Collier saat ini menjabat sebagai anggota dewan penasihat Academics Stand Against Poverty."},{"page_url":"https://sw.wikipedia.org/wiki/Gude","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Greycuckooshrike.jpg","page_title":"Gude","context_page_description":"Gude ni ndege wa familia Campephagidae. Spishi nyingi zina rangi ya kijivu na nyeupe tu na pengine nyeusi, spishi nyingine zina rangi kali pia kama nyekundu na njano. Hawa ni ndege wa misitu isipokuwa gude-ardhi wa Australia ambaye atokea maeneo wazi yenye miti michache. Chakula chao kuu ni viwavi lakini wadudu wengine pia na pengine wanyama wadogo, matunda na mbegu. Hujenga tago lao kwa umbo la kikombe mtini na jike huyataga mayai 3-4 yenye rangi ya nyeupe, majani au buluu."},{"page_url":"https://fr.wikipedia.org/wiki/Campagne_de_Chattanooga","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Chattanooga_Orchard_Knob.jpg","page_title":"Campagne de Chattanooga","context_page_description":"La campagne de Chattanooga rassemble les opérations militaires et les combats qui se déroulèrent en octobre et novembre 1863, sur le théâtre occidental de la guerre de Sécession.\\nAprès la défaite de l'armée du Cumberland, conduite par le major-général nordiste William Starke Rosecrans, à la Bataille de Chickamauga, les Confédérés de l'armée du Tennessee emmenés par le général Braxton Bragg assiègent Rosecrans et ses hommes en occupant les hauteurs qui surplombent Chattanooga. Le major-général Ulysses S. Grant, ayant reçu le commandement des forces de l'Union dans l'ouest, des renforts commencent à arriver avec lui à Chattanooga depuis le Mississippi et le théâtre oriental.\\nAprès avoir ouvert une ligne de ravitaillement pour nourrir ses troupes affamées et leurs montures, Grant repousse une contre-attaque confédérée à Wauhatchie, les 28 et 29 octobre 1863."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%89%B9%E6%AE%8A%E5%99%A8%E5%8F%B0%E3%83%BB%E7%89%B9%E6%AE%8A%E5%A3%BA","image_url":"https://upload.wikimedia.org/wikipedia/ja/0/0d/%E9%83%BD%E6%9C%88%E5%9D%821%E5%8F%B7%E5%A2%B3%E5%87%BA%E5%9C%9F_%E7%89%B9%E6%AE%8A%E5%99%A8%E5%8F%B0%E5%BD%A2%E5%9F%B4%E8%BC%AA%E3%83%BB%E6%A5%AF%E7%AF%89%E5%A2%B3%E4%B8%98%E5%A2%93%E5%87%BA%E5%9C%9F_%E7%89%B9%E6%AE%8A%E5%99%A8%E5%8F%B0.JPG","page_title":"特殊器台・特殊壺","context_page_description":"特殊器台・特殊壺は、弥生時代後期後葉に現在の岡山県にあたる吉備地方で生まれた、華麗な文様を施し丹で赤く塗るなどして装飾性に富んだ筒型・壺型の土器。首長の埋葬祭祀に使用された。これらの特殊土器類が発達し変遷して円筒埴輪の発生や成立に関係した。特殊器台型土器・特殊壺型土器とも言われる。"},{"page_url":"https://ms.wikipedia.org/wiki/Vitaly_Ginzburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Ginzburg_in_MSU_opaque.jpg","page_title":"Vitaly Ginzburg","context_page_description":"Vitaly Lazarevich Ginzburg, ForMemRS ialah seorang ahli fizik teori Soviet dan Rusia, astrofizik, pemenang Hadiah Nobel, seorang ahli Akademi Sains Rusia dan Soviet dan salah seorang bapa bom hidrogen Soviet. Beliau adalah pengganti kepada Igor Tamm sebagai ketua Jabatan Fizik Teoritis Institut Fizikal Lebedev dari Akademi Sains Rusia, dan seorang ateis."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%AD%80%E5%A9%A6%E5%B2%A9","image_url":"https://upload.wikimedia.org/wikipedia/ja/a/a6/Izu_islands.png","page_title":"孀婦岩","context_page_description":"孀婦岩は、伊豆諸島の最南端に位置する岩である。\\n2016年時点で、所属市町村未定のため東京都の直轄となっており本籍を置くことはできず、東京都総務局の出先機関である八丈支庁が管理事務を行っている。日本の気象庁により活火山とされている。"},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%91%D1%8F%D0%BB%D1%8B%D0%BD%D1%96%D1%87%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/%D0%91%D1%80%D0%BE%D0%B2%D0%B0%D1%80._%D0%91%D1%8F%D0%BB%D1%8B%D0%BD%D1%96%D1%87%D1%8B.jpg","page_title":"Бялынічы","context_page_description":"Бялы́нічы — места ў Беларусі, на рацэ Друці. Адміністрацыйны цэнтар Бялыніцкага раёну Магілёўскай вобласьці. Насельніцтва на 2018 год — 9887 чалавек. Знаходзяцца за 44 км на захад ад Магілёва, на аўтамабільнай дарозе Менск — Магілёў.\\nБялынічы — даўняе магдэбурскае мястэчка гістарычнай Аршаншчыны, старажытны замак Вялікага Княства Літоўскага. Сярод мясцовых славутасьцяў вылучаўся збудаваны ў стылі барока комплекс кляштару кармэлітаў з касьцёлам Унебаўзяцьця Найсьвяцейшай Панны Марыі, помнік архітэктуры XVIII ст., зруйнаваны савецкімі ўладамі. Цудоўны абраз Маці Божай, што захоўваўся ў касьцёле, зьнік з Магілёўскага музэю ў Другую сусьветную вайну."},{"page_url":"https://it.wikipedia.org/wiki/Maya_Zankoul","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Maya_Zankoul.jpg","page_title":"Maya Zankoul","context_page_description":"Maya Zankoul in arabo مايا زنقول è una scrittrice, artista, blogger e artista visiva libanese.\\nÈ per lo più conosciuta per il suo sarcastici cartoni animati e fumetti pubblicati nei suoi libri e il suo webcomic blog Amalgama."},{"page_url":"https://ca.wikipedia.org/wiki/Gerrit_Dou","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Dou%2C_Gerard_-_The_Quack_-_1652.jpg","page_title":"Gerrit Dou","context_page_description":"Gerrit Dou o Gerard Dou, va ser un pintor i gravador holandès del barroc. Va pertànyer a l'escola de Leiden i es va especialitzar en escenes de gènere caracteritzades pels seus trompe-l'oeil i les pintures nocturnes il·luminades amb espelmes, amb escenes de fort clarobscur."},{"page_url":"https://mn.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BB%D1%87%D0%B8%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/View_of_inside_Anfield_Stadium_from_Anfield_Road_Stand.jpg","page_title":"Калчио","context_page_description":"Скуадра Калчио баг нь Спортын цонх лигт тоглодог бөгөөд энэ лигийн шилдэг багуудын нэг юм. Калчио баг нь 2011 оны зун явагдсан \\"Спортын цонх\\" лигийн анхдугаар тэмцээнд нэг ч хожигдолгүй 10 хожил 8 тэнцээтэй 38 оноо цуглуулан түрүүлж байлаа. Улмаар энэ амжилтаа 2013 оны лигт давтаж 2 дахь аваргын цомоо өргөсөн юм. Тус багт 2010, 2011 оны Цомын мэргэн бууч, тэмцээний бүх цаг үеийн мэргэн бууч Ябраа, 2012, 2013 оны лигийн мэргэн бууч BTR тэмцээний шилдэг хаалгач Т.Зоригтсайхан, анхдугаар тэмцээний шилдэг тоглогч Г.Баяраа зэрэг тоглогчид багтдаг юм. Тус баг нь жил ирэх тусам шилдэг тамирчдаар бүрэлдэхүүнээ хүчирхэгжүүлж лиг болон цомын тэмцээнд тогтмол амжилттай өрсөлддөг төдийгүй тус багаас тэмцээний зохион байгуулалтанд идэвхтэй оролцож, тэмцээний зохион байгуулагч, шүүгчээр 3 гишүүн оролцдог.\\nКалчио багийн тоглогч дасгалжуулагчаар багийн ахлагч Т.Зоригтсайхан тоглодог."},{"page_url":"https://en.wikipedia.org/wiki/Brigade_insignia_of_the_United_States_Army","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/US_Army_116th_Military_Intelligence_Brigade_SSI.png","page_title":"Brigade insignia of the United States Army","context_page_description":"A shoulder sleeve insignia is an embroidered emblem worn on the sleeves of some United States Army uniforms to identify the primary headquarters to which a soldier is assigned. Like division sized units, separate brigades of the U.S. Army are allowed their own SSI to distinguish their wearers from those of other units. Most military units smaller than brigades do not have SSI, but rather wear the SSI of a higher headquarters. The following list of SSIs represent some of the current and former brigades of the U.S. Army:"},{"page_url":"https://ca.wikipedia.org/wiki/Cebus_kaapori","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Kaapori_Capuchin_area.png","page_title":"Cebus kaapori","context_page_description":"Cebus kaapori és una espècie de mico de la família dels cèbids que es troba al Brasil."},{"page_url":"https://et.wikipedia.org/wiki/Magnetv%C3%B5imendi","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Transductor_bw_series.png","page_title":"Magnetvõimendi","context_page_description":"Magnetvõimendi on elektrivoolu tugevuse, pinge või võimsuse võimendi, mille talitlus põhineb ferromagnetsüdamike magneetumisomaduste mittelineaarsusel. Magnetvõimendi patenteeriti 20. sajandi alguses. Magnetvõimendit on võrdlemisi hõlpus ehitada ning ta on küllaltki töökindel. Algselt palju kasutust militaar-, lennundus- ja merendusvaldkonnas leidnud võimendi on tänapäevaks aga asendatud väiksemate ja efektiivsemate elektrooniliste lahendustega."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8B%D5%B8%D6%80%D5%BB_%D5%80%D5%A1%D6%80%D5%AB%D5%BD%D5%B8%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/12ArnoldGrove.JPG","page_title":"Ջորջ Հարիսոն","context_page_description":"Ջորջ Հարիսոն, անգլիացի ռոք երաժիշտ, կիթառահար, երգիչ, հեղինակ և կիթառիստ, հայտնի է որպես The Beatles-ի առաջին կիթառահար և անդամ։ Խմբի ցրումից հետո Հարիսոնն ունեցավ հաջող սոլո կարիերա, նաև հանդես եկավ Traveling Wilburys խմբի կազմում։ Նա նաև կինոպրոդյուսեր էր ։ Դեռևս The Beatles-ի կազմում աչքի էր ընկնում իր կրոնական հետաքրքրություններով։\\nThe Beatles-ից հետո Հարիսոնը խմբի մյուս անդամների պես սկսեց երգել առանձին՝ որպես անհատ կատարող Give me love, That's the way it goes, Horse to the water, I've got my mind set on you, Where we was Fab, I'll see you in my dreams, This song, Creckerbox palace, This is love, My sweet lord, Here comes the moon\\" և շատ ու շատ այլ երգեր։"},{"page_url":"https://ko.wikipedia.org/wiki/%EC%86%90%EB%8B%B4%EB%B9%84%EC%9D%98_%EC%9D%8C%EB%B0%98_%EB%AA%A9%EB%A1%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/101002_Son_Dam_Bi.jpg","page_title":"손담비의 음반 목록","context_page_description":"다음은 대한민국의 대중 음악 가수 손담비의 음반 목록으로 한 장의 정규 음반, 한 장의 컴필레이션 음반, 네 장의 EP 음반, 네 장의 싱글 음반, 총 아홉 번의 참여를 했다."},{"page_url":"https://hu.wikipedia.org/wiki/V%C3%A9rszerz%C5%91d%C3%A9s","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Sz%C3%A9kely_Bertalan_V%C3%A9rszerz%C5%91d%C3%A9s.jpg","page_title":"Vérszerződés","context_page_description":"A vérszerződés a magyar hagyomány szerint a magyarság első alapszerződése. A szerződést a hagyomány szerint a hét vezér – Anonymus Gesta Hungaroruma szerint Álmos, Előd, Ond, Kond, Tas, Huba, Töhötöm, a hét törzs – Tarján, Jenő, Kér, Keszi, Nyék, Megyer és Kürtgyarmat vezére kötötte Etelközben egymással oly módon, hogy a szerződésben vállalt kötelezettségeik megerősítéseképpen vérüket egy edénybe csorgatták és ott összekeverték. A szerződés erről a jellegzetes mozzanatról kapta elnevezését, amely feltehetőleg a korabeli magyar szokásjog szerint különlegesen erős fogadalomtételek egyik formai kelléke volt, mint például az eskü. Tehát számtalan egyéb megegyezést, mai értelemben vett szerződést erősíthettek meg ebben a formában a kor magyarjai, ám csupán ez az alant taglalt, honfoglalást megelőző szerződés híresült el „a vérszerződés” néven. A szerződés pontos tartalmára és lefolyására vonatkozóan azonban csak a később készült krónikák és a mondák, regék, szájhagyomány állnak rendelkezésre."},{"page_url":"https://nn.wikipedia.org/wiki/Crummock_Water","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d3/Crummock_Water_from_Red_Pike.jpg","page_title":"Crummock Water","context_page_description":"Crummock Water er ein innsjø i Lake District i Cumbria i Nordvest-England mellom Buttermere i sør og Loweswater i nord. Elva Cocker vert rekna for å ha kjelde nord for innsjøen, før ho renn vidare i Lorton Vale. Åsen Mellbreak strekkjer seg langs heile vestsida av innsjøen.\\nInnsjøen er eigd av National Trust. Scale Force, den høgaste fossen i Lake District, gjev vatn til innsjøen."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D8%A7%D9%84%D9%85%D9%86%D8%A7%D8%B7%D9%82_%D8%A7%D9%84%D8%AD%D8%B6%D8%B1%D9%8A%D8%A9_%D9%81%D9%8A_%D8%A7%D9%84%D8%A7%D8%AA%D8%AD%D8%A7%D8%AF_%D8%A7%D9%84%D8%A3%D9%88%D8%B1%D9%88%D8%A8%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Birmingham_-UK_-Skyline.jpg","page_title":"قائمة المناطق الحضرية في الاتحاد الأوروبي","context_page_description":"هذه قائمة بالمناطق الحضرية في الاتحاد الأوروب مع أكثر من 10000 نسمة اعتبارًا من عام 2014."},{"page_url":"https://es.wikipedia.org/wiki/Eclipta_prostrata","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Eclipta_prostrata_in_AP_W2_IMG_9785.jpg","page_title":"Eclipta prostrata","context_page_description":"Eclipta prostrata es una especie de planta fanerógama de la familia Asteraceae. Es una de las Diez Flores Sagradas de Kerala."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%97%E0%B8%AD%E0%B8%A1_%E0%B9%82%E0%B8%88%E0%B8%99%E0%B8%AA%E0%B9%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Tom_Jones_concert.jpg","page_title":"ทอม โจนส์","context_page_description":"เซอร์ โทมัส โจนส์ วูดเวิร์ด เกิดเมื่อ 7 มิถุนายน ค.ศ. 1940 ที่คิงส์แลนด์เทอร์เรซ เทรฟฟอร์ด พอนตีพริดด์ เป็นนักร้องชาวเวลส์ ตั้งแต่ปี 1965 เขามียอดขายมากกว่า 100 ล้านชุด และเป็น 1 ใน 4 ของโค้ชใน The Voice UK\\nปี ค.ศ. 1965 หรือ พ.ศ. 2508 โทมัส โจนส์ ได้ร้องเพลงประกอบภาพยนตร์เรื่อง Thunderball หรือ ธันเดอร์บอลล์ 007"},{"page_url":"https://ca.wikipedia.org/wiki/Kevin_Connolly","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Kevin_Connolly_by_David_Shankbone.jpg","page_title":"Kevin Connolly","context_page_description":"Kevin Connolly és un actor i director de cinema estatunidenc, conegut pels seus papers a Entourage i a Unhappily Ever After."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%94%D7%99%D7%95%D7%9D_%D7%9C%D7%9E%D7%97%D7%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Channel_1_Israel_DSCN0966.JPG","page_title":"מהיום למחר","context_page_description":"\\"מהיום למחר\\" היא תוכנית חדשות ישראלית ששודרה בערוץ הראשון בשנים 1994–2012."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Rottendorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Rottendorf_W%C3%BCrzburger_Stra%C3%9Fe_Stundenbank.jpg","page_title":"Liste der Baudenkmäler in Rottendorf","context_page_description":"Auf dieser Seite sind die Baudenkmäler der unterfränkischen Gemeinde Rottendorf zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 15. April 2020 wieder und enthält 29 Baudenkmäler."},{"page_url":"https://sl.wikipedia.org/wiki/Lava","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Volcanic_bomb_from_Hekla.jpg","page_title":"Lava","context_page_description":"Lava je vrsta raztaljene kamnine, ki jo med erupcijo izbruha ognjenik. Raztaljena kamnina nastaja v notranjosti nekaterih planetov, med katerimi je tudi Zemlja, in nekaterih njihovih satelitov. Lava ima na izhodu iz vulkanskega dimnika temperaturo od 700 °C do 1200 °C. Viskoznost lave je približno 10.000 krat večja od viskoznosti vode, zaradi tiksotropskih lastnosti, ki zmanjšajo njeno viskoznost, pa lahko preteče velike razdalje preden se ohladi in strdi. Ko se lava strdi, se pretvotri v magmatsko kamnino.\\nBeseda lava je italijanskega izvora in je verjetno nastala iz latinske besede labes, ki pomeni padati ali drseti. Besedo lava je v zvezi z iztisnjeno magmo verjetno prvi uporabil Francesco Serao pri opisu izbruha Vezuva med 14. majem in 4. junijem leta 1737."},{"page_url":"https://pl.wikipedia.org/wiki/Czy%C5%9Bciec_bulwiasty","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e3/Stachys_sieboldii0.jpg","page_title":"Czyściec bulwiasty","context_page_description":"Czyściec bulwiasty – gatunek rośliny z rodziny jasnotowatych"},{"page_url":"https://az.wikipedia.org/wiki/Dieqo_Simeone","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Diego_Simeone_-_01.jpg","page_title":"Dieqo Simeone","context_page_description":"Dieqo Pablo Simeone Argentinalı futbolçu və futbol məşqçisi. 2006-cı ildə futbolçu karyerasını bitirmədən öncə, dəyaq yarımmüdafiəçi mövqeyində oynuyurdu. Hal hazırda Atletiko Madrid klubunun baş məşqçisidi. 24 mart 2015-ci ildə o, klubla 2020-ci ilə qədər müqaviləsini uzatdı.\\nO, Argentina milli futbol komandasında 100-dən çox oyun keçirdib və onun heyətində 1994, 1998 və 2002-ci illərin Dünya Çempionatlarında iştirak edib. Karyerası boyu, Simeone inadcıl yarımmüdafiəçi kimi tanınırdı, hansıki həm rəqibdən topu ala bilirdi, həm hücümü başlıyırdı, həmdə özü qol vurmaq bacarığındaydı. O, ilk növbədə öz liderliyi ilə, texnikasıyla, taktiki universallığıyla, ağılıyla, gücüylə, dözümlülüyü ilə seçilirdi."},{"page_url":"https://fr.wikipedia.org/wiki/Conus_(coquillage)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Conus_chaldaeus_3.jpg","page_title":"Conus (coquillage)","context_page_description":"Le genre Conus rassemble à présent 626 espèces de « coquillages ». De très nombreuses espèces fossiles sont également connues. La plupart de ces espèces sont venimeuses et les plus grosses sont dangereuses pour l'homme."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B0%D0%BB%D0%B0%D0%BD%D0%B4,_%D0%9A%D0%B5%D0%B2%D0%B8%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Kevin_Lalande_2012-02-06.JPG","page_title":"Лаланд, Кевин","context_page_description":"Кеви́н Лала́нд — бывший канадский и белорусский хоккеист, вратарь. Мастер спорта Республики Беларусь международного класса. Участник чемпионатов мира 2014 и 2015 годов в составе сборной Белоруссии. Вице-чемпион России сезона 2014/15 в составе московского ЦСКА."},{"page_url":"https://fr.wikipedia.org/wiki/Roiffieux","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Roiffieux_vue_de_la_Garde.jpg","page_title":"Roiffieux","context_page_description":"Roiffieux est une commune française située dans le département de l'Ardèche, en région Auvergne-Rhône-Alpes. Roiffieux est un village fleuri, il possède une architecture ancienne au village et avec plusieurs châteaux bourgeois. Mais il est devenu aussi une importante banlieue résidentielle. Son environnement lui permet cependant d'être un point de départ pour des randonnées avec vue sur le Vercors et la chaîne des Alpes.\\nRoiffieux est habitée par 2 851 habitants en 2014, ce qui en fait la troisième ville du bassin annonéen après Annonay et Davézieux.\\nLes habitants de Roiffieux sont appelés les Réfocaliens."},{"page_url":"https://eo.wikipedia.org/wiki/Mini-E%C5%ADropo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Mini_Europa_Br%C3%BCssel-1992_Palace_of_Westminster.jpg","page_title":"Mini-Eŭropo","context_page_description":"Mini-Eŭropo france Mini-Eŭrope, nederlande kaj germane Mini-Europa] estas amuzparko en Bruselo. Estas unu el la plej gravaj turismaj altiraĵoj de la urbo. Laŭ la ekzemplo de la nederlanda Madurodam, ĝi montras miniaturajn versiojn de la plej gravaj konstruaĵoj kaj monumentoj de la Eŭropa Komunumo. Ĉiuj konstruaĵoj estas surloke konstruitaj je mezurproporcio de 1:25.\\nLa parko ampleksas 9ha kaj havas proksimume 350.000 vizitantojn jare. Plej multaj vizitantoj venas de eksterlando kaj nur unufoje vizitas la ejon."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%A9%BA%E6%83%B3%E6%80%A7%E9%94%99%E8%A7%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Er_Gui_Ting_Fa_Shi_2015.jpg","page_title":"空想性错视","context_page_description":"空想性錯視，也被稱為空想性錯覺、幻想性錯覺，是一種心理現象，指的是大腦對外界的刺激賦予一個實際的意義，但只是巧合，實際上「意義」並不存在。\\n人們常常會將諸如雲朵看成動物、人臉、物品等。此外，「月面人臉」、「月兔」、音樂倒放、快放、慢放時聽到的「隱藏訊息」等都屬於空想性錯視帶來的幻覺。"},{"page_url":"https://pl.wikipedia.org/wiki/Wybory_parlamentarne_w_Polsce_w_2001_roku","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/2004.05.01._Bronislaw_Geremek_01.jpg","page_title":"Wybory parlamentarne w Polsce w 2001 roku","context_page_description":"Wybory parlamentarne w Polsce w 2001 roku – wybory do Sejmu i Senatu odbyły się 23 września. Zastosowano nowo uchwaloną ordynację wyborczą do Sejmu Rzeczypospolitej Polskiej i do Senatu Rzeczypospolitej Polskiej. O mandaty ubiegało się 15 komitetów wyborczych. Wybory te zakończyły się zwycięstwem koalicji SLD-UP. W wyniku wyborów do Sejmu weszło 6 komitetów, które przekroczyły odpowiedni próg oraz posłowie Mniejszości Niemieckiej. Po wyborach koalicja SLD-UP zawarła koalicję z Polskim Stronnictwem Ludowym. Premierem został przewodniczący SLD Leszek Miller. Stanowiska wicepremierów objęli Marek Pol i Jarosław Kalinowski."},{"page_url":"https://sk.wikipedia.org/wiki/Chaux-Neuve","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c1/Map_commune_FR_insee_code_25142.png","page_title":"Chaux-Neuve","context_page_description":"Chaux-Neuve je francúzska obec, ktorá sa nachádza v departemente Doubs, v regióne Franche-Comté."},{"page_url":"https://hu.wikipedia.org/wiki/Amazonok","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Amazone_Staatliche_Antikensammlungen_2342.jpg","page_title":"Amazonok","context_page_description":"Az amazonok harcos nőkből álló népesség, akik a görög hitregékben és a történetírásban is szerepelnek. Amazoi, annyi mint kebeltelenek. Ősi lakóhelyük a hagyomány szerint, a kis-ázsiai Pontosz tartomány területén volt. Kalandozásaik során bejárták csaknem az egész ókori világot, Egyiptomtól Hellász északi részéig. Úgy tartják, több várost is alapítottak, mint például Epheszoszt vagy Szmürnát. Az amazonok leginkább két istenséget tiszteltek: Artemiszt és Arészt. Monda szerinti ősapjuk Arész, ősanyjuk pedig Otréré volt. Az amazonomakhia, az amazonokkal vívott csata tárgyköre igen népszerű volt a görög és római képzőművészetben."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/V%C3%A9lez_de_Benaudalla","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Eglise_de_Velez_de_Benaudalla.jpg","page_title":"Vélez de Benaudalla","context_page_description":"Vélez de Benaudalla sī tī Se-pan-gâ Andalucía siā-lí Granada séng ê chi̍t ê municipio."},{"page_url":"https://es.wikipedia.org/wiki/Iglesia_de_San_Juan_de_los_Panetes_(Zaragoza)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Zaragoza_-San_Juan_de_los_Panetes_10.jpg","page_title":"Iglesia de San Juan de los Panetes (Zaragoza)","context_page_description":"La Iglesia de San Juan de los Panetes es un templo de culto católico de estilo barroco ubicado en Zaragoza, Aragón, España. Está situada junto a la Plaza del Pilar —o Plaza de las Catedrales— y a la Fuente de la Hispanidad. También se encuentra muy próxima al Torreón de la Zuda. Está catalogada como Bien de Interés Cultural y monumento nacional.\\nSu construcción se terminó en 1725, coincidiendo con la eclosión del barroco en la ciudad y el ánimo de mejorar las ya para entonces decadentes muestras de otros estilos —gótico y mudéjar—, lo que llevó a renovar las catedrales de la Seo y el Pilar. El principal motivo de la renovación fue sustituir la destruida iglesia de la Orden de San Juan de Jerusalén.\\nEn 2013 se inicia un proceso de reforma en el entorno del templo y de la zona de las Murallas Romanas, impulsada por Tranvía de Zaragoza y coincidiendo con la construcción de la Línea 1 de dicho medio de transporte. La consultora IDOM/ACTX realiza el proyecto inicial, sobre una propuesta de la SEM Los Tranvías de Zaragoza y en su concepción se cuenta con un proceso de participación ciudadana a través de 2.700 aportaciones."},{"page_url":"https://sv.wikipedia.org/wiki/Sheepwash","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Sheepwash%2C_Devon_-_geograph.org.uk_-_43117.jpg","page_title":"Sheepwash","context_page_description":"Sheepwash är en parish i Storbritannien. Den ligger i grevskapet Devon och riksdelen England, i den södra delen av landet, 290 km väster om huvudstaden London.\\nKlimatet i området är tempererat. Årsmedeltemperaturen i trakten är 8 °C. Den varmaste månaden är juli, då medeltemperaturen är 14 °C, och den kallaste är januari, med 0 °C."},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_di_Santa_Caterina_d%27Alessandria_(Ortona)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Ortona_-_Chiesa_di_Santa_Caterina_d%27Alessandria_08.jpg","page_title":"Chiesa di Santa Caterina d'Alessandria (Ortona)","context_page_description":"La chiesa di Santa Caterina d'Alessandria è un edificio religioso che si trova ad Ortona, in provincia di Chieti.\\nNoto precedentemente come monastero benedettino di Sant'Anna, fondato dai Celestini, poi delle Clarisse e delle Cistercensi, ospitava le monache Celestine, che rimasero sotto l'ordine delle Clarisse in centro, anche dopo la soppressione dell'ordine celestino nel 1811. Vi è annesso l'oratorio del Crocifisso miracoloso, affacciato sul mare."},{"page_url":"https://de.wikipedia.org/wiki/Hecker_(Motorrad)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Emblem_Hecker.JPG","page_title":"Hecker (Motorrad)","context_page_description":"Hans Hecker begann ab 1922 in seiner Manufaktur in der Imhoffstraße 24, später in der Lenaustraße 7 in Nürnberg mit dem Bau der sogenannten Einbaumotorräder, die unter dem Namen Emora an verschiedene Motorradhersteller vertrieben wurden. Es waren fertige Motorradfahrwerke, in die nur noch die Motor-Getriebe-Einheit eingebaut werden musste. Im Jahr 1923 begann Hecker komplette eigene Motorräder zu bauen. Erste Modelle waren die H1 und die H2 mit Motoren von S & G.\\nS & G produzierte ab 1925 eigene Motorräder, sodass Hecker gezwungen war, J.A.P.-Einbaumotoren mit 198 cm³ bis 548 cm³ zu verwenden. In den Jahren 1927 und 1928 erschienen neue Heckermodelle, jetzt mit Trapezgabel anstelle der Druidgabel und verbesserten Rahmen. So konnten großvolumige Motoren verwendet werden, wie die wechselgesteuerten V-Zweizylinder von Motosacoche mit 746 cm³. Dieses Motorrad wurde nur bis zur Weltwirtschaftskrise gebaut und durch eine billigere Version mit 600-cm³-Motor von J. A. P. ersetzt. Ab 1931 wurden Zweitakter von Sachs mit 73 cm³ und 98 cm³ eingebaut."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%9A%D0%BE%D1%80%D1%82%D0%BE%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Cortona-view.jpg","page_title":"Кортона","context_page_description":"Кортона — Италиядағы қала, Тоскана әкімшілік аймағына қарасты Ареццо провинциясында орналасқан.\\nҚаланың тұрақты тұрғындарының саны 22 594 адамды құрайды. Халық тығыздығы 64 адам/км². Алып жатқан жер аумағы 342 км² шамасында. Пошта индексі — 52044."},{"page_url":"https://fr.wikipedia.org/wiki/Gardegan-et-Tourtirac","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Gardegan-et-Tourtirac_Limite_communale.jpg","page_title":"Gardegan-et-Tourtirac","context_page_description":"Gardegan-et-Tourtirac est une commune du Sud-Ouest de la France, située dans le département de la Gironde, en région Nouvelle-Aquitaine."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B2%D5%A5%D5%A2%D5%A5%D6%84","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bc/Eg-consulate-bebek.jpg","page_title":"Բեբեք","context_page_description":"Բեբեք, Ստամբուլի Բեշիկթաշ շրջանի թաղամասերից մեկը, որը գտնվում է Բոսֆորի եվրոպական ափին: Բեբեքը սահմանակից է Ստամբուլի Էթիլեր, Արնավութքյոյ և Ռումելիհիսար թաղամասերին: Թաղամասի մերձափնյա հատվածում է գտնվում համանուն ծովախորշը:\\nԹաղամասի անվանումը՝ Bebek թուրքերենից բառացի թարգմանվում է որպես երեխա: Համարվում է, որ անվանումը ծագել է Boğaz'ın Gözbebeği անվան կրճատումից, ինչը թարգմանաբար, բառացի, նշանակում է Բոսֆորի բիբ, կամ, ավելի գրական՝ Բոսֆորի աչքի բիբ:"},{"page_url":"https://it.wikipedia.org/wiki/Charles_Helou","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Charles_Helou.jpg","page_title":"Charles Helou","context_page_description":"Charles Helou è stato un politico libanese.È stato Presidente della Repubblica del Libano dal 1964 al 1970."},{"page_url":"https://eo.wikipedia.org/wiki/P%C3%AEtres","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Eglise_P%C3%AEtres3.jpg","page_title":"Pîtres","context_page_description":"Pîtres estas franca komunumo situanta en departemento Eure, regiono Normandio.\\nĜiaj enloĝantoj nomiĝas Pîtriens."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Monuments_historiques_in_Locmariaquer","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Dolmen_de_Kerlud%2C_Locmariaquer%2C_France_-_02.JPG","page_title":"Liste der Monuments historiques in Locmariaquer","context_page_description":"Die Liste der Monuments historiques in Locmariaquer führt die Monuments historiques in der französischen Gemeinde Locmariaquer auf."},{"page_url":"https://en.wikipedia.org/wiki/Sevan_Ni%C5%9Fanyan","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Rock_tomb_in_%C5%9Firince.jpg","page_title":"Sevan Nişanyan","context_page_description":"Sevan Nişanyan is a Turkish-Armenian journalist and travel writer.\\nAn author of a number of books, Nişanyan was awarded the Ayşe Nur Zarakolu Liberty Award of the Turkish Human Rights Association in 2004 for his contributions to greater freedom of speech.\\nHe is also known for his work to restore a semi-derelict village, Şirince, near Turkey’s Aegean coast.\\nSevan Nişanyan was handed a cumulative jail sentence of 16 years and 7 months for alleged building infractions after he criticized the government’s attempts to prohibit criticism of the prophet Muhammad, in a blog entry in September 2012. However, he escaped prison in July 2017 and established in Athens, where he intends to apply for political asylum according to an interview he gave to the Belgian daily La Libre Belgique. He currently lives in exile in Samos about which he has said \\"I am grateful to providence that the goatf***ers who run Turkey gave me, unintentionally, this splendid opportunity.\\""},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B0%91%E7%94%9F%E7%94%A3%E6%A5%AD","image_url":"https://upload.wikimedia.org/wikipedia/ja/9/9a/MinseiBR331.jpg","page_title":"民生産業","context_page_description":"民生産業は、かつて存在した日本の法人である。\\n1935年に日本デイゼル工業として発足。その後1940年に鐘淵紡績の傘下となり1942年に鐘淵デイゼル工業へ社名変更、そして1946年に鐘淵工業からグループ離脱した際に当社名へ変更した。\\n1950年に大型商用自動車製造会社の民生デイゼル工業を分社。同社は2ストロークディーゼルエンジンとこれを搭載した車両を主力製品とする特徴のある企業であったが、母体企業の転変を経て日産自動車系列下に入った後の1960年に日産ディーゼル工業へ、さらにはボルボグループ入りしたのち2010年にUDトラックスへと改称。2014年にボルボ・グループ・ジャパンと合併し法人格消滅。\\nここでは、民生デイゼル工業以降の、同社による2ストロークディーゼルエンジン搭載車についてもあわせて記述する。"},{"page_url":"https://fr.wikipedia.org/wiki/Collection_de_peintures_du_mus%C3%A9e_Cond%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Prosper_Marilhat_-_Une_rue_au_Caire.jpg","page_title":"Collection de peintures du musée Condé","context_page_description":"La collection de peinture du musée Condé à Chantilly, comprend 800 peintures datant du XVᵉ siècle au XIXᵉ siècle. Les tableaux sont répartis dans presque toutes les salles selon le goût et les volontés du duc d'Aumale. Ils sont présentés les uns contre les autres et superposés, comme le voulait la mode dans les musées au XIXᵉ siècle. Cette liste présente les principaux tableaux par écoles et par peintres, ordonnés par ordre chronologique."},{"page_url":"https://fr.wikipedia.org/wiki/Tridacna","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Tridacna_derasa.001_-_Aquarium_Finisterrae.JPG","page_title":"Tridacna","context_page_description":"Le genre Tridacna regroupe des mollusques bivalves de l'ordre des Veneroida, communément appelés « bénitiers »."},{"page_url":"https://en.wikipedia.org/wiki/Haydamaky_(band)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Haydamaky_%28UKR%29_-_Sziget_2015.08.15_%283%29.JPG","page_title":"Haydamaky (band)","context_page_description":"Haydamaky is a Ukrainian folk rock band formed in 1991. The music of Haydamaky is inspired by various ethnic music from around the world, especially from various regions of Ukraine, such as Polesia, Bukovina, and Transcarpathia. Other influences include the Romanian folklore, punk music sound of Shane MacGowan and by the reggae of such bands like Burning Spear and Black Uhuru. The name refers to haidamakas, 18th century Ukrainian paramilitary and rebels."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B4%D9%87%D8%B1%D8%B3%D8%AA%D8%A7%D9%86_%D9%87%D8%A7%D8%B1%DB%8C%D9%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/51/Arukyla_Mois.jpg","page_title":"شهرستان هاریو","context_page_description":"شهرستان هاریو یکی از شهرستان‌های کشور استونی است.\\nاین شهرستان در سال ۲۰۱۱ میلادی ۵۲۸٬۴۶۸ نفر جمعیت داشته‌است و مرکز آن شهر تالین است."},{"page_url":"https://ca.wikipedia.org/wiki/Santa_Maria_la_Mar","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Santa_Maria_la_Mar_42.jpg","page_title":"Santa Maria la Mar","context_page_description":"Santa Maria la Mar és el poble cap del municipi del mateix nom, de 4.725 habitants, de la comarca del Rosselló.Se situa a la vall de la Tet, a l'est de Perpinyà, just al nord de Canet de Rosselló, a la part nord-oriental de la comarca, a ran de la Mar Mediterrània i al nord del riu Tet.\\nÉs a la subcomarca de la Salanca, antigament zona d'aiguamolls, d'on ve el nom de Salanca, a la plana existent al nord del riu esmentat. Actualment, juntament amb Bonpàs, Vilallonga de la Salanca i els districtes del nord-est de Perpinyà forma part del cantó número 7, de Perpinyà 2.\\nLa dita sobre els santmariaires és Santa Maria l'Eixau, i existeix un proverbi que diu Canet i Santa Maria se van pas fer en un dia."},{"page_url":"https://en.wikipedia.org/wiki/HSC_Our_Lady_Pamela","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/OurLadyPamela.jpg","page_title":"HSC Our Lady Pamela","context_page_description":"HSC Our Lady Pamela was a high-speed catamaran ferry which operated between the Isle of Wight and mainland England. She had operated on the Wightlink Ryde Pier to Portsmouth route since 1986 under Sealink along with her now scrapped sister ship HSC Our Lady Patricia. Both ships were named after the daughters of Lord Mountbatten, who had been the Governor of the Isle of Wight.\\nIn March 2009, it was announced that Wightlink would be replacing its FastCat catamarans with two new vessels, Wight Ryder I and Wight Ryder II. Our Lady Pamela was, however, taken out of service earlier than the two other vessels, FastCat Ryde and FastCat Shanklin. This was partly due to an engine fire causing significant damage.\\nShe was scrapped at Esbjerg in April 2010."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%AA%D8%A7%D8%B1%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Derev_tara.jpg","page_title":"تارا","context_page_description":"تارا روسیه اؤلکه‌سینده یئر آلان بیر شهردیر و اومسک اوبلاستینده یئرلشیب. ۲۰۱۰-جی ایلین نۆفوس ساییمی اساسیندا ۲۷۳۱۸ نفر دیر."},{"page_url":"https://tr.wikipedia.org/wiki/Barbara_Fugger","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Barbara_Fugger.jpg","page_title":"Barbara Fugger","context_page_description":"Barbara Fugger, Alman iş insanı ve bankacı. Augsburg'da varlıklı bir ailede dünyaya geldi. Tüccar Jakob Fugger ile evlendi. Uluslararası düzeyde keten ve yün ticareti yaptı. Eşinin ölümünden sonra 1469 yılından 1497 yılında kadar Fugger bankasını yönetti."},{"page_url":"https://de.wikipedia.org/wiki/Papa_Roach","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9e/Papa_roach_sziget2010_erdoedy.jpg","page_title":"Papa Roach","context_page_description":"Papa Roach ist eine US-amerikanische Metal- und Rockband, die 1993 in Vacaville gegründet wurde. Die Band war Anfang des neuen Jahrtausends mit dem Album Infest Teil der kommerziell erfolgreichen Nu-Metal-Welle, welche sich im „Crossover-Boom“ der 1990er Jahre entwickelt hatte. Die daraus ausgekoppelte Single Last Resort wurde ein Hit und erreichte in mehreren Ländern hohe Platzierungen in den Hitlisten. Dadurch wurde die Gruppe für zahlreiche internationale Musikpreise wie den Grammy und den MTV Video Music Award nominiert. Sie distanzierte sich allerdings bereits nach ihrem erfolgreichen Debüt musikalisch schrittweise von der Musikrichtung Nu Metal und handhabt seitdem mit verschiedenen Stilen der Rockmusik. Beeinflusst wurde die Band u. a. von Faith No More und Rage Against the Machine. Der Bandname „Papa Roach“ stammt von Sänger Jacoby Shaddix. Dieser sagte aus, dass sein Großvater mit Nachnamen „Roatch“ hieß, allerdings auch mit dem Spitznamen „Papa“ angesprochen worden sei. Er nahm sich 2006 das Leben. Die Band hat ein Maskottchen in Form einer Kakerlake."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B8%D1%82%D0%B2%D0%B8%D0%BD%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/21._Litvin.jpg","page_title":"Литвины","context_page_description":"Литви́ны — термин, который использовался в исторических источниках для обозначения населения Великого княжества Литовского. Как правило, термин подразумевал под собой как этнических литовцев, так и нынешних белорусов, а также всего населения Великого княжества вне зависимости от происхождения.\\nВ XIV—XVIII веках этим термином обозначали преимущественно белорусов и восточных литовцев, которые противопоставлялись соседним этнографическим группам — русинам, ляхам, мазурам, жемайтам, прусам, волынянам и другим. В конфессиональном аспекте связывался с католичеством.\\nВ современной этнографии литвинами называют субэтническую группу белорусов."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D1%80%D1%96%D1%81%D0%BD%D0%BE%D0%B2%D0%BE%D0%B4%D0%BD%D0%B8%D1%85_%D0%B0%D0%BA%D0%B2%D0%B0%D1%80%D1%96%D1%83%D0%BC%D0%BD%D0%B8%D1%85_%D1%80%D0%B8%D0%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/PuntiusStoliczkanus.jpg","page_title":"Список прісноводних акваріумних риб","context_page_description":"Аква́ріумні риби — збірна назва таксономічно різнорідних риб, яких утримують у акваріумах з декоративною метою.\\nУ даному списку в систематичному порядку наведений список прісноводних риб, що утримуються в акваріумах."},{"page_url":"https://fr.wikipedia.org/wiki/Gare_d%27Aino","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Aino_station_Hyogo_prefecture_frontview.jpg","page_title":"Gare d'Aino","context_page_description":"La gare d'Aino est une gare ferroviaire située dans la ville de Sanda, dans la préfecture de Hyōgo au Japon. La gare est exploitée par la compagnie JR West, sur la ligne Fukuchiyama/Ligne JR Takarazuka.L’utilisation de la carte ICOCA est valable dans cette gare."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%96%A7%E5%B1%B1%E9%81%93%E9%81%8B%E5%8B%95%E5%A0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/HK_HammerHillRoadSportsGround.JPG","page_title":"斧山道運動場","context_page_description":"斧山道運動場是香港一個田徑運動場，位於九龍牛池灣斧山道158號，由康樂及文化事務署管理。該運動場前身是平頂村。\\n運動場的正門位於斧山道，面南端永定道出口可供駕車者使用。該處也是斧山道游泳池的後門。\\n除被學校租用作運動會會場外，斧山道運動場在平日開放予街坊入內晨運和跑步等。看台的下層是更衣室和洗手間。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D0%BE%D1%80%D0%BE%D1%88%D1%91%D0%B2%D0%BE_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D1%8F_%D0%9C%D0%A6%D0%9A)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/MCC_Horoshevo.jpg","page_title":"Хорошёво (станция МЦК)","context_page_description":"Хорошёво — остановочный пункт / пассажирская платформа Малого кольца Московской железной дороги, обслуживающая маршрут городского электропоезда — Московское центральное кольцо. Открыта 10 сентября 2016 года вместе с открытием пассажирского движения электропоездов МЦК. Названа по Хорошёвскому шоссе и району Хорошёво-Мнёвники, но в действительности находится в 3 километрах к востоку от исторического Хорошёво."},{"page_url":"https://en.wikipedia.org/wiki/Mahmoud_Bodo_Rasch","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Fireproof_Tents_for_the_Muna_Tent_City%2C_SA_1998.jpg","page_title":"Mahmoud Bodo Rasch","context_page_description":"Mahmoud Bodo Rasch is a German architect who specializes in the construction of large convertible umbrellas and lightweight structures. He is founder and owner of SL Rasch GmbH Special and Lightweight Structures with branches in Leinfelden-Echterdingen, Jeddah, Mecca and Medina."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Krems-Stein","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Landstr_52.JPG","page_title":"Liste der denkmalgeschützten Objekte in Krems-Stein","context_page_description":"Die Liste der denkmalgeschützten Objekte in Krems-Stein enthält die 99 denkmalgeschützten unbeweglichen Objekte des Stadtteils Stein der Statutarstadt Krems an der Donau in Niederösterreich."},{"page_url":"https://fr.wikipedia.org/wiki/Soci%C3%A9t%C3%A9_des_avions_Caudron","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Royal_Military_Museum_Brussels_2007_422.JPG","page_title":"Société des avions Caudron","context_page_description":"La société des avions Caudron est un constructeur français d'avions, ayant existé de 1909 à 1946. En 1933, la société est rachetée par Renault. En 1946, la société est nationalisée et intégrée au sein de la SNCAN."},{"page_url":"https://sh.wikipedia.org/wiki/Xenia,_Ohio","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e6/OHMap-doton-Xenia.png","page_title":"Xenia, Ohio","context_page_description":"Zinija je grad u američkoj saveznoj državi Ohajo."},{"page_url":"https://es.wikipedia.org/wiki/Colombia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Lago_de_Tota_02.JPG","page_title":"Colombia","context_page_description":"Colombia, oficialmente República de Colombia, es un país soberano situado en la región noroccidental de América del Sur, que se constituye en un estado unitario, social y democrático de derecho cuya forma de gobierno es presidencialista. Es una república organizada políticamente en 32 departamentos descentralizados y el Distrito Capital de Bogotá, sede del Gobierno Nacional.​\\nIncluyendo la isla de Malpelo, el cayo Roncador y el banco Serrana, el país abarca una superficie de 1 141 748 km², ​ por lo que es el vigesimosexto país más grande del mundo y el séptimo más grande de América. Reclama como mar territorial el área hasta las 12 millas náuticas de distancia, ​ manteniendo un diferendo limítrofe al respecto con Venezuela y Nicaragua.​​ Limita al Oriente con Venezuela y Brasil, al Sur con Perú y Ecuador y al Noroccidente con Panamá; en cuanto a límites marítimos, colinda con Panamá, Costa Rica, Nicaragua, Honduras, Jamaica, Haití, República Dominicana y Venezuela en el mar Caribe, y con Panamá, Costa Rica y Ecuador en el océano Pacífico.​"},{"page_url":"https://af.wikipedia.org/wiki/NGC_6334","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/The_star-forming_Cat%E2%80%99s_Paw_Nebula_through_ArTeMiS%E2%80%99s_eyes.jpg","page_title":"NGC 6334","context_page_description":"NGC 6334 is ’n emissienewel en stervormende gebied in die Melkweg, in die sterrebeeld Skerpioen. Dit is in 1837 deur die sterrekundige John Herschel ontdek – hy het dit by Kaapstad in Suid-Afrika waargeneem."},{"page_url":"https://en.wikipedia.org/wiki/Scaevola_gaudichaudiana","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Scaevola_gaudichaudiana_%285188529688%29.jpg","page_title":"Scaevola gaudichaudiana","context_page_description":"Scaevola gaudichaudiana, the mountain naupaka, is a perennial shrub in the family Goodeniaceae.\\nThe plant is endemic to Hawaii.\\nIt was first described by Adelbert von Chamisso in 1832 in the journal Linnaea and was given the specific epithet, gaudichaudiana, to honour Charles Gaudichaud-Beaupré."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Monschau","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Monschau_Kirchstrasse_10.jpg","page_title":"Liste der Baudenkmäler in Monschau","context_page_description":"Die Liste der Baudenkmäler in Monschau enthält die denkmalgeschützten Bauwerke auf dem Gebiet der Stadt Monschau im Städteregion Aachen in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Monschau eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0-%D0%B3%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/%E9%BA%BB-bronze.svg","page_title":"Ма-гу","context_page_description":"Ма-гу — легендарная даосская бессмертная, фея, связанная с эликсиром жизни, является символической покровительницей женщин в китайской мифологии. Также считается добрым божеством весны и плодородия, чьё дыхание дарует жизнь. В китайской литературе Ма-гу описывается как красивая молодая женщина с длинными птичьими ногтями, в то время как ранние мифы связывают её с пещерами. «Ма-гу сянь-шоу» является популярным мотивом в китайском искусстве.\\nВ народных легендах Ма-гу является спасительницей людей, попавших в беду, на лубках изображается вместе с летучей мышью, символизирующей счастье; с бабочкой, означающей пожелание пережить 90-летний возраст; с маленьким мальчиком, как просьба, чтобы богиня даровала в семью сыновей; с персиком, плодом долголетия; с личжи, чудесным грибом, отведавший которого обретал бессмертие, и т. п."},{"page_url":"https://en.wikipedia.org/wiki/Hotel_Caf%C3%A9_Royal","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Cafe-royal-london.jpg","page_title":"Hotel Café Royal","context_page_description":"The Hotel Café Royal is a five-star hotel at 68 Regent Street in Piccadilly, London. Before its conversion in 2008–2012 it was a restaurant and meeting place."},{"page_url":"https://nl.wikipedia.org/wiki/Philip_Eijlander","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/PhilipEijlander2015.jpg","page_title":"Philip Eijlander","context_page_description":"Philip Eijlander vervulde van 20 november 2008 tot 4 juni 2015 de functie van rector magnificus van de Tilburg University. Daarvoor was hij gedurende ruim drie jaar de decaan van de faculteit rechtsgeleerdheid van dezelfde universiteit.\\nEijlander studeerde bestuurskunde aan de Universiteit Twente en promoveerde in 1993 aan de Universiteit van Tilburg. Hij werkt sinds 1983 aan de academie in verschillende functies waaronder vanaf 1999 als hoogleraar op het terrein van staats- en bestuursrecht. In de periode van 1989 tot 1997 was hij ook in dienst van de rijksoverheid als onder meer directeur Onderzoek en Wetenschapsbeleid bij het Ministerie van Justitie en directeur Toezicht bij het Ministerie van Sociale Zaken en Werkgelegenheid.\\nVan 1999 tot 2005 was hij directeur van het Schoordijk Instituut en vice-decaan onderzoek en van 1 januari 2005 tot 1 juli 2008 de decaan van de Tilburgse Rechtenfaculteit. In het najaar van 2008 werkte hij als gastonderzoeker aan de Law School van de Universiteit van Georgetown, Washington D.C. Sinds 20 november 2008 is hij de rector magnificus van de Tilburg University."},{"page_url":"https://de.wikipedia.org/wiki/Pfarrhaus_(Unterapfeldorf)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/2013_Apfeldorf_Kapellenweg_8.jpg","page_title":"Pfarrhaus (Unterapfeldorf)","context_page_description":"Das Pfarrhaus in Unterapfeldorf, einem Ortsteil der Gemeinde Apfeldorf im oberbayerischen Landkreis Landsberg am Lech, wurde 1747 bis 1749 errichtet. Das Pfarrhaus an der Flößerstraße 6 ist ein geschütztes Baudenkmal."},{"page_url":"https://en.wikipedia.org/wiki/Jedwabne_pogrom","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Jedwabne%2C_ul._I._Krasickiego%2C_obelisk_upami%C4%99tniaj%C4%85cy_tragedi%C4%99_zamordowanych_%C5%BByd%C3%B3w.jpg","page_title":"Jedwabne pogrom","context_page_description":"The Jedwabne pogrom was a massacre of Polish Jews in the town of Jedwabne, German-occupied Poland, on 10 July 1941, during World War II and the early stages of the Holocaust.\\nAt least 340 men, women and children were murdered, some 300 of whom were locked in a barn which was then set on fire. About 40 non-Jewish Poles were implicated as being perpetrators of the massacre. German military police were present in the town at the time.\\nThe massacre occurred among many others in the Podlasie region with the arrival of German troops shortly after their 21 June 1941 invasion of the Soviet Union, which had until then occupied Jedwabne in an 20-month reign of terror since the Hitler-Stalin Pact divided Poland in 1939. The killers at Jedwabne used the negative stereotype of \\"Jewish Communism\\" against their victims. Prior to the Soviet invasion of eastern Poland, Jedwabne had been located in an area which favored the National Party, an anti-Semitic bloc opposed to the prewar Polish government, which outlawed its radical violent wing in 1934."},{"page_url":"https://de.wikipedia.org/wiki/Motor-_und_Technikmuseum_in_Otr%C4%99busy","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/PL_Ursus_type_1921_1922_tractor.JPG","page_title":"Motor- und Technikmuseum in Otrębusy","context_page_description":"Das Motor- und Technikmuseum in Otrębusy ist ein privates Oldtimermuseum in der Ortschaft Otrębusy in der Nähe Warschaus. Es ist das größte Automobilmuseum in Osteuropa und beinhaltet eine der umfangreichsten motortechnischen Privatsammlungen Europas."},{"page_url":"https://pt.wikipedia.org/wiki/Frutose-6-fosfato","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Frutose6P-Estrutura_Wiki_.png","page_title":"Frutose-6-fosfato","context_page_description":"A frutose-6-fosfato, ou 6-fosfato de frutose, é um dos intermediários da glicólise. A glicólise é a seqüência de degradações enzimáticas da glicose, que inicia com esta e chega ao ácido pirúvico ou piruvato."},{"page_url":"https://ca.wikipedia.org/wiki/Prat_de_dall","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Prat_03_d%27abril_2006_034.jpg","page_title":"Prat de dall","context_page_description":"Un prat de dall o prat dallador és aquell tipus de prat destinat a ser dallat i del qual s'aprofita l'herba per utiiltzar-la com a aliment per al ramat estabulat. Són propis de les comarques humides de muntanya però arriben a la terra baixa mediterrània, on poden formar-se en sòls fèrtils temporalment inundats. Són hàbitats semi-naturals molt rics en biodiversitat, amb gran varietat d'espècies vegetals, papallones i altres insectes que són aliment d'aus. Aquests prats són especialment valuosos quan ajuden a conformar un mosaic amb altres hàbitats, aportant diversitat i heterogeneïtat al paisatge. Per aquest motiu, es consideren un hàbitat d'interès de conservació a nivell europeu. Per garantir l'existència dels prats de dall és necessari un maneig permanent, fet que en les darreres dècades ha sigut problemàtic per la manca de relleu generacional, el sobrepastureig o la difícil viabilitat econòmica d'aquests espais a nivell agrícola en l'actualitat."},{"page_url":"https://en.wikipedia.org/wiki/Grote_or_Sint-Laurenskerk_(Alkmaar)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Alkmaar_organ.jpg","page_title":"Grote or Sint-Laurenskerk (Alkmaar)","context_page_description":"Grote or Sint-Laurenskerk is a landmark formerly Protestant church in Alkmaar, Netherlands, now in secular use. The building is located on the Koorstraat. It is mostly closed in the winter and open for tourists in the summer months or by appointment."},{"page_url":"https://cs.wikipedia.org/wiki/Milan_Rynt","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Vyk%C5%99i%C4%8Dn%C3%ADk.jpg","page_title":"Milan Rynt","context_page_description":"DG\\nMilan Rynt je český básník, malíř, hudebník a učitel na DG."},{"page_url":"https://eo.wikipedia.org/wiki/Vladimir_Markovnikov","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Mgu_1798.jpg","page_title":"Vladimir Markovnikov","context_page_description":"Vladimiro MARKOVNIKOV estis rusa kemiisto, studis ekonomion en la Universitato de Kazano, estis asistanto de Aleksandro Butlerov, kaj lernanto de Emil Erlenmeyer en la Universitato de Hajdelbergo kaj de Hermann Kolbe en la Universitato de Lepsiko. En 1869, li sukcedis al Butlerov kiel profesoro en la Universitato de Kazano. En 1871, li estis nomumita profesoro en la Ŝtata Universitato de Odeso kaj post du jaroj li ekinstruis en la Universitato de Moskvo, kie li restis ĝis la lastaj jaroj de sia vivo.\\nĈiuj liaj verkoj estis pubikigitaj en la rusa. En siaj lastaj jaroj li esploris la aliciklajn kombinaĵojn kaj kontribuis por elmontri la ekziston de komponaĵoj kun ringoj je 4, 5 kaj 7 atomoj dum en tiu epoko oni kredis ke nur la 6-atomaj ciklaj komponaĵoj estis stabilaj. Interalie, li sin donis al intelekta formado de sennombraj junaj kemiistoj, nome, Nikolao Demjanov, Aleksejo Ĉiĉibabino kaj Nikolao Kiŝnero.\\nMarkovnikov estas ĉefe konata pro ties Regulo de Markovnikov, kreita en 1869, kiu klarigas la aldonajn reakciojn de la halogenidoj al alkenoj. Li same montris ke la buterata kaj izobuterata acidoj havas la saman kemian formulon, tamen, malsimilajn strukturojn."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E8%89%BE%E6%96%87%E6%96%AF_(%E7%8A%B9%E4%BB%96%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Ivins_UT.JPG","page_title":"艾文斯 (犹他州)","context_page_description":"艾文斯，是美國猶他州華盛頓縣下屬的一座城市。建市於 1922年，面積大約為9.76平方英里，海拔約為3,081英尺。根據2010年美國人口普查，該市有人口6,753人。"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AA%DB%8C%D9%88%D8%A7%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Aerodrom_Tivat.jpg","page_title":"تیوات","context_page_description":"شهر تیوات در کشور مونته‌نگرو واقع شده‌است. جمعیت این شهر ۹٫۹۵۶ نفر است. در تاریخ سده ۳ به عنوان شهر شناخته شد."},{"page_url":"https://fr.wikipedia.org/wiki/Szilv%C3%A1gy","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Szilv%C3%A1gy_l%C3%A9gifot%C3%B3.jpg","page_title":"Szilvágy","context_page_description":"Szilvágy est un village et une commune du comitat de Zala en Hongrie."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_gemeentelijke_monumenten_in_Klarenbeek","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Klarenbeek-jrkrepellaan-06190002.jpg","page_title":"Lijst van gemeentelijke monumenten in Klarenbeek","context_page_description":"De plaats Klarenbeek heeft gemeentelijke monumenten in de gemeente Apeldoorn en Voorst, hieronder een overzicht."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Windham_County,_Vermont","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Old_Broad_Brook_House_undergoing_restoration_and_conversion_to_the_Guilford_Country_store_in_Guilford%2C_Vt..JPG","page_title":"National Register of Historic Places listings in Windham County, Vermont","context_page_description":"This is a list of the National Register of Historic Places listings in Windham County, Vermont.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Windham County, Vermont, United States. Latitude and longitude coordinates are provided for many National Register properties and districts; these locations may be seen together in a map.\\nThere are 97 properties and districts listed on the National Register in the county, including 2 National Historic Landmarks.\\nThis National Park Service list is complete through NPS recent listings posted December 13, 2019."},{"page_url":"https://nl.wikipedia.org/wiki/Jean-Drapeau_(metrostation)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Station_Jean-Drapeau_%28M%C3%A9tro_de_Montr%C3%A9al%29.jpg","page_title":"Jean-Drapeau (metrostation)","context_page_description":"Jean Drapeau is een metrostation in de Canadese stad Montreal.\\nHet station ligt aan de gele lijn en is geopend ten behoeve van de wereldtentoonstelling die in 1967 in Montreal werd gehouden. Het station werd destijds genoemd naar het eiland dat het bediend, Île Saint-Hélène, en ligt in het expoterrein. Op 10 mei 2000 besloot de gemeenteraad om het station om te dopen in Jean-Drapeau ter ere van de oud burgemeester en initiator van de metro en de wereldtentoonstelling in Montreal. De naamswijzinging werd in maart 2001 doorgevoerd."},{"page_url":"https://fr.wikipedia.org/wiki/Houdancourt","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Houdancourt_%28Oise%29_%C3%89glise.JPG","page_title":"Houdancourt","context_page_description":"Houdancourt est une commune française située dans le département de l'Oise, en région Hauts-de-France. Ses habitants sont appelés les Houdancourtois et les Houdancourtoises."},{"page_url":"https://fr.wikipedia.org/wiki/Holothurie","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Haeckel_Amphoridea-12.jpg","page_title":"Holothurie","context_page_description":"Les Holothuries sont une classe d'animaux marins de l'embranchement des échinodermes au corps mou et oblong, et possédant un cercle de tentacules autour de la bouche. Elles sont aussi appelées concombres de mer ou bêches de mer, et possèdent une grande diversité de sobriquets sur les différentes côtes.\\nCes animaux, majoritairement benthiques vivent, suivant les espèces, de la surface aux abysses. Les holothuries mesurent généralement de 10 à 30 centimètres de long ; mais certaines espèces comme le cordon mauresque peuvent dépasser 3 mètres. Leurs plus proches parents sont les oursinss en dépit du peu de ressemblance visible. Ce sont des animaux parfaitement inoffensifs, mais parfois toxiques."},{"page_url":"https://en.wikipedia.org/wiki/J._Harry_McGregor","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4d/J._Harry_McGregor_crop_1940-3-5.jpg","page_title":"J. Harry McGregor","context_page_description":"James Harry McGregor was a Republican member of the U.S. House of Representatives from Ohio.\\nJames Harry McGregor was born on a farm near Unionport, Jefferson County, Ohio. He attended the public schools, West Lafayette College, and Oberlin College. During the First World War, he served as a sergeant with the One Hundred and Seventy-sixth Field Artillery, United States Army, in 1917 and 1918. He was engaged in the lumber and general contracting business at West Lafayette, Ohio, 1918-1945. He was a member of the school board of West Lafayette, Ohio, for eight years. He was a member of the Ohio House of Representatives from 1935 to 1940, serving as minority whip from 1937 to 1939 and as majority leader and speaker pro tempore in 1939 and 1940.\\nMcGregor was elected as a Republican to the Seventy-sixth Congress to fill the vacancy caused by the death of William A. Ashbrook. He was reelected to the Seventy-seventh and to the eight succeeding Congresses and served until his death. He served as chairman of the United States House Special Committee on Chamber Improvements during the Eightieth and Eighty-third Congresses. He had been renominated to the Eighty-sixth Congress."},{"page_url":"https://ceb.wikipedia.org/wiki/Spelaeornis_formosus","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/ElachuraKeulemans.jpg","page_title":"Spelaeornis formosus","context_page_description":"Espesye sa langgam nga una nga gihulagway ni [[Genevieve K ang Spelaeornis formosus. Walden]] ni adtong 1874. Ang Spelaeornis formosus sakop sa kahenera nga Spelaeornis sa kabanay nga Sylviidae. Giklaseklase sa IUCN ang espesye sa kinaminosang kalabotan. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://pl.wikipedia.org/wiki/Kaliningrad","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Krzysztof_Celestyn_Mrongowiusz_Kalendarz_pruski_polski_Kr%C3%B3lewiec_1793.jpg","page_title":"Kaliningrad","context_page_description":"Kaliningrad – miasto w Rosji, przy ujściu Pregoły do Zalewu Wiślanego, stolica obwodu kaliningradzkiego. Jest to ważny morski port handlowy i wojenny, połączony torem wodnym z otwartym Morzem Bałtyckim i awanportem Bałtyjsk, a także ośrodek przemysłu środków transportu, maszynowego, celulozowo-papierniczego i rybnego. Stanowi ponadto węzeł kolejowy, obsługiwane jest przez port lotniczy w pobliskim Chrabrowie. W mieście działają liczne szkoły wyższe. W 2015 roku liczyło 453,5 tys. mieszkańców."},{"page_url":"https://es.wikipedia.org/wiki/Controversia_de_la_circuncisi%C3%B3n_en_el_cristianismo_primitivo","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/File%22-Saint_Paul_Writing_His_Epistles%22_by_Valentin_de_Boulogne.jpg","page_title":"Controversia de la circuncisión en el cristianismo primitivo","context_page_description":"El concilio de Jerusalén​ durante la Edad Apostólica de la historia del cristianismo no incluía la circuncisión masculina religiosa como requisito para los nuevos gentiles convertidos. Esto se conoce como el «Decreto Apostólico»​​ y puede ser uno de los primeros actos de diferenciación temprana entre el cristianismo y el judaísmo.​​ La circuncisión se impuso sobre el patriarca bíblico Abraham, sus descendientes y sus siervos como «un símbolo de la Alianza», culminada con él por Dios para todas las generaciones, como un «pacto eterno».​"},{"page_url":"https://pl.wikipedia.org/wiki/Melodifestivalen_2010","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Jessica-andersson-melodifestivalen2010.jpg","page_title":"Melodifestivalen 2010","context_page_description":"Melodifestivalen 2010 – 49. edycja szwedzkich preselekcji do Konkursu Piosenki Eurowizji 2010. Półfinały odbyły się kolejno: 6, 13, 20 oraz 27 lutego, druga szansa 6 marca, a finał 13 marca. Podczas półfinałów o wynikach decydowali widzowie za pomocą głosowania telefonicznego, natomiast reprezentanta wybrali w połowie widzowie oraz jury.\\nPreselekcje wygrała Anna Bergendahl z piosenką „This Is My Life”, zdobywając w sumie 214 punktów w finale."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%87%AA%E6%AE%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/72nd_Shinbu_1945_Kamikaze.jpg","page_title":"自殺","context_page_description":"自殺とは自分で自分を殺すこと。自害、自死、自決、自尽、自裁、自刃などとも言い、状況や方法で表現を使い分ける場合がある。\\n世界保健機関によると、世界で2016年時点で毎年約80万人が自殺している。世界の自殺の75%は低中所得国で起こり、自殺は各国において死因の10位以内に入り、特に15 - 29歳の年代では2位になっていると報告している。\\n自殺は様々な事情が複雑に絡み合って生じる場合が多い。高所得国における主な理由は精神疾患であり、ほか金銭的問題、人間関係の悩み、病気による慢性痛などがある。WHOは「自殺は、そのほとんどが防ぐことのできる社会的な問題。適切な防止策を打てば自殺が防止できる」としている。そのうえでWHOは、一人一人のこの上なく尊い生命を守るため、本格的な予防戦略である世界自殺予防戦略を実施している。このようなWHOに準ずる形で、各国で行政・公的機関・NPO・有志の方々による多種多様な自殺予防活動が行われている。日本では『支援情報検索サイト』『いのち支える相談窓口』などが設けられていて「もしあなたが悩みを抱えていたら、ぜひ相談してください」と呼びかけている。日本では景気の回復に伴い、1978年から統計が始まった10万人あたりの自殺率が過去最低を下回るなど減少傾向にある。2020年の4月の自殺者数は前年度同月より20%減少した。新型コロナウイルス感染症の流行の影響で、家族ら同居する人が外出せず家にいることや、職場や学校に行く機会が減り、悩むことが少なかったことなどが要因とみられている。"},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_ministros_dos_Neg%C3%B3cios_Estrangeiros_de_Portugal","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Ant%C3%B3nio_Jos%C3%A9_de_Melo_Breyner_Teles_da_Silva.jpg","page_title":"Lista de ministros dos Negócios Estrangeiros de Portugal","context_page_description":"Esta é uma lista de ministros dos Negócios Estrangeiros de Portugal, entre o estabelecimento da Regência liberal na Terceira a 15 de março de 1830, e a atualidade. A lista cobre a Monarquia Constitucional, a Primeira República, o período ditatorial da Ditadura Militar, Ditadura Nacional e Estado Novo e o atual período democrático."},{"page_url":"https://bs.wikipedia.org/wiki/General_Dynamics_F-16","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/USAF_F-16C_Profile.jpg","page_title":"General Dynamics F-16","context_page_description":"General Dynamics F-16 jeste američki višenamjenski avion proizveden u firmi General Dynamics, čija je proizvodnja vojnih aviona preuzeta od kompanije Lockheed Martin. Njegova iznimna prilagodljivost smatra se jednim od glavnih razloga za uspješan izvoz u 24 zemlje. Također se smatra jednim od najsigurnijih višenamjenskih aviona na svijetu. Konstruiran kao lovački avion treće generacije, F-16 je i najuspješniji izvozni lovac Zapada, s preko 4.000 proizvedenih aviona. Borbeni spektar ovog aviona proširio se tokom upotrebe, tako da današnje varijante služe kao lovci, lovci-bombarderi, te za specijalne namjene u sklopu SEAD zadataka koje je ovaj tip preuzeo iz Wild Weasel varijante McDonnell F-4. Proizvodnja za USAF je završena, ali se i dalje proizvode novi avioni za izvoz. Širokim rasponom oružja i pametnih bombi, u svako doba dana i noći i u svim vremenskim uslovima, ovaj je avion u mogućnosti izvršiti sve postavljene zadatke.\\nU osnovi, F-16 je lovac za blisku zračnu borbu. Bio je prvi zapadni lovac sa fly-by-wire sistemom upravljanja, zbog čega su ga u početku zvali \\"električni mlaznjak\\"."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%97%D0%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/SZA_CTRL_Tour_Toronto_2017_11.jpg","page_title":"СЗА","context_page_description":"Солана Имани Роу, је позната под псеудонимом СЗА је америчка Р&Б пјевачица и композитор. СЗА је рођена у Саинт Лоуис-у, Мисури, касније се преселила у Маплевуд, Њу Џерзи. У октобру 2012. године, СЗА је објавила свој дебутски ЕП, Се. СЗА. Рун, који је потом праћен њеним другим ЕП-ом, назван С, у априлу 2013. У јулу 2013. откривено је да је потписала уговор са хип хоп издавачком кућом Топ Давг Ентертаинмент, преко које је објавила З, њен трећи ЕП и његово прво издање за продају у малопродаји, априла 2014.\\nСЗА-ин деби студијски албум, Цтрл, објављен је 9. јуна 2017. Који је добио универзално признање од разних критичара музике. Био је на броју 3 на америчкој Биллбоард Топ 200 и на крају је освоио Платинум од стране Удружења за снимање индустрије Америке.\\nСЗА је певачица нео соул чија је музика описана као алтернатива Р&Б, са елементима соул-а, хип хопа, као и минималистичким Р & Б-ом. Текстови СЗА описани су као \\"расплет\\", који се окреће око тема сексуалности, носталгије и напуштања. СЗА цитира различите уметнике који су јојбили инспирација, међу којима су Елла Фицџералд, Мелах, Бјорк, Јамирокаи и Лорен Хил."},{"page_url":"https://fr.wikipedia.org/wiki/Dolomites","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Alpine_chough_on_trail_sign.jpg","page_title":"Dolomites","context_page_description":"Les Dolomites constituent un massif montagneux des Préalpes orientales méridionales qui s'élève en Italie, à part environ égale entre le Trentin-Haut-Adige et la Vénétie. Il culmine à 3 343 mètres d'altitude à la Marmolada. Massif à géomorphologie bigarrée, il est caractérisé par une abondance de dolomie, roche sédimentaire carbonatée.\\nTerritoire aux limites contestées, les Dolomites représentent au sens large un ensemble des Alpes composé des Alpes de Fiemme et des Préalpes vicentines. Depuis le 26 juin 2009, le site Les Dolomites est inscrit au patrimoine mondial de l'UNESCO. Il comprend neuf parties dont certaines ne sont cependant pas situées dans les Dolomites."},{"page_url":"https://en.wikipedia.org/wiki/1914_All-Ireland_Senior_Hurling_Championship_Final","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Portumna_GAA_colours.PNG","page_title":"1914 All-Ireland Senior Hurling Championship Final","context_page_description":"The 1914 All-Ireland Senior Hurling Championship Final was the twenty-seventh All-Ireland Final and the culmination of the 1914 All-Ireland Senior Hurling Championship, an inter-county hurling tournament for the top teams in Ireland.\\nClare were the winners.\\nMonadrehid GAA Club refused a request from the Laois County Board for a contribution after the team reached the 1914 final. The club was using its money locally to deal with a player-welfare issue of their own."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D1%80%D1%82%D0%BE-%D0%A1%D0%B0%D0%BD%D1%82%D0%B0_%D0%A0%D1%83%D1%84%D0%B8%D0%BD%D0%B0_(%D1%81%D1%83%D0%B1%D1%83%D1%80%D0%B1%D0%B8%D0%BA%D0%B0%D1%80%D0%BD%D0%B0%D1%8F_%D0%B5%D0%BF%D0%B0%D1%80%D1%85%D0%B8%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/La_Storta_002.jpg","page_title":"Порто-Санта Руфина (субурбикарная епархия)","context_page_description":"Порто-Санта Руфина — субурбикарная епархия Римской епархии."},{"page_url":"https://eo.wikipedia.org/wiki/Konkero_de_Meksiko","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ce/Cort%C3%A9s_Ruta_Cuba-Tenochtitlan.png","page_title":"Konkero de Meksiko","context_page_description":"La Konkero de Meksiko ĉefe referencas al submetado de la Ŝtato Meksika aŭ Azteka, atingita de Hernán Cortés je la nomo de la reĝo Karolo la 1-a de Hispanio kaj favore al la Hispana Imperio inter 1519 kaj 1521. Finfine la 13an de aŭgusto de 1521 la urbo Meksiko falis en povo de la hispanaj konkistadoroj, post du jaroj de ardaj klopodoj, militaj, politikaj kaj konspiraj, en kiuj partoprenis, kun la hispanoj, ankaŭ indiĝenaj popoloj deantaŭe subpremitaj kaj vasaligitaj de la meksikoj, en intenco ribela — profite de la alianco kun la ĵus alvenintoj — for de la truditaj vivkondiĉoj en kiuj ili vivis. Tiu fakto markis la komencon de la hispana koloniigo kaj de la sekva nasko de la mestiza lando Meksiko.\\nKiam alvenis la hispanoj, en 1519, la meksika imperio estis tre juna kaj multaj el la subpremataj popoloj ankoraŭ konservis la memoron pri sia sendependa vivo; krome, anstataŭ konsideri Motekuhzoman kiel sian reganton, ili lin timis kaj malamis. Tiel, la vasalaj popoloj ne vidis en la hispanoj konkerantojn, sed liberigantojn."},{"page_url":"https://en.wikipedia.org/wiki/Belbimbre","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Belbimbre06.jpg","page_title":"Belbimbre","context_page_description":"Belbimbre is a municipality and town located in the province of Burgos, Castile and León, Spain. According to the 2004 census, the municipality has a population of 80 inhabitants."},{"page_url":"https://az.wikipedia.org/wiki/Bad%C4%B1mcan","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Aubergine.jpg","page_title":"Badımcan","context_page_description":"Badımcan — quşüzümü cinsinə aid bitki növü. Badımcançiçəklilər fəsiləsindən olub, tərkibində karotin, A vitamini, B qrupu vitaminlər, C vitamini, şəkər [3,2 %] olmaqla yanaşı, xeyli miqdarda kalium, fosfor, kalsium və dəmir duzları da vardır.\\nBadımcan istisevən birillik bitkidir. Əsasən Moldaviyada, Orta Asiya və Zaqafqaziya respublikalarında becərilir. Badımcan quruluşuna görə iri meyvə olub, qabıqla örtülmüşdür. Daxilində qalın ətli hissəsi və çoxlu toxumu vardır.\\nBadımcanın tərkibində 4,2% şəkər, 1,3% sellüloza, 0,2% üzvi turşu, 0,5% kül, 0,6% zülal, 0,5-0,7% pektin maddəsi, 0,0044-0,093%-ə qədər solanin qlükozidi vardır. Yetişib ötmüş badımcanın tərkibində solanin qlükozidi nisbətən çoxdur. Kal badımcanın tərkibində 0,8-3,7% nişasta olur.\\nBadımcan ölçüsünə və formasına görə qruplaşdırılır. Xırdameyvəli armudaoxşar badımcanların uzunluğu 8-10 sm, diametri 5-7 sm, irimeyvəli armudaoxşar badımcanda isə uyğun olaraq 10-18 və 8-13 sm, silindrformalı orta və iri ölçülü badımcanların uzunluğu 10-25 sm, diametri isə 5-8 sm-dir. Çəkisi 50 qr-dan 100 qr-a qədər olur. Lakin çox vaxt 100-300 qr irilikdə dərilir.\\nYetişməsinə görə tezyetişən, ortayetişən və gecyetişən sortları olur."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D0%BC%D0%B5%D1%80%D1%88%D0%B8%D0%B5_%D0%B2_%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D0%B5_2016_%D0%B3%D0%BE%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Cfb_3.jpg","page_title":"Умершие в январе 2016 года","context_page_description":"Это список известных людей, соответствующих установленным критериям значимости, умерших в январе 2016 года.\\nПричина смерти указывается лишь в исключительных случаях. В остальных случаях — не указывается.\\n← Декабрь 2015"},{"page_url":"https://en.wikipedia.org/wiki/Substituted_cathinone","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/3-IMC_structure.png","page_title":"Substituted cathinone","context_page_description":"Substituted cathinones, which include some stimulants and entactogens, are derivatives of cathinone. They feature a phenethylamine core with an alkyl group attached to the alpha carbon, and a ketone group attached to the beta carbon, along with additional substitutions. Cathinone occurs naturally in the plant khat whose leaves are chewed as a recreational drug."},{"page_url":"https://en.wikipedia.org/wiki/Tomb_of_Dai_Anga","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Beautiful_Columnar.JPG","page_title":"Tomb of Dai Anga","context_page_description":"The Tomb of Dai Anga, also known as the Gulabi Bagh, is a 17th-century Mughal tomb complex located in the Mughal-era suburb of Begampura, outside the Walled City of Lahore, Pakistan."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%B2%84%EC%A7%84_%EC%84%A0_%ED%95%AD%EA%B3%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Virgin_Sun_Airlines.jpg","page_title":"버진 선 항공","context_page_description":"버진 선 항공은 영국 크롤리에 기반을 둔 버진 그룹의 자회사로 1999년부터 2001년까지 존재했던 영국의 저비용 항공사로 알려져 있다."},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%B9%E0%A8%BE%E0%A8%AB%E0%A8%BC%E0%A8%A8%E0%A9%80%E0%A8%85%E0%A8%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Hf-crystal_bar.jpg","page_title":"ਹਾਫ਼ਨੀਅਮ","context_page_description":"{{#if:| }}\\nਹਾਫ਼ਨੀਅਮ ਇੱਕ ਰਸਾਇਣਕ ਤੱਤ ਹੈ ਜਿਹਦਾ Hf ਅਤੇ ਪਰਮਾਣੂ ਸੰਖਿਆ ੭੫ ਹੈ। ਇਹ ਇੱਕ ਚਮਕਦਾਰ, ਸਲੇਟੀ ਚਾਂਦੀ ਰੰਗੀ, ਚਹੁਸੰਯੋਜਕੀ ਪਰਿਵਰਤਨ ਧਾਤ ਹੈ ਜੋ ਰਸਾਇਣਕ ਤੌਰ 'ਤੇ ਜ਼ਿਰਕੋਨੀਅਮ ਵਰਗਾ ਹੈ ਅਤੇ ਜ਼ਿਰਕੋਨੀਅਮ ਦੀਆਂ ਧਾਤਾਂ ਵਿੱਚ ਮਿਲਦਾ ਹੈ। ਇਹਦੀ ਹੋਂਦ ਦੀ ਭਵਿੱਖਬਾਣੀ ੧੮੬੯ ਵਿੱਚ ਦਮਿਤਰੀ ਮੈਂਡਲੀਵ ਨੇ ਕੀਤੀ ਸੀ। ਇਹ ਨਾਂ Hafnia, \\"ਕੋਪਨਹੈਗਨ\\" ਦੀ ਲਾਤੀਨੀ, ਮਗਰੋਂ ਰੱਖਿਆ ਗਿਆ ਹੈ ਜਿੱਥੇ ਇਹਦੀ ਖੋਜ ਹੋਈ ਸੀ।"},{"page_url":"https://es.wikipedia.org/wiki/Ciudad_Ixtepec","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e8/Palacio_ixtepec.jpg","page_title":"Ciudad Ixtepec","context_page_description":"Ciudad Ixtepec, es una población dentro del municipio del mismo nombre en el estado de Oaxaca, México; localizado en la región del Istmo de Tehuantepec.\\nLa ciudad se encuentra a 45 minutos de Tehuantepec y a 4.5 horas de la capital del estado, Oaxaca de Juárez. Cuenta con una vasta tradición cultural heredada de los zapotecas y que ha ido enriqueciéndose al paso de las décadas debido a que gente de todas partes ha llegado a vivir a ella. Además de ser unos de los pocos lugares con herencia francesa y árabe, teniendo posiblemente el asentamiento más antiguo de toda la región.\\nSu dialecto el zapoteco tiene fonemas diferentes a la de otros pueblos vecinos."},{"page_url":"https://en.wikipedia.org/wiki/John_of_Nottingham","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ea/Edward_II_of_England1.jpg","page_title":"John of Nottingham","context_page_description":"John of Nottingham was a famous 14th century magician, said to have plotted to kill Edward II of England and Hugh Despenser the Younger in 1324 through witchcraft."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%BE%D0%B2%D1%87%D0%BE%D1%8F%D1%80%D1%96%D0%B2%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Fugarivka3.jpg","page_title":"Вовчоярівка","context_page_description":"Вовчоя́рівка — селище міського типу в Україні, у Попаснянському районі Луганської області."},{"page_url":"https://en.wikipedia.org/wiki/Tu%C4%9Fba_%C3%96zay","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Tu%C4%9Fba_%C3%96zay.jpg","page_title":"Tuğba Özay","context_page_description":"Nihal Tuğba Özay is a Turkish model-turned-singer and a famous star in Turkey. She was elected the first runner-up in the Miss Model of the World contest in 1995."},{"page_url":"https://war.wikipedia.org/wiki/Odontophorus_leucolaemus","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Odontophorus_leucolaemusCJ-AvesP74A.jpg","page_title":"Odontophorus leucolaemus","context_page_description":"An Odontophorus leucolaemus in uska species han Aves nga ginhulagway ni Osbert Salvin hadton 1867. An Odontophorus leucolaemus in nahilalakip ha genus nga Odontophorus, ngan familia nga Odontophoridae. Ginklasipika han IUCN an species komo diri gud kababarak-an. Waray hini subspecies nga nakalista."},{"page_url":"https://hu.wikipedia.org/wiki/Szecesszi%C3%B3s_%C3%A9p%C3%ADt%C3%A9szet_Magyarorsz%C3%A1gon","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Erzs%C3%A9bet_h%C3%ADd_a_Gell%C3%A9rthegyr%C5%91l._Fortepan_10957.jpg","page_title":"Szecessziós építészet Magyarországon","context_page_description":"A magyarországi szecessziós építészet az Osztrák–Magyar Monarchia részét képező Magyar Királyságban a 19–20. század fordulóján meghatározó, a szecessziós művészethez kötődő, elsősorban magyar építészek által művelt, többféle művészeti és stílusirányzatból összeálló épített örökséget jelenti.\\nA magyarországi építészetben a szecesszió jegyei az 1890-es években tűntek fel először, és a századfordulós fénykort követően az 1910-es évek végére, voltaképp az első világháborúval, korszaka lezártnak tekinthető. A stílus legfontosabb hazai mestere Lechner Ödön. Az általa, valamint követői és tanítványai által kifejlesztett és művelt magyaros szecesszió mellett, részben párhuzamosan, a stílusnak többféle irányzata létezett: egyes hazai épületeken megfigyelhető a francia és a belga Art Nouveau, a német Jugendstil, a bécsi kortársak, vagy épp a korabeli skandináv és angol építészet hatása. Lechner elméleti és gyakorlati munkássága a korszak több meghatározó építésze, így Lajta Béla, vagy a Fiatalok csoportjának egyik alapítója, Kós Károly számára is fontos kiindulópontot jelentett.\\nBudapest európai összehasonlításban is gazdag szecessziós műemlékekben."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Wallern_im_Burgenland","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/GuentherZ_2012-07-31_0107_Wallern_im_Bgld_Wassergasse_Marienkroenungssaeule.jpg","page_title":"Liste der denkmalgeschützten Objekte in Wallern im Burgenland","context_page_description":"Die Liste der denkmalgeschützten Objekte in Wallern im Burgenland enthält die 6 denkmalgeschützten, unbeweglichen Objekte der Gemeinde Wallern im Burgenland."},{"page_url":"https://hu.wikipedia.org/wiki/Megalobrama","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Megalobrama_terminalis.jpg","page_title":"Megalobrama","context_page_description":"A Megalobrama a csontos halak főosztályának sugarasúszójú halak osztályába, a pontyalakúak rendjébe, a pontyfélék családjába, és az Cultrinae alcsaládjába tartozó nem."},{"page_url":"https://nl.wikipedia.org/wiki/Johann_Strauss-monument","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Johann_Strauss_Denkmal_Wien.JPG","page_title":"Johann Strauss-monument","context_page_description":"Het Johann Strauss-monument is een monument in het Weense stadspark dat gewijd is aan Johann Strauss jr. Het bevindt zich in de buurt van de Kursalon Hübner. Het is een verguld bronzen standbeeld en vertoont een vioolspelende Strauss in een staande houding."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_r%C3%A9gions_des_%C3%89tats-Unis","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Hawaiianislandchain_USGS.png","page_title":"Liste des régions des États-Unis","context_page_description":"Cet article est une liste de certaines régions des États-Unis. De nombreuses régions sont définies par des lois ou des règlements du gouvernement fédéral, d'autres par une culture et une histoire partagées et d'autres par des facteurs économiques."},{"page_url":"https://fr.wikipedia.org/wiki/Anastasia_Mikha%C3%AFlovna_de_Russie","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/1851_Friedrich_Franz.JPG","page_title":"Anastasia Mikhaïlovna de Russie","context_page_description":"Anastasia Mikhaïlovna de Russie, née le 28 juillet 1860 à Peterhof, décédée le 11 mars 1922 à Èze, est une grande-duchesse de Russie et par son mariage grande-duchesse de Mecklembourg-Schwerin."},{"page_url":"https://en.wikipedia.org/wiki/List_of_City_of_Pittsburgh_historic_designations","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Tufa_Bridge%2C_Schenley_Park%2C_2015-09-19%2C_02.jpg","page_title":"List of City of Pittsburgh historic designations","context_page_description":"Historic designations in the City of Pittsburgh are awarded following nominations for districts and individual structures that are reviewed and recommended to Pittsburgh City Council, which makes the final decision, by the city's Historic Review Commission and the City Planning Commission. This list is not to be confused with the list of landmarks designated by the Pittsburgh History and Landmarks Foundation. City Historic Designation establishes a regulatory process for the review of all changes and alterations by the Historic Review Commission to the publicly viewable exterior and appearance of all buildings that are designated, either individually or as part of a district. As of 2011, there were 12 designated districts in the city, two historic objects, one historic site, and 87 individual structures."},{"page_url":"https://cs.wikipedia.org/wiki/Doln%C3%AD_P%C5%99edm%C4%9Bst%C3%AD_(Vala%C5%A1sk%C3%A9_Mezi%C5%99%C3%AD%C4%8D%C3%AD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Kr%C3%A1sno_nad_Be%C4%8Dvou%2C_Vrbensk%C3%A1_2.jpg","page_title":"Dolní Předměstí (Valašské Meziříčí)","context_page_description":"Dolní Předměstí je bývalé předměstí ve Valašském Meziříčí ve Zlínském kraji. Pod názvem Valašské Meziříčí-Dolní Předměstí se do roku 1974 také jednalo o samostatné katastrální území."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E9%BB%91%E9%BE%8D%E6%B1%9F%E7%9C%81","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/%E3%82%BD%E3%83%95%E3%82%A3%E3%82%B9%E3%82%AB%E3%83%A4%E5%AF%BA%E9%99%A2%E3%83%BB%E8%81%96%E7%B4%A2%E8%8F%B2%E4%BA%9C%E6%95%99%E5%A0%82.jpg","page_title":"黑龍江省","context_page_description":"黑龍江，簡稱黑hak¹，係中國東北地區嘅省，省名以中俄界河黑龍江來命名，呢條江嘅滿文名叫Sahaliyan ula，意思係「黑河」，省名同江名都係意譯自滿文。北面同東面係俄羅斯，南面接住吉林省，西面接住內蒙古。佢嘅省城係哈爾濱市。\\n全省由西北到東南都係連續嘅山地，包括大興安嶺、小興安嶺、完達山、張廣才嶺等山脈，其中好多係火山。而西南部嘅松嫩平原係主要嘅農業區同人口聚居區域。黑龍江、烏蘇里江同埋松花江交滙嘅地區就係三江平原，入面有大片沼澤濕地，係著名嘅「北大荒」，中國派咗建設兵團去開墾呢啲地方。中國邊疆最東點（黑瞎子島）同埋最北點（漠河）都響黑龍江省。\\n黑龍江省係中國鐵路通車里程最長嘅省，幾乎所有重要城市都有火車接駁；公路、內河航運都好發達；省入面有兩個國際機場，分別係哈爾濱太平國際機場同牡丹江海浪機場，機場航線可以飛去全國重要城市，同埋少數境外城市。"},{"page_url":"https://et.wikipedia.org/wiki/Keila_j%C3%B5gi","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Lohu_m%C3%B5isa_veskitamm_Keila_j%C3%B5el.jpg","page_title":"Keila jõgi","context_page_description":"Keila jõgi on Soome lahe vesikonna pikim jõgi, voolab Rapla- ja Harjumaa territooriumil. Jõgi saab alguse Kuimetsa külast 5 km lõunakagu pool ja suubub Soome lahte. Tähtsamad lisajõed on Atla ja Maidla.\\nKeila jõe pikkus on 111,8 km, koos lisaharudega 127,3 km. Valgala on 669,3 km². Keila jõgi on Eesti pikimate jõgede seas viiendal kohal.\\nKeila jõe algusosa jääb Kõrvemaale, oma põhiosas voolab ta Põhja-Eesti lavamaa territooriumil. Jõe lähe asub Viirika soo lääneservas. Algusosas teeb jõe jõesäng suurema kaare lõunasse ja kogub rohkesti vett Kaiu ümbruse suurtest allikatest Karitsa küla kohal. Edasi käändub jõgi loodesse ja jätkab selles üldsihis, enamasti looduslikus sängis, voolamist kuni suudmeni. Jõgi suubub Lohusalu lahte Keila-Joa aleviku pargis.\\nKeila jõgi läbib võrdlemisi tiheda asustusega piirkondi ja jõe kallastel paikneb rohkesti asulaid. Keskjooksul asub Kohila alev, Kurtna ja Kiisa alevik. Alamjooksul paiknevad Keila linn, Karjaküla alevik ja Keila-Joa alevik.\\nKeila jõe veepinna absoluutne kõrgus on lähtel 75,1 m ja suudmes 0. Jõe keskmine lang on 0,65 m/km.\\nSuurim on lang alamjooksu viimasel viiel kilomeetril, kus jõgi murrab läbi Põhja-Eesti paekalda."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9C%CE%B9%CF%87%CE%B1%CE%AE%CE%BB_%CE%9C%CE%AE%CF%84%CF%81%CE%B1%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/%CE%9C%CE%B9%CF%87%CE%B1%CE%AE%CE%BB_%CE%9C%CE%AE%CF%84%CF%81%CE%B1%CF%82.jpg","page_title":"Μιχαήλ Μήτρας","context_page_description":"Ο Μιχαήλ Μήτρας γεννήθηκε το 1944 στον Βόλο και πέθανε στις 6 Μαρτίου 2019 στη Νέα Μάκρη Αττικής. Ήταν ποιητής και πεζογράφος.\\nΠαρακολούθησε νομικά στο Πανεπιστήμιο Θεσσαλονίκης και ραδιοσκηνοθεσία στο City Literary Institute του Λονδίνου.\\nΣτην ποίησή του είναι φανερές οι επιδράσεις των ρευμάτων της «συγκεκριμένης», και της «οπτικής» ποίησης, ενώ στην πεζογραφία του απουσιάζει η γραμμική αφήγηση και κυριαρχεί η αποσπασματικότητα.\\nΕκτός από τις εκδόσεις των βιβλίων του και τις δημοσιεύσεις σε λογοτεχνικά περιοδικά, έχει εκθέσει \\"οπτικά ποιήματα\\" σε ατομικές και ο μαδικές εκθέσεις στην Ελλάδα και το εξωτερικό.\\nΣυνεργάστηκε στη σύνταξη της ετήσιας έκδοσης \\"Χρονικό\\" και των περιοδικών \\"Σήμα\\", \\"Ρεύματα\\".\\nΕίναι μέλος της Εταιρείας Συγγραφέων. Ύστερα από πρότασή του, το 1998, η Εταιρεία Συγγραφέων καθιέρωσε για πρώτη φορά στην Ελλάδα, την Ημέρα Ποίησης - 21 Μαρτίου. Κείμενά του έχουν μεταφραστεί στα αγγλικά και γαλλικά. Εργάστηκε ως παραγωγός εκπομπών λόγου στο Τρίτο και στο Πρώτο Πρόγραμμα της ΕΡΑ."},{"page_url":"https://pt.wikipedia.org/wiki/Furac%C3%A3o_Edith_(1971)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Edith1971sep91339z.png","page_title":"Furacão Edith (1971)","context_page_description":"Furacão Edith foi o furacão mais forte a formar-se durante a Temporada de furacões no Atlântico de 1971 e o furacão de Categoria 5 no Atlântico a ter atingido o solo mais ao sul até ser superado pelo Furacão Felix, em 2007. O Furacão Edith desenvolveu-se a partir duma onda tropical em 5 de setembro e rapidamente transformou-se num furacão no Mar do Caribe. O Furacão Edith intensificou-se rapidamente em 9 de setembro e atingiu o solo no Cabo Gracias a Dios como um furacão de Categoria 5 na Escala de furacões de Saffir-Simpson. Rapidamente perdeu intensidade na América Central e depois de entrar brevemente no Golfo de Honduras, atravessou a Península de Iucatã, no México. Depois de atravessar o Golfo do México, um cavado desviou a tempestade para o nordeste e o Furacão Edith, depois de ter restabelecido-se enquanto acelerava em direção à costa, atingiu a Luisiana com ventos de 105 mph em 16 de setembro. O Furacão Edith enfraqueceu-se sobre o solo e dissipou-se sobre a Geórgia em 18 de setembro.\\nO furacão matou duas pessoas quando passou perto de Aruba."},{"page_url":"https://en.wikipedia.org/wiki/Delia_Ephron","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Delia_Ephron01.JPG","page_title":"Delia Ephron","context_page_description":"Delia Ephron is an American bestselling author, screenwriter, and playwright."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%81%D9%8A%D8%B1%D9%88%D8%B2_%D8%A2%D8%A8%D8%A7%D8%AF%D8%8C_%D8%A3%D8%AA%D8%B1_%D8%A8%D8%B1%D8%AF%D9%8A%D8%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Firozabad_UP_2.jpg","page_title":"فيروز آباد، أتر برديش","context_page_description":"فيروز آباد هي مدينة من مدن الهند تقع في اقليم أتر برديش. يبلغ عدد سكانها 603,797 نسمة حسب إحصائيات سنة 2011."},{"page_url":"https://cs.wikipedia.org/wiki/Knockeensk%C3%A1_port%C3%A1lov%C3%A1_hrobka","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Knockeen_Dolmen_IMG_4715.jpg","page_title":"Knockeenská portálová hrobka","context_page_description":"Knockeenská portálová hrobka je megalitická stavba nalézající se v Knockeenu v irském hrabství Waterford. Jedná se o největší dolmenovou stavbu v tomto hrabství, která sestává z dvojice závěrných kamenů, přesto není nejvyšší stojící kamennou stavbou. Jedná se o jednu z nejlepších ukázek dolmenů v Irsku."},{"page_url":"https://ca.wikipedia.org/wiki/Casa_Francesc_Cama","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ef/FcescBerenguer-barcelona-granGracia77-7348.jpg","page_title":"Casa Francesc Cama","context_page_description":"La Casa Francesc Cama és una obra modernista de Barcelona protegida com a Bé Cultural d'Interès Local."},{"page_url":"https://ro.wikipedia.org/wiki/Arhiducesa_Maria_Josepha_a_Austriei","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Maria_Josepha_of_Austria_-_Anton_Raphael_Mengs_-_1767.jpg","page_title":"Arhiducesa Maria Josepha a Austriei","context_page_description":"Arhiducesa Maria Josepha de Austria. A fost al doisprezecelea copil al împăratului Francisc I și a împărătesei Maria Tereza a Austriei. A murit de variolă la vârsta de 16 ani."},{"page_url":"https://sk.wikipedia.org/wiki/Lu%C5%BEick%C3%A9_hory","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Luftbild_von_Gipfel_Jedlov%C3%A1.JPG","page_title":"Lužické hory","context_page_description":"Lužické hory sú geomorfologický celok a pohorie na severe Čiech a juhovýchode Nemecka. Najvyšší vrch Luž dosahuje výšku 793 m n. m."},{"page_url":"https://pl.wikipedia.org/wiki/Recz","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Panorama_Recza.JPG","page_title":"Recz","context_page_description":"Recz – miasto w woj. zachodniopomorskim, w powiecie choszczeńskim, położone nad rzeką Iną. Siedziba miejsko-wiejskiej gminy Recz.\\nWedług danych z 31 grudnia 2009 roku miasto miało 2971 mieszkańców."},{"page_url":"https://en.wikipedia.org/wiki/Krishnanattam","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Krishnanattam_Guruvayur_2.jpg","page_title":"Krishnanattam","context_page_description":"Krishnaattam is a temple art in Kerala, India. It is a dance drama and presents the story of Krishna in a series of eight plays and was created by Manaveda, the then Zamorin Raja of Calicut in northern Kerala. The eight plays are: Avataram, Kaliyamardanam, Rasakrida, Kamsavadham, Swayamvaram, Banayuddham, Vividavadham and Swargarohanam. It survives in its glory at the Guruvayur Sri Krishna temple.\\nThe troupe of players, once maintained by Zamorin of Calicut came to Guruvayur Devaswom. in 1958.The only troupe of artists are well maintained by devaswom till date."},{"page_url":"https://ceb.wikipedia.org/wiki/Backford","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/St_Oswald%27s_Church%2C_Backford_%281%29.JPG","page_title":"Backford","context_page_description":"Distrito ang Backford sa Hiniusang Gingharian. Nahimutang ni sa kondado sa Cheshire West and Chester ug apil sa nasod sa Inglatera, sa habagatang bahin sa nasod, 270 km sa amihanan-kasadpan sa London ang ulohan sa nasod.\\nAng klima kasarangan. Ang kasarangang giiniton 7 °C. Ang kinainitan nga bulan Hulyo, sa 16 °C, ug ang kinabugnawan Disyembre, sa 0 °C."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%90%E3%83%88%E3%83%B3%E3%83%AB%E3%83%BC%E3%82%B8%E3%83%A5%E3%81%AE%E6%88%A6%E3%81%84_(1862%E5%B9%B4)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5c/USS_essex_1856.jpg","page_title":"バトンルージュの戦い (1862年)","context_page_description":"バトンルージュの戦いは、南北戦争の1862年8月5日に、ルイジアナ州イーストバトンルージュ郡で起きた海陸の戦闘である。この戦闘に北軍が勝利することで、南軍がルイジアナ州を取り戻そうとする動きを止めた。"},{"page_url":"https://de.wikipedia.org/wiki/Pobiti_Kamani","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Bosque_de_Piedra%2C_provincia_de_Varna%2C_Bulgaria%2C_2016-05-27%2C_DD_83.jpg","page_title":"Pobiti Kamani","context_page_description":"Pobiti Kamani ist eine weit gestreute Gruppe von Steinformationen in Bulgarien. Die Nord-Süd-Ausdehnung des Areals beträgt 8 km, die Ost-West-Ausdehnung 3 km. Die Steinformationen befinden sich einen Kilometer östlich von Dewnja, 18 km westlich von Warna und erstrecken sich über eine Fläche von 7 km². Gelegentlich wird wegen der Ähnlichkeit zu Stein gewordenen Bäumen auch die Bezeichnung Steinerner Wald verwendet.\\nBis zum Anfang des 19. Jahrhunderts, bis zur genauen Beschreibung durch einen russischen Offizier, wurden diese säulenförmigen Steinformationen für die Überreste einer griechischen Stadt gehalten. Immerhin liegen 10 km weiter westlich die Überreste von Marcianopolis, der größten ehemaligen römischen Stadt im heutigen Bulgarien."},{"page_url":"https://hu.wikipedia.org/wiki/Szaturnusz-d%C3%ADj_a_legjobb_f%C3%A9rfi_mell%C3%A9kszerepl%C5%91nek","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/89/Scatman_Crothers_%281975%29_cropped.jpg","page_title":"Szaturnusz-díj a legjobb férfi mellékszereplőnek","context_page_description":"A legjobb férfi mellékszereplőnek járó Szaturnusz-díjat évente adja át az Academy of Science Fiction, Fantasy & Horror Films szervezet. A díjjal a mozifilmes sci-fi, fantasy és horror-szerepléseket jutalmazzák, az 1976-os, 3. díjátadó óta.\\nA díjat két alkalommal csupán Burgess Meredith, Ian McKellen és Andy Serkis nyerte meg. Egyazon alakításáért kizárólag Javier Bardemnek és Heath Ledgernek ítélték oda a legjobb férfi mellékszereplőnek járó Szaturnusz-díjat és a legjobb férfi mellékszereplőnek járó Oscar-díjat is."},{"page_url":"https://eu.wikipedia.org/wiki/Dionisio_I.a_Sirakusakoa","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7d/EarofDionysius.jpg","page_title":"Dionisio I.a Sirakusakoa","context_page_description":"Dionisio I.a edo Dionisio Zaharra Sirakusako tirano bat izan zen. Hark anitz hiri konkistatu zituen Sizilian eta Italiako hegoaldean, Kartagoko eraginari aurre egin zion eta Sirakusa mendebaldeko greziar kolonietatik indartsuena bilakatu zuen. Antzinako garaiko despoten eredurik txarrena izan zen, krudela, mesfidatia eta mendekaria."},{"page_url":"https://en.wikipedia.org/wiki/Nova_Esperan%C3%A7a_do_Sul","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1b/RioGrandedoSul_Municip_NovaEsperancadoSul.svg","page_title":"Nova Esperança do Sul","context_page_description":"Nova Esperança do Sul is a municipality in the state of Rio Grande do Sul, Brazil."},{"page_url":"https://de.wikipedia.org/wiki/Residenzschloss_Darmstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Residenzschloss-Darmstadt-Ostansicht.jpg","page_title":"Residenzschloss Darmstadt","context_page_description":"Das Residenzschloss Darmstadt, häufig auch Stadtschloss genannt, ist der im Zentrum der hessischen Stadt Darmstadt gelegene ehemalige Wohn- und Verwaltungssitz der Landgrafen und von 1806 bis 1919 der Großherzöge von Hessen-Darmstadt."},{"page_url":"https://hu.wikipedia.org/wiki/Habsburg%E2%80%93Lotaringiai_Zs%C3%B3fia_f%C5%91hercegn%C5%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Sophieaustria.jpg","page_title":"Habsburg–Lotaringiai Zsófia főhercegnő","context_page_description":"Habsburg–Lotaringiai Zsófia Friderika Dorottya Anasztázia Amália Erzsébet Franciska Stefánia Karolina Mária Jozefa főhercegnő császári-királyi osztrák főhercegnő, Ferenc József és Erzsébet elsőszülött leánya. Kétéves korában halt meg tífuszban."},{"page_url":"https://cv.wikipedia.org/wiki/%D0%97%D1%83%D1%80%D0%B7%D0%B5%D0%B5_(%D1%82%D1%8B%D1%82%C4%83%D0%BC%D0%BB%D0%B0%D0%BD%D0%B8)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Karte_Bezirk_Sursee.png","page_title":"Зурзее (тытăмлани)","context_page_description":"Зурзее — Швейцарири тăрăх. Тăрăх центрĕ — Зурзее хула.\\nТăрăх Люцерн кантонне кĕрет. 302,04 км² лаптăка йышăнать. 65 362 çын пурăнать. Официаллă код — 0304."},{"page_url":"https://pl.wikipedia.org/wiki/Rz%C4%99dowo%C5%9B%C4%87","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/57/Sec._Hydrocarbon_Structural_Formulae_V.1.png","page_title":"Rzędowość","context_page_description":"Rzędowość – termin stosowany przy opisie budowy związku chemicznego określający stopień podstawienia atomu w cząsteczce. Używany jest on przede wszystkim w chemii organicznej do wskazania liczby grup organicznych przyłączonych do danego atomu, co pozwala czasem na scharakteryzowanie ogólnych właściwości związku i przewidzenie jego zachowania w trakcie niektórych reakcji chemicznych. Niekiedy terminu tego używa się również w chemii nieorganicznej do opisu soli pochodzących od kwasów wieloprotonowych."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D1%83%D1%80%D0%B0_%D0%B6%D0%B8%D1%80%D0%BE%D0%B2%D0%B0_%D1%82%D0%BA%D0%B0%D0%BD%D0%B8%D0%BD%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/84/Braunes-Fett-PET-18.jpg","page_title":"Бура жирова тканина","context_page_description":"Бу́ра жирова́ ткани́на або бурий жир — спеціалізований тип жирової тканини, у якій окиснення жирів відбувається для отримання тепла, а не для синтезу АТФ. Має буре забарвлення внаслідок наявності великої кількості мітохондрій, що містять цитохроми із гемовими групами, які інтенсивно поглинають видиме світло. Найбільше цього типу жирової тканини у тілах дитинчат більшості ссавців, в тому числі і людини, а також у звірів, що впадають у зимову сплячку, тобто в тих організмів, що не можуть отримувати тепло тремтінням."},{"page_url":"https://en.wikipedia.org/wiki/Tsaliet","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Tinsehe_waterfall_2.jpg","page_title":"Tsaliet","context_page_description":"Tsaliet is a river in northern Ethiopia, belonging to the Nile basin. Rising in the mountains of Dogu’a Tembien, where it is first called May Leiba River and then Tinsehe River, it flows westward through a deep gorge, to become Tsaliet in its lower course, where it empties in Weri’i River, just upstream of the main Weri’i bridge along the road to Adwa."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A2%D0%B5%D1%84%D0%B5%D1%80%D0%BE%D1%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ec/Rueckhaltebecken_Taeferrot1.jpg","page_title":"Теферот","context_page_description":"Теферот општина је у њемачкој савезној држави Баден-Виртемберг. Једно је од 42 општинска средишта округа Осталб. Према процјени из 2010. у општини је живјело 1.047 становника. Посједује регионалну шифру 8136070."},{"page_url":"https://en.wikipedia.org/wiki/Grade_I_listed_buildings_in_Cumbria","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Brigham-church.jpg","page_title":"Grade I listed buildings in Cumbria","context_page_description":"There are over 9000 Grade I listed buildings in England. This page is a list of these buildings in the county of Cumbria, sub-divided by district."},{"page_url":"https://ca.wikipedia.org/wiki/Aubign%C3%A9-sur-Layon","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1e/Map_commune_FR_insee_code_49012.png","page_title":"Aubigné-sur-Layon","context_page_description":"Aubigné-sur-Layon és un municipi francès, situat al departament de Maine i Loira i a la regió de País del Loira. L'any 2007 tenia 357 habitants."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AF%D9%8A%D8%B3%D8%A7%D9%86%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Rizi%C3%A8re_%C3%A0_Desana-Verceil.jpg","page_title":"ديسانا","context_page_description":"ديسانا هي بلدية في مقاطعة فرشيلي التابعة لإقليم بييمونتي الإيطالي، تقع على بعد حوالي 60 كيلومتر إلى الشمال الشرقي من مدينة تورينو وحوالي 8 كيلومتر إلى الجنوب الغربي من فيرتشيلي. في 31 كانون الأول / ديسمبر 2004 كان عدد سكانها 1,085 نسمة، وتبلغ مساحتها 16.5 كيلومتر مربع.\\nتقع ديسانا على حدود البلديات التالية: أزيليانو فيرسيلسي، كوستانزانا، لينانا، رونسيكو، تريسيرو، فيرتشيلي."},{"page_url":"https://sh.wikipedia.org/wiki/Sarner_Aa","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Wichelsee_2012_10.jpg","page_title":"Sarner Aa","context_page_description":"Sarner Aa zvana i Sarneraa je rijeka u Švicarskoj duga 28 km."},{"page_url":"https://no.wikipedia.org/wiki/Skadedyr","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Kurre5.jpg","page_title":"Skadedyr","context_page_description":"Skadedyr er et eller flere dyr som utnytter en ressurs som også har interesse for oss mennesker, som forårsaker «en skade», og som oftest et økonomisk tap. Andre dyr som er smittebærere av sykdommer eller på ett eller annet vis er til plage eller sjenanse for menneskeheten, blir ofte regnet som skadedyr. Motsatsen til et skadedyr er et nyttedyr.\\nGrunnen til at enkelte arter blir regnet som skadedyr er at de har et slikt «livsmønster» at de lett kommer i konflikt med de aktiviteter som menneskene driver. Alle kan bli utsatt for skadedyr. Skadedyr finner ofte veien inn i utette bygninger eller som blindpassasjerer i varer og bagasje."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%95%E0%B4%BF%E0%B4%A8%E0%B5%8D%E0%B4%A8%E0%B4%B0%E0%B4%BF%E0%B4%95%E0%B5%8D%E0%B4%95%E0%B4%BE%E0%B4%95%E0%B5%8D%E0%B4%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Dicrurus_hottentottus_MWNH_1287.JPG","page_title":"കിന്നരിക്കാക്ക","context_page_description":"കിന്നരികാക്കയുടെ ആംഗല പേര് hair-crested drongoഎന്നും ശാസ്ത്രീയ നാമം Dicrurus hottentottusഎന്നുമാണ്ഏഷ്യയിലെ സ്ഥിര വാസിയാണ്. ഇവ ഇന്ത്യ, ഭൂട്ടാൻഇന്തോ ചൈന, ചൈന, ഇന്തോനേഷ്യ, ബ്രൂണൈഎന്നിവിടങ്ങ്ലിൽ വസിക്കുന്നു. ചെറു കൂട്ടങ്ങളായി വലിയ ശബ്ദത്തോടു കൂടിയാണ് സഞ്ചരിക്കുന്നത്.ശിശിരകാല സന്ദർശകനാണ്."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%A1%D1%8C%D0%BF%D1%96%D1%81_%D1%81%D1%82%D0%B0%D0%BD%D1%86%D1%8B%D1%8F%D1%9E_%D0%9C%D0%B0%D1%81%D0%BA%D0%BE%D1%9E%D1%81%D0%BA%D0%B0%D0%B3%D0%B0_%D0%BC%D1%8D%D1%82%D1%80%D0%B0%D0%BF%D0%B0%D0%BB%D1%96%D1%82%D1%8D%D0%BD%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Medvedkovo_Moscow_Metro_Station.jpg","page_title":"Сьпіс станцыяў Маскоўскага мэтрапалітэну","context_page_description":"Гэта сьпіс станцыяў Маскоўскага мэтрапалітэну. На 2018 год мэтрапалітэн складаецца з 14 лініяў агульнай працягласьцю 379,1 кілямэтраў, якія ўключаюць 221 дзейную станцыю. Больш за дзесяць станцыяў плянуецца адчыніць цягам найбліжэйшых пяці гадоў. Сьпіс уключае станцыі Маскоўскай манарэйкавай транспартнай сыстэмы, якая ўваходзіць у ДУП «Маскоўскі мэтрапалітэн», хаця тэхнічна сувязі між мэтрапалітэнам і манарэйкай няма. Гэты сьпіс станцыяў зроблены з прывязкай да лініяў і падзелены на дзейныя станцыі, і такія, каторыя знаходзяцца ў працэсе будаўніцтва, закансэрваваныя альбо запраектаваныя."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D0%B0%D0%BC%D0%B5%D0%BB%D1%8C%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Hameln_Panorama_3-2006_small.jpg","page_title":"Хамельн","context_page_description":"Хамельн, устаревшее написание Гамельн, реже Гаммельн — город в Германии, в земле Нижняя Саксония.\\nВходит в состав района Хамельн-Пирмонт. Население на 2014 год оценивается в 56 260 человек. Занимает площадь 102,30 км². Официальный код — 03 2 52 006. Город делится на 13 городских районов.\\nХамельн в значительной мере известен благодаря легенде о гамельнском крысолове."},{"page_url":"https://id.wikipedia.org/wiki/Wilayah_ekonomi_Pusat","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Central_economic_region.png","page_title":"Wilayah ekonomi Pusat","context_page_description":"Wilayah ekonomi Pusat adalah salah satu dari dua belas wilayah ekonomi Rusia.\\nLuas: 484,000 km²; populasi: 30.5 juta. Kepadatan penduduk—63/km².\\nWilayah ekonomi Pusat terletak di bagian tengah Rusia bagian Eropa.\\nWilayah ini memiliki kota Moskwa sebagai pusatnya, dan membentuk wilayah industri utama."},{"page_url":"https://en.wikipedia.org/wiki/Jalan_Ampang%E2%80%93Hulu_Langat","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Jkr-ft3210.png","page_title":"Jalan Ampang–Hulu Langat","context_page_description":"Jalan Ampang–Hulu Langat or Jalan Tasik Tambahan is a major road in Selangor, Malaysia. The road connects Taman Permai near Ampang in the west to Pekan Batu Empat Belas Hulu Langat in the east. Its main features including a panoramic view of Kuala Lumpur from the top of Bukit Belacan hill."},{"page_url":"https://id.wikipedia.org/wiki/Imperium_kolonial","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Italy_and_Posessions_September_1939.png","page_title":"Imperium kolonial","context_page_description":"Imperium kolonial adalah hasil dari Zaman Penjelajahan Eropa atau Zaman Pelayaran yang dimulai dengan lomba penjelajahan antara kekuatan laut paling maju pada masa itu, Portugal dan Spanyol, pada abad ke-15. Dorongan awal di balik kekaisaran laut yang sudah tidak ada lagi ini dan kekaisaran yang melanjutkannya adalah perdagangan, didorong oleh ide-ide baru dan kapitalisme yang muncul dari Renaisans Eropa. Perjanjian juga dibuat untuk membagi dunia di antara mereka tahun 1479, 1493, dan 1494.\\nPortugal mulai mendirikan jaringan dan kekaisaran dagang global di bawah kepemimpinan Henry sang Penjelajah. Portugal mendirikan kekuasaan kolonial dari Brasil, di Amerika Selatan, hingga beberapa koloni di Afrika (terutama Guinea Portugis, Tanjung Verde, São Tomé dan Príncipe, Angola dan Mozambik), di India Portugis (terutama Bombay dan Goa), di Tiongkok (Makau), dan Oseania (terutama Timor, khususnya Timor Timur), di antara banyak jajahan yang lebih kecil atau tidak berlangsung lama (lihat Perubahan Imperium Portugis)."},{"page_url":"https://it.wikipedia.org/wiki/Joan_Chandler","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Joan_Chandler_in_Rope_trailer.jpg","page_title":"Joan Chandler","context_page_description":"Joan Chandler, nome d'arte di Joan Cheeseman, è stata un'attrice statunitense."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%85%B4%E4%B8%AD%E4%BC%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Naval_Jack_of_the_Republic_of_China.svg","page_title":"兴中会","context_page_description":"興中會，為孫中山在檀香山成立的革命團體，為中國國民黨的前身組織，\\n中國國民黨即以其成立日1894年11月24日為建黨日。"},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Pierre-et-Saint-Paul_de_Sourzac","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/Sourzac_%C3%A9glise_%2834%29.JPG","page_title":"Église Saint-Pierre-et-Saint-Paul de Sourzac","context_page_description":"L'église Saint-Pierre-et-Saint-Paul est une église catholique située à Sourzac, en France.\\nElle fait l'objet de deux protections en tant que site inscrit et au titre des monuments historiques."},{"page_url":"https://en.wikipedia.org/wiki/Brasenia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/BraseniaAlt.jpg","page_title":"Brasenia","context_page_description":"Brasenia is a genus belonging to the family Cabombaceae, consisting of one species, Brasenia schreberi. It is widely distributed in North America, the West Indies, northern South America, eastern Asia, Australia, the Indian Subcontinent, and parts of Africa.\\nBrasenia is a perennial aquatic plant with floating, peltate leaves and rhizomatous stems. It is identified by its bright green leaves, small purple flowers that bloom from June through September, and a thick mucilage that covers all of the underwater organs, including the underside of the leaves, stems, and developing buds. This mucilage may be an anti-herbivore defence trait, perhaps to deter snail grazing. It grows in shallow water of lakes, rivers and beaver ponds, particularly those with somewhat acidic water."},{"page_url":"https://en.wikipedia.org/wiki/ESCRT","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/ESCRT_Machinery-Corrected.png","page_title":"ESCRT","context_page_description":"The endosomal sorting complexes required for transport machinery is made up of cytosolic protein complexes, known as ESCRT-0, ESCRT-I, ESCRT-II, and ESCRT-III. Together with a number of accessory proteins, these ESCRT complexes enable a unique mode of membrane remodeling that results in membranes bending/budding away from the cytoplasm. These ESCRT components have been isolated and studied in a number of organisms including yeast and humans.\\nThe ESCRT machinery plays a vital role in a number of cellular processes including multivesicular body biogenesis, cellular abscission, and viral budding. Multivesicular body biogenesis is a process in which ubiquitin tagged proteins enter organelles called endosomes via the formation of vesicles. This process is essential for cells to destroy misfolded and damaged proteins. Without ESCRT machinery, these proteins can build up and lead to neurodegenerative disease. For example, abnormalities in ESCRT-III components can lead to neurological disorders such as hereditary spastic paraplegia. Cellular abscission, the process by which the membrane connecting two daughter cells is cleaved, is also mediated by ESCRT machinery."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BB%D0%BE%D1%89%D0%B0%D0%B4%D1%8C_%D0%A1%D0%B2%D0%BE%D0%B1%D0%BE%D0%B4%D1%8B_(%D0%A1%D0%B5%D1%81%D1%82%D1%80%D0%BE%D1%80%D0%B5%D1%86%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Sestroretsk_Peter_I.JPG","page_title":"Площадь Свободы (Сестрорецк)","context_page_description":"Площадь Свободы — Главная площадь в Сестрорецке. Находится между улицами Володарского и улицей Воскова. Переулком Свободы соединяется с Приморским шоссе. На площади находится бывший районный Исполком, в котором в настоящее время размещается администрация Курортного района Санкт-Петербурга."},{"page_url":"https://sv.wikipedia.org/wiki/Anolis_heterodermus","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Anolis_heterodermus01.jpeg","page_title":"Anolis heterodermus","context_page_description":"Anolis heterodermus är en ödleart som beskrevs av Duméril 1851. Anolis heterodermus ingår i släktet anolisar, och familjen Polychrotidae. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://hu.wikipedia.org/wiki/Aquit%C3%A1niai_Szent_Prosper","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Aquit%C3%A1niai_Szent_Prosper.jpg","page_title":"Aquitániai Szent Prosper","context_page_description":"Aquitániai Szent Prosper, szentté avatott ókeresztény író."},{"page_url":"https://en.wikipedia.org/wiki/Inda_Sillasie_River","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Rubaksa_at_Dabba_Hadera.jpg","page_title":"Inda Sillasie River","context_page_description":"Inda Sillasie is a river of northern Ethiopia. It originates at the confluence of May Zegzeg and May Be'ati Rivers in the mountains of Dogu’a Tembien, and flows southward to Giba River which empties finally in the Tekezé River. Along its couse, it first takes the name Rubaksa River, then Dabba Hadera River, and finally Inda Sillasie River."},{"page_url":"https://gl.wikipedia.org/wiki/Cumbraos,_Sobrado","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Capela_da_Armada_%28Cumbraos%29.jpg","page_title":"Cumbraos, Sobrado","context_page_description":"San Xiao de Cumbraos é unha parroquia que se localiza no oeste do concello de Sobrado. Segundo o IGE, en 2014 tiña 239 habitantes, o que supón unha diminución en relación ao ano 2004 cando tiña 271 habitantes.\\nEclesiasticamente pertence ao arciprestado de Sobrado, igual cás demais parroquias do concello.\\nAquí naceu Mateo de Prado, unha das meirandes figuras da escultura barroca galega."},{"page_url":"https://hr.wikipedia.org/wiki/Ljubi%C4%8Devke","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Two_rarities_%284933168359%29.jpg","page_title":"Ljubičevke","context_page_description":"Ljubičevke, porodica cvjetnjača koja je dobila ime po rodu Viola, nekada klasificirana u vlastiti red Violales, a danas redu Malpighiales.\\nPorodica se sastoji od 25 rodova sa 806 priznatih vrsta o kojih 478 vrta ljubica, a raširene su u umjerenom, suptropskom i tropskom pojasu. To su zeljaste i drvenaste biljke. Cvjetovi su dvospolni, pokedonačni ili u cvatovima, a plod je tobolac ili bobica.\\nRod ljubica odlikuje se ugodnim mirisom i ljubičastim cvijetom. Rastu u šumama, rubovima šuma i travnjacima, a postoje i hibridne vrste nastale križanjem više vrsta."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%B0%E0%A4%BE%E0%A4%AE%E0%A5%87%E0%A4%B8%E0%A5%87%E0%A4%B8_%E0%A4%AA%E0%A5%8D%E0%A4%B0%E0%A4%A5%E0%A4%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/StatueHeadOfParamessu-TitledFrontalView-RamessesI_MuseumOfFineArtsBoston.png","page_title":"रामेसेस प्रथम","context_page_description":"रामेसेस या रामेसेस प्रथम प्राचीन मिस्र के नविन साम्राज्य के उन्नीसवे वंश के प्रथम फैरो थे| रामेसेस अठारहवें वंश आखिरी फैरो होरेम्हेब का अमात्य था, निसंतान होने के कारण होरेम्हेब ने रामेसेस को अपना उत्तराधिकारी चुना|\\nरामेसेस प्रथम ने केवल १७ माह तक ही राज किया जिसके बाद उसके पुत्र सेती प्रथम ने गद्दी संभाली| रामेसेस प्रथम ने अपने शासन काल में मिस्र में शांति स्थापित की और फिर उसके पुत्र सेती प्रथम और पोते रामेसेस द्वितीय मिस्र को उसके स्वर्णिम युग में ले गए|"},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B3%D8%A7%D9%85%D8%B1_%D8%A2%D9%84%D8%AA%DB%8C%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Summer_Altice_2011.jpg","page_title":"سامر آلتیس","context_page_description":"سامر آلتیس آمریکالی مانکن و اوْیونچو"},{"page_url":"https://es.wikipedia.org/wiki/Robert_Wight","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/RobertWight.jpg","page_title":"Robert Wight","context_page_description":"Robert Wight fue un cirujano y botánico escocés, que permaneció 30 años en la India.\\nEstudió botánica en Edimburgo con John Hope.\\nFue director del Jardín Botánico en Madrás. Hizo uso de artistas locales para realizar ilustraciones botánicas. Aprendió el arte de la litografía, que usó para publicar Icones Plantarum Indiae Orientalis en seis volúmenes, en 1856."},{"page_url":"https://ro.wikipedia.org/wiki/Amedeo_Preziosi","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Pia%C5%A3a_de_pe%C5%9Fte%2C_1869%2C_A._Preziosi.jpg","page_title":"Amedeo Preziosi","context_page_description":"Amedeo Preziosi a fost un pictor maltez care a excelat prin acuarelele sale. După ce a făcut studii de pictură la Paris s-a stabilit definitiv în 1842 la Istanbul unde s-a căsătorit și a avut patru copii. A devenit repede celebru, atât în Turcia cât și în Occident, datorită operelor sale care reflectau viața orientală. În anii 1868-69 a călătorit de două ori în România, unde a conlucrat pe plan artistic cu prietenul său, Carol Popp de Szathmári. A fost apreciat de regele Carol I al României pentru care a realizat multe lucrări și care i-a organizat o expoziție în București. A creat pe teme românești mai mult de 250 de lucrări care, în afară de valoarea artistică, prezintă o sursă importantă pentru istoricii și antropologii români.\\nValoarea documentară și narativă a operei lui Amedeo Preziosi a dus la consacrarea sa, creațiile artistului fiind foarte apreciate de public și colecționari. El este un neoclasic ca desen și colorit și tendința de a surprinde în peisaj scene de măreție sobră îl apropie de romantici. Arta contelui maltez este legată fără tăgadă de viața ce se constituie într-un izvor documentar de prim ordin."},{"page_url":"https://de.wikipedia.org/wiki/Forum_Kopenhagen","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9d/Forum-Copenhagen.jpg","page_title":"Forum Kopenhagen","context_page_description":"Das Forum Kopenhagen ist eine Veranstaltungshalle in Frederiksberg, Kopenhagen. Sie wurde 1947 erbaut, nachdem der Vorgängerbau aus dem Jahr 1926 durch einen Anschlag der Widerstandsgruppe Holger Danske im Jahr 1943 zerstört worden war. In den folgenden Jahrzehnten wurde es in mehreren Schritten durchgreifend umgebaut.\\nDie Ausstellungsfläche hat eine Bruttogröße von 8.000 m² und eine Nettogröße von 5.000 m². Für Konzerte bietet die Halle 10.000 Stehplätze oder 8.500 Sitzplätze. Im Jahr 1997 wurde die Dachkonstruktion erneuert, um die Akustik für Konzerte zu verbessern. Im Jahr 2009 kamen rund 450.000 Besucher in die Veranstaltungshalle."},{"page_url":"https://fr.wikipedia.org/wiki/Bonaparte_franchissant_le_Grand-Saint-Bernard","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Alexandre_domptant_Buc%C3%A9phale_cropped.jpg","page_title":"Bonaparte franchissant le Grand-Saint-Bernard","context_page_description":"Bonaparte franchissant le Grand-Saint-Bernard est un portrait équestre de Napoléon Bonaparte alors Premier Consul, réalisé par Jacques-Louis David entre 1800 et 1803. Napoléon est représenté lors du franchissement du col alpin du Grand-Saint-Bernard par l'armée de réserve, épisode qui marque le début de la seconde campagne d'Italie.\\nDavid peint cinq versions de ce portrait, dont la première est commandée par le roi d'Espagne Charles IV comme témoignage d'entente entre son royaume et la République française ; elle est depuis 1949 conservée au musée national du château de Malmaison. Les trois suivantes sont commandées par le Premier Consul à des fins de propagande et sont les premiers portraits officiels de Napoléon. Elles ornent le château de Saint-Cloud, la bibliothèque de l'hôtel des Invalides, et le palais de la République cisalpine à Milan. La dernière version n'a pas de commanditaire et est conservée par David jusqu'à sa mort.\\nArchétype du portrait de propagande, l'œuvre a été de nombreuses fois reproduite en gravure, sur des vases ou des assiettes, sous forme de puzzle ou en timbre-poste, témoignages d'une importante postérité."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%9A%E0%A6%BE%E0%A6%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Aloo_Tikki_served_with_chutneys.jpg","page_title":"চাট","context_page_description":"চাট হল একটি সুস্বাদু হালকা খাবার যা দক্ষিণ এশিয়া তথা ভারতে উদ্ভূত এবং বাংলাদেশ, ভারত, নেপাল ও পাকিস্তান জুড়ে যা সাধারণত ক্ষুধাবর্ধক খাবার হিসাবে রাস্তার পাশে বা ফুতপাতে খাবার ট্রলি বা ছোট্ট দোকান পরিবেশিত হয়। এটি ভারতের উত্তর প্রদেশে উদ্ভূত হয়েছে বলে ধরে নেওয়া হয়। চাট হিন্দি শব্দ যা চাটনা থেকে এসেছে, হিন্দি চাটনা এসেছে প্রাকৃত ভাষার চট্টই শব্দ থেকে।"},{"page_url":"https://fr.wikipedia.org/wiki/Maslives","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/R24-1.png","page_title":"Maslives","context_page_description":"Maslives est une commune française située dans le département de Loir-et-Cher, en région Centre-Val de Loire.\\nLocalisée au centre-est du département, la commune fait partie de la petite région agricole « les Vallée et Coteaux de la Loire », grand ruban plus ou moins large où dominent la culture de la vigne et les productions maraîchères.\\nL'occupation des sols est marquée par l'importance des espaces agricoles et naturels qui occupent la quasi-totalité du territoire communal. Plusieurs espaces naturels d'intérêt sont présents sur la commune : deux sites natura 2000 et deux zones naturelles d'intérêt écologique, faunistique et floristique. En 2010, l'orientation technico-économique de l'agriculture sur la commune est la culture des céréales et des oléoprotéagineux. À l'instar du département qui a vu disparaître le quart de ses exploitations en dix ans, le nombre d'exploitations agricoles a fortement diminué, passant de 15 en 1988, à 12 en 2000, puis à 11 en 2010.\\nLe patrimoine architectural de la commune comprend un bâtiment porté à l'inventaire des monuments historiques : le château de Chambord."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B1%D9%8A%D8%AA_%D8%A7%D9%84%D9%8A%D8%B3%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Rhett_Ellison_2012-12-30.jpg","page_title":"ريت اليسون","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nريت اليسون لاعب كورة القدم الامريكيه من امريكا."},{"page_url":"https://gl.wikipedia.org/wiki/Casa_dos_Austria","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/La_Bataille_de_Rocroi.jpg","page_title":"Casa dos Austria","context_page_description":"A casa dos Austria é o nome co que se coñece á dinastía Habsburgo reinante na Monarquía Hispánica nos séculos XVI e XVII; desde a Concordia de Villafáfila en que Filipe I o Fermoso é recoñecido como rei consorte da Coroa de Castela, quedando para o seu sogro Fernando o Católico a Coroa de Aragón, ata a morte sen sucesión directa de Carlos II o Enfeitizado, feito que provocou a Guerra de Sucesión Española. A rama dinástica española dos Habsburgo seguiu por parte da filla de D. Juan José de Austria, Dª. Margarita da Cruz de Habsburgo, que abandonou os hábitos o 17 de setembro de 1681 para contraer matrimonio co nobre galego D. Felipe de Romay."},{"page_url":"https://en.wikipedia.org/wiki/1903","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Galg_gem.jpg","page_title":"1903","context_page_description":"1903 was a common year starting on Thursday of the Gregorian calendar and a common year starting on Wednesday of the Julian calendar, the 1903rd year of the Common Era and Anno Domini designations, the 903rd year of the 2nd millennium, the 3rd year of the 20th century, and the 4th year of the 1900s decade. As of the start of 1903, the Gregorian calendar was 13 days ahead of the Julian calendar, which remained in localized use until 1923."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%B7%D0%B0_%D0%A5%D1%8E%D1%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Marines_Fire_From_a_House_Window%2C_February_1968_%2816242259837%29_%28cropped%29.jpg","page_title":"Битва за Хюэ","context_page_description":"Битва за Хюэ — одно из наиболее долгих и кровопролитных сражений периода войны во Вьетнаме, произошедшее в 1968 году между силами США и Южного Вьетнама с одной стороны и силами Северного Вьетнама с другой. Сражение велось за южновьетнамский город Хюэ и характеризовалось ожесточёнными уличными боями, сопровождавшимися большими разрушениями и жертвами среди мирного населения."},{"page_url":"https://it.wikipedia.org/wiki/Parco_dei_Mulini","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Mulino_Cornaggia_-_Antique_Burst.jpg","page_title":"Parco dei Mulini","context_page_description":"Il parco dei Mulini è un parco locale di interesse sovracomunale riconosciuto dalla Provincia di Milano il 10 marzo 2008 che si sviluppa intorno all'Olona ed al Canale Villoresi e comprende un breve tratto del torrente Bozzente. Si estende sul territorio dei comuni di Legnano, Canegrate, San Vittore Olona, Parabiago e, dal 1º gennaio 2011, Nerviano per una superficie di circa 500 ha."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%BE%8E%E5%9B%BD%E7%A9%BA%E5%86%9B%E4%B8%8A%E5%B0%86%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Patrick_Gamble.jpg","page_title":"美国空军上将列表","context_page_description":"此表是完整美国空军上将列表。上将军衔高于中将，目前是美军最高等级的军衔，于第二次世界大战时期曾经授予过五星上将，然而当前再无授予。\\n至今，美国空军授予了202位将领上将军衔，其中，196位是现役时授予，3位是退役后授予，另有一位乔治·西姆勒是逝世后追认。从进入空军的背景看：60人出自西点军校，49出自飞行学员计划，35人出自美国空军学院，33人出自普通大学的空军预备军官训练团，9人来自高级军事学院，7人来自通过空军军官训练学校，4人来自美国海军学院，2人为直接委任，塞缪尔·菲利普斯来自普通大学的预备军官训练团，理查德·罗森来自陆军国民警卫队，罗伯特·狄克逊来自加拿大皇家空军。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%96%B0%E5%8A%A0%E5%9D%A1%E8%AF%AD%E8%A8%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Sing_signroundabout.jpg","page_title":"新加坡语言","context_page_description":"新加坡流通的語言眾多。新加坡政府承認四種官方語言，即英語、馬來語、華語以及坦米爾語，其中馬來語被定為「國語」，全國的通用語則為英語。這些官方語言，連同多種其他語言，只不過在表面上反映出新加坡多元種族、多元文化以及多語言的性質。2009年，新加坡存在著超過20種語言。新加坡殖民時期身為貿易港口，現今是著名的國際化貿易之中心點，長期以來吸引了來自亞洲和其他地區的外國人。他們所帶來的語言極大地影響了新加坡的語言。\\n新加坡早期，島上的通用語是巴剎馬來語，為馬來語和漢語的混合語，也是馬來群島的貿易語言。雖然現在許多島上的人仍然繼續使用，尤其是新加坡馬來人，馬來語已經被英語取而代之。由於英國統治新加坡的緣故，英語成為通用語，並在新加坡獨立後立為主導語言。早期，英語用來團結各自有語言的各種族，依然是學術教育的主要語言。\\n閩臺片閩南語在短暫的一段時間內是華人之間的通用語，不過20世紀後期由中華人民共和國的國語完全取代。政府鼓勵新加坡華人講中國國語普通話是因為新加坡政府想消滅族群文化並搞同化政策 21世紀，中國經濟的崛起，新加坡政府便因此更鼓勵國人多講普通話。另一方面，非官話之漢族語言，例如福建話、潮州話、客家話、海南話和廣東話被歸類為「方言」，雖然這樣的歸類以語言學標準來說是完全錯誤的。政府的語言政策和根據這種歸類產生的語言態度的變化，導致這些語言的使用者隨後下跌。身為新加坡四種官方語言之一，坦米爾語是印度語言中的主要語言；然而新加坡也有使用其他語言。像馬來語一樣，學校允許使用不同種類的印度語言。\\n新加坡實行雙語政策，學生不僅以英語學習，也學習自己的語言，美其名為「母語」。但是由於政府的錯誤語言政策，英語占優勢的緣故致使在家中尤其是主要講英語的華人使用自身語言漸漸減少。。母語的流失也逐漸更加顯著，因為廣播媒體大量禁止其使用，年長人士使用比較多，其他年齡層比較少講。"},{"page_url":"https://sv.wikipedia.org/wiki/Geay,_Deux-S%C3%A8vres","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8a/Map_commune_FR_insee_code_79131.png","page_title":"Geay, Deux-Sèvres","context_page_description":"Geay är en kommun i departementet Deux-Sèvres i regionen Nouvelle-Aquitaine i västra Frankrike. Kommunen ligger i kantonen Saint-Varent som tillhör arrondissementet Bressuire. År 2009 hade Geay 344 invånare."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%8C%80%ED%95%9C%EB%AF%BC%EA%B5%AD%EC%9D%98_%EC%B2%9C%EC%97%B0%EA%B8%B0%EB%85%90%EB%AC%BC_(%EC%A0%9C301%ED%98%B8_~_%EC%A0%9C400%ED%98%B8)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Brent_Goose.jpg","page_title":"대한민국의 천연기념물 (제301호 ~ 제400호)","context_page_description":"다음은 대한민국 천연기념물의 일람이다. 취소선이 쳐져 있는 것은 천연기념물에서 해제된 것이다.\\n천연기념물은 동물·식물·지질·광물과 천연보호지역으로 구분된다. 천연기념물로 지정할 수 있는 자연물은 한국 특유의 이름있는 서식지 및 생장지·석회암지대·사구·동굴·건조지·습지·하천·온천·호수·도서, 학술적인 가치가 큰 나무, 원시림, 고산식물지대, 중요한 화석 표본 등이다. 천연보호지역은 보호해야 할 천연기념물이 풍부한 일정 규역을 설정한다. 전라남도 홍도, 강원도 설악산, 제주도 한라산, 그 밖에 대암산·대우산·향로봉 등이 천연보호구역이다\\n1933년 천연기념물 제도가 시행된 후 총 155가지가 지정되었고, 이를 1962년 재정비하는 과정에서 많은 수가 해제되었다. 2008년 천연기념물 명칭 기준이 바뀌어서 각 천연기념물의 공식 명칭이 크게 변했다."},{"page_url":"https://de.wikipedia.org/wiki/Usnea_filipendula","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Baumbart_sammeln.jpg","page_title":"Usnea filipendula","context_page_description":"Usnea filipendula, auch als Gewöhnlicher Baumbart bezeichnet, ist eine Flechte, die von Bäumen herabhängend wächst und charakteristische Flechtenbärte ausbildet."},{"page_url":"https://sv.wikipedia.org/wiki/Epirus_(distrikt)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Flag_of_the_Region_of_Epirus.jpg","page_title":"Epirus (distrikt)","context_page_description":"Epirus är en av Greklands tretton administrativa regioner, och utgör den södra delen av den historiska regionen Epirus. Det uppdelas i de fyra prefekturerna Arta, Ioannina, Preveza och Thesprotia. Regionen gränsar i öst till regionerna Västra Makedonien och Thessalien och i söder till Artabukten och regionen Västra Grekland. I väst möter regionen Joniska havet och de joniska öarna och i norr Albanien.\\nRegionen har en area på 9 200 km² och en befolkning på 350 000. Huvudort och största stad är Ioannina med omkring 100 000 invånare. Befolkningen är idag nästan uteslutande grekisktalande och räknar sig till grekisk-ortodoxa kyrkan. Det finns små albanska och romska minoriteter. Den albanska minoriteten i den grekiska provinsen har varit betydligt större men förflyttades under och efter andra världskriget och under det grekiska inbördeskriget.\\nEpirus är en av Greklands fattigaste regioner. Jordbruket består till stora delar av tobaksodling kring Ioannina, mjölk- och fisknäring. Huvuddelen av all mat måste dock importeras. Regionen har få naturtillgångar och liten utvecklad industri och har kontinuerligt avfolkats sedan 1800-talet."},{"page_url":"https://de.wikipedia.org/wiki/1863","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Brogi%2C_Giacomo_%281822-1881%29_-_n._3680_-_Torino_-_Tempio_israelitico.jpg","page_title":"1863","context_page_description":"Im Jahr 1863 tobt in Nordamerika weiterhin mit unverminderter Härte der Sezessionskrieg, auch wenn sich die Waage trotz zahlreicher Rückschläge langsam zugunsten des bevölkerungsreicheren und wirtschaftskräftigeren Nordens zu neigen beginnt, die die Herrschaft über den Mississippi River erringen und die Konföderierten aus Tennessee vertreiben. Die von der Union unter schweren Verlusten gewonnene Schlacht von Gettysburg bildet gleichzeitig die sogenannte „Hochwassermarke“ der Konföderation, die sich in der Folge zunehmend in der Defensive befindet. Mehrere Monate nach der Schlacht hält US-Präsident Abraham Lincoln auf dem Schlachtfeld eine kurze Rede. Die von Zeitgenossen kritisch bewertete Gettysburg Address gilt heute als eine seiner wichtigsten Reden. Trotz der militärischen Erfolge des Nordens liegt ein Sieg noch in weiter Ferne.\\nIn Mexiko rückt die französische Armee weiter vor und auch in den meisten anderen lateinamerikanischen Staaten werden Kriege oder Bürgerkriege geführt."},{"page_url":"https://es.wikipedia.org/wiki/Bonaparte_cruzando_los_Alpes","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Francois-Louis-Joseph_Watteau_001.jpg","page_title":"Bonaparte cruzando los Alpes","context_page_description":"Bonaparte cruzando los Alpes es una pintura al óleo de 1848-1850 que retrata a Napoleón Bonaparte, ​ realizada por el artista francés Paul Delaroche.​​ La pintura muestra a Bonaparte montado en una mula, guiando a su ejército a través de los Alpes, ​ un viaje realizado en la primavera de 1800, ​ en su intento por sorprender a las tropas austríacas en Italia.​​\\nLa obra se inspiró en la serie de cinco pinturas de Napoleón cruzando los Alpes realizadas por Jacques-Louis David. Las obras de David también muestran el viaje de Napoleón por el paso del Gran San Bernardo; sin embargo, existen importantes diferencias estilísticas entre ambas concepciones. El Napoleón de Delaroche tiene frío y está alicaído, mientras que el de David viste un uniforme prístino y es idealizado como héroe. Delaroche recibió la comisión de pintar un retrato realista, estilo que estaba surgiendo en esa época.​​\\nPese a que la pintura representaba y era una de las pioneras de este nuevo estilo, la obra fue criticada por varias autoridades en el tema. Sus motivos eran variados: desde la representación de la escena, hasta la desaprobación general del mismo Delaroche."},{"page_url":"https://cs.wikipedia.org/wiki/Kostel_svat%C3%A9ho_Ducha_(Lib%C3%A1%C5%88)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Lib%C3%A1%C5%88%2C_fara.jpg","page_title":"Kostel svatého Ducha (Libáň)","context_page_description":"Římskokatolický farní kostel svatého Ducha je barokní sakrální stavba v severní části města Libáň. Od roku 1964 je kostel chráněn jako kulturní památka."},{"page_url":"https://cs.wikipedia.org/wiki/Medyn%C4%9Bk","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Holcus_lanatus_Gestreepte_witbol_closeup.jpg","page_title":"Medyněk","context_page_description":"Medyněk je rod trav, tedy z čeledi lipnicovitých. Jedná se o vytrvalé, vzácně jednoleté byliny. Jsou trsnaté nebo někdy s oddenky či výběžky. Stébla dorůstají výšek zpravidla 8–150 cm. Čepele listů jsou ploché, na vnější straně listu se při bázi čepele nachází jazýček, 1–5 mm dlouhý. Květy jsou v kláscích, které tvoří latu, která je rozložitá nebo klasovitě či nepravidelně stažená. Klásky jsou zboku smáčklé, vícekvěté, horní květ je však jen samčí či sterilní. Na bázi klásku jsou dvě plevy, které jsou přibližně stejné, bez osin nebo je jedna či obě osinaté. Pluchy jsou někdy na vrcholu dvoulaločné, jindy nikoliv, bez osin nebo osinaté, osiny někdy jen u pluch samčích květů, osiny kolénkaté. Plušky jsou dvoukýlné. Plodem je obilka, která je neokoralá. Celkově je známo asi 9 druhů, které najdeme v Evropě, Malé Asii na Kavkaze, v severní Africe, jeden druh v jižní Africe, místy adventivní."},{"page_url":"https://ro.wikipedia.org/wiki/Chiesanuova,_Piemont","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/ChiesanuovaChiesa.JPG","page_title":"Chiesanuova, Piemont","context_page_description":"Chiesanuova este o comună din provincia Torino, Italia. În 2011 avea o populație de 203 de locuitori."},{"page_url":"https://pl.wikipedia.org/wiki/Sob%C3%B3r_Zwiastowania_w_Solwyczegodsku","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Solvychegodsk_%28Vologda_Governorate%29_%281780%29.png","page_title":"Sobór Zwiastowania w Solwyczegodsku","context_page_description":"Sobór Zwiastowania w Solwyczegodsku – prawosławny sobór w Solwyczegodsku.\\nSobór był jedną z wielu świątyń fundowanych przez rodzinę Stroganowów. Jest to jedna z najstarszych murowanych cerkwi na Rosyjskiej Północy. Decyzja o jego budowie zapadła w latach 50. XVI w., na mocy porozumienia arcybiskupa rostowskiego Nikandra ze Stroganowymi. Arcybiskup przesłał również do miasta ikonę Zwiastowania, co przesądziło o wezwaniu nadanym następnie gotowej świątyni. W 1560 położony został kamień węgielny pod przyszłą cerkiew. Prace budowlane trwały do 1584; obiekt usytuowano na wzgórzu nad rzeką Wyczegdą. W bocznych kaplicach świątyni znalazły się nagrobki członków rodziny, która ufundowała obiekt.\\nW 1613 sobór został rozgrabiony w czasie wielkiej smuty. Po stabilizacji sytuacji politycznej w Rosji Stroganowowie odbudowali cerkiew w pierwotnym kształcie, zastępując utracone cenne elementy wyposażenia nowymi.\\nMonumentalna bryła soboru miała podkreślać potęgę rodu Stroganowych i jego dominację w tym regionie Rosji. Oprócz głównego ołtarza Zwiastowania w cerkwi znajdowały się kaplice św. Mikołaja, Aleksego, metropolity Moskwy, Szymona Słupnika oraz Trzech Świętych Hierarchów."},{"page_url":"https://br.wikipedia.org/wiki/7_Gouere","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Marc_Chagall_1941.jpg","page_title":"7 Gouere","context_page_description":"1815: dont a ra Valais da vezañ 20vet kanton Suis.\\n1944: argadet eo strouezh Broualan gant an Alamaned hag o skoazellerien c'hall."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%82%DB%8C%D9%81","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/11/Kitchen_Funnel.jpg","page_title":"قیف","context_page_description":"قیف، لوله‌ای دراز می‌باشد که بیشتر با ریخت کله‌قندی، دهانه‌ای پهن و ساقه‌ای باریک دارد. این دستگاه برای عبور مواد مایع یا دانه‌های ریز با دهانه‌ای کوچک، برای عبور اجسام به‌طرف ظرف مورد نظر به‌کار می‌رود.\\nقیف‌ها معمولاً از جنس استیل ضدزنگ، شیشه یا پلاستیک ساخته می‌شوند. مواد مورد استفاده در ساخت این دستگاه باید به‌اندازه کافی محکم باشند تا بتواند وزن اجسامی را که قرار است انتقال یابد را تحمل کند و نباید نسبت به اجسام واکنش نشان دهد. به همین‌دلیل، استیل ضد زنگ یا شیشه برای انتقال گازوئیل مفید هستند، درصورتیکه پلاستیک برای یک آشپزخانه می‌تواند مفید باشد.\\nلفظ \\"قیف\\" گاهی‌اوقات برای اشاره به دودکش یا دودکش قطار در قطار بخار یا لوکوموتیو بخار استفاده می‌شود و معمولاً در اشاره به یک کشتی بکار می‌رود. اصطلاح \\"قیف\\" را می‌توان برای سایر اشیاء ظاهراً ناشناس، همچون لوله سیگار یا حتی آشپزخانه‌های بدون ارتفاع نیز بکار برد."},{"page_url":"https://de.wikipedia.org/wiki/Melvin_Vaniman","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/M._Vaniman_and_cat.jpg","page_title":"Melvin Vaniman","context_page_description":"Chester Melvin Vaniman war ein US-amerikanischer Fotograf, Aeronaut und Geschäftsmann. Er war bekannt für seine Panoramaaufnahmen. Er kam beim Absturz der Akron vor New Jersey um. Ein Teil seiner Bilder wurden von der State Library of New South Wales gesammelt."},{"page_url":"https://da.wikipedia.org/wiki/Thomas_Vermaelen","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Thomas-vermaelen-3.jpg","page_title":"Thomas Vermaelen","context_page_description":"Thomas Vermaelen er en belgisk fodboldspiller, der spiller som midterforsvarer hos den spanske La Liga-klub FC Barcelona Han kom til klubben i sommeren 2014 fra engelske Arsenal F.C. Derudover har han tidligere spillet for Ajax som han blev hollandsk mester i 2004 og pokalvinder med i både 2006 og 2007."},{"page_url":"https://de.wikipedia.org/wiki/Christian_von_Martens","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Christian_von_Martens_Ausmarsch_von_Heilbronn.jpeg","page_title":"Christian von Martens","context_page_description":"Christian Septimus von Martens war ein Offizier in königlich-württembergischen Diensten, der seine Feldzüge und Privatreisen dokumentierte. So hinterließ er einen umfangreichen Fundus an historisch wertvollen Tagebucheinträgen und Aquarellen von Städten, Landschaften und Uniformen, der heute großteils im Besitz des Hauptstaatsarchivs Stuttgart ist."},{"page_url":"https://uk.wikipedia.org/wiki/Simca","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Simca_1307_GLS_1978.jpg","page_title":"Simca","context_page_description":"Simca — з 1934 року французький виробник автомобілів. Штаб-квартира розташована в місті Нантерр. У 1964 році компанію купує фірма Chrysler. У 1980 році компанія припинила виробництво автомобілів."},{"page_url":"https://fr.wikipedia.org/wiki/Trolleybus_de_Wellington","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Big_red_bus_01.jpg","page_title":"Trolleybus de Wellington","context_page_description":"Le trolleybus de Wellington est un réseau de trolleybus qui dessert l'agglomération de Wellington, en Nouvelle-Zélande."},{"page_url":"https://zh.wikipedia.org/zh-my/%E5%9F%8E%E5%B7%B4A11%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Cityflyer_Route_NA11.jpg","page_title":"城巴A11線","context_page_description":"城巴A11线是香港机场巴士路线，来往机场及北角码头，驶经港岛北岸核心商业区包括中环、铜锣湾。\\n城巴NA11线则是香港一条机场巴士路线，为A11线的通宵版本，但总站是设在港珠澳大桥香港口岸，绕经机场航站楼。全程$52，并与NA29线列为全香港现时收费第二贵的通宵路线及专营巴士线，其次是A10，全程$48。"},{"page_url":"https://no.wikipedia.org/wiki/Eurovision_Song_Contest_1978","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/ESC_1978_logo.PNG","page_title":"Eurovision Song Contest 1978","context_page_description":"Eurovision Song Contest 1978 var den 23. utgaven av Eurovision Song Contest, EBUs årlige sangkonkurranse for organisasjonens medlemmer. Konkurransen ble arrangert lørdag 22. april 1978 av den franske kringkasteren TF1. Finalen ble holdt i Palais des congrès i Paris i Frankrike, og for første gang var det to programledere: Denise Fabre og Léon Zitrone. Danmark kom tilbake i konkurransen etter tolv års fravær, og Tyrkia returnerte etter tre års fravær. Dermed steg deltakerantallet til rekordhøye 20 land. Vinneren ble for første gang Israel med Izhar Cohen og Alphabeta som sang «A-ba-ni-bi». Norge plasserte seg helt i andre enden av resultatlisten, da Jahn Teigen fikk null poeng med «Mil etter mil». Dette var første gang et land fikk null poeng med det nåværende poengsystemet, noe som vakte stor oppmerksomhet i norsk og utenlandsk presse. Bunnplasseringen satte imidlertid også fart på Jahn Teigens lange artistkarriere i Norge, og han fikk stor suksess med oppfølgeralbumet This Year's Loser."},{"page_url":"https://sv.wikipedia.org/wiki/Svenska_ortnamnsefterled","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/PlaceNameSuffix_sunda.svg","page_title":"Svenska ortnamnsefterled","context_page_description":"Svenska ortnamnsefterled är sista ledet i sammansatta ortnamn som antingen förekommer i Sverige eller kommer ur svenskan. Förled och efterled förekommer i alla sammansatta ord och många svenska ortnamn är sammansättningar. I artikeln redovisas efterled som avser bebyggelsenamn. Dessa kan vara primära eller sekundära. Primära är sådana bebyggelsenamn som från början avsett bebyggelse, som -by. Naturnamn som -vik har i många fall senare kommit att beteckna bebyggelse. Även artefaktnamn som -bro har kommit att beteckna bebyggelse.\\nI ortnamnsforskningen spelar efterleden en stor roll som del av ortnamnen, därför att många efterled är så vanliga. Exempelvis har mycket forskning ägnats åt ortnamnselementen by, böle, lösa, rum och stad. Att kunna avgöra ortnamnens etymologi är centralt, liksom deras ålder och deras geografiska utbredning.\\nOrtnamn kan även antingen bestå av ett enda ord eller ha en avledningsändelse tillagd till grundordet. Vanliga sådana ändelser är -inge och -unge. Se vidare Svenska ortnamnsändelser."},{"page_url":"https://cs.wikipedia.org/wiki/%C5%98%C3%ADmskokatolick%C3%A1_farnost_Volyn%C4%9B","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5b/Volyn%C4%9B%2C_kostel_V%C5%A1ech_svat%C3%BDch%2C_od_severov%C3%BDchodu.jpg","page_title":"Římskokatolická farnost Volyně","context_page_description":"Římskokatolická farnost Volyně je část římskokatolické církve zahrnující obce v okolí jihočeského města Volyně, v nichž vykonává duchovní správu v místních kostelích. Je součástí Strakonického vikariátu, který spadá do Českobudějovické diecéze. Jejím duchovním správcem je R. D. Jan Löffelmann. Bohoslužby jsou vedle Volyně slouženy ještě v Malenicích, Česticích, Hošticích a v Paračově. Jako katecheta ve farnosti působil také literát Václav Čeněk Bendl-Stránický."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%96%9C%E5%B9%B3%E7%94%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/JGSDF_Camp_Kodaira.JPG","page_title":"喜平町","context_page_description":"喜平町は東京都小平市の地名。現行行政地名は喜平町一丁目から喜平町三丁目。住居表示実施区域。郵便番号は187-0044。"},{"page_url":"https://es.wikipedia.org/wiki/G%C3%B3ndola_(bote)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/35/Venice_-_Gondolas_-_3818.jpg","page_title":"Góndola (bote)","context_page_description":"La góndola es una embarcación a remos tradicional de Venecia. Las góndolas fueron durante siglos el principal medio de transporte de Venecia y todavía desempeñan un papel importante, ya que sirven como trasbordo desde y hacia los canales principales.\\nSe estima que durante el siglo XVIII navegaban por los canales miles de góndolas. En la actualidad su número ronda el centenar, destinadas principalmente al turismo, para el trasbordo hacia los canales principales y para uso privado. La construcción de la góndola se desarrolló hasta finales del siglo XIX, cuando empezaron a sustituirlas unos barcos motorizados que reciben el nombre de vaporetto.\\nUna góndola es larga y estrecha, con un contorno asimétrico para facilitar la propulsión con un solo remo, de haya​ y con una curvatura longitudinal que reduce al mínimo el área de contacto con el agua. El remo se sostiene con una especie de horquilla, conocida como forcola, realizada de una sola pieza de nogal​ y que tiene una forma complicada, permitiéndole ocho maniobras distintas, ​ como son las de remo lento, avance, giro, freno y para ciar."},{"page_url":"https://ro.wikipedia.org/wiki/Traian_B%C4%83sescu","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/B%C4%83sescu_%C3%AEi_prezint%C4%83_pe_MRU%2C_Cristian_Preda_%26_Adrian_Papahagi%2C_protest_Pia%C5%A3a_Revolu%C5%A3iei_26-7-12.jpg","page_title":"Traian Băsescu","context_page_description":"Traian Băsescu este un politician român, fost președinte al României între 2004 și 2014. Anterior, din iunie 2000 până în decembrie 2004, a fost primar general al municipiului București, ales din partea PD.\\nÎn 2001 a câștigat în cursul alegerilor interne președinția Partidului Democrat, înlocuindu-l pe Petre Roman. A fost copreședinte al Alianței Dreptate și Adevăr, formată din PNL și PD în 2003. În urma retragerii lui Theodor Stolojan din cursă, Traian Băsescu a devenit candidatul Alianței DA pentru președinția României.\\nLa alegerile prezidențiale din 2009 a fost reales președinte al României pentru un mandat de 5 ani, învingându-l pe Mircea Geoană.\\nLa 1 ianuarie 2007, în timpul mandatului său de președinte, România a aderat la Uniunea Europeană."},{"page_url":"https://fr.wikipedia.org/wiki/Wilton-Fijenoord","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Scheepreparatiewerf_Wilton_Fijenoord_in_Schiedam%2C_Bestanddeelnr_932-8353.jpg","page_title":"Wilton-Fijenoord","context_page_description":"Wilton-Fijenoord a été une entreprise de construction et de réparation navale à Schiedam, aux Pays-Bas, de 1929 à 1999.\\nActuellement, le chantier naval de Wilton-Feijnoord fait partie de Damen Shiprepair Rotterdam.\\nSous le nom de Fijenoord était connu, de 1825 à 1929, un chantier naval et génie mécanique situé sur l'île Fijenoord dans l'arrondissement de Rotterdam.\\nLa société avait été fondée, le 10 novembre 1825, sous le nom de Etablissement Fijenoord regroupant une partie de la société Nederlandsche Stoomboot Maatschappij de Gerhard Mauritz Roentgen établie deux ans plus tôt aux Pays-Bas.\\nEn 1895, le nom a été changé en NV Maatschappij voor Scheeps- en Werktuigbouw Fijenoord.\\nEn 1929, la société a fusionné avec la NV Wilton's Dok- en Werf Maatschappij de Rotterdam et Schiedam pour devenir la NVDok en Werf Maatschappij Wilton-Fijenoord.\\nEn 1999, Wilton-Fijenoord a intégré la Damen Shiprepair Rotterdam BV, puis en 2003 est absorbé par la Damen Shiprepair."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_W%C3%BCstungen_im_Okres_Doma%C5%BElice","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/BedrichovFriedrichshof_02.jpg","page_title":"Liste der Wüstungen im Okres Domažlice","context_page_description":"Die Liste der Wüstungen im Okres Domažlice listet die Wüstungen im Okres Domažlice im Plzeňský kraj auf, unterteilt nach den Gemeinden, auf deren Gebiet sie liegen.\\nIm Okres Domažlice entstanden viele Wüstungen durch die Vertreibung der Deutschen aus der Tschechoslowakei nach 1945 und den Bau der Grenzbefestigungen der Tschechoslowakei im Kalten Krieg.\\nDas liegt an der grenznahen Lage des Okres Domažlice. In anderen Gegenden von Tschechien gibt es durchaus auch viele Wüstungen, die durch die Anlage von Truppenübungsplätzen oder durch den Bau von Staudämmen entstanden sind.\\nDie in der Spalte Nr. angegebenen Nummern verlinken auf den tschechischen Denkmalschutz."},{"page_url":"https://pl.wikipedia.org/wiki/Uppony","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Uppony_-_Borsodb%C3%B3ta_%2819171879666%29.jpg","page_title":"Uppony","context_page_description":"Uppony – wieś i gmina w północno-wschodniej części Węgier, w pobliżu miasta Ózd.\\nMiejscowość leży na lekko wyżynnym obszarze Średniogórza Północnowęgierskiego, w pobliżu granicy ze Słowacją. Administracyjnie gmina należy do powiatu Ózd, wchodzącego w skład komitatu Borsod-Abaúj-Zemplén i jest jedną z jego 29 gmin."},{"page_url":"https://en.wikipedia.org/wiki/South_African_Class_19C_4-8-2","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/A.G._Watson.jpg","page_title":"South African Class 19C 4-8-2","context_page_description":"The South African Railways Class 19C 4-8-2 of 1935 was a steam locomotive.\\nIn 1935, the South African Railways placed fifty Class 19C steam locomotives with a 4-8-2 Mountain type wheel arrangement in service. It was the first South African locomotive class to use rotary cam poppet valve gear and also the first to be built new with a Watson Standard boiler."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D1%8E%D1%80%D0%BE%D0%BB%D1%8C_(%D1%81%D1%8B%D1%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/WikiCheese_-_Murol_du_Grand_B%C3%A9rioux_-_20150619_-_001.jpg","page_title":"Мюроль (сыр)","context_page_description":"Мюроль, Гран Мюроль — французский сыр из коровьего молока оригинальной формы в виде круга с отверстием в центре."},{"page_url":"https://es.wikipedia.org/wiki/Ricardo_Magdalena","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Zaragoza_-_Grupo_escolar_Gasc%C3%B3n_y_Mar%C3%ADn_-_Ricardo_Magdalena.jpg","page_title":"Ricardo Magdalena","context_page_description":"Ricardo Magdalena Tabuenca fue un arquitecto, pintor, diseñador y artista zaragozano y uno de los máximos exponentes del historicismo y eclecticismo arquitectónico en España.\\nSu estilo es monumental e historicista, basado en la recuperación de la clásica arquitectura del Renacimiento aragonés, con elementos mudéjares, utilización del ladrillo y grandes aleros de madera, como la Lonja de Zaragoza y otras casas y palacios de la ciudad, que constituían aún la mayor parte de sus edificaciones. Sin embargo no relegó el cultivo de la arquitectura del hierro, como puede observarse en el Matadero Municipal, aunque en este aspecto le aventajó Félix Navarro, su gran competidor contemporáneo. A diferencia de Magdalena, que buscaba conectar con los elementos de la tradición para la renovación de la arquitectura, Navarro buscaba investigar en el desarrollo de esta a través de las posibilidades que ofrecían los nuevos materiales y de un nuevo enfoque destinado a la clase obrera. Magdalena fue ante todo un ecléctico, agradecido al Ayuntamiento, que le proporcionó una educación y una carrera impensables en su situación de orfandad, y fiel servidor de las instituciones para las que trabajó."},{"page_url":"https://eu.wikipedia.org/wiki/Chen_canagica","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Emperor.goose.arp.750pix.jpg","page_title":"Chen canagica","context_page_description":"Chen canagica Chen generoko animalia da. Hegaztien barruko Anatidae familian sailkatua dago."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%91%D0%B8%D1%82%D0%BA%D0%B0_%D0%BF%D1%80%D0%B8_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BF%D0%BE%D0%BB_(1877)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/%D0%9F%D0%B0%D0%BC%D0%B5%D1%82%D0%BD%D0%B8%D0%BA_%D0%BC%D0%B0%D0%B9%D0%BE%D1%80_%D0%92%D0%BE%D0%BB%D1%87%D0%B0%D0%BD%D0%B5%D1%86%D0%BA%D0%B8%D0%B9_6.jpg","page_title":"Битка при Никопол (1877)","context_page_description":"Битка при Никопол е втората по време на Руско-турската война. Завършва с пленяването на Никополския гарнизон и открива възможност за решително настъпление на руските войски към централна Северна България."},{"page_url":"https://fr.wikipedia.org/wiki/FIA_Groupe_A","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Seat_Ibiza_Kit_Car.jpg","page_title":"FIA Groupe A","context_page_description":"Le Groupe A est la catégorie relative aux voitures de tourisme modifiées, dans le règlement FIA. Cette catégorie a été créée en 1982 pour remplacer l'ancienne catégorie Groupe 2."},{"page_url":"https://cy.wikipedia.org/wiki/Ffwrnais,_Ceredigion","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Eglwys_Ynys-hir_Machynlleth_Porth_2.JPG","page_title":"Ffwrnais, Ceredigion","context_page_description":"Pentref bychan yng ngogledd Ceredigion yw Ffwrnais. Gorwedd ar lan ddwyreiniol Afon Dyfi, tua milltir a hanner o'r afon ei hun, ar y briffordd A487 rhwng Machynlleth ac Aberystwyth, ger Eglwys Fach. Dal ei enw o'r ffwrnais a sefydlwyd yno ganol y 18g.\\nMae'r pentref bychan yn adnabyddus am Ffwrnais Dyfi, ffwrnais haearn yn cael ei danio gan olosg sydd bellach yn atyniad twristaidd.\\nCynrychiolir y pentref yn y Cynulliad Cenedlaethol gan Elin Jones a'r Aelod Seneddol yw Ben Lake.\\nDetholwyd safle ger rhaeadr ar afon Einion, ffrwd fynyddig sy'n un o ledneintiau afon Dyfi, i fanteisio ar y cyflenwad o olosg a oedd ar gael o'r coedwigoedd lleol ar lethrau isaf bryniau Pumlumon. Byddai'r mwyn haearn yn cael chludo yno gan longau arfordirol o Cumbria ac i fyny afon Dyfi.\\nAdeiladwyd y ffwrnais tua'r flwyddyn 1755, ond dim ond am tua hanner canrif y cafodd ei ddefnyddio. Rhoddwyd y gorau i'r gwaith yn 1810.\\nAr hyn o bryd mae'r ffwrnais yn cael ei atgyweirio'n sylweddol gan CADW a gobeithir y bydd y gwaith wedi gorffen yn 2008."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%94%D0%B0%D0%B9%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Intersecting_Dikes_in_Black_Canyon_of_the_Gunnison.jpg","page_title":"Дайка","context_page_description":"Дайката е пластово интрузивно тяло, при което магмата е застинала напречно или под прав ъгъл във вместващите го скали и дължината му е многократно по-голяма от дебелината. Формированието се отнася към типа на несъгласните интрузии, т.е. пресича пластовете на скалите, в които се вмества. Образува се чрез запълване на готови пукнатини, които пресичат основното скално напластяване и следователно са много по-млади от околните скали. Преди да кристализира, магмата изминава дълг път по протежение на дайката. Обикновено, изнесени на повърхността, тези образувания са ясно различими, защото имат различен цвят и текстура от околните скали и пресичат основните им пластове под ъгъл. Могат да бъдат формирани от застинала магма или седименти."},{"page_url":"https://lt.wikipedia.org/wiki/Nemaj%C5%ABn%C5%B3_koply%C4%8Dia","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Nemaj%C5%ABn%C5%B3_koply%C4%8Dia.JPG","page_title":"Nemajūnų koplyčia","context_page_description":"Nemajūnų koplyčia – medinė koplyčia, stovinti Nemajūnų kaimo kapinėse, vienas iš kultūros paveldo objektų Birštono savivaldybėje. Kapinės įsikūrusios netoli Nemajūnų bažnyčios, prie kelio 3319 Jundeliškės–Nemajūnai. Vietos liaudies meistrų pastatyta 1851 m.\\nKoplyčia šešiakampė, su portiku ir kolonomis priekiniame statinio fasade, arkiniais langais ir durimis, turinti romantizmo bruožų. Koplyčioje yra rašytojo, buvusio Ustronės dvarininko Stanislovo Moravskio kapas, nedidelė ekspozicija, supažindinanti su šios asmenybės gyvenimu, senų vertingų kryžių kolekcija. S. Moravskio koplyčia buvo sutvarkyta ir atnaujinta jau Nepriklausomybės metais. Šiuo metu koplyčioje yra saugomi kryžiai ir paminklai, kurie sovietiniais metais buvo nuversti, sutrūniję. Iš viso čia yra per 30 kryžių bei antkapinių paminklų, tarp kurių ir vienas iš trijų seniausių kapinių kryžių."},{"page_url":"https://eu.wikipedia.org/wiki/Silurus_lithophilus","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Silurus_lithophilus1.jpg","page_title":"Silurus lithophilus","context_page_description":"Silurus lithophilus Silurus generoko animalia da. Arrainen barruko Siluridae familian sailkatzen da."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%97%A5%E6%9C%AC%E6%B0%91%E5%AE%B6%E9%9B%86%E8%90%BD%E5%8D%9A%E7%89%A9%E9%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Museum_of_Old_Japanese_Farm_House_Toyonaka_Osaka.JPG","page_title":"日本民家集落博物館","context_page_description":"日本民家集落博物館は、大阪府豊中市の服部緑地内にある博物館。17〜19世紀に建築された岩手から奄美大島までの民家11棟を服部緑地内に移設し、日本最初の野外博物館として昭和31年に開館した。"},{"page_url":"https://gl.wikipedia.org/wiki/Personificaci%C3%B3n_nacional","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/La_Libertad_en_la_cima_de_la_Piramide_de_Mayo.jpg","page_title":"Personificación nacional","context_page_description":"Unha personificación nacional é a antropomorfización dunha nación, que pode aparecer tanto en caricaturas editoriais como en selos, moedas, propaganda, documentos oficiais etc. Estas personificacións son utilizadas polas súas respectivas nacións para exaltaren características, valores e virtudes propias do país.\\nAlgunhas personificacións temperás no mundo occidental tendían a ser manifestacións nacionais que tiñan aspecto de nai ou de guerreira, e con frecuencia tomaban o nome latino da antiga provincia romana que simbolizaban, como Hispania, Britannia, Germania ou Helvetia."},{"page_url":"https://fr.wikipedia.org/wiki/1er_r%C3%A9giment_de_dragons","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/1_Dragons_rev.png","page_title":"1er régiment de dragons","context_page_description":"Le 1ᵉʳ régiment de dragons est une unité de cavalerie de l'armée française, créé sous la Révolution à partir du régiment Royal dragons, un régiment français d'Ancien Régime et dissous en 1997."},{"page_url":"https://es.wikipedia.org/wiki/T%C3%A9miscouata","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Municipalit%C3%A9_de_Lejeune.JPG","page_title":"Témiscouata","context_page_description":"Témiscouata es un municipio regional de condado de la provincia de Quebec en Canadá. Está ubicado en la región administrativa de Bas-Saint-Laurent. El chef-lieu y municipio más poblado es Témiscouata-sur-le-Lac.​"},{"page_url":"https://cs.wikipedia.org/wiki/M%C4%9B%C5%A1%C5%A5ansk%C3%BD_d%C5%AFm_%C4%8Dp._408_(Javorn%C3%ADk)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/M%C4%9B%C5%A1%C5%A5ansk%C3%BD_d%C5%AFm_%28M%C4%9Bsto_Javorn%C3%ADk%29%2C_408.JPG","page_title":"Měšťanský dům čp. 408 (Javorník)","context_page_description":"Měšťanský dům č. p. 408 se nachází na ulici Míru mezi domy čp. 407 a 409 v Javorníku v okrese Jeseník. Dům je kulturní památkou ČR a je součástí městské památkové zóny Javorník."},{"page_url":"https://fr.wikipedia.org/wiki/Le_Bourget-du-Lac","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Bourget-du-lac.JPG","page_title":"Le Bourget-du-Lac","context_page_description":"Le Bourget-du-Lac est une commune française située dans le département de la Savoie, en région Auvergne-Rhône-Alpes.\\nL'implantation d'un des pôles de l'Université Savoie-Mont-Blanc sur la commune a permis d'en faire une ville étudiante, d'une certaine manière. Hormis de par les étudiants, l'économie de la ville repose essentiellement sur le tourisme, la zone d'activité de Savoie Technolac et l’aéroport de Chambéry - Savoie qui permet l'afflux de nombreux touristes en hiver comme en été.\\nLa ville, historiquement, doit beaucoup à la présence de la Maison de Savoie. Cette famille princière marqua profondément la commune et aimait régulièrement y séjourner au sein du château des comtes de Savoie se situant sur les rives du lac du Bourget."},{"page_url":"https://it.wikipedia.org/wiki/Onofrio_Abbate","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/OnofrioAbbate.jpg","page_title":"Onofrio Abbate","context_page_description":"Onofrio Abbate, dal 1882 Abbate Pascià, è stato un medico, naturalista e scrittore italiano."},{"page_url":"https://ro.wikipedia.org/wiki/Alegeri_parlamentare_%C3%AEn_Republica_Moldova,_1994","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Ale94-StefanVoda.png","page_title":"Alegeri parlamentare în Republica Moldova, 1994","context_page_description":"Alegerile legislative în Republica Moldova au avut loc pe 27 februarie 1994."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B1%E3%83%84%E3%82%A1%E3%83%AB%E3%82%B3%E3%82%A2%E3%83%88%E3%83%AB%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Dinosaurs_at_CMNH_44.JPG","page_title":"ケツァルコアトルス","context_page_description":"ケツァルコアトルスは、中生代の終わり、白亜紀末の大量絶滅期の直前の時代を生きていた翼竜の1属である。翼指竜亜目中のアズダルコ上科アズダルコ科に分類される。\\n約6,800万年前から約6,600万年前にかけての約200万年間、海進時代の北アメリカ大陸に生息していた。\\n2020年現在、知られる限りで史上最大級の翼竜であり、同時に、史上最大級の飛翔動物である。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%8E%D1%80%D0%BE_%D0%B0%D0%BB%D0%BA%D0%BE%D0%B3%D0%BE%D0%BB%D1%8F,_%D1%82%D0%B0%D0%B1%D0%B0%D0%BA%D0%B0,_%D0%BE%D0%B3%D0%BD%D0%B5%D1%81%D1%82%D1%80%D0%B5%D0%BB%D1%8C%D0%BD%D0%BE%D0%B3%D0%BE_%D0%BE%D1%80%D1%83%D0%B6%D0%B8%D1%8F_%D0%B8_%D0%B2%D0%B7%D1%80%D1%8B%D0%B2%D1%87%D0%B0%D1%82%D1%8B%D1%85_%D0%B2%D0%B5%D1%89%D0%B5%D1%81%D1%82%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Atf-fd-map.png","page_title":"Бюро алкоголя, табака, огнестрельного оружия и взрывчатых веществ","context_page_description":"Бюро алкоголя, табака, огнестрельного оружия и взрывчатых веществ, сокр. АТО или АТФ — федеральное агентство Министерства юстиции США, в обязанности которого входит расследования и предотвращение преступлений, связанных с незаконным использованием, производством и хранением огнестрельного оружия и взрывчатых веществ. В компетенцию агентства входит расследование террористических актов, поджогов и взрывов, а также контроль за незаконным оборотом алкогольной и табачной продукции. АТФ выполняет функции лицензионного агентства для продажи, хранения и транспортирования огнестрельного оружия, боеприпасов и взрывчатых веществ, а также торговли ими на территории США. В АТФ работает около 5000 человек, годовой бюджет в 2012 году составил 1,2 миллиарда долларов."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89nergie_%C3%A9olienne_au_Qu%C3%A9bec","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Eoliennes_Gaspesie.jpg","page_title":"Énergie éolienne au Québec","context_page_description":"L'énergie éolienne au Québec concerne l'analyse de l'énergie éolienne sur le territoire du Québec. L'idée d'exploiter ce type d'énergie dans cette province canadienne a été relancée après la signature du protocole de Kyoto, alors que le gouvernement du Québec s'est mis à chercher d'autres sources d'énergie renouvelable que l'hydro-électricité produite par Hydro-Québec."},{"page_url":"https://it.wikipedia.org/wiki/F%C3%BCrstenberg_(famiglia_principesca)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Wappen_Zaehringer.png","page_title":"Fürstenberg (famiglia principesca)","context_page_description":"Fürstenberg è una casata nobile originaria del Baden-Württemberg meridionale. I feudi di cui era proprietaria erano concentrati presso la Foresta Nera, l'Alto Reno, il Lago di Costanza ed il Giura Svevo.\\nIl Principato di Fürstenberg ebbe vita sino al 1806 e fu uno dei maggiori territori principeschi del sud-ovest tedesco. La famiglia divenne col tempo particolarmente nota come titolare di un famoso birrificio e per essere la proprietaria di una delle maggiori collezioni d'arte private in Europa. Dal 1488 la famiglia ha sede nel castello di Donaueschingen, uno dei monumenti più significativi del Rinascimento a nord delle Alpi.\\nSono numerosi i membri della famiglia che, nel corso dei secoli, hanno raggiunto posizioni eminenti come soldati, ecclesiastici, diplomatici, accademici e, di recente, anche stilisti e attori.\\nIl cognome della famiglia è stato talvolta \\"francesizzato\\" in de Furstenberg o \\"anglicizzato\\" in Furstenberg.\\nLa famiglia principesca dei Fürstenberg non deve essere confusa con la famiglia baronale dei Fürstenberg, originaria della Vestfalia."},{"page_url":"https://en.wikipedia.org/wiki/Embassy_of_the_United_Kingdom,_Washington,_D.C.","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Ford_B2649_NLGRF_photo_contact_sheet_%281977-01-05%29%28Gerald_Ford_Library%29.jpg","page_title":"Embassy of the United Kingdom, Washington, D.C.","context_page_description":"The British Embassy Washington is the British sovereign's diplomatic mission to the United States of America, representing the United Kingdom and the United Kingdom's interests. It is located at 3100 Massachusetts Avenue NW in Washington, D.C."},{"page_url":"https://nl.wikipedia.org/wiki/Tobermore","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Tobermore.jpg","page_title":"Tobermore","context_page_description":"Tobermore is een klein dorp in de County Londonderry, Noord-Ierland. Het dorp ligt ten zuiden van Maghera en ten westen van Magherafelt. Bij de plaatselijke voetbalclub Tobermore United FC sloot George Best in 1984 zijn voetballoopbaan af. Een andere voetballer, doelman Harry Gregg, werd in Tobermore geboren."},{"page_url":"https://fr.wikipedia.org/wiki/Charles_Jean_d%27Hector","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Le_Port_de_Brest_%28une_prise_de_la_m%C3%A2ture%29-Louis-Nicolas_Van_Blarenberghe_mg_8233.jpg","page_title":"Charles Jean d'Hector","context_page_description":"Charles Jean d'Hector, comte d'Hector, né le 22 juillet 1722 à Fontenay-le-Comte et mort le 18 août 1808 à Reading, près de Londres, est un aristocrate et officier de marine français du XVIIIᵉ siècle. Orphelin de père jeune, il entre tôt dans la marine royale et commence à servir pendant la guerre de Sept Ans, notamment lors de la bataille des Cardinaux. À la suite de ce combat, il sauve — en compagnie du chevalier de Ternay — une partie de la flotte française qui s'était réfugiée dans la Vilaine. Il est promu capitaine de vaisseau puis chef d'escadre au début de la guerre d'indépendance des États-Unis. Nommé commandant de la Marine et du port de Brest, il assiste le Ministre de la Marine, le maréchal de Castries dans ses réflexions sur la réforme de la Marine. Il reçoit la visite du futur tsar de Russie Nicolas Iᵉʳ et de sa famille, ainsi que celle de Louis XVI venu inspecter le port de Cherbourg.\\nSa pupille Melle Georgette de Kerouatz épouse au printemps de 1784 Paul Fleuriot de Langle.\\nIl termine sa carrière au grade de lieutenant général des armées navales de la Marine royale sous Louis XVI."},{"page_url":"https://eu.wikipedia.org/wiki/Batman_Returns","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Le_retour_de_Batman_%28par%29.PNG","page_title":"Batman Returns","context_page_description":"Batman Returns 1992ko Tim Burton estatubatuar zinema zuzendariak eta ekoizleak zuzendu eta ekoitzitako superheroi film bat da. DC Comics argitaletxearen Batman superheroiaren komikietan oinarritua dago. Michael Keaton, Danny DeVito, Michelle Pfeiffer, Christopher Walken, Michael Gough, Pat Hingle eta Michael Murphy aktoreek antzeztu zuten.\\nEfektu berezi onenen Oscar Saria eta Makillaje onenaren Oscar Sariaren izendapenak jaso zituen."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A0%D7%99%D7%95_%D7%92%27%D7%A8%D7%96%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/A_poser_goldfinch_%283863963277%29.jpg","page_title":"ניו ג'רזי","context_page_description":"ניו ג'רזי היא מדינה בארצות הברית. המדינה, השוכנת בחוף המזרחי, היא אחת המדינות הקטנות בשטחן באיחוד והצפופה במדינות ארצות הברית. היא קרויה על שם האי ג'רזי שבאיי התעלה. ניו ג'רזי היא אחת משלוש עשרה המושבות המקוריות שמרדו בשלטון הבריטי במהלך המהפכה האמריקנית והקימו את ארצות הברית."},{"page_url":"https://ru.wikipedia.org/wiki/Miles_Gordon_Technology","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Sam_coupe_front_dec_05.jpg","page_title":"Miles Gordon Technology","context_page_description":"Miles Gordon Technology — компания, основанная в июне 1986 года в Кембридже двумя бывшими работниками Sinclair Research, Аланом Майлсом и Брюсом Гордоном, после того как Синклер передал все права на ZX Spectrum компании Amstrad. MGT специализировалась на периферии для компьютера Spectrum. В мае 1986 года компания переехала в Суонси, в июле 1989 стала публичной компанией, и в июне 1990 года была передана под внешнее управление."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%AC%AC%E4%BA%8C%E5%A5%97%E7%9B%B4%E5%BC%8F%E6%96%B0%E8%87%BA%E5%B9%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/TaiwanP1946-1Cent-1949_a.jpg","page_title":"第二套直式新臺幣","context_page_description":"第二套直式新台币于1949年7月5日开始分批发行，中央印制厂台北厂印制。本套币中一百元券由于民众恐惧通货膨胀，未发行，1961年6月9日误流出，紧急收回取消发行。"},{"page_url":"https://zh-yue.wikipedia.org/wiki/Favicon","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Wikipedia_favicon_in_Firefox_on_KDE.png","page_title":"Favicon","context_page_description":"Favicon 係favorite icon嘅減筆，又叫website icon、shortcut icon、url icon同bookmark icon， 係一個16×16或者32×32像素嘅圖示檔案，當打開一個網頁嗰陣時會喺網址列旁顯示，或者出現喺分頁鍵同書籤度。唔同網站會放唔同嘅圖示來做自己網站嘅標識。"},{"page_url":"https://nl.wikipedia.org/wiki/Ontwerp_voor_stationsplein_in_Leeuwarden","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Theo_van_Doesburg_Design_Monument_Leeuwarden.jpg","page_title":"Ontwerp voor stationsplein in Leeuwarden","context_page_description":"Ontwerp voor stationsplein in Leeuwarden, ook Vierkant in vierkant genoemd, is een prijsvraagontwerp gemaakt in 1917-1918 door architect Jan Wils en beeldend kunstenaar Theo van Doesburg voor de herinrichting en verfraaiing van het stationsplein in de Nederlandse stad Leeuwarden."},{"page_url":"https://it.wikipedia.org/wiki/Mike_Douglas","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Mike_Douglas_1966.JPG","page_title":"Mike Douglas","context_page_description":"Michael Delaney Dowd, meglio noto come Mike Douglas, è stato un cantante e attore statunitense.\\nHa iniziato l'attività di cantante da adolescente e per questo negli anni quaranta si trasferì in California.\\nHa anche preso parte in qualche film come attore e anche come cantante, come la versione cantata del principe in Cenerentola.\\nNel 1944, a 19 anni ha sposato Genevieve Purnell con cui rimase fino alla morte e da cui ha avuto tre figlie, tra cui due gemelle.\\nÈ morto nel 2006, il giorno del suo 81º compleanno e le cause della morte sono sconosciute: la moglie ha rivelato che Mike era morto per ipotermia, ma questo non fu mai accertato poiché l'11 agosto era un giorno molto caldo in Florida; altri hanno rivelato che fosse morto per un cancro alla prostata di cui era malato dal 1990.\\nMike Douglas è stato sepolto nel Riverside Memorial Park di Tequesta, Florida."},{"page_url":"https://pl.wikipedia.org/wiki/U%C3%B1a","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/U%C3%B1a.JPG","page_title":"Uña","context_page_description":"Uña – gmina w Hiszpanii, w prowincji Cuenca, w Kastylii-La Mancha, o powierzchni 23,25 km². W 2011 roku gmina liczyła 105 mieszkańców."},{"page_url":"https://lt.wikipedia.org/wiki/Raudonasis_klevas","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Maple7951.JPG","page_title":"Raudonasis klevas","context_page_description":"Raudonasis klevas – klevinių šeimos, klevų genties lapus metantis medis. Šis medis dar žinomas tokiais vardais, kaip Pelkių ar Švelnusis klevas.\\n."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B1%E3%83%B4%E3%82%A3%E3%83%B3%E3%83%BB%E3%83%9E%E3%83%83%E3%82%AB%E3%83%BC%E3%82%B7%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Kevin_McCarthy_in_Invasion_of_the_Body_Snatchers_trailer.jpg","page_title":"ケヴィン・マッカーシー","context_page_description":"ケヴィン・マッカーシーは、アメリカ合衆国の俳優。ワシントン州シアトル出身。姉に作家のメアリー・マッカーシー。"},{"page_url":"https://hu.wikipedia.org/wiki/Celest%C3%BAn","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Celest%C3%BAn%2C_Yucat%C3%A1n_%2801%29.JPG","page_title":"Celestún","context_page_description":"Celestún község és település Mexikó Yucatán államának nyugati tengerpartján, lakossága 2010-ben meghaladta a 6800 főt. A községhez a községközponton, Celestúnon kívül még tíz település tartozik, ám ezek közül a legnagyobban is mindössze 4 fő lakik."},{"page_url":"https://et.wikipedia.org/wiki/Haywoodi_maakond_(Tennessee)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Brownsville_TN_2012-04-08_004.jpg","page_title":"Haywoodi maakond (Tennessee)","context_page_description":"Haywoodi maakond on maakond USA-s Tennessee osariigis.\\nMaakonna halduskeskus ja suurim linn on Brownsville.\\nMaakonna pindala on 1383 km². Veepindala on 2 km².\\nElanike arv oli 2010. aasta rahvaloenduse järgi 18 787. Aastal 2000 oli elanike arv 19 797."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A8%D8%A7%D8%A6%D9%88%D8%AF%DB%8C%D9%86%DA%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Location_of_Baoding_Prefecture_within_Hebei_%28China%29.png","page_title":"بائودینگ","context_page_description":"بائودینگ یکی از شهرهای کشور جمهوری خلق چین است. جمعیت آن در سال ۲۰۰۸ میلادی برابر ۱،۰۷۶،۲۸۸ نفر تخمین زده شده است.\\nبائودینگ در استان هه‌بی در شرق چین قرار گرفته است. این شهر، از نظر اداری مستقل به حساب می‌آید. فاصله آن با پکن ۱۴۰ کیلومتر است."},{"page_url":"https://cs.wikipedia.org/wiki/David_Longstreth","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Dirty_Projectors_2008.05.31_004.jpg","page_title":"David Longstreth","context_page_description":"David Longstreth je americký zpěvák a kytarista. Narodil se ve městě Southbury v americkém státě Connecticut. Své první album nazvané The Graceful Fallen Mango vydal roku 2002 a zanedlouho založil skupinu Dirty Projectors, se kterou vydal řadu alb. Rovněž se podílel na sólových nahrávkách jednoho dalších členů kapely, baskytaristy Nata Baldwina. Roku 2015 se podílel na písni „FourFiveSeconds“ tria Rihanna, Kanye West a Paul McCartney. Téhož roku složil klasickou skladbu nazvanou „Michael Jordan“ pro newyorský soubor Ensemble LPR. Rovněž vytvořil orchestrální aranžmá pro album Divers hudebnice Joanny Newsom. Jeho přítelkyní byla zpěvačka Amber Coffman, rovněž členka Dirty Projectors."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A9%E3%82%AF%E3%83%80%E7%A7%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Large_scott_oxydactylus.jpg","page_title":"ラクダ科","context_page_description":"ラクダ科は、哺乳類・偶蹄目の生物分類単位。世界各地で家畜として利用されるラクダやラマなどが含まれる。\\n哺乳類の赤血球は無核で丸く、鳥類や爬虫類の赤血球は核があり楕円形なのが普通であるが、哺乳類の中でもラクダ科の動物だけは無核だが楕円形をした赤血球を持っている。また、他の哺乳類とは異なり、重鎖だけで構成されるサイズの小さな抗体を持つことが知られている。"},{"page_url":"https://hu.wikipedia.org/wiki/Mohamed_Az%C3%A1m_sah","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Darbarscene.jpg","page_title":"Mohamed Azám sah","context_page_description":"Abu'l Faaiz Kutb-ud-Din Mohamed Azám Padisah, közismert nevén Azám Sah, névleges mogul sah, aki 1707. március 14. és 1707. június 8. között uralkodott. Ő volt a legidősebb fia a hatodik mogul sahnak, Aurangzebnek, és első feleségének, Dilrasz Banu Begamnak.\\nSáh Dzsahán mogul sahnak unokája és Zeb-un-Nisszának pedig az öccse volt.\\nAzámot szentelték fel a trón várományosának 1681. augusztus 12-én. Többek között mint helytartó szolgált a Berári szubahban, Malvában, Bengálban, Gudzsarátban és a Dekkánon. Ahmednagarban lépett a mogul trónra 1707. március 14-én, apja halála után.\\nAzám sah és három fia, Mohamed Bidar Bakt, Sahzada Dzsaván Bakt Bahádur és Sahzada Szikander San Bahádur elestek a Dzsadzsaui csatában 1707. június 8-án, amit idősebb féltestvére, Álam sah herceg, ellen vívtak."},{"page_url":"https://en.wikipedia.org/wiki/Reticulate_whipray","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Honeycomb_stingray_at_the_California_Academy_of_Sciences.jpg","page_title":"Reticulate whipray","context_page_description":"The reticulate whipray or honeycomb stingray is a species of stingray in the family Dasyatidae. It inhabits coastal and brackish waters across the Indo-Pacific region from South Africa to Taiwan to Australia, favoring sandy habitats. A large species reaching 2 m in width, the reticulate whipray has a diamond-shaped pectoral fin disc and an extremely long tail without fin folds. Both its common and scientific names refer to its ornate dorsal color pattern of many small, close-set dark spots or reticulations on a lighter background. However, the reticulate whipray is only one of several large spotted stingrays in the Indo-Pacific which, coupled with the variability of its coloration with age and locality, has resulted in a great deal of taxonomic confusion.\\nOften encountered resting on the bottom during daytime, the reticulate whipray is a predator of bottom-dwelling invertebrates and bony fishes. Like other stingrays, it is aplacental viviparous, with the developing embryos nourished at first by yolk and later by histotroph. Females bear litters of up to five pups in summer, following a gestation period of a year."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Pierre_de_Genens","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Montr%C3%A9al_%2832%29_%C3%89glise_Saint-Pierre_de_Genens_25.JPG","page_title":"Église Saint-Pierre de Genens","context_page_description":"L’église Saint-Pierre de Genens est une église romane, aujourd’hui en ruine, sur le territoire de la commune de Montréal-du-Gers, dans le Gers."},{"page_url":"https://es.wikipedia.org/wiki/Bureta_(Zaragoza)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Escudo_de_Bureta.svg","page_title":"Bureta (Zaragoza)","context_page_description":"Bureta es una población española de la provincia de Zaragoza, comarca Campo de Borja, Comunidad Autónoma de Aragón. Tiene un área de 11 km², con una población de 269 habitantes y una densidad de 24,45 hab/km²."},{"page_url":"https://fr.wikipedia.org/wiki/Harfleur","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Mus%C3%A9e_du_Prieur%C3%A9-Tour.JPG","page_title":"Harfleur","context_page_description":"Harfleur est une commune française située dans le département de la Seine-Maritime en région Normandie."},{"page_url":"https://pl.wikipedia.org/wiki/Lista_%C5%9Bwiatowego_dziedzictwa_UNESCO_w_Bu%C5%82garii","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Bulgaria-Plovdiv-02.jpg","page_title":"Lista światowego dziedzictwa UNESCO w Bułgarii","context_page_description":"Lista światowego dziedzictwa UNESCO w Bułgarii – lista miejsc w Bułgarii wpisanych na listę światowego dziedzictwa UNESCO. Obecnie na liście znajduje się 9 miejsc. Na liście oczekujących na nominację znajduje się zaś 13 obiektów."},{"page_url":"https://en.wikipedia.org/wiki/Ambatolampy","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Antananarivo_Ambatolampy.png","page_title":"Ambatolampy","context_page_description":"Ambatolampy is a city in the Vakinankaratra Region, situated in the Central Highlands of Madagascar. It had a population of about 28,500 in 2013.\\nIt is the administrative capital of the district of the same name, and is situated on Route nationale No. 7 which runs from Antananarivo to Toliara. Ambatolampy is a railway station on the Antananarivo - Antsirabe line.\\nA regional centre for distance education of the Centre National de Télé-Enseignement de Madagascar is located in Ambatolampy.\\nA species of gecko, Lygodactylus tolampyae, may be named after Ambatolampy."},{"page_url":"https://pt.wikipedia.org/wiki/Juiz_de_Fora","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Universidade_Federal_Juiz_de_Fora_22.JPG","page_title":"Juiz de Fora","context_page_description":"Juiz de Fora é um município brasileiro no interior do estado de Minas Gerais. Localiza-se na Zona da Mata Mineira, a sudeste da capital do estado, distando desta cerca de 283 km. Sua população foi contada, no ano de 2010, em 516 247 habitantes, pelo Instituto Brasileiro de Geografia e Estatística, sendo então o quarto mais populoso de Minas Gerais e o 36º do Brasil. Em 2018 sua população foi estimada em 564 310 habitantes. Ocupa uma área de 1 429,875 km², sendo que apenas 317,740 km² estão em perímetro urbano. A cidade faz parte do eixo industrial das cidades próximas à BR 040 e das próximas à BR 116.\\nA cidade de Juiz de Fora foi emancipada de Barbacena na década de 1850. A versão mais conhecida de sua etimologia é que o nome seja uma referência a um juiz de fora, magistrado nomeado pela Coroa Portuguesa para atuar onde não havia juiz de direito, que hospedou-se por pouco tempo em uma fazenda da região, passando esta a ser conhecida como a Sesmaria do Juiz de Fora. Hoje é formada pela cidade de Juiz de Fora além dos distritos de Rosário de Minas, Torreões e Sarandira, subdivididos ainda em 111 bairros."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%94%D1%8B%D0%BA%D1%96%D1%80%D1%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Map_Diekirch.PNG","page_title":"Дыкірх","context_page_description":"Дыкірх — камуна ў Люксэмбургу, разьмяшчаецца ў акрузе Дыкірх. Камуна Дыкірх зьяўляецца часткай кантона Дыкірх. У камуне знаходзіцца аднайменны населены пункт.\\nНасельніцтва складае 6450 чалавек ​​, у камуне разьмяшчаюцца 2100 хатніх гаспадарак. Займае плошчу 12,42 км ². Найвышэйшая кропка камуны над узроўнем мора складае 396 м, найменшая 187 м."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D1%80%D1%85%D0%B8%D0%B5%D0%BF%D0%B0%D1%80%D1%85%D0%B8%D1%8F_%D0%93%D0%B0%D0%BB%D0%B8%D1%84%D0%B0%D0%BA%D1%81%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/DSC04665_%287185769572%29.jpg","page_title":"Архиепархия Галифакса","context_page_description":"Архиепархия Галифакса — архиепархия Римско-Католической церкви с центром в городе Галифакс, Канада. В архиепархию Галифакса входят епархии Антигониша, Шарлоттауна, Ярмута. Кафедральным собором архиепархии является собор Пресвятой Девы Марии в Галифаксе."},{"page_url":"https://no.wikipedia.org/wiki/Guden%C3%A5","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a8/Gudena00121.gif","page_title":"Gudenå","context_page_description":"Gudenå er ei elv i Jylland, og den lengste elva i Danmark. Den er 176 kilometer lang og har et nedbørfelt på 2 643 km². Elva har utspring fra Tinnet Krat i Vejle kommune, bare en halv kilometer sørøst for kilden til Skjern Å, og munner ut i Randers Fjord, rundt 10 kilometer øst for Randers."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8B%D5%B8%D6%82%D6%81%D5%B8%D6%82_(%D5%86%D5%A1%D6%80%D5%B8%D6%82%D5%BF%D5%B8)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Mangekyou_Sharingan_Kakashi.svg","page_title":"Ջուցու (Նարուտո)","context_page_description":"Ջուցու, այսպես է կոչվում «Նարուտո» անիմեի նինջաներից յուրաքանչյուրի ֆանտաստիկ և առանձնահատուկ կարողությունները։ Ջուցուների բազմազանությունն ու տպավորչությունը անիմեի այդքան հայտնիության պատճառներից մեկն են։\\nՏեխնիկայի գաղափարը մշակել է Մասաշի Քիշիմոտոն՝ հիմնվելով արևելյան կրոնների և հավատալիքների վրա։ Իր կերպարների գերմարդկային ունակությունները նա պարզաբանում է հենց դրանցով։ Քիշիմոտոյի գաղափարի համաձայն ՝ ցանկացած «տեխնիկա» հիմնված է կա՛մ չակրան ուղղակիորեն վերահսկելու, կա՛մ ձեռագիր կնիքների, կա՛մ ձեռքի կնիքների վրա ։\\nՉնայած հնդկական դիցաբանության, բուդդիզմի և այլ կրոնական համակարգերում չակրա առկայությանը ՝ Քիշիմոտոն հարցազրույցներից մեկում ասել է, որ դրանցից ոչ մեկը չի ազդել մանգայում այս տերմինի օգտագործման վրա: Նարուտոյի աշխարհի չակրան Քիշիմոտոն համեմատում է Աստաղին պատերազմներ ֆիլմի «Ուժի» հետ։"},{"page_url":"https://en.wikipedia.org/wiki/Zoig%C3%AA_County","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Baozuo_communities.jpg","page_title":"Zoigê County","context_page_description":"Zoigê County is a county of Ngawa Tibetan and Qiang Autonomous Prefecture in Sichuan, China, bordering Gansu to the north. It is the northernmost county of the province. It is part of the Tibetan traditional region of Amdo.\\nIt has an area of 10,620 km² and a population of 69,900, 90.4% of which are Tibetan people."},{"page_url":"https://lv.wikipedia.org/wiki/N%C4%ABderlandes_pils%C4%93tu_uzskait%C4%ABjums","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/50/Location_Netherlands_EU_Europe.png","page_title":"Nīderlandes pilsētu uzskaitījums","context_page_description":"Uzskaitījumā apkoptas Nīderlandes pilsētas.\\nNīderlandes galvaspilsētā Amsterdamā, Roterdamā un Hāgā iedzīvotāju skaits ir vairāk nekā pusmiljons. 25 Nīderlandes pilsētās iedzīvotāju skaits ir 500 000 — 100 000 iedzīvotāju. 39 pilsētās iedzīvotāju skaits ir 100 000 — 50 000 iedzīvotāju. 101 pilsētā iedzīvotāju skaits ir 50 000 — 25 000 iedzīvotāju. Savukārt pārējās pilsētās iedzīvotāju skaits ir zem 25 000 iedzīvotājiem."},{"page_url":"https://de.wikipedia.org/wiki/Dmitri_Sergejewitsch_Lichatschow","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Dmitry_Lihachev.jpg","page_title":"Dmitri Sergejewitsch Lichatschow","context_page_description":"Dmitri Sergejewitsch Lichatschow war ein russischer Philologe und Slawist, Mitglied der Russischen bzw. Sowjetischen Akademie der Wissenschaften.\\nLichatschow verfasste eine große Anzahl an Untersuchungen über die Geschichte der russischen Literatur, vorwiegend über die altrussische Periode. Epochemachend für die Slawistik war seine Monographie über Textkritik, die sich mit Fragestellungen der Editionstechnik auseinandersetzt."},{"page_url":"https://pl.wikipedia.org/wiki/%C5%9Alinianka","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Illu_quiz_hn_02.jpg","page_title":"Ślinianka","context_page_description":"Ślinianka, gruczoł ślinowy – gruczoł położony w przedniej części układu pokarmowego, wytwarzający ślinę, która zawiera enzymy trawienne służące do wstępnej fazy trawienia, a u niektórych gatunków także toksyny."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%83%A7%E4%BC%BD%E7%BE%85%E4%BA%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Piper_betle_Blanco1.12.jpg","page_title":"僧伽羅人","context_page_description":"僧伽羅人是斯里蘭卡的主體民族。斯里蘭卡島的西南部便是僧伽羅人人口分布比例最高的地區。長年處在熱帶氣候當中的僧伽羅人，在住房及飲食方面都有著適應氣候而發展出的特色。僧伽羅人有自己的語言及文字，並於1956年成為《斯里蘭卡憲法》上承認的官方語言。在歷史發展方面，僧伽羅人與同處斯里蘭卡島上的少數民族—泰米爾人一直在土地、工作權等議題上有所摩擦，因此也成為南亞地區著名的民族衝突。在宗教信仰方面，僧伽羅人主要信仰上座部佛教，因此斯里蘭卡到處可見佛寺、佛像，節慶也多以佛教慶典為主。"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D8%A7%D9%86%D8%B4%DA%AF%D8%A7%D9%87_%D8%AF%D9%88%D9%84%D8%AA%DB%8C_%D9%85%D8%B3%DA%A9%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/MSUSoilScienceFaculty1.JPG","page_title":"دانشگاه دولتی مسکو","context_page_description":"دانشگاه دولتی لومونُسُـف مسکو با نام اختصاری ام. گ. او МГУ یکی از مهم‌ترین دانشگاه‌های کشور روسیه است. دانشگاه مسکو، دانشگاهی دولتی است و در شهر مسکو، پایتخت روسیه و در بالای تپه‌ای به نام «تپهٔ گنجشکان» قرار دارد."},{"page_url":"https://fy.wikipedia.org/wiki/Esens","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6d/Grosses_Wappen_Esens.png","page_title":"Esens","context_page_description":"Esens is in gemeente en stêd yn East-Fryslân yn de Dútske dielsteat Nedersaksen, en is part fan de samtgemeinde mei deselde namme yn it landkreis Wittmund.\\nEsens hat sa'n 6894 ynwenners en leit sa'n fjouwer km fan de Waadsee ôf."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Auslandsvertretungen_Tunesiens","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Tunis_Embassy_%283809111659%29.jpg","page_title":"Liste der Auslandsvertretungen Tunesiens","context_page_description":"Dies ist eine Liste der diplomatischen und konsularischen Vertretungen Tunesiens."},{"page_url":"https://en.wikipedia.org/wiki/COVID-19_pandemic_in_Italy","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/E_guarirai_da_tutte_le_malattie_ed_io%2C_avr%C3%B2_cura_di_te%2C_%28Dio_blocca_il_Coronavirus_%28COVID-19%29_sull%27Italia%29%2C_china_su_graphia%2C_Giovanni_Guida_2020.jpg","page_title":"COVID-19 pandemic in Italy","context_page_description":"The COVID-19 pandemic in Italy is part of the pandemic of coronavirus disease 2019 caused by severe acute respiratory syndrome coronavirus 2. The virus was first confirmed to have spread to Italy on 31 January 2020, when two Chinese tourists in Rome tested positive for the virus. One week later an Italian man repatriated back to Italy from the city of Wuhan, China, was hospitalised and confirmed as the third case in Italy. A cluster of cases was later detected, starting with 16 confirmed cases in Lombardy on 21 February, and 60 additional cases and the first deaths on 22 February. By the beginning of March, the virus had spread to all regions of Italy. On 6 March 2020, the Italian College of Anesthesia, Analgesia, Resuscitation and Intensive Care published medical ethics recommendations regarding triage protocols that might need to be employed.\\nOn 31 January, the Italian government suspended all flights to and from China and declared a state of emergency. In February, eleven municipalities in northern Italy were identified as the centres of the two main Italian clusters and placed under quarantine. The majority of positive cases in other regions traced back to these two clusters."},{"page_url":"https://eu.wikipedia.org/wiki/Pseudacris_crucifer","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/H_crucifer_USGS.jpg","page_title":"Pseudacris crucifer","context_page_description":"Pseudacris crucifer Pseudacris generoko animalia da. Anfibioen barruko Hylidae familian sailkatuta dago, Anura ordenan."},{"page_url":"https://en.wikipedia.org/wiki/Airmont,_New_York","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Rockland_County_New_York_incorporated_and_unincorporated_areas_Airmont_highlighted.svg","page_title":"Airmont, New York","context_page_description":"Airmont is a village in the town of Ramapo, Rockland County, New York, United States, located north of the state of New Jersey, east of Suffern, south of Montebello, and west of Chestnut Ridge. The population was 8,628 at the 2010 census.\\nThe village of Airmont, incorporated in 1991, is a consolidation of the hamlets of Tallman, Airmont and South Monsey. Joseph Berger of The New York Times wrote in a 1997 article that Airmont was one of several Ramapo villages formed \\"to preserve the sparse Better Homes and Garden [sic] ambiance that attracted them to Rockland County.\\" In 2005, Peter Applebome of The New York Times said that Airmont was \\"slapped around enough by the courts to be something other than a virginal player in any discrimination case\\" since it ran into legal resistance to its development laws."},{"page_url":"https://sv.wikipedia.org/wiki/S%C3%A3o_Jorge","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Ilha_do_Pico_vista_da_Faj%C3%A3_Grande%2C_Calheta%2C_ilha_de_S%C3%A3o_Jorge%2C_A%C3%A7ores%2C_Portugal.JPG","page_title":"São Jorge","context_page_description":"São Jorge är en portugisisk ö som tillhör ögruppen Azorerna cirka 1500 km väster om Portugal i Atlanten. Tillsammans med Pico, Terceira, Faial och Graciosa tillhör den centrala gruppen i Azorerna.\\nSão Jorge har en yta på 246 km² och ett invånarantal på 9 171 invånare personer. Ön är mycket långsmal. Den är 56 km lång och 8 km bred och ligger på färjeavstånd från Faial, Pico och Terceira. Den högsta punkten på ön heter Pico da Esperança och är 1 053 meter hög.\\nSão Jorge är uppdelad i två kommuner Velas och Calheta med fem respektive sex församlingar:\\nVelas, Manadas, Norte Grande, Rosais, Santo Amaro, Urzelina.\\nCalheta, Norte Pequeno, Ribeira Seca, Santo Antão, Topo."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Brooklyn_thoroughfares","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/OceanParkway.JPG","page_title":"List of Brooklyn thoroughfares","context_page_description":null},{"page_url":"https://en.wikipedia.org/wiki/Scottish_Episcopal_Church","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/James_I%2C_VI_by_John_de_Critz%2C_c.1606.png","page_title":"Scottish Episcopal Church","context_page_description":"The Scottish Episcopal Church is the ecclesiastical province of the Anglican Communion in Scotland.\\nA continuation of the Church of Scotland as intended by King James VI, and as it was from the Restoration of Charles II to the re-establishment of Presbyterianism in Scotland following the Glorious Revolution, it recognises the Archbishop of Canterbury as president of the Anglican Instruments of Communion, but without jurisdiction in Scotland per se. This close but ambivalent relationship – consisting of a partial recognition of the authority of the Church of England, yet concurrent claim of independence – results from the unique history of the Scottish Episcopal Church.\\nScotland's third largest church, the Scottish Episcopal Church has 303 local congregations. In terms of official membership, Episcopalians nowadays constitute well under 1 per cent of the population of Scotland, making them considerably smaller than the Church of Scotland. The membership of the church in 2018 was 28,647, of whom 19,983 were communicant members. Weekly attendance was 12,430. In 2017, church membership had been 30,909, of whom 22,073 were communicant members."},{"page_url":"https://sh.wikipedia.org/wiki/M%C3%A1ndok","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/M%C3%A1ndok1.jpg","page_title":"Mándok","context_page_description":"Mándok je grad na sjeveroistoku Mađarske od 4,143 stanovnika, koji administrativno podpada pod Županiju Szabolcs-Szatmár-Bereg."},{"page_url":"https://en.wikipedia.org/wiki/2010_World_Rhythmic_Gymnastics_Championships","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Olympic_Stadium_%28Moscow%29.jpg","page_title":"2010 World Rhythmic Gymnastics Championships","context_page_description":"The XXX World Rhythmic Gymnastics Championships were held in Moscow, Russia, from September 20 to 26, 2010, at the Olympiysky Sports Complex. The events were All-around, ball, ribbon, hoop, rope and the Group all around, group 5 hoops and group 3 ribbons + 2 ropes."},{"page_url":"https://es.wikipedia.org/wiki/Fuerzas_Armadas_Espa%C3%B1olas_(per%C3%ADodo_del_franquismo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Vintagedivi2.png","page_title":"Fuerzas Armadas Españolas (período del franquismo)","context_page_description":"Las Fuerzas Armadas Españolas durante el período del franquismo fueron la institución encargada de la defensa nacional y el orden público del territorio español durante el periodo histórico del Reino de España bajo la tutela del general Francisco Franco. Su historia se desarrolla desde el inicio de la Guerra Civil, pasando por la dictadura militar, hasta 1978 durante los primeros años de la transición a la democracia.\\nDurante la Guerra Civil y la dictadura fueron autodenominadas como Ejército \\"Nacional\\" o simplemente Ejército español. Debido a su fidelidad y obediencia a Francisco Franco, por ello también son denominadas como el Ejército Franquista. De hecho, en la Dictadura de Francisco Franco se convirtió en uno de los resortes y los principales apoyos del poder franquista, y como tal se mantuvo hasta después de su muerte en 1975 y la reinstauración de la democracia durante el periodo de la Transición.\\nTienen sus orígenes en las fuerzas que se sublevaron en 1936 contra el Gobierno republicano, dando comienzo a la Guerra Civil que duraría casi 3 años."},{"page_url":"https://no.wikipedia.org/wiki/Lizabeth_Scott","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Lizabeth_Scott-publicity.JPG","page_title":"Lizabeth Scott","context_page_description":"Lizabeth Scott var en amerikansk sanger og skuespiller.\\nLisbeth Scott studerte til å bli skuespiller ved Alvienne School of Drama. Hennes skuespiller-debut i en film var i You came Along fra 1945 der hun spilte mot Robert Cummings. Scott spilte også i Desert Fury og mot Kirk Douglas i Natt over New York og i 1949 spilte hun i filmen For sent for tårer. I 1972 hadde hun sin siste filmopptreden, i Skyt ikke på skribenten, sammen med stjerner som Michael Caine og Mickey Rooney. Etter det har hun i stor grad holdt seg unna offentlighetens søkelys, og hun har takket nei til mange forespørsler om intervju og TV-opptredener. I 2001 sto Scott oppført som en av kjendisene som skulle komme til Michael Jackson sitt 30-årsjubileum som vist i USA på TV-kanalen CBS. Lizabeth Scott ble tildelt en stjerne på Hollywood Walk of Fame for hennes mange bidrag til den amerikanske filmindustrien. Stjernen ligger ved 1624 Vine Street i Hollywood."},{"page_url":"https://de.wikipedia.org/wiki/Saint-Antoine-du-Rocher","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Saint-Antoine-du-Rocher_02.JPG","page_title":"Saint-Antoine-du-Rocher","context_page_description":"Saint-Antoine-du-Rocher ist eine französische Gemeinde mit 1720 Einwohnern im Département Indre-et-Loire in der Region Centre-Val de Loire; sie gehört zum Arrondissement Chinon und zum Kanton Château-Renault. Die Einwohner werden Rocantoniens genannt."},{"page_url":"https://it.wikipedia.org/wiki/Classe_Neftegaz","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Buque_ARA_Islas_Malvinas_en_Comodoro_Rivadavia.jpg","page_title":"Classe Neftegaz","context_page_description":"Le unità classe Neftegaz sono rimorchiatori di grandi dimensioni di costruzione polacca.\\nQueste navi sono ampiamente utilizzate in Russia, sia in ambito civile, sia militare."},{"page_url":"https://el.wikipedia.org/wiki/Volvo_S90","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Volvo_S90_%2813914268555%29.jpg","page_title":"Volvo S90","context_page_description":"Το Volvo S90 είναι ένα μεσαίο πολυτελές σεντάν αυτοκίνητο της κατηγορίας Ε, που κατασκευάζεται από τη σουηδική αυτοκινητοβιομηχανία Volvo, από τον Ιούνιο του 2016. Το S90 αποκαλύφθηκε για πρώτη φορά στο Σαλόνι Αυτοκινήτου του Ντιτρόιτ στις 11 Ιανουαρίου 2016, ενώ στις 1 Μαρτίου 2016, στο Σαλόνι Αυτοκινήτου της Γενεύης, παρουσιάστηκε και η έκδοση στέισον βάγκον του S90, ως Volvo V90. Και οι δύο αυτές εκδόσεις λανσαρίστηκαν τον Ιούνιο, τον ίδιο μήνα με την έναρξη της μαζικής παραγωγής τους. Το S90 αντικατέστησε το Volvo S80 δεύτερης γενιάς στον ρόλο του κορυφαίου σεντάν της εταιρείας, έχοντας όμως κερδίσει αρκετά σε διαστάσεις από τον προκάτοχό του, ενώ ειδικότερα το V90 αντικατέστησε την τρίτη γενιά του Volvo V70, που ήταν ουσιαστικά η station wagon εκδοχή του S80 δεύτερης γενιάς.\\nΠαρά την ήδη σημαντική αύξηση του συνολικού μήκους στο S90, από τον Δεκέμβριο του 2016 διατίθεται και μια εκδοχή με μακρύτερο μεταξόνιο, που είναι γνωστή ως Volvo S90L και έχει μήκος άνω των 5 μέτρων, στα 5.083 χιλιοστά, με αποτέλεσμα να θεωρείται επίσημα ως μεγάλο πολυτελές σεντάν της κατηγορίας F."},{"page_url":"https://pl.wikipedia.org/wiki/Wojciech_Bartos_G%C5%82owacki","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Bitwa_pod_Raclawicami.jpg","page_title":"Wojciech Bartos Głowacki","context_page_description":"Wojciech Bartos, od 1794 z nazwiskiem Głowacki – polski chłop, kosynier w czasie insurekcji kościuszkowskiej, chorąży grenadierów krakowskich.\\nWziął udział w insurekcji kościuszkowskiej, w bitwie pod Racławicami 4 kwietnia 1794 odznaczył się wielkim męstwem, za co został mianowany chorążym; otrzymał także nazwisko Głowacki. Został śmiertelnie ranny podczas bitwy pod Szczekocinami 9 czerwca 1794, zmarł i został pochowany w Kielcach. Po klęsce powstania stał się symbolem waleczności i męstwa."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Amerongen","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Amerongen_-_t_Klooster_Burg_vd_Boschstraat_24_RM7725.JPG","page_title":"Lijst van rijksmonumenten in Amerongen","context_page_description":"De plaats Amerongen telt 144 inschrijvingen in het rijksmonumentenregister. Hieronder een overzicht."},{"page_url":"https://pt.wikipedia.org/wiki/Luciano_Manara","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8f/Manara.jpg","page_title":"Luciano Manara","context_page_description":"Luciano Manara foi um militar e político italiano que lutou durante o Risorgimento.\\nAmigo de Carlo Cattaneo, participou nos Cinco Dias de Milão, liderando, entre outras coisas, a operação que levou à tomada da Porta Tosa. Depois tomou parte na Primeira Guerra de Independência Italiana, tendo organizado um grupo de 500 voluntários. Com o retorno dos austríacos, exilou-se em Piemonte, onde foi nomeado chefe do corpo de bersaglieri, com os quais lutou no Pó e em La Cava.\\nEm 29 de abril, desembarcou no porto de Anzio junto com 600 homens do batalhão lombardo Bersaglieri, por ele comandado. Lutou na defesa da República Romana de 1849, além de ter sido chefe do Estado-Maior de Giuseppe Garibaldi. Morreu na batalha de Villa Spada em 30 de junho. Seu funeral foi feito na igreja de San Lorenzo in Lucina."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D1%8E%D0%B1%D0%B5%D1%88%D1%96%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Liubeshiv_Volynska-Polish_cemetery-central_monument-2.jpg","page_title":"Любешів","context_page_description":"Любеші́в — невелике містечко на північному сході Волинської області у Камінь-Каширському районі, колишній адміністративний центр Любешівського району, розташоване на лівому березі річки Стохід. За історико-етнографічними ознаками та за своїм географічним розташуванням Любешів належить до Українського Полісся. Населення — 7832 осіб. Відстань до обласного центру, м. Луцьк, становить 137 км. Найближчі залізничні станції розташовані у м. Маневичі та м. Камінь-Каширський, за 50-60 км від Любешева. Через Любешів проходить Р14, яким можна дістатися до міжнародного автомобільного пункту пропуску «Дольськ» на кордоні з Білоруссю.\\nАбсолютний максимум температури повітря для Любешева +36,9 градуса, абсолютний мінімум −37.2 градуса. Добовий максимум опадів — 119 мм."},{"page_url":"https://en.wikipedia.org/wiki/Benz_Patent-Motorwagen","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Patent-Motorwagen_Nr.1_Benz_2.jpg","page_title":"Benz Patent-Motorwagen","context_page_description":"The Benz Patent-Motorwagen, built in 1885, is widely regarded as the world's first production automobile, that is, a vehicle designed to be propelled by an internal combustion engine. The original cost of the vehicle in 1885 was 600 imperial German marks, approximately 150 US dollars.\\nThe vehicle was awarded the German patent number 37435, for which Karl Benz applied on 29 January 1886. Following official procedures, the date of the application became the patent date for the invention once the patent was granted, which occurred in November of that year.\\nBenz's wife, Bertha, financed the development process.\\nBenz unveiled his invention to the public on 3 July 1886, on the Ringstrasse in Mannheim.\\nAbout 25 Patent-Motorwagen were built between 1886 and 1893."},{"page_url":"https://fr.wikipedia.org/wiki/Citrange","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Pomological_Watercolor_POM00006386.jpg","page_title":"Citrange","context_page_description":"Le Citrange, ×Citroncirus webberi, est une espèce hybride de l'oranger et du citronnier épineux. Ce croisement était une tentative pour créer un citronnier/oranger vigoureux, résistant au froid et donnant des fruits délicieux. Cependant la plupart des citranges sont amers."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Ronnenberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Ronnenberg-Ueber_den_Beeken_13.JPG","page_title":"Liste der Baudenkmale in Ronnenberg","context_page_description":"Die Liste der Baudenkmale in Ronnenberg enthält alle Baudenkmale Ronnenbergs und deren Ortsteile Benthe, Empelde, Ihme-Roloven, Linderte, Vörie und Weetzen. Stand der Liste ist das Jahr 1988."},{"page_url":"https://en.wikipedia.org/wiki/Humaithara","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Humaithara_on_urus.jpg","page_title":"Humaithara","context_page_description":"Abu Al Hassan El-Shazly or Sheikh Shazlyas called now or the original name Humaithara or Sheikh Shazily is an isolated town in the Egyptian desert located in the Red Sea Governorate in Egypt. The town is surrounded by hills. The Holy Shrine of Imām Nūr al-Dīn Abū al-Ḥasan ʻAlī al-Shādhilī is located here."},{"page_url":"https://id.wikipedia.org/wiki/NGC_67","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/NGC_0067_2MASS.jpg","page_title":"NGC 67","context_page_description":"NGC 67 adalah sebuah galaksi elips yang terletak di konstelasi Andromeda yang ditemukan pada 7 oktober 1855 oleh R. J. Mitchell. Ia menggambarkan galaksi ini \\"sangat lemah, sangat kecil, bulat\\". Galaksi ini masuk dalam Grup NGC 68, yang juga berisi galaksi NGC 68, NGC 69, NGC 70, NGC 71, NGC 72, dan mungkin NGC 74."},{"page_url":"https://la.wikipedia.org/wiki/Villa_de_Plano_Carpini","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Magione.jpg","page_title":"Villa de Plano Carpini","context_page_description":"Villa de Plano Carpini est oppidum Italiae et municipium circiter 13 800 incolarum, in Regione Umbria ac in Provincia Perusina situm. Incolae Planocarpinenses vel Mansionenses appellantur."},{"page_url":"https://sv.wikipedia.org/wiki/Friedrich_Weyerh%C3%A4user","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/04/CAB_1918_Weyerhaeuser_Frederick.jpg","page_title":"Friedrich Weyerhäuser","context_page_description":"Friedrich Weyerhäuser, född 21 november 1834 i Nieder-Saulheim, Rheinhessen, död 4 april 1914 i Pasadena, Kalifornien, var en tysk-amerikansk trävarumogul som grundade trävarufirman Weyerhaeuser Company.\\nHan kom till Förenta staterna år 1852 och förvärvade stora skogsområden i Minnesota lockad av Amerikabrev som hans släktingar sänt efter sin flykt från Tyskland i samband med revolutionen 1848. Så småningom förärades han med tillnamnet \\"Lumber King\\", \\"timmerkungen\\" tack vare sina framgångar. Sågverk och pappersverk samt andra affärsrörelser grundades av honom. På sin tid räknades han som den åttonde rikaste amerikanen.\\nHan begravdes i familjegraven i Chippiannock cemetery i Rock Island i Illinois."},{"page_url":"https://fr.wikipedia.org/wiki/Sites_historiques_et_culturels_majeurs_prot%C3%A9g%C3%A9s_au_niveau_national_(Mongolie_int%C3%A9rieure)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Khara-khoto.jpg","page_title":"Sites historiques et culturels majeurs protégés au niveau national (Mongolie intérieure)","context_page_description":"Cette liste regroupe les principaux sites historiques et culturels majeurs protégés au niveau national par l'administration d'état chargée du patrimoine culturel en Chine pour la région autonome de Mongolie-Intérieure. Actuellement, elle ne reprend que les cinq premières listes. Une sixième et une septième liste ont été publiées en 2006 et en 2013 avec de nombreux sites supplémentaires."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_prot%C3%A9g%C3%A9s_en_1954","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/20_rue_Jacques-d%27Uzes_in_Uzes.jpg","page_title":"Liste des monuments historiques protégés en 1954","context_page_description":"Cet article recense les monuments historiques français classés en 1954."},{"page_url":"https://es.wikipedia.org/wiki/Jaume_Cirera","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Jaume_Cirera_-_Altarpiece_of_Saint_Michael_and_Saint_Peter_-_Google_Art_Project.jpg","page_title":"Jaume Cirera","context_page_description":"Jaume Cirera, fue un pintor gótico catalán, discípulo y colaborador de Jaume Cabrera. Durante el segundo cuarto del siglo XV estuvo asociado con Bernat Despuig y trabajaron juntos.\\nSu obra Lucha entre ángeles y demonios se encuentra expuesta actualmente en el Museo Nacional de Arte de Cataluña."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%84%E0%B8%B2%E0%B9%82%E0%B8%A3%E0%B8%A5%E0%B8%B5%E0%B9%80%E0%B8%99%E0%B8%AD_%E0%B9%84%E0%B8%9A%E0%B8%A5%E0%B9%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/2012-05-31_Studio_Hamburg_Nachwuchspreis_DSCF0643.jpg","page_title":"คาโรลีเนอ ไบล์","context_page_description":"คาโรลีเนอ ไบล์ เกิดที่ฮัมบวร์ค เป็นนักแสดงและพิธีกรโทรทัศน์หญิงชาวเยอรมัน ผลงานที่ทำให้คาโรลีเนอเป็นที่นิยม คือ Storm of Love"},{"page_url":"https://es.wikipedia.org/wiki/Pitta_sordida","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Hoodedpitta3.jpg","page_title":"Pitta sordida","context_page_description":"La pita encapuchada es una especie de ave paseriforme de la familia Pittidae distribuida por la región indomalaya desde el sur de China y la India hasta Filipinas y las islas de la Sonda, la Wallacea y Nueva Guinea."},{"page_url":"https://en.wikipedia.org/wiki/Rank_insignia_of_the_Austro-Hungarian_armed_forces","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/af/K.u.k._Gardekorporal.png","page_title":"Rank insignia of the Austro-Hungarian armed forces","context_page_description":"In Austrian armed forces rank insignia are traditionally called Paroli\\nand are worn as gorget patch or collar tap, appliquéd to the gorget fore-part of the uniform coat, uniform jacket and/or battle-dress."},{"page_url":"https://fr.wikipedia.org/wiki/Ouj%C3%A9-Bougoumou","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Oujesign.jpg","page_title":"Oujé-Bougoumou","context_page_description":"Oujé-Bougoumou est une terre réservée crie du Nord-du-Québec au Canada. En 2011, la nation crie d'Oujé-Bougoumou est devenue la dernière Première Nation à être reconnue par le ministère des Affaires autochtones et du Nord du Canada."},{"page_url":"https://de.wikipedia.org/wiki/Niendorfer_Hafen","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/2013-07_01_Niendorfer_Hafen_Onkel_Charly.JPG","page_title":"Niendorfer Hafen","context_page_description":"Der Niendorfer Hafen liegt im Ortsteil Niendorf der Gemeinde Timmendorfer Strand. Er befindet sich an der Mündung der Aalbek in der Lübecker Bucht der Ostsee."},{"page_url":"https://id.wikipedia.org/wiki/Portugal","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Torre_Bel%C3%A9m_April_2009-4a.jpg","page_title":"Portugal","context_page_description":"Republik Portugal merupakan sebuah negara bagian Eropa di wilayah barat daya. Negara ini berbatasan dengan Spanyol di sebelah utara dan sebelah timur, sedangkan di sebelah barat berbatasan dengan Samudra Atlantik. Selain itu, Portugal juga mempunyai daerah di Madeira, Azores dan Kepulauan Selvagens. Portugal mengklaim sebuah daerah kecil bernama \\"Olivença\\" yang dikuasai Spanyol sejak Kongres Wina. Nama lama atau latin dari negara ini adalah Lusitania.\\nKata Portugis sering dipakai untuk menyebutkan penduduk atau orang yang berasal dari Portugal. Kata ini juga sebutan untuk bahasa yang dipakai oleh bangsa ini. Negara-negara berbahasa Portugis sering disebut sebagai negara-negara Lusophone.\\nPortugal juga termasuk sebagai negara maju dan termasuk kedalam anggota negara Uni Eropa, bergabung pada tahun 1986.\\nSelama abad kelima belas, dan keenam belas, Portugis adalah pelopor dalam hal eksplorasi lepas pantai, mendirikan kerajaan kolonial pertama dari lingkup global, dengan harta benda di Afrika, Asia, dan Amerika Selatan, menjadi kekuatan dunia ekonomi, politik, dan militer."},{"page_url":"https://lt.wikipedia.org/wiki/Dr%C4%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Dreux_village_St_Pierre.jpg","page_title":"Drė","context_page_description":"Drė – miestas šiaurės vakarų Prancūzijoje, Ero ir Luaro departamente."},{"page_url":"https://eo.wikipedia.org/wiki/Herbertingen","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/14/Karte_Herbertingen.png","page_title":"Herbertingen","context_page_description":"Herbertingen estas komunumo en Germanio. Ĝi troviĝas en la distrikto Sigmaringen kaj en la distriktaro Tübingen de la federacia lando Baden-Virtembergo. Fine de decembro 2017 la komunumo havis 4 784 loĝantojn. En la komunumoparto Heuneburg oni trovis frukeltan urbon simile al fruekelta urbo de Vix."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E8%88%AA%E7%A9%BA%E6%AF%8D%E8%89%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/USS_Enterprise_%28CVAN-65%29%2C_USS_Long_Beach_%28CGN-9%29_and_USS_Bainbridge_%28DLGN-25%29_underway_in_the_Mediterranean_Sea_during_Operation_Sea_Orbit%2C_in_1964.jpg","page_title":"航空母艦","context_page_description":"航空母艦（簡稱航母、航艦）係一種以搭載艦載機為主要武器嘅軍艦，艦體通常擁有供固定翼飛機起降使用嘅巨大甲板同座落於左右其中一側嘅島式艦橋（一般稱為「艦島」）。航艦係航空母艦戰鬥群嘅核心，艦隊中嘅其它船隻提供其保護同供給畀，而航母則提供空中支援同遠程打擊能力。航空母艦係目前最大嘅武器系統平台，發展至今已係現代藍水海軍唔可或缺嘅武器，亦係海戰最重要嘅作戰艦艇之一。\\n航空母艦起源於第一次世界大戰期間飛機作戰能力實用化後嘅影響，喺各國航空技術進步、進而使陸基飛機有能力攻擊地面目標嘅同時，海軍亦用飛機來進行偵查與攻擊敵軍偵察機，因此出現咗專門供水上飛機整備與其它雙翼機起飛嘅水上飛機母艦。一戰後，各大海軍強國主要仍維持著崇尚排水量大、裝載大口徑艦砲軍艦嘅大艦巨砲主義，但即使如此仲係有唔少軍事理論家提倡將飛機用於攻擊軍艦嘅作法，因此研製出多種形式嘅航空母艦、奠定未來海空兵力嘅發展。 第二次世界大戰爆發後，航艦嘅重要性日益浮現，而喺珍珠港事件以及馬來亞海戰嘅結果中顯示，大型軍艦喺飛機嘅空中攻擊下十分脆弱，大艦巨砲主義亦因此走向終結，到咗戰爭後期仲出現瞭如雷伊泰灣海戰此類嘅航艦大戰。\\n二戰結束後，航空母艦嘅地位一度因為核武器嘅出現而產生爭議與討論，特別係喺受到核子武器攻擊下嘅生存能力，但到咗韓戰後又恢復咗其重要性，世界形成以美國為首嘅航艦武力對抗蘇聯水面艦艇部隊嘅格局，航空母艦更係參與咗世界各地嘅局部衝突與代理戰爭。冷戰結束後，世界各國軍備緊縮，目前僅美國、俄羅斯、英國、法國、印度、巴西、義大利、西班牙、中國、泰國擁有或計畫建造航空母艦，由於其造價與維護費用巨大，擁有航空母艦亦係顯示國力強大嘅表現，喺呢方面美國海軍即擁有世界上冚唪唥已服役航艦總數嘅一半，排水量則佔咗超過80％，其相關科技亦係世界領先。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Vohenstrau%C3%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/AltenstadtWappentafel.JPG","page_title":"Liste der Baudenkmäler in Vohenstrauß","context_page_description":"Auf dieser Seite sind die Baudenkmäler der Oberpfälzer Stadt Vohenstrauß zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%81%D0%BE%D0%B1%D0%BE%D1%80%D1%96%D0%B2_%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Kolomyia_Transfiguration_Cathedral.jpg","page_title":"Список соборів України","context_page_description":"Це список соборів України — кафедральних храмів.\\nУ православ'ї також собором називається церква, де ця кафедра коли-небудь була, а також головна церква монастиря.\\n№\\nНайменування\\nСвітлина\\nДатування\\nРозташування\\nКороткі відомості"},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B4%D5%BE%D5%AB%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Dvin_2014_pic_32.JPG","page_title":"Դվին","context_page_description":"Անվան այլ կիրառումների համար տե՛ս՝ Դվին\\nԴվին, Հայաստանի պատմական մայրաքաղաքներից մեկը։ Հիմնադրվել է 4-րդ դարի առաջին կեսին։ Գտնվում է Այրարատ նահանգի Հայոց Ոստան գավառում ։ Ըստ պատմահայր Մովսես Խորենացու՝ «դվին» բառը պարսկերեն ծագում ունի և նշանակում է բլուր։ Փավստոս Բյուզանդի կարծիքով Դվինը բլուրի անվանումն է։\\nՄիջնադարյան Հայաստանի Դվին մայրաքաղաքի ավերակները գտնվում են Վերին Դվին, Հնաբերդ, Վերին Արտաշատ, Նորաշեն, Այգեստան գյուղերի տարածքներում, Երևանից մոտ 30 կմ հարավ։ Ընդգրկված է Հնաբերդի պատմության և մշակույթի անշարժ հուշարձանների ցանկում:"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Northeim_(Au%C3%9Fenbezirke)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Sudheim_Pfarrhaus_Denkmal.jpg","page_title":"Liste der Baudenkmale in Northeim (Außenbezirke)","context_page_description":"In der Liste der Baudenkmale in Northeim (Außenbezirke) sind denkmalgeschützte Bauten der Außenbezirke der niedersächsischen Stadt Northeim aufgelistet. Stand der Liste ist das Jahr 1997."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B5%B7%E9%81%8B%E5%A4%A7%E5%BB%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Ocean_Terminal_Carpark.jpg","page_title":"海運大廈","context_page_description":"海運大廈位於香港九龍尖沙咀海港城，是香港其中一個郵輪碼頭所在地。碼頭的客運樓名爲「海運大廈」，由九倉發展，於1966年3月22日開幕，是當時全亞洲第一個購物商場。\\n除碼頭外，還包括10,000平方呎的寫字樓，以及648,000平方呎的商場。而海港城的商場部份則是全香港面積最大購物中心。\\n為防止COVID-19傳播，特區政府於2020年2月5日宣布海運大廈郵輪碼頭與啟德郵輪碼頭暫時關閉，直至另行通知。"},{"page_url":"https://ca.wikipedia.org/wiki/Senat_de_Romania","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Romania-1170_-_Palace_of_the_Parliament_%287557749966%29.jpg","page_title":"Senat de Romania","context_page_description":"El Senat de Romania és la cambra alta del Parlament bicameral de Romania. Té 134 escons i els seus membres són elegits per sufragi universal directe amb un mandat de quatre anys."},{"page_url":"https://eu.wikipedia.org/wiki/Sumer","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Basse_Mesopotamie_DA.PNG","page_title":"Sumer","context_page_description":"Sumer antzinako Mesopotamiaren parte zen eskualdea da, Eufrates eta Tigris ibaien arteko lurralde oparoan.\\nSumertarrak munduko lehen zibilizaziotzat hartuak dira. Haien jatorria ezezaguna da eta hipotesi ugari dago. Hipotesi zabalduenen arabera, bertako gizataldeen eta Iran zein Indiakoen arteko nahasketaren ondorio dira sumertarrak.\\nSumertarrek euren lurraldeari Kengi zeritzoten. Termino honen akadierazko forma mat Sumeri da, hots, Sumerren lurraldea."},{"page_url":"https://zh.wikipedia.org/wiki/Beonex_Communicator","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Beonex.6-book-of-mozilla.png","page_title":"Beonex Communicator","context_page_description":"Beonex Communicator是由德国Mozilla开发者Ben Bucksch基于Mozilla Application Suite所开发的开放源代码网络包。目的旨在提供比其他商业产品具有更高的安全性和隐私性。该网络包包含网页浏览器、电子邮件、新闻客户端、HTML编辑器和IRC客户端。"},{"page_url":"https://ko.wikipedia.org/wiki/%EC%84%B8%EB%A0%88%EC%8A%A4_(%EC%99%9C%ED%96%89%EC%84%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/PIA20397-Ceres-DwarfPlanet-Dawn-4thMapOrbit-LAMO-image43-20160125.jpg","page_title":"세레스 (왜행성)","context_page_description":"세레스는 소행성대에 있는 왜행성으로, 공식 명칭인 소행성명은 1 세레스이다. 현재 태양계의 소행성대에 존재하는 유일한 왜행성이다. 1801년 1월 1일 이탈리아의 천문학자 주세페 피아치가 발견하여, 그 후 반세기 동안 행성에 속했었다. 세레스라는 이름은 로마 신화의 농업과 곡물의 여신인 케레스에서 따왔다.\\n지름은 970 km 로, 소행성대에서 가장 크고 무거운 천체이다.\\n다른 소행성은 불규칙한 모형, 약한 중력임에 반해 세레스는 관측을 통해 구형임이 밝혀졌다.\\n표면은 물얼음과 다양한 수화물이 혼합되어 있는 것으로 추정된다.\\n세레스의 내부는 암석질의 핵 그리고 얼음 맨틀으로 구성되어 있으며, 표면 아래에는 물로 이루어진 바다가 존재하는 것으로 생각된다.\\n세레스의 겉보기등급은 +6.7 ~ +9.3 등급으로, 육안으로는 볼 수가 없다.\\n2007년 9월 27일, NASA에서는 4 베스타, 세레스 를 탐사하기 위하여 돈 탐사선을 발사했다."},{"page_url":"https://pl.wikipedia.org/wiki/Uri_Orlew","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/UriOrlev7856.JPG","page_title":"Uri Orlew","context_page_description":"Uri Orlew, właściwie Jerzy Henryk Orłowski – izraelski prozaik, autor książek dla dzieci i tłumacz polsko-żydowskiego pochodzenia."},{"page_url":"https://nl.wikipedia.org/wiki/Slag_om_Korsun","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Bundesarchiv_Bild_101I-711-0438-05A%2C_Russland-S%C3%BCd%2C_Marsch_auf_unbefestigter_Stra%C3%9Fe.jpg","page_title":"Slag om Korsun","context_page_description":"De Slag om Korsun-Tsjerkasy vond plaats van 24 januari tot 16 februari 1944 aan het oostfront van de Tweede Wereldoorlog. De veldslag maakte deel uit van het Sovjet Dnjeproffensief. Het 1e en 2e Oekraïense Front, onder leiding van respectievelijk Nikolaj Vatoetin en Ivan Konev, wisten Duitse troepen van Legergroep Zuid te omsingelen in een gebied nabij de rivier Dnjepr. In de weken daarna probeerden de twee fronten de omsingelde Duitse troepen te vernietigen. De Duitsers probeerden tegelijkertijd uit te breken, wat gecombineerd werd met een ontzetting van buitenaf. Dit leidde tot zware verliezen.\\nDe overwinning van de Sovjets in deze veldslag was een succesvolle toepassing van de diepe operatiedoctrine. Volgens deze doctrine moest een doorbraak van de vijandelijke linies gevolgd worden door de inzet van reservetroepen, die moesten doorstoten naar het strategische achterland van de vijand. De levering van grote hoeveelheden Amerikaanse en Britse vrachtwagens en halfrupsvoertuigen gaven de Sovjettroepen meer mobiliteit dan zij daarvoor hadden."},{"page_url":"https://pl.wikipedia.org/wiki/Sandra_Nasi%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Sandra_Nasic.jpg","page_title":"Sandra Nasić","context_page_description":"Sandra Nasić – niemiecka wokalistka, autorka tekstów i piosenek. Sandra Nasić znana jest przede wszystkim z występów w zespole muzyki rockowej Guano Apes, którego jest członkinią od 1994 roku. W 2007 roku ukazał się jej debiutancki album solowy zatytułowany The Signal. Nasić gościła ponadto na płytach Apocalyptiki i DJ-a Tomkka."},{"page_url":"https://it.wikipedia.org/wiki/Impero","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/RomanEmpire_117.svg","page_title":"Impero","context_page_description":"Un impero è convenzionalmente un'entità statale costituita da un esteso insieme di territori e di popoli diversi, a volte anche molto lontani, sottoposti ad un'unica autorità, normalmente rappresentata dalla persona fisica dell'imperatore. Quando invece il popolo, la lingua, l'origine è compatta e coesa, si parla non di Impero ma piuttosto di Regno.\\nPur essendo indicate come impero strutture statali anche estremamente diverse tra loro, per le sue caratteristiche, un impero presenta quasi sempre spiccate caratteristiche di multiculturalità e multietnicità, accompagnate però da una marcata distinzione tra i territori metropolitani e i territori periferici, normalmente indicati come province oppure come colonie e tra l'etnia dominante e i popoli assoggettati.\\nL'impero è inoltre in genere caratterizzato da un'ideologia imperiale, cioè dell'ideologia fondante dell'architettura del sistema imperiale, spesso connotata di caratteri di egemonismo ed universalità, sulla base della quale si modellano i meccanismi di controllo politico, sociale, religioso ed economico del gruppo dominante sui gruppi dominati."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%B0%D0%B2%D1%82%D0%BE%D0%BC%D0%BE%D0%B1%D0%B8%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%B7%D0%B0%D0%B2%D0%BE%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Minsky_automoblie_plant.png","page_title":"Минский автомобильный завод","context_page_description":"ОАО «Минский автомобильный завод» — управляющая компания холдинга «БЕЛАВТОМАЗ» — советская и белорусская автомобилестроительная компания, специализирующаяся на выпуске большегрузной автомобильной, а также автобусной, троллейбусной и прицепной техники.\\nТорговая марка МАЗ широко известна в СНГ и в дальнем зарубежье. Автомобили МАЗ поставлялись в более чем 45 стран мира. После проблемного периода начала 1990-х годов, сегодня МАЗ смог вернуться на большинство из этих рынков.\\nКак управляющая компания входит в холдинг «БелавтоМАЗ», в составе которого находятся также ОАО «БААЗ», Барановичи, ОАО «ОЗАА», Осиповичи; ОАО «КЗТШ», Жодино; ОАО «ДЭМЗ», Дзержинск; ОАО «Гродненский механический завод»; ОАО «ТАиМ», Бобруйск, и другие. Номенклатура выпускаемой Минским автозаводом продукции превышает 400 моделей, модификаций и комплектаций. В то же время «МАЗ» является кузовосварочным заводом, не производящим какие-либо автозапчасти."},{"page_url":"https://ca.wikipedia.org/wiki/Cetraria","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Cetraria_aculeata_habito.jpg","page_title":"Cetraria","context_page_description":"Cetraria és un gènere de líquens fruticosos associats amb algues verdes com fotobionts. La majoria de les espècies es troben en latituds altes, sobre la sorra o matolls. Les espècies tenen una forma com de corretja, amb vores lobulades espinoses.\\nCetraria islandica, o liquen d'Islàndia és un dels pocs líquens amb usos culinaris i que es collia i es menjava al nord d'Europa en temps de fam.\\nAltres espècies es fan servir a la gastronomia tradicional de l'Índia"},{"page_url":"https://fr.wikipedia.org/wiki/Distillerie_Pierre_Guy_de_Pontarlier","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Distillerie_Armand_Guy_039.JPG","page_title":"Distillerie Pierre Guy de Pontarlier","context_page_description":"La distillerie Pierre Guy de Pontarlier est une distillerie familiale traditionnelle française, fondée en 1890 par Armand Guy à Pontarlier dans le Haut-Doubs en Franche-Comté.\\nElle a pour produits phare l'absinthe, le « Pontarlier-Anis » ou « Pont » et la liqueur de sapin, au sein de sa gamme de 30 produits."},{"page_url":"https://fi.wikipedia.org/wiki/Helsinki","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Tilkka3.jpg","page_title":"Helsinki","context_page_description":"Helsinki on Suomen pääkaupunki ja Uudenmaan maakuntakeskus. Se sijaitsee Suomenlahden pohjoisrannalla Uudenmaan maakunnan keskiosassa. Helsingin naapurikunnat ovat lännessä Espoo, pohjoisessa Vantaa ja idässä Sipoo. Kaupungissa on 655 281 asukasta. Helsingin keskustaajama ulottuu usean naapurikunnan alueelle, kuten Espooseen ja Vantaalle. Laajemmalla Helsingin seudun metropolialueella on 1 572 928 asukasta.\\nHelsinki on Suomen kulttuurillinen, hallinnollinen, poliittinen ja liike-elämän keskus, monen suuren yrityksen kotikaupunki ja maan suurin työnantaja. Kaupunki perustettiin Tallinnan kilpailijaksi Vantaanjoen suulle vuonna 1550 ja siirrettiin nykyiselle paikalleen vuonna 1640. Helsingistä tuli Suomen suuriruhtinaskunnan pääkaupunki vuonna 1812 ja Suomen tasavallan pääkaupunki maan itsenäistyessä vuonna 1917."},{"page_url":"https://en.wikipedia.org/wiki/Flabellinopsis_iodinea","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Spanish_Shawl_nudibranch.jpg","page_title":"Flabellinopsis iodinea","context_page_description":"Flabellinopsis iodinea is a species of aeolid nudibranch, a very colorful sea slug. This is a marine gastropod mollusk in the family Flabellinidae."},{"page_url":"https://sv.wikipedia.org/wiki/Sumter_County,_South_Carolina","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Sumter_courthouse_1369.JPG","page_title":"Sumter County, South Carolina","context_page_description":"Sumter County är ett administrativt område i delstaten South Carolina, USA, med 107 456 invånare. Den administrativa huvudorten är Sumter."},{"page_url":"https://id.wikipedia.org/wiki/Daftar_anggota_Dewan_Perwakilan_Rakyat_Amerika_Serikat","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Tim_Ryan_113th_Congress.jpg","page_title":"Daftar anggota Dewan Perwakilan Rakyat Amerika Serikat","context_page_description":"Berikut adalah daftar anggota Dewan Perwakilan Rakyat Amerika Serikat saat ini."},{"page_url":"https://en.wikipedia.org/wiki/Uday_Shankar","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Uday_Shankar%2C_1930s.jpg","page_title":"Uday Shankar","context_page_description":"Uday Shankar was an Indian dancer and choreographer, best known for creating a fusion style of dance, adapting European theatrical techniques to Indian classical dance, imbued with elements of Indian classical, folk, and tribal dance, which he later popularised in India, Europe, and the United States in 1920s and 1930s. He was a pioneer of modern dance in India.\\nIn 1962, he was awarded by Sangeet Natak Akademi, India's The National Academy for Music, Dance and Drama, with its highest award, the Sangeet Natak Akademi Fellowship for lifetime achievement, and in 1971, the Govt. of India, awarded him its second highest civilian award the Padma Vibhushan."},{"page_url":"https://pt.wikipedia.org/wiki/Farmington_(Washington)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Farmington_wa.jpg","page_title":"Farmington (Washington)","context_page_description":"Farmington é uma cidade localizada no estado norte-americano de Washington, no Condado de Whitman."},{"page_url":"https://de.wikipedia.org/wiki/Platow_(Adelsgeschlecht)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Platen-Wappen_Sm.png","page_title":"Platow (Adelsgeschlecht)","context_page_description":"Platow ist der Name eines märkischen Adelsgeschlechtes, welches um das 15. Jahrhundert in der Mark Brandenburg und im Herzogtum Preußen Besitzungen hatte.\\nDas Geschlecht ist zu unterscheiden von dem alten niedersächsischen Adelsgeschlecht von Plato, das auch ein anderes Wappen führt."},{"page_url":"https://vi.wikipedia.org/wiki/Conciergerie","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Marie_Antoinette_Adult11.jpg","page_title":"Conciergerie","context_page_description":"Conciergerie hay tên cũ là Palais de la Cité là một công trình lịch sử nổi tiếng nằm trên đảo Île de la Cité thuộc sông Seine, Quận 1 thành phố Paris. Đây từng là dinh thự chính thức của vua Pháp từ thế kỷ 10 đến thế kỷ 14 và sau đó là nhà tù quốc gia từ năm 1392. Trong thời gian Cách mạng Pháp, Conciergerie là nơi giam giữ, kết án và tử hình nhiều nhân vật lịch sử nổi tiếng như Marie-Antoinette, Antoine Lavoisier, Maximilien Robespierre. Sau Cách mạng, đây tiếp tục là nơi giam giữ nhiều tù nhân nổi tiếng như Michel Ney, Georges Cadoudal và Louis-Napoléon Bonaparte. Hiện nay phần lớn diện tích của Conciergerie vẫn được tòa án Pháp sử dụng, phần còn lại được mở cửa cho công chúng tham quan, đây là một trong những điểm thu hút khách du lịch hàng đầu của thủ đô Paris."},{"page_url":"https://eu.wikipedia.org/wiki/Etxetxuko_dorreak","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Etxetxu.jpg","page_title":"Etxetxuko dorreak","context_page_description":"Etxetxuko Dorreak Bilboko eraikinik ezagunenetarikoak dira. Bilboko Ametzolako auzoan altxatu zituen Anasagasti eraikuntza enpresak, 1971. urtean. Dorreak nahiko hurbil daude elkarrengandik eta Etxetxuko plazaren aurrez aurre daude.\\nGuztira 21 solairuko altuera dute, eta 75 bat metro. Olite, Gaztañeta Almirantea, Zubiaurre Margolariak eta Trenbidearen etorbidearen artean daude dorreok. Isozaki dorreak eraiki arte, Bilboko eraikin erresidentzialik altuenak izan ziren."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B8%D0%BD%D1%8C%D1%86%D0%B7%D1%8F%D0%BD-%D0%A3%D0%B9%D0%B3%D1%83%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D0%B0%D0%B2%D1%82%D0%BE%D0%BD%D0%BE%D0%BC%D0%BD%D1%8B%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Xinjiang_nationalities_by_prefecture_2000.png","page_title":"Синьцзян-Уйгурский автономный район","context_page_description":"Синьцзя́н-Уйгу́рский автоно́мный райо́н, — регион на северо-западе Китая. Самая большая по площади территориально-административная единица КНР.\\nНаселение — 24 870 000 человек.\\nАдминистративный центр и крупнейший город — Урумчи."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%B0%E7%89%B9%E6%8B%89%E7%BB%B4%E4%BA%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Bidasoa_ibaiaren_ahoa.jpg","page_title":"Hondarribia","context_page_description":"丰特拉维亚，巴斯克语名为翁达里维亚，西班牙巴斯克自治区与法国交界处一小城，属吉普斯夸省管辖。该城人口15700人。"},{"page_url":"https://war.wikipedia.org/wiki/La_Trinit%C3%A9-de-Thouberville","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/70/LaTrinit%C3%A9DeThouberville_%C3%A9glise1.JPG","page_title":"La Trinité-de-Thouberville","context_page_description":"An La Trinité-de-Thouberville amo in usa ka komyun ha departamento han Eure ngan ha rehiyon han Normandie ha nasod han Fransya."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Ludwigshafen-N%C3%B6rdliche_Innenstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Ludwigshafen_Prinzregentenstra%C3%9Fe_48.JPG","page_title":"Liste der Kulturdenkmäler in Ludwigshafen-Nördliche Innenstadt","context_page_description":"In der Liste der Kulturdenkmäler in Ludwigshafen-Nördliche Innenstadt sind alle Kulturdenkmäler des Ortsbezirks Nördliche Innenstadt der rheinland-pfälzischen Stadt Ludwigshafen am Rhein aufgeführt. Grundlage ist die Denkmalliste des Landes Rheinland-Pfalz."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%83%91%E5%B7%9E%E6%9C%BA%E5%9C%BA%E9%AB%98%E9%80%9F%E5%85%AC%E8%B7%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Zhengzhou_Airport_Expressway_in_2006.jpg","page_title":"郑州机场高速公路","context_page_description":"鄭州機場高速公路是連接鄭州市區與新鄭國際機場的快速通道，全長26.4公里。"},{"page_url":"https://es.wikipedia.org/wiki/Ayumu_Nakajima","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Nakajima_Ayumu_from_%22It_Girls-_Anytime_Smokin%27_Cigarette%22_at_Opening_Ceremony_of_the_Tokyo_International_Film_Festival_2017_%2840169264772%29.jpg","page_title":"Ayumu Nakajima","context_page_description":"Ayumu Nakajima es un actor japonés, afiliado a Ten Carat.​"},{"page_url":"https://hu.wikipedia.org/wiki/Egyiptom","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Hurghada_desert_by_Hatem_Moushir_6.JPG","page_title":"Egyiptom","context_page_description":"Egyiptom, hivatalosan Egyiptomi Arab Köztársaság független ország Észak-Afrikában és Délnyugat-Ázsiában. A Sínai-félsziget által Afrika egyetlen transzkontinentális országa, és jelentős hatalom az egész földrészen és a tágabb értelemben vett Közel-Keleten. Az országot nyugatról Líbia, délről Szudán, északról a Földközi-tenger, északkeletről a Gázai övezet és Izrael, keletről pedig a Vörös-tenger határolja. Fővárosa a középkor óta az arab és az iszlám világ központja, Kairó, mely csaknem húszmillió lakosával a világ egyik legnagyobb városa.\\nEgyiptom közel 100 milliós népességével a legnépesebb arab ország, a harmadik legnépesebb Afrikában és a kilencedik Ázsiában. A népesség nagy része a Nílus partján és a Nílus-deltában él, ami az ország területének töredéke, és itt találhatók a termőföldek is. Az ország többi részét túlnyomórészt a gyéren lakott Szahara sivatag borítja.\\nEgyiptom területén már a történelem kezdetén, az i. e. 4. évezredben megszerveződtek különböző államalakulatok, amelyeket i. e. 2995 körül egyesítettek, létrehozva ezzel az egységes Egyiptomi Birodalmat."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%B7%B3%E4%BA%B2%E7%8E%8B%E5%BA%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/706_Group_cilvilians_and_diplomats_taking_refuge_in_the_British_Legation_during_the_seige%2C_1900_%28CHANDLESS_17%29.jpeg","page_title":"淳亲王府","context_page_description":"淳親王府是位於中華人民共和國北京市東城區東長安街14號院內的清朝淳親王允祐及其後人的府第。後來該府及周邊地區在清朝末期被改建為英國駐華使館。"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%9D%91%E5%8F%A3%E6%9D%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/HangHau_Village_rural_committee.JPG","page_title":"坑口村","context_page_description":"坑口村是香港新界將軍澳的一條鄉村，位於西貢區將軍澳坑口鴨仔山旁的寓安里。"},{"page_url":"https://en.wikipedia.org/wiki/Worth_County_Library_System","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Margaret_Jones_Public_Library.JPG","page_title":"Worth County Library System","context_page_description":"The Worth County Library System is a public library system serving the county of Worth, Georgia. There is one branch in the system, the Sylvester-Margaret Jones Library located in Sylvester, Georgia. In 2016 the library archived the entire collection of the Sylvester Local News and made it available online for public access.\\nWorth County Library is a member of PINES, a program of the Georgia Public Library Service that covers 53 library systems in 143 counties of Georgia. Any resident in a PINES supported library system has access to the system's collection of 10.6 million books. The library is also serviced by GALILEO, a program of the University System of Georgia which stands for \\"GeorgiA LIbrary LEarning Online\\". This program offers residents in supported libraries access to over 100 databases indexing thousands of periodicals and scholarly journals. It also boasts over 10,000 journal titles in full text."},{"page_url":"https://sv.wikipedia.org/wiki/Durian","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Tempoyak.jpg","page_title":"Durian","context_page_description":"Durio är ett släkte fruktbärande träd inom familjen malvaväxter, men det råder diskussioner kring dess taxonomi. De olika ätbara frukterna i släktet kallas allmänt för durian. Frukterna är mycket använda och uppskattade i Sydostasien, och kallas där \\"frukternas konung\\". Frukterna utmärker sig för sin storlek, unika doft och sina tjocka skal som skyddas av taggar. Frukten kan bli upp till 30 centimeter i diameter och väger vanligtvis ett till tre kg. Dess form kan vara allt från avlång till rund, färgen på skalet grön till brun och köttet blekgult till rött, beroende på art.\\nSläktet förekommer naturligt i Brunei, Indonesien och Malaysia, och dess frukter har varit kända i västvärlden i ungefär 600 år. Det finns 30 kända arter i släktet, av vilka åtminstone nio producerar ätbara frukter och av dessa finns det hundratals olika sorter. Fruktköttet avsöndrar en speciell doft som är stark och genomträngande, även när skalet är helt. En del anser att fruktköttet är väldoftande, medan andra finner aromen överväldigande och obehaglig. Doften har lett till att frukten har bannlysts från vissa hotell och från kollektivtrafik i Sydostasien."},{"page_url":"https://fr.wikipedia.org/wiki/Hallebarde","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Wiki_Loves_Art_-_Bruxelles_-_Porte_de_Hal_-_Hallebarde_de_guerre_%28Q26299517%29.jpg","page_title":"Hallebarde","context_page_description":"La hallebarde est une arme d'hast polyvalente comportant, au bout d'une hampe en bois, une pointe de lance, un fer de hache et un bec de corbin. Sa hampe est généralement de section octogonale ou carrée, renforcée d'atèles métalliques permettant au combattant d'arrêter un coup de taille. Enfin à l'autre extrémité se trouvait un talon métallique permettant un usage comme arme contondante. Arme de combat rapproché pour le fantassin professionnel et autres hommes d'armes, la hallebarde servait à combattre l'infanterie comme la cavalerie adverse. Elle est conçue afin d'être plus courte et plus maniable que d'autres armes d'hast comme la pique.\\nElle dérive directement du vouge, dont on a dissocié la pointe de lance du fer de hache. Ce dernier se voit équilibré par l'ajout du bec de corbin du côté opposé. Elle fut largement utilisée dans les armées d'Europe durant le Moyen Âge tardif et la Renaissance avant d'être remplacée, comme la pique, par le fusil à baïonnette à la fin du XVIIIᵉ siècle.\\nLes soldats maniant cette arme sont des hallebardiers."},{"page_url":"https://sk.wikipedia.org/wiki/Kingston_upon_Hull","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Hull_Guildhall.jpg","page_title":"Kingston upon Hull","context_page_description":"Kingston upon Hull, často len skrátene Hull, je mesto a samostatná správna jednotka v Anglicku, v grófstve Yorkshire. Rozprestiera sa na severnej strane rieky Humber, neďaleko východného pobrežia asi 40 km od Severného mora. V priebehu 700 rokov svojej existencie bol Kingston trhovým mestom, rybárskym i vojenským prístavom a obchodno-priemyselným centrom."},{"page_url":"https://ca.wikipedia.org/wiki/Energia_El%C3%A8ctrica_de_Catalunya","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Central_EEC_Sant_Adri%C3%A0.jpg","page_title":"Energia Elèctrica de Catalunya","context_page_description":"Energia Elèctrica de Catalunya, S.A. fou una companyia fundada a Barcelona l'any 1911 dedicada a la producció i comercialització d’energia elèctrica que va tenir un paper de gran importància en l’electrificació de Catalunya. Entre les seves construccions més emblemàtiques figuren la pionera Central hidroelèctrica de Capdella i la Central tèrmica de Sant Adrià de Besòs. Energia Elèctrica de Catalunya es constituí per l'empenta d'Emili Riu i Periquet que veié l'oportunitat de mercat i buscà les concessions hidroelèctriques i el capital necessari per emprendre l'empresa. Si bé inicialment competí amb Riegos y Fuerzas del Ebro, la major capacitat financera d'aquesta li permeté el 1913 adquirir el 49% del capital d'Energia Elèctrica de Catalunya i n'acabà comprant la totalitat el 1923, integrant-la al grup de la Barcelona Traction, Light and Power. El 1925 les activitats d'Energia Elèctrica de Catalunya es van integrar totalment a La Canadenca."},{"page_url":"https://en.wikipedia.org/wiki/Jones%E2%80%93Pestle_Farmstead","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/WaitsfieldVT_JonesPestleFarmstead1.jpg","page_title":"Jones–Pestle Farmstead","context_page_description":"The Jones–Pestle Farmstead is a historic farm property at 339 Bridge Street in Waitsfield, Vermont. First developed in the 1820s, it is a well-preserved 19th-century disconnected farm complex. It was listed on the National Register of Historic Places in 2015."},{"page_url":"https://de.wikipedia.org/wiki/Te%C5%A1anj","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Te%C5%A1anj_-_Tour_de_l%27horloge_1.JPG","page_title":"Tešanj","context_page_description":"Tešanj ist eine Kleinstadt im Norden von Bosnien und Herzegowina. Sie ist Hauptort und Verwaltungssitz der gleichnamigen Gemeinde im Kanton Zenica-Doboj der Föderation Bosnien und Herzegowina."},{"page_url":"https://vi.wikipedia.org/wiki/T%E1%BB%95ng_th%E1%BB%91ng_Chile","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Jorge_Montt_Alvarez%283%29.jpg","page_title":"Tổng thống Chile","context_page_description":"Tổng thống Chile là người đứng đầu nhà nước và đứng đầu chính phủ của Cộng hòa Chile. Tổng thống là người chịu trách nhiệm hành chính của nhà nước và chính phủ. Mặc dù vai trò và chức danh của vị trí này có những thay đổi trong lịch sử Chile, cũng như vị thế và liên hệ chính trị với các đảng phái ở Chile, tổng thống được coi là hình ảnh chính trị nổi bật nhất của đất nước này. Nó cũng được coi là một trong những thể chế của \\"Lịch sử hiến pháp Chile\\", và là yếu tố chính cho sự ổn định chính trị.\\nTheo hiến pháp hiện tại của Chile, Tổng thống có nhiệm kỳ 4 năm và không được tham gia tranh cử lần tiếp theo. Thời gian quản lý ngắn cho phép quá trình bầu cử Quốc hội và Tổng thống diễn ra được đồng thời.\\nPhủ Tổng thống Chile là cung La Moneda ở thủ đô Santiago."},{"page_url":"https://en.wikipedia.org/wiki/Rural_Municipality_of_Hazel_Dell_No._335","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/SK_RM_335_Hazel_Dell.svg","page_title":"Rural Municipality of Hazel Dell No. 335","context_page_description":"The Rural Municipality of Hazel Dell No. 335 is a rural municipality in the Canadian province of Saskatchewan within Census Division No. 9 and SARM Division No. 4."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%91%D1%8A%D0%BB%D0%B3%D0%B0%D1%80%D0%BE-%D0%B0%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B8_%D0%BE%D1%82%D0%BD%D0%BE%D1%88%D0%B5%D0%BD%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/President_Theodore_Roosevelt%2C_1904.jpg","page_title":"Българо-американски отношения","context_page_description":"Българо-американските отношения водят своето начало официално от 1903 г.\\nТе претърпяват редица промени – от мисионерска дейност и американска подкрепа в борбата за независимост на България в края на 19 век, разширяване на търговските отношения в началото на 20 век, враждебност през Първата световна война, открити военни действия и бомбардировки през Втората световна война до идеологически сблъсък през Студената война, партньорство на България със САЩ и НАТО и все по-здрави политически, военни и икономически връзки в началото на 21 век."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BB%D1%96%D1%82%D0%B0%D0%BA%D1%96%D0%B2_%D0%94%D1%80%D1%83%D0%B3%D0%BE%D1%97_%D1%81%D0%B2%D1%96%D1%82%D0%BE%D0%B2%D0%BE%D1%97_%D0%B2%D1%96%D0%B9%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Li-2_HA-LIQ_04.jpg","page_title":"Список літаків Другої світової війни","context_page_description":"Список літаків Другої світової війни — список, який містить перелік усіх літальних апаратів, які використовувались країнами-учасницями Другої світової війни. В даний перелік також входять дрони, вертольоти, автожири та дирижаблі."},{"page_url":"https://sv.wikipedia.org/wiki/Ludovico_Bidoglio","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Ludovico_Bidoglio_1930.jpeg","page_title":"Ludovico Bidoglio","context_page_description":"Ludovico Bidoglio, född 5 februari 1900 i Buenos Aires, död 25 december 1970, var en argentinsk fotbollsspelare.\\nBidoglio blev olympisk silvermedaljör i fotboll vid sommarspelen 1928 i Amsterdam."},{"page_url":"https://cy.wikipedia.org/wiki/Stadtbibliothek_G%C3%B6ttingen","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/70/Stadtbibliothek_G%C3%B6ttingen_Thomas-Buergenthal-Haus.jpg","page_title":"Stadtbibliothek Göttingen","context_page_description":"Llyfrgell yn Göttingen, Niedersachsen, Yr Almaen, ydy Stadtbibliothek Göttingen. Mae'n gartref i 190,000 o gyfryngau, yn ychwanegol at wasanaeth archebu llyfrau, DVDau, CD-ROM, mapiau, sgriptiau cerddoriaeth a gemau.\\nCeir canghennau o'r llyfrgell ganolog hon yn ardaloedd Elliehausen, Geismar, Grone, Nicholasberg, a Roringen Weende."},{"page_url":"https://sq.wikipedia.org/wiki/Almeria","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Estaci%C3%B3n_intermodal_de_Almer%C3%ADa.JPG","page_title":"Almeria","context_page_description":"Almeria është qytet në juglindje të Spanjës. Almeria është themeluar nga Abdurrahman III në vitin 955."},{"page_url":"https://pl.wikipedia.org/wiki/Wewak","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/27/WewakBeach.jpg","page_title":"Wewak","context_page_description":"Wewak – miasto w Papui-Nowej Gwinei, stolica prowincji Sepik Wschodni, na północnym wybrzeżu Nowej Gwinei, na zachód od rzeki Sepik.\\nW mieście znajduje się niewielki port morski oraz port lotniczy Wewak. Eksportuje się kawę, kakao, a także kauczuk.\\nPodczas II wojny światowej w mieście znajdowała się największa na wyspie japońska baza lotnicza, będąca częstym celem ataków samolotów amerykańskich i australijskich. Siły japońskie stacjonujące w mieście skapitulowały 13 września 1945 roku."},{"page_url":"https://en.wikipedia.org/wiki/1.59-inch_Breech-Loading_Vickers_Q.F._Gun,_Mk_II","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/1.59-inch_Crayford_gun_photograph.jpg","page_title":"1.59-inch Breech-Loading Vickers Q.F. Gun, Mk II","context_page_description":"The 1.59-inch Breech-Loading Vickers Q.F. Gun, Mk II was a British light artillery piece designed during World War I. Originally intended for use in trench warfare, it was instead tested for air-to-air and air-to-ground use by aircraft. Although it fired shells and had no capability to launch rockets, it was widely but misleadingly known as the \\"Vickers-Crayford rocket gun.\\""},{"page_url":"https://de.wikipedia.org/wiki/Trajektorie_(Mathematik)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Phasenportrait_LGS.png","page_title":"Trajektorie (Mathematik)","context_page_description":"Mit Trajektorie wird in der Mathematik meist die Lösungskurve einer Differentialgleichung mit vorgegebenen Anfangsbedingungen bezeichnet. Die Differentialgleichung beschreibt die Koordinaten eines Systems in Abhängigkeit von einem Parameter, der in mechanischen Anwendungen meist die Zeit ist. Dann beschreibt die Trajektorie die Koordinaten des Systems in Abhängigkeit von der „Zeit“."},{"page_url":"https://it.wikipedia.org/wiki/%C3%89milien_Jacquelin","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Biathlon_European_Championships_2017_Sprint_Men_0065.JPG","page_title":"Émilien Jacquelin","context_page_description":"Émilien Jacquelin è un biatleta francese."},{"page_url":"https://en.wikipedia.org/wiki/Los_Pe%C3%B1asquitos_Lagoon","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/110301_SR-56_BT_bicyclist_curve_hill_025.jpg","page_title":"Los Peñasquitos Lagoon","context_page_description":"Los Peñasquitos Marsh Natural Preserve and Lagoon is a coastal marsh in San Diego County, California, United States situated at the northern edge of the City of San Diego, forming the natural border with Del Mar, California. The lagoon, previously called The Soledad Lagoon, divides a colony of the endangered Pinus torreyana on a narrow coastal strip. The name \\"Los Peñasquitos\\" is Spanish for \\"The Little Cliffs\\"."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_tijdens_de_Atjeh-oorlog_gesneuvelde_officieren","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Man%2C_L.W..J.jpg","page_title":"Lijst van tijdens de Atjeh-oorlog gesneuvelde officieren","context_page_description":"De Atjeh-oorlog was een koloniale oorlog die het Koninkrijk der Nederlanden voerde met het aanvankelijk oogmerk om de zeevaart door Straat Malakka te beveiligen tegen zeerovers uit Atjeh. Later was het doel het Sultanaat Atjeh onder Nederlands koloniaal gezag te brengen en te houden. Onderstaand een lijst van tijdens die oorlog gesneuvelde officieren. De meeste officieren die sneuvelden werden begraven te Peutjoet."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%A0%D7%93%D7%A8%D7%98%D7%AA_%D7%91%D7%A0%D7%99_%D7%97%D7%95%D7%A3_%D7%94%D7%9B%D7%A8%D7%9E%D7%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/PikiWiki_Israel_11141_war_memorial_in_atlit.jpg","page_title":"אנדרטת בני חוף הכרמל","context_page_description":"אנדרטת בני חוף הכרמל היא האנדרטה המרכזית המנציחה את חללי המועצה האזורית חוף הכרמל שנפלו במלחמות ישראל. האנדרטה שוכנת ליד עתלית וצמודה לכביש החוף על רכס הכורכר. האנדרטה עוצבה על ידי הפסל יעקב אפשטיין."},{"page_url":"https://pl.wikipedia.org/wiki/Tingatinga","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/15/Wall_painting_ngapa1.JPG","page_title":"Tingatinga","context_page_description":"Tingatinga – pochodzący z lat 60. XX w. styl malarski Tanzanii. Nazwa wywodzi się od nazwiska\\nEdwarda Saidiego Tingatingi."},{"page_url":"https://arz.wikipedia.org/wiki/%DA%86%D9%8A%D9%86_%D9%84%D9%88%D9%8A%D8%B3_%D8%AA%D8%B4%D8%A7%D8%B3%D8%AA%D8%A7%D9%86%D9%8A%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Jean-Louis_Chastanet_1929.jpg","page_title":"چين لويس تشاستانيت","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nچين لويس تشاستانيت كان سياسى من فرنسا."},{"page_url":"https://en.wikipedia.org/wiki/1900","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/11exupery-inline1-500.jpg","page_title":"1900","context_page_description":"1900 was an exceptional common year starting on Monday of the Gregorian calendar and a leap year starting on Saturday of the Julian calendar, the 1900th year of the Common Era and Anno Domini designations, the 900th year of the 2nd millennium, the 100th and last year of the 19th century, and the 1st year of the 1900s decade. As of the start of 1900, the Gregorian calendar was 12 days ahead of the Julian calendar, which remained in localized use until 1923.\\nAs of March 1, when the Julian calendar acknowledged a leap day and the Gregorian calendar did not, the Julian calendar fell one day further behind, bringing the difference to 13 days until February 28, 2100."},{"page_url":"https://id.wikipedia.org/wiki/Daftar_relikui_kultural_Tiongkok_yang_dilarang_dipajang_di_luar_negeri","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/%E9%95%BF%E6%B2%99%E7%AA%91%E9%9D%92%E9%87%89%E8%A4%90%E5%BD%A9%E8%B4%B4%E8%8A%B1%E4%BA%BA%E7%89%A9%E7%BA%B9%E5%A3%B6%2C_2018-09-28.jpg","page_title":"Daftar relikui kultural Tiongkok yang dilarang dipajang di luar negeri","context_page_description":"Daftar peninggalan budaya Tiongkok yang dilarang untuk dipamerkan di luar negeri terdiri dari daftar barang antik dan artefak arkeologis yang dimiliki oleh berbagai museum dan institusi lain di Republik Rakyat Tiongkok, yang secara resmi dilarang oleh pemerintah Tiongkok, sejak tahun 2003, untuk dibawa ke luar negeri untuk dipamerkan. Banyak peninggalan dalam daftar tersebut melambangkan terobosan penemuan arkeologis di Tiongkok sejak pertengahan abad ke-20, ketika arkeologi sebagai ilmu pengetahuan modern mulai berakar di Tiongkok. Barang-barang ini adalah salah satu harta karun yang paling penting di Tiongkok, dan memiliki makna sejarah, budaya atau artistik."},{"page_url":"https://pl.wikipedia.org/wiki/Pecn%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Pecny.jpg","page_title":"Pecný","context_page_description":"Pecný – szczyt o wysokości 1334 m n.p.m. w paśmie górskim Wysokiego Jesionika, w północno-wschodnich Czechach, w Sudetach Wschodnich, na Morawach, w obrębie gminy Vernířovice, oddalony o około 7,6 km na południowy zachód od szczytu góry Pradziad, leżący na jego głównym grzbiecie, pomiędzy szczytami Břidličná hora i Pec."},{"page_url":"https://en.wikipedia.org/wiki/Oronsay,_Colonsay","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Oronsay_-_Hebrides.jpg","page_title":"Oronsay, Colonsay","context_page_description":"Oronsay, also sometimes spelt and pronounced Oransay by the local community, is a small tidal island south of Colonsay in the Scottish Inner Hebrides with an area of 543 hectares.\\nThe island rises to a height of 93 m at Beinn Orasaigh and is linked to Colonsay by a tidal causeway consisting of sands and mud flats. In the 2001 census Oronsay was recorded as having a population of five people, who lived at the farm adjacent to Oronsay Priory. In 2011 the population had risen to eight. The island has no facilities for visitors and is now privately owned, with the RSPB farming the island for the American owner. It is dependent upon tidal access to and from Colonsay. There is a small grass air strip south of the priory that \\"fights a losing battle with the rabbits\\"."},{"page_url":"https://id.wikipedia.org/wiki/Kesengsaraan_Yesus","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Stom%2C_Matthias_-_Christ_Crowned_with_Thorns_-_c._1633-1639.jpg","page_title":"Kesengsaraan Yesus","context_page_description":"Kisah Sengsara dalam Kekristenan adalah periode akhir pendek dalam kehidupan Yesus yang menyoroti masa pada sejak kunjungan terakhir-Nya ke Yerusalem dalam periode Minggu Sengsara dan perjalanan-Nya menuju penyaliban-Nya di atas Gunung Kalvari, yang didefinisikan sebagai peristiwa klimaktik utama pada doktrin \\"Sejarah Keselamatan\\" Kristen.\\nPeristiwa tersebut dimulai dengan pertanda yang didapatkan Bunda Maria, disusul dengan Yesus dielu-elukan di Yerusalem dan pengadaan Ekaristi-Nya pada Perjamuan Terakhir, kepergian-Nya ke Taman Getsemani disusul dengan penangkapan-Nya oleh para imam Sanhedrin dan dibawa ke pengadilan Pontius Pilatus. Bagian-bagian dari empat Injil menceritakan tentang peristiwa tersebut, beserta Injil Petrus non-kanonikal, yang dikenal sebagai \\"naratif Kisah Sengsara\\". Dalam kalender liturgi Gereja Katolik Roma, kisah sengsara dirayakan dalam Minggu Kudus, dimulai pada Jumat Kesedihan, Minggu Palma dan berpuncak pada kematian-Nya pada Jumat Agung."},{"page_url":"https://pl.wikipedia.org/wiki/Hokej_na_lodzie_na_Zimowej_Uniwersjadzie_2009","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Sergei_Zhukov.jpg","page_title":"Hokej na lodzie na Zimowej Uniwersjadzie 2009","context_page_description":"Hokej na lodzie na Zimowej Uniwersjadzie 2009 odbył się w dniach 18 - 28 lutego w halach Hali sportowej Instytutu Wychowania Fizycznego i Hali hokeja na lodzie w Harbinie"},{"page_url":"https://fr.wikipedia.org/wiki/Coblence","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0e/Stadtteilkarte_Koblenz-Horchheimer_H%C3%B6he.png","page_title":"Coblence","context_page_description":"Coblence est une ville et un arrondissement d'Allemagne, situés dans le nord du Land de la Rhénanie-Palatinat. Au 31 décembre 2014, la ville comptait 111 434 habitants.\\nLes villes les plus proches sont Bonn, à près de 60 km en aval du Rhin, et Mayence, à 90 km en amont du Rhin. Coblence est la troisième ville de la Rhénanie-Palatinat et le siège de la conurbation Mayen-Coblence. C'est également une ville universitaire.\\nLe nom Coblence vient du latin Confluentes qui signifie confluent. Depuis 2002, une partie de Coblence a été inscrite au patrimoine mondial de l'UNESCO.\\nCoblence se trouve dans une région appelée Deutsches Eck, littéralement le coin allemand, au confluent de la Moselle et du Rhin. La ville est bordée par une partie du Hunsrück au sud et par le paysage légèrement vallonné du Maifeld à l'ouest.\\nLes quartiers de la ville situés sur la rive droite du Rhin se trouvent à la bordure de la forêt du Westerwald, qui plonge en partie jusqu'au fleuve. Les quartiers situés entre le Rhin et la Moselle sont en partie plantés d'une forêt mixte qui constitue le poumon vert de la ville et de sa banlieue proche."},{"page_url":"https://vi.wikipedia.org/wiki/H%C6%B0%C6%A1u_%C4%91%E1%BB%93ng_c%E1%BB%8F_Nam_M%E1%BB%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Veado-campeiro.jpg","page_title":"Hươu đồng cỏ Nam Mỹ","context_page_description":"Nai đồng cỏ Nam Mỹ, tên khoa học Ozotoceros bezoarticus là một loài động vật có vú trong họ Hươu nai, bộ Guốc chẵn. Loài này được Linnaeus mô tả năm 1758."},{"page_url":"https://pt.wikipedia.org/wiki/Johannes_Vogel","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/2017-05-14_NRW_Landtagswahl_by_Olaf_Kosinsky-139.jpg","page_title":"Johannes Vogel","context_page_description":"Johannes Vogel é um político alemão do FDP."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%95%99%EB%93%9C%EB%A0%88%ED%94%BC%EC%97%90%EB%A5%B4_%EC%A7%80%EB%83%90%ED%81%AC","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/16/Andr%C3%A9-Pierre_Gignac_2008-07-09.JPG","page_title":"앙드레피에르 지냐크","context_page_description":"앙드레피에르 지냐크 은 프랑스의 프로 축구선수로, 현재 리가 MX의 티그레스 UANL 소속이다. 그는 주로 윙어에 영향을 미치는 스트라이커로 활약한다. 지냐크는 \\"공중볼 경합\\"에 있어서 \\"강력하고 위험한\\" 스트라이커로 평가받고 있다. 그는 그의 팀동료로부터 데데 로 줄여서 부르기도 한다.\\n집시 혈통으로, 지냐크는 고향 프로방스알프코트다쥐르의 지역 클럽 ES 포수므 와 마르티게의 유소년팀에 처음 속해 있었다. 2002년, 그는 브르타뉴 지역을 연고로 하는 FC 로리앙으로 이적하였다. 그는 3년간 이 클럽의 1군에서 활약하였으나, 주전 확보에 어려움을 겪고 2년째 해에는 아마추어 클럽인 FC 포로 임대되었다. 2007년, 그는 툴루즈 FC로 논란이 이는 가운데 이적하였다. 초기에 어려움을 겪었던 그는, 2008-09 시즌에 24골을 득점하며 이 시즌의 득점왕으로 등극하였다. 2009-10 시즌에 툴루즈에서 활약한 지냐크는 2010년 8월에 프랑스 챔피언 올랭피크 드 마르세유와 5년 계약을 체결하였다. 그는 에투알 프레쥐스 생라파옐의 수비수인 자크 아바르도나도와 AS 낭시의 윙어 요한 몰로의 사촌이다.\\n지냐크는 2009년 4월, 리투아니아전을 앞두고, 소속팀 툴루즈에서의 우수한 성과로 프랑스 축구 국가대표팀 데뷔전을 치루었다. 그는 5달 후, 페로 제도와의 경기에서 첫골을 기록하였다. 지냐크는 2010년 FIFA 월드컵을 처음으로 메이저 국가대항전에 참가하였다. 그는 프랑스가 참여한 조별리그 3경기에 모두 출장하였다."},{"page_url":"https://cs.wikipedia.org/wiki/Paka_n%C3%AD%C5%BEinn%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Paca.jpg","page_title":"Paka nížinná","context_page_description":"Paka nížinná, rovněž aguti paka nebo tlamák bahní je hlodavec z čeledi pakovití a rodu Cuniculus. Dříve byl řazen do čeledi agutiovití. Popsal jej Carl Linné v roce 1766. Má rozsáhlý areál rozšíření. Dle Mezinárodního svazu ochrany přírody i proto patří mezi málo dotčené druhy."},{"page_url":"https://en.wikipedia.org/wiki/Gagauz_people","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Bugeac-etnic.png","page_title":"Gagauz people","context_page_description":"The Gagauzes are a Turkic people living mostly in southern Moldova and southwestern Ukraine. Most Gagauzes are Eastern Orthodox Christians."},{"page_url":"https://fr.wikipedia.org/wiki/Vincenzo_Baviera","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Limmat_-_Baden_IMG_6735.JPG","page_title":"Vincenzo Baviera","context_page_description":"Vincenzo Baviera, né le 28 juillet 1945 à Zurich, est un sculpteur suisse."},{"page_url":"https://cs.wikipedia.org/wiki/Parlamentn%C3%AD_volby_na_Islandu_2017","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Bright_Future_logo_%28BF_version%29.png","page_title":"Parlamentní volby na Islandu 2017","context_page_description":"Parlamentní volby na Islandu 2017 se konaly v sobotu 28. října. Poměrným systémem s 5 % uzavírací klauzulí bylo voleno všech 63 poslanců Althingu. Jednalo se o předčasné volby, vyhlášené 15. září 2016 po pádu koaliční vlády Strany nezávislosti, Reformní strany a strany Zářná budoucnost. Vítězem se stala Strana nezávislosti, která se ziskem 25,2 % získala 16 mandátů a vytvořila koaliční vládu s hnutím Levice-Zelení a Progresivní stranou."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%A4%E0%AF%86%E0%AE%A9%E0%AF%8D%E0%AE%A4%E0%AE%BF%E0%AE%B0%E0%AF%81%E0%AE%B5%E0%AE%BE%E0%AE%B2%E0%AE%B5%E0%AE%BE%E0%AE%AF%E0%AF%8D_%E0%AE%95%E0%AF%8B%E0%AE%AF%E0%AE%BF%E0%AE%B2%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Thenthiruvalaya_Temple.jpg","page_title":"தென்திருவாலவாய் கோயில்","context_page_description":"தென்திருவாலவாய் கோயில் அல்லது தென் திரு ஆலவாய் கோயில் என்பது, தமிழ்நாட்டின் மதுரை மாநகரில், தெற்கு மாசி வீதியில் அமைந்துள்ள மீனாட்சியம்மன் உடனுறை சிவபெருமான் கோயில் ஆகும். மூலவர் பெயர் சொக்கநாதர். அம்பாள் பெயர் மீனாட்சி. இங்குள்ள சிவமூர்த்தி அளவில் பெரியவர். இது தெற்கு திசைக்குத் தலைவனாகிய எமன் வழிபட்ட கோயில். இக்கோயில் மதுரையில் உள்ள பஞ்சபூத தலங்களில் அக்னி தலமாகும். திருவிளையாடற் புராணக் கதைகளில் ஒன்றான மதுரைக்கு எல்லை கட்டிய படலம் நிகழப்பெற்ற கோயில் இது. மதுரை மீனாட்சி சுந்தரேஸ்வரர் கோயில் நிர்வாகத்தின் கீழ் வரும் கோயில்களில் இக்கோயிலும் ஒன்றாகும்."},{"page_url":"https://vi.wikipedia.org/wiki/S%C3%A2n_bay_qu%E1%BB%91c_t%E1%BA%BF_Dubai","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Arrivals_hall_in_DXB_Terminal_3_%283344510514%29.jpg","page_title":"Sân bay quốc tế Dubai","context_page_description":"Sân bay quốc tế Dubai là sân bay quốc tế phục vụ Dubai, Các Tiểu Vương quốc Ả Rập Thống nhất, là sân bay chính của Dubai và là sân bay bận rộn nhất thế giới theo lưu lượng hành khách quốc tế. Đây là trung tâm hoạt động của Emirates, là sân bay bận rộn thứ ba trên thế giới, sân bay chở hàng đông thứ sáu trên thế giới, sân bay bận rộn nhất cho các chuyến bay Airbus A380 và Boeing 777 và cũng là sân bay bận rộn nhất trên thế giới hoạt động chỉ với hai đường băng. Năm 2007, sân bay này phục vụ 34.348.110 khách, xếp hạng thứ 27 thế giới về các sân bay bận rộn nhất thế giới. Đến thời điểm tháng 7 năm 2010, có hơn 6000 lượt chuyến mỗi tuần vận hành bởi 130 hãng hàng không đến hơn 215 điểm khắp các châu lục trừ châu Nam Cực. Trong năm 2017, DXB đã xử lý 88 triệu hành khách, 2,65 triệu tấn hàng hóa và 409.493 lượt máy bay. Sân bay này sẽ cạnh tranh với Sân bay quốc tế Al Maktoum rộ40 140 km² sắp được xây ở quốc gia này. Năm 2011, sân bay này phục vụ 50,98 triệu lượt khách, năm 2014 là 70,4 triệu lượt khách. Vào năm 2017, DXB phục vụ cho 88 triệu hành khách, 2,65 triệu tấn hàng hóa và 409.493 lượt cất hạ cánh."},{"page_url":"https://pt.wikipedia.org/wiki/Snov%C3%ADdky","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Snov%C3%ADdky_-_kaple.jpg","page_title":"Snovídky","context_page_description":"Snovídky é uma comuna checa localizada na região de Morávia do Sul, distrito de Vyškov."},{"page_url":"https://sk.wikipedia.org/wiki/Mary_Ellen_Weberov%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Mary_Ellen_Weber.jpg","page_title":"Mary Ellen Weberová","context_page_description":"Mary Ellen Weberová je americká vedkyňa a astronautka. Vo vesmíre bola dvakrát."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A7%D0%B5%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%82%D0%B5%D1%85%D0%BD%D1%96%D1%87%D0%BD%D0%B8%D0%B9_%D1%83%D0%BD%D1%96%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%82%D0%B5%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Czech_National_Technical_Library_new_building.jpg","page_title":"Чеський технічний університет","context_page_description":"Че́ський техні́чний університе́т — технічний університет у столиці Чехії місті Празі, що має славні історичні традиції й шерег відомих випускників; один із найбільших вишів у країні.\\nЗаснований у 1707 році університет є, таким чином, найстарішим технічним університетом Центральної Європи і найстарішим цивільним технічним вишом Європи в цілому.\\nЧТУ — один із найбільших університетів країни. Станом на 2008 рік тут навчалося 23 363 студентів.\\nГоловний корпус університету розташований у центрі Нового Мєста в Празі — на Карловій площі, центральний кампус — у празькому районі Дейвіце."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%98%94%E8%95%8A%E5%85%B0%E5%B1%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Peristylus_aristatus_%284956215876%29_-_cropped.jpg","page_title":"阔蕊兰属","context_page_description":"闊蕊蘭屬是蘭科下的一個屬，為陸生蘭。該屬共有約100種，分布於亞洲熱帶地區至大洋洲。"},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%A1%D5%B4%D5%B8%D6%82%D5%BC%D5%B6%D5%A5%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Moss_on_a_dry_stone_wall.jpg","page_title":"Մամուռներ","context_page_description":"Մամուռներ մամռանմաններ, ցամաքային, հազվադեպ քաղցրահամ ջրերի ինքնասուն բույսեր։ Բաժանվում\\nեն 3 դասի՝\\nԱնթոցերոտայիններ,\\nԼյարդամամուռներ\\nՏերևացողունայիններ կամ իսկական մամուռներ ։\\nՀայտնի է մոտ 27000, ՀՀ-ում՝ 430 տեսակ ։ Մոտ 110-120 ընտանիք, կազմում են մոտ 20 000 տեսակ։"},{"page_url":"https://de.wikipedia.org/wiki/Figuren_im_Star-Trek-Universum","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Manu_Intiraymi_2014-07-23_19-11.jpg","page_title":"Figuren im Star-Trek-Universum","context_page_description":"Dieser Artikel beschreibt die wichtigsten Figuren im Universum von Star Trek."},{"page_url":"https://ca.wikipedia.org/wiki/Sandia","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Heather_Wilson_and_Governor_Victor_Montoya.jpg","page_title":"Sandia","context_page_description":"El Pueblo Sandia és una tribu reconeguda federalment d'amerindis dels Estats Units de cultura pueblo que viu en la reserva de 101,114 km² del mateix nom a l'est del Rio Grande Rift del centre de Nou Mèxic, situada tres milles al sud de Bernalillo al sud del comtat de Sandoval i al nord del comtat de Bernalillo, a 35° 15′ 17″ N, 106° 34′ 23″ O. Limita al sud amb la ciutat d'Albuquerque i a l'est pels contraforts de les muntanyes Sandia, una forma de relleu que el poble considera sagrada i que era fonamental per a l'economia tradicional i segueix sent important en la vida espiritual de la comunitat. Una zona boscosa coneguda com el bosque envolta la resta de la reserva i serveix com a font de llenya i caça silvestre. El cens dels Estats Units del 2000 informa d'una població resident de 4.414 habitants. Dues comunitats ubicades en el seu territori són Pueblo of Sandia Village i part de la ciutat de Bernalillo.\\nEl Pueblo Sandia és un dels 19 pueblos amerindis reconeguts federalment de Nou Mèxic, i un dels Pueblo de l'Est."},{"page_url":"https://pt.wikipedia.org/wiki/Lu%C3%ADs_Filipe,_Pr%C3%ADncipe_Real_de_Portugal","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Princ%C3%ADpe_D._Lu%C3%ADs_Filipe_de_Bragan%C3%A7a_-_Fotografia_Lazarus%2C_Louren%C3%A7o_Marques.png","page_title":"Luís Filipe, Príncipe Real de Portugal","context_page_description":"Luís Filipe de Bragança foi Príncipe Real de Portugal. Filho mais velho do rei D. Carlos I de Portugal e de sua mulher, a rainha D. Amélia de Orleães, foi Príncipe da Beira antes da subida de seu pai ao trono."},{"page_url":"https://es.wikipedia.org/wiki/Montefiascone","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Montefiascone_panorama.jpg","page_title":"Montefiascone","context_page_description":"Montefiasconees un municipio de Italia en la provincia de Viterbo. Con 13.300 habitantes, dista de la capital alrededor de 15 km. Produce el vino con DOC Est! Est!! Est!!! di Montefiascone. Se encuentra en una colina al sureste del lago de Bolsena, a 113 km de ferrocarril al noroeste de Roma."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%8E%E0%B0%B2%E0%B0%95%E0%B1%8D%E0%B0%9F%E0%B1%8D%E0%B0%B0%E0%B0%BF%E0%B0%95%E0%B0%B2%E0%B1%8D_%E0%B0%87%E0%B0%82%E0%B0%9C%E0%B0%A8%E0%B1%80%E0%B0%B0%E0%B0%BF%E0%B0%82%E0%B0%97%E0%B1%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Space_Shuttle_Columbia_launching.jpg","page_title":"ఎలక్ట్రికల్ ఇంజనీరింగ్","context_page_description":"ఎలెక్ట్రిసిటీ. ఎలెక్ట్రానిక్స్, ఎలెక్ట్రోమాగ్నెటిజమ్ విషయాలకు సంబంధించన అధ్యయనమే ఎలెక్ట్రికల్ ఇంజనీరింగ్. పందొమ్మిదవ శతాబ్దం చివరి దశలో ఎలెక్ట్రికల్ టెలిగ్రాప్, విద్యుత్ శక్తి సరఫరా వాణిజ్యపరంగా ప్రారంభంతో ఇది ప్రత్యేక వృత్తిగా గుర్తింపు పొందింది. దీనిలో పవర్, ఎలెక్ట్రానిక్స్, కంట్రోల్ సిస్టమ్స్, సిగ్నల్ ప్రాసెసింగ్, టెలికమ్యూనికేషన్ అనే ఉపవిభాగాలు ఉన్నాయి. భారతదేశంలో ఎలెక్ట్రానిక్స్ ఇంజనీరింగ్ తక్కువస్థాయి వ్యవస్థలను కంప్యూటర్, ఇంటిగ్రేటెడ్ సర్కూట్స్ తో పనిని సూచించడానికి వాడతారు, ఎలెక్ట్రికల్ ఇంజనీరింగ్, భారీ స్థాయి వ్యవస్థలను అనగా విద్యుత్ శక్తి వుత్పాదన, పంపిణీ, యంత్రాల నియంత్రణ వంటి వాటికి వాడతారు.\\n17వశతాబ్ది తొలి దశనుండి శాస్త్రవేత్తలు విద్యుత్ పై అధ్యయనం చేసేవారు. అలెస్సాండ్రో వోల్టా 1775 లో స్థితి విద్యుత్ చార్జీ తయారీ యంత్రం, 1800లో వోల్టాయిక్ పైల్ అనగా ఆధునిక బ్యాటరీకి మూలరూపం తయారు చేశాడు. జార్జి ఓమ్ 1827 లో కరెంటుకి వోల్టేజికి సంబంధాన్ని కనుగొన్నాడు. 1831 లో, మైఖేల్ ఫారడే, ఎలెక్ట్రోమాగ్నెటిక్ ఇండక్షన్, 1873లో జేమ్స్ క్లార్క్ మాక్స్వెల్ విద్యదయాస్కాంత సూత్రాలు కనుగొన్నాడు. 1882 లో థామస్ అల్వా ఎడిసన్ రపంచంలో తొలిసారి విద్యుత్ ప్రసార నెట్వర్క్ తయారుచేశాడు. 1887 లో, నికోలా టెస్లా ఆల్టర్నేటింగ్ కరెంట్ అనబడే విద్యుత్ ప్రసార విధానాన్ని కనుగొన్నాడు."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%BE%85%E6%BC%A2%E9%BD%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Boeddha%27s_Delight.jpg","page_title":"羅漢齋","context_page_description":"羅漢齋は主に中国で作られている精進料理である。中国国内では時に、羅漢菜と表記されることがある。\\n羅漢齋は伝統的に仏教僧の間で食されてきた料理であったが、現代では世界中の中華料理店におけるベジタリアンの食事の選択肢として人気のある料理となっている。羅漢齋の材料は様々な野菜であるが、時に魚や卵を用いることもある。野菜を、醤油をベースとして様々な調味料を加えたソースとともに炒めて作る。羅漢齋を特徴づける食材はアジア内部とアジア外で大きく異なる。"},{"page_url":"https://fr.wikipedia.org/wiki/Mathis_Picard","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/La_Rhune%2C_huile.jpg","page_title":"Mathis Picard","context_page_description":"Mathis Picard né Mathurin Picard à Limoges le 18 janvier 1854, mort à Biarritz le 22 mars 1938, est un aquarelliste paysagiste avec une technique très personnelle dans ses réalisations."},{"page_url":"https://de.wikipedia.org/wiki/Tel_Dan","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Tel_Dan_Israelite_Gate_2.jpg","page_title":"Tel Dan","context_page_description":"Tel Dan ist ein Nationalpark und Naturreservat etwa einen Kilometer nördlich vom Kibbuz Dan im Norden von Israel. Das Reservat umfasst den etwa 20 Meter hohen Siedlungshügel einer von der frühen kanaanitischen bis in die römische Zeit bewohnten Stadt, sowie die Quellen des Dan-Flusses."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%9F%D0%B0%D0%B3%D0%BE%D0%BD%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Vita%C5%ADt_Vialiki%2C_Pahonia._%D0%92%D1%96%D1%82%D0%B0%D1%9E%D1%82_%D0%92%D1%8F%D0%BB%D1%96%D0%BA%D1%96%2C_%D0%9F%D0%B0%D0%B3%D0%BE%D0%BD%D1%8F_%28K._Kielisi%C5%84ski%2C_1385%2C_1841%29.jpg","page_title":"Пагоня","context_page_description":"Пагоня — герб Вялікага Княства Літоўскага, які атрымаў статус дзяржаўнага ў час княжаньня Вітаўта Вялікага. Традыцыйны нацыянальны герб беларусаў. Дзяржаўны герб Беларускай Народнай Рэспублікі і Рэспублікі Беларусь. Гэта выява ўзброенага вершніка на белым кані на чырвонай тарчы. Вершнік трымае ў паднятай правай руцэ меч, у левай — белую, чырвоную альбо сінюю тарчу з залатым шасьціканцовым крыжом. Зь левага боку ў вершніка ножны мяча, з-пад сядла зьвісае трохканцовая вупраж. З колераў Пагоні ўтвараецца нацыянальны бел-чырвона-белы сьцяг беларусаў.\\n14 траўня 2007 году ўрад Беларусі надаў гербу Пагоні статус нематэрыяльнай гістарычна-культурнай каштоўнасьці. З 10 красавіка 1990 году варыянт Пагоні зьяўляецца дзяржаўным гербам Летувы."},{"page_url":"https://lt.wikipedia.org/wiki/Juozas_T%C5%ABbelis","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fb/T%C5%ABbelisJuozas.jpg","page_title":"Juozas Tūbelis","context_page_description":"Juozas Tūbelis – politikos ir visuomenės veikėjas, Lietuvos Vyriausybės ir Lietuvos banko vadovas, žemės ūkio specialistas, spaudos darbuotojas."},{"page_url":"https://nl.wikipedia.org/wiki/Brussels_Airport","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Starbucks_Brussels_Airport.jpg","page_title":"Brussels Airport","context_page_description":"Brussels Airport is de nationale luchthaven van België."},{"page_url":"https://eo.wikipedia.org/wiki/Hermann_Witsius","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Hermann_Witsius_by_Heymans.jpg","page_title":"Hermann Witsius","context_page_description":"Hermann Witsius estis nederlanda teologo, reformisto, klasikulo, hebreisto, profesoro pri teologio en la Universitato de Franeker. Kvankam teologie Witsius celis la repaciĝon inter la ortodoksio kaj la Teologio pri la Interligoj, ankaŭ konata kiel federalismo, li antaŭ ĉio estis biblia teologo kaj lia ĉefa studareo estis la sistema teologio. Li estis samtempulo de Johano Kocejo kaj Gisbertus Voetius, kun kies sekvantoj li partoprenis en kelkaj polemikoj."},{"page_url":"https://en.wikipedia.org/wiki/First_Baptist_Church_(Ottawa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/First_Baptist_Church%2C_Ottawa.jpg","page_title":"First Baptist Church (Ottawa)","context_page_description":"First Baptist Church is a prominent Baptist church in Ottawa, Ontario, Canada. It is part of the Canadian Baptists of Ontario and Quebec union."},{"page_url":"https://no.wikipedia.org/wiki/Klerestorium","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b0/Coupe.nef.cathedrale.Amiens.png","page_title":"Klerestorium","context_page_description":"Et klerestorium er veggen med vinduer over midtskipet i en basilika.\\nMidtskipsveggen har som oftest tre etasjer med arkade i første, triforium i andre og klerestorium i tredje.\\nSærlig i sengotiske steinkirker ble klerestorieveggen utstyrt med store åpninger for å få mest mulig lys inn i midtskipet.\\nBetegnelsen har også vært brukt om overveggen rundt det hevede midtrommet i en stavkirke av type B, som kan være utstyrt med runde glugger eller senere innsatte vinduer. Dette gir en visuell klerestorieeffekt, men er ikke et ekte klerestorium. Det har vært hevdet at dette er et bygningsmessig trekk som knytter stavkirken til steinarkitekturen, men denne teorien er omstridt."},{"page_url":"https://fr.wikipedia.org/wiki/Sporus","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Nero_Glyptothek_Munich_321.jpg","page_title":"Sporus","context_page_description":"Sporus était un jeune favori de l'empereur Néron, qui le fit castrer, puis l'épousa."},{"page_url":"https://fi.wikipedia.org/wiki/Ryan_Seacrest","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Ryan_Seacrest_2013.jpg","page_title":"Ryan Seacrest","context_page_description":"Ryan John Seacrest on yhdysvaltalainen radio- ja televisiojuontaja sekä televisiotuottaja. Hän on On Air with Ryan Seacrest Top-40-radio-ohjelman juontaja. Televisiossa Seacrest juontaa E! News -ohjelmaa ja American Idolia."},{"page_url":"https://arz.wikipedia.org/wiki/%DA%86%D8%A7%D8%B3%D9%8A%D9%86%D8%AA%D8%A7_%D8%A7%D8%B3%D9%83%D9%88%D8%AF%D9%88%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Jacinta_Escudos.jpg","page_title":"چاسينتا اسكودوس","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nچاسينتا اسكودوس صحفيه من السالفادور."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BE%D0%BA%D0%BE%D0%B2%D0%BD%D0%B8%D0%BD,_%D0%92%D0%B8%D0%BA%D1%82%D0%BE%D1%80_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/%D0%9F%D1%91%D1%82%D1%80_%D0%98%D0%BB%D1%8C%D1%87%D0%B5%D0%BD%D0%BA%D0%BE-%D0%BF%D1%80%D0%BE%D1%84%D0%B5%D1%81%D1%81%D0%BE%D1%80_%D0%9C%D0%93%D0%9A.jpg","page_title":"Соковнин, Виктор Александрович","context_page_description":"Ви́ктор Алекса́ндрович Соковни́н — русский оперный певец и педагог."},{"page_url":"https://pl.wikipedia.org/wiki/Ulica_Krochmalna_w_Lublinie","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/A_1101_1-15_zesp%C3%B3%C5%82_cukrowni_Lublin_2s.jpg","page_title":"Ulica Krochmalna w Lublinie","context_page_description":"Ulica Krochmalna w Lublinie – arteria komunikacyjna w Lublinie o długości ponad 2 km. Łączy dzielnicę Piaski z Czubami i Rurami. Stanowi główną drogę dzielnicy administracyjnej Za Cukrownią. Przebiega z jednej strony pomiędzy Bystrzycą a z drugiej – torami linii kolejowych nr 68 i nr 7. W pobliżu znajduje się dworzec kolejowy Lublin i dworzec PKS. Przez większą część trasy jest jednojezdniowa z jednym pasem ruchu w każdą stronę; wzdłuż całej długości ulicy poprowadzono ścieżkę rowerową.\\nPrzy Krochmalnej znajduje się nieco budynków z XIX wieku, dominuje jednak architektura przemysłowa związana z charakterem dzielnicy. Do budynków przemysłowych należą: zlikwidowana już Cukrownia spółki Polski Cukier, Hotel Kryształ, Kościół św. Teresy od Dzieciątka Jezus, fabryka Polmosu, liczne warsztaty samochodowe, a także park jeździecki nad Bystrzycą i osadniki. We wrześniu 2014 otworzono w pobliżu ul. Krochmalnej nowy stadion miejski, co wiązało się z wybudowaniem ronda i wyburzeniem 20 budynków przy ul. Krochmalnej i Nadłącznej."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D1%83%D0%BC%D0%B0%D0%BD%D0%BE%D0%B2%D1%81%D0%BA%D0%B0_%D0%B1%D0%B8%D1%82%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Zarobljeni_turski_oficiri_u_kumanovskoj_bici2.jpg","page_title":"Кумановска битка","context_page_description":"Кумановска битка вођена је у току Првог балканског рата, 23. и 24. октобра 1912. године у близини Куманова, између српске и турске војске.\\nБитка код Куманова била је битка у сусрету, јер су обе војске јуриле једна према другој. Због јаче концентрације српских трупа, иницијативе и храбрости војника и официра Прве српске армије, напад је одбијен, а битка добијена изненада. Турска Вардарска армија била је разбијена и повукла се ка Скопљу, Штипу и Велесу.\\nВелика победа код Куманова била је прва српска победа у Првом балканском рату и означила је скори крај турске владавине на Балкану.\\nСрпска војска је после више од 500 година поново овладала Косовом, а после Кумановске битке ушла је и у Скопље, престоницу Српског царства из 14. века."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Gouda","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Cornelis_en_Frederik_de_Houtman.jpg","page_title":"Lijst van rijksmonumenten in Gouda","context_page_description":"De stad en gemeente Gouda telt 355 inschrijvingen in het rijksmonumentenregister. Hieronder een compleet overzicht."},{"page_url":"https://fr.wikipedia.org/wiki/Livio_Berruti","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Berruti.JPG","page_title":"Livio Berruti","context_page_description":"Livio Berruti, né le 19 mai 1939, est un ancien athlète italien. Il a été le vainqueur surprise du 200 m aux Jeux olympiques d'été de 1960.\\nNé à Turin, Berruti, un étudiant en chimie, n'avait que 21 ans lorsqu'il participa aux jeux de Rome. En demi-finale du 200 m, il courait en 20 s 5, égalant le record du monde et se profilait comme un sérieux outsider pour la finale du lendemain. Dans cette course, Berruti, qui courait toujours avec des lunettes noires et des chaussettes blanches, répéta son temps de 20 s 5, battant les favoris américains. Dernier relayeur du 4 × 100 m italien, il manquait de peu une deuxième médaille, terminant quatrième.\\nCe titre olympique au début de sa carrière resta son meilleur résultat. Il participa trois fois aux championnats d'Europe, avec comme meilleure place, un septième rang sur 200 m en 1966. En Italie, il remportait le titre sur 100 m et 200 m de 1957 à 1962 et encore deux titres sur 200 m en 1965 et 1968. Berruti fit encore deux apparitions aux Jeux olympiques d'été. en 1964 et 1968, accédant les deux fois à la finale avec le relais 4 × 100 m et se classant cinquième sur 200 m en 1964."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D8%B7%D9%88%D9%84%D8%A9_%D8%A3%D9%88%D8%B1%D9%88%D8%A8%D8%A7_%D8%AA%D8%AD%D8%AA_21_%D8%B3%D9%86%D8%A9_%D9%84%D9%83%D8%B1%D8%A9_%D8%A7%D9%84%D9%82%D8%AF%D9%85_2013","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Netanya-Stadium_02.jpg","page_title":"بطولة أوروبا تحت 21 سنة لكرة القدم 2013","context_page_description":"بطولة أوروبا تحت 21 سنة لكرة القدم 2013هي النسخة التاسعة عشر من بطولة أوروبا تحت 21 سنة لكرة القدم. استضافتها إسرائيل من 5 إلى 18 يونيو 2013. أحرزت إسبانيا لقب البطولة للمرة الرابعة بعد تغلبها على إيطاليا 4–2 في النهائي."},{"page_url":"https://af.wikipedia.org/wiki/Kristina_Wong","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Kristina_Wong_in_Wong_Flew_Over_the_Cuckoo%27s_Nest.PNG","page_title":"Kristina Wong","context_page_description":"Kristina Wong is 'n Amerikaanse aktrise, skryfster, en vervaardiger. Sy is bekend vir haar rolle in die rolprente Urban Playground, Target Audience 9.1, en Dreamkiller."},{"page_url":"https://en.wikipedia.org/wiki/Victor_Herbert","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Eduard_Strauss_concert_poster.jpg","page_title":"Victor Herbert","context_page_description":"Victor August Herbert was an American composer, cellist and conductor of Irish ancestry and German training. Although Herbert enjoyed important careers as a cello soloist and conductor, he is best known for composing many successful operettas that premiered on Broadway from the 1890s to World War I. He was also prominent among the Tin Pan Alley composers and was later a founder of the American Society of Composers, Authors, and Publishers. A prolific composer, Herbert produced two operas, a cantata, 43 operettas, incidental music to 10 plays, 31 compositions for orchestra, nine band compositions, nine cello compositions, five violin compositions with piano or orchestra, 22 piano compositions and numerous songs, choral compositions and orchestrations of works by other composers, among other music.\\nIn the early 1880s, Herbert began a career as a cellist in Vienna, Austria, and Stuttgart, Germany, during which he began to compose orchestral music. Herbert and his opera singer wife, Therese Förster, moved to the U.S. in 1886 when both were engaged by the Metropolitan Opera."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%81%94%E9%82%A6%E5%86%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Flag_of_the_United_States_of_America_%281863-1865%29.svg","page_title":"联邦军","context_page_description":"聯邦軍，美國南北戰爭時期泛指北方聯邦方面軍隊，亦稱北軍、聯邦陸軍、洋基佬等。在美國南北戰爭期間，聯邦軍作戰的最高目標是擊敗聯盟軍，保衛美國國家統一。聯邦陸軍最終有效地保衛了一個持續有效、完整的共和國。它主要由北方未脫離聯邦的美軍正規軍、義務役官兵、國民兵兵員以及南方反對奴隸制、要求聯邦統一的志願兵組成。\\n在戰爭期間聯邦總共招募了2,128,948名聯邦軍士兵，其中包括178,895名有色人種士兵；白人士兵中有25%都出生在美國之外。最初動員的北軍士兵只約定了3個月的服役期，而在這之後他們大多選擇繼續在北軍中服役3年。這些北軍官兵中總共大約有596,670人因各種原因死亡，失蹤，受傷或致殘。 內戰中，北軍依靠聯邦強大的經濟實力、後勤、兵員補充能力最終擊敗了南軍。"},{"page_url":"https://fr.wikipedia.org/wiki/Timoth%C3%A9e_de_Lystre","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Saint_Timothy.jpg","page_title":"Timothée de Lystre","context_page_description":"Saint Timothée est un disciple, compagnon de voyage et proche confident de Paul de Tarse qui l'aurait institué évêque d'Éphèse. Rien n’est connu de lui hors des sources néo-testamentaires."},{"page_url":"https://fi.wikipedia.org/wiki/Lauri_Korpikoski","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/LauriKorpikoski1.jpg","page_title":"Lauri Korpikoski","context_page_description":"Lauri Korpikoski on suomalainen jääkiekkoilija ja olympiamitalisti, joka pelaa SM-liigajoukkue Turun Palloseurassa. Pelipaikaltaan hän on vasen laitahyökkääjä ja myös joukkueen kapteeni kaudesta 2018–2019 alkaen.\\nJääkiekon SM-liigassa Korpikoski on edustanut ainoastaan Turun Palloseuraa. New York Rangers varasi Korpikosken NHL:ään vuoden 2004 varaustilaisuudessa ensimmäisellä kierroksella varausnumerolla 19. Hän kuului Rangersin organisaatioon vajaan viiden kauden ajan, edustaen pääasiassa Rangersin AHL:ssä pelaavaa farmiseuraa, Hartford Wolf Packia. New Yorkissa hän ehti pelata yhteensä 68 runkosarjaottelua ja kahdeksan pudotuspelikamppailua ennen kuin Rangers kauppasi hänet Phoenixiin vaihdossa Enver Lisiniin vuonna 2009."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%A0%BC%E5%B1%B1%E9%99%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/%E4%B8%AD%E6%9E%97%E7%AB%B9%E6%B4%9E%E7%94%BB%E3%83%BB%E9%A0%BC%E5%B1%B1%E9%99%BD%E8%B3%9B%E3%80%8C%E5%B1%B1%E6%B0%B4%E5%9B%B3%E3%80%8D.jpg","page_title":"頼山陽","context_page_description":"頼 山陽は、大坂生まれの江戸時代後期の歴史家、思想家、漢詩人、文人。幼名は久太郎、名は襄、字は子成。山陽、三十六峯外史と号した。主著に『日本外史』があり、これは幕末の尊皇攘夷運動に影響を与え、日本史上のベストセラーとなった。贈正四位。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Eintr%C3%A4ge_im_National_Register_of_Historic_Places_im_Carroll_County_(Illinois)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Downtown_Main_Street_MG_8155.jpg","page_title":"Liste der Einträge im National Register of Historic Places im Carroll County (Illinois)","context_page_description":"Die Liste der Registered Historic Places im Carroll County in Illinois führt alle neun Bauwerke und historischen Stätten im Carroll County auf, die in das National Register of Historic Places aufgenommen wurden."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8C%97%E6%B5%B7%E9%81%93%E9%81%9331%E5%8F%B7%E9%9F%B3%E6%9B%B4%E6%B1%A0%E7%94%B0%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Japanese_National_Route_Sign_0241.svg","page_title":"北海道道31号音更池田線","context_page_description":"北海道道31号音更池田線は、北海道河東郡音更町と中川郡池田町を結ぶ道道である。"},{"page_url":"https://fi.wikipedia.org/wiki/Bronco_Horvath","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/1959_Topps_Bronco_Horvath.JPG","page_title":"Bronco Horvath","context_page_description":"Joseph \\"Bronco\\" Horvath oli kanadalainen jääkiekkoilija, joka pelasi 434 ottelua NHL:ssä 1955–1968.\\nHän tuli tunnetuksi etenkin Boston Bruinsin maineikkaassa Uke Line -ketjussa, jossa hänen kanssaan pelasivat Johnny Bucyk ja Vic Stasiuk. Horvath pelasi viidessä NHL:n niin sanotusta Original Six -joukkueesta Detroit Red Wingsiä lukuunottamatta."},{"page_url":"https://ca.wikipedia.org/wiki/Fraga","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Fraga_-_Arquer%C3%ADa_en_plaza_de_san_Pedro.JPG","page_title":"Fraga","context_page_description":"Fraga és una localitat aragonesa de parla catalana situada a l'extrem sud-est de la província d'Osca, en l'últim tram de la Vall del Cinca. Limita amb lo municipi català de Massalcoreig. Lo seu municipi és un dels més extensos d'Espanya; és cap de partit judicial i capital de la comarca del Baix Cinca.\\nFraga té un clima mediterrani-continental amb temperatures mitjanes anuals de 14,7 °C i amb una mitjana de precipitacions de 384 mm, recollides a la primavera i especialment a la tardor.\\nLa ciutat constitueix un important centre del sector serveis, que ocupa un terç de la població activa. La població total era de 13 341 habitants lo 2008."},{"page_url":"https://de.wikipedia.org/wiki/Nikolai_Olegowitsch_Scherdew","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Zherdev_291111.jpeg","page_title":"Nikolai Olegowitsch Scherdew","context_page_description":"Nikolai Olegowitsch Scherdew ist ein russischer Eishockeyspieler, der zuletzt bei Dinamo Riga in der Kontinentalen Hockey-Liga unter Vertrag stand."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%96%D7%95%D7%96%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Jaffa_Gate_Jerusalem_10.JPG","page_title":"מזוזה","context_page_description":"ביהדות, מְזוּזָה היא תשמיש קדושה הנקבע בצד הכניסה לבית מגורים ובחדרי הבית, לרוב על המשקוף. תוכנה העיקרי של המזוזה הוא קלף עליו נכתבות בכתב סת\\"ם פרשיות 'שמע ישראל', ו־'והיה אם שמוע' מחומש דברים. על פי רוב, יריעת הקלף נתונה בתוך בית המזוזה, התקן קשיח שנועד לכיסוי הקלף ולשמירה עליו.\\nישנה מצוות עשה לקבוע מזוזה על דופן פתח בית מגורים ובפתחי חדרים בבית מגורים, וכן בשערי יישובים וערים."},{"page_url":"https://pt.wikipedia.org/wiki/Charles_Wheatstone","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0d/Physiker.jpg","page_title":"Charles Wheatstone","context_page_description":"Charles Wheatstone foi um cientista britânico.\\nInventor de muitas das inovações científicas da era vitoriana, incluindo a concertina inglesa, o estereoscópio, e a cifra Playfair. No entanto, Wheatstone é mais conhecido como uma das grandes figuras no desenvolvimento da telegrafia e pela ponte de Wheatstone. Embora o circuito tenha sido inventado por Samuel Hunter Christie, Wheatstone foi certamente o pioneiro na exploração do mesmo para fazer medidas de resistências."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%8E%92%E7%81%A3%E6%97%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/%E6%8E%92%E7%81%A3%E6%97%8F%E5%A4%AA%E9%BA%BB%E9%87%8C%E7%A4%BE%E6%9C%A8%E6%A7%8D.jpg","page_title":"排灣族","context_page_description":"排灣族，為臺灣原住民族。今日之族群分布區域主要橫跨中央山脈南段東、西兩側，海拔500公尺至1300公尺的山地，北起武洛溪上游大母母山一帶，向南延伸至恆春半島，另包括中央山脈東南麓與其狹長海岸地帶。行政上分屬屏東縣三地門鄉、瑪家鄉、泰武鄉、來義鄉、春日鄉、獅子鄉、牡丹鄉與滿州鄉；臺東縣達仁鄉、大武鄉、金峰鄉、太麻里鄉與臺東市新園里。"},{"page_url":"https://nl.wikipedia.org/wiki/Drommedaris_(Enkhuizen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Drommedaris_stedemaagd1_Enkhuizen.jpg","page_title":"Drommedaris (Enkhuizen)","context_page_description":"De Drommedaris is de zuidelijke toegangspoort van de stad Enkhuizen. Het is het bekendste gebouw in Enkhuizen."},{"page_url":"https://en.wikipedia.org/wiki/1983%E2%80%9384_S.L._Benfica_season","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/The_1983_Iberian_Cup_%28cropped%29.jpg","page_title":"1983–84 S.L. Benfica season","context_page_description":"The 1983–84 season was Sport Lisboa e Benfica's 80th season in existence and the club's 50th consecutive season in the top flight of Portuguese football, covering the period from 1 July 1983 to 30 June 1984. Benfica competed domestically in the Primeira Divisão, Taça de Portugal and the Supertaça Cândido de Oliveira, and participated in the European Cup after winning the previous league. They also played in the Iberian Cup with the La Liga winners, Athletic Bilbao.\\nIn the second year of Eriksson at Benfica, he lost João Alves and Frederico Rosa but hired António Oliveira and Michael Manniche. Benfica started the season by winning the Portuguese Cup Final of the past season and the Iberian Cup. In the league, Benfica started strong until their drop points in October. A home win against Porto propelled them into first place, which they never lost. Twelve consecutive wins followed until they were stopped in February. In March, Benfica was knocked out of Europe and lost for the first time in the league. They reacted with five wins and a draw in the next month, before losing for a second time in late April."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%B4%D0%B6%D0%B0%D1%80%D1%96%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Aslan_Abaschidse.jpg","page_title":"Аджарія","context_page_description":"Аджа́рська автоно́мна респу́бліка, Аджарія, Аджара — автономний регіон у складі Грузії, розташований на південному заході Грузії, на узбережжі Чорного моря."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%BE%D8%B1%DB%8C%D9%84%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Perylene-LongWaveUV.png","page_title":"پریلن","context_page_description":"پریلن یک هیدروکربن آروماتیک چندحلقه‌ای با شناسه پاب‌کم ۹۱۴۲ است. شکل ظاهری این ترکیب، جامد قهوه‌ای است."},{"page_url":"https://es.wikipedia.org/wiki/Volkswagen_W12","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/2008-07-12_Volkswagen_W12_Syncro_Concept_Goodwood.jpg","page_title":"Volkswagen W12","context_page_description":"El Volkswagen W12 fue un prototipo de automóvil Superdeportivo creado por la fábrica alemana Volkswagen en 1997."},{"page_url":"https://en.wikipedia.org/wiki/Blaan_people","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/T%27nalak_Festival_B%27laan.jpg","page_title":"Blaan people","context_page_description":"The Blaan people, alternatively spelled as \\"B'laan,\\" are one of the indigenous peoples of Southern Mindanao in the Philippines. Their name could have derived from \\"bla\\" meaning \\"opponent\\" and the suffix \\"an\\" meaning \\"people.\\" Other terms used to refer to this group are Blaan, Bira-an, Baraan, Vilanes, and Bilanes."},{"page_url":"https://io.wikipedia.org/wiki/2016","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Muhammad_Ali_1966.jpg","page_title":"2016","context_page_description":"Un dio en la Interreto ye 2016: 36.000.000 kompri en Amazon, 152.000.000 Skype-telefoni, 186.000.000 Instagram-fotografuri, 803.000.000 Tweet-i, 4.200.000.000 Google-serchi, 8.800.000.000 spektita Youtube-videi, 207.000.000.000 sendita e-posti."},{"page_url":"https://et.wikipedia.org/wiki/Abrahami_j%C3%A4rv","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/LakeAbrahamPan1.jpg","page_title":"Abrahami järv","context_page_description":"Abrahami järv on tehisjärv Kanadas Alberta provintsi lääneosas Clearwateri maakonnas Põhja-Saskatchewani jõel.\\nJärve geograafilised koordinaadid on 52° 13′ 25″ N, 116° 25′ 38″ W.\\nAbrahami järve suurim pikkus põhja-lõunasuunas on 32 km ja suurim laius 3,3 km. Järve pindala on 53,7 km². Veepind on 1340 meetri kõrgusel merepinnast.\\nJärv rajati 1972. aastal Põhja-Saskatchewani jõe ülemjooksule Kaljumäestiku orgu seoses Bighorni paisu ja hüdroelektrijaama ehitamisega.\\nAbrahami järv on tähelepanu äratanud erakordsete jääaluste metaanimullidega, mida on täheldatud ka paljudes teistes arktilistes järvedes. Mullid moodustuvad igikeltsa sulamisel maakoorest vabanevast metaanist."},{"page_url":"https://hu.wikipedia.org/wiki/Feny%C5%91_lombj%C3%A1r%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Pine_Warbler_-_female.jpg","page_title":"Fenyő lombjáró","context_page_description":"A fenyő lombjáró a madarak osztályának verébalakúak rendjébe és az újvilági poszátafélék családjába tartozó faj."},{"page_url":"https://de.wikipedia.org/wiki/Berwangen","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Berwangen-exrathaus2009.JPG","page_title":"Berwangen","context_page_description":"Berwangen ist ein Dorf mit etwa 1400 Einwohnern im Landkreis Heilbronn in Baden-Württemberg, das seit 1971 zur Gemeinde Kirchardt gehört."},{"page_url":"https://fr.wikipedia.org/wiki/Memphis_(%C3%89gypte)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Kolosstatue_Ramses_II_Memphis.jpg","page_title":"Memphis (Égypte)","context_page_description":"Memphis était la capitale du premier nome de Basse-Égypte, le nome de la Muraille blanche. Ses vestiges se situent près des villes de Mit-Rahineh et d'Helwan, au sud du Caire.\\nLa légende, rapportée par Manéthon, raconte que Memphis fut fondée par le roi Ménès vers -3000. Capitale de l’Égypte durant tout l’Ancien Empire, elle est restée une cité importante tout au long de l'histoire égyptienne, placée sous la protection du dieu Ptah, le patron des artisans dont le temple était l’Hout-ka-Ptah. C'est de ce terme, qualifiant la maison du dieu, que serait dérivé en grec le mot aegyptus prototype du nom du pays en latin.\\nLa ville occupe une place stratégique à l’entrée du delta du Nil et de ce fait regorge d’ateliers et de manufactures, notamment d’armes qui étaient conservées dans de grands arsenaux non loin du port principal de la ville, le Perou Nefer, dont les textes du Nouvel Empire vantent l’activité fébrile.\\nSon histoire est étroitement liée à celle du pays et sa ruine est due, d’abord, à la perte de son rôle économique à la fin de l’Antiquité et la montée d’Alexandrie, puis à l’abandon de ses cultes à la suite de l’édit de Thessalonique."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Naturschutzgebiete_in_Sachsen-Anhalt","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Oranienbaumer_Heide_k3.jpg","page_title":"Liste der Naturschutzgebiete in Sachsen-Anhalt","context_page_description":"Diese sortierbare Liste enthält die Naturschutzgebiete in Sachsen-Anhalt. Sie machen eine Fläche von rund 67.057 ha und damit über 3 % der Landesfläche aus. Das erste Naturschutzgebiet in Sachsen-Anhalt geht auf eine Verordnung vom 25. Januar 1926 zurück."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B8%D0%B9_(%D0%91%D0%B5%D0%BB%D1%8C%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B8%D0%B9_%28%D0%91%D0%B5%D0%BB%D1%8C%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9%29.jpg","page_title":"Алексий (Бельковский)","context_page_description":"Архиепископ Алексий — епископ Русской православный церкви, архиепископ Великоустюжский и Усть-Вымский.\\nПричислен к лику святых Русской православной церкви в 2000 году."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%AD%B4%E5%8F%B2%E7%9A%84%E5%BA%AD%E5%9C%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Pompeji_um_1900_haus.jpg","page_title":"歴史的庭園","context_page_description":"歴史的庭園 が 1982 歴史的庭園保護憲章 で定義されているとおりは歴史的な建物や植物のある庭園・芸術的観点から公衆の関心を引く庭園である。\\n日本では大正11年に庭園を文化的資産として指定し保護する法律上の措置である史蹟名勝天然紀念物保存法により名勝の指定が始まり、以来かなりの歴史を有して庭園を名勝として保護する取組を行い、近現代における日本庭園史の調査研究にも一定の指標を与え、大きな影響を及ぼしてきたとされている。\\n日本では国内に所在する数ある名勝地で、文化財保護法により指定されている「名勝」は300以上を数え、そのうち庭園は200件ちかくあり、名勝全体の過半数を占めている。これら法令や条例に基づいて名勝等に指定されている庭園を一般に「文化的庭園」と称している。\\n日本において、数多く存在する歴史的庭園を国民的資産として法律に基づき保存していこうとする本格的な取り組みは大正8年4月に制定され、6月に施行された「史蹟名勝天然紀念物保存法」に始まる。その契機は明治44年の帝国議会において貴族院での「史蹟及天然紀念物保存ニ関スル建議案」と衆議院における「名所奮蹟古墳墓保護ニ関スル建議案」および「名勝地維持保存ニ関スル建議案」という3つの建議案の可決にある。\\n史蹟名勝天然紀念物保存法は全6条から成る法律で指定制度を基本とする法的・行政的措置について示しているものの、どのようなものが「指定」に値するのかについては法律の条文には示さず、その第1条において「本法ヲ適用スヘキ史蹟名勝天然紀念物ハ内務大臣之ヲ指定ス」と規定しているのみで、どのようなものがこの第1条の規定に基づいて指定されるかについては、別に「史蹟名勝天然紀念物保存要目」を定め、庭園については、その「名勝之部の要目」において、「著名ナル公園及庭園」を指定するべきものの例示として挙げている。\\nこうした歴史的な庭園の保全は、歴史的なランドマークの庭園やデザインされた景観に関連する特殊なタイプの史跡保護および保全または修復である。"},{"page_url":"https://ht.wikipedia.org/wiki/Norman_Park,_Georgie","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Norman_Park_city_hall.jpg","page_title":"Norman Park, Georgie","context_page_description":"Norman Park, Georgie se yon vil Etazini. Li sitye nan leta Georgie.\\nChèf-lye li se?\\n."},{"page_url":"https://ast.wikipedia.org/wiki/Diosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/NMMI_IMG_8966.JPG","page_title":"Diosa","context_page_description":"Una diosa ye una deidá femenina, en contraste coles deidaes masculines conocíes como \\"dioses\\". Munches relixones y cultures adoraron a dioses y, en parte, tamién esti cultu caltener hasta la dómina actual. La idea o representación conceptual d'estes deidaes, según la so área d'aición, acomuñáronse frecuentemente a la fertilidá, a la maternidá o a otres figures femenines comunes. Sicasí, esisten tamién dioses de la guerra, de la sabiduría, del mar o de la conocencia. Frecuentemente son parte d'un llargu panteón qu'inclúi los xéneros convencionales y, en dellos casos, inclusive deidaes hermafrodites."},{"page_url":"https://vec.wikipedia.org/wiki/Lign%C3%A8res","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/FranceNormandieLigneresEglise.jpg","page_title":"Lignères","context_page_description":"Lignères el xé on comun de 28 abitanti del departemento de Orne che el fa parte del rejon Normandia in Fransa."},{"page_url":"https://cs.wikipedia.org/wiki/Genesis","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Genesis-gersom-ben-mose-soncin.jpg","page_title":"Genesis","context_page_description":"Genesis, též První kniha Mojžíšova, je první knihou hebrejské i křesťanské bible. Kniha je součástí židovské Tóry, která je křesťany označována jako Pentateuch neboli Pět knih Mojžíšových, první části židovského Tanachu, křesťany označovaného Starý zákon.\\nGenesis pojednává o mytickém pojetí nejstarších dějin lidstva od stvoření světa po patriarchy Abraháma, Izáka a Jákoba. Obsahuje řadu známých příběhů, jako jsou například stvoření člověka, vyhnání z ráje, Kain a Ábel, Noe a potopa, Babylonská věž, Sodoma a Gomora, obětování syna Izáka nebo vznik dvanácti izraelských kmenů."},{"page_url":"https://de.wikipedia.org/wiki/Adrian_Sieber_(Musiker)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Adrian_Sieber_%282018%29_von_Lovebugs_bei_Radio_Pilatus.jpg","page_title":"Adrian Sieber (Musiker)","context_page_description":"Adrian Sieber ist ein Schweizer Popmusiker."},{"page_url":"https://sl.wikipedia.org/wiki/Godala","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Bowed_string_instruments_%281%29_Arrabita%2C_Rabels%2C_Violin_-_Soinuenea.jpg","page_title":"Godala","context_page_description":"Godala so glasbeni instrumenti, s katerimi ustvarjamo zvok tako, da nanje godemo z lokom, ki napete strune spravlja v nihanje oziroma v vibracijo. Ker strune s pomočjo trupa ustvarjajo zvok, spadajo godala v skupino kordofonih glasbenih instrumentov. Poleg igranja z lokom lahko na njih tudi brenkamo, v skladbah 20. stoletja po njih tudi tolčemo z roko.\\nV Evropo so godala prišla s Srednjega vzhoda v 10. stoletju. Eno najstarejših glasbil, na katero so igrali z lokom je bil rebek. Skupino godal v tujih jezikih večkrat dvoumno tolmačijo, ker je ne imenujejo po načinu izvajanja, neglede na to pa za isti izraz v orkesterski glasbi velja, da v to skupino ne prištevajo brenkal, klavirja, itd.\\nNa godala lahko igramo tudi s prsti; temu se reče pizzicato. Nihanje strune proizvaja zvok."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%B0%D1%85%D0%B0%D1%80%D0%B8%D0%B0%D1%81,_%D0%A5%D0%B5%D0%BB%D1%8C%D0%BC%D1%83%D1%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6c/Helmut_Zacharias_1965.jpg","page_title":"Захариас, Хельмут","context_page_description":"Хельмут Захариас — немецкий скрипач и композитор, создатель более 400 произведений тиражом 14 миллионов копий. Также участвовал в съемках кинофильмов, обычно играя музыкантов."},{"page_url":"https://fr.wikipedia.org/wiki/Basters","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Rehoboth_Namibia_1908.jpg","page_title":"Basters","context_page_description":"Les Basters sont les descendants des liaisons matrimoniales entre femmes africaines et colons néerlandais de la colonie du Cap.\\nIls vivent principalement en Namibie."},{"page_url":"https://fi.wikipedia.org/wiki/Eero_Saarinen","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Dulles_Airport_Terminal.jpg","page_title":"Eero Saarinen","context_page_description":"Eero Saarinen oli suomalais-yhdysvaltalainen arkkitehti. Hän loi näyttävän uran arkkitehtina ja huonekalusuunnittelijana. Toisen maailmansodan aikana Saarinen työskenteli CIA:n edeltäjälle Office of Strategic Servicesille suunnitellen rakennuksia ja tiloja, mm. Valkoisen talon \\"sotahuoneen\\"."},{"page_url":"https://ca.wikipedia.org/wiki/Shigel%C2%B7la","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Shigella_stool.jpg","page_title":"Shigel·la","context_page_description":"Les shigel·les són eubacteris gramnegatius, no mòbils i no formadors d'espores propers a E. coli i a salmonel·la. Són l'agent causant de la shigel·losi en humans. També causen malalties en els altres primats, però no en la resta de mamífers."},{"page_url":"https://ca.wikipedia.org/wiki/C%C3%A9dric_Sorhaindo","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/C%C3%A9dric_Sorhaindo.JPG","page_title":"Cédric Sorhaindo","context_page_description":"Cédric Sorhaindo és un jugador d'handbol francès. Va participar en la selecció francesa que va guanyar la medalla d'or al Campionat del món de 2009 a Croàcia, i també vencé amb la seva selecció als Jocs Olímpics d'estiu de 2012.\\nLa temporada 2013-2014, va guanyar cinc títols amb el FC Barcelona, en un gran any en què l'equip només no va poder guanyar la Copa d'Europa, i a la Lliga ASOBAL va guanyar tots 30 partits disputats, amb un nou rècord de gols, 1146."},{"page_url":"https://de.wikipedia.org/wiki/Leichtathletik-Weltmeisterschaften_2015/100_m_der_M%C3%A4nner","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Andre_De_Grasse_Rio_2016.jpg","page_title":"Leichtathletik-Weltmeisterschaften 2015/100 m der Männer","context_page_description":"Der 100-Meter-Lauf der Männer bei den Leichtathletik-Weltmeisterschaften 2015 fand am 22. und 23. August 2015 in Peking, Volksrepublik China, statt.\\nUsain Bolt gewann den Wettbewerb in 9,79 s. Für ihn war es nach 2009 und 2013 der dritte WM-Triumph im 100-Meter-Lauf."},{"page_url":"https://uk.wikipedia.org/wiki/Renault_Twingo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Renault_Twingo_%28II%2C_Facelift%29_%E2%80%93_Frontansicht%2C_3._M%C3%A4rz_2012%2C_Ratingen.jpg","page_title":"Renault Twingo","context_page_description":"Renault Twingo - міський автомобіль особливо малого класу французької компанії Renault. Вперше був представлений на Паризькому автосалоні в жовтні 1992 року. Продажі стартували в 1993 році. Влітку 2007 року почався випуск другого покоління Рено Твінго.\\nНазва Твінго є контамінацією слів твіст, свінг та танго і відображає динамічний і веселий характер автомобіля."},{"page_url":"https://nn.wikipedia.org/wiki/Frank_Lloyd_Wright","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Frank_Lloyd_Wright_LC-USZ62-36384.jpg","page_title":"Frank Lloyd Wright","context_page_description":"Frank Lloyd Wright var ein framståande arkitekt og formgjevar i USA på første halvdelen av 1900-talet. Wright var ein nyskapande modernist som hadde stor innverknad i heimlandet, der dei fleste bygningane hans er, og elles. Wright var ein føregangsmann innan organisk arkitektur, spel med linjer og var mellom dei første som laga opne innelandskap og brukte ubehandla materiale og jernbetong. Han er særleg kjend for «Prairie-stilen», ei form for utstrekte, asymmetriske hus som danna grunnlag for utforminga av amerikanske bustadhus på 1900-talet."},{"page_url":"https://cs.wikipedia.org/wiki/Lu_Jan-sun","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Yen-hsun-lu.png","page_title":"Lu Jan-sun","context_page_description":"Lu Jan-sun je současný tchajwanský profesionální tenista. Ve své dosavadní kariéře vyhrál na okruhu ATP World Tour 2 turnaje ve čtyřhře. Nejvýše byl ve dvouhře umístěn 1. listopadu 2010 na 33. místě a ve čtyřhře 31. ledna 2005 na 86. místě žebříčku ATP."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Pistolen","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Walther%27s_Patent_Mod_9-102.jpg","page_title":"Liste von Pistolen","context_page_description":"Dies ist eine unvollständige Liste von Pistolen. In die Liste werden nur seriengefertigte Pistolen aufgenommen, mit denen Patronenmunition verschossen wird.\\nHinweis: Eine Übersicht von Handfeuerwaffen A bis Z findet sich in der Liste der Handfeuerwaffen."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%90%E1%83%9A%E1%83%9F%E1%83%98%E1%83%A0%E1%83%98_(%E1%83%A5%E1%83%90%E1%83%9A%E1%83%90%E1%83%A5%E1%83%98)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Makamelchahid.JPG","page_title":"ალჟირი (ქალაქი)","context_page_description":"ალჟირი, ელ-ჯაზაირი — ალჟირის დედაქალაქი და უმსხვილესი ქალაქი, მდებარეობს ხმელთაშუა ზღვის ნაპირას. ქალაქის სახელწოდება მომდინარეობს „ელ-ჯაზაირიდან“ რაც არაბულად ნიშნავს კუნძულს. შუა საუკუნეებში ქალაქის მახლობლად მდებარეობდა 4 კუნძული, რომლებიც 1525 წელს გახდნენ მატერიკის ნაწილები. თავის მხრივ, სახელწოდება ალ-ჯაზაირ არის ქალაქის ძველი სახელის აბრევიატურა. არაბულ. جزائر بني مزغانة ჯაზაირ ბნი მაზღანა, რომელსაც იყენებდნენ\\nშუასაუკუნეების გეოგრაფი, როგორიცაა ალ-იდრისი და იაკუტ ალ-ჰამავი.\\nმოსახლეობა — 2,988,145 ადამიანი იყო 2008 წლის აღწერით და 2011 წელს 3,500,000-ს მიაღწია.\\nქალაქის თანამედროვე ნაწილი ხმელთაშუა ზღვის სანაპიროს მიჰყვება, ძველი ნაწილი კი ციცაბო ბორცვზეა შეფენილი, რომლის თავზე, 140 მ ზღვის დონიდან, მდებარეობს ციტადელი. ციტადელი და ორი ნავსაყუდელი ქალაქის სამკუთხედს ქმნის."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Haselbachtal","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Steindeckerbr%C3%BCcke_VI_Haselbach_2020-05-16_4.jpg","page_title":"Liste der Kulturdenkmale in Haselbachtal","context_page_description":"In der Liste der Kulturdenkmale in Haselbachtal sind die Kulturdenkmale der sächsischen Gemeinde Haselbachtal verzeichnet, die bis August 2017 vom Landesamt für Denkmalpflege Sachsen erfasst wurden. Die Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale im Landkreis Bautzen."},{"page_url":"https://en.wikipedia.org/wiki/Groups_of_Traditional_Buildings","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/88/Unomachi_town_b.jpg","page_title":"Groups of Traditional Buildings","context_page_description":"Groups of Traditional Buildings is a Japanese category of historic preservation introduced by a 1975 amendment of the law which mandates the protection of groups of traditional buildings which, together with their environment, form a beautiful scene. They can be post towns, castle towns, mining towns, merchant quarters, ports, farming or fishing villages, etc. The Japanese government's Agency for Cultural Affairs recognizes and protects the country's cultural properties under the Law for the Protection of Cultural Properties.\\nMunicipalities can designate items of particular importance as Preservation Districts for Groups of Traditional Buildings and approve measures to protect them. Items of even higher importance are then designated Important Preservation Districts for Groups of Traditional Buildings by the central government. The Agency for Cultural Affairs then provides guidance, advice, and funds for repairs and other work. Additional support is given in the form of preferential tax treatment.\\nAs of October 19, 2019, 120 districts have been classified as Important Preservation Districts for Groups of Traditional Buildings."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%A5%9E%E6%88%B8%E5%B8%82%E7%AB%8B%E5%8D%9A%E7%89%A9%E9%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/ja/c/c3/%E6%A1%9C%E3%83%B6%E4%B8%9810%E5%8F%B7%E9%8A%85%E9%90%B8.JPG","page_title":"神戸市立博物館","context_page_description":"神戸市立博物館は、神戸市中央区京町にある人文科学系博物館である。2020年現在の館長は大谷幸正。"},{"page_url":"https://en.wikipedia.org/wiki/Yitro_(parsha)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/75/Fjellstedt_Br%C3%A4nnoffer-altaret.jpg","page_title":"Yitro (parsha)","context_page_description":"Yitro, Yithro, Yisroi, Yisrau, or Yisro is the seventeenth weekly Torah portion in the annual Jewish cycle of Torah reading and the fifth in the Book of Exodus. The parashah tells of Jethro's organizational counsel to Moses and God's revelation of the Ten Commandments to the Israelites at Mount Sinai.\\nThe parashah constitutes Exodus 18:1–20:23. The parashah is the shortest of the weekly Torah portions in the Book of Exodus, and is made up of 4,022 Hebrew letters, 1,105 Hebrew words, and 75 verses.\\nJews read it the seventeenth Sabbath after Simchat Torah, generally in January or February. Jews also read part of the parashah, Exodus 19:1–20:23, as a Torah reading on the first day of the Jewish holiday of Shavuot, which commemorates the giving of the Ten Commandments."},{"page_url":"https://gl.wikipedia.org/wiki/Nicole_Le_Douarin","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Nicole_Marthe_Le_Douarin%2C_2013_%28cropped%29.jpg","page_title":"Nicole Le Douarin","context_page_description":"Nicole Le Douarin, nada en Lorient o 20 de agosto de 1930, é unha investigadora francesa en bioloxía e embrioloxía."},{"page_url":"https://ca.wikipedia.org/wiki/Capella_de_la_Resurrecci%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Chapelle_de_la_R%C3%A9surrection_fa%C3%A7ade_detail.JPG","page_title":"Capella de la Resurrecció","context_page_description":"La Capella de la Resurrecció és una església catòlica amb clara vocació ecumènica, situada al cor del barri de les institucions europees de Brussel·les. L'edifici és del segle xv, i es trobava originàriament al centre de la ciutat. Per causa d'un desenvolupament urbanístic, el 1907 es va traslladar al seu emplaçament actual. L'any 2001, després d'una renovació molt important, l'església va rebre el seu nom actual i la seva orientació ecumènica. La responsabilitat pastoral de la capella es va encomanar a la Companyia de Jesús."},{"page_url":"https://tr.wikipedia.org/wiki/Domodedovo_(%C5%9Fehir)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/da/Blick_%C3%BCber_Domodedowo.jpg","page_title":"Domodedovo (şehir)","context_page_description":"Domodedovo, Rusya'nın Moskova Oblastı'nda bulunan bir şehirdir. Şehir, Moskova'nın 37 km güneyinde yer almaktadır. Yüzölçümü 159.27 km² olan şehrin nüfusu 2010 yılı itibarı ile 96,145'tir.\\nDomodedovo Havalimanı, şehrin birkaç kilometre uzağında yer almaktadır."},{"page_url":"https://eo.wikipedia.org/wiki/Burgfrido","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Burg_Vilsegg_Bergfried.jpg","page_title":"Burgfrido","context_page_description":"La ĉefa turo aŭ burgfrido estis la neloĝata centra turo de mezepoka burgo. Ekde la 12a jarcento ĝi aperis ĉie ajn en Mezeŭropo. Ĝi ankaŭ povas esti loĝata loĝturo."},{"page_url":"https://sv.wikipedia.org/wiki/Gul_skogss%C3%A5ngare","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Dendroica_petechia4.jpg","page_title":"Gul skogssångare","context_page_description":"Gul skogssångare är en mycket karakteristisk och vida spridd amerikansk fågel i familjen skogssångare inom ordningen tättingar. Vissa urskiljer de sydliga populationerna som en egen art, mangroveskogssångare."},{"page_url":"https://it.wikipedia.org/wiki/Codex_Petropolitanus_(Nuovo_Testamento)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Codex_Petropolitanus_fols._164v-165r.jpg","page_title":"Codex Petropolitanus (Nuovo Testamento)","context_page_description":"Il Codex Petropolitanus è un manoscritto onciale del Nuovo Testamento, datato paleograficamente al IX secolo."},{"page_url":"https://ca.wikipedia.org/wiki/Flora_de_les_Illes_Balears","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/99/Ullastrar_menorqu%C3%AD.JPG","page_title":"Flora de les Illes Balears","context_page_description":"La flora de les Illes Balears és el conjunt de vegetació que es troba a les illes Balears. Els boscos característics en són la pineda i l'alzinar, i l'ullastrar menorquí."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B8%D0%B5%D0%BB%D1%8C%D0%B3%D0%BE%D1%80%D1%81%D0%BA%D0%B8%D0%B9,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%AE%D1%80%D1%8C%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Michal_Wielhorski.jpg","page_title":"Виельгорский, Михаил Юрьевич","context_page_description":"Граф Михаи́л Ю́рьевич Виельго́рский — русский музыкальный деятель и композитор-любитель польского происхождения, старший брат Матвея Виельгорского, отец Иосифа Виельгорского."},{"page_url":"https://nl.wikipedia.org/wiki/Trichopodus_leerii","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Trichopodus_leerii.jpg","page_title":"Trichopodus leerii","context_page_description":"Trichopodus leerii is een straalvinnige vissensoort uit de familie van de echte goerami's. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1852 door Bleeker."},{"page_url":"https://is.wikipedia.org/wiki/Rysy","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ad/Rysy%2C_wierzcholek_slowacki.jpg","page_title":"Rysy","context_page_description":"Rysy er fjall í Tatra-fjöllum á mörkum Slóvakíu og Póllands. Fjallið hefur þrjá tinda og er sá hæsti 2.503 metrar. Norðvesturtindurinn er hæsti punktur Póllands tveir eru í Slóvakíu. Fyrsta þekkta ganga á fjallið varð árið 1840."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%96%E3%83%A9%E3%83%88%E3%83%AB%E3%83%9C%E3%83%AD_(%E3%83%90%E3%83%BC%E3%83%A2%E3%83%B3%E3%83%88%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Municipal_Center_Brattleboro.jpg","page_title":"ブラトルボロ (バーモント州)","context_page_description":"ブラトルボロは、アメリカ合衆国バーモント州ウィンダム郡の町である。州の南東部にあり、ニューハンプシャー州との州境に接している。人口は2010年国勢調査で12,049 人だった。コネチカット川に沿い、ウェスト川が合流する地点にある。\\nブラトルボロはバーモント州最古の町であり、その活発な芸術の社会で知られている。町内には精神科病院であり、回復期センターとして定評あるブラトルボロ・リトリートがあり、またマールボロ・カレッジ・センター・フォー・グラデュエイト・アンド・プロフェッショナル・スタディーズと、国際教育機関であるSITグラデュエイト・インスティチュートという、2つの大学院大学がある。"},{"page_url":"https://ca.wikipedia.org/wiki/Paolo_Costoli","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/PaoloCostoli.jpg","page_title":"Paolo Costoli","context_page_description":"Paolo Costoli va ser un nadador, jugador de waterpolo i entrenador italià."},{"page_url":"https://en.wikipedia.org/wiki/Southampton_Street,_London","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Clock_in_Southampton_Street_WC2_-_geograph.org.uk_-_1276671.jpg","page_title":"Southampton Street, London","context_page_description":"Southampton Street is a street in central London, running north from the Strand to Covent Garden Market.\\nThere are restaurants in the street such as Bistro 1\\nand Wagamama. There are also shops\\nsuch as The North Face outdoor clothing shop."},{"page_url":"https://nl.wikipedia.org/wiki/Florence_and_the_Machine","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Florence_and_the_Machine_%2822117304699%29.jpg","page_title":"Florence and the Machine","context_page_description":"Florence and the Machine is een Britse band geformeerd rond zangeres en frontvrouw Florence Welch. De muziek kan het beste worden omschreven als door soul geïnspireerde indie."},{"page_url":"https://fr.wikipedia.org/wiki/Pascal_Quoirin","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Grandes-Orgues%2C_Notre-Dame_de_Paris.jpg","page_title":"Pascal Quoirin","context_page_description":"Pascal Quoirin est un facteur d'orgue français installé dans le Vaucluse. Il a restauré de nombreux orgues historiques et construit des instruments neufs. Il a été consulté à la suite de l'incendie de Notre-Dame de Paris."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%9B%E0%B8%AD%E0%B9%82%E0%B8%95%E0%B9%80%E0%B8%9F%E0%B8%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Vlaamse_Hutsepot.jpg","page_title":"ปอโตเฟอ","context_page_description":"ปอโตเฟอ เป็นสตูเนื้อแบบฝรั่งเศส เชฟแรมง บล็อง กล่าวว่า ปอโตเฟอเป็นอาหารที่มีชื่อเสียงที่สุดในประเทศฝรั่งเศส"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%95%E3%82%A7%E3%83%AA%E3%83%BC%E3%81%97%E3%81%BE%E3%82%93%E3%81%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/%E3%83%95%E3%82%A7%E3%83%AA%E3%83%BC%E3%81%97%E3%81%BE%E3%82%93%E3%81%A8.jpg","page_title":"フェリーしまんと","context_page_description":"フェリーしまんとは、オーシャントランスが運航するフェリー。"},{"page_url":"https://az.wikipedia.org/wiki/Pirsinq","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Biigabe1.jpg","page_title":"Pirsinq","context_page_description":"Pirsinq – bədən modifikasiyasının bir forması, bədənin bir sıra yerlərində deşiyin yaradılması və oraya bəzək və ya zinət əşyalarının taxılması.\\nPirsinqin edilməsi və ya edilməməsinin bir çox səbəbi ola bilər. Bir sıra insanlar pirsinqi dini və ya mənəvi səbəblərdən, digərləri isə özünüifadə ehtiyacı ilə, estetik dəyərlərlə, öz seksual həyəcanlarını yaxşılaşdırmaqla, özünü hərhansısa bir submədəniyyətə aid etməsi və ya ona etirazı ilə tənzimlənir. Təhsil müəssisələri, işəgötürənlər və dini icmalar adətən pirsinqin geyinilməsini məhdudlaşdırırlar. Bir sıra insanlar isə pirsinqin ekstremal növlərini praktikada işlədirlər. Ginnesin Rekordlar Kitabında, bədənində yüzlərlə və hətta minlərlə pirsinq deşiklərinə sahib olan insanların adları qeyd edilib.\\nƏslində pirsinq – invaziv prosedurdur və pirsinq zamanı bədəndə allerqik reaksiya, kəsik və ya çapıq izlərinin yaranması və ümumilikdə orqanizmin görünmədən reaksiya ehtimalı böyükdür. Ancaq müasir qaydalar və ehtiyat kimi tibbi tədbirlər yuxarıda adı çəkilən risklərin yaranmasını minimuma salır."},{"page_url":"https://fr.wikipedia.org/wiki/Cath%C3%A9drale_de_Berlin","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/View_from_Humboldtbox_-_Berlin_Cathedral.jpg","page_title":"Cathédrale de Berlin","context_page_description":"La cathédrale de Berlin est l'église principale protestante historique de Berlin située sur l'île aux Musées à Berlin-Mitte. Traduit en français comme cathédrale, l'église n'est pas une cathédrale dans le sens strict du mot car elle n'a jamais été le siège d'un évêché."},{"page_url":"https://en.wikipedia.org/wiki/Saborsko_massacre","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Map_5_-_Croatia_-_Banija-Kordun-Lika_Operations_October_1991_-_January_1992.jpg","page_title":"Saborsko massacre","context_page_description":"The Saborsko massacre was the killing of 29 Croat residents of the village of Saborsko on 12 November 1991, following the seizure of the village in a Yugoslav People's Army and Croatian Serb offensive during the Croatian War of Independence. The fall of the town occurred as part of a JNA and Croatian Serb operation to capture a Croatian-held pocket centered on the town of Slunj, southeast of Karlovac. While the bulk of the civilian population fled with the surviving Croatian forces, those who remained in Saborsko were rounded up and either killed or expelled. The bodies of the victims were retrieved from two mass graves and several individual graves in 1995.\\nThe capture of Saborsko and the killing and expulsion of its civilian population was included in the International Criminal Tribunal for the former Yugoslavia indictments of Milan Babić and Milan Martić, high-ranking officials of the Croatian Serb-declared wartime breakaway region of SAO Krajina. Following the war, the ICTY convicted Babić and Martić for their role in the events. Saborsko was subsequently rebuilt."},{"page_url":"https://simple.wikipedia.org/wiki/Irina_Ratushinskaya","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Evstafiev-Irina_Ratushinskaya.jpg","page_title":"Irina Ratushinskaya","context_page_description":"Irina Borisovna Ratushinskaya was a Russian dissident, poet and writer.\\nOn September 17, 1982, Ratushinskaya was arrested for anti-Soviet agitation. In April 1983, she was convicted of \\"agitation carried on for the purpose of subverting or weakening the Soviet regime\\", sentenced to seven years in a labor camp followed by five years of internal exile. She was released on October 9, 1986, on the eve of the summit in Reykjavík, Iceland between President Ronald Reagan and Mikhail Gorbachev.\\nRatushinskaya died on 5 July 2017 in Moscow of cancer at the age of 63."},{"page_url":"https://pt.wikipedia.org/wiki/Ansaldo_SVA","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ec/Ansaldo_S.V.A.5.jpg","page_title":"Ansaldo SVA","context_page_description":"O Ansaldo SVA era uma aeronave biplana monomotora italiana de reconhecimento armada da Primeira Guerra Mundial. Foi projetada inicialmente como caça, mas apesar de muito veloz para a época, possuía baixa manobrabilidade, sendo empregada para reconhecimento e bombardeio leve. Seu primeiro voo ocorreu em 1917. Recebeu a nomenclatura SVA em homenagem a seus projetistas, Savoia e Verduzio, e seu fabricante, Ansaldo. Continuou em fabricação após a guerra, totalizando 1.245 aeronaves produzidas.\\nA Marinha do Brasil operou duas aeronaves com flutuadores, denominadas ISVA, entre 1919 e 1921 como treinadores avançados. Outros 18 exemplares do modelo SVA 10 foram recebidos em 1923 e operaram até 1928. Esta variante era de pouso terrestre, tendo motor mais potente de 250 HP e asas mais largas, foi empregado para observação."},{"page_url":"https://nl.wikipedia.org/wiki/NGC_5450","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/NGC5450_-_SDSS_DR14.jpg","page_title":"NGC 5450","context_page_description":"NGC 5450 is een deel van het sterrenstelsel Messier 101 in het sterrenbeeld Grote Beer. Het hemelobject werd op 27 april 1851 ontdekt door de Ierse astronoom William Parsons."},{"page_url":"https://lv.wikipedia.org/wiki/Guano_Apes","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Guano_Apes.jpg","page_title":"Guano Apes","context_page_description":"Guano Apes ir alternatīvā roka grupa no Getingenas Vācijā. Tā tika izveidota 1994. gadā un bija no komerciāli veiksmīgākajām 1990. gadu crossover grupām, kas apvienoja rokmūziku ar smago metālu un repošanu. 2005. gadā grupa uz laiku izjuka, bet 2009. gadā atkalapvienojās."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D1%8D%D1%81%D1%82%D0%B5%D1%80-%D0%A0%D0%BE%D1%81%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Loch_Ewe_from_Drumchork.jpg","page_title":"Уэстер-Росс","context_page_description":"Уэстер-Росс — является частью традиционного графства Росс-Шир, которая находится к западу от водораздела. Росс-Шир позже стал частью района Росс и Кромарти, который, в свою очередь, является частью Хайленда. С течением времени границы Уэстер-Росса менялись, поэтому несмотря на то, что название Уэстер-Росс широко используется, точная географическая область для его применения остаётся неясной.\\nНаселение Уэстер-Росса чуть больше 6000 человек, проживающих в небольшом городе Аллапул, восьми деревнях и множество мелких поселений и ферм. Тот факт, что Уэстер-Росс в основном мало обитаем, для некоторых людей делает его привлекательным местом для отдыха.\\nХотя Уэстер-Росс и является популярным местом туризма, с 1970 года его уровень значительно снизился. Туризм по-прежнему является важной частью экономической деятельности Уэстер-Росса, в связи с аналогичным снижением уровня второй важной экономической деятельности — рыболовства. В Уэстер-Россе имеется ряд живописных мест, включая побережье северного моря, озеро Лох Мари, сад Инвери, ущелье Коришалок, долину Догерти и перевал Bealach na Bà и др. Кроме того, в этом районе много различных гор."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%B3%DB%8C%D9%86_%D9%81%DB%8C%D9%88%DA%AF%D9%88%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/%C3%89dificeCienfuegos.JPG","page_title":"سین فیوگوس","context_page_description":"سین فیوگوس ایک شہر ہے جو کیوبا میں واقع ہے۔ اس کی مجموعی آبادی 164,924 افراد پر مشتمل ہے، یہ سینفویگوس صوبہ میں واقع ہے۔"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D1%96%D0%B4%D0%BD%D0%B8%D0%B9_%D1%8F%D1%80_(%D0%A5%D0%B0%D1%80%D0%BA%D1%96%D0%B2)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/%D0%9B%D1%96%D0%B4%D0%BD%D0%B8%D0%B9_%D1%8F%D1%80_%28%D0%A5%D0%B0%D1%80%D0%BA%D1%96%D0%B2%29.JPG","page_title":"Лідний яр (Харків)","context_page_description":"Лідний яр — балка довжиною більше 7 км з крутими схилами в місті Харкові. Розділює навпіл селище Лідне, відокремлює Липовий гай від місцевості Перемога, Нову Баварію від місцевості Місто Донець та Покотилівки, яка вже за межами Харкова."},{"page_url":"https://de.wikipedia.org/wiki/Eisenhut","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Aconitum_columbianum.jpg","page_title":"Eisenhut","context_page_description":"Die Pflanzengattung Eisenhut, auch Sturmhut, Akonit, früher auch Wolfswurz genannt, gehört zur Familie der Hahnenfußgewächse.\\nDie Bezeichnung Eisenhut leitet sich von der helmartigen Blütenform ab. Der Blaue Eisenhut wurde 2005 zur Giftpflanze des Jahres gewählt."},{"page_url":"https://it.wikipedia.org/wiki/Barletta","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d8/Barletta_Chiesa_di_San_Giacomo_Fronte.jpeg","page_title":"Barletta","context_page_description":"Barletta è un comune italiano di 94 316 abitanti, co-capoluogo insieme ad Andria e Trani della provincia di Barletta-Andria-Trani in Puglia.\\nIl territorio comunale fa parte del bacino della valle dell'Ofanto e, oltre a essere bagnato dall'omonimo fiume, che funge amministrativamente come confine territoriale tra Barletta e Margherita di Savoia, ne ospita anche la foce.\\nIl comune di Barletta, che comprende la frazione di Canne, sito archeologico ricordato per la storica battaglia vinta nel 216 a.C. da Annibale, è stato riconosciuto come città d'arte dalla Regione Puglia nel 2005 per le sue bellezze architettoniche."},{"page_url":"https://sv.wikipedia.org/wiki/Delphinium_bicolor","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Delphiniumbicolor.jpg","page_title":"Delphinium bicolor","context_page_description":"Delphinium bicolor är en ranunkelväxtart. Delphinium bicolor ingår i släktet storriddarsporrar, och familjen ranunkelväxter."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A5%D0%B0%D0%B4%D0%B6%D0%B8_%D0%A5%D0%B0%D1%81%D0%B0%D0%BD_%D0%BC%D0%B0%D1%85%D0%B0%D0%BB%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Plovdiv%2C_Hadji_Hasan_Mahala.jpg","page_title":"Хаджи Хасан махала","context_page_description":"Хаджи Хасан махала е един от най-старите квартали в Пловдив. Разположен е в централната част на града, между Понеделник пазар, Стария град, площад Шахбазян, площад Тримонциум, бул. Шести септември, бул. Мария Луиза и бул. Източен. В квартала има археологически разкопки, разкриващи част от Източната порта на античния римски град Тримонциум."},{"page_url":"https://ms.wikipedia.org/wiki/Berliner_Maschinenbau","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/BMAG.jpg","page_title":"Berliner Maschinenbau","context_page_description":"Berliner Maschinenbau AG ialah pengeluar lokomotif Jerman.\\nKilang ini diasaskan oleh Louis Victor Robert Schwartzkopff pada 3 Oktober 1852 sebagai Eisengießerei und Maschinen-Fabrik von L. Schwartzkopff di Berlin."},{"page_url":"https://hsb.wikipedia.org/wiki/Frohburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Rathaus_in_Frohburg.jpg","page_title":"Frohburg","context_page_description":"Frohburg je sakske městačko w Lipšćanskim wokrjesu. Nadeńdźe so 35 kilometrow južnje Lipska a 11 kilometrow sewjerowuchodnje Starohroda při durinskej hranicy a ma něhdźe 10.000 wobydlerjow. Přez město běži rěčka Wyhra.\\nHród Frohburg naspomni so prěni raz kónc 10. lětstotka, sydlišćo same hakle w lěće 1198 jako Vroburc a 1233 jako město. Měšćanske prawa dósta Frohburg pak hakle přez nowu saksku wustawu w lěće 1831.\\nDnja 1. januara 2018 bu susodne městačko Kohren-Sahlis zagmejnowane."},{"page_url":"https://de.wikipedia.org/wiki/Regierung_Gillard_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Catherine_King_MP_Original.jpg","page_title":"Regierung Gillard II","context_page_description":"Die Regierung Gillard II regierte Australien vom 14. September 2010 bis zum 27. Juni 2013. Es handelte sich um eine Regierung der Labor Party.\\nSeit dem 3. Dezember 2007 regierte eine Laborregierung unter Premierminister Kevin Rudd. Nach einem Rückgang der Popularität Rudds in den Meinungsumfragen, forderte ihn seine Stellvertreterin Julia Gillard heraus und wurde am 24. Juni 2010 von der Laborfraktion zur neuen Premierministerin gewählt. Bei den vorgezogenen Parlamentswahlen am 21. August 2010, verlor Labor 11 Sitze und kam nur noch auf 72 der 150 Sitze im Repräsentantenhaus. Nur mit Unterstützung von einem Abgeordneten der Grünen und drei Unabhängigen konnte Labor eine knappe Mehrheit behaupten. Julia Gillard blieb Premierministerin einer Laborregierung. Als 2013 die Popularität von Gillard sank, forderte Rudd sie heraus und wurde am 26. Juni 2013 von der Partei zum neuen Premierminister gewählt."},{"page_url":"https://en.wikipedia.org/wiki/List_of_lighthouses_in_British_Columbia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Ballenas_Islands.jpg","page_title":"List of lighthouses in British Columbia","context_page_description":"This is a list of lighthouses in the province of British Columbia, Canada."},{"page_url":"https://en.wikipedia.org/wiki/The_Appropriate_Technology_Collaborative","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Amaranth_Winnower_by_The_Appropriate_Technology_Collaborative.jpg","page_title":"The Appropriate Technology Collaborative","context_page_description":"The Appropriate Technology Collaborative is a U.S. Non-profit dedicated to designing everyday technologies for the global poor.\\nATC projects are international collaborative efforts between local grassroots organizations, local engineers and designers, university groups and individuals. Projects are inspired by local needs and interest in developing or improving technologies to make life easier for low-income communities in rural or urban areas.\\nSome ATC Projects are open to US volunteer participation. These projects inspire intercultural collaboration and mutual educational exchange as local and foreign participants share skills and knowledge on the work site. These volunteer trips aid in creating cross-cultural understanding while addressing issues surrounding poverty in the developing world. ATC projects empower local communities to decide what technology is needed, build it, use it and plan for maintenance.\\nATC also runs a women's education and social venture business incubation program called “Mayan Power and Light” in which young Mayan women study solar power installation, electrical circuits and carpentry to start their own solar businesses."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%B5%D1%81%D0%BB%D1%96_%D0%91%D0%BB%D0%B5%D0%B9%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Wesleyblakenxt.jpg","page_title":"Веслі Блейк","context_page_description":"Веслі Блейк — професійний американський реслер. Нині виступає на підготовчому майданчику NXT, де володіє поясом Чемпіона NXT у командних змаганнях.\\nУ червні 2013 року уклав угоду з WWE. Відразу після цього вирушив на підготовчий майданчик NXT. Уперше на ТБ з'явився в образі ковбоя. Це сталося 22 січня 2014. 28 січня 2015 Блейк та його командний партнер Мерфі заволоділи титулами Чемпіонів NXT у командних змаганнях."},{"page_url":"https://id.wikipedia.org/wiki/Verona","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Girolamo_Dai_Libri_-_Madonna_della_quercia_-_1533_after_-_Museo_Castelvecchio%2C_Verona_%28ITALY%29.jpg","page_title":"Verona","context_page_description":"Verona adalah sebuah kota di Sungai Adige di regione Veneto, Italia Utara, dengan populasi sekitar 265.000 penduduk dan merupakan salah satu dari 7 ibu kota provinsial regione tersebut. Verona merupakan kota munisipalitas terbesar kedua di Veneto dan terbesar ketiga di Italia Timur Laut. Wilayah metropolitan Verona meliputi area seluas 1,426 km² dan memiliki populasi 714.274 penduduk. Wilayah ini merupakan salah satu destinasi wisata utama di Italia utara berkat warisan artistik, sejumlah pameran tahunan, pertunjukan, dan operanya, misalnya pertunjukan opera musim panas skala besar di Arena Verona, sebuah amfiteater kuno yang dibangun oleh bangsa Romawi.\\nTiga drama Shakespeare menggunakan Verona sebagai latarnya: Romeo and Juliet, The Two Gentlemen of Verona, dan The Taming of the Shrew. Kota ini diberikan status Situs Warisan Dunia oleh UNESCO karena arsitektur dan struktur perkotaannya."},{"page_url":"https://pl.wikipedia.org/wiki/Miecznictwo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Messerschmidt-1568.png","page_title":"Miecznictwo","context_page_description":"Miecznictwo – wytwarzanie broni białej siecznej, takiej jak: miecze, szpady, rapiery, topory i puginały, a także oprawy tej broni. Przy wytwarzaniu broni ozdobnej lub paradnej miecznicy często współpracowali ze złotnikami. Wytwarzali i naprawiali też broń drzewcową.\\nW Polsce od XIV wieku miecznicy byli zrzeszeni w cechach, do których należeli również płatnerze, czyli wytwórcy zbroi i kolczug. Cech mieczników jest wymieniany jako jeden z ponad sześćdziesięciu cechów obecnych w Poznaniu w XVI wieku.\\nW miarę wychodzenia z użycia mieczy, w XVI wieku przeistaczali się w szabelników i tworzyli samodzielne cechy.\\nOd wieku XVIII wyodrębnili się szpadnicy.\\nW końcu XVIII wieku produkcja warsztatów broni białej została wyparta przez manufaktury.\\nW połowie wieku XIX miecznicy zostali przyłączeni do cechu rusznikarzy, szlifierzy i wytwórców narzędzi stalowych."},{"page_url":"https://it.wikipedia.org/wiki/Musei_Capitolini","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e0/Torso_Dionysos_Musei_Capitolini_MC1113.jpg","page_title":"Musei Capitolini","context_page_description":"I Musei Capitolini costituiscono la principale struttura museale civica comunale di Roma, parte del «Sistema dei musei in comune» con una superficie espositiva di 12.977 m².\\nAperti al pubblico nell'anno 1734, sotto papa Clemente XII, sono considerati il primo museo al mondo, inteso come luogo dove l'arte fosse fruibile da tutti e non solo dai proprietari. Si parla di \\"musei\\", al plurale, in quanto alla originaria raccolta di sculture antiche fu aggiunta da papa Benedetto XIV, nel XVIII secolo, la Pinacoteca, costituita da opere illustranti soggetti prevalentemente romani."},{"page_url":"https://cs.wikipedia.org/wiki/%C5%98%C3%ADmsk%C3%A9_v%C3%A1lky_v_Hisp%C3%A1nii","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Nicolas_Poussin_-_The_continence_of_Scipio_-_Google_Art_Project.jpg","page_title":"Římské války v Hispánii","context_page_description":"Římská expanze do Hispánie začala za druhé punské války koncem 3. století př. n. l. Po dobu bezmála dvou staletí sváděla římská republika urputné a krvavé boje nejprve s Kartáginci a poté s kmeny obývajícími Iberský poloostrov. Jeho ovládnutí završil teprve první římský císař Augustus v závěru 1. století př. n. l.\\nKartaginští vojevůdci z rodu Barkovců si ve 3. století př. n. l. podmanili rozsáhlé území na jihu Ibérie. Když Hannibal dobyl Saguntum, využili toho Římané jako záminky k rozpoutání druhé punské války a v roce 218 př. n. l. vylodili legie na severovýchodě Hispánie s úmyslem vyvrátit tamější kartaginskou říši. V dalších sedmi letech dosáhlo římské vojsko v čele s bratry Scipiony několika vítězství, nicméně oba posléze přišli o život. Jejich příbuzný Publius Cornelius Scipio se zmocnil významného města Nové Kartágo a vítězstvím v bitvě u Ilipy v roce 206 př. n. l. ukončil přítomnost Punů na poloostrově.\\nPřestože Kartáginci byli vypuzeni, strach z jejich návratu a touha po nerostném bohatství země přiměly Římany k tomu, aby v Hispánii setrvali. Římský senát záhy zjistil, že odlehlost hispánských území činí přímou kontrolu nad nimi nemožnou."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%84%D9%8A%D8%B3%D9%88%D8%AA%D9%88%D8%B5%D9%88%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Lesothosaurus_diagnosticus.jpg","page_title":"ليسوتوصور","context_page_description":"ليستوسورس أو ليستوصور ‏ هو ديناصور صغير عاش في العصر الجوراسي المبكر، ويُعتبر من أوائل الديناصورات، وهو صغير الحجم، كان من الحيوانات الذكية، وعداء سريع جداً. يشبه السحلية، طوله حوالي المتر، وله أربعة أقدام، ولكنه يمشى على ساقين طويلين، وله يدان قصيرتان، وبكل قدم خمسة أصابع، وذيله مدبب وطويل، ذو رقبة مرنة ورأس صغير وقصير وعيون كبيرة.\\nكان آكل نبات، ذو أسنان حادة الصالحة لطحن ألياف النبات القاسية التي تأكلها، كانت أسنانه الأمامية مدببة وحادة والأسنان الجانبية تشبه السهم، لكن نهاية فكه السفلي بدون أسنان.\\nعاش في السهول الجافة والحارة التي هي الآن جنوب القارة الأفريقية، وتواجد في أواخر العصر الترياسي وأوائل العصر الجورواسي، تقريبا قبل 208 إلى 200 مليون سنة.\\nوجدت متحجراته في ليسوتو بجنوب أفريقيا، وقد وجد الكثير من الأسنان على مقربة من المتحجرات ولكنها كانت على عمق كبير تحت الأرض، ويعتقد العلماء بأنهم لربما أن تلك المتحجرات كانت قد ماتت خلال فترة سباتها تحت الأرض للهروب من أشهر السنة الحارة، وربما سقطت الأسنان الإضافية خلال فترة السبات."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_de_Herenstraat_(Amsterdam)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Amsterdam_Herenstraat_37_-_1980.JPG","page_title":"Lijst van rijksmonumenten in de Herenstraat (Amsterdam)","context_page_description":"Een overzicht van de 20 rijksmonumenten in de Herenstraat in Amsterdam."},{"page_url":"https://en.wikipedia.org/wiki/North_Carolina%27s_congressional_districts","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Walker_Official_Photo_2017.jpg","page_title":"North Carolina's congressional districts","context_page_description":"North Carolina is currently divided into 13 congressional districts, each represented by a member of the United States House of Representatives. After the 2000 Census, the number of North Carolina's seats was increased from 12 to 13 due to the state's increase in population."},{"page_url":"https://fr.wikipedia.org/wiki/Allison_Hayes","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Allison_Hayes-Gene_Barry_in_Bat_Masterson.jpg","page_title":"Allison Hayes","context_page_description":"Mary Jane Hayes, née le 6 mars 1930 à Charleston et morte le 27 février 1977 à San Diego, est une actrice américaine, connue comme Allison Hayes."},{"page_url":"https://ca.wikipedia.org/wiki/Ferrol","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Ferrol-021.jpg","page_title":"Ferrol","context_page_description":"Ferrol és un municipi i una ciutat situada al nord de la província de la Corunya, a Galícia, capital de la comarca homònima. És el tercer municipi més poblat de la província per darrere de la Corunya i Santiago i el setè de la comunitat, amb una població de 71.232 habitants.\\nFerrol és una ciutat eminentment marítima com ho demostren la seva activitat militar naval, les seves activitats pesqueres, les drassanes o els molls del port. La ciutat es troba a la vora de la ria de Ferrol però també té una destacada façana marítima cap a l'oceà Atlàntic a la zona rural del municipi. En aquesta zona hi destaquen conegudes platges, com les de Doniños, San Xurxo o Covas, on es practiquen esports com el surf o el bodyboard."},{"page_url":"https://fr.wikipedia.org/wiki/Gare_de_Cr%C3%A9teil-Pompadour","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Gare_de_Cr%C3%A9teil-Pompadour_-_20131216_103310.jpg","page_title":"Gare de Créteil-Pompadour","context_page_description":"La gare de Créteil-Pompadour Parc Interdépartemental des Sports est une gare ferroviaire française de la ligne de Paris-Lyon à Marseille-Saint-Charles, située sur la commune de Créteil, à la hauteur du carrefour Pompadour. Cette gare, ouverte depuis le 15 décembre 2013, remplace la gare de Villeneuve-Prairie, située 800 mètres plus au sud, désormais fermée."},{"page_url":"https://fr.wikipedia.org/wiki/Arr%C3%AAt_cardiorespiratoire","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/US_Navy_040421-N-8090G-001_Hospital_Corpsman_3rd_Class_Flowers_administers_chest_compressions_to_a_simulated_cardiac_arrest_victim.jpg","page_title":"Arrêt cardiorespiratoire","context_page_description":"L'arrêt cardiorespiratoire est l'arrêt de la circulation du sang et de la respiration chez un individu. Actuellement, le terme utilisé est plutôt arrêt cardiaque ou arrêt circulatoire.\\nL'arrêt cardiaque a un pronostic catastrophique mais l'amélioration de celui-ci est principalement dépendant de la mise en place d'une chaine de soins adaptés et surtout de la réalisation immédiate par les 1ers témoins d'une réanimation adaptée par compressions thoraciques et de la mise en place d'un défibrillateur automatisé externe."},{"page_url":"https://fi.wikipedia.org/wiki/Louis_Saint-Laurent","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Louisstlaurent.jpg","page_title":"Louis Saint-Laurent","context_page_description":"Louis Stephen Saint Laurent oli kanadalainen lakimies ja Kanadan liberaalipuolueeseen kuulunut poliitikko: oikeusministeri ja oikeuskansleri vuosina 1941–1946, alahuoneen jäsen vuodesta 1942, ulkoministeri 1946–1948 sekä pääministeri 1948–1957."},{"page_url":"https://it.wikipedia.org/wiki/Specie_di_Thalictrum","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Thalictrum_dioicum.jpg","page_title":"Specie di Thalictrum","context_page_description":"La voce elenca le specie di Thalictrum più note.\\nLa seguente lista è stata compilata in base alle specie europee riconosciute come valide dalla Checklist dei Royal Botanic Garden Edinburgh.\\nNote:\\n[Pign]: specie presente nella “Flora d'Italia” di Pignatti ma non presente nella “ Flora Europaea”.\\n[FA]: specie presente nella ”Flora Alpina” di AA.VV. ma non presente nella “ Flora Europaea”.\\n[CIVF]: specie presente nella ”An annotated checklist of the Italian Vascular Flora” di AA.VV. ma non presente nella “Flora Europaea”.\\n: alcune specie extraeuropee."},{"page_url":"https://es.wikipedia.org/wiki/J%C3%ADlov%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/J%C3%ADlov%C3%A9_D%C4%9B%C4%8D%C3%ADn.png","page_title":"Jílové","context_page_description":"Jílové es una localidad del distrito de Děčín en la región de Ústí nad Labem, República Checa, con una población estimada a principio del año 2018 de 5171 habitantes.\\nSe encuentra ubicada al noreste de la región, en la ladera sur de los montes Metálicos, cerca del río Elba, de la región de Liberec y del estado alemán de Sajonia.​"},{"page_url":"https://de.wikipedia.org/wiki/Eva_Stort","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Eva_Stort.jpg","page_title":"Eva Stort","context_page_description":"Eva Stort war eine deutsche Landschaftsmalerin und Grafikerin."},{"page_url":"https://uk.wikipedia.org/wiki/Speleomantes_supramontis","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Speleomantes_supramontis01.jpg","page_title":"Speleomantes supramontis","context_page_description":"Speleomantes supramontis — вид хвостатих земноводних родини Безлегеневі саламандри."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_de_villes_d%27%C3%89rythr%C3%A9e","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Keren_-_2008-11-01.jpg","page_title":"Liste de villes d'Érythrée","context_page_description":"Ce tableau récapitule les principales villes d'Érythrée selon leur population. Le rang indiqué est celui du dernier recensement de 2000, les informations de 2004 et 2005 sont le fruit d'estimations et celles de 2012 de calculs.\\nCe tableau met en lumière la croissance urbaine de l'Érythrée dont la population ne cesse d'augmenter, les prévisions pour 2050 projettent, ainsi, une élévation de plus de 300 % de la population urbaine."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%9D%B1%E6%B5%B7%E5%A4%A7%E5%AD%B8_(%E5%8F%B0%E7%81%A3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Technological_Building_of_Tunghai_University_2011-8-9.JPG","page_title":"東海大學 (台灣)","context_page_description":"东海大学，简称东海、东大，创立于1955 年，以人文为基础，培养和发展多方面的智能与技能，是中华民国首间基督教新教背景的综合大学，也是高教发展史上第二所现代综合大学。座落于台中市西屯区大肚山山麓，校园绿荫盎然，校地面积广达135.65公顷，是私立大学中土地面积最大的学校，也是唯一进入不分公私立土地面积前10大的私立学校。东海大学也是第一所在台湾非改制升格设立且现存的重点私立大学。东海与亚马逊AWS成立云创学院及云创中心。"},{"page_url":"https://en.wikipedia.org/wiki/Fort_Lincoln_(District_of_Columbia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Fort_Lincoln_Cemetery%2C_Brentwood%2C_Maryland_016.JPG","page_title":"Fort Lincoln (District of Columbia)","context_page_description":"Fort Lincoln was one of seven temporary earthwork forts part of the Civil War Defenses of Washington, DC during the Civil War built in the Northeast quadrant of the city at the beginning of the Civil War by the Union Army to protect the city from the Confederate Army. From west to east, the forts were as follow: Fort Slocum, Fort Totten, Fort Slemmer, Fort Bunker Hill, Fort Saratoga, Fort Thayer and Fort Lincoln.\\nBattery Jamson was a large battery east of the fort overlooking the Anacostia River providing additional support."},{"page_url":"https://en.wikipedia.org/wiki/Nome-Council_Highway","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ae/Cape_Nome_Roadhouse.jpg","page_title":"Nome-Council Highway","context_page_description":"The Nome-Council Highway is a highway that runs for 71.970 miles between the communities of Council and Nome in the Nome Census Area of the Unorganized Borough in the U.S. state of Alaska. The road travels east from Nome, following the shore of the Bering Sea until it reaches the ghost town of Solomon. From there, the route travels northeast through the interior of the Seward Peninsula before it terminates on the south bank of the Niukluk River, south of Council. One of three highways traveling from Nome to surrounding communities, the highway is disconnected from the rest of the Alaska Highway System. The route is unpaved for its entire length and becomes impassable for automobiles in the winter outside of a short portion immediately outside of Nome. The portion of the road between Nome and Solomon is part of the Iditarod Trail and the highway passes several historic sites associated with the trail and the area's gold mining history.\\nThe route began as a collection of informal trails connecting Nome with mining communities established on the peninsula at the beginning of the 20th century."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%BE%D1%80%D0%BB%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Tarimbecken_3._Jahrhundert.png","page_title":"Корла","context_page_description":"Корла — місто і міський повіт у центральній частині Сіньцзян-Уйгурського автономного району Китаю, адміністративний центр Баянгол-Монгольського автономного округу. Загальна площа міського повіту — 7 116,9 км². Населення Корли становить приблизно 430 000. Корла відома своїми \\"ароматними\\" грушами."},{"page_url":"https://hu.wikipedia.org/wiki/Sigamary_Diarra","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Sigamary_Diarra.jpg","page_title":"Sigamary Diarra","context_page_description":"Sigamary Diarra mali válogatott labdarúgó, jelenleg a Valenciennes játékosa."},{"page_url":"https://es.wikipedia.org/wiki/R%C3%ADo_Miskatonic","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Housatonic_River%2C_Housatonic_MA.jpg","page_title":"Río Miskatonic","context_page_description":"El río Miskatonic es un río ficticio de Nueva Inglaterra que es mencionado en los escritos de H. P. Lovecraft. Es también el nombre de una red de drenaje conocida como el Valle del Miskatonic. La también ficticia Universidad Miskatonic, ubicada en Arkham, fue nombrada en honor de este río. El Valle del Miskatonic fue mencionado por primera vez en el cuento de Lovecraft llamado \\"La lámina de la casa\\".\\nSe dice que las comunidades ficticias de Arkham y Dunwich, Massachusetts, están localizadas sobre la rivera del río del Miskatonic. En el cuento \\"El Color que cayó del cielo\\", el narrador clama que hay una \\"pequeña isla del Miskatonic, donde el diablo concedía audiencias al lado de un extraño altar de piedra, más antiguo que los indios.\\""},{"page_url":"https://id.wikipedia.org/wiki/William_Shakespeare","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/ShakespeareMonument_cropped.jpg","page_title":"William Shakespeare","context_page_description":"William Shakespeare adalah seorang pujangga, dramawan, dan aktor Inggris, secara luas dianggap sebagai penulis drama berbahasa Inggris terhebat dan dramawan termasyhur di dunia. Ia sering disebut sebagai penyair nasional Inggris dan dijuluki \\"Pujangga dari Avon\\". Karya-karyanya yang masih ada, termasuk karya kolaborasi, terdiri dari sekitar 39 drama, 154 soneta, dua sajak naratif, dan sejumlah syair lainnya, beberapa di antaranya dengan kepenulisan yang diperdebatkan. Dramanya telah diterjemahkan ke dalam setiap bahasa hidup dan dipentaskan di panggung lebih sering daripada penulis drama lainnya.\\nShakespeare lahir dan besar di Stratford-upon-Avon, Warwickshire. Pada usia 18 tahun, ia menikah dengan Anne Hathaway, dan memiliki tiga anak: Susanna dan si kembar Hamnet dan Judith. Antara tahun 1585 dan 1592, ia memulai karier yang sukses sebagai aktor, penulis, dan pemilik perusahaan drama bernama Lord Chamberlain's Men, yang kelak berganti nama menjadi King's Men. Pada usia 49 tahun, ia pensiun dan pindah ke Stratford, tempat ia meninggal dunia tiga tahun kemudian."},{"page_url":"https://nl.wikipedia.org/wiki/Is%C3%A8re_(rivier)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2e/GrenobleMariusGontardBridge.jpg","page_title":"Isère (rivier)","context_page_description":"De Isère is een rivier in het zuidoosten van Frankrijk.\\nZij ontspringt op la Galise, nabij de col de l'Iséran, in het departement Savoie, en stroomt in de Rhône op enkele kilometers ten noorden van Valence, in het departement Drôme.\\nDepartementen en belangrijke steden liggen in het stroomgebied van de Isère, alle in de regio Auvergne-Rhône-Alpes:\\nSavoie: Bourg-Saint-Maurice, Albertville\\nIsère: Grenoble\\nDrôme: Romans-sur-Isère\\nDe belangrijkste zijrivieren zijn de Arly, de Arc, de Drac en de Bourne."},{"page_url":"https://af.wikipedia.org/wiki/Altai-gebergte","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Kazakhstan_Altay.jpg","page_title":"Altai-gebergte","context_page_description":"Die Altai-gebergte is 'n bergreeks tussen Noord-, Oos- en Sentraal-Asië, waar Rusland, die Volksrepubliek China, Mongolië en Kasakstan ontmoet, en waar die riviere Irtisj en Ob ontspring. Die bergmassief gaan in die noordooste na die Sajan-gebergte oor, en word in die suidooste geleidelik laer, waar dit die hoë plato van die Gobiwoestyn ontmoet. Dit streek van 45° tot 52° N en van 84° tot 99° O. Die Goue Berge van Altai is in 1998 deur Unesco as 'n wêrelderfenisgebied gelys.\\nDie Altai-gebergte is yl bevolk, maar beskik oor 'n etnies diverse bevolking, met etniese groepe soos Russe, Kasakke, Altai en Mongole. Die plaaslike ekonomie is gebaseer op veeteelt van onder meer beeste, skape en perde, landbou, bosbou en mynbou. Die voorgestelde en omstrede Altaïese taalfamilie is na hierdie bergreeks genoem. Daarbenewens is die Russiese deelrepubliek Altai na die Altai-gebergte genoem.\\nDie Altai-gebergte word Altain nuruu in Khalkha-Mongools, altai-yin niruɣu in Chakhar-Mongools en Altay tuular in Altaïes genoem. Dit word ook Altaı taýlary in Kasaks; Altajskije gory in Russies; Altay Taghliri in Oeigoers; ā'ěrtài shānmài in Chinees; en Arteː shanmeː in Dungaans genoem."},{"page_url":"https://fr.wikipedia.org/wiki/Terry_Kubicka","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Demonstratie_internationale_top_kunstrijden_in_Edenhal_Amerikaan_Terry_Kubicka_%2C_Bestanddeelnr_928-4696.jpg","page_title":"Terry Kubicka","context_page_description":"Terry Kubicka, né le 3 avril 1956 à Long Beach, est un patineur artistique américain."},{"page_url":"https://nl.wikipedia.org/wiki/Forcalquier_(stad)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Vue_forcalquier_2402.JPG","page_title":"Forcalquier (stad)","context_page_description":"Forcalquier is een gemeente in het Franse departement Alpes-de-Haute-Provence in de regio Provence-Alpes-Côte d'Azur die 5.018 inwoners in 2017 telde. De plaats maakt deel uit van het arrondissement Forcalquier."},{"page_url":"https://fr.wikipedia.org/wiki/Pluteus_(%C3%A9chinid%C3%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Developing_PLuteus_larva_001.png","page_title":"Pluteus (échinidé)","context_page_description":"Pluteus est le nom qu'ont donné les scientifiques au premier stade larvaire des oursins, qui est encore planctonique."},{"page_url":"https://en.wikipedia.org/wiki/Mozart_in_Italy","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Maria_Theresia_mit_Ordensband.jpg","page_title":"Mozart in Italy","context_page_description":"Between 1769 and 1773, the young Wolfgang Amadeus Mozart and his father Leopold Mozart made three Italian journeys. The first, an extended tour of 15 months, was financed by performances for the nobility and by public concerts, and took in the most important Italian cities. The second and third journeys were to Milan, for Wolfgang to complete operas that had been commissioned there on the first visit. From the perspective of Wolfgang's musical development the journeys were a considerable success, and his talents were recognised by honours which included a papal knighthood and memberships in leading philharmonic societies.\\nLeopold Mozart had been employed since 1747 as a musician in the Archbishop of Salzburg's court, becoming deputy Kapellmeister in 1763, but he had also devoted much time to Wolfgang's and sister Nannerl's musical education. He took them on a European tour between 1764 and 1766, and spent some of 1767 and most of 1768 with them in the imperial capital, Vienna. The children's performances had captivated audiences, and the pair had made a considerable impression on European society."},{"page_url":"https://no.wikipedia.org/wiki/Gustav_Adolf_stavkirke","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/HahnenkleeStabkircheNord.jpg","page_title":"Gustav Adolf stavkirke","context_page_description":"Gustav Adolf stavkirke er en stavkirke som står i Hahnenklee, i regionen Harz, Tyskland.\\nKirken er en kopi av Borgund stavkirke i Norge tilpasset for å fylle sin rolle som Hahnenklee luthersk sognekirke. Byggingen begynte i 1907, og kirken åpnet sine dører for bruk 28. juni 1908."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A7%88%EB%A6%AC%EB%84%A4%EC%9D%B4%EB%93%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Chicken_thighs_in_marinade.jpg","page_title":"마리네이드","context_page_description":"마리네이드는 식재료를 조리하기 전에 재워 두는 조미한 액체이다. 식초 등 산을 넣어 신맛이 나는 경우가 많다. 서양에서 그 단어의 기원은 바닷물의 사용에서 기인한 것으로 고대에는 바닷물로 생선 따위를 절였던 데서 착안할 수 있다. 소금에 절임으로서 물에 담가 오래 보관했던 것이다. 서구 사회에서 마리네이드로 볼 수 있는 marinade는 식초나 레몬주스, 포도주를 넣어 실 수도 있고 파인애플이나 파파야와 같은 과일 효소를 첨가해 달짝지근할 수도 있다. 액체에 담구면서 기름이나 향신료, 다른 야채를 넣어서 마리네이드로 쓰기도 한다.\\n마리네이드는 고기의 냄새를 없애어 맛을 돋우는 역할도 하며 삼겹살에 포도주를 첨가하여 발효하는 것은 맛을 부드럽고 연하게 하는 효과가 있어 식감을 높여준다. 일단 식재료를 마리네이드에 넣고 몇 시간에서 몇 일동안 저장해 두었다 쓰기도 한다. 인도 요리에서는 보통 향신료를 첨가하여 마리네이드로 쓴다."},{"page_url":"https://sv.wikipedia.org/wiki/L%C3%A5ngstreckat_gr%C3%A4smott","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Agriphila.latistria.mounted.jpg","page_title":"Långstreckat gräsmott","context_page_description":"Långstreckat gräsmott är en fjärilsart som först beskrevs av Adrian Hardy Haworth 1811. Långstreckat gräsmott ingår i släktet Agriphila, och familjen mott. Arten är reproducerande i Sverige."},{"page_url":"https://pl.wikipedia.org/wiki/%E2%80%9EModus%E2%80%9D_Przedsi%C4%99biorstwo_Odzie%C5%BCowe","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Mundur_galowy_WL_02.jpg","page_title":"„Modus” Przedsiębiorstwo Odzieżowe","context_page_description":"Modus – przedsiębiorstwo przemysłu odzieżowego w Bydgoszczy założone w 1945 roku, producent odzieży służbowej, mundurowej, biznesowej i korporacyjnej."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%BE%D1%8F%D1%80%D1%81%D0%BA%D0%BE%D0%B5_(%D0%BE%D0%B7%D0%B5%D1%80%D0%BE,_%D0%9C%D1%83%D0%B5%D0%B7%D0%B5%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/%D0%91%D0%BE%D1%8F%D1%80%D1%81%D0%BA%D0%BE%D0%B5_%28%D0%BE%D0%B7%D0%B5%D1%80%D0%BE%2C_%D0%9C%D1%83%D0%B5%D0%B7%D0%B5%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD%29_2.jpg","page_title":"Боярское (озеро, Муезерский район)","context_page_description":"Боярское — озеро на территории Ледмозерского сельского поселения Муезерского района Республики Карелии."},{"page_url":"https://lv.wikipedia.org/wiki/Artis_Gustovskis","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/12.Saeimas_deput%C4%81ts_Artis_Gustovskis_%2839628075601%29.jpg","page_title":"Artis Gustovskis","context_page_description":"Artis Gustovskis ir latviešu pedagogs, tūrisma organizators un politiķis, arī gleznotājs un fotogrāfs. Bijis 12. Saeimas deputāts, ievēlēts no partijas \\"Vienotība\\" saraksta, kurā pārstāvēja reģionālo partiju \\"Kuldīgas novadam\\". Kopš 1997. gada vairākkārt bijis Kuldīgas pašvaldības deputāts."},{"page_url":"https://en.wikipedia.org/wiki/Svanbergite","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Svanbergite_w-pyrophyllite_on_andalusite_Basic_strontium_aluminum_phosphate_Donally_Mine_near_Thorne_Minerals_County_Nevada_1879.jpg","page_title":"Svanbergite","context_page_description":"Svanbergite is a colorless, yellow or reddish mineral with the chemical formula SrAl₃(OH)₆. It has rhombohedral crystals.\\nIt was first described for an occurrence in Varmland, Sweden in 1854 and named for Swedish chemist Lars Fredrik Svanberg.\\nIt occurs in high aluminium medium-grade metamorphic rocks; in bauxite deposits and from sulfate enriched argillic alteration associated with hydrothermal systems often replacing apatite. It occurs with pyrophyllite, kyanite, andalusite, lazulite, augelite, alunite, kaolinite and quartz."},{"page_url":"https://cs.wikipedia.org/wiki/Ketoprofen","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Ketoprofen-ES452500-1977.png","page_title":"Ketoprofen","context_page_description":"Ketoprofen je chemická látka ze skupiny fenylpropanových kyselin. Je to farmaceuticky účinná látka, patřící mezi nesteroidní protizánětlivá léčiva s analgetickými a antipyretickými účinky."},{"page_url":"https://de.wikipedia.org/wiki/COVID-19-Pandemie","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/COVID-19_pandemic_Hamsterkaeufe_Germany_2020-03-14.jpg","page_title":"COVID-19-Pandemie","context_page_description":"Die COVID-19-Pandemie ist der weltweite Ausbruch der neuen Atemwegserkrankung COVID-19. Am 31. Dezember 2019 wurde der Ausbruch einer neuen Lungenentzündung mit noch unbekannter Ursache in Wuhan in China bestätigt. Am 11. Februar 2020 schlug die WHO den Namen COVID-19 für die Krankheit vor. Im Januar 2020 entwickelte sich die Krankheit zur Epidemie in China und am 11. März 2020 erklärte die WHO die bisherige Epidemie offiziell zu einer weltweiten Pandemie. Verursacht wird die Erkrankung durch eine Infektion mit dem bis dahin unbekannten Coronavirus SARS-CoV-2. In zahlreichen Ländern der Welt gibt es im Verlauf der Pandemie massive Einschnitte in das öffentliche Leben und in das Privatleben vieler Bürger. Einige Historiker beurteilten die Pandemie als historische Zäsur. Zu den gesamtgesellschaftlichen Auswirkungen der COVID-19-Pandemie gehört auch die Wirtschaftskrise 2020.\\nDie dritte und bisher verheerendste Pandemie des 21. Jahrhunderts wird weltweit in großem Rahmen von den Medien begleitet. Sie ist ein warnendes Beispiel für die rasche Ausbreitung einer Krankheit in einer vernetzten und globalisierten Welt.\\nAm 13."},{"page_url":"https://en.wikipedia.org/wiki/Hill_Park,_Karachi","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Hill_Park_07%2C_Karachi%2C_Pakistan.jpg","page_title":"Hill Park, Karachi","context_page_description":"Hill Park is situated on a hilltop surrounded by a residential area known as PECHS neighborhood of Jamshed Town in Karachi, Sindh, Pakistan. The park is spread over of 62 acres of this only 25% area has been developed as park."},{"page_url":"https://en.wikipedia.org/wiki/Paria,_Utah","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Site_of_Paria%2C_Utah.jpg","page_title":"Paria, Utah","context_page_description":"Paria or Pahreah, is a ghost town on the Paria River in Grand Staircase-Escalante National Monument in central Kane County, Utah, United States. It was inhabited from 1870 to 1929, and later used as a filming location."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D1%96%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%B1%D0%BE%D1%82%D0%B0%D0%BD%D1%96%D1%87%D0%BD%D0%B8%D0%B9_%D1%81%D0%B0%D0%B4_(%D0%91%D1%80%D0%B8%D1%81%D0%B1%D0%B5%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/BCBG_Flowers_01.JPG","page_title":"Міський ботанічний сад (Брисбен)","context_page_description":"Міський ботанічний сад — ботанічний сад у місті Брисбен. Ботанічний сад розташований у центрі міста на північному березі річки Брисбен.\\nУ ботанічному саду росте багато рідкісних і незвичайних ботанічних видів. Зокрема, сад має колекцію саговників, пальм, бамбука і фікусів."},{"page_url":"https://fr.wikipedia.org/wiki/Molinaea","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Molinaea_alternifolia.JPG","page_title":"Molinaea","context_page_description":"Molinaea est un genre de plantes de la famille des Sapindaceae."},{"page_url":"https://ceb.wikipedia.org/wiki/D%C5%99%C3%ADsy","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/D%C5%99%C3%ADsy_flag.jpg","page_title":"Dřísy","context_page_description":"Lungsod ang Dřísy sa Nasod nga Czech. Nahimutang ni sa lalawigan sa Středočeský kraj, sa sentro nga bahin sa nasod, 24 km sa amihanan-sidlakan sa Prague ang ulohan sa nasod. 174 metros ibabaw sa dagat kahaboga ang nahimutangan sa Dřísy, ug adunay 746 ka molupyo.\\nAng yuta palibot sa Dřísy kay patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 227 ka metro ug 1.4 km sa amihanan-kasadpan sa Dřísy. Dunay mga 62 ka tawo kada kilometro kwadrado sa palibot sa Dřísy medyo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Černý Most, 17.4 km sa habagatan sa Dřísy. Hapit nalukop sa kaumahan ang palibot sa Dřísy. Sa rehiyon palibot sa Dřísy, mga bungtod talagsaon komon.\\nAng klima hemiboreal. Ang kasarangang giiniton 9 °C. Ang kinainitan nga bulan Agosto, sa 20 °C, ug ang kinabugnawan Enero, sa -5 °C."},{"page_url":"https://af.wikipedia.org/wiki/Draco-dwergsterrestelsel","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/PGC_60095_Draco_Dwarf_Hubble_WikiSky.jpg","page_title":"Draco-dwergsterrestelsel","context_page_description":"Die Draco-dwergsterrestelsel is ’n sferoïdale satellietstelsel van die Melkweg in die sterrebeeld Draak. Dit is in 1954 deur Albert George Wilson van die Lowell-sterrewag ontdek op fotoplate van die National Geographic Society in Washington D.C. se Palomar-sterrewag-lugopname."},{"page_url":"https://gl.wikipedia.org/wiki/Iosif_Kobzon","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Official_portrait_of_Iosif_Kobzon_%281%29.jpg","page_title":"Iosif Kobzon","context_page_description":"Iosif Davidovich Kobzon nado en Chasiv Yar o 11 de setembro de 1937, é un cantante ruso."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%B9%D0%BD-%D0%A2%D0%B0%D0%B9%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/APC_de_Ain_taya.jpg","page_title":"Айн-Тайа","context_page_description":"Айн-Тайа — місто на півночі Алжиру, розташоване в окрузі Дар-ель-Беіда, столичного вілаєту Алжир. Населення міста становить 34 501 осіб."},{"page_url":"https://it.wikipedia.org/wiki/1._magyar_p%C3%A1nc%C3%A9loshadoszt%C3%A1ly","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Tank%2C_Fiat-brand_Fortepan_93750.jpg","page_title":"1. magyar páncéloshadosztály","context_page_description":"La 1. magyar páncéloshadosztály fu una divisione corazzata del Regio esercito ungherese, attiva durante la seconda guerra mondiale.\\nCreata nel marzo 1942 dall'espansione di una brigata motorizzata costituita in precedenza, la 1ª Divisione corazzata ungherese fece parte del contingente inviato dal Regno d'Ungheria a prendere parte ai combattimenti del fronte orientale contro l'Unione Sovietica e a fianco della Germania nazista. Tra il giugno e il settembre 1942 la divisione partecipò all'offensiva tedesca nella Russia meridionale, venendo impegnata negli scontri della battaglia di Voronež; schierata con il resto delle forze ungheresi in posizione difensiva lungo il fiume Don, la divisione finì in gran parte annientata nel corso della grande offensiva sovietica sferrata nel gennaio 1943.\\nI resti della 1ª Divisione corazzata furono ritirati in Ungheria, ma la ricostruzione dell'unità procedette a rilento e solo nel settembre 1944 fu pronta per essere reimpiegata al fronte."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_gemeentelijke_monumenten_in_Lingewaard","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Bemmel-dorpsstraat-06050003.jpg","page_title":"Lijst van gemeentelijke monumenten in Lingewaard","context_page_description":"De gemeente Lingewaard heeft 109 gemeentelijke monumenten, hieronder een overzicht. Zie ook de rijksmonumenten in Lingewaard."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%BC%97%E5%90%89%E5%B0%BC%E4%BA%9A%E7%BA%A7%E6%A0%B8%E6%BD%9C%E8%89%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/USS_New_Hampshire_SSN-778_Crest.png","page_title":"弗吉尼亚级核潜艇","context_page_description":"維吉尼亞級核動力攻擊潛艦是美國海軍第一艘同時針對大洋和近海兩種功能設計的核子潛艦。維吉尼亞級是美國海軍「新型攻擊潛艦計畫」的具體產出成品，以作為冷戰時代海狼級潛艦的低成本取代方案。維吉尼亞級成軍後預計取代洛杉磯級潛艦，均由紐波特紐斯造船、通用動力電船兩家造船廠聯合建造。根據海軍2014年的30年建艦計劃，美國將繼續建造「維吉尼亞級」至2043年，並服役至2060年後。"},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%B5%E0%AE%BF%E0%AE%B0%E0%AE%BF%E0%AE%AF%E0%AE%A9%E0%AF%8D_%E0%AE%AE%E0%AF%80%E0%AE%A9%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Viperfish_small.png","page_title":"விரியன் மீன்","context_page_description":"விரியன் மீன் என்பது கடல் மீன் பேரினமாகும். இந்த மீன்கள் ஊசிபோன்ற கூர்மையான நீண்ட பற்களும், குறுகிய தாடையும் கொண்டவை. பொதுவாக விரியன் மீன்கள் 30 செ.மீ முதல் 60 செ.மீ வரை வரை வளரக்கூடியன. விரியன் மீன்கள் பகலில் குறைந்த ஆழத்தில் இருக்கும், ஆனால் இரவு நேரத்தில் ஆழத்திற்கு சென்றுவிடும். இவை முதன்மையாக வெப்பமண்டல கடல் பகுதியில் காணப்படுகின்றன. இவை தன் உடலின் கீழ்ப்புறப் பகுதிகளில் அமைந்துள்ள போட்டோபோர்சு என அழைக்கப்படும் ஒளி தயாரிப்பு உறுப்புகளைக் கொண்டு, தன் எல்லைக்குள் இரையைக் கவர்ந்து தாக்குவதாக நம்பப்படுகிறது.\\nவிரியன் மீன்கள் கருப்பு, பச்சை, வெள்ளி நிறங்களில் வேறுபடுகின்றன. இந்த மீன்கள் தன் இரையை பிடிப்பதற்கு இதன் பாங் போன்ற பல் பயன்படுத்துகிறது. இதன் பற்கள் மிக நீண்டு உள்ளதால் இவற்றின் வாயை மூட இயலாது எப்போதும் திறந்தபடியே இருக்கும்.\\nஇந்த மீன்கள் தங்கள் வாழிடங்களில் 30 முதல் 40 ஆண்டுகள் வரை வாழ்வதாக நம்பப்படுகிறது, ஆனால் அடைபட்ட நிலையில் ஒரு சில மணி நேரமே வாழ்கின்றன. இவற்றால் வினாடிக்கு தனது உடல் நீளத்தில் இரண்டு மடங்கு நீளம் என்ற வேகத்தில் நீந்த முடியும் என்று அறிவியலாளர்கள் கருதுகிறார்கள். ஆனால் இந்த வேகம் உத்தியோகப்பூர்வ வேகம் அல்ல.\\nஇவற்றைக் காணும்போது இதன் உடல் செதில்களால் மூடப்பட்டதுபோல காணப்பட்டுகின்றன."},{"page_url":"https://sk.wikipedia.org/wiki/Slade","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/77/Slade_18041977_01_400.jpg","page_title":"Slade","context_page_description":"Slade je britská glam rocková skupina. V časoch svojej najväčšej slávy bola táto skupina v Spojenom kráľovstve jednou z komerčne najúspešnejších. Medzi zvláštnosti v produkcii tejto skupiny patrí, že názvy skladieb a ich texty sú pravopisne vedome skomolené."},{"page_url":"https://da.wikipedia.org/wiki/Antroposofi","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Dornach_goetheanum_westseite.jpg","page_title":"Antroposofi","context_page_description":"Antroposofi er en esoterisk filosofi og bevægelse, skabt af Rudolf Steiner. Antroposofien bygger på, at mennesket er et åndeligt væsen, som i sin helhed består af legeme, sjæl og ånd.\\nNavnet er sammensat af de to græske ord antropos og sofia. Således betyder antroposofi \\"menneskevisdom\\" eller \\"visdom om det menneskelige\\". Det må ikke forveksles med antropologi, der betyder læren om mennesket. Gennem antroposofien opfordres enkeltmennesket til at søge åndelig erkendelse. Rudolf Steiner kalder antroposofien en åndsvidenskab, fordi han har anvist bestemte videnskabelige metoder til opnåelse af sand åndserkendelse Samtidigt har han ud fra antroposofien givet impulser til en række praktiske livsområder.\\nAntroposofisk Selskab blev stiftet af Rudolf Steiner, efter at han brød med det teosofiske selskab, hvor han var generalsekretær 1902-13 for den tyske afdeling. Det var især Anni Besants fremstilling af Jiddu Krishnamurti som en reinkarnation af Jesus Kristus, der var årsag til bruddet.\\nRudolf Steiner skrev over tredive bøger og holdt omkring seks tusinde foredrag. De allerfleste af dem er udgivet i bogform, på tysk og også i norsk, svensk eller dansk oversættelse."},{"page_url":"https://de.wikipedia.org/wiki/Colorado_and_Southern_Railway","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Baker-tank.jpg","page_title":"Colorado and Southern Railway","context_page_description":"Die Colorado and Southern Railway war eine Eisenbahngesellschaft in den Vereinigten Staaten. Die Gesellschaft mit Sitz in Denver betrieb Bahnstrecken in Wyoming, Colorado und Texas."},{"page_url":"https://it.wikipedia.org/wiki/Muka%C5%99ov_(Praha-v%C3%BDchod)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Mukarov_PH_CZ.png","page_title":"Mukařov (Praha-východ)","context_page_description":"Mukařov è un comune della Repubblica Ceca facente parte del distretto di Praha-východ, in Boemia Centrale."},{"page_url":"https://cs.wikipedia.org/wiki/Modletice_(P%C3%ADse%C4%8Dn%C3%A9)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/Modletice_1.jpg","page_title":"Modletice (Písečné)","context_page_description":"Vesnice Modletice byla dříve samostatnou obcí 1,5 km severně od Písečného v nadmořské výšce 440 m. Leží na pravé straně údolí Moravské Dyje, které je součástí Mutenského hřbetu v jižní části Brtnické vrchoviny. Malá obec dříve s německým obyvatelstvem. Po vzniku Československa v roce 1918 se silnou českou menšinou, po odsunu německého obyvatelstva v roce 1945 a dosídlení, české obyvatelstvo. V roce 1843 žilo v obci 130 obyvatel ve 20 domech a 30 domácnostech. V roce 2011 zde trvale žilo sedmnáct obyvatel. Od roku 1972 je vesnice místní částí obce Písečné a je v ní 16 obytných domů."},{"page_url":"https://en.wikipedia.org/wiki/Scottish_Football_Hall_of_Fame","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Billy_Liddell.jpg","page_title":"Scottish Football Hall of Fame","context_page_description":"The Scottish Football Hall of Fame is located at the Scottish Football Museum. Nominations are made each year by fans and a committee selects the inductees. The first inductions to the Hall of Fame were in November 2004 in a ceremony at Hampden Park. Brian Laudrup and Henrik Larsson became the first players from outside Scotland to be inducted, in 2006. Rose Reilly was the first woman to be inducted into the Hall of Fame, in 2007. As of October 2019, there had been 122 inductions to the Hall of Fame."},{"page_url":"https://en.wikipedia.org/wiki/Aphrodisias","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Afrodisias_-_Aphrodisias_-_Ode%C3%B3n.jpg","page_title":"Aphrodisias","context_page_description":"Aphrodisias was a small ancient Greek Hellenistic city in the historic Caria cultural region of western Anatolia, Turkey. It is located near the modern village of Geyre, about 100 km east/inland from the coast of the Aegean Sea, and 230 km southeast of İzmir.\\nAphrodisias was named after Aphrodite, the Greek goddess of love, who had here her unique cult image, the Aphrodite of Aphrodisias. According to the Suda, a Byzantine encyclopedic compilation, before the city became known as Aphrodisias it had three previous names: Lelégōn Pólis, Megálē Pólis, and Ninóē.\\nSometime before 640, in the Late Antiquity period when it was within the Byzantine Empire, the city was renamed Stauroúpolis.\\nIn 2017 it was inscribed on the UNESCO World Heritage Site list."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%B1%B1%E4%B8%9C%E5%A5%B3%E5%AD%90%E5%AD%A6%E9%99%A2","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/Chinese_Women%27s_Academy_at_Shandong_Changqing.JPG","page_title":"山东女子学院","context_page_description":"山東女子學院是中國山東省濟南市的一所本科層次全日制公辦高等院校。學校現有市中校區、長清校區兩個校區。"},{"page_url":"https://en.wikipedia.org/wiki/2012_Boston_Red_Sox_season","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Lester_Warms.jpg","page_title":"2012 Boston Red Sox season","context_page_description":"The 2012 Boston Red Sox season was the 112th season in the franchise's Major League Baseball history. The Red Sox finished last in the five-team American League East with a record of 69 wins and 93 losses, 26 games behind the first-place New York Yankees. It was the first time the Red Sox finished last in their division since 1992. Under manager Bobby Valentine, the Red Sox finished with the third-lowest win percentage in the American League.\\nOn the heels of a 2011 season that ended with the team losing 20 of 27 games during September, resulting in their elimination from playoff contention and the departure of manager Terry Francona, the Red Sox struggled throughout their 2012 campaign under new manager Bobby Valentine. At the All-Star break the team was 43–43, and at the end of August they had fallen to 62–71. At 66–81 on September 16, the Red Sox were mathematically eliminated from the playoff race. On September 19, the team lost their 82nd regular season game, thus clinching their first losing season since 1997. On September 30, the Red Sox reached the 90-loss mark, assuring them of their first season with 90 or more losses since 1966."},{"page_url":"https://nl.wikipedia.org/wiki/Enneti%C3%A8res-en-Weppes","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/Map_commune_FR_insee_code_59196.png","page_title":"Ennetières-en-Weppes","context_page_description":"Ennetières-en-Weppes is een gemeente in het Franse Noorderdepartement en telt 1.126 inwoners. De plaats maakt deel uit van het arrondissement Rijsel. Het laatste deel van de gemeentenaam verwijst naar de streek Weppes."},{"page_url":"https://it.wikipedia.org/wiki/Relazioni_bilaterali_tra_Argentina_e_Italia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Argentina_Italy_Locator.png","page_title":"Relazioni bilaterali tra Argentina e Italia","context_page_description":"Le relazioni bilaterali tra Argentina e Italia sono le relazioni diplomatiche attuali e storiche tra Argentina e Italia. Entrambe le nazioni godono di relazioni amichevoli, la cui importanza è incentrata sulla storia della migrazione italiana in Argentina. Gli argentini di origine italiana totale o parziale ammontano a circa 25 milioni, pari al 62% della popolazione totale del paese. Entrambe le nazioni sono membri del G20."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%97%D7%95%D7%96%D7%95%D7%AA_%D7%A7%D7%95%D7%A0%D7%98%D7%99%D7%A7%D7%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Connecticut-counties-map.gif","page_title":"מחוזות קונטיקט","context_page_description":"במדינת קונטיקט שבארצות הברית ישנם 8 מחוזות.\\nהגדול שבמחוזות קונטיקט הוא מחוז ליצ'פילד, הקטן שבהם הוא מחוז מידלסקס, והמאוכלס שבהם הוא מחוז פיירפילד. עיר הבירה, הרטפורד, נמצאת במחוז הרטפורד."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A0%D7%A4%D7%90%D7%9C_%D7%91%D7%9E%D7%A9%D7%97%D7%A7%D7%99%D7%9D_%D7%94%D7%90%D7%95%D7%9C%D7%99%D7%9E%D7%A4%D7%99%D7%99%D7%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/2010_Opening_Ceremony_-_Nepal_entering.jpg","page_title":"נפאל במשחקים האולימפיים","context_page_description":"נפאל השתתפה לראשונה במשחקים האולימפיים באולימפיאדת טוקיו. היא נעדרה מאולימפיאדת מקסיקו סיטי ומאז אולימפיאדת מינכן היא משתתפת במשחקים ברציפות. הישגים של הספורטאים הנפאלים במשחקים היו סמליים בלבד. לוחם הטאקוונדו בידאן לאמה זכה אמנם במדליית ארד באולימפיאדת סיאול, אך באותם משחקים תחרויות הטאקוונדו היו לראווה בלבד, ולא היו חלק מהמשחקים הרשמיים.\\nמאז אולימפיאדת סולט לייק סיטי משתתפת נפאל גם באולימפיאדות החורף. גם במשחקים אלה היו הישגי הספורטאים הנפאלים צנועים."},{"page_url":"https://uk.wikipedia.org/wiki/IPlasma","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Overview_pyramid_inheritance.jpg","page_title":"IPlasma","context_page_description":"iPlasma - це платформа, створена як університетський проект у Румунії, для оцінки якості об'єктно-орієнтованого проектування. Основні результати вимірювання вона відображає у вигляді піраміди, що відображає значення ключових показників якості вимірюваної об'єктно-орієнтованої системи разом із порівнянням цих значень зі стандартними діапазонами даних показників.\\nThe Overview Pyramid відображає три основні аспекти об'єктно-орієнтованого проектування:\\nРозмір та складність.\\nЗв'язність.\\nСпадкування.\\nОтже, Overview Pyramid, дозволяє описати і охарактеризувати загальну структуру об'єктно-орієнтованої системи, шляхом кількісного аспекту складності, взаємозв'язку та використання спадкування. Основна ідея даної піраміди зібрати в одному місці найбільш значущі виміряні показники об'єктно-орієнтованої системи, так щоб інженер зміг бачити і інтерпретувати в одному кадрі все, що потрібно, щоб отримати перше враження про систему."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B8%D0%BC%D1%84%D0%B5%D1%80%D0%BE%D0%BF%D0%BE%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9_%D1%82%D1%80%D0%BE%D0%BB%D0%BB%D0%B5%D0%B9%D0%B1%D1%83%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/%D0%91%D0%B8%D0%BB%D0%B5%D1%82%D0%9A%D1%80%D1%8B%D0%BC%D1%82%D1%80%D0%BE%D0%BB%D0%BB%D0%B5%D0%B9%D0%B1%D1%83%D1%812018.jpg","page_title":"Симферопольский троллейбус","context_page_description":"Симферопольский троллейбус — система городского электротранспорта Крымской столицы, пришедшая на смену трамваю. Троллейбус является основным общественным транспортом в Симферополе, связывает крупнейшие микрорайоны с центральной частью города. Особенность симферопольского троллейбуса состоит в том, что маршруты идут из одного конца города в другой. Троллейбусные маршруты обслуживаются филиалом «Симферопольское троллейбусно-ремонтное управление», которое входит в состав предприятие ГУП РК «Крымтроллейбус» и включает в себя симферопольский троллейбусный парк и центральные троллейбусные ремонтные мастерские."},{"page_url":"https://es.wikipedia.org/wiki/Pissouri","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/LimassolDistrictPissouri.png","page_title":"Pissouri","context_page_description":"Pissouri es un pueblo situado en el Distrito de Limasol en Chipre, entre Limasol y Pafos. El área administrativa de Pissouri es la tercera más grande de su distrito. La localidad principal está situada a unos tres kilómetros de distancia de la bahía llamada Cabo Aspro y está construida sobre la ladera de una colina verde. Excepcionalmente se ubica en el centro del territorio.\\nAhora hay dos comunidades distintas, el Área de Pissouri pueblo y el Área de Pissouri Bahía. La población permanente total es de alrededor de 1.100 personas, de los cuales aproximadamente la mitad son chipriotas y el resto extranjeros, principalmente británicos, residentes y turistas. Hay varias tiendas, tabernas, restaurantes y bares."},{"page_url":"https://hu.wikipedia.org/wiki/1821_az_irodalomban","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/%C3%89tienne_Carjat%2C_Portrait_of_Charles_Baudelaire%2C_circa_1862.jpg","page_title":"1821 az irodalomban","context_page_description":"Az 1821. év az irodalomban."},{"page_url":"https://no.wikipedia.org/wiki/Batyskaf","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Nautil.jpg","page_title":"Batyskaf","context_page_description":"En batyskaf er en ubåtliknende, selvgående dypvannsfarkost som består av en kabin tilsvarende en batysfære, festet under en tank som skal sørge for oppdrift. De første forsøkene med batyskafer ble gjort allerede før andre verdenskrig av en sveitsisk fysikkprofessor, Auguste Piccard, som også konstruerte ordet batyskaf av de greske ordene βαθύς, «dyp» og σκάφος, «skip»."},{"page_url":"https://de.wikipedia.org/wiki/Frankfurter_Berg","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/FfmBerg4.jpg","page_title":"Frankfurter Berg","context_page_description":"Frankfurter Berg ist ein Stadtteil von Frankfurt am Main mit 8.168 Einwohnern."},{"page_url":"https://es.wikipedia.org/wiki/R%C3%ADo_Ume","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Ume_River.jpg","page_title":"Río Ume","context_page_description":"El río Ume es un río europeo que discurre por el norte de Suecia y desemboca en el golfo de Botnia. Tiene una longitud de 467,4 km y drena una cuenca de 26.815 km²."},{"page_url":"https://fr.wikipedia.org/wiki/Jean_Martin_(m%C3%A9decin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Jean_Martin_by_Erling_Mandelmann.jpg","page_title":"Jean Martin (médecin)","context_page_description":"Jean Martin (médecin), né en 1940, est un médecin suisse connu pour ses prises de positions publiques."},{"page_url":"https://fr.wikipedia.org/wiki/Flora_Antarctica","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Flora_Antarctica_Plate_CLXV.CLXVI_%28lighter%29.jpg","page_title":"Flora Antarctica","context_page_description":"Flora Antarctica est un recueil des découvertes botaniques de l'expédition Erebus et Terror. Édité en quatre parties de 1843-1859 par Joseph Dalton Hooker, il totalise six volumes et couvre environ 3 000 espèces et contient 530 plaques représentant 1 095 des espèces décrites.\\nIl est illustré par Walter Hood Fitch.\\nLes parties sont :\\nPartie I : Flora of Lord Auckland and Campbell's Islands sur les îles Campbell et les îles Auckland ;\\nPartie II : Flora of Fuegia, the Falkland Islands, etc sur les îles Kerguelen et les îles Malouines ;\\nPartie III : Flora Novae-Zelandiae sur la Nouvelle-Zélande ;\\nPartie IV : Flora Tasmaniae sur la Tasmanie.\\nHooker donne à Charles Darwin une copie de la première partie de son livre. Darwin le remercie et accepte en novembre 1845 que la distribution géographique des organismes soit « la clé qui ouvrira le mystère des espèces »."},{"page_url":"https://eo.wikipedia.org/wiki/Ve%C4%8Delkov","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Slovakia_banskabystrica_rimavskasobota.png","page_title":"Večelkov","context_page_description":"Večelkov, hungare Vecseklő estas malgranda vilaĝo en Slovakio, en Regiono Banská Bystrica, en Distrikto Rimavská Sobota.\\nAreo: 5 km²\\nSupermara alteco: 290 m\\nLoĝantaro: 270\\nPoŝtkodo: 980 34\\nAŭtokodo: RS\\nTelefonprefikso: 47"},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BB%D5%BE%D5%A1%D5%B6_%D5%8F%D5%B8%D6%82%D6%80%D5%A3%D5%A5%D5%B6%D6%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Pauline_Viardot_by_Timoleon_von_Neff.jpg","page_title":"Իվան Տուրգենև","context_page_description":"Իվան Սերգեյի Տուրգենև, ռուս ռեալիստ գրող, բանաստեղծ, հրապարակախոս, դրամատուրգ, թարգմանիչ։ Ռուս գրականության դասականներից է, Պետերբուրգի գիտությունների կայսերական ակադեմիայի ռուսերենի գծով թղթակից անդամ, Օքսֆորդի համալսարանի պատվավոր դոկտոր ։ Հեղինակ է վեպերի, վիպակների և պատմվածքների։\\nՏուրգենևի ստեղծած գեղարվեստական համակարգը ազդեցություն է թողել 19-րդ դարի երկրորդ կեսի ոչ միայն ռուս, այլև՝ արևմտաեվրոպական վեպի բանաստեղծական արվեստի վրա։ Իվան Տուրգենևն առաջինը ռուս գրականության մեջ սկսեց ուսումնասիրել «նոր մարդու»՝ վաթսունականի անձը, նրա բարոյական հատկանիշները և հոգեբանական առանձնահատկությունները: Նրա շնորհիվ ռուսաց լեզվում սկսեց լայնորեն կիրառվել «նիհիլիստ» եզրը: Նա ռուս գրականության և դրամատուրգիայի քարոզիչն էր Արևմուտքում։\\nԻվան Տուրգենևի ստեղծագործության ուսումնասիրությունը Ռուսաստանի հանրակրթական դպրոցական ծրագրերի պարտադիր մասն է կազմում։"},{"page_url":"https://pt.wikipedia.org/wiki/Bomba_de_fragmenta%C3%A7%C3%A3o","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/B1-B_Lancer_and_cluster_bombs.jpg","page_title":"Bomba de fragmentação","context_page_description":"Bomba de fragmentação é um artefato explosivo que, quando acionado, libera uma certa quantidade de projéteis ou fragmentos menores, com a finalidade de causar grande número de vítimas, já que, além da concussão causada pela explosão em si, os fragmentos são lançados a alta velocidade em todas as direções, provocando ferimentos graves ou mesmo mortais dentro de uma grande área. Seu efeito sobre uma tropa é devastador: além dos mortos e feridos, causa um pânico generalizado, devido exatamente à sua crueza e brutalidade.\\nPode ser usada também contra outros alvos - veículos, linhas de transmissão e abrigos - e lançada a partir do ar, do solo. Pode também ser usada como mina terrestre. A médio prazo, causa ferimentos e morte nas populações civis.\\nA definição de armas de fragmentação inclui toda munição, como granadas, foguetes e bombas, que contenha um grande número de bombas menores que, ao serem lançadas, espalham-se sobre uma grande área. Esses pequenos explosivos podem permanecer intactos por muitos anos e representam um perigo iminente para a população, podendo causar mutilações ou mortes no momento em que explodem. A maioria das vítimas é civil."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8D%83%E6%B3%A2%E6%B9%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Lake_Senba_Phot_2019-2020_%286%29.jpg","page_title":"千波湖","context_page_description":"千波湖は、茨城県水戸市にある那珂川水系の湖沼である。"},{"page_url":"https://de.wikipedia.org/wiki/Gawain","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Gawain_and_the_Green_Knight.jpg","page_title":"Gawain","context_page_description":"Gawain von Orkney, walisisch Gwalchmei fab Gwyar, auch Gawan oder Gawein, ist eine Sagengestalt aus der walisischen Mythologie und daraus hervorgegangener Artuslegenden. In den früheren Überlieferungen spielt der Neffe Artus’ als Gwalchmei zunächst eine nur untergeordnete Rolle als Begleiter bei Abenteuern, wohingegen die mittelalterliche Artusepik der Matière de Bretagne ihm als Ritter der Tafelrunde eine wesentliche Stellung bei der Queste, der Suche nach dem Heiligen Gral, zukommen lässt.\\nIn neuerer Zeit ist die Figur Gawains in Comics, Filmen und Fernsehserien dargestellt worden."},{"page_url":"https://fr.wikipedia.org/wiki/Burgondes","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Hepbach_Kirche_Decke_1.jpg","page_title":"Burgondes","context_page_description":"Les Burgondes sont un des peuples du groupe des Germains orientaux. Identifiés comme tels, ils relèvent de l'aire culturelle de l'Âge du fer germanique ancien. Hypothétiquement originaires de l'île de Bornholm en Mer Baltique, leur ethnogenèse remonterait à l'Âge du bronze danois.\\nAu Iᵉʳ siècle, ils migrent vers l'actuelle Poméranie aux bouches de l'Oder, puis s'installent au IIᵉ siècle en Silésie aux sources de la Vistule. À la fin du IIIᵉ siècle, ils se déplacent vers l'Elbe puis le Main. A la fin du IVᵉ siècle, ils sont établis aux abords du Rhin en Germanie supérieure, à la suite de la migration des Vandales et Alains en Gaule romaine, sans être politiquement soumis à l'Empire romain d'Occident. Ils constituent ainsi un premier royaume en 413, avant d'être défaits en 436 par les Huns en Germanie inférieure. Cette épopée des Burgondes est légendairement retracée par le Chant des Nibelungen.\\nAu terme des Migrations germaniques de la fin de l'Antiquité, les Burgondes s'établissent durablement dans le centre-est de la Gaule comme peuple fédéré de l'Empire romain d'Occident."},{"page_url":"https://sv.wikipedia.org/wiki/Tom%C3%A1s_Estrada_Palma","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/27/Tomas_estrada_palma.jpg","page_title":"Tomás Estrada Palma","context_page_description":"Tomás Estrada, född 9 juli 1832, död 4 november 1908, var en kubansk politiker. Han var Kubas förste president, från 1902 till 1906."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%81%D0%B2%D1%8F%D1%82%D1%8B%D1%85_%D0%BD%D0%BE%D0%B2%D0%BE%D0%BC%D1%83%D1%87%D0%B5%D0%BD%D0%B8%D0%BA%D0%BE%D0%B2_%D0%B8_%D0%B8%D1%81%D0%BF%D0%BE%D0%B2%D0%B5%D0%B4%D0%BD%D0%B8%D0%BA%D0%BE%D0%B2_%D0%A6%D0%B5%D1%80%D0%BA%D0%B2%D0%B8_%D0%A0%D1%83%D1%81%D1%81%D0%BA%D0%BE%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Olgachair.jpg","page_title":"Список святых новомучеников и исповедников Церкви Русской","context_page_description":"Святы́е новому́ченики и испове́дники Церкви Русской — группа святых Русской православной церкви, принявших мученическую кончину за Христа или подвергшихся гонениям после Октябрьской революции 1917 года."},{"page_url":"https://lb.wikipedia.org/wiki/NGC_1381","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/NGC_1381_%28crop_of_eso1612a%29.png","page_title":"NGC 1381","context_page_description":"Den NGC 1381 ass eng lënsefërmeg Galaxis am Stärebild Fornax.\\nD'Galaxis gouf am Joer 1865 vum Astronom Julius Schmidt mat sengem 16 cm-Teleskop entdeckt. Den NGC 1381 ass e Member vum Fornax-Galaxiëkoup."},{"page_url":"https://en.wikipedia.org/wiki/Jewett-Thompson_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Jewett-Thompson_House.jpg","page_title":"Jewett-Thompson House","context_page_description":"The Jewett-Thompson House is a historic house located at 1141 Wales Drive in Fort Myers, Florida."},{"page_url":"https://de.wikipedia.org/wiki/Ssireum","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/08/Goguryeo-Gakjeochong-Ssireumdo-01.jpg","page_title":"Ssireum","context_page_description":"Ssireum ist eine alte Form des Ringens, die nur in Korea verbreitet ist. Die ältesten erhaltenen Spuren des Sports stammen aus dem 4. Jahrhundert, es wird ihm jedoch teilweise ein Alter von bis zu 5.000 Jahren zugeschrieben. Heute wird eine modernisierte Form sowohl von Amateuren als auch semiprofessionell betrieben."},{"page_url":"https://hu.wikipedia.org/wiki/Breitenbrunn_(Schwaben)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Loppenhausen_Teilansicht-Ortsmitte.jpg","page_title":"Breitenbrunn (Schwaben)","context_page_description":"Breitenbrunn település Németországban, azon belül Bajorországban. Lakosainak száma 2342 fő. +/-"},{"page_url":"https://hu.wikipedia.org/wiki/Rock_and_Roll_Hall_of_Fame","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Jerry-Mickey_at_Red_Rocks_taken_08-11-87.jpg","page_title":"Rock and Roll Hall of Fame","context_page_description":"A Rock and Roll Hall of Fame and Museum egy múzeum az Erie-tó partján az Ohio-beli Cleveland városában az Amerikai Egyesült Államokban. Célja, hogy emléket állítson azon ismert művészeknek, producereknek és egyéb személyeknek, akik a zeneiparra és azon belül főleg a rock and rollra nagy hatással voltak. Az intézményt működtető alapítványt Ahmet Ertegün, az Atlantic Records alapítója és elnöke, hozta létre 1986-ban. Az alapítás évében beiktatták a Rock and Roll Hírességek Csarnokának első tagjait, olyan legendás előadókat, mint pl. Chuck Berry, James Brown, Ray Charles, Jerry Lee Lewis, Little Richard vagy Elvis Presley.\\nMaga a múzeum évekkel később valósult csak meg. Több város is jelentkezett, hogy otthont adna a múzeumnak, köztük Memphis, Detroit és Philadelphia, de a befutó végül Cleveland lett, akik 65 millió dollárt ajánlottak fel a múzeum megvalósítására. Az építkezést 1993-ban kezdték meg, az ünnepélyes megnyitó pedig 1995. szeptember 1-jén volt. A múzeum nem csak a Hírességek Csarnokába beiktatott előadók munkásságát mutatja be tárlatain, hanem a rock and roll történetének különböző korszakait is tematikus kiállításaival."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%88%B1%E4%B8%BD%E8%88%8D%E5%AE%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Salon_dor%C3%A9_Palais_de_l%27%C3%89lys%C3%A9e1.JPG","page_title":"爱丽舍宫","context_page_description":"爱丽舍宫是法国总统的官邸与办公室所在地，位于巴黎八区圣奥诺雷市郊路55号，邻近香榭丽舍大街。其名称“Élysée”来自希腊神话中的至福乐土。\\n爱丽舍宫原为艾威尔伯爵于1718年兴建、1722年竣工的宫殿Hôtel d'Évreux，拿破仑一世的皇后约瑟芬亦曾在此宫殿居住，1873年起至今作为法国总统官邸，并供接待重要外宾，除特定日外，并不对外开放参观。"},{"page_url":"https://it.wikipedia.org/wiki/Luis_Moya","image_url":"https://upload.wikimedia.org/wikipedia/it/b/bb/Rallye_Sanremo_1990_-_Luis_Moya%2C_Carlos_Sainz_%28Toyota-Marlboro_Team_Europe%29.jpg","page_title":"Luis Moya","context_page_description":"Luis Rodríguez Moya è un ex copilota di rally spagnolo, è stato il navigatore di Carlos Sainz, con il quale ha quindi condiviso i due titoli di campione del mondo."},{"page_url":"https://ga.wikipedia.org/wiki/Suranam","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Maroon_village%2C_Suriname_River%2C_1955.jpg","page_title":"Suranam","context_page_description":"Tír atá lonnaithe i dtuaisceart Mheiriceá Theas í Poblacht Shuranam nó Suranam go coiteanta. Tá teorainn aici le Guáin na Fraince, leis an nGuáin agus leis an mBrasaíl. Is í Ollainnis teanga oifigiúil na tíre.\\nBhí Bundúchasaigh ina gcónaí ann i bhfad roimh theacht na nEorpach. B’fhéidir gur tháinig an t-ainm “Suranam” ó threibh a dtugtaí “Surinen” orthu agus a labhraíodh Taíno."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%AD%94%E6%A9%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Aqueduct_of_Segovia_01.jpg","page_title":"魔橋","context_page_description":"魔橋または悪魔の橋は、多くが悪魔が作ったといわれる伝承をもつ、欧州に数十程度ある橋である。石積みのアーチ橋で当地に古代ローマ時代に作られたという俗話がある。"},{"page_url":"https://zh.wikipedia.org/zh-my/%E9%9B%A8%E5%82%98%E9%9D%A9%E5%91%BD%E7%9A%84%E8%97%9D%E8%A1%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/2014.10.37_Hong_Kong_protests.JPG","page_title":"雨傘革命的藝術","context_page_description":"雨伞运动的艺术指的是为抒发追求民主市民的真普选特首诉求而创作的艺术作品。大多数实物的艺术作品都位于这三个主要占领区即是金钟、铜锣湾和旺角，一些概念是来自香港以外的地区。"},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AC%E0%A6%A8%E0%A6%BE%E0%A6%A8%E0%A7%80_%E0%A6%AE%E0%A6%A1%E0%A7%87%E0%A6%B2_%E0%A6%9F%E0%A6%BE%E0%A6%89%E0%A6%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Mirpur-banani_flyover.JPG","page_title":"বনানী মডেল টাউন","context_page_description":"বনানী মডেল টাউন গুলশান থানা ১৯ নম্বর ওয়ার্ড এর একটি অংশ যা ঢাকা, বাংলাদেশে অবস্থিত। বনানী মডেল টাউন বাংলাদেশের গুরুত্বপূর্ণ কুটনৈতিক এলাকা"},{"page_url":"https://en.wikipedia.org/wiki/Ouvrage_Thonnelle","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Thonnelle_bloc3.jpg","page_title":"Ouvrage Thonnelle","context_page_description":"Ouvrage Thonnelle is a petit ouvrage of the Maginot Line, located in the Fortified Sector of Montmédy between the towns of Thonnelle and Verneuil-Petit, facing Belgium. It possesses four combat blocks. It is located between gros ouvrages Vélosnes and Chesnois. The position was sabotaged and abandoned by French forces that were ordered to retreat from the exposed position in June 1940 during the Battle of France. The ouvrage is abandoned."},{"page_url":"https://en.wikipedia.org/wiki/Licio_Visintini","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Licio_visintini.jpg","page_title":"Licio Visintini","context_page_description":"Licio Visintini was an Italian naval officer during World War II. Visintini was decorated for his operations against Allied shipping in Gibraltar during the Battle of the Mediterranean. His brother Mario Visintini was a famous flying ace; both were killed during the war."},{"page_url":"https://he.wikipedia.org/wiki/%D7%99%D7%95%D7%A0%D7%92%D7%A8%D7%9E%D7%A0%D7%90%D7%99%D7%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Bazzania_trilobata_%28L.%29_Gray-Rohozec_trojlalo%C4%8Dn%C3%BD1.jpg","page_title":"יונגרמנאים","context_page_description":"יונגרמנאים הם מחלקה של טחבי כבד שהם צמחים שאינם וסקולריים. היונגמנאים מתאפיינים בגמטופיט בעל עלעלים."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%83%D1%80%D0%B8%D0%BD_(%D0%B3%D0%BE%D1%80%D0%BE%D0%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Surin_City_Pillar_Shrine_-_Surin.jpg","page_title":"Сурин (город)","context_page_description":"Сури́н — город на северо-востоке Таиланда, административный центр провинции Сурин.\\nРасположен на южной окраине плато Корат, в бассейне реки Мун, примерно в 430 км к северо-востоку от Бангкока. Население по данным на 2012 год составляет 40 096 человек.\\nЧерез Сурин проходит железная дорога, соединяющая крупные города Накхонратчасима и Убонратчатхани."},{"page_url":"https://es.wikipedia.org/wiki/Hermandad_del_Santo_Entierro_(Moguer)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Hdad_SantoEntierro_20170415_Encarnacion1.jpg","page_title":"Hermandad del Santo Entierro (Moguer)","context_page_description":"La Fervorosa, Real e Ilustre Cofradía de Nazarenos del Satisimo Cristo de la Misericordia, Santísimo Cristo de la Paz Eterna y Nuestra Señora de la Encarnación en Soledad es una cofradía del pueblo de Moguer, en Huelva.\\nPopularmente conocida como \\"El Santo Entierro\\".\\nFundada en el año 1574.\\nSede: Ermita de San Sebastián.\\nPenitentes: Las túnicas, cíngulo, capa y antifaz son moradas. El escudo se sitúa en el antifaz, a la altura del pecho.\\nImágenes: El Cristo de la Paz Eterna es obra de Antonio León Ortega, el de la Misericordia es de Barbero de 1975 y la Virgen de la Encarnación es una talla anónima del Siglo XVI.\\nPasos: La procesión consta de 3 pasos. El primer paso porta el Cristo de la Misericordia acompañado de la virgen María, María Magdalena y San Juan Evangelista. En el segundo al Santísimo Cristo de la Paz Eterna en su urna. El Tercer paso porta a Nuestra Señora de la Encarnación en Soledad seguida de la cruz y dos escaleras.\\nLa antigua hermandad del Santo Entierro se fusionó en 1867 con la hermandad de la Vera-Cruz, con la que se mantuvo hasta que las imágenes titulares fueron quemadas en la Guerra Civil."},{"page_url":"https://en.wikipedia.org/wiki/Safety_pin","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Silver_safety_pins.jpg","page_title":"Safety pin","context_page_description":"The safety pin is a variation of the regular pin which includes a simple spring mechanism and a clasp. The clasp serves two purposes: to form a closed loop thereby properly fastening the pin to whatever it is applied to, and to cover the end of the pin to protect the user from the sharp point.\\nSafety pins are commonly used to fasten pieces of fabric or clothing together. Safety pins, or more usually a special version with an extra safe cover, called a nappy pin, or loincloth pin, are widely used to fasten cloth diapers, or modern loincloths, as the safety clasp, while remaining ingestion hazard, prevents the baby girl or boy from being jabbed or pricked. Similarly, they can be used to patch torn or damaged clothing. Safety pins can also be used as an accessory in jewelry, like earrings, chains, and wristbands. Sometimes they are used to attach an embroidered patch. Size 3 is often used in quilting and may be labelled for purchase as a \\"quilting pin\\". Size 4 and larger may be called \\"blanket pins\\" and deemed acceptable as kilt pins for informal dress, depending upon design and appearance."},{"page_url":"https://fr.wikipedia.org/wiki/Mike_Hanke","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Mike_Hanke.jpg","page_title":"Mike Hanke","context_page_description":"Mike Hanke est un footballeur allemand né le 5 novembre 1983 à Hamm. Il évolue au poste d'attaquant.\\nÉvoluant en attaque, il fait partie de la « nouvelle génération » allemande. International depuis le 8 juin 2005, il intègre le groupe des 23 au Mondial 2006, en remplaçant à la dernière minute Kevin Kuranyi. Particulièrement décisif en coupes, il quitta Schalke 04 afin de gagner du temps de jeu.\\nAprès deux saisons mitigées à VfL Wolfsburg dans un système à 3 attaquants, il rejoint Hanovre 96, pour une somme de 4,5 millions d'euros. Il ne put s'exprimer durant la saison 2008-2009, barré par Mikael Forssell et Jan Schlaudraff. Finalement, en décembre 2010, il signe un contrat avec le Borussia Mönchengladbach, alors 18ᵉ de la Bundesliga. Il s'y impose dans un rôle de pivot et contribue au sauvetage du club puis de l'épopée 2011-2012.\\nLe 17 décembre 2014, alors qu'il venait de terminer la saison 2014 du Championnat de Chine, après avoir porté les couleurs du Guizhou Renhe. Il annonce la fin de sa carrière sportive.¹"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1978","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Didier_Drogba_9279.JPG","page_title":"Lijst van personen geboren in 1978","context_page_description":"Dit is een lijst van personen die geboren zijn in 1978.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://de.wikipedia.org/wiki/Bahnhof_Frankfurt_(Main)_West","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Stra%C3%9Fenbahn_16_-_Frankfurt_Westbahnhof.jpg","page_title":"Bahnhof Frankfurt (Main) West","context_page_description":"Der Bahnhof Frankfurt (Main) West ist ein Regional- und S-Bahnhof an der Main-Weser-Bahn im Westen der Innenstadt von Frankfurt am Main, nahe der Messe Frankfurt und dem Campus Bockenheim der Johann-Wolfgang-Goethe-Universität Frankfurt am Main."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%B8%8C%E7%91%9F%C2%B7%E5%BD%AD%E5%B0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Major_Heather_%E2%80%9CLucky%E2%80%9D_Penney.jpg","page_title":"希瑟·彭尼","context_page_description":"希瑟·彭尼，美國飛行員，服役於美國空中國民警衛隊。2001年九一一襲擊發生時首批緊急升空保衛華盛頓特區的戰鬥機飛行員之一，在缺乏武器的情況下曾準備駕駛F-16戰機撞擊遭恐怖分子劫持的美聯航93號班機，阻止其抵達原定目標華盛頓。伊拉克戰爭期間兩度在伊拉克執行作戰任務。現任洛克希德·馬丁航空公司美軍空優項目主任。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_cultural_property_of_national_significance_in_Switzerland:_Fribourg","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Granary_Corminboeuf_Apr_2011.jpg","page_title":"List of cultural property of national significance in Switzerland: Fribourg","context_page_description":"This list contains all cultural property of national significance in the canton of Fribourg from the 2009 Swiss Inventory of Cultural Property of National and Regional Significance. It is sorted by municipality and contains 205 individual buildings, 14 collections, 18 archaeological finds and 1 other special site or object.\\nThe geographic coordinates provided are in the Swiss coordinate system as given in the Inventory.\\nContents: Top - A B C D E F G H K L M O P R S T U V W"},{"page_url":"https://no.wikipedia.org/wiki/Vitalij_Buts","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Vitaliy_Buts_-_Crit%C3%A9rium_du_Dauphin%C3%A9_2010.jpg","page_title":"Vitalij Buts","context_page_description":"Vitalij Volodymyrovytsj Buts er en ukrainsk landeveissyklist."},{"page_url":"https://en.wikipedia.org/wiki/Dacian_bracelets","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/Dacian_bracelet_type_Slimnic3.jpg","page_title":"Dacian bracelets","context_page_description":"The Dacian bracelets are bracelets associated with the ancient people known as the Dacians, a distinct branch of the Thracians. These bracelets were used as ornaments, currency, high rank insignia and votive offerings Their ornamentations consist of many elaborate regionally distinct styles. Bracelets of various types were worn by Dacians, but the most characteristic piece of their jewelry was the large multi-spiral bracelets; engraved with palmettes towards the ends and terminating in the shape of an animal head, usually that of a snake."},{"page_url":"https://cs.wikipedia.org/wiki/Mineralogick%C3%A9_muzeum_J._E._Hibsche","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Homole_u_Panny_2015_%2819%29.jpg","page_title":"Mineralogické muzeum J. E. Hibsche","context_page_description":"Mineralogické muzeum Josefa Emanuela Hibsche se nachází v obci Homole u Panny v okrese Ústí nad Labem ve stejnojmenném kraji. Muzeum, které je věnováno geologii a mineralogii Českého středohoří a podrobnému zdokumentování života a díla zdejšího rodáka, geologa a vysokoškolského profesora Josefa Emanuela Hibsche, bylo otevřeno v roce 2002."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%A1%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/P1070891_%D0%A1%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D0%BE%2C_%D0%9E%D1%80%D0%BB%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C.jpg","page_title":"Сосково","context_page_description":"Сосково — Российн Федерацин эвла, Орёлан областан Соскован кӀоштан административан центр."},{"page_url":"https://en.wikipedia.org/wiki/Westlake_Village,_California","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0d/Westlake_Village_and_Agoura_Hills_California_USA.jpg","page_title":"Westlake Village, California","context_page_description":"Westlake Village is a city in Los Angeles County on its western border with Ventura County. The city is named after the master-planned community of Westlake Village. With a lake at the center, the community straddles the line between Los Angeles and Ventura counties. Roughly two-thirds of the community was annexed by the city of Thousand Oaks. In 1981, the remaining portion incorporated into the City of Westlake Village which became the 82nd municipality of Los Angeles County. The population of the city was estimated to be at 8,217 in 2019, down from 8,270 at the 2010 census."},{"page_url":"https://pt.wikipedia.org/wiki/Fort_Saint_Louis","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ef/TXMap-doton-Inez.PNG","page_title":"Fort Saint Louis","context_page_description":"Fort Saint Louis foi uma colônia francesa que existiu nas proximidades da atual cidade de Inez, no Texas. Também chamado de Texas francês, representa um período da história do Texas, de 1685 a 1689. O explorador Robert de La Salle pretendia fundar a colônia na foz do Rio Mississippi, mas mapas imprecisos e erros de navegação fizeram seus navios ancorar 400 milhas a Oeste além da costa do Texas, perto de Matagorda Bay.\\nA colônia enfrentou diversas dificuldades durante sua breve existência, inclusive a hostilidade dos Nativos Americanos. Ciente de sua missão original, La Salle liderou várias expedições para encontrar o Rio Mississippi. Em vez disso, ele explorou muito o Rio Grande e parte do Leste do Texas. Durante uma dessas ausências, em 1686, o último navio da colônia naufragou, deixando os colonos impossibilitados de buscar suprimentos nas colônias francesas do Mar do Caribe. Com as condições deterioradas, La Salle se deu conta que a colônia só poderia sobreviver com a ajuda do povoado francês no País do Illinois. Sua última expedição terminou ao longo do Rio Brazos, no início de 1687, quando La Salle e cinco de seus homens foram assassinados por rivais de outro grupo."},{"page_url":"https://ceb.wikipedia.org/wiki/Demir_Hisar_(munisipyo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Zname_DH.jpg","page_title":"Demir Hisar (munisipyo)","context_page_description":"Munisipyo ang Demir Hisar sa Makedoniya. Nahimutang ni sa habagatan-kasadpang bahin sa nasod, 80 km sa habagatan sa Skopje ang ulohan sa nasod. Adunay 8,609 ka molupyo. Naglangkob kin og 780 ka kilometro kwadrado.\\nAng yuta sa Demir Hisar kay kabungtoran sa habagatang-sidlakan, apan sa amihang-kasadpan nga kini mao ang kabukiran.\\nMga lungsod sa Demir Hisar:\\nDemir Hisar\\nSopotnica\\nSlepče\\nŽvan\\nSmilevo\\nSveta\\nSuvodol\\nEdinakovci\\nSloeštica\\nStrugovo\\nŽurče\\nObednik\\nVardino\\nPribilci\\nVirovo\\nZagoriče\\nMrenoga\\nGraište\\nDolenci\\nGolemo Ilino\\nBelče\\nBrezovo\\nBabino\\nBoište\\nKutretino\\nMalo Ilino\\nBazernik\\nŽeleznec\\nUtovo\\nNovo Selo\\nKočište\\nSladuevo\\nZašle\\nSa mosunod nga mga natural nga mga bahin makita sa Demir Hisar:\\nMga suba:\\nArnautski Dol\\nAsanoec\\nBela Reka\\nBela Voda\\nBela Voda\\nBerkoec\\nBočkar\\nBogdanov Dol\\nBoiška Reka\\nBrdo Padina\\nBrestečka Reka\\nBučalo\\nČaška\\nČavdarica\\nČeren\\nCerovska Reka\\nDedojčka Reka\\nDelkov Dol\\nDlaboki Dol\\nDlaboki Dol\\nDlaboki Dol\\nDlaboki Dol\\nDobromirski Dol\\nDražjo\\nDrenika\\nGlavodoč\\nGolemača\\nGolemoilinska Reka\\nGorna Reka\\nJablanica\\nJalica\\nKapina\\nKarpi\\nKatuška Reka\\nKočinski Dol\\nKolitatkov Dol\\nKoljovo Rečište\\nKopidonski Dol\\nKoprivnica\\nKošarnik\\nKrivi Dol\\nKukišta\\nKušna\\nLakatska Reka\\nLevačka Reka"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%B0%D0%BC%D0%BE%D0%BA_%D0%9A%D1%83%D0%BA%D1%83%D0%BA%D1%88%D1%82%D0%B0%D0%B9%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Schloss_Kuckuckstein01.jpg","page_title":"Замок Кукукштайн","context_page_description":"Замок Кукукштайн — средневековый замок в немецком городе Либштадт в федеральной земле Саксония. Расположенный на высоком уступе скалы над долиной реки Зайдевиц, он должен был контролировать торговый путь, проходивший из долины Эльбы через восточные отроги Рудных гор в Богемию."},{"page_url":"https://sk.wikipedia.org/wiki/Mil%C3%A1_(pr%C3%ADrodn%C3%A1_rezerv%C3%A1cia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Pohled_z_turistick%C3%A9_trasy..jpg","page_title":"Milá (prírodná rezervácia)","context_page_description":"Prírodná rezervácia Milá je chránené územie v okrese Most v Úsťanskom kraji. Rozkladá sa v I. zóne CHKO České středohoří na ploche 19,95 ha na rovnomennom vrchu Milá na katastri dediny Milá. Územie je vzdialené asi 12,5 km juhovýchodne vzdušnou čiarou od centra mesta Mostu. Rezerváciou prechádza modro značený turistický chodník vedúci z Mostu do Loun s odbočkou na vrchol."},{"page_url":"https://it.wikipedia.org/wiki/Disco_freno","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/59/Buell_disk_brake.jpg","page_title":"Disco freno","context_page_description":"I dischi freno costituiscono la parte dell'impianto frenante a disco che ruota assieme alla ruota e risulta molto importante sia per quanto riguarda la potenza frenante sia per quanto riguarda la guidabilità e l'utilizzo del mezzo."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E4%BC%81%E6%A5%AD%E8%99%9F%E8%88%AA%E7%A9%BA%E6%AF%8D%E8%89%A6_(CV-6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/SBDs_VB-10_over_CV-6_Palau_1944.jpg","page_title":"企業號航空母艦 (CV-6)","context_page_description":"企业号航空母舰，是一艘隶属于美国海军的航空母舰，为约克城级航空母舰的二号舰。它是美军第七艘以企业为名的军舰，舰名源自美国独立战争期间美军俘获并更名的一艘英国单桅纵帆船。\\n其在太平洋战争期间，击沉敌舰71艘，击伤敌舰192艘，空中击落敌机404架，地面击毁敌机507架，于太平洋战区参战20场，并获得数十枚战争表扬奖章，为人类史上最辉煌战绩，与超过60年人类史上最优秀功勋纪录保持舰。\\n企业号在1934年开始建造，在1936年下水，并于1938年服役。接着企业号参与了一次舰队解难演习，在1940年编入驻太平洋的战斗部队。1941年美国太平洋舰队重设后，企业号仍旧留在太平洋服役。\\n1941年12月7日，日本海军偷袭珍珠港。企业号原定在前一日进入港口，但因风浪而有所延误，侥幸避过一劫。此后企业号参与了美国海军在太平洋战争的大部分重要战斗，由早期的空袭东京、中途岛海战及瓜达尔卡纳尔岛战役，到美军反攻的吉尔伯特及马绍尔群岛战事、马里亚纳群岛及帕劳战事、菲律宾战役及莱特湾海战，以及晚期的硫磺及琉球群岛战事。1945年5月冲绳战役期间，企业号接连被神风特攻队自杀飞机击伤，被迫返回美国维修，使之错过日本投降前最后三个月的战斗。\\n大战结束后，战绩彪炳的企业号参与了接载美军返国的魔毯行动，最后在1947年退役停放。美国海军部长福莱斯特曾称赞企业号为美国海军于第二次世界大战的最佳象征，并请求政府将企业号如同宪法号一样永久保存，然而企业号在战后多次的捐赠计划都因故失败。1952年及1953年企业号先后被重编为攻击航母及反潜航母，但舰体并没有作任何改装。1956年海军将企业号除籍并出售拆解。舰艇的老兵组织试图筹款购入企业号不果，而企业号最终在1958年拆解。在老兵的强烈要求下，海军将在同年开始建造的全球第一艘核动力航空母舰命名为企业，以资纪念。"},{"page_url":"https://de.wikipedia.org/wiki/Klecina","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Klecina-Supinskiego-brama_cukrowni.jpg","page_title":"Klecina","context_page_description":"Klecina ist ein Ortsteil von Breslau im Stadtteil Krzyki und gehört seit 1951 zur Stadt Breslau.\\nIm früheren Vorort Klettendorf befand sich bis 1945 eine der bedeutendsten Zuckerfabriken, in der der in ganz Deutschland und im benachbarten Ausland bekannte Feinzucker Klettendorfer Raffinade produziert wurde.\\nDie unter den Namen Vom Rath, Schoeller & Skene firmierende Fabrik war durch Fusionen mit anderen Zuckerfabriken im Landkreis Breslau gewachsen.\\n1322 erwarb Nikolaus von Banz das Gut Klettendorf.\\nMit der Einführung der Kreisordnung für die Provinzen Preußen, Brandenburg, Pommern, Posen, Schlesien und Sachsen vom 13. Dezember 1872 wurde der Amtsbezirk Klettendorf Nr. 18 aus den Landgemeinden Hartlieb, Kleinburg, Klettendorf, Krietern und Kundschütz und dem Gutsbezirk Hartlieb gebildet. 1936 war Paul Hartmann Bürgermeister in Klettendorf. Der Bürgermeister des Ortes, Eugen Pfanz wurde am 6. Februar 1945 erschossen, da er vor den heranrückenden Russen geflohen war.\\n1939 zählte Klettendorf 2936 Einwohner.\\nDie katholische Pfarrkirche St. Mariae wurde urkundlich zuerst in einer Urkunde des Bischofs Thomas I. von 1254 erwähnt."},{"page_url":"https://de.wikipedia.org/wiki/K%C5%8Dnomine-ji","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Kounomineji_07.JPG","page_title":"Kōnomine-ji","context_page_description":"Der Kōnomine-ji, mit den Go Chikurinzan und Jizōin in Yasuda, ist ein Tempel, der zur Buzan-Richtung des Shingon-Buddhismus gehört. In der traditionellen Zählung ist er der 27. Tempel des Shikoku-Pilgerwegs."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%9C%A3%E6%B3%A2%E8%92%99%E4%BD%A9%E5%B0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Map_commune_FR_insee_code_85260.png","page_title":"圣波蒙佩尼","context_page_description":"聖波蒙佩尼是法國羅亞爾河地區大區 旺代省的一個市鎮，屬於萊薩布勒多洛訥區 帕呂奧縣。該市鎮2009年時的人口 為811人。"},{"page_url":"https://fr.wikipedia.org/wiki/Scutellina","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Scutella_paulensis_MNHN.JPG","page_title":"Scutellina","context_page_description":"Les Scutellina sont un sous-ordre d'oursins plats."},{"page_url":"https://nl.wikipedia.org/wiki/Geelgerande_watertor","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Divingbeetles.jpg","page_title":"Geelgerande watertor","context_page_description":"De geelgerande watertor, ook wel geelgerande waterkever of gewone geelrand, is een kever uit de familie waterroofkevers.\\nDe geelgerande watertor kan een lichaamslengte bereiken van 3,5 centimeter en is een van de grootste kevers in België en Nederland. De geelgerande watertor is hier ook vrij algemeen, in tegenstelling tot andere grote kevers zoals de grote spinnende watertor en het vliegend hert. De geelgerande watertor is te herkennen aan het van boven bezien langwerpig ovale, maar zijwaarts gezien platte, gestroomlijnde lichaam, de zwartgroene kleur en de gele rand aan de buitenrand van de dekschilden. Het halsschild is geheel geel omrand en hieraan is de soort te onderscheiden van de meeste gelijkende waterkevers.\\nDe geelgerande watertor is een felle rover die voornamelijk op insecten jaagt, maar ook kleine vissen en salamanders buitmaakt. De kever kan in kleine tuinvijvers schadelijk zijn doordat kleine vissen en amfibieënlarven worden gegeten. Door kwekers van goudvissen en koikarpers wordt de kever beschouwd als een plaagsoort.\\nDe geelgerande watertor leeft in uiteenlopende wateren met een dichte onderwatervegetatie zoals sloten en vennen."},{"page_url":"https://en.wikipedia.org/wiki/Philodendron_xanadu","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Philodendron_xanadu_AK2.jpg","page_title":"Philodendron xanadu","context_page_description":"Philodendron xanadu is a plant that belongs to the family Araceae and subgenus Meconostigma, one of three subgenera within the genus Philodendron. This plant is native to Brazil, but is widely cultivated as a landscape plant in tropical, subtropical and warm temperate climates."},{"page_url":"https://de.wikipedia.org/wiki/Bourguignon-l%C3%A8s-Conflans","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Bourguignon_2.jpg","page_title":"Bourguignon-lès-Conflans","context_page_description":"Bourguignon-lès-Conflans ist eine Gemeinde im französischen Département Haute-Saône in der Region Bourgogne-Franche-Comté."},{"page_url":"https://pl.wikipedia.org/wiki/Stanis%C5%82aw_Grabski","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/53/Stanis%C5%82aw_Grabski_by_Lentz.jpg","page_title":"Stanisław Grabski","context_page_description":"Stanisław Grabski ps. Stanisław – polski polityk, ekonomista, poseł na Sejm Ustawodawczy oraz I kadencji w II RP, przewodniczący Rady Narodowej RP, wiceprzewodniczący Krajowej Rady Narodowej."},{"page_url":"https://en.wikipedia.org/wiki/Nativit%C3%A0_della_Vergine,_Thiene","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Chiesetta_Rossa_Thiene_21-09-08.jpg","page_title":"Natività della Vergine, Thiene","context_page_description":"Natività della Vergine, also known as \\"Ceseta Rossa\\", is a small Gothic church or oratory, located on Corso Garibaldi in Thiene, Italy. It was erected in 1470 by the aristocratic family Da Porto. It vertical facade echoes the nearby Castle of Thiene."},{"page_url":"https://it.wikipedia.org/wiki/Battaglia_di_Hannut","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Bundesarchiv_Bild_101I-127-0396-13A%2C_Im_Westen%2C_deutsche_Panzer.jpg","page_title":"Battaglia di Hannut","context_page_description":"La battaglia di Hannut fu uno scontro combattuto in Belgio tra due Panzer-Divisionen della Wehrmacht e due divisioni leggere meccanizzate francesi durante la fase iniziale della campagna di Francia del 1940, nella seconda guerra mondiale. Si trattò della prima grande battaglia di carri della guerra e del solo scontro corazzato in cui i carri francesi vennero impiegati in grandi formazioni e riuscirono, sfruttando le notevoli qualità tecniche dei mezzi, a contrastare ed a infliggere sensibili perdite ai vantati panzer tedeschi.\\nPeraltro, dopo oltre due giorni di battaglie, le divisioni corazzate tedesche misero in mostra una evidente superiorità di addestramento e di tattiche, e sfruttarono la loro capacità di manovrare armonicamente a gruppi, di coordinarsi grazie all'uso delle radio di bordo, e la migliore disciplina del tiro, per superare la dura resistenza e avanzare verso il varco di Gembloux, dopo aver decimato le forze meccanizzate francesi, entrate in azione coraggiosamente ma in modo frammentario e confuso."},{"page_url":"https://eo.wikipedia.org/wiki/Zeiningen","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/eb/Zeiningen_Oberdorf.jpg","page_title":"Zeiningen","context_page_description":"Zeiningen estas komunumo en la distrikto Rheinfelden de Kantono Argovio, Svislando. Ĝi havis 2199 loĝantojn je la 31-a de decembro 2008."},{"page_url":"https://cy.wikipedia.org/wiki/Cap_tyllog_morafia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Tylopilus_tabacinus_107775.jpg","page_title":"Cap tyllog morafia","context_page_description":"Math a rhywogaeth o ffwng yn nheulu'r Boletaceae yw'r Cap tyllog morafia. 'Y Capiau Tyllog' yw'r enw ar lafar ar y grwp mae'r ffwng yma'n perthyn iddo, ond nid yw'n derm gwyddonol. Gair arall am gap tyllog yw 'boled', a ddefnyddir hefyd i ddisgrifio rhai mathau o ffwng. Mae'r rhan oddi tano'n debycach i sbwng nag i degyll. Mae'r teulu Boletaceae yn gorwedd o fewn urdd y Boletales."},{"page_url":"https://en.wikipedia.org/wiki/Ralph_Mooney","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/CR014-Ralph-Mooney-The-Sound-of-Country-Music-1024x538.jpg","page_title":"Ralph Mooney","context_page_description":"Ralph Mooney was an American steel guitar player. He was inducted into the Steel Guitar Hall of Fame in 1983. He was the original steel guitarist in the Strangers.\\nA native of Duncan, Oklahoma, Mooney became a key figure in the country music scene around Bakersfield, California. He played on many records associated with the\\nBakersfield sound, including Wynn Stewart's \\"Wishful Thinking\\", Buck Owens' \\"Under Your Spell Again\\" and Merle Haggard's \\"Swinging Doors\\". He and guitarist James Burton released an instrumental album called Corn Pickin' and Slick Slidin' in 1968.\\nMooney played with many other country artists and was a member of Waylon Jennings' band for two decades. Jennings would often transition to Mooney's instrumentals with the lyrics, \\"Pick it, Moon\\".\\nThough best known for his instrumental work, Mooney co-wrote \\"Crazy Arms\\" with Chuck Seals; the song was Ray Price's first No. 1 country hit in 1956. Mooney said he wrote the song in 1949 while living in Las Vegas, getting the idea after his wife left him because of his drinking problem.\\nTyler Mayhan Coe dedicated a full episode of his podcast Cocaine & Rhinestones to Mooney."},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_Yhdysvaltain_presidenttien_ulkomaanmatkoista_(1990%E2%80%932000-luvut)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/George_Bush_and_Mikhail_Gorbachev_sign_the_START_1991.jpg","page_title":"Luettelo Yhdysvaltain presidenttien ulkomaanmatkoista (1990–2000-luvut)","context_page_description":"Tämä on luettelo Yhdysvaltain presidenttien ulkomaanmatkoista 1989–2008. Tässä artikkelissa on luettelo Yhdysvaltain presidenttien ulkomaanmatkoista George H. W. Bushista George W. Bushiin.\\nLuettelo on osa isompaa artikkelikokonaisuutta Luettelo Yhdysvaltain presidenttien ulkomaanmatkoista."},{"page_url":"https://de.wikipedia.org/wiki/Lenkgetriebe","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Draglink.JPG","page_title":"Lenkgetriebe","context_page_description":"Das Lenkgetriebe ist ein Teil der Lenkanlage eines Kraftfahrzeuges und setzt die Drehbewegung des Lenkrades in eine Schiebebewegung der Spurstangen um. Bei der Zahnstangenlenkung werden die Spurstangen von einer quer verschobenen Zahnstange, bei Lenkgetrieben mit Lenkstockhebel vom geschwenkten Lenkstockhebel bewegt."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%BE%D0%BB%D0%B8%D0%BD%D0%B0_%D0%9D%D0%B0%D0%BF%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/38/Vineyard_in_Napa_Valley_4_edit1.jpg","page_title":"Долина Напа","context_page_description":"Долина Напа — американская виноградарская зона, расположенная в Напа Каунти, Калифорния, США. Долина Напа считается одним из лучших винодельческих регионов в мире. Коммерческое производство вина в этом регионе датируется XIX веком, но производство вин высшего качества в долине относится к началу 1960-х годов.\\nУдачное сочетание средиземноморского климата, географических условий и геологии региона способствуют выращиванию здесь качественного винограда. В 1858 году Джон Петчет создал первый коммерческий виноградник в долине Напа. В 1861 году Чарльз Круг создал в долине Напа первые коммерческие винные заводы в Св. Елены. Виноградарство в Напе терпело несколько неудач в конце 19 и начале 20 веков, в том числе из-за вспышки заболевания виноградной лозы-филлоксеры и Великой Депрессии. Ныне виноделие в долине Напа восстановилось. Долина Напа-это сейчас главная зона винного туризма."},{"page_url":"https://simple.wikipedia.org/wiki/Veterinary_medicine","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Kitten_check_up_at_Guantanamo.jpg","page_title":"Veterinary medicine","context_page_description":"Veterinary medicine is a branch of medicine that deals with the health of animals. It is the study and practice of preventing, diagnosing and treating disease and injuries in animals. Veterinary medicine covers all species of animals, including both domesticated animals and wild animals.\\nPeople who study and practice veterinary medicine professionally are called veterinarians.\\nVeterinary science tries to help human health by monitoring and controlling zoonotic diseases."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Recorded_Texas_Historic_Landmarks_(Sabine-Travis)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/0011Gulf_Colorado_and_Sante_Fe_Station_NW_Fort_Worth_Texas.jpg","page_title":"List of Recorded Texas Historic Landmarks (Sabine-Travis)","context_page_description":"The following is a partial list of Recorded Texas Historic Landmarks arranged by county as designated by the Texas Historical Commission and local county historical commissions in Texas. This page includes RTHLs in the following counties: Sabine, San Augustine, San Jacinto, San Patricio, San Saba, Schleicher, Scurry, Shackelford, Shelby, Sherman, Smith, Somervell, Starr, Stephens, Sterling, Stonewall, Sutton, Swisher, Tarrant, Taylor, Terrell, Terry, Throckmorton, Titus, Tom Green, and Travis.\\nKEY\\nLandmarks with multiple historic designations are colored according to their highest designation within the following hierarchy."},{"page_url":"https://es.wikipedia.org/wiki/Kupu_(Kuusalu)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Kupukivi.jpg","page_title":"Kupu (Kuusalu)","context_page_description":"Kupu es una localidad del municipio de Kuusalu en el condado de Harju, Estonia, con una población a final del año 2011 de 24 habitantes.\\nSe encuentra ubicada al este del condado, cerca de la costa del mar Báltico, de la frontera con el condado de Lääne-Viru y del parque nacional de Lahemaa.​"},{"page_url":"https://pl.wikipedia.org/wiki/Entre_Folhas","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Bras%C3%A3o_de_Entre_Folhas_MG.png","page_title":"Entre Folhas","context_page_description":"Entre Folhas – miasto i gmina w Brazylii, w stanie Minas Gerais. Znajduje się w mikroregionie Caratinga."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B2%D0%B5%D0%BD%D1%86%D0%B8%D1%86%D0%BA%D0%B8%D0%B9,_%D0%93%D0%B5%D0%BD%D1%80%D0%B8%D1%85_%D0%98%D0%BF%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Genryh_Ipalitavich_Sviancicki_-_authograph_-_1910_AD.jpg","page_title":"Свенцицкий, Генрих Ипполитович","context_page_description":"Ге́нрих Ипполи́тович Свенци́цкий — инженер путей сообщения, общественный деятель и политик, член Государственной думы 3-го и 4-го созывов от Виленской губернии."},{"page_url":"https://sh.wikipedia.org/wiki/Forma_(botanika)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Abies_procera_%27Glauca%27_-_20101120-02.jpg","page_title":"Forma (botanika)","context_page_description":"Forma – u botaničkoj nomenklaturi – jedan je od \\"sekundarnih\\" taksonomskih rangova, ispod variejteta, a koji je ispod podvrste date vrste biljaka. Drugim riječima, to je infraspecijski takson.\\nAko se, u opisu taksona, navodi više od tri naziva daje se primjerena \\"klasifikacija\\", ali u tri dijela koji čine \\"ime\\": ime roda, ime vrste i infraspecijski epitet.\\nU oznaci forme stavlja se skraćenica \\"f.\\" ili puno \\"forma\\", da se zna da epitet označava rang. Forma se ne piše italikom, tj. kurzivom.\\nNaprimjer:\\nAcanthocalycium spiniflorum f. klimpelianum ili\\nAcanthocalycium spiniflorum forma klimpelianum Donald\\nCrataegus aestivalis Torr. & A.Gray var. cerasoides Sarg. f. luculenta Sarg. je klasifikacija biljke čije ime je:\\nCrataegus aestivalis Torr. & A.Gray f. luculenta Sarg.\\nForma obično označava grupu sa primijetnim morfološkim odstupanjima od ostatka populacije. Uobičajena taksonomski praksa je da za jedinke koje se svrstavaju u formu nije nužno poznavati da li su usko srodne Naprimjer, bijelocvijetne biljke vrsta koje obično imaju obojene cvjetove, mogu se grupirati i pod jednim nazivom."},{"page_url":"https://de.wikipedia.org/wiki/Lozio","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Villa_-_Lozio_%28Foto_Luca_Giarelli%29.jpg","page_title":"Lozio","context_page_description":"Lozio ist eine italienische Gemeinde mit 405 Einwohnern in der Provinz Brescia in der Lombardei. Die Gemeinde liegt etwa 50 Kilometer von Brescia, gehört zur Comunità Montana di Valle Camonica und grenzt unmittelbar an die Provinz Bergamo."},{"page_url":"https://de.wikipedia.org/wiki/Humber_Super_Snipe","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/12/Humber_Super_Snipe_Series_V_Estate_rear.jpg","page_title":"Humber Super Snipe","context_page_description":"Der Humber Super Snipe ist ein PKW der oberen Mittelklasse, der von der Rootes Group hergestellt und unter ihrer Marke Humber verkauft wurde."},{"page_url":"https://en.wikipedia.org/wiki/Slavko_L%C3%B6wy","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/S._Lowy.jpg","page_title":"Slavko Löwy","context_page_description":"Slavko Löwy was well-known Croatian architect."},{"page_url":"https://nl.wikipedia.org/wiki/Langerlo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/De_binnenkant_van_de_kapel.JPG","page_title":"Langerlo","context_page_description":"Langerlo is een gehucht van Genk, gelegen in het zuiden van deze stad, nabij het Albertkanaal.\\nKerkelijk gezien hoort Langerlo bij de parochie Onze-Lieve-Vrouw Moeder der Kerk, waarvan het kerkgebouw in de nabijgelegen wijk Kolderbos is gevestigd.\\nNabij Langerlo ligt de Elektriciteitscentrale van Langerlo, er zijn sluizen in het kanaal, waarover een spoorbrug loopt, en er is een insteekhaven. Ten zuidoosten van Langerlo bevindt zich het Observatie- en behandelingscentrum Bethanië, dat in 1965 werd gesticht. Verder naar het oosten ligt de wijk Sledderlo.\\nAan beide zijden van het kanaal vindt men uitgestrekte industrieterreinen.\\nDe elektriciteitscentrale heeft een vermogen van 556 MW. Het is een kolencentrale, die tevens hout en aardgas verstookt. Ze is onderdeel van energiebedrijf E.ON.\\nLangerlo is het oudste gehucht van de stad Genk in de Belgische provincie Limburg. Het ligt in het zuiden van Genk. Het bezit net zoals vroeger een ‘lo’, een open vlakte."},{"page_url":"https://en.wikipedia.org/wiki/Battle_of_Jerusalem_Plank_Road","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Jerusalem_Plank_Road_Battlefield_Virginia.jpg","page_title":"Battle of Jerusalem Plank Road","context_page_description":"The Battle of Jerusalem Plank Road, also known as the First Battle of the Weldon Railroad, was fought June 21–23, 1864, near Petersburg, Virginia. It was the first of a series of battles during the Siege of Petersburg aimed at extending the Union siege lines to the west and cutting the rail lines supplying Petersburg. Two infantry corps of the Union Army of the Potomac attempted to sever the railroad, but were attacked and driven off by the Confederate Army of Northern Virginia's Third Corps, principally the division of Brig. Gen. William Mahone. The inconclusive battle left the Weldon Railroad temporarily in Confederate hands, but the Union Army began to extend its fortifications to the west, starting to increase the pressure of the siege."},{"page_url":"https://vi.wikipedia.org/wiki/Cataphract","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Knight-Iran.JPG","page_title":"Cataphract","context_page_description":"Cataphract hay thiết kỵ là tên gọi của một loại kỵ binh nặng được áp dụng trong chiến tranh cổ đại tại Trung Á, Đông Á, Trung Đông, Bắc Phi và châu Âu.\\nCái tên bắt nguồn từ chữ Hy Lạp cổ κατάφρακτος kataphraktos, có nghĩa \\"được bảo hộ\\" hay \\"bao phủ mọi mặt\\". Trong lịch sử, cataphract là lực lượng kị binh nặng bậc nhất, với ngựa chiến và kị sĩ đều được trang bị loại giáp nặng phủ kín từ đầu đến chân, trong khi vũ khí được sử dụng phổ biến nhất cũng thuộc hạng nặng như thương, giáo dài, hoặc cung tên, mác.\\nTrong suốt chiều dài lịch sử tồn tại, các cataphract phục vụ trong hàng ngũ quân chính quy hoặc lực lượng đột kích cho các quốc gia hoặc đế chế sử dụng loại kị binh này, nhờ khả năng xuyên phá đội hình bộ binh của đối phương. Cụ thể, một số quốc gia, dân tộc xây dựng đội quân cataphract là người Scythia, các dân tộc đông Iran, các đế chế Ba Tư cổ đại, vương quốc Pergamum, vương quốc Armenia cổ đại, đế chế Seleucid, đế quốc La Mã, đế chế Byzantine và người Goth. Ở Đông Á, người Mông Cổ, người Nữ Chân, các đế chế Trung Hoa, Nhật Bản hay các vương triều ở Việt Nam cũng từng xây dựng lực lượng thiết kị kiểu cataphract mang đặc trưng văn hóa riêng."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B2%D1%81%D0%B5%D0%BC%D0%B8%D1%80%D0%BD%D0%BE%D0%B3%D0%BE_%D0%BD%D0%B0%D1%81%D0%BB%D0%B5%D0%B4%D0%B8%D1%8F,_%D0%BD%D0%B0%D1%85%D0%BE%D0%B4%D1%8F%D1%89%D0%B5%D0%B3%D0%BE%D1%81%D1%8F_%D0%BF%D0%BE%D0%B4_%D1%83%D0%B3%D1%80%D0%BE%D0%B7%D0%BE%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Garamba_National_Park_overhead.jpg","page_title":"Список всемирного наследия, находящегося под угрозой","context_page_description":"Список всемирного наследия, находящегося под угрозой — список ценностей культурного и природного наследия, включённых в список всемирного наследия, которым угрожают серьёзные и конкретные опасности, такие как «угроза исчезновения вследствие прогрессирующего разрушения, проекты проведения крупных общественных или частных работ, быстрое развитие городов и туризма, разрушение в связи с изменением предназначения или права собственности на землю, серьезные повреждения вследствие неустановленной причины, заброшенность по каким-либо причинам, стихийные бедствия и катаклизмы, опасность вооружённых конфликтов, большие пожары, землетрясения, оползни, вулканические извержения, изменения уровня вод, наводнения, приливы».\\nВключение в список означает необходимость значительных работ по сохранению объектов всемирного наследия, с выделением финансовой помощи в рамках Конвенции об охране всемирного культурного и природного наследия.\\nСписок составляется, обновляется и публикуется Комитетом всемирного наследия в ходе ежегодных сессий комитета. В случае чрезвычайных обстоятельств Комитет может в любое время включить в список новый объект, собравшись на внеочередную сессию."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%9F%AF%E8%BE%BE%E4%BC%8A%C2%B7%E4%BD%90%E5%B0%94%E4%B8%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Kod%C3%A1ly_Zolt%C3%A1n_1930s.jpg","page_title":"柯达伊·佐尔丹","context_page_description":"高大宜·佐爾坦，匈牙利作曲家、民族音樂學家、教育家，以其創建的高大宜音樂教學法為世人所熟知。"},{"page_url":"https://hu.wikipedia.org/wiki/Gabriel_Achilier","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/ENTRENAMIENTO_SELECCI%C3%93N_ECUADOR_%2822464364018%29.jpg","page_title":"Gabriel Achilier","context_page_description":"Gabriel Eduardo Achilier Zurita ecuadori válogatott labdarúgó, aki jelenleg a Morelia játékosa.\\nA válogatott tagjaként részt vett a 2014-es labdarúgó-világbajnokságon, illetve a 2011-es, a 2015-ös és a 2016-os Copa Américán."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%91%D7%95%D7%91%D7%99%D7%AA_%D7%90%D7%A8%D7%95%D7%9B%D7%AA-%D7%97%D7%93%D7%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Corythoichthys_schultzi_R%C3%A9union.jpg","page_title":"אבובית ארוכת-חדק","context_page_description":"אבובית ארוכת-חדק הוא מין דג ממשפחת האבובוניים."},{"page_url":"https://pt.wikipedia.org/wiki/Ba%C5%99ice-Velk%C3%A9_T%C4%9B%C5%A1any","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/Coat_of_Ba%C5%99ice-Velk%C3%A9_T%C4%9B%C5%A1any.png","page_title":"Bařice-Velké Těšany","context_page_description":"Bařice-Velké Těšany é uma comuna checa localizada na região de Zlín, distrito de Kroměříž."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B5%D1%87%D0%BD%D1%8B%D0%B5_%D0%BE%D0%B3%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Breszt-Er%C5%91d.jpg","page_title":"Вечные огни","context_page_description":"Список мемориалов «Вечный огонь». Возможно, данный список неполный."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%96%B0%E5%9F%8E%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Yuya_Onsen01.jpg","page_title":"新城市","context_page_description":"新城市は、愛知県東部の東三河地方に位置する市。\\n豊橋市や豊川市の北にあり、旧設楽郡の玄関口にあたる。2005年10月1日に、南設楽郡鳳来町・作手村と新設合併し、愛知県内では豊田市に次いで2番目に広い面積を有する自治体である。"},{"page_url":"https://pl.wikipedia.org/wiki/Capitol_South","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Capitol_South_Station_2.jpg","page_title":"Capitol South","context_page_description":"Capitol South – stacja linii niebieskiej, pomarańczowej i srebrnej metra waszyngtońskiego. Przystanek został otwarty 1 lipca 1977 roku, początkowo tylko na linii niebieskiej; składy linii pomarańczowej docierają na niego od 17 listopada 1978 roku, a srebrnej od 26 lipca 2014 roku."},{"page_url":"https://cs.wikipedia.org/wiki/Look","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Perry-Mason-Look-1961.jpg","page_title":"Look","context_page_description":"Look byl čtrnáctideník publikovaný v Des Moines ve státě Iowa od roku 1937 do 1971, s velkým zaměřením na fotografie ilustrující články. Velký rozměr stránky, který byl od 28 do 35 centimetrů, byl zaveden časopisem Life, který byl vydáván teprve o několik měsíců dříve a skončil v roce 1972. Ve své době měl časopis nezanedbatelné místo v historii fotožurnalistiky za svůj významný přínos v publikování obrazových zpráv."},{"page_url":"https://fr.wikipedia.org/wiki/Alc%C3%A1zar_royal_de_Madrid","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Alcazar_de_Madrid_siglo_XVII.jpg","page_title":"Alcázar royal de Madrid","context_page_description":"L'Alcázar royal de Madrid fut la résidence de la famille royale espagnole et le siège de la cour depuis le règne de Charles Iᵉʳ jusqu'à sa destruction en 1734, alors que le trône était occupé par Philippe V. Actuellement, le Palais royal de Madrid s'élève à l'emplacement de l'Alcázar royal."},{"page_url":"https://it.wikipedia.org/wiki/Uwe_Rapolder","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Rapolder_uwe_600.jpg","page_title":"Uwe Rapolder","context_page_description":"Uwe Rapolder è un allenatore di calcio tedesco."},{"page_url":"https://sv.wikipedia.org/wiki/Lista_%C3%B6ver_fornl%C3%A4mningar_i_S%C3%B6dert%C3%A4lje_kommun_(S%C3%B6dert%C3%A4lje)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/S%C3%B6dert%C3%A4lje_105_1.JPG","page_title":"Lista över fornlämningar i Södertälje kommun (Södertälje)","context_page_description":"Lista över fornlämningar i Södertälje kommun (Södertälje) är en förteckning av ett urval av de fornlämningar som finns i Södertälje i Södertälje kommun."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B4%D5%AB%D5%B4%D5%A1%D5%A4%D6%80%D5%B8%D6%82%D5%A9%D5%B5%D5%A1%D5%B6_%D5%B7%D5%A1%D6%80%D5%AA%D5%B8%D6%82%D5%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/101st_with_members_of_dutch_resistance.jpg","page_title":"Դիմադրության շարժում","context_page_description":"Դիմադրության շարժում, ազգային-ազատագրական, հակաֆաշիստական շարժում Երկրորդ համաշխարհային պատերազմի տարիներին ՝ գերմանական, իտալական և ճապոնական օկուպանտների ու նրանց հետ գործակցած տեղական տարրերի դեմ։ Շարժանը մասնակցում էին բանվորներ և գյուղացիներ, հայրենասիրական տրամադրություն ունեցող քաղաքային մանր և մասամբ՝ միջին բուրժուազիան, մտավորականության և հոգևորականության մի մասը։ Շարժման մեջ եղել է երկու հիմնական հոսանքներ՝ դեմոկրատական, որ ղեկավարում էր բանվոր դասակարգը կոմունիստական կուսակցությունների գլխավորությամբ, առաջ էր քաշում ոչ միայն ազգային, այլև սոցիալական ազատագրման պահանջ, և աջ, պահպանողական, ղեկավարում էին բուրժական տարրերը, նպատակ ուներ վերականգնել ազգային բուրժուազիայի իշխանությունը և մինչօկուպացիոն կարգերը։ Մի շարք երկրներում դեմոկրատական և աջ հոսանքները շարժման ընթացքում համագործակցեցին թշնամու դեմ մղվող ընդհանուր պայքարում։ Դիմադրության շարժումը դրսևորվեց պայքարի բազմազան ձներով՝ հակաֆաշիստական պրոպագանդա և ագիտացիա, ընդհատակյա գրականության հրատարակում և տարածում, գործադուլ և դիվերսիա օկուպանտների համար արտադրանք թողարկող ձեռնարկություններում, զենքի ն զինամթերքի փոխադրումների խափանում, պարտիզանական շարժում և այլն։"},{"page_url":"https://sk.wikipedia.org/wiki/Post%C5%99elmov","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/PostrelmovHrobka.jpg","page_title":"Postřelmov","context_page_description":"Postřelmov je obec v Česku v okrese Šumperk v Olomouckom kraji. 1. januára 2013 tu žilo 3 245 obyvateľov, z toho 1 558 mužov a 1 687 žien, pričom priemerný vek v obci bol 41,4 roka."},{"page_url":"https://id.wikipedia.org/wiki/Mantikora","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Martigora_engraving.jpg","page_title":"Mantikora","context_page_description":"Mantikora adalah makhluk dalam legenda yang mirip dengan sfinks di Mesir. Makhluk itu bertubuh singa merah, berkepala manusia pria dengan tiga deretan gigi tajam, dan bersuara seperti terompet. Aspek lain tentang hewan tersebut berbeda antara suatu cerita dengan cerita lainnya. Bisa saja dikatakan bertanduk, bersayap, atau keduanya. Ekornya bisa saja berbentuk naga atau kalajengking, dan memiliki sengat beracun yang dapat digunakan untuk melumpuhkan maupun membunuh korbannya. Makhluk tersebut memakan seluruh tubuh mangsanya. Ia tidak menyisakan pakaian, tulang, atau apapun yang digunakan mangsanya saat itu. Maka selama abad awal, ada keyakinan bahwa bila seseorang menghilang, itu merupakan bukti keberadaan mantikora sehingga mantikora dianggap nyata. Telapak kakinya bisa berbentuk kaki naga, tetapi sering kali dikatakan seperti cakar singa. Ukuran tubuhnya berkisar antara ukuran singa sampai ukuran kuda. Makhluk itu juga sering kali disalah sangka sebagai pria berjanggut jika dilihat dari kejauhan."},{"page_url":"https://it.wikipedia.org/wiki/Joaquim_Chissano","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Joaquim_Chissano.jpg","page_title":"Joaquim Chissano","context_page_description":"Joaquim Alberto Chissano è un politico mozambicano, secondo presidente del Mozambico dal 1986 al 2005. Da allora, egli è stato chiamato come mediatore per favorire il dialogo in questioni internazionali e quale inviato diplomatico dell'ONU. Chissano è anche il presidente dell'associazione che riunisce gli ex capi di stato e di governo africani."},{"page_url":"https://pl.wikipedia.org/wiki/Storczyk_m%C4%99ski","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ca/Orchis_mascula_Saarland_03.jpg","page_title":"Storczyk męski","context_page_description":"Storczyk męski – gatunek byliny należący do rodziny storczykowatych."},{"page_url":"https://ms.wikipedia.org/wiki/Senarai_jambatan_gantung_terpanjang","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Storeb%C3%A6ltsbroen-2.jpg","page_title":"Senarai jambatan gantung terpanjang","context_page_description":"Kepanjangan rentang utama ialah kaedah paling biasa dalam membandingkan saiz jambatan-jambatan gantung, selalunya berkait dengan ketinggian menara dan kerumitan kejuruteraan yang terlibat dalam mereka bentuk dan membina jambatan berkenaan.\\nJambatan gantung mempunyai rentang terpanjang berbanding jenis jambatan lain. Jambatan tali gai, rekaan terpanjang kedua, hanya praktikal untuk rentangan sedikit melebihi 1 kilometer. Maka 17 jambatan dalam senarai ini ialah kesemua 17 rentangan terpanjang buat masa kini bagi kesemua jenis jambatan untuk kenderaan."},{"page_url":"https://en.wikipedia.org/wiki/Frederick_Irwin","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/Frederick_Irwin_%281788-1860%29.jpg","page_title":"Frederick Irwin","context_page_description":"Lieutenant-Colonel Frederick Chidley Irwin, KH was acting Governor of Western Australia from 1847 to 1848.\\nBorn in 1794 in Drogheda, Ireland, Frederick Chidley Irwin was the son of Reverend James Irwin. Some sources give the year 1788 as his birthyear. In 1808, he was commissioned into the 83rd Regiment of Foot. He saw service in Spain and Portugal, and took part in several major battles of the Peninsula War, for which he was awarded a medal. In 1816-17 he was stationed in Cape of Good Hope, and later in Ceylon.\\nIn 1828, the British government decided to establish a colony on the western coast of Australia, and a cousin of Irwin's, James Stirling, was appointed its first Lieutenant-Governor. Irwin was subsequently sent to the colony as a major in command of a detachment of the 63rd Regiment of Foot, whose mission was to protect and help establish the colony. He arrived with his men on board HMS Sulphur in June 1829, six days after the arrival of the first settlers and Stirling on the Parmelia.\\nIrwin's position as officer commanding the troops afforded him the further position of vice chairman of the Legislative Council appointed by Stirling in January 1831."},{"page_url":"https://fr.wikipedia.org/wiki/Naufrage_du_Sewol","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Memorial_for_the_victims_of_the_sinking_of_the_MV_Sewol_47.JPG","page_title":"Naufrage du Sewol","context_page_description":"Le naufrage du Sewol s'est déroulé le 16 avril 2014, sur le trajet entre Incheon et Jeju en Corée du Sud. Le ferry a chaviré alors qu'il transportait 476 personnes, la plupart des lycéens de l'école secondaire Danwon, dans la ville d'Ansan. En tout, 304 passagers et membres d'équipage ont péri dans la catastrophe. Des 172 survivants, plus de la moitié ont été rescapés par des bateaux de pêche et par d'autres navires commerciaux arrivés sur la scène quelque 40 minutes après la garde côtière sud-coréenne.\\nLe naufrage du Sewol a causé des réactions très vives en Corée du Sud. Des accusations ont visé le capitaine et les membres d'équipage ainsi que l'exploitant du ferry et les fonctionnaires responsables de la supervision de l'exploitation. Le gouvernement coréen a également été accusé d'une réponse inadéquate à la tragédie et de tentatives de minimiser sa responsabilité. Le 15 mai 2014, le capitaine et trois membres d'équipage ont été accusés de meurtre; 11 autres membres d'équipage ont été accusés d'avoir abandonné le navire."},{"page_url":"https://en.wikipedia.org/wiki/1981","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Flag_of_Antigua_and_Barbuda.svg","page_title":"1981","context_page_description":"1981 was a common year starting on Thursday of the Gregorian calendar, the 1981st year of the Common Era and Anno Domini designations, the 981st year of the 2nd millennium, the 81st year of the 20th century, and the 2nd year of the 1980s decade."},{"page_url":"https://en.wikipedia.org/wiki/Anti-austerity_movement_in_Spain","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Acampada_Sol_ph03.jpg","page_title":"Anti-austerity movement in Spain","context_page_description":"The anti-austerity movement in Spain, also referred to as the 15-M Movement, and the Indignados Movement, was a series of protests, demonstrations, and occupations against austerity policies in Spain that began around the local and regional elections of 2011 and 2012. First starting on 15 May 2011, many of the subsequent demonstrations spread through various social networks such as Real Democracy NOW and Youth Without a Future.\\nSpanish media related the movement to the 2008–14 Spanish financial crisis, the Arab Spring, as well as demonstrations in North Africa, Iran, Greece, Portugal, in Iceland. The movement was also compared to Stéphane Hessel's political manifesto Time for Outrage!, which was seen to empower Spanish youth not in school, training, or employment. Protestors rallied against high unemployment rates, welfare cuts, politicians, and the two-party system in Spain, as well as the political system, capitalism, banks, and public corruption. Many called for basic rights, of home, work, culture, health and education.\\nAccording to RTVE, the Spanish public broadcasting company, between 6.5 and 8 million Spaniards participated in these events."},{"page_url":"https://en.wikipedia.org/wiki/Equation_clock","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Equation_of_time.svg","page_title":"Equation clock","context_page_description":"An equation clock is a mechanical clock which includes a mechanism that simulates the equation of time, so that the user can read or calculate solar time, as would be shown by a sundial. The first accurate clocks, controlled by pendulums, were patented by Christiaan Huyghens in 1657. For the next few decades, people were still accustomed to using sundials, and wanted to be able to use clocks to find solar time. Equation clocks were invented to fill this need.\\nEarly equation clocks have a pointer that moves to show the equation of time on a dial or scale. The clock itself runs at constant speed. The user calculates solar time by adding the equation of time to the clock reading. Later equation clocks, made in the 18th Century, perform the compensation automatically, so the clock directly shows solar time. Some of them also show mean time, which is often called \\"clock time\\"."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_okrese_Tachov","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Stud%C3%A1nka%2C_socha_svat%C3%A9ho_Ji%C5%99%C3%AD.jpg","page_title":"Seznam kulturních památek v okrese Tachov","context_page_description":"Tento seznam nemovitých kulturních památek v okrese Tachov vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu.\\nSeznam kulturních památek v Bezdružicích včetně částí obce Křivce, Pačín, Řešín a Zhořec\\nSeznam kulturních památek v Boru včetně částí obce Bezděkov, Borovany, Damnov, Holostřevy, Kosov, Lužná, Nový Dvůr a Skviřín\\nSeznam kulturních památek v Černošíně včetně částí obce Krásné Údolí, Lhota, Třebel a Víchov\\nSeznam kulturních památek v Chodové Plané včetně částí obce Boněnov, Dolní Kramolín, Michalovy Hory, Pístov, Výškov a Výškovice\\nSeznam kulturních památek v Chodském Újezdu včetně částí obce Horní Jadruž, Nahý Újezdec a Štokov"},{"page_url":"https://pl.wikipedia.org/wiki/Medal_za_Kampani%C4%99_Chi%C5%84sk%C4%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Medal_for_China_campaign%281901%29%2C_silver%2C_averse.jpg","page_title":"Medal za Kampanię Chińską","context_page_description":"Medal za Kampanię Chińską – rosyjskie odznaczenie państwowe nadawane uczestnikom walk w Chinach w latach 1900 – 1901."},{"page_url":"https://de.wikipedia.org/wiki/Kindenheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Aion_Kindenheim.jpg","page_title":"Kindenheim","context_page_description":"Kindenheim ist eine Ortsgemeinde im rheinland-pfälzischen Landkreis Bad Dürkheim und liegt im Nordwesten der europäischen Metropolregion Rhein-Neckar. Sie gehört der Verbandsgemeinde Leiningerland an."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%AA%E9%99%BD%E7%B3%BB%E5%A4%96%E8%A1%8C%E6%98%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Planets_everywhere_%28artist%E2%80%99s_impression%29.jpg","page_title":"太陽系外行星","context_page_description":"太陽系外行星，或簡稱系外行星，是位於太陽系之外，不繞行太陽公轉的行星。截至2020年6月底，已經被確認的系外行星總共有4281顆，當中約有71.3%是透過凌日現象發現的；這些行星分屬3163個行星系，其中有701個多行星系。克卜勒任務已經檢測到18,000顆行星候選者，包括262顆位於潛在適居帶的候選者。\\n在銀河系，估計有數十億顆恆星，不只在恆星周圍有行星，也有自由移動的行星質量天體，而已知最靠近的系外行星是比鄰星b。\\n幾乎所有已經發現的系外行星都在我們自己的銀河系內，但是有少量的銀河系外行星可能可以被檢測出來。哈佛－史密松天體物理中心在2013年1月提出的一份報告中提到：估計在銀河系內「至少有170億顆」地球尺度的系外行星。\\n數百年來，許多哲學家和科學家都認為在太陽系以外應該也有行星的存在，但是沒有辦法知道行星有多普遍，或是與太陽系行星的相似度又是如何。在19世紀，許多的偵測方法被提出來，但最終所有的天文學家得到的結果都是否定的。第一個被確認的檢測出現在1992年，發現有幾顆質量類似地球的天體環繞著脈衝星PSR B1257+12。在主序帶恆星發現行星的第一個偵測結果出現在1995年，在鄰近的飛馬座51發現了以4天週期公轉一週的巨大行星。由於觀測技術的進步，自此之後偵測到的數量與效率迅速的增加。有些系外行星被大望遠鏡直接拍攝到影像，但絕大多數的系外行星都是經由徑向速度測量檢出的。除了系外行星，「系外彗星」也被發現，也許在銀河系內也是很普遍的。\\n最常見的系外行星是氣體巨行星，相信是類似於木星或海王星，但這也反應了取樣偏差，因為大質量的行星比較容易被觀察到。一些相對比較輕的系外行星，質量只有地球的幾倍；如眾所周知，在統計上的研究表明它們的數量應該超過巨大的行星。雖然現在已經發現一小撮包括地球大小和更小的行星，似乎表現出其它的地球類似體屬性。也存在著有這行星質量的天體環繞著棕矮星和不受到恆星拘束在太空中自由移動的行星；然而，「行星」這個名詞尚未應用在這些天體上。\\n發現的太陽系外行星，特別是軌道位於適居帶，極有可能有液態水存在表面的那些行星，提高了搜尋外星生命的興趣。因此，尋找太陽系外的行星還包括適居行星，在太陽系外的行星適合承載生命的研究中，被考慮的因素相當廣泛。\\n在2013年1月7日，來自克卜勒任務太空天文台的天文學家宣布發現了KOI-172.02，一顆像地球的系外行星候選者，在一顆類似太陽的恆星的適居帶中環繞著，可能是「存在著外星生命的主要候選者」。"},{"page_url":"https://sv.wikipedia.org/wiki/Montsalier","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/ba/Map_commune_FR_insee_code_04132.png","page_title":"Montsalier","context_page_description":"Montsalier är en kommun i departementet Alpes-de-Haute-Provence i regionen Provence-Alpes-Côte d'Azur i sydöstra Frankrike. Kommunen ligger i kantonen Banon som ligger i arrondissementet Forcalquier. År 2009 hade Montsalier 107 invånare."},{"page_url":"https://cs.wikipedia.org/wiki/Socha_svat%C3%A9ho_Franti%C5%A1ka_Xaversk%C3%A9ho_(Krupka)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Krupka%2C_socha_sv._Franti%C5%A1ka_Xaversk%C3%A9ho.jpg","page_title":"Socha svatého Františka Xaverského (Krupka)","context_page_description":"Socha svatého Františka Xaverského je barokní socha sv. Františka Xaverského v Krupce u Teplic v Ústeckém kraji. Socha stojí v Husitské ulici od roku 1717. Připomíná morovou epidemii z roku 1680, při které ve městě zemřelo 327 lidí, tedy asi třetina tehdejších obyvatel. Jezuitskému misionáři obyvatelé přisoudili hlavní zásluhu na potlačení epidemie. Socha je jedním ze symbolů Krupky."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Eintr%C3%A4ge_im_National_Register_of_Historic_Places_im_Angelina_County","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Boynton-Kent_House%2C_Lufkin%2C_TX.jpg","page_title":"Liste der Einträge im National Register of Historic Places im Angelina County","context_page_description":"Die Liste der Registered Historic Places im Angelina County führt alle Bauwerke und historischen Stätten im texanischen Angelina County auf, die in das National Register of Historic Places aufgenommen wurden."},{"page_url":"https://ro.wikipedia.org/wiki/M%C4%83n%C4%83stirea_Aladja","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/BG_Aladzha_monastery_34.jpg","page_title":"Mănăstirea Aladja","context_page_description":"Mănăstirea Aladja este una din cele 120 mănăstiri din piatră situate în apropierea țărmului Mării Negre. Mănăstirea a fost amenajată în galeriile unor peșteri care au fost afectate de cutremure, în urma cărora intre galeriile longitudinale s-au stabilit legaturi pe verticala prin prăbușirile de rocă. Mănăstirea reprezinta unul dintre cele mai vechi asezaminte religioase de pe teritoriul Bulgariei.\\nA fost înființată în secolul 13 și locuită de călugării hermiți. Este situată în partea de nord-est a Bulgariei la 17 km de Varna și 3 km de Nisipurile de aur. Mănăstirea a fost deschisă pentru prima dată publicului în anul 1906 ca muzeu și sit turistic, câțiva ani mai târziu fiind declarată monument național de cultură și antichitate.\\nMănăstirea Aladzha are o biserică și o capelă mică care împreună formează un important monument medieval și istoric. Aceasta este una dintre cele mai bine conservate mănăstiri din piatră din Bulgaria și totodată ușor accesibile, conform stilului de viață al călugărilor care viețuiesc aici."},{"page_url":"https://it.wikipedia.org/wiki/San_Pio_X_(Vicenza)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Villa_Tacchi-2.jpg","page_title":"San Pio X (Vicenza)","context_page_description":"San Pio X è un quartiere di Vicenza appartenente alla terza circoscrizione."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D1%82%D0%B8%D1%86_%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D1%8B","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6d/RacekMaly.jpg","page_title":"Список птиц Украины","context_page_description":"Список птиц Украины — список всех видов птиц, которые были зарегистрированы на территории Украины."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%BA%B3%E5%8D%9A%E8%AE%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Narbonne_1657_Zeiller_15233.jpg","page_title":"纳博讷","context_page_description":"纳博讷，法国南部城市，奥克西塔尼大区奥德省的一个市镇，同时也是该省的一个副省会，下辖纳博讷区，其市镇面积为172.96平方千米，是该省面积最大的市镇；2017年1月1日时人口数量为54,700人，是该省人口最多的城市，在法国城市中排名第109位。\\n纳博讷位于奥德省东部，市区距离地中海海岸线约15千米。纳博讷历史悠久，罗马时期为纳博讷高卢行省的首府，多米蒂安大道由此通过，被称为“意大利以外的小罗马”，中世纪则长期为朗格多克的一个商业码头，现代则是一个区域性的中心城市和交通枢纽，法国两条铁路干线在此交汇。"},{"page_url":"https://zh.wikipedia.org/wiki/%E8%81%96%E4%BF%9D%E7%BE%85%E5%9C%B0%E9%90%B515%E8%99%9F%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Monotrilho_de_SP_%282%29.jpg","page_title":"聖保羅地鐵15號線","context_page_description":"聖保羅地鐵15號線是聖保羅地鐵6條路線之一，也是聖保羅都會鐵路交通網絡13條路線之一。此線是南美洲第一條以大眾交通形式營運的單軌鐵路，也是世界上首個使用龐巴迪Innovia單軌列車300的系統。完工後將成為南北美洲最大和最高容量的單軌鐵路系統，也是世界第二大的系統，僅次於重慶單軌列車。首段路線在2014年8月30日啟用，起初只在週末的早上10時至下午3時營運。截至2016年10月26日，此線由凌晨4時40分開始運行至午夜12時。此線可在維拉·普魯登特站轉乘聖保羅地鐵2號線，未來還可以在伊皮朗加站轉乘聖保羅都市圈鐵路10號線。\\n此線是無人駕駛，全長7.6 km，設有10個車站。完工後，此線將長約27公里，設18個車站。全線預計在2021年完工。"},{"page_url":"https://tt.wikipedia.org/wiki/%D0%A3%D1%80%D0%BC%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Ural_forest.jpg","page_title":"Урман","context_page_description":"Урман — агаччыл үсемлекләр белән капланган Җир йөзенең бер өлеше. Урманнар моннан 380 млн ел элек девон чорында барлыкка килгәннәр. Урманнар коры җирнең 27 %, 3,4 млрд. га мәйданын биләп тора, 30 проценты — ылыслы, 70 проценты яфраклы агачлардан тора.\\nӘлегә урманнар коры җирнең якынча өчтән бер өлешен тәшкил итә һәм Җир йөзендә һава сулаучы тормышның бар булуы өчен бик әһәмиятле роль уйныйлар.\\nУрманнарда, агач һәм үсемлекләрдән тыш, үзенә төрле микроорганизмнар, бөҗәкләр һәм хайваннарны алган үзенчәлекле катлаулы экосистема барлыкка килә."},{"page_url":"https://uk.wikipedia.org/wiki/The_Young_Gods","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Hellfest2019TheYoungGods_05.jpg","page_title":"The Young Gods","context_page_description":"The Young Gods — рок-гурт із Швейцарії, що грає у стилі пост-індастріал."},{"page_url":"https://da.wikipedia.org/wiki/Liberty_Stadium","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Liberty_Stadium_interior_-_2.jpg","page_title":"Liberty Stadium","context_page_description":"Liberty Stadium er et fodboldstadion i Swansea, Wales. Det bruges til fodbold, rugby og koncerter. Liberty Stadium har en kapacitet på 20.750. Stadionet er hjemmebanen for Swansea City F.C. og for rugbyholdet Ospreys."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%87%D9%8A%D9%84%D8%AA%D9%88%D9%86_%D8%A2%D8%B1%D9%85%D8%B3%D8%AA%D8%B1%D9%88%D9%86%D8%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Hilton_Armstrong.jpg","page_title":"هيلتون آرمسترونج","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nهيلتون آرمسترونج لاعب كرة سله من امريكا."},{"page_url":"https://es.wikipedia.org/wiki/Xavier_Bertoni","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Flickr_-_tpower1978_-_FIS_World_Championships_%285%29.jpg","page_title":"Xavier Bertoni","context_page_description":"Xavier Bertoni es un deportista francés que compitió en esquí acrobático.​ Ganó una medalla de bronce en el Campeonato Mundial de Esquí Acrobático de 2009, en la prueba de halfpipe.​"},{"page_url":"https://war.wikipedia.org/wiki/Acacia_blakelyi","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Acacia_blakelyiDistMap120.png","page_title":"Acacia blakelyi","context_page_description":"An Acacia blakelyi in uska species han Magnoliopsida nga ginhulagway ni Joseph Henry Maiden. An Acacia blakelyi in nahilalakip ha genus nga Acacia, ngan familia nga Fabaceae. Waray hini subspecies nga nakalista."},{"page_url":"https://pl.wikipedia.org/wiki/Dan_Burton","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Burton_Dan.jpg","page_title":"Dan Burton","context_page_description":"Dan Burton, właśc. Danny Lee Burton – amerykański polityk, członek Partii Republikańskiej. W latach 1983-2013 był przedstawicielem stanu Indiana w Izbie Reprezentantów Stanów Zjednoczonych, najpierw z szóstego, a od roku 2003 z piątego okręgu wyborczego."},{"page_url":"https://sv.wikipedia.org/wiki/Isopogon_polycephalus","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Isopogon_polycephalusDistMap28.png","page_title":"Isopogon polycephalus","context_page_description":"Isopogon polycephalus är en tvåhjärtbladig växtart som beskrevs av Robert Brown. Isopogon polycephalus ingår i släktet Isopogon och familjen Proteaceae. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://en.wikipedia.org/wiki/Cantiano","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Cantiano_le_sacre_rappresentazioni_a_congresso.jpg","page_title":"Cantiano","context_page_description":"Cantiano is a comune in the Province of Pesaro e Urbino in the Italian region Marche, located about 100 km west of Ancona and about 70 km southwest of Pesaro. The Burano flows in the town."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%BE%D0%BD_%D0%93%D0%BE%D0%B2%D0%B0%D1%80%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Ron_Howard_2011_Shankbone_3.JPG","page_title":"Рон Говард","context_page_description":"Ро́нальд Ві́льям Го́вард — американський кінорежисер, продюсер та актор. Має дві нагороди «Оскар» за стрічку «Ігри розуму», яка також є однією з найвідоміших робіт Говарда поруч із «Аполлон-13» та екранізаціями книжок Дена Брауна «Код да Вінчі», «Янголи і демони»."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Blatce","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Blatce_CoA.jpg","page_title":"Blatce","context_page_description":"Blatce sī Czech Liberec chiu Česká Lípa koān ê chi̍t ê hiuⁿ-siā."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%90%D1%82%D0%B8%D1%99%D0%B0%D0%BD%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/ATTIGLIANO_PIAZZA_CENTRALE.jpg","page_title":"Атиљано","context_page_description":"Атиљано је насеље у Италији у округу Терни, региону Умбрија.\\nПрема процени из 2011. у насељу је живело 1754 становника. Насеље се налази на надморској висини од 88 м."},{"page_url":"https://sv.wikipedia.org/wiki/Anders_Mattsson_(fotograf)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Anders_Mattsson_-_2005-Malm%C3%B6.jpg","page_title":"Anders Mattsson (fotograf)","context_page_description":"Carl Anders Lennart Mattsson, född 10 januari 1942 i Norrköping, är en svensk fotograf och konstnär."},{"page_url":"https://en.wikipedia.org/wiki/Mylabris_oleae","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Meloidae_-_Mylabris_oleae.JPG","page_title":"Mylabris oleae","context_page_description":"Mylabris oleae is a species of beetle belonging to the Meloidae family."},{"page_url":"https://fr.wikipedia.org/wiki/Leisse","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Leisse03.jpg","page_title":"Leisse","context_page_description":"La Leisse est une rivière du département de la Savoie sous-affluent du Rhône par le Doron de Termignon, l'Arc dans la vallée de la Maurienne, et l'Isère."},{"page_url":"https://vi.wikipedia.org/wiki/Barnhill,_Ohio","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Barnhill_OH_Town_Hall.JPG","page_title":"Barnhill, Ohio","context_page_description":"Barnhill là một làng thuộc quận Tuscarawas, tiểu bang Ohio, Hoa Kỳ. Năm 2010, dân số của làng này là 396 người."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/P%C5%99%C3%ADseka","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/P%C5%99%C3%ADseka_flag.jpg","page_title":"Příseka","context_page_description":"Příseka sī Czech Vysočina chiu Havlíčkův Brod koān ê chi̍t ê hiuⁿ-siā."},{"page_url":"https://it.wikipedia.org/wiki/Somerville_College","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Somerville_College_Oxford_Coat_Of_Arms_%28with_motto_and_crest%29.png","page_title":"Somerville College","context_page_description":"Il Somerville College è uno dei collegi costituenti l'Università di Oxford. Fondato nel 1879, era originariamente aperto solo alle donne; creato allo stesso tempo del Lady Margaret Hall per aumentare il numero di studentesse ad Oxford, il Somerville aveva nelle origini un'impostazione meno religiosa, e fu dedicato alla memoria di Mary Somerville, una matematica scozzese scomparsa in quegli anni.\\nDurante la prima guerra mondiale fu temporaneamente convertito in un ospedale, nel quale anche Robert Graves e Siegfried Sassoon furono pazienti.\\nIl collegio fu aperto agli uomini a partire dal 1992."},{"page_url":"https://en.wikipedia.org/wiki/Taronga_Zoo_Sydney","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Sydney_taronga_zoo.jpg","page_title":"Taronga Zoo Sydney","context_page_description":"Taronga Zoo Sydney is Australia's largest zoo, located in Sydney, New South Wales, Australia in the suburb of Mosman, on the shores of Sydney Harbour.\\nIt was officially opened on 7 October 1916. Taronga Zoo Sydney is managed by the Zoological Parks Board of New South Wales, under the trading name Taronga Conservation Society, along with its sister zoo, the Taronga Western Plains Zoo in Dubbo.\\nDivided into eight zoogeographic regions, the 28-hectare Taronga Zoo Sydney is home to over 4,000 animals of 350 species. It has a zoo shop, a cafe, and information centre."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1991","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Aude_biannic_stage_two_womens_tour_2014.jpg","page_title":"Lijst van personen geboren in 1991","context_page_description":"Dit is een lijst van personen die geboren zijn in 1991.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://hu.wikipedia.org/wiki/Anna_and_the_Barbies","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/P%C3%A1sztor_S%C3%A1muel.jpg","page_title":"Anna and the Barbies","context_page_description":"Az Anna and the Barbies 2004 őszén Budapesten alapított magyar zenekar. Alapítói az MC Jammin néven is ismert Pásztor Anna énekesnő, színésznő, koreográfus, táncművész és dalszövegíró, valamint testvére, Pásztor Sámuel, gitáros és dalszerző."},{"page_url":"https://vi.wikipedia.org/wiki/Prunus_mahaleb","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Ab_plant_2052.jpg","page_title":"Prunus mahaleb","context_page_description":"Prunus mahaleb là loài thực vật có hoa trong họ Hoa hồng. Loài này được Mill. mô tả khoa học đầu tiên năm 1768."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%A0%BC%E5%A5%A7%E7%88%BE%E6%A0%BC%C2%B7%E7%A7%91%E7%88%BE%E8%B2%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/2006-03-xx_Kolbe-Plastik_%28Marinemuseum_D%C3%A4nholm%29.jpg","page_title":"格奧爾格·科爾貝","context_page_description":"格奥尔格·科尔贝萨克森州瓦尔德海姆人，德国雕刻家，为19世纪雕刻家的代表人物，其充满活力、现代感与精简的古典风格与法国的马约尔相似。在19世纪末，科尔贝以画家的身份在慕尼黑、德累斯顿与巴黎出名。在二十世纪初在罗马的一次游历中投入雕刻，接受Louis Tuaillon的指导。1912年他在艺术上有了重要突破，发表作品\\"Die Tänzerin\\"，其最为闻名的作品。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D0%B0%D0%B9%D1%82%D1%82%D0%B5%D0%BA%D0%B5%D1%80,_%D0%94%D0%B6%D0%BE%D0%B7%D0%B5%D1%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Orchis_morio_%28Green-winged_Orchid%29_Specimen_in_Derby_Museum_herbarium.jpg","page_title":"Уайттекер, Джозеф","context_page_description":"Джозеф Уайттекер — британский ботаник, в 1839 году посетивший Австралию. 300 растений из той поездки были привезены в сады Кью, и 2200 засушенных экземпляров — в Музей и художественную галерею Дерби."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Dinkelsb%C3%BChl/Kernstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Dinkelsb%C3%BChl_Wethgasse_9-001.JPG","page_title":"Liste der Baudenkmäler in Dinkelsbühl/Kernstadt","context_page_description":"Diese Liste ist eine Teilliste der Liste der Baudenkmäler in Dinkelsbühl. Grundlage der Liste ist die Bayerische Denkmalliste, die auf Basis des bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt und aktualisiert wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A4%D0%BB%D1%96%D0%BD%D0%B4%D0%B5%D1%80%D1%81_(%D0%BE%D1%81%D1%82%D1%80%D1%96%D0%B2)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/LGATasmania_Flinders.png","page_title":"Фліндерс (острів)","context_page_description":"Фліндерс — острів у протоці Басса. Він знаходиться за 20 кілометрів від мису Портленд, північно-східного краю Тасманії, Австралії і є найбільшим островом у групі Фюрне."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%96%B0%E5%AE%BF%E4%B8%AD%E5%BF%83%E5%A4%A7%E5%8E%A6","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/31/Shinjuku-Center-Building-01.jpg","page_title":"新宿中心大厦","context_page_description":"新宿中心大廈是日本東京都新宿區西新宿超高層建築群中的一棟摩天大樓。"},{"page_url":"https://nl.wikipedia.org/wiki/Aymeri_de_Narbonne","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Enluminure_manuscrit_Aymeri_de_Narbonne.png","page_title":"Aymeri de Narbonne","context_page_description":"Aymeri de Narbonne is een gedicht uit de vierentwintig chansons de geste van de Willem van Orange cyclus. Het werd begin dertiende eeuw geschreven, voor een deel waarschijnlijk door de dichter Bertrand de Bar-sur-Aube uit Champagne, Frankrijk."},{"page_url":"https://de.wikipedia.org/wiki/Bab_Ezzouar","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Bab_Ezzouar_%D8%A8%D8%A7%D8%A8_%D8%A7%D9%84%D8%B2%D9%88%D8%A7%D8%B1.jpg","page_title":"Bab Ezzouar","context_page_description":"Bab Ezzouar ist eine Gemeinde in der Provinz Algier im Norden von Algerien mit 96.597 Einwohnern. Die Stadt hat den Charakter einer Vorstadt von Algier. Es ist eine der am schnellsten wachsenden Gemeinden in Algier und es wurden viele Hotels und Einkaufszentren in der Region errichtet. Bab Ezzouar ist auch der Standort der Universität für Wissenschaft und Technologie Houari Boumedienne, einer der bekanntesten technologischen Universitäten in Algerien."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%AC%AC41%E5%9B%9E%E4%B8%96%E7%95%8C%E9%81%BA%E7%94%A3%E5%A7%94%E5%93%A1%E4%BC%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Naumburger_Dom.jpg","page_title":"第41回世界遺産委員会","context_page_description":"第41回世界遺産委員会は、2017年7月2日から7月12日の間、ポーランドのクラクフで開催された。ヨーロッパでの世界遺産委員会開催は過去に何度もあるが、ポーランドでの開催は初である。クラクフはその歴史地区がいわゆる世界遺産第1号の一つとなった都市であり、この会議は2014年竣工のICEクラクフ・コングレス･センターでの開催となった。文化遺産18件、自然遺産3件、複合遺産0件の計21件が登録された結果、世界遺産リスト登録物件の総数は1,073件となった。"},{"page_url":"https://en.wikipedia.org/wiki/Mouse_Models_of_Human_Cancer_database","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/PDX_Like_Me.jpg","page_title":"Mouse Models of Human Cancer database","context_page_description":"The laboratory mouse has been instrumental in investigating the genetics of human disease, including cancer, for over 110 years. The laboratory mouse has physiology and genetic characteristics very similar to humans providing powerful models for investigation of the genetic characteristics of disease.\\nThe Mouse Models of Human Cancer database is a unique, comprehensive online knowledgebase of mouse models of human cancer hosted by The Jackson Laboratory with funding from the National Cancer Institute. MMHCdb is part of the Mouse Genome Informatics consortium and was first released in 1998 as the Mouse Tumor Biology database. MMHCdb contains genetic and genomic information about inbred mouse strains, genetically engineered mouse models and Patient Derived Xenograft models of human cancer. Data in MMHCdb is expertly curated from peer-reviewed scientific publications or obtained as direct data submissions from individual investigators and large-scale research initiatives. MMHCdb, in collaboration with EMBL-EBI, co-developed the PDX Finder resource which serves as a global catalog of PDX models."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%B8%E0%B0%82%E0%B0%97%E0%B0%82_(%E0%B0%A8%E0%B1%86%E0%B0%B2%E0%B1%8D%E0%B0%B2%E0%B1%82%E0%B0%B0%E0%B1%81_%E0%B0%9C%E0%B0%BF%E0%B0%B2%E0%B1%8D%E0%B0%B2%E0%B0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Sangameswara_Temple%2C_Sangam%2C_Nellore_Dt_06.JPG","page_title":"సంగం (నెల్లూరు జిల్లా)","context_page_description":"సంగం ఆంధ్ర ప్రదేశ్ రాష్ట్రం, శ్రీ పొట్టి శ్రీరాములు నెల్లూరు జిల్లాలో ఇదే పేరుతో ఉన్న మండలం యొక్క కేంద్రము. ఇది సమీప పట్టణమైన నెల్లూరు నుండి 32 కి. మీ. దూరంలో ఉంది. 2011 భారత జనగణన గణాంకాల ప్రకారం ఈ గ్రామం 2576 ఇళ్లతో, 10698 జనాభాతో 2098 హెక్టార్లలో విస్తరించి ఉంది. గ్రామంలో మగవారి సంఖ్య 4950, ఆడవారి సంఖ్య 5748. షెడ్యూల్డ్ కులాల సంఖ్య 1583 కాగా షెడ్యూల్డ్ తెగల సంఖ్య 1025. గ్రామం యొక్క జనగణన లొకేషన్ కోడ్ 591933 .పిన్ కోడ్: 524308."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A0%D0%B0%D1%82%D0%BE%D0%B2%D0%B8_%D0%B7%D0%B2%D0%B5%D0%B7%D0%B4%D0%B0:_%D0%A3%D1%81%D0%BF%D0%BE%D0%BD_%D0%A1%D0%BA%D0%B0%D1%98%D0%B2%D0%BE%D0%BA%D0%B5%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/J._J._Abrams_by_Gage_Skidmore.jpg","page_title":"Ратови звезда: Успон Скајвокера","context_page_description":"Ратови звезда: Успон Скајвокера, познат и као Ратови звезда — епизода IX: Успон Скајвокера је амерички научнофантастични филм из 2019. године, режисера, сценаристе и продуцента Џеј-Џеј Ејбрамса који представља девети део филмског серијала Ратови звезда и последњи у трилогији наставака, иза филмова Буђење силе и Последњи џедаји. У главним улогама су Кери Фишер, Марк Хамил, Адам Драјвер, Дејзи Ридли, Џон Бојега, Оскар Ајзак, Ентони Данијелс, Наоми Аки, Донал Глисон, Ричард Е. Грант, Лупита Нјонго, Кери Расел, Џонас Суотамо, Кели Мари Трен, Били Ди Вилијамс и Ијан Макдиармид.\\nНакон што је нова трилогија најављена 2012. године, првобитно је требало да режисер филма Последњи џедаји, Рајан Џонсон, напише сценарио за епизоду IX. У августу 2015. године, Колин Тревороу је одабран за режију, али је 2017. године напустио пројекат, због креативних разлика са продуценткињом Кетлин Кенеди, а Ејбрамс је унајмљен пар дана касније. Снимање филма почело је 1. августа 2018. у Енглеској, а завршено је 15. фебруара 2019; пост-продукција је завршена 24. новембра исте године. Са буџетом од 275 милиона долара, један је од најскупљих филмова икада снимљених."},{"page_url":"https://fr.wikipedia.org/wiki/Andr%C3%A9s_Hurtado_de_Mendoza","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/23/Andres_Hurtado_de_Mendoza.jpg","page_title":"Andrés Hurtado de Mendoza","context_page_description":"Andrés Hurtado de Mendoza, marquis de Cañete est un militaire et homme politique espagnol, vice-roi du Pérou de 1556 à 1560."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%88%B6%E6%9C%8D_(%E3%83%8A%E3%83%81%E3%82%B9%E8%A6%AA%E8%A1%9B%E9%9A%8A)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Bundesarchiv_Bild_146-1980-073-19A%2C_Emil_Maurice.jpg","page_title":"制服 (ナチス親衛隊)","context_page_description":"本稿ではドイツの政党国家社会主義ドイツ労働者党の準軍事組織である親衛隊の制服について記述する。"},{"page_url":"https://fr.wikipedia.org/wiki/Omar_Effendi","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Central_Market_%28Orosdi%29_Back_Door.jpg","page_title":"Omar Effendi","context_page_description":"Omar Effendi est la plus ancienne et la plus connue chaîne de magasins d’Égypte.\\nLe grand magasin Osrodi-Back est fondé en 1856 au Caire par deux juifs autrichiens, Leon Osrodi et Hermann Back. Le magasin séduit la clientèle européenne, essentiellement britannique et française, et les classes aisées égyptiennes. Il crée des filiales, dont un grand magasin à Alexandrie.\\nDans les années 1920, la société prend son nom actuel.\\nOmar Effendi est nationalisée en 1957-1961, dans le cadre de la socialisation de l’économie égyptienne après la révolution de 1952.\\nAvec l’enrichissement de la bourgeoisie lors du mouvement de libéralisation économique des années 1990-2000, la chaîne de magasins est délaissée par sa clientèle, et devient de moins en moins attractive.\\nEn 2006, le réseau est vendu à la société saoudienne Anwal, pour 589 millions de livres égyptiennes, sous la responsabilité du premier ministre Ahmad Nazif et de l’industriel Ahmad Ezz, dans des conditions et à un prix qui paraissent douteuses."},{"page_url":"https://en.wikipedia.org/wiki/Katzelsdorf","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/aa/Katzelsdorf_Hauptstra%C3%9Fe.jpg","page_title":"Katzelsdorf","context_page_description":"Katzelsdorf is a municipality in the district of Wiener Neustadt-Land in Lower Austria, Austria. It is situated at the foot of the Rosalia Mountains, on the river Leitha, 5 km southeast of Wiener Neustadt."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%B0%B4%E8%AD%A6%E7%B8%BD%E5%8D%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/HK_TapMunPolicePost.JPG","page_title":"水警總區","context_page_description":"水警总区，隶属于香港警务处行动处行动部，主要责任为维持香港水域及离岛的公共安全，执行水上巡逻、打击偷渡及追截走私，并且在香港境内及邻近海域进行搜索及拯救。水警总区保卫长达近200公里的边界海岸线、管辖香港1,651平方公里的海域及261座岛屿；水师共119艘轮艇，为世界上规模最庞大的水上警察。"},{"page_url":"https://pl.wikipedia.org/wiki/Rak_jelita_grubego","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/AscendensKarzinomBiopsie.PNG","page_title":"Rak jelita grubego","context_page_description":"Rak jelita grubego – pierwotny nowotwór złośliwy jelita grubego wywodzący się z nabłonka błony śluzowej jelita grubego. Do raka jelita grubego zaliczany jest rak okrężnicy, rak zgięcia esiczo-odbytniczego i rak odbytnicy. Klinicznie bywa dzielony na raka okrężnicy i odbytnicy. Rak kanału i brzegu odbytu jest osobną jednostką kliniczną.\\nPod względem zapadalności na świecie stanowi drugi co do częstości nowotwór złośliwy u kobiet i trzeci u mężczyzn. W 2012 roku rozpoznano 1 340 000 przypadków raka jelita grubego i 690 000 zgonów z jego powodu. Histopatologicznie zdecydowaną większość nowotworów jelita grubego u ludzi stanowi gruczolakorak. Objawy choroby zależą od lokalizacji guza oraz jej zaawansowania. Początkowo nowotwór pozostaje bezobjawowy lub skąpoobjawowy. Typowym objawem raka jelita grubego jest krwawienie, które przy dalszej lokalizacji guza jest obserwowane jako jawna obecność krwi zmieszanej ze stolcem lub krwi na stolcu, a w przypadku bliższej lokalizacji guza krew ulega degradacji i świeża krew nie jest widoczna, a krwawienie objawia się obecnością ciemno zabarwionych stolców i niedokrwistości z niedoboru żelaza."},{"page_url":"https://ceb.wikipedia.org/wiki/Tillandsia_tricolor","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Tillandsia_tricolor_BotGardBln07122011B.jpg","page_title":"Tillandsia tricolor","context_page_description":"Espesye sa balili ang Tillandsia tricolor. Una ning gihulagway ni Diederich Franz Leonhard von Schlechtendal ug Adelbert von Chamisso. Ang Tillandsia tricolor sakop sa kahenera nga Tillandsia sa kabanay nga Bromeliaceae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://de.wikipedia.org/wiki/Laboe","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0a/Laboe_in_PLOE.png","page_title":"Laboe","context_page_description":"Das Ostseebad Laboe ist eine Gemeinde in der Probstei im Kreis Plön in Schleswig-Holstein am Ostufer der Kieler Förde.\\nDie Gemeinde ist ein Wohn- und Urlaubsort und schmückt sich mit dem Slogan „Die Sonnenseite der Kieler Förde“."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%9B%B2%E8%9D%BD%E7%A7%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Eichen-Schmuckwanze_Rhabdomiris_striatellus_2.jpg","page_title":"盲蝽科","context_page_description":"盲蝽科，或作盲椿象科，是一个数量庞大而且高度多样性的半翅目异翅亚目昆虫的科，皆为小型到中型的物种，体形多样。\\n本科现时包括有超过1300个属、合共超过一万个已知物种；而新的物种每年均有发现。本科最广为人知的物种均为农业上的害虫，会刺穿植物的组织，以吸取其汁液进食。这种进食的行为更不时将植物性病毒在农作物间传染，造成经济损失。有小量物种却是捕食性昆虫。"},{"page_url":"https://cs.wikipedia.org/wiki/%C4%8Cervenec_2018","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Imran_Khan_-_portrait_%28cropped%29.jpg","page_title":"Červenec 2018","context_page_description":"Červenec 2018 je 7. měsíc roku 2018, který začal v neděli 1. července a skončil v úterý 31. července."},{"page_url":"https://hu.wikipedia.org/wiki/Mikoviny_S%C3%A1muel","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Notitia_Hungariae%E2%80%A6.jpg","page_title":"Mikoviny Sámuel","context_page_description":"Mikoviny Sámuel, magyar matematikus, mérnök, földmérő, tanár, a magyar térképészet megalapítója. Két nemzet, a magyar és a szlovák büszkesége.\\nA 18. század jelentős magyar polihisztora, szerteágazó tevékenysége nagy hatással volt a tudományos életre, ő tekinthető a magyar térképészet megalapítójának, nagy jelentőségűek folyószabályozási és mocsárlecsapolási munkái, továbbá úttörő szerepet játszott a hazai műszaki felsőoktatás megteremtésében.\\nAzok közé az alkotók közé tartozik, akiknek a művei mind a mai napig időtállóak. Háromszáz éve – a török háborúkban és a kurucok szabadságharca után a nyomorúságba süllyedt és pusztasággá vált Magyarországon született. S bár polihisztor volt, az új országépítő és tudós generáció tagjaként a térképkészítésben alkotta a legmaradandóbbat. A magyar földmérés történetében ő tekinthető a tudományos kartográfia magyarországi megalapítójának.\\nA 19. század előhírnökeként, korát többszörösen megelőzve, üstökösként alkotott maradandót Mikoviny Sámuel. Jelentőségét, nagyságát a természettudományok és a technika történetében még ma sem lehet pontosan felmérni."},{"page_url":"https://sv.wikipedia.org/wiki/Absint","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Acorus_calamus_-_K%C3%B6hler%E2%80%93s_Medizinal-Pflanzen-006.jpg","page_title":"Absint","context_page_description":"Absint är en osötad, alkoholstark spritdryck, ofta med en svagt gulgrönaktig nyans."},{"page_url":"https://en.wikipedia.org/wiki/Bilateria","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Bilaterian_body_plan.svg","page_title":"Bilateria","context_page_description":"The bilateria or bilaterians are animals with bilateral symmetry as an embryo, i.e. having a left and a right side that are mirror images of each other. This also means they have a head and a tail as well as a belly and a back. Nearly all are bilaterally symmetrical as adults as well; the most notable exception is the echinoderms, which achieve secondary pentaradial symmetry as adults, but are bilaterally symmetrical during embryonic development.\\nMost animals are bilaterians, excluding sponges, ctenophores, placozoans and cnidarians. For the most part, bilateral embryos are triploblastic, having three germ layers: endoderm, mesoderm, and ectoderm. Except for a few phyla, bilaterians have complete digestive tracts with a separate mouth and anus. Some bilaterians lack body cavities, while others display primary body cavities or secondary cavities."},{"page_url":"https://fr.wikipedia.org/wiki/Tramway_de_Grenoble_%C3%A0_Chapareillan","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/07/Carte_postale_grenoble_5.jpg","page_title":"Tramway de Grenoble à Chapareillan","context_page_description":"Le tramway de Grenoble à Chapareillan est un tramway électrique suburbain français qui a circulé entre 1899 et 1947, desservant la rive droite de la vallée du Grésivaudan, jusqu'à la limite de la Savoie."},{"page_url":"https://es.wikipedia.org/wiki/Scalenghe","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Scalenghe_pan.jpg","page_title":"Scalenghe","context_page_description":"Scalenghe es una localidad y comune italiana de la provincia de Turín, región de Piamonte, con 3.156 habitantes."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D9%86%D8%BA%D8%A7_%D8%A5%D8%BA%D9%86%D8%A7%D8%B7%D9%8A%D9%88%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/AnjaIgnatius.jpg","page_title":"أنغا إغناطيوس","context_page_description":"أنغا إغناطيوس ‏ هي معلمة موسيقى وموسيقية وعازفة كمان فنلندية، ولدت في 2 يوليو 1911 في تامبيري في فنلندا، وتوفيت في 10 أبريل 1995 في هلسنكي في فنلندا."},{"page_url":"https://nl.wikipedia.org/wiki/Kees_de_Boer_(illustrator)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Kees_de_Boer_2012.jpg","page_title":"Kees de Boer (illustrator)","context_page_description":"Kees de Boer is een Nederlands striptekenaar, cartoonist en illustrator."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%9C%8B%E9%81%93254%E8%99%9F_(%E6%97%A5%E6%9C%AC)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Route_254_Hanabusa_interchange_2.JPG","page_title":"國道254號 (日本)","context_page_description":"国道254号是东京都文京区经埼玉县、群马县至长野县松本市的一般国道。"},{"page_url":"https://de.wikipedia.org/wiki/Bazemont","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Bazemont%2878%29-Ferme.jpg","page_title":"Bazemont","context_page_description":"Bazemont ist eine französische Gemeinde mit 1.560 Einwohnern im Département Yvelines in der Region Île-de-France. Sie gehört zum Arrondissement Saint-Germain-en-Laye und zum Kanton Aubergenville. Die Einwohner werden Bazemontais genannt."},{"page_url":"https://fr.wikipedia.org/wiki/Destruction_du_patrimoine_culturel_par_l%27%C3%89tat_islamique","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Lion_in_the_garden_of_Palmyra_Archeological_Museum%2C_2010-04-21.jpg","page_title":"Destruction du patrimoine culturel par l'État islamique","context_page_description":"À partir de 2014, l'État islamique procède à la destruction organisée et au vol d'objets appartenant au patrimoine culturel des territoires qu'il contrôle en Irak, en Syrie et en Libye. L'organisation terroriste a notamment ciblé des sites religieux ainsi que des sites archéologiques et antiques. La plupart des destructions sont réalisées à l'aide d'engins explosifs, à la masse ou au bulldozer.\\nEn Irak, entre la prise de Mossoul en juin 2014 et février 2015, l'État islamique a détruit au moins vingt-huit monuments historiques. Les œuvres et objets d'art dérobés ont parfois été conservés pour être revendus au profit de l'EI. Les sites archéologiques de Palmyre, Ninive et Hatra, ainsi que les villes de Mossoul et de Racca, sont les principales cibles des destructions.\\nL'État islamique dispose d'une unité spéciale chargée de la destruction du patrimoine culturel. La directrice générale de l'UNESCO, Irina Bokova, a qualifié ces activités de « génocide culturel » et appelle à la mobilisation des acteurs internationaux pour la préservation du patrimoine des zones contrôlées par l'EI."},{"page_url":"https://sv.wikipedia.org/wiki/Philipp_R%C3%B6sler","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Philipp_Roesler_World_Economic_Forum_2013_%282%29.jpg","page_title":"Philipp Rösler","context_page_description":"Philipp Rösler, född omkring den 24 februari 1973 i Khánh Hưng, nuvarande Sóc Trăng i Sóc Trăng-provinsen i Vietnam, är en tysk liberal politiker. Från maj 2011 till 2013 var han partiledare för Freie Demokratische Partei. I samband med valet till partiledare som efterträdare till Guido Westerwelle övertog han även posten som Tysklands vice förbundskansler och som näringslivs- och teknologiminister. Rösler tillkännagav sin avgång som partiledare vid en presskonferens 23 september 2013, dagen efter att partiet hamnat strax under femprocentsspärren i valet till förbundsdagen 2013, och därmed förlorat sina mandat i parlamentet.\\nFrån 28 oktober 2009 till 17 december 2013 ingick han i den federala Regeringen Merkel II, 2009-2011 som Tysklands hälsominister. Från den 18 februari 2009 till 27 oktober 2009 var han ekonomi-, arbets- och trafikminister och ställföreträdande ministerpresident i delstaten Niedersachsen.\\nRösler är till yrket ursprungligen läkare, med en akademisk doktorsgrad i medicin, och arbetade innan han blev heltidspolitiker som läkare och medicinsk officer inom Bundeswehr."},{"page_url":"https://en.wikipedia.org/wiki/Duke_of_Narbonne","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Denier_Narbonne_Alphonse_Jourdain.jpg","page_title":"Duke of Narbonne","context_page_description":"The title Duke of Narbonne was a title employed at various times by the overlords of Narbonne, while the direct power in the city was held by the viscounts. The prestige of the title probable attached to the fact that Narbonne had been a capital of the ancient Roman administration of the eponymous province of Gallia Narbonensis.\\nOn the death of his cousin Bertha of Rouergue in 1065, William IV of Toulouse inherited the county of Narbonne. His brother and successor, Raymond IV, elevated the status to that of duke. Raymond's son and successor, Alfonso Jordan, also employed the title with royal approval and his son, Raymond V placed it first before his other titles as an implication of its importance. The family was only dispossessed of the title when Raymond VI brought down the wrath of the French king for his supposed support of Cathar heresies.\\nIn 1215, following the successes of the Albigensian Crusade, Philip II of France granted Simon IV de Montfort, already Earl of Leicester, the titles of Duke of Narbonne and Count of Toulouse."},{"page_url":"https://en.wikipedia.org/wiki/Nancy,_France","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Nancy_Cathedral_BW_2015-07-18_16-22-28.jpg","page_title":"Nancy, France","context_page_description":"Nancy is the capital of the north-eastern French department of Meurthe-et-Moselle, and formerly the capital of the Duchy of Lorraine, and then the French province of the same name. The metropolitan area of Nancy had a population of 434,565 inhabitants at the 2011 census, making it the 20th largest urban area in France. The population of the city of Nancy proper was 104,321 in 2014.\\nThe motto of the city is Non inultus premor, Latin for '\\"I am not injured unavenged\\"'—a reference to the thistle, which is a symbol of Lorraine.\\nPlace Stanislas, a large square built between March 1752 and November 1755 by Stanislaus I of Poland to link the medieval old town of Nancy and the new town built under Charles III in the 17th century, is a UNESCO World Heritage Site, the first place in France and in the top four in the world."},{"page_url":"https://es.wikipedia.org/wiki/Historia_de_Marruecos","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/df/Hassan_II%2C_Marrakech%2C_1966.jpg","page_title":"Historia de Marruecos","context_page_description":"La historia de Marruecos se remonta a la época de la cultura capsiense, entre el 10 000 a. C. y el 6000 a. C., en un momento en que el Magreb era menos árido que en la actualidad. La lengua bereber llegó probablemente al mismo tiempo que la agricultura, y fue adoptada por la población ya asentada allí. El análisis del ADN da como resultado que varias poblaciones han contribuido a la mezcla de genes de los marroquíes, incluyendo, además de los grupos étnicos principales, bereberes y árabes, a fenicios, judíos sefardíes, y africanos subsaharianos.\\nLa evidencia arqueológica demuestra que la región ya estuvo habitada por homínidos desde hace cuatrocientos mil años.​ La historia escrita de Marruecos comienza con la colonización fenicia de la costa marroquí entre los siglos VIII y VI a.C., ​ aunque ya estuvo habitada por los bereberes unos 2000 años antes. En el siglo V a.C., los dominios de la ciudad estado de Cartago se extendieron por las costas de África del Norte.​ Permanecieron allí hasta finales del siglo III a.C.​ pero más tarde el territorio fue gobernado por monarcas nativos.​"},{"page_url":"https://pl.wikipedia.org/wiki/Pawe%C5%82_Churski","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Pawe%C5%82_Churski.jpg","page_title":"Paweł Churski","context_page_description":"Paweł Churski – polski geograf, specjalizujący się w zagadnieniach geografii społeczno-ekonomicznej i gospodarki przestrzennej oraz rozwoju regionalnego i polityki regionalnej."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%95%9C%EA%B5%AD%EC%A0%84%EB%A0%A5%EA%B8%B0%EC%88%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Kepcoencci.jpg","page_title":"한국전력기술","context_page_description":"한국전력기술주식회사는 대한민국의 원자력 및 화력발전소 기술자립을 위해 세워진 회사이다. 2009년말 UAE 원전수주에서 설계를 맡고 있다. 친환경 발전소 설계경험과 노하우를 바탕으로 탈황·탈질 등 첨단 대기오염방지설비사업, 에너지절약사업, 온실가스저감사업 등 환경사업과 신재생에너지 사업분야에서도 많은 성과를 보여주며 대한민국의 저탄소 녹색성장에 기여하고 있다. 흔히 줄여서 한전기술로 불린다. 주식의 65.78%를 한국전력이 소유하고 있는 한전 자회사이다."},{"page_url":"https://de.wikipedia.org/wiki/CFE-Baureihe_M","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/2M_auf_der_Holl_Holl-Br%C3%BCcke.jpg","page_title":"CFE-Baureihe M","context_page_description":"Die Compagnie de Chemin de Fer Franco-Ethiopien de Jibuti à Addis Abeba beschaffte 1950 von der Schweizerischen Lokomotiv- und Maschinenfabrik in Winterthur insgesamt 12 Diesellokomotiven. Sie werden als Baureihe M geführt, je nach Sprache wird auch die Bezeichnung M oder Type M verwendet. Die Bezeichnung leitet sich aus Service marchandises ab."},{"page_url":"https://en.wikipedia.org/wiki/Shippen_Township,_Tioga_County,_Pennsylvania","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Shippen_Township_Rise.jpg","page_title":"Shippen Township, Tioga County, Pennsylvania","context_page_description":"Shippen Township is a township in Tioga County, Pennsylvania, in the United States. The population was 527 at the 2010 census. Two Pennsylvania state parks, Colton Point and Leonard Harrison are in Shippen Township at the Pennsylvania Grand Canyon. The Grand Canyon Airport is also located on Pennsylvania Route 362 in Shippen Township."},{"page_url":"https://en.wikipedia.org/wiki/Hybrid_electric_vehicle","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/2016_Toyota_Prius_%28ZVW50R%29_Hybrid_liftback%2C_SMRT_taxis_%282017-11-29%29.jpg","page_title":"Hybrid electric vehicle","context_page_description":"A hybrid electric vehicle is a type of hybrid vehicle that combines a conventional internal combustion engine system with an electric propulsion system. The presence of the electric powertrain is intended to achieve either better fuel economy than a conventional vehicle or better performance. There is a variety of HEV types and the degree to which each function as an electric vehicle also varies. The most common form of HEV is the hybrid electric car, although hybrid electric trucks and buses also exist.\\nModern HEVs make use of efficiency-improving technologies such as regenerative brakes which convert the vehicle's kinetic energy to electric energy, which is stored in a battery or supercapacitor. Some varieties of HEV use an internal combustion engine to turn an electrical generator, which either recharges the vehicle's batteries or directly powers its electric drive motors; this combination is known as a motor–generator. Many HEVs reduce idle emissions by shutting down the engine at idle and restarting it when needed; this is known as a start-stop system."},{"page_url":"https://vi.wikipedia.org/wiki/Buc,_Yvelines","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/37/Buc_78_Mairie.jpg","page_title":"Buc, Yvelines","context_page_description":"Buc là một xã thuộc tỉnh Yvelines, trong vùng Île-de-France.\\nCác xã giáp ranh: Versailles về phía bắc, Jouy-en-Josas về phía đông bắc, Les Loges-en-Josas về phía đông nam, Toussus-le-Noble về phía nam, Châteaufort về phía cực tây nam và Guyancourt về phía tây."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D8%A7%D8%AF%D9%88_%D8%A7%D9%84%D8%B2%D8%A7%D9%83%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Wydad_Casablanca_vs_Wydad_de_Fes%2C_December_13_2009-3.jpg","page_title":"بادو الزاكي","context_page_description":"زكي بادو من مواليد سيدي قاسم في 2 أبريل 1959 هو كحارس مرمى مغربي سابق أصبح مدربا للمنتخب المغربي من 2004 إلى 2005 ثم من 2 ماي 2014 إلى غاية 10 فبراير/شباط 2016.\\nاشتهر الزاكي بتدخلاته الرائعة ومرونته الفائقة. بدأ في إظهار خبراته ومهارته مع نادي الوداد البيضاوي، وفي سنة 1979 أصبح حارسا للمنتخب الوطني الذي شارك معه في كأس الأمم الأفريقية لكرة القدم 1980 بنيجيريا وفاز بالميدالية البرونزية.\\nخاض أحسن تجربة في تاريخه الرياضي الحافل مع جيل 1986 في كأس العالم، عندما أبان عن علو كعبه في حراسة المرمى، ولم يدخل مرماه إلا هدفان فقط في أربع مباريات دولية لكأس العالم 1986 التي فتح فيها المغرب أبواب التأهل للأدوار الطلائعية في بطولة كأس العالم للدول الإفريقية والعربية، وبرزت مؤهلات بادو الزاكي عالميا في بطولة كأس العالم، عندما استطاع أن ينقذ مرماه من هدف محقق إثر تسديدة لنجم ألمانيا كارل-هاينتس رومنيغه.\\nوبفضل جهده ومثابرته المتواصلة، استطاع أن ينال الإعجاب والتقدير، فأحرز جائزة أحسن لاعب أفريقي سنة 1986.\\nوقد كان اسم \\"الزاكي بادو\\" متواجدا في إنجازا غير مسبوق في التقرير الذي أعلنه الاتحاد الدولي لتاريخ وإحصائيات كرة القدم، بدخوله قائمة أفضل حراس المرمى في العالم، على مر التاريخ."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%94%BC%EB%A6%AC%ED%94%BC%EB%A6%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/African_red_devil_peppers.jpg","page_title":"피리피리","context_page_description":"피리피리는 작고 매운 고추이다. 중국고추의 재배품종으로, 주로 아프리카에서 재배하며, 포르투갈인이 인도의 고아와 구자라트 지역에 심기도 했다."},{"page_url":"https://de.wikipedia.org/wiki/Fernsehsender_Monschau","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Sendemast_Lammersdorf_mit_neuer_Antenne_2013_aufgestockt.jpg","page_title":"Fernsehsender Monschau","context_page_description":"Der Fernsehsender Monschau oder auch Fernmeldeturm Lammersdorf steht bei Lammersdorf in der Gemeinde Simmerath in der Städteregion Aachen. Es handelt sich um einen Fernmeldeturm in Stahlfachwerkbauweise. Vor der Umstellung auf DVB-T wurde von hier aus die Nordwesteifel, teilweise die Stadt Aachen und die angrenzende Deutschsprachige Gemeinschaft Belgiens mit dem ZDF und WDR Fernsehen versorgt. Trotz der niedrigen Bauhöhe hatte er aufgrund seiner Lage auf einem Berg mit einer Höhe von 648 m ü. NN eine große Reichweite. Mit der Einführung von DVB-T in der Region Aachen am 20. November 2007 wurden die Fernsehsender außer Betrieb genommen. Vier Tage später wurde die Turmspitze mit der Sendeantenne demontiert. Die Übertragung von DVB-T/T2-Programmen ist in diesem Teil der Eifel nicht geplant. Der Turm trägt nun nur noch Mobilfunkantennen sowie UKW-Antennen zur Verbreitung des lokalen Radiosenders Antenne AC.\\nAm 6. September 2013 wurde der Sendeturm aufgestockt. Der genaue Grund für die Aufstockung sowie die aktuelle Gesamthöhe sind nicht bekannt. Bis dahin betrug die Gesamthöhe 66 Meter."},{"page_url":"https://cs.wikipedia.org/wiki/Moucha_dom%C3%A1c%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Moscas._Fecundaci%C3%B3n._Bastavales%2C_Bri%C3%B3n%2C_090905-Retouched.jpg","page_title":"Moucha domácí","context_page_description":"Moucha domácí je nejčastější druh dvoukřídlých vyskytující se v domovech. Často je považována za škůdce, který může přenášet vážné nemoci. Hlavní predátoři jsou pavouci, ropuchy a žáby. V letu dosahuje rychlosti kolem 8 km/h."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%BE%BE%E8%8E%89%E5%A8%85%C2%B7%E4%BB%80%E6%A2%85%E5%88%97%E5%A8%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/2017_UEC_Track_Elite_European_Championships_146_%28cropped%29.jpg","page_title":"达莉娅·什梅列娃","context_page_description":"達莉婭·米哈伊洛夫娜·什梅列娃生於莫斯科，是一名俄羅斯女子自由車運動員，主攻場地自由車項目。她早在2011年時便開始和隊友阿納斯塔西婭·沃伊諾娃搭檔參賽。2016年8月，兩人在里約奧運當中獲得女子團體追逐賽的銀牌。"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%D8%A7%D9%86%D8%AA%DB%8C%D8%A7%DA%AF%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/TorreTelef%C3%B3nicaChile.jpg","page_title":"سانتیاگو","context_page_description":"سانتیاگو پایتخت کشور شیلی در آمریکای جنوبی است و جمعیتی در حدود شش میلون و سیصد و ده هزار نفر دارد.\\nسانتیاگو بزرگترین شهر کشور شیلی است. این شهر در ارتفاع ۱۷۰۰ پایی از سطح دریا در دره مرکزی کشور واقع شده، و از لحاظ اداری بخشی از ناحیه پایتختی سانتیاگو است. با وجود پایتخت بودن سانتیاگو، کنگره ملی شیلی| مراجع قانونگذاری در نزدیکی ناحیه والپارایسو تشکیل می‌شود.\\nدو دهه رشد اقتصادی سانتیاگو را به یکی از پیچیده‌ترین نواحی پایتختی آمریکای لاتین به همراه توسعه گسترده حومه، بازارهای متعدد فروش، و معماری برجسته بلندمرتبه‌سازی تبدیل کرده‌است. این شهر همچنین به خاطر داشتن تماشایی‌ترین زیرساخت در آمریکای جنوبی، همچون مترو سانتیاگو و و یک «نوار ساحلی شمالی» جدید و درخشان به خود می‌بالد، یک سیستم بزرگراهی که از زیر مرکز شهر عبور کرده و محدوده‌های شرقی و غربی شهر را ظرف ۱۵ دقیقه به هم متصل می‌کند. سانتیاگو مقر بسیاری از شرکت‌های مهم و نیز از لحاظ منطقه‌ای یک مرکز مهم اقتصادی است."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9A%E3%83%AB%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Jos%C3%A9_de_San_Mart%C3%ADn_%28retrato%2C_c.1828%29.jpg","page_title":"ペルー","context_page_description":"ペルー共和国、通称ペルーは、南アメリカ西部に位置する共和制国家。首都はリマ。\\n北にコロンビア、北西にエクアドル、東にブラジル、南東にボリビア、南にチリと国境を接し、西は太平洋に面する。\\n紀元前から多くの古代文明が栄えており、16世紀までは当時の世界で最大級の帝国だったインカ帝国の中心地だった。その後スペインに征服された植民地時代にペルー副王領の中心地となり、独立後は大統領制の共和国となっている。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_Isolepis_species","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Flora_Antarctica_Plate_L.jpg","page_title":"List of Isolepis species","context_page_description":"List of Isolepis species — a cosmopolitan genus of flowering plants in the sedge family, Cyperaceae."},{"page_url":"https://pt.wikipedia.org/wiki/Alfred_Bessette","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Irmao_andre.jpg","page_title":"Alfred Bessette","context_page_description":"Irmão André foi um religioso canadense, ao qual são creditados milhares de supostas curas milagrosas."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9C%D1%96%D0%BD%D1%96%D1%81%D1%82%D1%8D%D1%80%D1%81%D1%82%D0%B2%D0%B0_%D1%9E%D0%BD%D1%83%D1%82%D1%80%D0%B0%D0%BD%D1%8B%D1%85_%D1%81%D0%BF%D1%80%D0%B0%D1%9E_%D0%A1%D0%A1%D0%A1%D0%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/%D0%A2%D1%80%D0%B0%D0%BD%D1%81%D0%BF%D0%BE%D1%80%D1%82%D0%BD%D0%B0%D1%8F_%D0%9C%D0%B8%D0%BB%D0%B8%D1%86%D0%B8%D1%8F_%D0%9C%D0%92%D0%94_%D0%A1%D0%A1%D0%A1%D0%A0.JPG","page_title":"Міністэрства ўнутраных спраў СССР","context_page_description":"Міністэрства ўнутраных спраў СССР — цэнтральны саюзна-рэспубліканскі орган дзяржаўнага кіравання Саюза Савецкіх Сацыялістычных Рэспублік па барацьбе са злачыннасцю і падтрыманні грамадскага парадку ў 1946—1960 і 1968—1991 гадах. Да распаду СССР аб'ядноўвала 15 рэспубліканскіх МУС саюзных рэспублік. Колькасць у 1953 годзе — 1 095 678 чалавек."},{"page_url":"https://en.wikipedia.org/wiki/Obrestad","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Obrestad_havn2.jpg","page_title":"Obrestad","context_page_description":"Obrestad is a very small farming village in Hå municipality in Rogaland county, Norway. The village is located in the district of Jæren on the shore of the North Sea, about 4 kilometres west of the village of Nærbø.\\nA harbour was constructed in Obrestad in 1874 and it is still in use. The Obrestad Lighthouse was built in 1873, about 900 metres northwest of the harbour. A sea rescue station for seafarers was established at Obrestad in 1854. It was in use until 1977."},{"page_url":"https://en.wikipedia.org/wiki/Dokarichanchara","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Dokrichanchara_Valley.jpg","page_title":"Dokarichanchara","context_page_description":"Dokarichanchara is a picnic spot and tourist place situated in Khaligarh village, Koksara, Kalahandi, Odisha, India."},{"page_url":"https://cs.wikipedia.org/wiki/Kanton_Cour%C3%A7on","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Charente-Maritime_department_cantons_Courcon.svg","page_title":"Kanton Courçon","context_page_description":"Kanton Courçon je francouzský kanton v departementu Charente-Maritime v regionu Poitou-Charentes. Skládá se ze 14 obcí."},{"page_url":"https://sk.wikipedia.org/wiki/Sovietske_n%C3%A1morn%C3%A9_letectvo","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/An-24V_Sperenberg_%2822287710216%29.jpg","page_title":"Sovietske námorné letectvo","context_page_description":"Sovietske námorné letectvo bolo leteckou zložkou sovietskeho námorníctva.\\nPrvé námorné jednotky boli v Rusku sformované v rokoch 1912 – 1914 v rámci baltskej a čiernomorskej flotily. Počas prvej svetovej vojny vykonávali ruské lietadlá v Čiernom mori prieskum, bombardovanie aj útoky na nepriateľské lode.\\nVzhľadom na to, že sovietske námorníctvo počas studenej vojny nikdy nedisponovalo veľkou flotilou lietadlových lodí ako americké námorníctvo, sovietska strana uprednostňovala nasadenie námorných leteckých síl z letísk na pevnine. Prvé sovietske lietadlové lode triedy Kiev, schopné pojať až 30 lietadiel vrátane VTOL strojov Jakovlev Jak-38 vstúpili do služby koncom 70. rokov 20. storočia. Ďalšia trieda sovietskych lietadlových lodí Kuznecov disponovala konvenčnejším typom ako Suchoj Su-33. Z pozemných letísk operujúce lietadlá ako Tupolev Tu-16 a Tupolev Tu-22M slúžili ako nosiče protilodných striel."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D1%96%D0%BB%D1%8C%D1%8F%D0%BC_%D0%A2%D0%BE%D0%BC%D0%B0%D1%81_%D0%91%D0%BB%D0%B0%D0%BD%D1%84%D0%BE%D1%80%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Timon_princeps.JPG","page_title":"Вільям Томас Бланфорд","context_page_description":"Вільям Томас Бланфорд — англійський геолог і натураліст."},{"page_url":"https://hu.wikipedia.org/wiki/Kar%C3%A1csony","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Dami%C3%A1n_Forment%2C_Adoraci%C3%B3n_de_los_pastores.JPG","page_title":"Karácsony","context_page_description":"A karácsony az egyik legnagyobb keresztény ünnep, teológiailag a húsvét ünnepe után a legnagyobb, amellyel Isten fia, Jézus Krisztus földi születésére emlékeznek. Assisi Szent Ferenc az ünnepek ünnepének tartotta. Minden évben december 25-én tartják világszerte, habár Jézus születésének tényleges időpontja nem ismert. Talán azért esett erre a választás, mert egyes keresztény szerzők szerint Jézus szenvedése, azaz a húsvét, illetve fogantatása az év azonos napján, március 25-én történt, vagy azért, mert ekkor van a téli napforduló a Föld északi féltekéjén, illetve a korai keresztények ezen a napon a kötelező Mithrász- és Sol Invictus-ünnep helyett Jézus születését ünnepelték. Ez a keresztény ünnep az első nikaiai zsinat határozata értelmében Jézus Krisztus földi születésének emléknapja: az öröm és békesség, a család és gyermekség, az otthon és szülőföld ünnepe.\\nA Biblia leírása szerint Jézus szegényes körülmények között született, egy istállóban, mert senki nem fogadta be a házába a várandós Máriát, Jézus édesanyját a születés estéjén. A történet szerint napkeleti bölcsek indultak útnak ajándékokkal köszönteni a születendő Messiást, és egy fényes csillag vezette el őket Jézushoz."},{"page_url":"https://pt.wikipedia.org/wiki/Pal%C3%A1cio_de_Monserrate","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Palacio-Monserrate_Vale-dos-Fetos_SET-07.jpg","page_title":"Palácio de Monserrate","context_page_description":"O Palácio de Monserrate é um palácio inserido no Parque de Monserrate situado em São Martinho, Sintra, distrito de Lisboa, Portugal."},{"page_url":"https://en.wikipedia.org/wiki/Rupert_Neve","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/BBMamek.jpg","page_title":"Rupert Neve","context_page_description":"Rupert Neve, born 31 July 1926 in Newton Abbot, England, is a British electronics engineer and entrepreneur, who is particularly known as a pioneering designer of professional audio recording equipment."},{"page_url":"https://no.wikipedia.org/wiki/N%C3%BCrnbergprosessen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Field_Marshall_Keitel_signs_German_surrender_terms_in_Berlin_8_May_1945_-_Restoration.jpg","page_title":"Nürnbergprosessen","context_page_description":"Nürnbergprosessen omhandler rettssakene mot de ledende tyske nasjonalsosialistene etter annen verdenskrig. Rettssakene ble gjennomført av de allierte i den tyske byen Nürnberg fra november 1945 til oktober 1946.\\nFlere andre rettssaker ble også holdt i Nürnberg i tiden etter hovedprosessen, og disse kalles Nürnbergprosessene.\\nHenging var tradisjonelt brukt for alminnelige kriminelle, mens militære anså det som uverdig og foretrakk å bli skutt. For eksempel Wilhelm Keitel, Alfred Jodl og Hermann Göring ønsket å dø som soldater. Göring tok sitt eget liv med cyanid rett før henrettelsen. En amerikansk soldat fotograferte likene av de henrettede, med og uten klær. Fotografiene ble hemmeligstemplet."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BD%D1%87%D0%B5%D1%81%D1%82%D0%B5%D1%80_%D0%A1%D1%96%D1%82%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Oasis_Noel_and_Liam_WF.jpg","page_title":"Манчестер Сіті","context_page_description":"«Манче́стер Сі́ті» — англійський футбольний клуб з міста Манчестер. Клуб виступає в англійській Прем'єр-лізі. Після придбання клубу еміратськими інвесторами в 2008 році, він є одним з лідерів англійського футболу.\\nГоловним тренером «Манчестер Сіті» є Жузеп Гвардіола, призначений на цю посаду після закінчення сезону Прем'єр-ліги 2015/16 замість Мануеля Пеллегріні. Діючий капітан команди — Венсан Компані, обраний гравцями «Сіті» 13 серпня 2011 року замість Карлоса Тевеса."},{"page_url":"https://cy.wikipedia.org/wiki/St_Peter_Port","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/St_Peter_Port_Guernsey.jpg","page_title":"St Peter Port","context_page_description":"St Peter Port yw prifddinas a dinas fwyaf Beilïaeth Ynys y Garn yn Ynysoedd y Sianel."},{"page_url":"https://en.wikipedia.org/wiki/Karan_Mahajan","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Karan_Mahajan_2016.jpg","page_title":"Karan Mahajan","context_page_description":"Karan Mahajan is an Indian-American novelist, essayist, and critic. His second novel, The Association of Small Bombs, was a finalist for the 2016 National Book Award for Fiction. He has contributed writing to The Believer, The Daily Beast, the San Francisco Chronicle, Granta, and The New Yorker. In 2017, he was named one of Granta's Best Young American Novelists."},{"page_url":"https://eo.wikipedia.org/wiki/Sch%C3%B6ngeising","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Sch%C3%B6ngeising_St._Johannes_Baptist.jpg","page_title":"Schöngeising","context_page_description":"Schöngeising estas komunumo en Germanio. Ĝi troviĝas en la distrikto Fürstenfeldbruck kaj en la distriktaro Supra Bavario de la federacia lando Bavario. Fine de decembro 2015 la komunumo havis 1 845 loĝantojn. La komunumo apartenas al administra komunumaro, nomata Verwaltungsgemeinschaft Grafrath, kiu krome konsistas el la najbaraj komunumoj Kottgeisering kaj Grafrath."},{"page_url":"https://pl.wikipedia.org/wiki/Stod","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/67/Stod_%281%29.jpg","page_title":"Stod","context_page_description":"Stod − miasto w Czechach, w kraju pilzneńskim.\\nWedług danych z 31 grudnia 2003 powierzchnia miasta wynosiła 2 002 ha, a liczba jego mieszkańców 3 532 osób."},{"page_url":"https://it.wikipedia.org/wiki/Locomotiva_Class_9_Eurotunnel","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Eurotunnel_9015_Nord-Pas-de-Calais.jpg","page_title":"Locomotiva Class 9 Eurotunnel","context_page_description":"Le Locomotive Class 9 Eurotunnel o 9000 Eurotunnel sono una famiglia di motrici elettriche costruite specificamente per il trasporto di veicoli nell'Eurotunnel, la galleria che permette il collegamento ferroviario tra le coste francesi e quelle inglesi. Poiché vengono usate su convogli che effettuano il servizio navetta per il trasporto di autoveicoli, sono anche note col nome di Le Shuttle o Eurotunnel Shuttle."},{"page_url":"https://de.wikipedia.org/wiki/Perperek_Knoll","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Perperek-Livingston.jpg","page_title":"Perperek Knoll","context_page_description":"Der Perperek Knoll ist ein 360 m hoher Berg auf der Livingston-Insel im Archipel der Südlichen Shetlandinseln. In den Vidin Heights ragt er 5,7 km nördlich des Sliven Peak, 4,4 km nordöstlich des Leslie Hill und 2,3 km südöstlich des Miziya Peak auf.\\nBulgarische Wissenschaftler kartierten ihn bei Vermessungen der Tangra Mountains zwischen 2004 und 2005. Die bulgarische Kommission für Antarktische Geographische Namen benannte ihn 2005 nach der antiken Stadt Perperikon im Süden Bulgariens."},{"page_url":"https://es.wikipedia.org/wiki/Navantia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Calle_Vel%C3%A1zquez_132_%28Madrid%29_01.jpg","page_title":"Navantia","context_page_description":"Navantia es una sociedad pública española dedicada a la construcción naval civil y militar creada en 2005 como resultado de la segregación de los activos militares de la empresa pública Grupo IZAR."},{"page_url":"https://pl.wikipedia.org/wiki/El%C5%BCbieta_Romanowa_(1779%E2%80%931826)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Elizaveta_Alexeevna_by_anonymous_%2819_c%2C_Taganrog_museum%29.jpg","page_title":"Elżbieta Romanowa (1779–1826)","context_page_description":"Elżbieta Aleksiejewna, urodzona jako Ludwika Maria Augusta Badeńska – księżniczka Badenii, cesarzowa Rosji jako żona cesarza Aleksandra I."},{"page_url":"https://en.wikipedia.org/wiki/United_Kingdom","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/da/Treaty_of_Union.jpg","page_title":"United Kingdom","context_page_description":"The United Kingdom of Great Britain and Northern Ireland, commonly known as the United Kingdom or Britain, is a sovereign country located off the north­western coast of the European mainland. The United Kingdom includes the island of Great Britain, the north­eastern part of the island of Ireland, and many smaller islands. Northern Ireland shares a land border with the Republic of Ireland. Otherwise, the United Kingdom is surrounded by the Atlantic Ocean, with the North Sea to the east, the English Channel to the south and the Celtic Sea to the southwest, giving it the 12th-longest coastline in the world. The Irish Sea separates Great Britain and Ireland. The total area of the United Kingdom is 94,000 square miles.\\nThe United Kingdom is a unitary parliamentary democracy and constitutional monarchy. The monarch is Queen Elizabeth II, who has reigned since 1952, making her the world's longest-serving current head of state. The United Kingdom's capital is London, a global city and financial centre with an urban area population of 10.3 million.\\nThe United Kingdom consists of four countries: England, Scotland, Wales and Northern Ireland."},{"page_url":"https://fr.wikipedia.org/wiki/Histoire_philat%C3%A9lique_et_postale_de_la_France","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Semeuse_croix-rouge_neuf.jpg","page_title":"Histoire philatélique et postale de la France","context_page_description":"Ceci est une introduction à l'histoire postale et philatélique de la France."},{"page_url":"https://en.wikipedia.org/wiki/1750%E2%80%931775_in_Western_fashion","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Badger_attributed_Two_Children_Detail_of_Boy.jpg","page_title":"1750–1775 in Western fashion","context_page_description":"Fashion in the years 1750–1775 in European countries and the colonial Americas was characterised by greater abundance, elaboration and intricacy in clothing designs, loved by the Rococo artistic trends of the period. The French and English styles of fashion were very different from one another. French style was defined by elaborate court dress, colourful and rich in decoration, worn by such iconic fashion figures as Marie Antoinette.\\nAfter reaching their maximum size in the 1750s, hoop skirts began to reduce in size, but remained being worn with the most formal dresses, and were sometimes replaced with side-hoops, or panniers. Hairstyles were equally elaborate, with tall headdresses the distinctive fashion of the 1770s. For men, waistcoats and breeches of previous decades continued to be fashionable.\\nEnglish style was defined by simple practical garments, made of inexpensive and durable fabrics, catering to a leisurely outdoor lifestyle. These lifestyles were also portrayed through the differences in portraiture. The French preferred indoor scenes where they could demonstrate their affinity for luxury in dress and lifestyle."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A1%CE%BF%CE%B3%CE%AE%CF%81%CE%BF%CF%82_%CE%93%CE%84_%CF%84%CE%B7%CF%82_%CE%91%CF%80%CE%BF%CF%85%CE%BB%CE%AF%CE%B1%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Scifato_ducale.jpg","page_title":"Ρογήρος Γ΄ της Απουλίας","context_page_description":"Ο Ρογήρος Γ΄ της Απουλίας μέλος του Οίκου των Ωτβίλ ήταν Δούκας της Απουλίας και Καλαβρίας. Ο Ρογήρος Γ΄ ήταν μεγαλύτερος γιος του Ρογήρου Β΄ της Σικελίας και της Ελβίρας Χιμένες νόθης κόρης του Αλφόνσου ΣΤ΄ της Καστίλης και Λεόν."},{"page_url":"https://en.wikipedia.org/wiki/Bengkulu","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Bengkulu_in_Indonesia.svg","page_title":"Bengkulu","context_page_description":"Bengkulu is a province of Indonesia. It is located on the southwest coast of Sumatra. It was formed on 18 November 1968 by separating out the former Bengkulu Residency area from the province of South Sumatra under Law No. 9 of 1967 and was finalised by Government Regulation No. 20 of 1968. Spread over 19,813 km², it is bordered by the provinces of West Sumatra to the north, Jambi to the northeast, Lampung to the southeast, and South Sumatra to the east, and by the Indian Ocean to the northwest, south, southwest, and west.\\nBengkulu is the 25th largest province by area; it is divided into nine regencies and the city of Bengkulu, the capital and largest city. Bengkulu is also the 26th largest province by population in Indonesia, with 1,715,518 inhabitants at the 2010 Census and 1,872,136 at the 2015 Census; the latest official estimate is 1,971,800. According to a release by Badan Pusat Statistik, it has the eleventh highest Human Development Index among the provinces, with a score of about 0.744 in 2013. By 2014, the province is positioned 28th highest in gross domestic product and 20th highest in life expectancy, 70.35 years."},{"page_url":"https://de.wikipedia.org/wiki/S%C3%A3o_Louren%C3%A7o_do_Bairro","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Anadia_35.PNG","page_title":"São Lourenço do Bairro","context_page_description":"São Lourenço do Bairro ist ein Ort und eine Gemeinde in der Mittelregion von Portugal."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8D%D5%B8%D6%82%D6%80%D5%A2_%D5%8D%D5%A1%D6%80%D5%A3%D5%AB%D5%BD_(%D5%BF%D5%B8%D5%B6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/%D0%A1%D0%B2%D1%8F%D1%82%D0%BE%D0%B9_%D0%A1%D0%B0%D1%80%D0%BA%D0%B8%D1%81_-_%D0%BF%D0%BE%D0%BA%D1%80%D0%BE%D0%B2%D0%B8%D1%82%D0%B5%D0%BB%D1%8C_%D0%B2%D0%BB%D1%8E%D0%B1%D0%BB%D1%91%D0%BD%D0%BD%D1%8B%D1%85.jpg","page_title":"Սուրբ Սարգիս (տոն)","context_page_description":"Անվան այլ կիրառումների համար տե՛ս՝ Սուրբ Սարգիս\\nՍուրբ Սարգիս, Հայ Առաքելական Եկեղեցու կողմից նշվող տոներից։ Նշվում է Սուրբ Զատկից 63 օր առաջ՝ սովորաբար հունվարի 18-ի և փետրվարի 23-ի միջակայքում՝ շաբաթ օրը։ Սուրբ Սարգիս զորավարը համարվում է երիտասարդ զույգերի և սիրահարների բարեխոսը։"},{"page_url":"https://sv.wikipedia.org/wiki/Kashgar,_Xinjiang","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e9/Location_of_Kashgar_Prefecture_within_Xinjiang_%28China%29.png","page_title":"Kashgar, Xinjiang","context_page_description":"Kashgar är en prefektur i sydvästra delen av regionen Xinjiang i Kina. Residensstad är oasstaden Kashgar."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BC%D0%BF%D1%96%D1%97-%D0%BB%D0%B5-%D0%91%D0%BE%D1%80%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Ampilly-les-Bordes_Landscape.JPG","page_title":"Ампії-ле-Борд","context_page_description":"Ампії́-ле-Борд — муніципалітет у Франції, у регіоні Бургундія-Франш-Конте, департамент Кот-д'Ор. Населення — 77 осіб.\\nМуніципалітет розташований на відстані близько 220 км на південний схід від Парижа, 50 км на північний захід від Діжона."},{"page_url":"https://cs.wikipedia.org/wiki/Platan","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Krasi_Platane.jpg","page_title":"Platan","context_page_description":"Platan je jediný rod čeledi platanovité vyšších dvouděložných rostlin."},{"page_url":"https://ru.wikipedia.org/wiki/8-%D1%8F_%D0%BC%D0%B5%D1%85%D0%B0%D0%BD%D0%B8%D0%B7%D0%B8%D1%80%D0%BE%D0%B2%D0%B0%D0%BD%D0%BD%D0%B0%D1%8F_%D0%B1%D1%80%D0%B8%D0%B3%D0%B0%D0%B4%D0%B0_(1-%D0%B3%D0%BE_%D1%84%D0%BE%D1%80%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B0%D0%BD%D0%B8%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/ru/e/e3/Quadmaxims.jpg","page_title":"8-я механизированная бригада (1-го формирования)","context_page_description":"8-я механизированная бригада — воинское соединение автобронетанковых войск в РККА Вооружённых сил СССР."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%85%89%E5%A3%B3%E8%9B%A4%E5%B1%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Veneridae_-_Lioconcha_castrensis.JPG","page_title":"光壳蛤属","context_page_description":"光壳蛤属是帘蛤科一个海洋腹足纲软体动物的属，过往光壳蛤亚科的模式属。"},{"page_url":"https://sv.wikipedia.org/wiki/Maxillaria","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Maxillaria_striata_Orchi_2012-09-21_079.jpg","page_title":"Maxillaria","context_page_description":"Maxillaria är ett släkte av orkidéer. Maxillaria ingår i familjen orkidéer."},{"page_url":"https://fr.wikipedia.org/wiki/Pic_Piestewa","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Piestewa_Peak_2.jpg","page_title":"Pic Piestewa","context_page_description":"Le pic Piestewa, en anglais Piestewa Peak, anciennement pic Squaw, est un sommet montagneux américain à Phoenix, dans le comté de Maricopa, en Arizona. Il culmine à 794 mètres d'altitude dans les monts Phoenix. Son sommet est accessible par le Piestewa Peak Summit Trail, un sentier de randonnée classé National Recreation Trail depuis 1974."},{"page_url":"https://en.wikipedia.org/wiki/Hidden_Christian_Sites_in_the_Nagasaki_Region","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Former_the_archbishop_hall_of_the_Roman_Catholic_Archdiocese_of_Nagasaki03s3.jpg","page_title":"Hidden Christian Sites in the Nagasaki Region","context_page_description":"Hidden Christian Sites in the Nagasaki Region is a group of twelve sites in Nagasaki Prefecture and Kumamoto Prefecture relating to the history of Christianity in Japan. The Nagasaki churches are unique in the sense that each tells a story about the revival of Christianity after a long period of official suppression.\\nProposed jointly in 2007 for inscription on the UNESCO World Heritage List under criteria ii, iii, iv, v, and vi, the submission named at the time Churches and Christian Sites in Nagasaki on the Tentative List, was recognized on January 30, 2018, as a World Heritage Site.\\nThe initial nomination included 26 sites; however, after reconsideration the Nagasaki Prefecture reduced the monuments to 13 sites. Twelve sites were recognized. Concerns over the Hidden Christian Sites in the Nagasaki Region have been widely discussed in the academic literature."},{"page_url":"https://nl.wikipedia.org/wiki/Gabonadder","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Bitis_gabonica_rhinoceros_tagged.png","page_title":"Gabonadder","context_page_description":"De gabonadder, ook wel gabonpofadder of gaboenpofadder is een giftige slang uit de familie adders.\\nDe gabonadder wordt tot het geslacht Bitis gerekend, de soorten uit dit geslacht worden ook wel pofadders genoemd en zijn zeer giftig. De gabonadder is de grootste soort van alle pofadders en heeft tevens de grootste giftanden waarmee de slang een relatief grote hoeveelheid gif injecteert. In combinatie met het algemene voorkomen maakt dit de gabonadder tot een van de gevaarlijkste soorten binnen zijn verspreidingsgebied.\\nDe gabonadder komt voor in westelijk Afrika en delen van oostelijk Afrika. De gabonadder eet voornamelijk kleine zoogdieren en andere gewervelde dieren. De belangrijkste natuurlijke predatoren zijn roofvogels en varkens. De gabonadder is een bewoner van bossen die altijd op de bodem leeft. De gabonadder komt vaak algemeen voor en is vanwege het dieet van voornamelijk knaagdieren een nuttige soort.\\nDe kleuren en patronen van de gabonadder zijn opmerkelijk; ze steken schril af tegen een egale ondergrond maar op de bosbodem is de slang nagenoeg onzichtbaar."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BB%D1%8C%D1%82%D0%B5%D0%BD%D0%B3%D0%BE%D1%84_(%D0%A8%D0%BB%D0%B5%D0%B7%D0%B2%D1%96%D0%B3-%D0%93%D0%BE%D0%BB%D1%8C%D1%88%D1%82%D0%B5%D0%B9%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Altenhof_5332.jpg","page_title":"Альтенгоф (Шлезвіг-Гольштейн)","context_page_description":"Альтенгоф — громада в Німеччині, розташована в землі Шлезвіг-Гольштейн. Входить до складу району Рендсбург-Екернферде. Складова частина об'єднання громад Шляй-Остзее.\\nПлоща — 12,13 км². Населення становить 300 ос."},{"page_url":"https://es.wikipedia.org/wiki/Cecilia_Chung","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Cecilia_Chung_at_Trans_March_San_Francisco_20170623-6639.jpg","page_title":"Cecilia Chung","context_page_description":"Cecilia Chung es una líder de derechos civiles y activista por los derechos LGBT, la conciencia del VIH / SIDA, la defensa de la salud y la justicia social. Cecilia es una mujer trans. La historia de su vida fue una de las cuatro historias principales en la miniserie ABC 2017 When We Rise sobre los derechos LGBT en las décadas de 1970 y 1980.​"},{"page_url":"https://en.wikipedia.org/wiki/Jefferson_Memorial","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/%22I_Am_Not_an_Advocate_for_Frequent_Changes_._._.%22_at_Jefferson_Memorial.jpg","page_title":"Jefferson Memorial","context_page_description":"The Jefferson Memorial is a presidential memorial built in Washington, D.C. between 1939 and 1943 under the sponsorship of President Franklin D. Roosevelt. Roosevelt thought that it was a suitable memorial to the Founding Fathers of the United States and to Thomas Jefferson, the principal author of the United States Declaration of Independence and the founder of the Democratic-Republican Party.\\nThe neoclassical building is situated in West Potomac Park on the shore of the Potomac River. It was designed by John Russell Pope and built by Philadelphia contractor John McShain. Construction began in 1939 and was completed in 1943. The bronze statue of Jefferson was added in 1947. Pope made references to the Roman Pantheon and to Jefferson's own design for the rotunda at the University of Virginia. The Jefferson Memorial and the White House form one of the main anchor points in the area of the National Mall in D.C. The Washington Monument was intended to be located at the intersection of the White House and the site for the Jefferson Memorial, but soft swampy ground required that it be situated to the east."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%A7%D9%84%D9%83%D9%88%D9%85_%D9%81%D9%88%D8%B1%D8%A8%D8%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f8/Chateau_de_Balleroy.JPG","page_title":"مالكوم فوربس","context_page_description":"مالكوم ستيفنسون فوربس ‏ رجل أعمال أمريكي وصاحب مجلة فوربس، والتي أسسها والده بيرتي تشارلز فوربس. رأسمالي كبير ومؤمن بالتجارة الحرة في الأسواق. يعشق أسلوب الحياة الصاخب. عاش فوربس حياة ترفيهية مليئة بالبذخ مازال يحكي الناس عنها حتى وقتنا الحالي. عاشق للحفلات وللسفر. يهوى فوربس إنشاء مجموعات خاصة به من مختلف الأشياء كالمنازل، اليخوت، الطائرات، الأعمال الفنية، الدراجات النارية وبيض فابرجي."},{"page_url":"https://pl.wikipedia.org/wiki/Wojew%C3%B3dztwo_pozna%C5%84skie_(1945%E2%80%931975)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/50/POL_wojew%C3%B3dztwo_pozna%C5%84skie_1946.svg","page_title":"Województwo poznańskie (1945–1975)","context_page_description":"Województwo poznańskie – dawna jednostka podziału administracyjnego Polski najwyższego szczebla, której stolicą był Poznań, formalnie przywrócona 22 sierpnia 1944. Faktycznie jednostka została zorganizowana po przejściu linii frontu. 25 września 1945 została powiększona o część Ziem Odzyskanych. Województwo kilkakrotnie zmieniało swoje granice. W latach 1946–1950 było największym województwem Polski. W związku z reformą administracyjną w 1975 województwo zostało zlikwidowane a jego teren został podzielony w większości pomiędzy tzw. małe województwo poznańskie, województwo kaliskie, województwo konińskie, województwo leszczyńskie i województwo pilskie. Obecnie w większości teren województwa należy do województwa wielkopolskiego."},{"page_url":"https://oc.wikipedia.org/wiki/L%27Alguer","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1e/Unitat_de_la_llengua_Alghero.jpg","page_title":"L'Alguer","context_page_description":"La vila de L'Alguer es en Sardenha, al nòrd-oèst, en riba de mar. Es una enclava de lenga catalana. A una populacion de 43 912 personas e 30 000 personas i parlan encara lo catalan dins sa varietat locala, l'alguerés, una forma arcaïzanta del catalan oriental.\\nLo gentilici es alguerés -esa.\\nA l'Edat Mejana foguèt una vila fortificada, mas uèi viu del torisme. A un bèl pòrt e un environament mediterranèu barcelonés fòrça polit.\\nLas gents li ne dison a sa vila de \\"la Barceloneta\\"."},{"page_url":"https://it.wikipedia.org/wiki/Little_Red_(gruppo_musicale)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Little_Red_%285393507917%29.jpg","page_title":"Little Red (gruppo musicale)","context_page_description":"I Little Red sono stati un gruppo musicale australiano, formatosi a Melbourne e attivo dal 2005 al 2012."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D9%88%D9%84%D8%A7%D8%AF%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Collado_CC_Iglesia_2009.jpg","page_title":"كولادو","context_page_description":"بلدية كولادو، هي بلدية تقع في مقاطعة قصرش والتي تقع في منطقة إكستريمادورا، غرب إسبانيا.\\nيبلغ عدد سكانها 227 نسمة وفقاً لإحصائية سنة."},{"page_url":"https://es.wikipedia.org/wiki/Segunda_Divisi%C3%B3n_de_Chile_1974","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/600px_Verde_Rosso_Bianco_Verde.png","page_title":"Segunda División de Chile 1974","context_page_description":"El Campeonato Nacional de Fútbol de Segunda División de 1974 fue el 23° torneo disputado de la segunda categoría del fútbol profesional chileno, con la participación de 16 equipos.\\nEl torneo se jugó en dos etapas. En la primera etapa, jugada con un sistema de todos contra todos, se dividió geográficamente a los equipos en un Grupo Norte y un Grupo Sur. Los tres primeros de cada grupo clasificarían a la segunda etapa, que finalmente dirimiría al campeón del torneo. Los colistas de ambos grupos definirían en un partido al equipo que descendería a su asociación de origen.\\nEl campeón del torneo fue Santiago Morning, que consiguió el ascenso para la Primera División, junto al subcampeón Everton."},{"page_url":"https://en.wikipedia.org/wiki/Agostino_Barbarigo","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/20/Doge_Agostino_Barbarigo.png","page_title":"Agostino Barbarigo","context_page_description":"Agostino Barbarigo was Doge of Venice from 1486 until his death in 1501.\\nWhile he was Doge, the imposing Clock Tower in the Piazza San Marco with its archway through which the street known as the Merceria leads to the Rialto, was designed and completed. A figure of the Doge was originally shown kneeling before the lion of Venice on the top storey below the bell but this was removed by the French in 1797 after Venice had surrendered to Napoleon.\\nIn 1496 he created an Italian coalition to push back Charles VIII of France from Italy, which led to the Battle of Fornovo during the French retreat from Italy. During his reign Venice gained several strongholds in Romagna and annexed the island of Cyprus.\\nHis relationships with the Ottoman sultan Bayezid II were initially amicable, but they became increasingly strained starting from 1492, eventually leading to open war in 1499. The Venetian merchants in Istanbul were arrested, while Bosnian troops invaded Dalmatia and reached Zara. The Venetian fleet was defeated at the Battle of Zonchio, and the Republic lost its base in Lepanto."},{"page_url":"https://fi.wikipedia.org/wiki/Pointe-%C3%A0-Pitre","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Ancien_h%C3%B4tel_de_ville_de_Pointe-%C3%A0-Pitre_01.JPG","page_title":"Pointe-à-Pitre","context_page_description":"Pointe-à-Pitre on Guadeloupen suurin kaupunki. Se sijaitsee maan suurimpia saaria, Basse-Terreä ja Grande-Terreä erottavan Rivière Salée -salmen itärannalla eli Grande-Terren lounaisrannikolla. Lukuisat pienet saaret suojaavat kaupungin satamaa. Lähistöllä on myös mangrovesoita.\\nKeskeisen sijaintinsa takia Pointe-à-Pitre on Guadeloupen tärkein kaupunki. Sen matkailunähtävyys on Mémorial ACTe, orjuuden a kolonialismin ajoista kertova museo.\\nPointe-à-Pitren lentoasema sijaitsee keskustasta pohjoiseen, Les Abymesin kunnan puolella. Kaupungin satamasta on lauttayhteys Guadeloupen pienemmille saarille."},{"page_url":"https://es.wikipedia.org/wiki/Imperio_almohade","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Adarve_alcazaba_badajoz_1.JPG","page_title":"Imperio almohade","context_page_description":"Los almohades «los que reconocen la unicidad de Dios», o Banu ‘Abd al-Mu'min​ fueron una dinastía bereber marroquí​ que dominó el norte de África y el sur de la península ibérica desde 1147 a 1269.\\nLos almohades surgieron en el actual Marruecos en el siglo XII, como reacción a la apertura religiosa de los almorávides, que se habían hecho dueños del Magreb, pero habían fracasado en su intento de revigorizar los estados musulmanes y tampoco habían ayudado a detener el avance de los estados cristianos en la península ibérica. Muhámmad ibn Túmart fundó un movimiento religioso con el apoyo de un grupo de tribus bereberes del Alto Atlas de Marruecos​​, organizando el derrocamiento de los almorávides, de origen cenhegí. Posteriormente, Abd al-Mumin y su familia, bereberes cenetes, tomaron el control y eliminaron a los ziríes y hammadíes del Magreb central y oriental. Los almohades fueron derrocados por las dinastías bereberes de los meriníes, los ziyánidas y los háfsidas del Magreb."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stra%C3%9Fen_und_Pl%C3%A4tze_in_Berlin-Westend","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/WestendCrusiusstra%C3%9Fe.jpg","page_title":"Liste der Straßen und Plätze in Berlin-Westend","context_page_description":"Die Liste der Straßen und Plätze in Berlin-Westend beschreibt das Straßensystem im Berliner Ortsteil Westend mit den entsprechenden historischen Bezügen. Gleichzeitig ist diese Zusammenstellung ein Teil der Listen aller Berliner Straßen und Plätze."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B3%D8%AA%D8%A7%D8%B1%D9%87_%D9%87%D8%B1%D9%85%DB%8C%D9%86%D9%88%D9%88%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Star%C3%A9_He%C5%99minovy_znak.jpg","page_title":"ستاره هرمینووی","context_page_description":"ستاره هرمینووی چک اؤلکه‌سینده بیر یاشاییش منطقه‌سی‌دیر. سوْن نۆفوس ساییمی اساسيندا ۲۳۳ نفر ایمیش. گئنیش‏لیگی ۱۰٫۱۸ کیلومتر موربّع ایدی و موراوی-سیلزی اوستانیندا یئرلشیب. بۆتون چک‌دا اوْلدوغو کیمی، بۇ شهرده آنا دیلی چک دیلی دیر."},{"page_url":"https://en.wikipedia.org/wiki/Euro_starter_kits","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/SloveniaBkit.jpg","page_title":"Euro starter kits","context_page_description":"Euro starter kits are packs of euro coins of all the eight denominations sealed in a plastic bag. The scope of these kits is primarily to familiarise the citizens of a nation that is going to join the eurozone with the new currency, the euro. Another objective is to fill up cash registers well in advance of €-Day. Usually these kits are available from the local banks some weeks before the euro changeover.\\nMainly there are two types of starter packs: business starter kits and kits for the general public. The difference is in the number of coins per pack. Business kits are intended for retailers, thereby they contain around 100 euro or more of coins and are normally contained in rolls, whereas the mini-starter kits are intended for the general public and usually have a small volume of coins."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Niederw%C3%BCrschnitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Wappen_Niederw%C3%BCrschnitz.png","page_title":"Liste der Kulturdenkmale in Niederwürschnitz","context_page_description":"Die Liste der Kulturdenkmale in Niederwürschnitz enthält die Kulturdenkmale in Niederwürschnitz.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen."},{"page_url":"https://it.wikipedia.org/wiki/Stazione_di_San_Gallo","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Hauptbahnhof_St._Gallen.JPG","page_title":"Stazione di San Gallo","context_page_description":"La stazione di San Gallo è la principale stazione ferroviaria a servizio dell'omonima città svizzera. È gestita dalle Ferrovie Federali Svizzere."},{"page_url":"https://en.wikipedia.org/wiki/Academy_of_Music_(Philadelphia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/2013_Academy_of_Music_from_south.jpg","page_title":"Academy of Music (Philadelphia)","context_page_description":"The Academy of Music, also known as American Academy of Music, is a concert hall and opera house located at 240 S. Broad Street in Philadelphia, Pennsylvania. Its location is between Locust and Manning Streets in the Avenue of the Arts area of Center City.\\nThe hall was built in 1855–57 and is the oldest opera house in the United States that is still used for its original purpose. Known as the \\"Grand Old Lady of Locust Street,\\" the venue is the home of the Pennsylvania Ballet and Opera Philadelphia. It was also home to the Philadelphia Orchestra from its inception in 1900 until 2001, when the orchestra moved to the new Kimmel Center for the Performing Arts. The Philadelphia Orchestra still retains ownership of the Academy.\\nThe hall was designated a National Historic Landmark in 1962."},{"page_url":"https://ru.wikipedia.org/wiki/Cygnus_CRS_OA-6","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/ISS-47_Cygnus_OA-6_approaching_the_ISS_%281%29.jpg","page_title":"Cygnus CRS OA-6","context_page_description":"Cygnus CRS OA-6 — пятая миссия грузового корабля Cygnus к Международной космической станции по контракту снабжения Commercial Resupply Services с NASA.\\nШестой полёт космического корабля Cygnus, второй полёт улучшенной версии корабля. Корабль назван в честь астронавта NASA Рика Хасбанда.\\nВ связи подготовкой новой версии ракеты-носителя Antares, запуск осуществлён ракетой-носителем Атлас-5 401."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%AD%E0%B8%B1%E0%B8%87%E0%B8%81%E0%B8%B2%E0%B8%9A%E0%B8%AB%E0%B8%99%E0%B8%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Barleria_prionitis_%28Porcupine_flower%29_in_Hyderabad%2C_AP_W_IMG_9990.jpg","page_title":"อังกาบหนู","context_page_description":"อังกาบหนู เป็นพืชในวงศ์เหงือกปลาหมอ ที่เป็นพืชท้องถิ่นในประเทศอินเดีย เป็นพืชสมุนไพรในตำรับยาอายุรเวท น้ำคั้นจากใบใช้ป้องกันเท้าเปื่อยและแตกในฤดูมรสุม ชาวโอรังอัซลีในรัฐเปรัก ประเทศมาเลเซีย ใช้ใบบดแล้วพอกบริเวณที่อักเสบ\\nอังกาบหนูมักเป็นอาศัยของหนอนของ en:Phalanta phalantha และ en:Junonia lemonias ในใบมี en:6-Hydroxyflavone ซึ่งเป็นตัวยับยั้งแบบไม่แข่งขันของcytochrome P450 2C9"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9E%D1%82%D0%B0%D0%BC%D0%B0%D0%BD_(%D0%B1%D1%80%D0%BE%D0%BD%D0%B5%D1%82%D1%80%D0%B0%D0%BD%D1%81%D0%BF%D0%BE%D1%80%D1%82%D0%B5%D1%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Otaman_8x8_4.jpg","page_title":"Отаман (бронетранспортер)","context_page_description":"Отаман — глибока модернізація шасі БТР-60/70, бойова платформа, на базі якої може бути створена бойова техніка різноманітного призначення: бронетранспортер, машина вогневої підтримки, самохідна артилерійська установка інші бойові та спеціальні машини. Розроблена компанією НВО «Практика»."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%96%B0%E4%BC%9A%E5%8C%BA","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7c/Banana_Tree_Long.JPG","page_title":"新会区","context_page_description":"新会，简称新或会，古称冈州，因盛产蒲葵而别称葵乡，位于珠江三角洲西部西江、潭江下游汇合处，名称来自新会郡，现为中国广东省江门市下辖的市辖区，下辖1街道10镇，全区总人口近100万，市区人口38万。\\n新会居民以汉族的四邑族群为主，母语为粤语四邑片新会话。新会建置于东晋末年，迄今近一千六百年，是广东省历史文化名城，历史上长期作为四邑地区的政治、经济、文化和交通中心。从北宋起新会的文化教育就非常发达，是中国产生进士、举人和两院院士最多的城市。在近现代史上，新会位列广东最迟开放通商的两个城市之一。这里的习俗、文化、传统艺术、建筑形式都独具风格，具有强烈的地域特征。这里是梁启超、陈献章、陈垣、刘德华等名人的故乡，同时又作为岭南学派和岭南琴派的发源地，素有“海滨邹鲁”之称。新会还是70几万海外华人的祖籍地，为中国著名侨乡。"},{"page_url":"https://en.wikipedia.org/wiki/Kia_Forte","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/2010_Kia_Cerato_Koup_%28TD_MY10%29_coupe_%2817580660078%29.jpg","page_title":"Kia Forte","context_page_description":"The Kia Forte, known as the K3 in South Korea, the Forte K3 or Shuma in China and Cerato in South America and Australia is a compact car produced by Kia Motors since mid-2008. It replaced the Kia Cerato/Spectra and is available in two-door coupe, four-door sedan, five-door hatchback variants. It is not available in Europe, where the similar sized Kia Ceed is offered.\\nIn some markets, such as Costa Rica, Australia and Brazil, the Forte is marketed as Kia Cerato replacing its predecessor of the same name. In Colombia and Singapore, the name Cerato Forte was used for the second generation, while Naza Automotive Manufacturing of Malaysia has assembled the vehicle since 2009, selling it there under the name Naza Forte."},{"page_url":"https://ms.wikipedia.org/wiki/Masakan_Korea","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0b/Samgyetang.jpg","page_title":"Masakan Korea","context_page_description":"Masakan Korea sebagai masakan kebangsaan Korea dikenali hari ini telah timbul melalui berkurun-kurun perubahan dan pengaruh sosial dan politik. Akar dan asal-usulnya dapat dikesan kembali ke mitos dan lagenda antikuiti. Berasa dari tradisi nomad dan pertanian kuno di Manchuria selatan dan semenanjung Korea utara, masakan Korea telah timbul melalui suatu interaksi kompleks alam semulajadi dan arah aliran kebudayaan.\\nMasakan Korea sebahagian besar berasaskan beras, mi, tauhu, sayuran dan daging. Makanan tradisional Korea terkenal dengan sejumlah besar makanan sampingan yang disebut banchan yang dimakan bersama dengan nasi putih dan sup. Setiap makanan dilengkapi dengan banchan yang cukup banyak.\\nKimchi adalah jeruk yang dibuat dari sayuran, terutamanya sawi, lobak dan timun. Setidaknya ada satu jenis kimchi yang disajikan bersama banchan pada sepanjang tahunnya. Kimchi juga adalah bahan dasar utama dalam berbagai resep masakan Korea.\\nMakanan Korea biasanya diperisakan dengan minyak bijan, doenjang, kicap, garam, bawang putih, halia dan pes cili."},{"page_url":"https://en.wikipedia.org/wiki/Resurrection_Cathedral,_Tirana","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Orthodox_Church_Tirana_2016_albania.jpg","page_title":"Resurrection Cathedral, Tirana","context_page_description":"The Resurrection Cathedral is an Albanian Orthodox church situated in the center of Tirana, Albania. It is the consindered among the largest Orthodox churches in the Balkan Peninsula.\\nIt was officially opened on June 24, 2012, to celebrate the 20th anniversary of the revival of the Albanian Orthodox Church and the election of Archbishop Anastasios of Albania."},{"page_url":"https://fr.wikipedia.org/wiki/Eyalet_de_Mossoul","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Raft_Conveying_Winged_Bull_to_Baghdad.jpg","page_title":"Eyalet de Mossoul","context_page_description":"L'eyalet ou pachalik de Mossoul est une province de l'Empire ottoman, en Mésopotamie, créée au XVIᵉ siècle lors de la conquête du pays par Soliman le Magnifique. Sa capitale était Mossoul. La réforme administrative de 1864, qui transforme les eyalets en vilayets, en fait le vilayet de Mossoul."},{"page_url":"https://pl.wikipedia.org/wiki/Tienszan","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Tien-szan1.jpg","page_title":"Tienszan","context_page_description":"Tienszan, Tien-szan – łańcuch górski w Azji Centralnej, na pograniczu Kazachstanu, Uzbekistanu, Kirgistanu i Chin. Długość łańcucha wynosi około 2500 km, najwyższym szczytem jest Szczyt Zwycięstwa."},{"page_url":"https://pt.wikipedia.org/wiki/Brianna_Wu","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Brianna_Wu_next_to_Motorcycle.jpg","page_title":"Brianna Wu","context_page_description":"Brianna Wu é uma desenvolvedora estadunidense de jogos eletrônicos e programadora de computadores. Ela cofundou, em Boston, Massachusetts, a Giant Spacekat, um estúdio independente de desenvolvimento de jogos eletrônicos, com Amanda Warner. É também blogueira e podcaster sobre questões relacionadas com a indústria de jogos eletrônicos e, sem lograr êxito, concorreu ao cargo de deputada estadual pelo Massachusetts no 8º distrito congressional."},{"page_url":"https://nl.wikipedia.org/wiki/Klimtechniek","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/de/Escalade_crochet_talon.jpg","page_title":"Klimtechniek","context_page_description":"Met klimtechniek wordt bedoeld wat de eigenlijke techniek is om zich bij het klimmen te verplaatsen, dit kan zowel omhoog, zijwaarts, horizontaal als naar beneden zijn. Dit kan zowel de noodzakelijke bewegingsleer van het lichaam zijn, het juiste gebruik van de klimmaterialen als het persoonlijk gedrag ten opzichte van de natuur door de klimmers.\\nIn Nederland en het Nederlandssprekende gedeelte van België is in samenwerking van de Nederlandse Klim- en Bergsport Vereniging en de Klim- en Bergsportfederatie-Vlaanderen een Klimvaardigheidsbewijs KVB1, KVB2 en KVB3 tot stand gebracht die deze noodzakelijke competenties moeten aantonen. Zij die in het bezit zijn van een KVB beschikken over een minimumaantal bekwaamheden en men kan met behulp van zo’n bewijs aantonen over degelijke kennis te beschikken. De veiligheid tijdens het sportklimmen ligt echter nog steeds in handen van de klimmer en de zekeraar zelf, dus het bezitten van een KVB biedt geen waarborg hierop."},{"page_url":"https://es.wikipedia.org/wiki/Club_Atl%C3%A9tico_San_Lorenzo_de_Almagro","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4b/El_Gasometro.JPG","page_title":"Club Atlético San Lorenzo de Almagro","context_page_description":"El Club Atlético San Lorenzo de Almagro, conocido popularmente como San Lorenzo de Almagro o simplemente San Lorenzo, es un club social y deportivo de Argentina, fundado el 1 de abril de 1908. Su principal actividad es el futbol masculino, donde participa en la Primera División de Argentina. También se practica básquet, natación, atletismo, hockey, rugby y vóley, entre otras disciplinas deportivas. Es un club que se destaca por haber sido laureado en todos los deportes, teniendo en su haber campeones olímpicos como Delfo Cabrera. Está incorporado al sistema educativo con un jardín de infantes y un próximo colegio secundario.\\nEs considerado como uno de los cinco grandes del fútbol argentino a partir del momento en que la AFA dispuso la implementación del llamado \\"voto proporcional\\" en 1937, que consistía en darle mayor poder de decisión a aquellos clubes con mayor número de socios, antigüedad y títulos."},{"page_url":"https://es.wikipedia.org/wiki/Meures","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/14/Map_commune_FR_insee_code_52322.png","page_title":"Meures","context_page_description":"Meures es una población y comuna francesa, en la región de Champaña-Ardenas, departamento de Alto Marne, en el distrito de Chaumont y cantón de Juzennecourt."},{"page_url":"https://vi.wikipedia.org/wiki/Tr%E1%BB%91ng_%C4%91%E1%BB%93ng_%C4%90%C3%B4ng_S%C6%A1n","image_url":"https://upload.wikimedia.org/wikipedia/vi/5/55/Trong1.jpg","page_title":"Trống đồng Đông Sơn","context_page_description":"Trống đồng Đông Sơn là tên một loại trống tiêu biểu cho Văn hóa Đông Sơn của người Việt cổ. Nhiều chiếc trống loại này với quy mô đồ sộ, hình dáng cân đối, hài hoà đã thể hiện một trình độ rất cao về kỹ năng và nghệ thuật, đặc biệt là những hoa văn phong phú được khắc họa, miêu tả chân thật sinh hoạt của con người thời kỳ dựng nước mà người ta vẫn cho là chìm trong đám mây mù của truyền thuyết Việt Nam. Viện Bảo tàng Lịch sử Việt Nam đã lưu giữ một số lớn trống đồng Đông Sơn. Cho đến nay, theo các số liệu đã công bố, đây là bộ sưu tập lớn nhất thế giới. Ngôi sao nhiều cánh ở giữa mặt trống tượng trưng cho thần Mặt Trời vì người dân Văn Lang có quan niệm về thần Mặt Trời."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AE%D9%88%D8%B3%D8%AA%D9%88_%D8%AE%D9%88%D8%B3%D9%8A%D9%87_%D8%AF%D9%8A_%D9%83%D8%A7%D8%B1%D9%88%D9%83%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Justo_Jos%C3%A9_de_Urquiza_MHN.JPG","page_title":"خوستو خوسيه دي كاروكا","context_page_description":"خوستو خوسيه دي كاروكا ‏ هو سياسي، وعسكري محترف من الأرجنتين ولد في إنتري ريوس.\\nويحمل رتبة عسكرية فريق أول."},{"page_url":"https://de.wikipedia.org/wiki/Sender_Hemmingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Hemmingen_Niedersachsen_Sendemasten.jpg","page_title":"Sender Hemmingen","context_page_description":"Der Sender Hemmingen ist eine Sendeanlage des Norddeutschen Rundfunks für UKW-Rundfunk und Fernsehen in Hemmingen, einer Stadt in der Region Hannover. Bis Anfang 2015 strahlte er als Mittelwellensender auf 828 kHz NDR Info aus."},{"page_url":"https://pl.wikipedia.org/wiki/Mur%C3%A1nska_planina","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Mur%C3%A1nska_planina_-_%C3%9Atul%C5%88a_Ni%C5%BEn%C3%A1_K%C4%BEakov%C3%A1.JPG","page_title":"Muránska planina","context_page_description":"Muránska planina – w regionalizacji polskiej jest to tzw. grupa Fabovej w Rudawach Gemerskich. Na jej terenie znajduje się Park Narodowy Muránska planina. W regionalizacji słowackiej część tzw. Krasu Spisko-Gemerskiego."},{"page_url":"https://en.wikipedia.org/wiki/Pontiac_V8_engine","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/1960_Pontiac_Venture_engine_-_389_cid_V8_%2814115314547%29.jpg","page_title":"Pontiac V8 engine","context_page_description":"The Pontiac V8 engine is a family of overhead valve V8 engines manufactured by the Pontiac Division of General Motors Corporation that made its debut in 1955. Pontiac began as a \\"companion\\" to the Oakland division of the General Motors line of automobiles in 1926. Pontiac successfully competed against more-expensive inline four-cylinder models with their inline flathead six-cylinder engines. After outselling Oakland, Pontiac became the sole survivor of the two by 1932. In addition to the inline 6, Pontiac used the Oakland V8 for one year, 1932, debuting an inline 8 in 1933. The two inline engines were used through 1954, when Pontiac unveiled its OHV V8 in 1955. The development of this V8 dates back to 1946, when engineers began considering new engine designs for postwar cars. They came up with a 269-cubic-inch L-head design. Pontiac engineers tested their 269 cu in V8 in 1949 or 1950 against a downsized Olds rocket V8 overhead engine. The Olds engine was a 303 cu in, Pontiac reduced the size to 270 cu in in for testing against the 269 engine. The test results showed Pontiac that an L-head engine simply couldn't compete with overhead valve V8 engine designs."},{"page_url":"https://es.wikipedia.org/wiki/Iglesia_de_Santa_Mar%C3%ADa_la_Real_(Cillamayor)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Iglesia_de_Santa_Mar%C3%ADa_Cillamayor_001_Abside.JPG","page_title":"Iglesia de Santa María la Real (Cillamayor)","context_page_description":"La Iglesia de Santa María la Real está situada en Cillamayor, dentro del municipio de Barruelo de Santullán, perteneciente a la provincia de Palencia, en España. El grueso del edificio, aunque con alguna modificación posterior, corresponde a época románica. No obstante, existe un fragmento de muro en el lienzo Norte, que no corresponde ni con la tipología románica del edificio ni con el despiece que le rodea. Desconocemos su origen, pero podemos datarlo entre un prerrománico tardío y un románico incipiente. De época propiamente románica va a datar la construcción de la cabecera del edificio. Como es habitual, siempre se comienza por esta parte de las iglesias, puesto que una vez concluida, se puede consagrar y comenzar ya a oficiar la misa en ella. Por su tipología podemos encuadrarla alrededor de mediados del siglo XII."},{"page_url":"https://fr.wikipedia.org/wiki/Le_Roi_Candaule","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Boissard_Fernand_1841_H%C3%A9ta%C3%AFre_offerte.jpg","page_title":"Le Roi Candaule","context_page_description":"Le Roi Candaule est une nouvelle de Théophile Gautier, parue en cinq livraisons, du 1ᵉʳ au 5 octobre 1844, dans La Presse."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A8%D1%83%D0%BF,_%D0%94%D1%8D%D0%B2%D0%B8%D0%B4","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b3/GenDMShoup_USMC.jpg","page_title":"Шуп, Дэвид","context_page_description":"Дэвид Монро Шуп — генерал корпуса морской пехоты США, награждён медалью Почёта за участие во Второй мировой войне, 22-й комендант корпуса морской пехоты США. После отставки — один из наиболее влиятельных критиков Вьетнамской войны.\\nРодился в штате Индиана в обедневшей семье, вступил в ряды вооружённых сил из-за финансовых причин. В межвоенный период продвигался по служебной лестнице. Дважды направлялся в Китай, в ходе местной гражданской войны. В ходе вступления США во вторую мировую войну служил в Исландии, затем служил штабным офицером на Тихоокеанском театре. Неожиданно был поставлен во главе второго полка морской пехоты и возглавил первую высадку на Тараве, за что получил медаль Почёта и орден «За выдающиеся заслуги». Участвовал в кампании на Марианских островах. Позднее стал высокопоставленным офицером по военному снабжению.\\nУтвердив свою репутацию как жёсткий и напористый лидер, Шуп вошёл в ряды высшего руководства корпусом, отвечая за финансовые дела, снабжение и подготовку новобранцев. Президент США Эйзенхауэр выбрал его кандидатуру на пост коменданта корпуса. В дальнейшем Шуп служил и в ходе президентства Кеннеди."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%A9%AC%E5%A1%9E%E6%B4%9B%C2%B7%E8%90%A8%E6%8B%89%E8%80%B6%E5%A1%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Marcelo_Zalayeta.jpg","page_title":"马塞洛·萨拉耶塔","context_page_description":"馬塞洛·丹比奧·薩拉耶塔，烏拉圭國家足球隊的前鋒。2016年退役。香港球迷給他暱稱為「椰撻」。"},{"page_url":"https://de.wikipedia.org/wiki/Bassum","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Bassum_25100700112_Stiftsdamenhaus_Stift_3.jpg","page_title":"Bassum","context_page_description":"Bassum ist eine Stadt im Landkreis Diepholz in Niedersachsen mit 15.964 Einwohnern."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B3%8A%E5%A4%B4%E7%81%AB%E6%9F%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Botou_Match.JPG","page_title":"泊头火柴","context_page_description":"泊头火柴，是河北泊头火柴有限公司所生产的一种火柴，有着百年历史，曾改变了当时中国依赖“洋火”的局面。"},{"page_url":"https://sv.wikipedia.org/wiki/1468","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Gutenberg.jpg","page_title":"1468","context_page_description":"1468 var ett skottår som började en fredag i den julianska kalendern."},{"page_url":"https://ja.wikipedia.org/wiki/F3D_(%E8%88%AA%E7%A9%BA%E6%A9%9F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Douglas_F3D-2_Skyknight_124630_%2815359711837%29.jpg","page_title":"F3D (航空機)","context_page_description":"F3D スカイナイトは、アメリカ合衆国のダグラス社が開発し、アメリカ海軍や海兵隊で運用された艦上戦闘機。\\n愛称の「スカイナイト 」は、空の騎士の意。後に改称され、F-10 スカイナイトとなった。"},{"page_url":"https://de.wikipedia.org/wiki/Max_Dennert","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a2/Villa_Huegel_Essen_2.jpg","page_title":"Max Dennert","context_page_description":"Max Dennert war ein deutscher Bildhauer."},{"page_url":"https://it.wikipedia.org/wiki/The_Avett_Brothers","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Flickr_-_moses_namkung_-_Avett_Brothers_5.jpg","page_title":"The Avett Brothers","context_page_description":"Gli Avett Brothers sono un gruppo musicale statunitense proveniente da Concord, Carolina del Nord.\\nIl gruppo è composto dai fratelli Scott e Seth Avett e da Bob Crawford. Il violoncellista Joe Kwon ed il batterista Mike Marsh accompagnano il gruppo durante i tour,\\nKwon ha partecipato alle registrazioni in studio dell'album Emotionalism.\\nNati dalle ceneri di un precedente gruppo, il loro stile musicale fonde principalmente bluegrass, folk e rock, ma sono presenti anche richiami a molti altri generi come il country, il punk rock, il pop."},{"page_url":"https://oc.wikipedia.org/wiki/Festalems","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/63/Festalemps_mairie.JPG","page_title":"Festalems","context_page_description":"Festalems, prononciat [fɛjtɒ’lɛ̃m], o Festalens es una anciana comuna dau departament de Dordonha de la region de Novela Aquitània, ancianament d'Aquitània. Dempuei lo 1er de genier 2017, es gropelada emb Sent Antòni e Cucmont e Sent Privat daus Prats e es venguda comuna delegada de la comuna novela de Sent Privat en Perigòrd."},{"page_url":"https://tr.wikipedia.org/wiki/Tekne_kald%C4%B1rac%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Str%C3%A9py-Bracquegnies_JPG03.jpg","page_title":"Tekne kaldıracı","context_page_description":"Tekne kaldıracı, gemi kaldıracı ya da kaldıraç havuzu, iki farklı rakımdaki sular arasında tekneleri taşımaya yarayan makinedir. Kanal havuzu ile kanal yatay düzlemine bir alternatif olarak sunulmuştur.\\nBu kaldıraçlar, Almanya ve Belçika'daki gemi kaldıraçları, Fransa'daki Les Fontinettes ve İngiltere'deki Anderton tekne kaldıracı gibi yatay olarak ya da İskoçya'daki Falkirk Wheel gibi dairesel hareket edebilirler."},{"page_url":"https://en.wikipedia.org/wiki/Angiopteris","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Angiopteris_evecta_Coffs_Harbour.jpg","page_title":"Angiopteris","context_page_description":"Angiopteris is a genus of huge evergreen ferns from the family Marattiaceae, found throughout the paleotropics from Madagascar to the South Pacific islands. Species of smaller stature with elongate synangia and creeping rhizomes are sometimes segregated into the genus Archangiopteris, and a once-pinnate monotypic segregate genus has been called Macroglossum, but molecular data supports inclusion of these taxa within a broad concept of Angiopteris.\\nAngiopteris evecta has been introduced and naturalized in Hawaii, Jamaica, and parts of Central America, where it has become an invasive weed in lower elevation drainages. They feature a large, erect, woody rhizome with a wide base supported by thick roots. The fronds are deltoid, pinnate, 5–8 metres long, with spreading leaflets.\\nAngiopteris is unique among ferns in having explosively dispersed spores, thought to be caused by the cavitation of an airspace between spore layers.\\nThe basal chromosome number for this genus is 2n=80. The type species is Angiopteris evecta."},{"page_url":"https://hu.wikipedia.org/wiki/Sz%C3%B6vetkezet","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/25/OSG_Co-op_AGM_20050423.jpg","page_title":"Szövetkezet","context_page_description":"A polgári jogban a szövetkezet a tagok vagyoni hozzájárulásából álló tőkével alapított, a nyitott tagság és a változó tőke elvei szerint működő, a tagok gazdasági és társadalmi szükségleteinek kielégítésére irányuló tevékenységet végző jogi személy, amelynél a tag kötelezettsége a szövetkezettel szemben vagyoni hozzájárulásának szolgáltatására és az alapszabályban meghatározott személyes közreműködésre terjed ki."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%94%D0%B5%D1%82%D0%B5_%D0%B8%D0%B7_%D0%A2%D0%B0%D1%83%D0%BD%D0%B3%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Australopithecus_africanus_-_Cast_of_taung_child.jpg","page_title":"Дете из Таунга","context_page_description":"Дете из Таунга је назив за фосилизовану лобању изумрле врсте хоминида Australopithecus africanus. Откривена је 1924. у граду Таунг у Јужној Африци. Рејмонд Дарт га је описао као нову врсту хоминида у часопису Природа, 1925."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D8%A7%D8%AE_%D8%B3%D9%84%D8%B7%D9%86%D8%AA%DB%8C_%D8%A2%D9%85%D8%B3%D8%AA%D8%B1%D8%AF%D8%A7%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/King_Willem-Alexander%2C_Princess_Beatrix_en_Queen_Maxima.jpg","page_title":"کاخ سلطنتی آمستردام","context_page_description":"کاخ سلطنتی آمستردام یک کاخ در شهر آمستردام، هلند است.\\nاین کاخ در سال ۱۶۴۸ شروع به ساخت و در ۱۶۵۵ میلادی تأسیس شده، این بنا سیتی‌هال و مرکز قدرت پادشاهی هلند در شهر آمستردام بوده‌است."},{"page_url":"https://fr.wikipedia.org/wiki/Embl%C3%A8mes_de_la_France","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Logo_XV_de_france.JPG","page_title":"Emblèmes de la France","context_page_description":"L'emblème de la France fixé par la Constitution actuelle dans son article 2 est le drapeau bleu, blanc et rouge.\\nEn 1999, le gouvernement a adopté pour sa communication une charte graphique comprenant un logotype utilisé par les ministères, les services déconcentrés de l'État, les ambassades, etc.\\nUn emblème représentant un faisceau de licteur est utilisé pour représenter la France sur les passeports et sur les plaques signalant les représentations diplomatiques sans qu'il fasse l'objet d'un texte officiel.\\nAu cours de l'Histoire, la France a connu comme emblèmes de nombreuses oriflammes ou autres symboles."},{"page_url":"https://pl.wikipedia.org/wiki/Jezioro_Witobelskie","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Tor_regatowy_na_Jeziorze_Witobelskim.jpg","page_title":"Jezioro Witobelskie","context_page_description":"Jezioro Witobelskie – jezioro w woj. wielkopolskim, w pow. poznańskim, w gminie Stęszew. Jest to jezioro rynnowe położone na Pojezierzu Poznańskim, w granicach Wielkopolskiego Parku Narodowego. Linia brzegowa słabo rozwinięta, brzegi wysokie, miejscami porośnięte lasem. Przy południowym krańcu jeziora wieś Łódź. Przez jezioro przepływa Samica Stęszewska."},{"page_url":"https://en.wikipedia.org/wiki/Herts_and_Middlesex_Wildlife_Trust","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Old_Park_Wood_path.jpg","page_title":"Herts and Middlesex Wildlife Trust","context_page_description":"Herts and Middlesex Wildlife Trust manages over 40 nature reserves covering nearly 810 hectares north of London, in Hertfordshire and the former county of Middlesex, which is now divided between the London boroughs of Barnet, Enfield, Harrow and Hillingdon. It has over 21,000 members, and is one of 46 Wildlife Trusts across the UK. It is a Registered Charity, with its Registered Office in St Albans, and had an income in the year to 31 March 2014 of over £1.5 million.\\nThe Trust's activities include managing nature reserves, advising landowners on how to manage their land for wildlife, commenting on planning applications, advising planning authorities and campaigning to protect wildlife. The Trust also encourages people to be active volunteers helping to maintain nature reserves.\\nThe first preparatory meeting of what was to become the Trust was held on 16 November 1963, and the Hertfordshire & Middlesex Trust for Nature Conservation was incorporated on 9 October 1964. By 1970 it had twenty reserves and in the same year it took over management of its first Site of Special Scientific Interest, Blagrove Common. In 1987 it changed its name to the Herts and Middlesex Wildlife Trust."},{"page_url":"https://sv.wikipedia.org/wiki/Hermione_(djur)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Hermione.jpg","page_title":"Hermione (djur)","context_page_description":"Hermione är ett släkte av ringmaskar. Hermione ingår i familjen Aphroditidae.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://en.wikipedia.org/wiki/Javi_M%C3%A1rquez","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e9/Javi_Marquez.jpg","page_title":"Javi Márquez","context_page_description":"Javier \\"Javi\\" Márquez Moreno is a Spanish professional footballer who plays as a central midfielder."},{"page_url":"https://uk.wikipedia.org/wiki/Simca","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/62/Matra_M530LX.jpg","page_title":"Simca","context_page_description":"Simca — з 1934 року французький виробник автомобілів. Штаб-квартира розташована в місті Нантерр. У 1964 році компанію купує фірма Chrysler. У 1980 році компанія припинила виробництво автомобілів."},{"page_url":"https://es.wikipedia.org/wiki/Esculturas_de_la_Plaza_de_Catalu%C3%B1a","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Gargallo_-_Pastor_del_flabiol.jpg","page_title":"Esculturas de la Plaza de Cataluña","context_page_description":"El conjunto de esculturas de la Plaza de Cataluña fue creado entre 1927 y 1929 para la Exposición Internacional de Barcelona de 1929. La Plaza de Cataluña es uno de los centros neurálgicos de Barcelona, y está situada en el distrito del Ensanche, en la confluencia entre la Rambla de Canaletas, la calle de Pelayo, la ronda de la Universidad, la Rambla de Cataluña, el Paseo de Gracia, la Ronda de San Pedro, la calle de Fontanella y el Portal del Ángel. Tiene una superficie de 5 hectáreas.​\\nLa Plaza de Cataluña empezó a urbanizarse en 1902, aunque el punto culminante de las obras se realizó en los años 1920, con vistas a la celebración de la Exposición Internacional. En 1927 se organizó un concurso público para decorar la plaza, en el que se decidió la instalación de 28 esculturas, de autores como Eusebi Arnau, Joan Borrell, Enric Casanovas, Josep Clarà, Josep Dunyach, Jaume Duran, Pablo Gargallo, Josep Llimona, Frederic Marès, Enric Monjo, Vicenç Navarro, Llucià Oslé, Miquel Oslé, Jaume Otero, Antonio Parera, Josep Tenas y Josep Viladomat.​ Este conjunto es uno de los más grandes de Barcelona en cuanto a arte público, y supone un auténtico museo de esculturas al aire libre."},{"page_url":"https://sv.wikipedia.org/wiki/Andra_v%C3%A4rldskriget","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Battle_of_britain_air_observer.jpg","page_title":"Andra världskriget","context_page_description":"Andra världskriget var en väpnad konflikt som pågick från år 1939 till 1945 och involverade de flesta av världens nationer, inklusive alla stormakter, vilka till slut bildade två motsatta militära allianser: de allierade med Storbritannien som ledande mot axelmakterna med Tyskland som huvudrepresentant. Det var det mest utbredda kriget i historien med mer än 100 miljoner människor som tjänstgjorde i militära enheter. I ett tillstånd av \\"totalt krig\\" ställde de stora deltagarna hela sin ekonomiska, industriella och vetenskapliga kapacitet till förfogande för krigsansträngningen och raderade därmed ut skillnaden mellan civila och militära resurser. Genom att involvera massdöd av civila, däribland förintelsen i koncentrationsläger, strategiska bombningar och de första användningarna av kärnvapen i krig ledde kriget till att mellan 50 och 85 miljoner människor dödades. Detta gör andra världskriget till den i särklass blodigaste konflikten under hela mänsklighetens historia."},{"page_url":"https://fr.wikipedia.org/wiki/Gregorio_Ferro","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/San_Sebasti%C3%A1n%2C_Gregorio_Ferro.jpg","page_title":"Gregorio Ferro","context_page_description":"Gregorio Ferro, né Gregory Ferro Requeijo le 24 décembre 1742 à Boqueixón et mort le 23 janvier 1812 à Madrid, est un peintre espagnol."},{"page_url":"https://sq.wikipedia.org/wiki/Bezas","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Sierra_de_Albarrac%C3%ADn.png","page_title":"Bezas","context_page_description":"Bezas është një komunë në Spanjë, e vendosur në qarkun Sierra de Albarracín, të provincës Teruel, në Aragon. Bezas ka 72 banorë, dhe përfshinë një sipërfaqe prej 26.32 km²."},{"page_url":"https://sk.wikipedia.org/wiki/Kostol_Bo%C5%BEsk%C3%A9ho_Srdca_Je%C5%BEi%C5%A1ovho_(Partiz%C3%A1nske)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Partiz%C3%A1nske%2C_kostol_Bo%C5%BEsk%C3%A9ho_Srdca_Je%C5%BEi%C5%A1ovho.jpg","page_title":"Kostol Božského Srdca Ježišovho (Partizánske)","context_page_description":"Kostol Božského Srdca je rímskokatolícky kostol v Partizánskom. Navrhol ho významný architekt Vladimír Karfík. Stavba dotvára dôležitú kompozičnú osnovu mesta a dodnes je jeho známou dominantou. Základný kameň kostola bol posvätený 8. júla 1943. Legálnu vysviacku kostola naplánovanú na 25.-26. mája 1949 prekazil nový komunistický režim, kostol bol neoficiálne vysvätený 25. júna 1949, oficiálne až 2. septembra 1989."},{"page_url":"https://it.wikipedia.org/wiki/Elasmucha_grisea","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Elasmucha_grisea.jpg","page_title":"Elasmucha grisea","context_page_description":"Elasmucha grisea Linnaeus, 1758, è un insetto Rincote Eterottero della famiglia degli Acanthosomatidae."},{"page_url":"https://ro.wikipedia.org/wiki/Maria_Luisa_Immaculata_de_Bourbon-Dou%C4%83_Sicilii","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Princess_Maria_Luisa_of_Bourbon-Two_Sicilies%2C_Countess_of_Bardi.jpg","page_title":"Maria Luisa Immaculata de Bourbon-Două Sicilii","context_page_description":"Prințesa Maria Luisa de Bourbon-Două Sicilii a fost fiica cea mică a regelui Ferdinand al II-lea al Celor Două Sicilii și a celei de-a doua soții, Maria Tereza de Austria. A fost cunoscută pentru pietatea ei și caritatea față de săraci."},{"page_url":"https://en.wikipedia.org/wiki/Book_of_Job_in_Byzantine_illuminated_manuscripts","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/PAT171p507.jpg","page_title":"Book of Job in Byzantine illuminated manuscripts","context_page_description":"There are fourteen known Byzantine manuscripts of the Book of Job dating from the 9th to 14th centuries, as well as a post-Byzantine codex illuminated with cycle of miniatures. The quantity of Job illustrations survived in the fifteen manuscripts exceeds 1800 pictures. The total is aggregated considerably by single images of Job in other manuscripts, frescoes and carvings."},{"page_url":"https://en.wikipedia.org/wiki/1907%E2%80%9308_Istanbul_Football_League","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/54/Moda_FC.jpg","page_title":"1907–08 Istanbul Football League","context_page_description":"The 1907–08 İstanbul Football League season was the fourth season of the league. Moda FC won the league for the first time."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%98%BF%E6%8B%89%E5%A5%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/E8309-Kosh-Kol-beach.jpg","page_title":"阿拉套","context_page_description":"阿拉套，在古突厥语中的意思为“各种颜色的花色”。指的是中亚美丽的山脉。如果从山脚攀登到山顶，一路花草树木品种各异，让人一日之内观尽四季风景。\\n从名字可知，这些山脉是古代操突厥语的人们繁衍生息的地方。这些以阿拉套命名的山脉，除了现在属于俄罗斯的库兹涅茨克山外，都在中亚的天山山脉，包括：\\n准噶尔阿拉套：简称阿拉套山，位于中国新疆博尔塔拉蒙古自治州与哈萨克斯坦七河地区之间的北天山山脉，长约450千米，最高峰别斯巴斯坎山海拔4464米，由卡拉套、巴斯坎套、托克桑拜、别德任套等平行山脉所组成。阿拉套山东端的阿拉山口，另一说为282米，为中国和哈萨克斯坦两国边界的重要口岸。\\n外伊犁阿拉套：属于北天山山脉，位于哈萨克斯坦南部及吉尔吉斯斯坦北部，长350 km，最高峰为塔尔加尔峰，外伊犁阿拉套的北缘就是伊犁盆地的西段，伊犁河从此流过，命名也由此而来。阿拉木图市就位于此山脉的山脚。\\n泰尔斯凯山脉：属于南天山山脉，位于吉尔吉斯斯坦东南部，伊塞克湖的南面，长354 km，最高峰为鲍里斯·叶利钦峰，海拔5,216米。\\n昆格山脉"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Nor_L%C3%ADpez_S%C3%A9ng","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Bolivia_Potos%C3%AD_Nor_L%C3%ADpez.png","page_title":"Nor Lípez Séng","context_page_description":"Nor Lípez sī Bolivia Potosí Hú ê chi̍t ê séng."},{"page_url":"https://hu.wikipedia.org/wiki/Bourg-de-P%C3%A9age","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Population_-_Municipality_code_26057.svg","page_title":"Bourg-de-Péage","context_page_description":"Bourg-de-Péage település Franciaországban, Drôme megyében. Bourg-de-Péage Romans-sur-Isère, Alixan, Châteauneuf-sur-Isère és Chatuzange-le-Goubet községekkel határos."},{"page_url":"https://pl.wikipedia.org/wiki/Dodge_Magnum_(1978)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Magnum_Turbo_by_Chrysler_1985.JPG","page_title":"Dodge Magnum (1978)","context_page_description":"Dodge Magnum – samochód sportowy klasy luksusowej, a następnie klasy średniej produkowany pod amerykańską marką Dodge w latach 1978 – 1988."},{"page_url":"https://en.wikipedia.org/wiki/Air_traffic_controller","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Civilian_air_traffic_controllers%2C_Memphis.jpg","page_title":"Air traffic controller","context_page_description":"Air traffic control specialists, abbreviated ATCS, are personnel responsible for the safe, orderly, and expeditious flow of air traffic in the global air traffic control system. Usually stationed in air traffic control centers and control towers on the ground, they monitor the position, speed, and altitude of aircraft in their assigned airspace visually and by radar, and give directions to the pilots by radio. The position of air traffic controller is one that requires highly specialized knowledge, skills, and abilities. Controllers apply separation rules to keep aircraft at a safe distance from each other in their area of responsibility and move all aircraft safely and efficiently through their assigned sector of airspace, as well as on the ground. Because controllers have an incredibly large responsibility while on duty and make countless real-time decisions on a daily basis, the ATC profession is consistently regarded around the world as one of the most mentally challenging careers, and can be notoriously stressful depending on many variables."},{"page_url":"https://de.wikipedia.org/wiki/Vemac_RD320R","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Mach_GoGoGo_Shaken_RD320R_2011_Super_GT_Fuji_250km.jpg","page_title":"Vemac RD320R","context_page_description":"Der Vemac RD320R war ein Rennwagen des britischen Sportwagenherstellers Vemac, der 2001 entwickelt wurde und 2002 zum ersten Mal bei einem Rennen antrat. Vemac produzierte das Fahrzeug bis 2009.\\nDer RD320R war als FIA World Sportcar registriert und fuhr als Super-GT-300-Fahrzeug."},{"page_url":"https://eu.wikipedia.org/wiki/Aiolosita","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Aiolosite.jpg","page_title":"Aiolosita","context_page_description":"Aiolosita sulfato motako minerala da eta hedyphane taldearen kidea da."},{"page_url":"https://pt.wikipedia.org/wiki/Asa_Gray","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Asa_Gray_by_John_Whipple%2C_1864.jpg","page_title":"Asa Gray","context_page_description":"Asa Gray foi um botânico norte-americano, discípulo de John Torrey e colaborador de Charles Darwin.\\nFoi autor de muitos livros que difundiram a botânica. Escreveu Flora da América do Norte com John Torrey e foi um líder entusiástico na descoberta e classificação de novas espécies. Não vislumbrando nenhum conflito entre a evolução e sua visão do projeto divino da natureza, apoiou as teorias de Darwin num momento em que elas eram condenadas por muitos."},{"page_url":"https://de.wikipedia.org/wiki/Luitpoldbad_(Bad_Kissingen)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/Bad_Kissingen_-_Luitpold-Bad_s%C3%BCdwestlich.jpg","page_title":"Luitpoldbad (Bad Kissingen)","context_page_description":"Das Luitpoldbad im bayerischen Staatsbad Bad Kissingen war Anfang des 20. Jahrhunderts das größte Badehaus Europas. Heute beherbergt das unter Denkmalschutz stehende Gebäude die Bad Kissinger Spielbank und mehrere Behörden."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B7%E3%83%B3%E3%82%BD%E3%83%BB%E3%83%87%E3%83%BB%E3%83%AA%E3%83%9F%E3%82%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Espa%C3%B1aLoc.svg","page_title":"シンソ・デ・リミア","context_page_description":"シンソ・デ・リミアは、スペイン・ガリシア州オウレンセ県のムニシピオ。コマルカ・ダ・リミアに属する。ガリシア統計局によれば、2013年の人口は10,307人。住民呼称はlimiao/-iá。カスティーリャ語表記はGinzo de Limia。\\nガリシア語話者の自治体住民に占める割合は、96.57％。"},{"page_url":"https://fr.wikipedia.org/wiki/Oberhergheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Oberhergheim%2C_Mairie.jpg","page_title":"Oberhergheim","context_page_description":"Oberhergheim [obəʁɛʁkaɪm] est une commune française rurale située dans le département du Haut-Rhin, en région Grand Est.\\nCette commune se trouve dans la région historique et culturelle d'Alsace.\\nSes habitants sont appelés les Oberhergheimois et les Oberhergheimoises."},{"page_url":"https://en.wikipedia.org/wiki/Psalm_106","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Psalm_105_Initial_C.jpg","page_title":"Psalm 106","context_page_description":"Psalm 106 is the 106th psalm of the biblical Book of Psalms. In the Greek Septuagint version of the bible, and in its Latin translation in the Vulgate, this psalm is Psalm 105 in a slightly different numbering system."},{"page_url":"https://en.wikipedia.org/wiki/Eirin_Faldet","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Eirin_Faldet_-_Arbeiderpartiet.jpg","page_title":"Eirin Faldet","context_page_description":"Eirin Faldet is a Norwegian politician for the Labour Party. She was elected to the Norwegian Parliament from Hedmark in 1985, and has been re-elected on five occasions. She has served as Deputy President of the Storting since 2001. On the local level she was a member of Trysil municipal council from 1975 to 1978. Prior to entering politics she was a teacher and a social worker."},{"page_url":"https://en.wikipedia.org/wiki/Second_Tikal%E2%80%93Calakmul_War","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Caracol-glif.png","page_title":"Second Tikal–Calakmul War","context_page_description":"The Second Tikal–Calakmul War was the second in a series of wars between Tikal and Calakmul known as The Tikal–Calakmul wars. Tikal and Calakmul were some of the most prosperous cities in Peten during the classic period of Mesoamerican chronology. After the classic came the post classic which was characterized by a decline in Maya Civilization. During that time both Tikal and Calakmul were abandoned."},{"page_url":"https://pl.wikipedia.org/wiki/%C5%81oskotnica_p%C4%99kaj%C4%85ca","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Hura_crepitans_Vietnam.jpg","page_title":"Łoskotnica pękająca","context_page_description":"Łoskotnica pękająca, piaskownica pękająca – gatunek drzewa z rodziny wilczomleczowatych. Pochodzi tropikalnych rejonów Ameryki. Naturalizowana również na niektórych obszarach w Azji. Cała roślina zawiera trujący sok mleczny – samo dotknięcie może wywołać podrażnienia skóry, zaś kontakt z oczami prowadzić nawet do ślepoty."},{"page_url":"https://es.wikipedia.org/wiki/Campo_de_Aliste_(Red_Natura_2000)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Circus_cyaneus_01367t.JPG","page_title":"Campo de Aliste (Red Natura 2000)","context_page_description":"El Campo de Aliste es un espacio natural protegido por la Red Natura 2000 en la provincia de Zamora.​\\nSe sitúa en un amplio valle, entre los ríos Aliste y Cebal y las estribaciones de la sierra de la Culebra. Las figuras de protección existentes son las de Lugar de Importancia Comunitaria con código ES4190133 y la de Zona de Especial Protección para las Aves con código ES0000358."},{"page_url":"https://it.wikipedia.org/wiki/Isola_Gabbia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Olbia%2C_isola_Gabbia_%2801%29.jpg","page_title":"Isola Gabbia","context_page_description":"L'isola Gabbia è un'isola del mar Tirreno situata a ridosso della costa nord-orientale della Sardegna, all'interno del golfo di Olbia.\\nAppartiene amministrativamente al comune di Olbia."},{"page_url":"https://id.wikipedia.org/wiki/Viviane_Senna","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Senna_viviane.jpg","page_title":"Viviane Senna","context_page_description":"Viviane Senna Lalli adalah pengusaha dan dermawan Brasil. Dia adalah saudari dari pembalap dan juara dunia Formula Satu tiga kali Ayrton Senna, dan ibu dari pembalap Bruno Senna."},{"page_url":"https://de.wikipedia.org/wiki/Preu%C3%9Fische_Armee","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/C61_Saarlouis.JPG","page_title":"Preußische Armee","context_page_description":"Die Preußische Armee war die Armee des preußischen Staates von 1701 bis 1919. Sie ging aus dem seit 1644 existierenden stehenden Heer Brandenburg-Preußens hervor. 1871 ging sie ins Deutsche Heer ein und wurde 1919 als Folge der Niederlage des Deutschen Kaiserreiches im Ersten Weltkrieg aufgelöst.\\nDie militärische Stärke dieser Armee war Voraussetzung für die Entwicklung Brandenburg-Preußens zu einer der fünf europäischen Großmächte des 18. und 19. Jahrhunderts. Ihre Niederlage zu Beginn der Napoleonischen Kriege 1806 stellte eine Zäsur in ihrer Geschichte dar. Sie leitete eine grundlegende Modernisierung unter Führung von Gerhard von Scharnhorst ein, die die Armee völlig veränderte. Historiker sprechen deshalb von der altpreußischen Armee und der neupreußischen Armee.\\nNach der Reform nahm die preußische Armee zwischen 1813 und 1815 an den Befreiungskriegen teil und leistete einen entscheidenden Anteil zur Befreiung der deutschen Staaten von der französischen Fremdherrschaft."},{"page_url":"https://sq.wikipedia.org/wiki/Sh%C5%8Dgitai","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/77/Duel_between_a_Shogitai_and_Shaguma_in_the_Battle_of_Ueno.jpg","page_title":"Shōgitai","context_page_description":"Shōgitai ishin elitë të shogunatit e formuar më 1868 gjatë periudhës Bakumatsu në Japoni.\\nShōgitai morrën pjesë në beteja të Luftës Boshin, sidomos në Betejën e Toba-Fushimi dhe Betejën e Uenos, ku ishin pothuajse të shfarosur."},{"page_url":"https://es.wikipedia.org/wiki/Cuadrangular_de_Villamontes_2012","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Flag_of_Tarija.svg","page_title":"Cuadrangular de Villamontes 2012","context_page_description":"El Cuadrangular de Villamontes 2012 o Copa Villamontes 2012, fue un torneo relámpago organizado por el Comité Ejecutivo Seccional de la ciudad de Villamontes, como parte del 152 aniversario de la localidad, que además contó con actividades de carácter cultural y folklórico, desarrolladas en la plaza principal de la ciudad.\\nLas autoridades indicaron que hay una firme intención de realizar la segunda versión de la Copa Villamontes para el 2013"},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_di_San_Panfilo","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Tornimparte_-_Chiesa_di_San_Panfilo_09.jpg","page_title":"Chiesa di San Panfilo","context_page_description":"La chiesa di San Panfilo è un edificio religioso che si trova nel comune di Tornimparte in provincia dell'Aquila, monumento nazionale dal 1902."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BB%D0%BE%D0%BC%D0%B5%D1%8F-%D0%BF%D0%BE%D0%B2%D0%B8%D1%82%D1%83%D1%85%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Salome_capp.JPG","page_title":"Саломея-повитуха","context_page_description":"Саломе́я-повитуха — упоминаемая в христианских апокрифах повивальная бабка, присутствовавшая при рождении Иисуса Христа, которая через чудо засвидетельствовала сохранение девственности Богородицы. Образ Саломеи вошёл в иконографию Рождества Христова и народные обычаи, связанные с родами."},{"page_url":"https://de.wikipedia.org/wiki/Juri-Gagarin-Ring","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Postscheckamt_Erfurt.JPG","page_title":"Juri-Gagarin-Ring","context_page_description":"Der Juri-Gagarin-Ring ist eine 2300 Meter lange Ringstraße, die den Kern der Altstadt Erfurts im Süden und Osten umgibt. Angelegt wurde der Straßenzug 1898, nachdem bereits unter Oberbürgermeister Richard Breslau Planungen dazu angestellt wurden. Seit 1964 ist er nach dem sowjetischen Raumfahrer Juri Gagarin benannt."},{"page_url":"https://en.wikipedia.org/wiki/Poliana_Barbosa_Medeiros","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Poliana_Barbosa_Medeiros.jpg","page_title":"Poliana Barbosa Medeiros","context_page_description":"Poliana Barbosa Medeiros, known as Poliana, is a Brazilian football defender who plays for Campeonato Brasileiro de Futebol Feminino side São José and the Brazil women's national football team."},{"page_url":"https://lt.wikipedia.org/wiki/Jos%C3%A9_Ramos_Horta","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Jos%C3%A9_Ramos-Horta_Portrait.jpg","page_title":"José Ramos Horta","context_page_description":"Žozė Ramoš Orta – Rytų Timoro užsienio reikalų ministras ir svarbiausias nepriklausomybės nuo Indonezijos judėjimo veikėjas. Nuo 2007 m. gegužės 20 d. iki 2012 gegužės 20 d. Rytų Timoro prezidentas.\\nGimė Dilyje, portugalo ir timorietės šeimoje. Mokėsi katalikų misijoje. Po Indonezijos invazijos įstojo į Fretilin judėjimą. Jo 8 broliai ir 4 seserys buvo nužudyti Indoneziečių armijos. Pasitraukė į užsienį, kur atstovavo Fretilin. Spaudė tarptautinę bendruomenę atkreipti dėmesį į Rytų Timoro okupaciją. Kovojo prieš žmogaus teisių pažeidimus tėvynėje. 1996 m. kartu su savo bičiuliu, vyskupu Carlos Filipe Ximenes Belo pasidalino Nobelio taikos premiją. Gyvendamas užsienyje studijavo Hagos tarptautinės teisės akademijoje, taip pat studijavo teisę kituose garsiuose universitetuose."},{"page_url":"https://sh.wikipedia.org/wiki/Asignat","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1f/Assignat_de_15_sols.jpg","page_title":"Asignat","context_page_description":"Asignat je pomoćni papirnati novac, koji je prvi put emitiran u Francuskoj 1789. godine, za vrijeme Francuske revolucije. Emitiran je u velikim nominalama, od po 10.000 franaka, a kao pokriće su mu služila zaplijenjena dobra plemstva i crkve. Od 1790. godine emitiraju se i male nominale i u optjecaju se nalaze zajedno s kovanim novcem. Uslijed inflatornog emitiranja, vrijednost im je stalno opadala, tako da im je 1791. godine vrijednosti bila 90% nominalne vrijednosti, krajem 1794. godine 17%, a 1797. godine svi su asignati proglašeni bezvrijednima."},{"page_url":"https://pl.wikipedia.org/wiki/Liao_He","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Liaorivermap.png","page_title":"Liao He","context_page_description":"Liao He – rzeka w północno-wschodnich Chinach, płynąca przez południową, Nizinę Mandżurską i uchodząca do Zatoki Liaotuńskiej na Morzu Żółtym.\\nPowstaje z połączenie Xiliao He, która ma źródło w Mongolii Wewnętrznej i Dongliao He, która ma źródła w Górach Wschodniomandżurskich. Żegluga na Liao He jest możliwa na odcinku ok. 650 km; rzeka zamarza na cztery miesiące w roku. Długość rzeki wynosi 1430 km, a powierzchnia dorzecza to 219 tys. km²."},{"page_url":"https://sv.wikipedia.org/wiki/Gaudonville","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/81/Map_commune_FR_insee_code_32139.png","page_title":"Gaudonville","context_page_description":"Gaudonville är en kommun i departementet Gers i regionen Occitanien i sydvästra Frankrike. Kommunen ligger i kantonen Saint-Clar som tillhör arrondissementet Condom. År 2009 hade Gaudonville 118 invånare."},{"page_url":"https://es.wikipedia.org/wiki/Roiffieux","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cd/Map_commune_FR_insee_code_07197.png","page_title":"Roiffieux","context_page_description":"Roiffieux es una población y comuna francesa, ubicada en la región de Ródano-Alpes, departamento de Ardèche, en el distrito de Tournon-sur-Rhône y cantón de Annonay-Sud."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%84%A1%E8%BB%8C%E9%9B%BB%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Vbl_190_Heck.jpg","page_title":"無軌電車","context_page_description":"无轨电车是一种通常由架空接触网供电、电动机驱动，不依赖固定轨道行驶的道路公共交通工具。而在有些国家或地区，无轨电车则属于轨道交通的范畴。正因无轨电车兼具道路汽车和轨道交通二者的优缺点，使得其成为当代备受争议的一种交通工具。\\n无轨电车的车身和底盘一般与普通巴士相同，但车顶需要安装一对受电杆，用于从接触网的一对触线受电并形成电流通路。一般地，无轨电车的受电杆脱线则会失去动力；而装备有动力蓄电池、超级电容器或柴油发电机的双动源无轨电车，则可在没有架空接触网的路段实现离线行驶。"},{"page_url":"https://it.wikipedia.org/wiki/Podolia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/5._%D0%93%D0%BE%D0%BB%D0%BE%D0%B2%D0%BD%D0%B8%D0%B9_%D0%BA%D0%BE%D1%80%D0%BF%D1%83%D1%81_%D0%A3%D0%9D%D0%A3%D0%A1_%28%D0%BC%D1%83%D1%80.%29%2C_%D0%B2%D1%83%D0%BB%D0%B8%D1%86%D1%8F_%D0%86%D0%BD%D1%81%D1%82%D0%B8%D1%82%D1%83%D1%82%D1%81%D1%8C%D0%BA%D0%B0%2C_4_%28%D0%A3%D0%BC%D0%B0%D0%BD%D1%8C%29.JPG","page_title":"Podolia","context_page_description":"La Podolia è una regione storico-geografica situata nella zona centro-occidentale e sud-occidentale dell'attuale Ucraina e la Moldavia nord-orientale. Il nome Podolia appare in fonti storiche per la prima volta nel XIV secolo, quando i polacchi iniziarono a spostarsi nella regione."},{"page_url":"https://jv.wikipedia.org/wiki/Prat%C3%A9lan_kabupat%C3%A8n_lan_kutha_ing_Indon%C3%A9sia","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9a/Jakarta_selatan.png","page_title":"Pratélan kabupatèn lan kutha ing Indonésia","context_page_description":"Kaca iki isi pratélan kabupatèn lan kutha ing Indonésia."},{"page_url":"https://pt.wikipedia.org/wiki/Bandeira_de_Abel_Figueiredo","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Bandeira_Abel_Figueiredo.jpg","page_title":"Bandeira de Abel Figueiredo","context_page_description":"A bandeira de Abel Figueiredo é um dos símbolos oficiais de Abel Figueiredo, município localizado no estado do Pará."},{"page_url":"https://uk.wikipedia.org/wiki/AVE","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/AVE_network_rus.png","page_title":"AVE","context_page_description":"AVE — торгова марка компанії-оператора Іспанських залізниць Ренфе-Операдора, створена для надання послуг високошвидкісного залізничного транспорту в країні. Назва перекладається буквально Іспанський високошвидкісний, абревіатура одночасно обігрує слово Аве, яка зображена на логотипі компанії. Перевезення здійснюються на спеціально побудованих лініях стандартної європейської колії 1435 мм зі швидкістю до 330 км/год."},{"page_url":"https://it.wikipedia.org/wiki/Epilobium","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Epilobum_augustifolium_Aug2003.jpg","page_title":"Epilobium","context_page_description":"Il genere Epilobium, comunemente noti come epilobio, comprende più di un centinaio di specie di erbe dei climi temperati e freddi di entrambi gli emisferi."},{"page_url":"https://en.wikipedia.org/wiki/Mahmud_Esad_Co%C5%9Fan","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/HbfotoajaxaZUO1.jpg","page_title":"Mahmud Esad Coşan","context_page_description":"Mahmud Esad Coşan was a Turkish academic author, preacher, professor of Islam and Naqshbandi leader. He was born in Çanakkale, Turkey on 14 April 1938. He died in Dubbo, New South Wales, Australia on 4 February 2001."},{"page_url":"https://sv.wikipedia.org/wiki/Anne_of_Green_Gables_(1919)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Anne_of_Green_Gables_%281919_film%29.jpg","page_title":"Anne of Green Gables (1919)","context_page_description":"Anne of Green Gables är en amerikansk film från 1919 i regi av William Desmond Taylor. Filmen är baserad på romanen Anne på Grönkulla av Lucy Maud Montgomery som gavs ut 1908. Filmen räknas som förlorad."},{"page_url":"https://en.wikipedia.org/wiki/Francis_Rapp","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Francis_Rapp_par_Claude_Truong-Ngoc_f%C3%A9vrier_2014.jpg","page_title":"Francis Rapp","context_page_description":"Francis Rapp was a French medievalist specializing in the history of Alsace and medieval Germany. An emeritus university professor, he was a member of the Académie des inscriptions et belles-lettres since 1993."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BD%D5%B8%D6%80%D5%A1%D5%B6%D5%A1%D6%80%D5%A4%D5%A1%D5%B1%D6%87_%D5%BF%D5%B6%D5%A5%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Kubuswoningen_Speelhuisplein_Helmond.jpg","page_title":"Խորանարդաձև տներ","context_page_description":"Խորանարդաձև տներ կամ Տուն-խորանարդներ, 1984 թվականին Ռոտերդամում և Հելմոնդում ճարտարապետ Պիտ Բլոմի նորարարական նախագծով կառուցված տների շարք։ Ռոտերդամում տները գտնվում են Օվերբլանկ փողոցի վրա, նույնանուն մետրոյի կայարանից ոչ հեռու։ Բլոմի վճռական որոշումն այն էր, որ նա հիմնադրեց տան զուգահեռագիծը ոչ թե հիմքում, ինչպես սովորաբար, այլ գագաթին, և այդ գագաթով նա հենվում է վեցանկյուն մուտքին։ Ռոտերդամում կա այդպիսի 38 տուն և նաև երկու խոշոր տուն-խորանարդներ, բացի այդ բոլոր տները միաձուլված են որպես մեկ շինություն։ Թռչնի թռիչքի բարձրությունից կոմպլեքսն ունի մտացածին տեսք, որը հիշեցնում է չստացված եռանկյունի։\\nՇատ բնակիչներ էքսկուրսիաներ են առաջարկում դեպի իրենց անսովոր բնակավայր։\\nՏները բաղկացած են երեք հարկից․\\nՑոկոլային հարկ՝ մուտք;\\nԱռաջին հարկում հյուրասենյակ և խոհանոց;\\nԵրկրորդ հարկում երկու ննջասենյակ և լոգասենյակ;\\nՎերևի հարկում երբեմն լինում է փոքրիկ այգի։\\nՊատերն ու լուսամուտները հատակի հետ կազմում են 54,7 աստիճանի անկյուն։ Բնակարանի ընդհանուր մակերեսը կազմում է 100 քառ․ մետր, սակայն տարածության քառորդ մասը չի օգտագործվում պատերի թեքության պատճառով։"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%B4%8B%E6%9C%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Van_Loo_-_Le_Marquis_de_Marigny_et_de_sa_femme_%281769%29.jpg","page_title":"洋服","context_page_description":"洋裝，廣義上的洋服包括整個西方服飾體系，但西方各國的傳統服飾均不一樣，因此目前如果提到洋服，狹義上指近代英國的西式的正式套裝，多指男性西裝。西裝雖然源自歐洲，但現已成為國際通行的正式服裝，是表示禮貌、尊重場合的一種方式。\\n男性洋服最為規範化。長袖外套、相配的長褲、長袖襯衫、領帶，是男性套裝的基本服飾。外套配長褲稱為兩件式西裝；加上背心則稱為三件式，但現在比較少見。女性洋服則比較多樣化，不過基本可歸納為外套、裙子、褲子、女裝襯衫。\\n舊式西裝甚至有相搭配的帽子，男性可戴軟呢帽或圓頂硬禮帽，女性戴藥丸盒帽。不過時至今日，藥丸盒帽多數只作為護理師或商店服務員制服的一部分，男性也少戴帽子。"},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A7%88%EB%A6%AC%EC%95%84_%EB%A0%88%EC%98%A4%ED%8F%B4%EB%94%94%EB%84%A4_%ED%8F%B0_%EC%99%B8%EC%8A%A4%ED%84%B0%EB%9D%BC%EC%9D%B4%ED%9E%88_%EC%97%AC%EB%8C%80%EA%B3%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/FranciscaGonzagaDeBranganca.jpg","page_title":"마리아 레오폴디네 폰 외스터라이히 여대공","context_page_description":"오스트리아의 마리아 레오폴지나는 브라질과 포르투갈의 군주 페드루 1세의 황후이다."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B5%D1%80%D1%80%D0%B0_%D1%81%D0%B8%D0%B3%D0%B8%D0%BB%D0%BB%D0%B0%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Terra_sigillata_%28Valladolid%2C_Spain%29.jpg","page_title":"Терра сигиллата","context_page_description":"Терра сигиллата — современный термин для римской столовой посуды определённой формы, которая изготавливалась в итальянских мастерских в Ареццо в конце I в. до н. э. Римские ремесленники ставили на столовой посуде клеймо своих ремесленных мануфактур.\\nТерра сигиллата представляет собой посуду с блестящим красноватым покрытием и бывает либо гладкой, либо модельной, то есть украшенной рельефами. На модельной посуде ставился отдельный штамп. Такие керамические сосуды, преимущественно чаши в дополнение обтачивались. Украшенную часть сосуда обычно увенчивает так называемый астрагал. Исследование терра сигиллата в археологии имеет давние традиции. Периодизация производится в первую очередь на основании штампа производителя и рисунка.\\nИз Италии терра сигиллата распространилась в северные провинции, а потом и в южную Галлию. Мастерские по изготовлению терра сигиллата возникли в южной и восточной Галлии, например, в Рейнцаберне в Пфальце, где в конце II в. возникло несколько мастерских-филиалов, в которых изготавливался так называемый «швабский товар». Кроме того, гончарные мануфактуры функционировали восточнее Рейна."},{"page_url":"https://simple.wikipedia.org/wiki/4_Vesta","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/4_Vesta_1_Ceres_Moon_at_20_km_per_px.png","page_title":"4 Vesta","context_page_description":"4 Vesta is the second most massive asteroid in the solar system, with an average diameter of about 530 km and an estimated mass 9% the mass of the entire asteroid belt. Its size and unusually bright surface makes Vesta the brightest asteroid, and the only one ever visible to the naked eye from Earth. Vesta's astronomical symbol is."},{"page_url":"https://it.wikipedia.org/wiki/Comuni_dell%27Arb%C3%ABria","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Willkommensschild_Vena_di_Maida_%28Maida%29.png","page_title":"Comuni dell'Arbëria","context_page_description":"Qui sono elencate le località italo-albanesi vive dell'Arbëria, ovvero quelle in cui la lingua viene mantenuta abitualmente, insieme al rito ed ai costumi. Sono elencate quelle dove l'uso dell'albanese è scomparso e quelle di cui si ha notizia o memoria della fondazione comune.\\nAll'interno delle comunità dell'Arbëria viene purtroppo segnalata una generale tendenza alla dismissione dell'uso dell'arbërishtja. Stime recenti generali, varianti nelle località albanofone, assegnano tra il 70% e il 90% dei residenti una competenza linguistica a livello di comprensione orale, mentre il restante 30%/10% parlerebbe l'italiano mantenendo una comprensione passiva dell'albanese. La lingua albanese continua ad esser tramandata sostanzialmente oralmente, all'interno della propria famiglia. Da sempre, lì dove viene conservato il rito bizantino, viene utilizzata e insegnata nella scrittura e nella lettura dalla chiesa locale, essendo lingua liturgica della Chiesa Italo-Albanese."},{"page_url":"https://nl.wikipedia.org/wiki/Leersum","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Utrechtse_Heuvelrug_Leersumse_veld.jpg","page_title":"Leersum","context_page_description":"Leersum is een dorp in de Nederlandse provincie Utrecht, gemeente Utrechtse Heuvelrug, op de gelijknamige Heuvelrug in het zuidoosten van de provincie. De Utrechtse Heuvelrug is sinds 2003 een nationaal park. De kern van Leersum heeft 7.575 inwoners. Vanwege het bosrijke karakter en de ligging aan de voet van de Heuvelrug, is Leersum een veel bezocht vakantieoord\\nDe Rijksstraatweg verdeelt het dorp in een noordelijk, lommerrijk gedeelte en een zuidelijk stuk met dichtere bouw.\\nLeersum was tot 1 januari 2006 een zelfstandige gemeente. Per deze datum is Leersum samen met de gemeenten Maarn, Amerongen, Driebergen en Doorn opgegaan in de nieuwe gemeente Utrechtse Heuvelrug. Leersum is in omvang de derde dorpskern van de gemeente."},{"page_url":"https://en.wikipedia.org/wiki/Sphaerophysa_(plant)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/29/Sphaerophysasalsula1.jpg","page_title":"Sphaerophysa (plant)","context_page_description":"Sphaerophysa is a genus of flowering plants in the legume family, Fabaceae. It belongs to the subfamily Faboideae.\\nThe species distributed from West Asia, Central Asia, Siberia and East Asia. There are two species:\\nSphaerophysa kotschyana is a sensitive plant endemic to Central Anatolia.\\nSphaerophysa salsula, on the other hand, is an Asian plant that is well-known on other continents as an introduced species and sometimes a weed."},{"page_url":"https://it.wikipedia.org/wiki/Cosa_nostra_statunitense","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/GottiPrison_%28mono_restoration%29.jpg","page_title":"Cosa nostra statunitense","context_page_description":"Cosa nostra statunitense è il nome con cui viene definita l'organizzazione criminale di stampo mafioso italo-statunitense, originatasi come un'associazione di mafiosi siciliani emigrati negli Stati Uniti d'America cominciando verso la seconda metà dell'Ottocento. L'espressione \\"Cosa Nostra\\" è stata coniata dal boss siculo-americano Lucky Luciano nel Dopoguerra, il quale ad una domanda di un affiliato sul nome da dare alla ristrutturazione della mafia in Sicilia e in America, rispose che era \\"una cosa tra loro\\", appunto \\"cosa nostra\\", per mantenerne meglio la segretezza.\\nCosa nostra statunitense, in maniera simile all'originale Cosa nostra siciliana, di cui ha mantenuto i rituali, l'organizzazione, ecc., è un'organizzazione mafiosa potente e segreta, priva di un nome formale. Coloro che ne fanno parte la chiamano cosa nostra o our thing. I mass media statunitensi la chiamano anche National Crime Syndicate, però questo epiteto comprende anche il sindacato ebreo-americano che collaborava strettamente con Cosa nostra italo-statunitense."},{"page_url":"https://id.wikipedia.org/wiki/Pembagian_administratif_Turki","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Gaziantep_districts.png","page_title":"Pembagian administratif Turki","context_page_description":"Sebanyak 81 Distrik di Turki dibagi kedalam 957 daerah. Di Republik Turki awal dan di Kesultanan Utsmaniyyah, unit yang ada kala itu."},{"page_url":"https://id.wikipedia.org/wiki/Panakawan","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Punakawan_wooden_decoration.jpg","page_title":"Panakawan","context_page_description":"Panakawan atau punakawan atau panakawan KBBI adalah sebutan umum untuk para pengikut kesatria dalam khasanah kesusastraan Indonesia, terutama di Jawa. Pada umumnya para panakawan ditampilkan dalam pementasan wayang, baik itu wayang kulit, wayang golek, ataupun wayang orang sebagai kelompok penebar humor untuk mencairkan suasana. Namun di samping itu, para panakawan juga berperan penting sebagai penasihat nonformal kesatria yang menjadi asuhan mereka."},{"page_url":"https://eu.wikipedia.org/wiki/NGC_2895","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/NGC_2895_SDSS.jpg","page_title":"NGC 2895","context_page_description":"NGC 2895 galaxia espiral bat da, Hartz Handia konstelazioan. John Herschelek aurkitu zuen 1831ko otsailaren 9an."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9F%E3%83%8E%E3%83%AB%E3%83%BB%E3%83%A4%E3%82%B9%E3%82%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Minoru_Yasui.jpg","page_title":"ミノル・ヤスイ","context_page_description":"ミノル・“ミン”・ヤスイは、アメリカ合衆国の日系二世弁護士で、第二次世界大戦期のアメリカにおける、日系人の強制収容の不当性を訴えた権利擁護活動家。"},{"page_url":"https://de.wikipedia.org/wiki/Johannes_Oerding","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Johannes_Oerding_%28ZMF_2018%29_jm78586.jpg","page_title":"Johannes Oerding","context_page_description":"Johannes Oerding ist ein deutscher Popsänger und Songwriter."},{"page_url":"https://hu.wikipedia.org/wiki/Miss_Eur%C3%B3pa","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Simon_B%C3%B6ske_Miss_Hungary_%C3%A9s_Miss_Europe.png","page_title":"Miss Európa","context_page_description":"A Miss Európa egy évente megrendezett szépségverseny."},{"page_url":"https://de.wikipedia.org/wiki/Walter_Ewert","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/GrabFamilieEwert.JPG","page_title":"Walter Ewert","context_page_description":"Walter Ewert war ein Kantor, Lehrer, Heimatforscher, Archiv- und Bodendenkmalpfleger des Kreises Greifswald-Land."},{"page_url":"https://eu.wikipedia.org/wiki/Anthracothorax_dominicus","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Antillean_Mango.jpg","page_title":"Anthracothorax dominicus","context_page_description":"Anthracothorax dominicus Anthracothorax generoko animalia da. Hegaztien barruko Trochilidae familian sailkatua dago."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_2014/Voorstel","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Koumbayala.jpg","page_title":"Lijst van personen overleden in 2014/Voorstel","context_page_description":"Dit is een lijst van personen die overleden zijn in 2014.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://eu.wikipedia.org/wiki/Luchino_Visconti","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Luchino_Visconti_1972.jpg","page_title":"Luchino Visconti","context_page_description":"Luchino Visconti, Modroneko Dukea antzerki eta zinema zuzendaria izan zen."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%D9%86%DA%A9%D8%B1%DB%8C%D9%86_%DB%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/PBB_GE_ANK1_205390_s_at_fs.png","page_title":"آنکرین ۱","context_page_description":"آنکرین ۱ یک نوع کمپلکس پروتئینی که غشای گلبول قرمز را به اسپکترین و اکتین اسکلت سلولی متصل می‌کند."},{"page_url":"https://vo.wikipedia.org/wiki/Huntington_(Massachusetts)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Westfield_River%2C_Huntington_MA.jpg","page_title":"Huntington (Massachusetts)","context_page_description":"Huntington binon zif in komot: Hampshire, in tat: Massachusetts, in Lamerikän."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D9%84%DB%8C%D8%AA%D9%88%D9%86%D8%8C_%D8%A2%D9%84%D8%A7%D8%A8%D8%A7%D9%85%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Clayton_Alabama_Town_Hall.JPG","page_title":"کلیتون، آلاباما","context_page_description":"کلیتون شهری در شهرستان باربر ایالت آلاباما است که مساحت آن ۱۷٫۲۹ کیلومتر مربع است و در سرشماری سال ۲۰۱۰ میلادی، ۳٬۰۰۸ نفر جمعیت داشته و تراکم جمعیتی آن، ۱۷۳٫۹۷ نفر در هر کیلومتر مربع بوده است."},{"page_url":"https://lv.wikipedia.org/wiki/6._tramvaju_mar%C5%A1ruts_(R%C4%ABga)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Tramvaj-v-Rize.jpg","page_title":"6. tramvaju maršruts (Rīga)","context_page_description":"6. tramvaju maršruts bija Rīgas sabiedriskā transporta tramvaju maršruts no 1951. līdz 2018. gadam. Pirms maršruta slēgšanas tramvaji tajā kursēja no Ausekļa ielas līdz Juglai. Maršruta kopējais garums bija 22,118 km. Virziena Ausekļa iela — Jugla kopējais garums bija 11,240 km, bet virziena Jugla — Ausekļa iela kopējais garums bija 10,879 km.\\n6. tramvajs bija visvairāk izmantotais un arī visbiežāk kursējošais tramvaja maršruts Rīgā pirms 1. maršruta atjaunošanas, pārvadājot gandrīz 10 miljonus pasažieru gadā.\\nNeskatoties uz daudziem rīdzinieku iebildumiem, 2018. gada 3. martā 6. tramvaju maršrutu slēdza."},{"page_url":"https://bs.wikipedia.org/wiki/Wimbledon_(tenis)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/The_Royal_Gallery_at_Centre_Court%2C_Wimbledon.jpg","page_title":"Wimbledon (tenis)","context_page_description":"Wimbledon, punim imenom The Championships Wimbledon, teniski je turnir koji se održava u Londonu na terenima All England Lawn Tennis and Croquet Cluba. Počinje šest sedmica prije prvog ponedjeljka u augustu, a često zbog kiše traje više od dvije sedmice. Od četiri Grand Slam turnira Wimbledon je najstariji i jedini koji se igra na travnatoj podlozi. Do 2007. bio je jedini od Grand slam turnira koji je imao različite nagradne fondove za muškarce i žene.\\nUporedo se održavaju turniri za muškarce, žene, muške, ženske i mješovite parove, djecu, tenisere starije od 35 i 45 godina te tenisere u kolicima."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%90%D0%BD%D1%82%D0%BE%D0%BD%D0%BE%D0%B2_%D0%90%D0%BD-2","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/An-2_on_skis.jpg","page_title":"Антонов Ан-2","context_page_description":"Ан-2 је транспортно-десантни лаки авион, совјетског порекла, с могућношћу вишенаменске примене. Конципиран је на основу аеродинамичке шеме двокрилца, с малим специфичним оптерећењем по јединици површине.\\nПрвенац је у развоју бироа Антонов, у оквиру познате и многобројне гаме транспортних авиона, тога назива.\\nКористи се за цивилне и војне потребе у великом броју земаља света, поред тактичког транспорта и десанта и у спортском падобранству, санитету, пољопривреди и у другим наменама.\\nПроизведено је у периоду од 1947. до 1992. године, у Совјетском Савезу, Кини и Пољској 18.000 авиона из ове фамилије, у варијантама: Ан-2, Ан-3, Ан-4, и Ан-6."},{"page_url":"https://en.wikipedia.org/wiki/Polyethylene","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Polyethylene.jpg","page_title":"Polyethylene","context_page_description":"Polyethylene or polythene is the most common plastic in use today. It is a linear, man-made, addition, homo-polymer, primarily used for packaging. As of 2017, over 100 million tonnes of polyethylene resins are being produced annually, accounting for 34% of the total plastics market.\\nMany kinds of polyethylene are known, with most having the chemical formula ₙ. PE is usually a mixture of similar polymers of ethylene, with various values of n. It can be low density or high density: low density polyethylene is extruded using high pressure and high temperature, while high density polyethylene is extruded using low pressure and low temperature. Polyethylene is usually thermoplastic, however it can be modified to become thermosetting instead, for example in cross-linked polyethylene."},{"page_url":"https://nl.wikipedia.org/wiki/Station_Montierchaume","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/90/Gare_de_Montierchaume_%2836%29_-_Quais_et_voies.jpg","page_title":"Station Montierchaume","context_page_description":"Station Montierchaume is een spoorwegstation in de Franse gemeente Montierchaume. Het station is gesloten."},{"page_url":"https://fi.wikipedia.org/wiki/Green_Berets","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Spops2004afghanm60.jpg","page_title":"Green Berets","context_page_description":"Green Berets on Yhdysvaltain maavoimien erikoisjoukko. Vihreiden barettien päätehtäviä ovat ulkomaisen joukkojen koulutus, Terrorismin vastainen taistelu, epätavanomainen sodankäynti, erikoistiedustelu ja iskuosastotoiminta."},{"page_url":"https://id.wikipedia.org/wiki/Tom_Finney","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Finney_statue_in_Preston.jpg","page_title":"Tom Finney","context_page_description":"Tom Finney merupakan seorang pemain sepak bola berkebangsaan Inggris. Dia bermain di klub utamanya seperti Preston North End dan Distillery. Di klub Preston, dia mencatat sebagai pemain dengan penampilan terbanyak yaitu 433 kali.\\nDi timnas Inggris, dia bermain 76 kali dan mencetak 30 gol."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1896","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Ruth-Gordon-Seventeen-1918-2.jpg","page_title":"Lijst van personen geboren in 1896","context_page_description":"Dit is een lijst van personen die geboren zijn in 1896.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://de.wikipedia.org/wiki/Schw%C3%A4bisch_Gm%C3%BCnd","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/M%C3%BCnster-GD-Vorderansicht.JPG","page_title":"Schwäbisch Gmünd","context_page_description":"Schwäbisch Gmünd ist eine Stadt im Osten Baden-Württembergs, die etwa 50 km östlich der Landeshauptstadt Stuttgart liegt. Die frühere Reichsstadt gehört zur Region Ostwürttemberg und zur Randzone der europäischen Metropolregion Stuttgart. Sie ist sowohl einwohner- als auch flächenmäßig die größte Stadt im Remstal. Hinsichtlich der Bevölkerungsgröße ist sie nach Aalen die zweitgrößte Stadt des Ostalbkreises sowie der gesamten Region Ostwürttemberg, in der sie ein Mittelzentrum für ihr Umland bildet. Seit 1956 ist Schwäbisch Gmünd Große Kreisstadt und seit 1973 der Sitz des Regionalverbandes Ostwürttemberg.\\nVon 1805 bis 1934 hieß die Stadt amtlich Gmünd, eine Bezeichnung, die im örtlichen Sprachgebrauch weiterhin verwendet wird. Der Name der Stadt leitet sich vom Zusammenfluss vieler Bäche mit der Rems ab."},{"page_url":"https://it.wikipedia.org/wiki/Stazione_di_Shim%C5%8Dsa-Nakayama","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/JR-Shimousanakyama002.jpg","page_title":"Stazione di Shimōsa-Nakayama","context_page_description":"La Stazione di Shimōsa-Nakayama è una stazione ferroviaria situata nella città di Funabashi, nella prefettura di Chiba, che serve la linea Chūō-Sōbu della JR East."},{"page_url":"https://pl.wikipedia.org/wiki/Stwo%C5%82a","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/SVK_%C5%A0t%C3%B4la_COA.png","page_title":"Stwoła","context_page_description":"Stwoła, dawniej Cwoła – wieś gminna w północnej Słowacji leżąca w powiecie Poprad, w kraju preszowskim."},{"page_url":"https://it.wikipedia.org/wiki/Ballincollig","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/06_07_Ballincollig_Castle.JPG","page_title":"Ballincollig","context_page_description":"Ballincollig è una città satellite nella contea di Cork, in Irlanda."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A7%D7%A0%D7%99%D7%95%D7%9F_%D7%A0%D7%94%D7%A8_%D7%98%D7%90%D7%A8%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/%C4%90ur%C4%91evi%C4%87a_Tara_Bridge_%281%29.JPG","page_title":"קניון נהר טארה","context_page_description":"קניון נהר טארה נמצא בפארק לאומי דורמיטור במונטנגרו. הוא הארוך ביותר במונטנגרו. אורכו 82 ק\\"מ ועומקו המקסימלי הוא 1300 מטר, דבר המעניק לו את התואר של הקניון העמוק ביותר באירופה והשני בעולם אחרי הגרנד קניון. בתחתיתו זורם נהר טארה.\\nהנהר טארה מתחיל בדרום מונטנגרו באלפים הדינרים. אורכו 144 ק\\"מ מתוכם 104 ק\\"מ בתחום מונטנגרו ו-40 ק\\"מ בתחום בוסניה והרצגובינה. הוא זורם בתחילה צפונה ואחר כך מערבה שם הוא זורם בתחתית קניון טארה. בבוסניה והרצגובינה הוא מתחבר לנהר פיבה ויוצר את נהר דרינה הנשפך לנהר סאווה, יובל גדול של הדנובה.\\nבגלל הבדלי הגבהים יש מפלים רבים לאורך הנהר ומפותח בו ספורט הרפטינג."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%86%D9%83%D9%8A%D8%AA_%D9%81%D8%A7%D8%AF%D9%8A%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Ankitfadia2.jpg","page_title":"انكيت فاديا","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nانكيت فاديا كاتب من الهند."},{"page_url":"https://en.wikipedia.org/wiki/1955","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/James_Dean_in_Rebel_Without_a_Cause.jpg","page_title":"1955","context_page_description":"1955 was a common year starting on Saturday of the Gregorian calendar, the 1955th year of the Common Era and Anno Domini designations, the 955th year of the 2nd millennium, the 55th year of the 20th century, and the 6th year of the 1950s decade."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_op_8_januari","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Sir_William_Draper_KB.jpg","page_title":"Lijst van personen overleden op 8 januari","context_page_description":"Dit is een lijst van personen die overleden zijn op 8 januari.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina.\\n482 - Severinus van Noricum, monnik bewerken\\n871 - Bagsecg, koning en commandant bewerken\\n1079 - Adela van Mesen, Franse hertogin en hertogin, feodaal bewerken\\n1107 - Edgar van Schotland, politicus uit het Koninkrijk Schotland bewerken\\n1152 - Koenraad I van Zähringen, hertog, aristocraat bewerken\\n1198 - Paus Celestinus III, paus, diplomaat en rooms-katholiek priester uit de Kerkelijke Staat bewerken\\n1282 - Hojo Yoshimasa, Japanse Rensho bewerken\\n1324 - Marco Polo, ambassadeur, koopman, ontdekkingsreiziger, schrijver en diplomaat uit de Republiek Venetië bewerken\\n1332 - Andronikos III Megas Komnenos, monarch uit het keizerrijk Trebizonde bewerken\\n1337 - Giotto di Bondone, Italiaanse hofschilder, kunstschilder en architect bewerken"},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_di_Santo_Stefano_a_Poggio_alla_Malva","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Santo_Stefano_D.jpg","page_title":"Chiesa di Santo Stefano a Poggio alla Malva","context_page_description":"La chiesa di Santo Stefano a Poggio alla Malva si trova nel comune di Carmignano, in provincia di Prato.\\nGià oratorio del Santissimo Crocifisso, divenne chiesa parrocchiale nel 1741 dopo l'abbandono di Santo Stefano alle Busche, posta più a valle.\\nSi presenta all'interno molto armoniosa, con la copertura a capriate e nella zona presbiteriale con una volta a botte. Il venerato crocifisso ligneo policromo cinquecentesco sull'altare maggiore proviene dall'oratorio; gli arredi provengono dall'antica chiesa, come anche gli affreschi staccati, databili all'inizio del secolo XV, raffiguranti Il bacio di Giuda, La flagellazione, L'adorazione dei pastori. Ai due altari laterali, la tavola di Neri di Bicci con la Madonna e il Bambino in trono con i santi Stefano, Silvestro, Bartolomeo, Lorenzo, e la tela con il Martirio di santo Stefano della bottega di Cesare Dandini."},{"page_url":"https://es.wikipedia.org/wiki/Bas%C3%ADlica_de_San_Donato_y_San_Rogatio_(Nantes)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Basilique_Saint-Donatien_et_Saint-Rogatien_entrance.jpg","page_title":"Basílica de San Donato y San Rogatio (Nantes)","context_page_description":"La basílica [de] San Donato y San Rogatio de Nantes es una iglesia católica francesa historicista erigida en el distrito de Malakoff-Saint-Donatien de Nantes, en el departamento de Loira Atlántico. Su fachada principal se encuentra frente a la plaza des Enfants-Nantais. La iglesia fue declarada basílica menor el 14 de marzo de 1889.​ y es, con la basílica de San Nicolás, una de las dos basílicas de la ciudad.\\nData de finales del siglo XIX y está dedicada a san Donatio de Nantes y su hermano san Rogatio, primeros cristianos de Nantes, martirizados en la ciudad a finales del siglo III. Además de la basílica, el sitio integra también el cementerio de San Donatio y de la capilla San Esteban, recogida esta última en el título de los monumentos históricos."},{"page_url":"https://azb.wikipedia.org/wiki/%DA%86%D8%B1%D9%BE%D9%88%D9%86%DA%A9%D8%A7%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Kudumbarani_Institute.jpg","page_title":"چرپونکال","context_page_description":"چرپونکال هیندوستان اؤلکه‌سینین کرالا ایالتینده بیر شهر دیر. بۇ شهرده مالایالم دیلی و اینگیلیس دیلی دانیشیلیر."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teauneuf-de-Gadagne","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Ch%C3%A2teauneuf-de-Gadagne_Vieux_remparts.jpg","page_title":"Châteauneuf-de-Gadagne","context_page_description":"Châteauneuf-de-Gadagne est une commune française située dans le département de Vaucluse, en région Provence-Alpes-Côte d'Azur.\\nSes habitants sont appelés les Gadagniens ou les Castelnovins."},{"page_url":"https://sh.wikipedia.org/wiki/Svetozar_Markovi%C4%87","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/92/Radenik.jpg","page_title":"Svetozar Marković","context_page_description":"Svetozar Marković je bio uticajni srpski socijalistički mislilac, političar i publicista druge polovine XIX veka. Izdavao je Radenik, prvi socijalistički list u Srbiji i na Balkanu.\\nMarković je bio žestoki kritičar velikosrpske politike i pionir ideje Balkanske federacije. Odbacio je „istorijsko pravo“, to jest obnovu Dušanovog carstva, kao osnovu rešenja srpskog pitanja. Govorio je da bi pokušaj obnove ove srednjevekovne države, koja i nije bila samo srpska i na čijem prostoru su se odigrali ireverzibilni istorijski procesi, učinili Srbiju na spoljnom planu osvajačkom, a unutra vojno-policijskom državom.\\nMarković je utemeljio federalizam kao konstantu srpske levice, kao alternativu velikodržavnoj ideologiji zasnovanoj na „istorijskom pravu“. On je također odbacio klerikalnu tradiciju kao osnovu za jedinstvo srpskog naroda, povlači liniju razdvajanja sa desnim populizmom."},{"page_url":"https://es.wikipedia.org/wiki/Provincia_de_Pescara","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Pescara_Palazzo_del_Governo_01_%28raboe%29.jpg","page_title":"Provincia de Pescara","context_page_description":"Pescara es una provincia de la región de Abruzzo, en Italia. Su capital es la ciudad de Pescara. Limita al norte con la provincia de Teramo, al oeste con L'Aquila, al sur con Chieti y al este con el mar Adriático.\\nTiene un área de 1225 km², y una población total de 295.463 hab. Hay 46 municipios en la provincia."},{"page_url":"https://es.wikipedia.org/wiki/Aythya_ferina","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Male_pochard_reflection_in_evening.jpg","page_title":"Aythya ferina","context_page_description":"El porrón europeo o porrón común ​ es una especie de ave anseriforme de la familia Anatidae que vive en Eurasia y África."},{"page_url":"https://nl.wikipedia.org/wiki/Franciscanenkerk_(Boedapest)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/BudapestDSCN3743.JPG","page_title":"Franciscanenkerk (Boedapest)","context_page_description":"De Franciscanenkerk is een kerkgebouw stammend uit de 13e eeuw, gelegen in het stadsdeel Pest aan het Franciscanerplein in de Hongaarse stad Boedapest.\\nOp deze plek stond eerder ook een franciscanerklooster. Door de verovering van Pest in 1541 door de Turken werd de kerk een moskee, de Moskee van Sinan. Door de terugverovering van Pest door de Oostenrijkers in 1686 werd dit weer ongedaan gemaakt. De franciscanen kregen de kerk terug.\\nTussen 1727 en 1743 werd de kerk herbouwd in barokke stijl. Het hoofdaltaar werd in 1740 vervaardigd op kosten van baron Antal Grassalkovich, nadat zijn tweede vrouw in de kerk was begraven. In de voorgevel van de kerk bevindt zich een franciscaner embleem bekroond met een door engelen aanbeden Maria. Ook bevinden zich in de voorgevel beelden van franciscaner heiligen. Het interieur van de kerk is versierd met fresco's van Károly Lotz, die stammen uit 1894 en 1895. Ook bevinden er zich schilderijen van Victor Tardo Kremer in het kerkgebouw. Naast het hoofdaltaar bevinden zich ook sculpturen uit 1741 en 1851. De zijaltaren en de kansel van de kerk stammen uit 1851 en 1852."},{"page_url":"https://id.wikipedia.org/wiki/Arondisemen_Mulhouse","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Arrondissement_de_Mulhouse.PNG","page_title":"Arondisemen Mulhouse","context_page_description":"Arondisemen Mulhouse merupakan sebuah arondisemen di Prancis, terletak di département Haut-Rhin, di région Alsace. Memiliki 9 kanton dan 73 komune."},{"page_url":"https://fr.wikipedia.org/wiki/Nikola%C3%AF_Baskov","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Nikolay_Baskov.jpg","page_title":"Nikolaï Baskov","context_page_description":"Nikolaï Viktorovich Baskov, né le 15 octobre 1976 à Balachikha, est un chanteur ténor russe populaire. Il est célèbre pour chanter, avec succès, à la fois du classique et de la musique pop. Nikolaï Baskov est à la fois artiste émérite et artiste populaire de Russie, ainsi qu'artiste populaire d'Ukraine et artiste populaire de Tchéchénie."},{"page_url":"https://sv.wikipedia.org/wiki/Barrowligan","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Bonnie_apuntant_de_broma_a_Clyde_amb_una_escopeta.jpg","page_title":"Barrowligan","context_page_description":"Barrowligan var en grupp amerikanska brottslingar, aktiva åren 1930–1934. I ligan ingick bröderna Clyde och Buck Barrow, liksom deras respektive Bonnie Parker och Blanche Barrow. Andra som kan räknas dit var Raymond Hamilton, W.D. Jones, Joe Palmer och Henry Methvin.\\nLigan begick en stor mängd rån under deras aktiva tid. Dessutom dödade de elva personer, varav nio polismän."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Steyr-Steyr/S%E2%80%93Z","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Steyr_Wieserfeldplatz_34_%2801%29.JPG","page_title":"Liste der denkmalgeschützten Objekte in Steyr-Steyr/S–Z","context_page_description":"Die Liste der denkmalgeschützten Objekte in Steyr-Steyr S–Z enthält die 232 denkmalgeschützten, unbeweglichen Objekte der Steyrer Katastralgemeinde Steyr mit Straßennamen beginnend ab S."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%98%BF%E5%B0%94%E5%9D%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Map_commune_FR_insee_code_41004.png","page_title":"阿尔坦","context_page_description":"阿爾坦是法國盧瓦-謝爾省的一個市鎮，位於該省西部，屬於旺多姆區。該市鎮總面積11.72平方公里，2009年時的人口為295人。"},{"page_url":"https://de.wikipedia.org/wiki/Som","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/KyrgyzstanP21-100Som-2002_b.jpg","page_title":"Som","context_page_description":"Der Som ist die Währung Kirgisistans. Die Währung wurde 1993 eingeführt und löste den Rubel aus der Sowjetzeit ab. Kirgisistan war damit das erste Land Zentralasiens, das sich aus der Rubelzone löste. Die Nationalbank der kirgisischen Republik brachte die ersten Banknoten am 10. Mai 1993 in Umlauf, wobei 200 Rubel zu 1 Som getauscht wurden.\\n1 Som ist in 100 Tyjyn unterteilt. Anfänglich war der Tyjyn in kleinformatigen Banknoten zu 1, 10 und 50 Tyjyn in Umlauf. Münzen sind in Kirgisistan erst seit 2008 im Umlauf. Es gibt Werte zu 1, 10 und 50 Tyjyn sowie 1, 3, 5 und 10 Som. Aufgrund des Kursverfalls des Som in den ersten Jahren nach dessen Einführung ist der Tyjyn jedoch heute nur noch selten in Gebrauch, so dass die Unterteilung in der Praxis keine Rolle spielt.\\nDie Kirgisische Nationalbank erkannte Anfang 2017 ein unterstrichenes C als offizielles Währungssymbol für den kirgisischen Som an. Derzeit ist noch kein Unicode-Währungssymbol für zugewiesen."},{"page_url":"https://en.wikipedia.org/wiki/Emmelie_Proph%C3%A8te","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Emmelie_Proph%C3%A8te-Milc%C3%A9_0299.JPG","page_title":"Emmelie Prophète","context_page_description":"Emmelie Prophète is a Haitian writer and diplomat.\\nShe was born in Port-au-Prince and studied law and modern literature at the Université de Port-au-Prince and communications at Jackson State University. She has served as an attaché at the embassy in Haiti and in Geneva. Prophète has also hosted a jazz program on Radio-Haïti. She has served as director of the Haiti Direction Nationale du Livre and the Bureau haïtien du droit d’auteur. In 2014, she was named head of the National Library of Haiti.\\nShe has contributed to various periodicals such as Chemins Critiques, Boutures, Cultura, La Nouvelle Revue Française and Le Nouvelliste."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D9%88%D9%86%D8%B1%D8%A7%D8%AF_%D9%87%D9%88%D9%84%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Conrad_Holt_2012.jpg","page_title":"كونراد هولت","context_page_description":"كونراد هولت ‏ هو لاعب شطرنج أمريكي، ولد في 9 يوليو 1993 في ويتشيتا في الولايات المتحدة."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B4%A5%E8%BB%BD%E7%9F%B3%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Tsugaruishi-Sta01.JPG","page_title":"津軽石駅","context_page_description":"津軽石駅は、岩手県宮古市津軽石にある、三陸鉄道リアス線の駅である。\\n駅の愛称は「鮭の町」。"},{"page_url":"https://fr.wikipedia.org/wiki/Colourpoint","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Kr%C3%A1l%C3%ADk_novoz%C3%A9landsk%C3%BD_b%C3%ADl%C3%BD.jpg","page_title":"Colourpoint","context_page_description":"Colourpoint, ou Colorpoint, est le nom donné dans les standards d'élevage félins à un type de coloration du pelage de certains chats aux extrémités plus foncées, comme le Chat siamois. C'est une variante de l'albinisme qui n'affecte pas uniquement les chats et que l'on rencontre chez d'autres animaux d'élevage comme les rongeurs ou le bétail, mais jamais les humains.\\nCette pigmentation est induite génétiquement par la série allélique C qui limite chez ce type de chat la coloration aux parties les plus froides du corps. Dans ce cas la couleur est restreinte aux extrémités, en anglais points, dans un corps clair.\\nPar extension, le « colourpoint » désigne une race diversement homologuée selon les pays et nommée aussi parfois « Himalayen ». Cette lignée colourpoint du chat Persan est issue du croisement entre un Siamois et un Persan noir."},{"page_url":"https://lv.wikipedia.org/wiki/Valgas_apri%C5%86%C4%B7is","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Konrad_M%C3%A4gi._Meditatsioon_%28Maastik_daamiga%29._1915-1916.jpg","page_title":"Valgas apriņķis","context_page_description":"Valgas apriņķis ir viens no 15 Igaunijas apriņķiem. Apriņķis robežojas ar Viljandi un Tartu apriņķiem ziemeļos, Pelvas un Veru apriņķiem austrumos, kā arī ar Latviju dienvidos. Apriņķī atrodas Otepē augstiene. Valgas apriņķa administratīvais centrs ir Valga, kas ir Latvijas-Igaunijas robežpilsēta. Tas ir otrs mazākais Igaunijas apriņķis.\\nValgas apriņķis atrodas Igaunijas dienvidu daļā, saimnieciski-ģeogrāfiski un reģionāli-politiski tas ietilpst Igaunijas Dienvidaustrumu reģionā. Kā vēsture, tā dabas reljefa īpatnības to arī pieskaita pie Dienvidu Igaunijas reģiona. Apriņķa kopējā platība ir 2043,53 kvadrātkilometri, iedzīvotāju skaits — 30176 cilvēku, tas plešas no ziemeļiem uz dienvidiem 65 km un no austrumiem uz rietumiem — 59 km. Valgas apriņķis ir 12. vietā Igaunijā pēc iedzīvotāju skaita un 14. vietā pēc platības.\\nApriņķa centrs, Valga, ir 267 km attālumā no Tallinas, 86 km no Tartu, 88 km no Viljandi, 73 km no Veru, 96 km no Pelvas, 141 km no Pērnavas un 264 km no Narvas. Līdz Rīgai ir 157 km.\\nValgas apriņķis ziemeļrietumos robežojas ar Viljandi, ziemeļos ar Tartu,"},{"page_url":"https://de.wikipedia.org/wiki/Bernd_Lafrenz","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Bernd_Lafrenz_6810.jpg","page_title":"Bernd Lafrenz","context_page_description":"Bernd Lafrenz ist ein deutscher Theaterschauspieler, Komödiant, Autor, Theaterregisseur und Theaterleiter, der sich der Adaption und Darstellung von William Shakespeares Stücken als Solo-Komödien widmet. Bei seinem Spiel handelt es sich um eine Kombination von Maskentheater, Körpertheater, Pantomime, Clownerie und Parodie."},{"page_url":"https://no.wikipedia.org/wiki/Don_(elv_i_England)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Sheffield_-_Ball_Street_Bridge_over_River_Don.jpg","page_title":"Don (elv i England)","context_page_description":"Don er ei elv i South Yorkshire i England. Den er ei sideelv til Ouse, og er 112 km lang.\\nDon har sitt utspring i Penninene og renner mot øst gjennom Dondale, via byene Penistone, Sheffield, Rotherham, Mexborough, Conisbrough, Doncaster og Stainforth. Den munnet opprinnelig ut i elva Trent, men ble på 1600-tallet kanalisert og ledet lengre nord, og munner nå ut i elva Ouse ved Goole i Yorkshire.\\nDons viktigste sideelver er Loxley, Rivelin, Sheaf, Rother og Dearne.\\nRegionens industrielle natur har medført alvorlige forurensningsproblemer for elva. Dog har disse problemene avtatt de seneste årene, og det er rapportert fangst av laks i elva ved Doncaster.\\nNavnet Don er avledet fra Danu, en keltisk morsgudinne."},{"page_url":"https://la.wikipedia.org/wiki/Saint-Supplet","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/Map_commune_FR_insee_code_54489.png","page_title":"Saint-Supplet","context_page_description":"Saint-Supplet est commune Francicum 167 incolarum praefecturae Murtae et Mosellae in provincia orientali Lotharingia."},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%A8%E0%A5%87%E0%A4%B9%E0%A4%B0%E0%A5%82_%E0%A4%AF%E0%A5%81%E0%A4%B5%E0%A4%BE_%E0%A4%95%E0%A5%87%E0%A4%82%E0%A4%A6%E0%A5%8D%E0%A4%B0_%E0%A4%B8%E0%A4%82%E0%A4%98%E0%A4%9F%E0%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Nehru_Yuva_Kendra_Jalna.jpg","page_title":"नेहरू युवा केंद्र संघटन","context_page_description":"नेहरू युवा केंद्र संघटना हे भारत सरकारच्या युवक व क्रीडा मंत्रालयाअंतर्गत असलेली स्वायत्त संस्था आहे. हिची स्थापना १९७२ साली झाली. या संस्थेचे मुख्यालय दिल्ली येथे आहे. ही संघटना युवकांमध्ये, विशेषतः ग्रामीण भागात राष्ट्रनिर्मिती व देशभक्तीच्या भावनेला जागृत करण्याचे कार्य करते. हिचे घोषवाक्य भविष्याचे सहप्रवासी असे केंद्राचे घोषवाक्य आहे. वर्षभरात २.२५ लाख कृती आयोजित करून संघटन एक कोटीहून जास्त युवकांपर्यंत पोहोचते. संघटनेने ८०, ०००हून जास्त सक्रिय युवक मंडळांचे जाळे विणले असून देशाच्या सर्व जिल्ह्यांमध्ये लाखो कार्यकर्ते कार्यरत आहेत. प्रत्येक वर्षी १२००० कार्यकर्ते निवडून, प्रशिक्षण देऊन, रुजू करून घेतले जातात व देशाच्या प्रत्येक जिल्ह्यात २० ते ३० कार्यकर्ते विखरून ठेवले जातात."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_s%C3%A9lectionn%C3%A9s_en_%C3%A9quipe_d%27Australie_de_rugby_%C3%A0_XV","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Matt_Dunning.jpg","page_title":"Liste des sélectionnés en équipe d'Australie de rugby à XV","context_page_description":"La liste des joueurs sélectionnés en équipe d'Australie de rugby à XV comprend 930 joueurs au 19 octobre 2019, le dernier étant Jordan Petaia retenu pour la première fois en équipe nationale 5 octobre 2019 contre l'Uruguay. Le premier Australien sélectionné est Paddy Carew le 24 juin 1899 contre les Lions britanniques et irlandais. L'ordre établi prend en compte la date de la première sélection, puis la qualité de titulaire ou remplaçant et enfin l'ordre alphabétique."},{"page_url":"https://id.wikipedia.org/wiki/Indo-Kanada","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Sukh_Dhaliwal.jpg","page_title":"Indo-Kanada","context_page_description":"Orang Kanada yang berasal dari etnis India adalah orang Kanada yang berasal dari subbenua India, anak-anak dari orang yang berimigrasi dari Asia Selatan ke Kanada, atau orang-orang asal India yang memiliki kewarganegaraan Kanada. Istilah Orang India Timur dan Orang Asia Selatan terkadang digunakan untuk membedakan dari orang-orang keturunan asli dari India dari orang-orang Negara-Negara Pertama di Kanada, yang terkadang, disebut di Kanada sebagai orang India. Hal ini sebagian karena secara sejarah benua Amerika dikira oleh Columbus sebagai India dan orang Amerika asli dikira oleh Columbus sebagai orang India dan kemudian sebagai orang India Barat.\\nIstilah Indo-Kanada umumnya digunakan sampai awal abad ke-21. Beberapa orang Kanada asal India sekarang merasa bahwa istilah tersebut adalah salah dan mendiskriminasi.\\nPopulasi Indo-Kanada dapat ditemukan di Daratan Utama Rendah British Columbia dan Wilayah Toronto Besar, namun terdapat pertumbuhan komunitas di Calgary, Edmonton, Hamilton, dan Montreal."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%8E%84%E5%B0%94%E5%B0%BC%E8%AF%BA-%E5%8D%97%E6%96%B9%E6%8C%AF%E8%8D%A1%E7%8E%B0%E8%B1%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Enso-global-temp-anomalies.png","page_title":"厄尔尼诺-南方振荡现象","context_page_description":"聖嬰-南方震盪現象是發生在橫跨赤道附近太平洋的一種準周期氣候類型，大約每5年發生一次。南方震盪是指東太平洋赤道區域海面溫度和西太平洋赤道區域的海面上氣壓的變動。這兩種變動是相互聯繫的：東太平洋的暖洋階段，即聖嬰，伴隨著西太平洋的高海面氣壓；東太平洋的變冷階段，即反聖嬰，伴隨著西太平洋的低海面氣壓。導致這種變動的機制仍在研究中。\\n這種氣候類型變動的極端時期，即聖嬰和反聖嬰事件，會在世界很多區域引起極端的天氣。依靠農業和漁業的開發中國家，特別是太平洋沿岸的國家，所受影響最大。聖嬰-南方震盪比較流行的稱呼常常省略為「聖嬰」。聖嬰是西班牙語，意指「小男孩」，指的是聖子耶穌，因為南美太平洋的變暖時期通常都在聖誕節附近。"},{"page_url":"https://pl.wikipedia.org/wiki/Esterina_Tartman","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Esterina_Tartman.jpg","page_title":"Esterina Tartman","context_page_description":"Esterina Tartman – izraelska polityk, w latach 2006–2009 poseł do Knesetu z listy partii Nasz Dom Izrael.\\n8 lutego 2006 zastąpiła Micha’ela Nudelmana i została posłanką do szesnastego Knesetu. W wyborach parlamentarnych w marcu tego zdobyła mandat poselski izraelskiego parlamentu i zasiadała w nim do końca siedemnastej kadencji."},{"page_url":"https://es.wikipedia.org/wiki/Templo_Se%C3%B1or_de_Esquipulas_(Teapa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Iglesia_del_Se%C3%B1or_de_Esquipulas_Teapa_Tabasco..jpg","page_title":"Templo Señor de Esquipulas (Teapa)","context_page_description":"El Templo Señor de Esquipulas, conocido popularmente como Templo de Esquipulas, es un templo católico que se localiza en la ciudad de Teapa, estado de Tabasco, México.\\nFue el tercer templo religioso que se edificó en Teapa después del Santuario de Guadalupe, y la Iglesia de Santiago Apóstol, y es uno de los más antiguos del estado de Tabasco, ya que su construcción se realizó en el año de 1780.\\nActualmente este templo está catalogado oficialmente por el Instituto Nacional de Antropología e Historia, como patrimonio histórico y cultural de la nación."},{"page_url":"https://vi.wikipedia.org/wiki/Conus_cancellatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Conus_cancellatus_2.jpg","page_title":"Conus cancellatus","context_page_description":"Conus cancellatus là một loài ốc biển, là động vật thân mềm chân bụng sống ở biển trong họ Conidae, họ ốc cối.\\nGiống như tất cả các loài thuộc chi Conus, chúng là loài săn mồi và có nọc độc. Chúng có khả năng \\"đốt\\" con người, do vậy khi cầm chúng phải hết sức cẩn thận."},{"page_url":"https://en.wikipedia.org/wiki/Grade_II_listed_buildings_in_Brighton_and_Hove:_M","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/124%E2%80%93126_Marine_Parade%2C_Brighton_%28NHLE_Code_1381740%29_%28January_2010%29.jpg","page_title":"Grade II listed buildings in Brighton and Hove: M","context_page_description":"As of February 2001, there were 1,124 listed buildings with Grade II status in the English city of Brighton and Hove. The total at 2009 was similar. The city, on the English Channel coast approximately 52 miles south of London, was formed as a unitary authority in 1997 by the merger of the neighbouring towns of Brighton and Hove. Queen Elizabeth II granted city status in 2000.\\nIn England, a building or structure is defined as \\"listed\\" when it is placed on a statutory register of buildings of \\"special architectural or historic interest\\" by the Secretary of State for Culture, Media and Sport, a Government department, in accordance with the Planning Act 1990. English Heritage, a non-departmental public body, acts as an agency of this department to administer the process and advise the department on relevant issues. There are three grades of listing status. The Grade II designation is the lowest, and is used for \\"nationally important buildings of special interest\\". Grade II* is used for \\"particularly important buildings of more than special interest\\"; there are 69 such buildings in the city. There are also 24 Grade I listed buildings in Brighton and Hove."},{"page_url":"https://en.wikipedia.org/wiki/Battle_of_Surabaya","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/IWM-SE-5866-Jat-Bren-_gunners-in-Surabaya-194511.jpg","page_title":"Battle of Surabaya","context_page_description":"The Battle of Surabaya was fought between pro-independence Indonesian soldiers and militia against British and British Indian troops as a part of the Indonesian National Revolution. The peak of the battle was in November 1945. The battle was the heaviest single battle of the revolution and became a national symbol of Indonesian resistance. Considered a heroic effort by Indonesians, the battle helped galvanise Indonesian and international support for Indonesian independence. 10 November is celebrated annually as Heroes' Day.\\nBy the time the Allied forces arrived at the end of October 1945, the Pemuda foothold in Surabaya City was described as \\"a strong unified fortress\\". Fighting broke out on 30 October after the British commander, Brigadier A. W. S. Mallaby was killed in a skirmish. The British retaliated with a punitive sweep that began on 10 November, under the cover of air attacks. Although the Colonial forces largely captured the city in three days, the poorly armed Republicans fought for three weeks, and thousands died as the population fled to the countryside."},{"page_url":"https://en.wikipedia.org/wiki/Swallow_Doretti","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/160507-Swallow-Doretti-03.jpg","page_title":"Swallow Doretti","context_page_description":"The Swallow Doretti is a two-seater British sports car built on Swallow's own design of box-section tube chassis using Triumph TR2 mechanicals, made between 1954 and 1955. It was intended for the U.S. market and to be a more refined two-seater than available there at that time."},{"page_url":"https://nl.wikipedia.org/wiki/Agama_mwanzae","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/MC_Siedleragame.jpg","page_title":"Agama mwanzae","context_page_description":"Agama mwanzae is een hagedis uit de familie agamen."},{"page_url":"https://fr.wikipedia.org/wiki/Lac_Merced_(San_Francisco)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Sanfrancisco_twinpeaks_lakemerced_map.png","page_title":"Lac Merced (San Francisco)","context_page_description":"Le lac Merced est situé au sud-ouest de San Francisco."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Milan_Metro_stations","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Milano_-_Metropolitana_Duomo_-_Linea_rossa_-_Foto_Giovanni_Dall%27Orto_-_3-jan-2007_-_02.jpg","page_title":"List of Milan Metro stations","context_page_description":"The Milan Metro is the rapid transit/metro system serving Milan, Italy. The network comprises 4 lines, identified by different numbers and colors, with a total route length of 100 kilometres and 106 stations. The system has a daily ridership of over one million.\\nThe metro network is connected to the Milan suburban railway service through several stations. Metro lines are identified by the letter \\"M\\", while suburban line numbers are preceded by the letter \\"S\\"."},{"page_url":"https://pt.wikipedia.org/wiki/Picha%C3%A7%C3%A3o","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Osdemos_%28202%29.JPG","page_title":"Pichação","context_page_description":"Pichação é o ato de escrever ou rabiscar sobre muros, fachadas de edificações, asfalto de ruas ou monumentos, usando tinta em spray aerossol, dificilmente removível, estêncil ou mesmo rolo de tinta.\\nNo geral, são escritas frases de protesto ou insulto, assinaturas pessoais ou mesmo declarações de amor, também utilizada como forma de demarcação de territórios entre grupos – às vezes gangues rivais."},{"page_url":"https://en.wikipedia.org/wiki/Joachim_Brudzi%C5%84ski","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Joachim_Brudzi%C5%84ski_2008.jpg","page_title":"Joachim Brudziński","context_page_description":"Joachim Stanisław Brudziński is a Polish conservative politician. He was elected to the Sejm on 25 September 2005, getting 14,731 votes in 41 Szczecin district as a candidate from the Prawo i Sprawiedliwość list. Brudziński graduated from the political sciences faculty of the University of Szczecin. Sailor, journalist and PhD student of the University of Poznań. Presently president of executive committee of the ruling party Law and Justice, he is well known for his \\"down to earth\\" and family oriented perspectives of global politics.\\nIn 2018, Brudziński joined the Polish cabinet as the Minister of the Interior after Mariusz Błaszczak, the previous Interior Minister, became the Minister of National Defence. He is a Member of the European Parliament.\\nIn 2020, Brudziński stated on Twitter that Poland without LGBT is more beautiful.\\nBrudziński is married with two daughters and a son."},{"page_url":"https://es.wikipedia.org/wiki/Municipio_de_Acatl%C3%A1n_(Hidalgo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/MuniMarketAcatlanHgo.JPG","page_title":"Municipio de Acatlán (Hidalgo)","context_page_description":"El municipio de Acatlán es uno de los ochenta y cuatro municipios que conforman el estado de Hidalgo, México. Cuya cabecera municipal es la localidad de Acatlán.​​\\nAcatlán se localiza al oriente del territorio hidalguense entre los paralelos 20° 04’ y 20° 20’ de latitud norte; los meridianos 98° 21’ y 98° 31’ de longitud oeste; con una altitud entre 1600 y 3100 msnm.​ Este municipio cuenta con una superficie de 241.6 km², y representa el 1.16% de la superficie del estado;​​ dentro de la región geográfica denominada como el valle de Tulancingo.​\\nColinda al norte con el municipio de Huasca de Ocampo, el estado de Veracruz de Ignacio de la Llave, los municipios de Agua Blanca de Iturbide y Metepec; al este con los municipios de Metepec y Tulancingo de Bravo; al sur con los municipios de Tulancingo de Bravo y Singuilucan; al oeste con los municipios de Singuilucan y Huasca de Ocampo.​​"},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_barri%C3%A8res_de_Paris","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Barri%C3%A8re_de_Montreuil.png","page_title":"Liste des barrières de Paris","context_page_description":"Les barrières de Paris sont de trois sortes :\\nles 57 barrières à la limite, fixée en 1674 et modifiée en 1724, au-delà de laquelle il était interdit de bâtir. Elles correspondaient en partie à la limite fiscale et comprenaient 53 barrières par terre et 4 barrières par eau, ou pataches.\\nContrairement à celles du mur des Fermiers généraux, les barrières par terre étaient, pour la plupart de modestes installations en planches, quelques-unes avec des grilles de fer. Elles étaient situées à la limite des dernières constructions des faubourgs, un peu en arrière de la future enceinte des Fermiers généraux.\\nles barrières d'octroi du mur des Fermiers généraux ;\\nles 23 barrières de l'enceinte de Thiers."},{"page_url":"https://no.wikipedia.org/wiki/Bj%C3%B8rnefamilien","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Brown_Bear_Feeding_on_Salmon.jpg","page_title":"Bjørnefamilien","context_page_description":"Bjørnefamilien, også kalt bjørner, bjønner og ursider, er en relativt liten gruppe av store rovpattedyr som deles inn i åtte arter. Selv om gruppen av bjørner er liten, er artene i denne familien spredt utover store landområder. De har vært kulturelt svært viktige dyr for menneskelige populasjoner i de områder hvor de finnes."},{"page_url":"https://en.wikipedia.org/wiki/Diarrhea","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Slum_and_dirty_river.jpg","page_title":"Diarrhea","context_page_description":"Diarrhea, also spelled diarrhoea, is the condition of having at least three loose, liquid, or watery bowel movements each day. It often lasts for a few days and can result in dehydration due to fluid loss. Signs of dehydration often begin with loss of the normal stretchiness of the skin and irritable behaviour. This can progress to decreased urination, loss of skin color, a fast heart rate, and a decrease in responsiveness as it becomes more severe. Loose but non-watery stools in babies who are exclusively breastfed, however, are normal.\\nThe most common cause is an infection of the intestines due to either a virus, bacterium, or parasite—a condition also known as gastroenteritis. These infections are often acquired from food or water that has been contaminated by feces, or directly from another person who is infected. The three types of diarrhea are: short duration watery diarrhea, short duration bloody diarrhea, and persistent diarrhea. The short duration watery diarrhea may be due to cholera, although this is rare in the developed world. If blood is present, it is also known as dysentery. A number of non-infectious causes can result in diarrhea."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D1%83%D1%81%D0%B0%D0%BA,_%D0%9E%D1%82%D0%B0%D0%BA%D0%B0%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/ru/6/6d/%D0%9A%D0%B0%D0%BF%D0%B8%D1%82%D0%B0%D0%BD_%D0%9E%D1%82%D0%B0%D0%BA%D0%B0%D1%80_%D0%93%D1%83%D1%81%D0%B0%D0%BA.jpg","page_title":"Гусак, Отакар","context_page_description":"Отакар Гусак — чехословацкий военный и государственный деятель, министр национальной обороны Чехословакии, генерал. Почётный гражданин города Нимбурк."},{"page_url":"https://vi.wikipedia.org/wiki/Himalaya","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Jains_at_Kailash.jpg","page_title":"Himalaya","context_page_description":"Himalaya là một dãy núi ở châu Á, phân chia tiểu lục địa Ấn Độ khỏi cao nguyên Tây Tạng. Mở rộng ra, đó cũng là tên của một hệ thống núi hùng vĩ bao gồm cả Himalaya theo đúng nghĩa của từ này, Karakoram, Hindu Kush và các dãy núi nhỏ khác trải dài từ dãy núi Pamir. Tên gọi này bắt nguồn từ tiếng Sanskrit himālaya, một từ kép mang ý nghĩa \\"nơi ở của tuyết\\".\\nHimalaya là dãy núi cao nhất Trái Đất và là nơi của 14 đỉnh núi cao nhất thế giới: các đỉnh cao trên 8.000 m, bao gồm cả đỉnh Everest. Để thấy được kích thước khổng lồ của những đỉnh núi trong dãy Himalaya, có thể so với đỉnh Aconcagua trong dãy Andes, với độ cao 6.962 m, là đỉnh cao nhất bên ngoài Himalaya, trong khi hệ thống núi Himalaya có trên 50 ngọn núi khác nhau đạt chiều cao vượt quá 7.200 m. Dãy Himalaya cũng là nơi khởi nguồn của 3 hệ thống sông lớn trên thế giới, đó là lưu vực các sông như sông Ấn, sông Hằng-Brahmaputra và sông Dương Tử. Khoảng 750 triệu người sống trên lưu vực của các con sông bắt nguồn từ dãy Himalaya, tính luôn cả Bangladesh.\\nĐược nâng lên bởi sự hút chìm của mảng kiến ​​tạo Ấn Độ dưới mảng Á-Âu, dãy Himalaya chạy theo hướng tây-tây bắc đến đông-đông nam trong một vòng cung dài 2.400 km."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%97%90%EC%9D%B4%ED%94%84%EB%A6%B4%EC%9D%98_%EC%9D%8C%EB%B0%98_%EC%99%B8_%ED%99%9C%EB%8F%99_%EB%AA%A9%EB%A1%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/%28TV%ED%85%90%29_%EC%97%90%EC%9D%B4%ED%94%84%EB%A6%B4%28April%29%2C_Mayday_Mayday~%E2%99%AC_%ED%99%94%EB%B3%B4_%EB%B9%84%ED%95%98%EC%9D%B8%EB%93%9C%21_%283%29.jpg","page_title":"에이프릴의 음반 외 활동 목록","context_page_description":"다음은 대한민국의 걸 그룹 에이프릴의 음반 외 활동 목록이다."},{"page_url":"https://en.wikipedia.org/wiki/Royalton_Township,_Michigan","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Royalton_Township%2C_MI_location.png","page_title":"Royalton Township, Michigan","context_page_description":"Royalton Township is a civil township of Berrien County in the U.S. state of Michigan, a few miles southeast of the city of St. Joseph. The population was 4,766 at the 2010 census, up from 3,888 at the 2000 census. There are no incorporated municipalities in the township, but portions are considered to be part of the Benton Harbor/St. Joseph urban area. The unincorporated communities of Hollywood, Scottdale, Arden, and Buckhorn are within the township.\\nRoyalton Township was organized in 1835 and originally included portions of Lincoln Charter Township, Sodus Township, and St. Joseph Charter Township."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%99%B8%EB%A5%B4%ED%81%AC_%EB%8D%B0%EB%AC%B4%EC%8A%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Goerg_Demus_%281972_tour_of_Southern_Africa%29.jpeg","page_title":"외르크 데무스","context_page_description":"외르크 데무스는 오스트리아의 피아니스트이다.\\n파울 바두라스코다, 프리드리히 굴다 등과 함께 빈의 트리오로 불리며, 솔로 외에도 바두라스코다와 협연하기도 하고, 디트리히 피셔디스카우의 <겨울 나그네> 전곡의 반주를 하였다. 유순하고 밝은 성격이 연주에 항상 반영되었다. 드뷔시의 작품과 슈베르트의 작품 연주가 훌륭하다."},{"page_url":"https://es.wikipedia.org/wiki/San_Marino_en_los_Juegos_Ol%C3%ADmpicos_de_M%C3%A9xico_1968","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Flag_of_San_Marino_%281862%E2%80%932011%29.svg","page_title":"San Marino en los Juegos Olímpicos de México 1968","context_page_description":"San Marino estuvo representado en los Juegos Olímpicos de México 1968 por cuatro deportistas masculinos que compitieron en dos deportes.​\\nEl equipo olímpico sanmarinense no obtuvo ninguna medalla en estos Juegos.​​"},{"page_url":"https://de.wikipedia.org/wiki/Waldfriedhof_Obersch%C3%B6neweide","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Linker_Sockel_Ehrenmal_Erster_Weltkrieg_Waldfriedhof_Obersch%C3%B6neweide.jpg","page_title":"Waldfriedhof Oberschöneweide","context_page_description":"Der Waldfriedhof Oberschöneweide ist ein städtischer Friedhof im Berliner Ortsteil Oberschöneweide im Bezirk Treptow-Köpenick. Er wurde 1902 im Auftrag des Mitgründers der Allgemeinen Elektricitäts-Gesellschaft Emil Rathenau von Max Stutterheim als Kirchhof an der Waldstraße angelegt. Erst seit der Fertigstellung des Volksparks Wuhlheide hat er die Adresse An der Wuhlheide 131 a."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%AC%AC68%E5%9B%9E%E5%85%A8%E6%97%A5%E6%9C%AC%E3%83%90%E3%83%AC%E3%83%BC%E3%83%9C%E3%83%BC%E3%83%AB%E9%AB%98%E7%AD%89%E5%AD%A6%E6%A0%A1%E9%81%B8%E6%89%8B%E6%A8%A9%E5%A4%A7%E4%BC%9A","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/30/Tokyo_Metropolitan_Gymnasium_2008_cropped.jpg","page_title":"第68回全日本バレーボール高等学校選手権大会","context_page_description":"第68回全日本バレーボール高等学校選手権大会は、2016年1月5日から1月10日まで東京体育館で開催された全日本バレーボール高等学校選手権大会である。男子は東福岡高等学校が2年連続優勝を遂げ、女子は東京勢決戦を制した下北沢成徳高等学校が3年ぶり3回目の優勝を果たした。"},{"page_url":"https://pl.wikipedia.org/wiki/Lista_stanowisk_archeologicznych_w_Peru","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c8/Cusco_Coricancha_Inti-Huasi_main_view.jpg","page_title":"Lista stanowisk archeologicznych w Peru","context_page_description":"Stanowiska archeologiczne w Peru są liczne i zróżnicowane. Zaliczają się do nich świątynie, twierdze, relikty wielu kultur zamieszkujących ten obszar, takich jak Moche lub Nazca. Stanowiska te są zróżnicowane pod względem istotności, od nieznacznych, po obiekty wpisane na listę światowego dziedzictwa UNESCO. Poniższa lista prezentuje część z nich."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B5%D1%82%D0%BD%D0%B8%D0%B5_%D0%9E%D0%BB%D0%B8%D0%BC%D0%BF%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B5_%D0%B8%D0%B3%D1%80%D1%8B_1952","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Zatopek-Gorno-1952.jpg","page_title":"Летние Олимпийские игры 1952","context_page_description":"XV Летние Олимпийские игры проходили с 19 июля по 3 августа 1952 года в Хельсинки. Это были первые и пока единственные Олимпийские игры, которые проводились в Финляндии. Эти игры стали самым важным международным событием из всех ранее проводимых в Финляндии.\\nХельсинки получил право принимать летние Олимпийские игры 1940 года, но они были отменены в связи со Второй мировой войной. После её окончания, Международный олимпийский комитет принял решение провести летнюю Олимпиаду 1952 года в Хельсинки.\\nИгры начались 19 июля 1952 года, когда закончивший карьеру финский бегун Пааво Нурми зажёг олимпийский огонь. В играх приняли участие 4925 спортсменов, 518 из которых были женщины. В соревнованиях принимали участие 69 стран, между которыми разыгрывалось в общей сложности 43 комплекта медалей в 149 категориях. США были самой успешной страной из стран-участниц. Второе место по числу медалей получили спортсмены Советского Союза, которые впервые в истории приняли участие в Олимпийских играх. Принимающая Олимпиаду Финляндия стала восьмой, получив 22 медали, в том числе шесть золотых."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_onroerend_erfgoed_in_Geraardsbergen","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Geraardsbergen_-_Viane_-_Edingseweg_403_-_Mertensmolen_3.jpg","page_title":"Lijst van onroerend erfgoed in Geraardsbergen","context_page_description":"Een overzicht van het onroerend erfgoed in Geraardsbergen. Het onroerend erfgoed maakt deel uit van het cultureel erfgoed in België."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BD%D1%8C%D1%87%D0%B6%D1%83%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D1%86%D0%BE%D0%BA%D0%BE%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Myospalax_psilurus_2.jpg","page_title":"Маньчжурский цокор","context_page_description":"Маньчжурский цокор или северокитайский цокор — млекопитающее рода цокоров отряда грызунов."},{"page_url":"https://de.wikipedia.org/wiki/Letn%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Letenskytunel-jizniportal.jpg","page_title":"Letná","context_page_description":"Letná ist der Flurname eines Prager Hügels nördlich des Stadtzentrums und häufig auch die Kurzbezeichnung einer erhöhten Ebene, die Letenská pláň heißt und sich an den Letenské sady anschließt. Die Letná-Höhe liegt in den Prager Katastralgemeinden Bubeneč und Holešovice. Trotz seiner zentrumsnahen Lage ist dieses Gebiet großenteils noch immer eine Freifläche mit wechselnden Nutzungen und ist ein beliebter Naherholungsort."},{"page_url":"https://id.wikipedia.org/wiki/Tragikomedi","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Tragic_comic_masks_-_roman_mosaic.jpg","page_title":"Tragikomedi","context_page_description":"Tragikomedi adalah gaya atau bentuk drama yang memadu unsur-unsur antara tragedi dan komedi. Artinya, drama tersebut ingin mengungkapkan sebuah persitiwa tragis namun ditampilkan dalam gaya lucu, atau sebaliknya. Aliran tersebut muncul semenjak zaman Romawi Kuno, tampak dalam karya dramawan Plautus dalam prolog berjudul Amphytryon, di mana istilah ini dipergunakan untuk pertama kali. Ciri tragikomedi juga tampak dalam masa Renaisans dan menemukan bentuk yang semakin jelas, yaitu meliputi karya yang biasanya berakhir bukan dengan kesedihan atau kematian, walaupun cenderung mengarah demikian. Secara ringkas, drama bergaya tragikomedi berisi kisah-kisah nasib butuk yang menimpa tiba-tiba, bencana yang tidak terelakkan, dan berakhir dengan kebahagiaan atau happy ending. Dramawan Prancis, Shakespeare dalam judul The Merchant of Venice dan Measure or measure adalah contoh dari ciri tersebut.\\nPada abad ke-19, kaum romantik memasukkan unsur tragikomedi, yang selanjutnya berpengaruh pada drama modern. Gaya tersebut dianggap tampak aneh, membingungkan, dan tak mudah dimengerti, tetapi terkenal, misalnya tampak dalam karya Samuel Beckett berjudul Waiting for Godot."},{"page_url":"https://ru.wikipedia.org/wiki/Renault_Clio","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Renault_Clio_2-verde.jpg","page_title":"Renault Clio","context_page_description":"Renault Clio — автомобиль класса супермини, выпускаемый французской компанией Renault с 1990 года. Признавался «Автомобилем года в Европе» в 1991 и 2006 годах. Первое поколение претерпело рестайлинг в 1994 и 1996 годах. Осенью 1998 года на Парижском автосалоне показали второе поколение — Renault Clio II на совершенно новой платформе. В 2000 году появляется модификация Renault Clio Sport V6 с двигателем V6, расположенным центрально, вместо заднего ряда сидений. Мощность этого трёхлитрового двигателя составляла 230 л.с. — это самая мощная серийная версия Renault Clio. На базе выпускающегося с октября 2012 года Clio IV конструкторами Renault разработан компактный кроссовер Captur, производство которого началось во второй половине 2013 года."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B9%B3%E9%81%A5%E6%96%87%E5%BA%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Pingyao_Wenmiao_2013.08.25_10-16-52.jpg","page_title":"平遥文庙","context_page_description":"平遥文庙位于平遥古城东南隅城隍庙街120号，始建于唐贞观初年，是中国现存最早的孔庙；文庙大成殿重建于金大定三年，是中国各孔庙中唯一的金代建筑。文庙附绍山书院，晚清思想家徐继畬曾任山长，教书达十年之久。\\n1997年平遥文庙连同平遥古城，平遥双林寺等被列入世界文化遗产。平遥文庙现为全国重点文物保护单位，中国国家4A级旅游景区。\\n平遥文庙大成殿拥有中国少见的独立昂结构。"},{"page_url":"https://fr.wikipedia.org/wiki/Rojava","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Kurdish-inhabited_areas_of_the_Middle_East_and_the_Soviet_Union_in_1986.jpg","page_title":"Rojava","context_page_description":"Le Rojava, ou Kurdistan occidental ou Kurdistan syrien ou Fédération démocratique du nord de la Syrie, est une région rebelle autonome de fait dans le nord et le nord-est de la Syrie. Elle s’est autoproclamée en 2013 sous le nom d'Administration transitoire intérimaire.\\nLe 17 mars 2016, les Kurdes de Syrie proclament une entité « fédérale démocratique » dans les zones contrôlées et qui comprennent notamment les trois « cantons » kurdes d'Afrine, de Kobané et de la Djézireh, dans ce qui était jusqu'à présent une zone d’« administration autonome ». Cette entité est également dénommée Fédération démocratique du Rojava-Syrie du Nord. Dans sa constitution de décembre 2016, son nom officiel est celui de Système fédéral démocratique de Syrie du Nord. Cette déclaration a été faite à Rmeilane par le Parti de l'union démocratique en présence d'autres partis kurdes, arabes et assyriens.\\nDepuis 2012, la majorité du Kurdistan syrien est contrôlé par des milices kurdes. En novembre 2013, des représentants kurdes, arabes, assyriens et d'autres minorités ont formé un gouvernement de facto dans la région. Deux millions de Kurdes vivent sur ce territoire."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%AF%D9%88%D9%84%D8%A9_%D8%A7%D9%84%D8%A3%D9%8A%D9%88%D8%A8%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Nur_ad-Din_Zangi2.jpg","page_title":"الدولة الأيوبية","context_page_description":"الدولة الأيوبية هي دولة إسلامية نشأت في مصر، وامتدت لتشمل الشام والحجاز واليمن والنوبة وبعض أجزاء المغرب العربي. يعد صلاح الدين يوسف بن أيوب مؤسس الدولة الأيوبية، كان ذلك بعد أن عُيِّن وزيرًا للخليفة الفاطمي العاضد لدين الله ونائبًا عن السلطان نور الدين محمود في مصر، فعمل على أن تكون كل السلطات تحت يده، وأصبح هو المتصرف في الأمور، وأعاد مصر الى تبعية الدولة العباسية، فمنع الدعاء للخليفة الفاطمي ودعا للخليفة العباسي، وأغلق مراكز الشيعة الفاطمية، ونشر المذهب السني.\\nبعد وفاة نور الدين زنكي توجه صلاح الدين إلى بلاد الشام، فدخل دمشق، ثم ضمَّ حمص ثم حلب، وبذلك أصبح صلاح الدين سلطانًا على مصر والشام. كانت دولة الأيوبيين قد امتدت إلى بلاد الحجاز، حيث قام صلاح الدين بتحصين جنوب فلسطين، والاستعداد لأي أمر يقوم به أرناط صاحب قلعة الكرك، والذي كان يدبر للهجوم على الأماكن المقدسة في مكة والمدينة، وكان صلاح الدين قد اعتنى بميناء القلزم وميناء جدة، لأن أرناط كان قد عمَّر أسطولا في ميناء أَيْلَة، وأرسل سفنًا بلغت عِيذاب، فاستولى صلاح الدين على أيلة."},{"page_url":"https://nl.wikipedia.org/wiki/Wojciesz%C3%B3w","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Wojciesz%C3%B3w_%28Kauffung%29.jpg","page_title":"Wojcieszów","context_page_description":"Wojcieszów is een stad in het Poolse woiwodschap Neder-Silezië, gelegen in de powiat Złotoryjski. De oppervlakte bedraagt 32,16 km², het inwonertal 4014."},{"page_url":"https://it.wikipedia.org/wiki/Saorgio","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Saorge%2C_monast%C3%A8re_franciscain%2C_r%C3%A9fectoire%2C_fresques_17e_si%C3%A8cle_%281%29.jpg","page_title":"Saorgio","context_page_description":"Saorgio è un comune francese di 447 abitanti situato nel dipartimento delle Alpi Marittime della regione della Provenza-Alpi-Costa Azzurra."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B9%82%E0%B8%8B%E0%B9%80%E0%B8%A7%E0%B8%B5%E0%B8%A2%E0%B8%95%E0%B8%AD%E0%B8%B4%E0%B8%99%E0%B8%9F%E0%B8%AD%E0%B8%A3%E0%B9%8C%E0%B8%A1%E0%B8%9A%E0%B8%B9%E0%B9%82%E0%B8%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/RIAN_archive_409373_Sovinformburo_last_war_report.jpg","page_title":"โซเวียตอินฟอร์มบูโร","context_page_description":"โซเวียตอินฟอร์มบูโร เป็นสำนักข่าวของสหภาพโซเวียตในช่วงปี ค.ศ. 1941 ถึง ค.ศ. 1961 ก่อตั่งขึ่นในวันที่ 24 มิถุนายน ค.ศ. 1941 โดยเปิดขึ่นในช่วงสงครามโลกครั้งที่สองโดยอยู่ในการกำกับของคอมมิสซาร์กลาโหมประชาชนและคณะกรรมาธิการกลางแห่งพรรคคอมมิวนิสต์สหภาพโซเวียต\\nในช่วงสงครามโลกครั้งที่สองโซเวียตอินฟอร์มบูโรได้เป็นเครื่องมือของ All-Slavonic Committee, Anti-Fascist Committee of Soviet Women, Anti-Fascist Committee of the Soviet Youth, Anti-Fascist Committee of Soviet Scientists และ the Jewish Anti-Fascist Committee ในการโฆษณาชวนเชื่อเพื่อต่อต้านนาซีหลังจากที่สงครามโลกครั้งที่สองยุติลงโซเวียตอินฟอร์มบูโรยังคงทำงานต่อจนปี ค.ศ. 1961 โซเวียตอินฟอร์มบูโรจึงเปลี่ยนชื่อเป็น Novosti Press Agency และเปลี่ยนเป็นรีอะโนวัสติในปัจจุบัน"},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Schaubergwerken","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Kletno_-_sztolnia_fluorytowa_PL.jpg","page_title":"Liste von Schaubergwerken","context_page_description":"Dies ist eine Liste von Schaubergwerken, die sich in Betrieb befinden. Voraussetzung für die Aufnahme ist nicht ein ständiger Besucherbetrieb, wohl aber die Möglichkeit, die Bergwerke auf Anfrage unter fachkundiger Führung begehen zu können. Schaubergwerke besitzen in der Regel eine entsprechende Betriebsgenehmigung und sind in offiziellen Listen von Bergbehörden aufgeführt."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%87%D8%A7%DA%A4%D9%8A%D8%B1%D8%AC%D8%A7%D9%84_%D8%A8%D8%B1%D9%8A%D8%A7%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/Havergal_Brian_-_signature_%281966%29.png","page_title":"هاڤيرجال بريان","context_page_description":"هاڤيرجال بريان كان ملحن مزيكا من المملكه المتحده."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E7%9E%BF%E5%85%AC%E7%9C%9F%E4%BA%BA%E5%BB%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/%E7%9E%BF%E5%85%AC%E7%9C%9F%E4%BA%BA%E5%BB%9F%E4%BE%9B%E6%A1%8C%E8%88%87%E7%A5%9E%E5%83%8F.jpg","page_title":"瞿公真人廟","context_page_description":"瞿公真人庙，是位于台湾台北市大同区朝阳里的庙宇，主祀瞿公真人，为台湾清治时期光绪年间湘军所带来的信仰。"},{"page_url":"https://cy.wikipedia.org/wiki/Radiwm","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Electron_shell_088_Radium.svg","page_title":"Radiwm","context_page_description":"Elfen gemegol ymbelydrol a geir mewn mwynau wraniwm yw radiwm. Mae'n un o'r metelau daear alcalïaidd ac mae ganddo'r symbol Ra a'r rhif atomig 88. Mae'n wyn fel arfer ond mae'n troi'n ddu ym mhresenoldeb aer. Mae gan ei isotop mwyaf cyffredin, ²²⁶Ra, hanner oes o tua 1,602 o flynyddoedd. Darganfuwyd radiwm ym 1898 gan Marie Curie a'i gŵr Pierre Curie."},{"page_url":"https://ru.wikipedia.org/wiki/Rosella","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Rosella_shopattu.jpg","page_title":"Rosella","context_page_description":"Rosella — круизный 9-палубный пассажирский и автомобильный паром финского судоходного концерна Viking Line. Совершает регулярные рейсы по маршруту Капельшер-Мариехамн. Является рекордсменом по разнообразию маршрутов, на которых эксплуатировался, в составе флота Viking Line."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E6%9D%9C%E9%A6%AC%E5%90%89%E5%8E%9F%E4%BD%8F%E6%B0%91%E9%83%A1%E6%94%BF%E5%BA%9C","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/Doomadgee_LGA_Qld.png","page_title":"杜馬吉原住民郡政府","context_page_description":"杜馬吉原住民郡是澳大利亞昆士蘭州西北部的特別地方政府。由於此郡居民多為澳大利亞原住民，與州內其他地方民情有別，因此州政府於1987年成立了產權契約信託公司，以法人方式協助當地發展，並維護當地生態的成長。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B8%D0%BB%D1%8E%D0%BA%D0%BE%D0%B2,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/%D0%9C%D0%B8%D0%BB%D1%8E%D0%BA%D0%BE%D0%B2_%D0%94%D0%BE%D0%B1%D1%80%D0%BE%D0%B5_%D1%81%D1%82%D0%B0%D1%80%D0%BE%D0%B5_%D0%B2%D1%80%D0%B5%D0%BC%D1%8F.jpg","page_title":"Милюков, Александр Петрович","context_page_description":"Алекса́ндр Петро́вич Милюко́в — русский писатель, литературный критик, журналист, главный идеолог и фактический руководитель журнала «Светоч», мемуарист. Педагог, историк литературы, путешественник, библиограф, профессор. Друг М. М. Достоевского и Ф. М. Достоевского, принимавший активное участие в литературной жизни России 1840—1880-х гг.; прототип С. В. Липутина, персонажа романа «Бесы». Петрашевец-фурьерист, примыкавший к умеренному крылу движения. Многочисленные работы Милюкова отличаются самостоятельностью, глубиной и убедительностью аргументации, имеют много ценных наблюдений и выдержали испытание временем.\\nСамая крупная критическая работа, «Очерк истории русской поэзии», в середине XIX столетия выдержала три издания и в течение полувека служила пособием по курсу русской критики для студентов филологических факультетов."},{"page_url":"https://de.wikipedia.org/wiki/Beta_Pictoris","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ef/HST_betaPictoris_comb.jpg","page_title":"Beta Pictoris","context_page_description":"Beta Pictoris ist der zweithellste Stern im Sternbild Maler. Der massereiche, heiße Stern befindet sich in einer Entfernung von etwa 63 Lichtjahren und spielt in der Geschichte der Astronomie eine bedeutende Rolle. Der Stern ist Mitglied und Namensgeber des β-Pictoris-Bewegungshaufens. In seinem Orbit wurde per direkter Beobachtung im Jahre 2008 ein Exoplanet entdeckt."},{"page_url":"https://ro.wikipedia.org/wiki/Insula_Clipperton","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Clippertonisland.jpg","page_title":"Insula Clipperton","context_page_description":"Insula Clipperton sau Insula pasiunii este un atol de corali nelocuit în Oceanul Pacific la 1280 km sud-vest de Mexic și la vest de Costa Rica la 10°18′N 109°13′V. Insula face parte din domeniile statului francez, cu acest titlu fiind sub directa autoritate a primului ministru, autoritate delegată de acesta înaltului comisar al Republicii Franceze în Polinezia Franceză, acesta acordând autorizațiile de vizitare a atolului sau concesiunile de explorare."},{"page_url":"https://en.wikipedia.org/wiki/Mycalesis_aramis","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Mycalesis_aramis.JPG","page_title":"Mycalesis aramis","context_page_description":"Mycalesis aramis is a butterfly of the family Nymphalidae. It is found on Luzon in the Philippines."},{"page_url":"https://ca.wikipedia.org/wiki/Tetrafluoromet%C3%A0","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/db/Carbon-tetrafluoride-2D-dimensions.png","page_title":"Tetrafluorometà","context_page_description":"El tetrafluorometà, també conegut com a tetrafluorur de carboni, és el més simple dels fluorocarbonis. Té una força d'unió molt alta a causa de la naturalesa de l'enllaç carboni-fluor. També pot ser classificat com un haloalcà o halometà. A causa dels múltiples enllaços carboni-fluor, i l'alta electronegativitat del fluor, el carboni en tetrafluorometà té una càrrega parcial positiva significativa que enforteix i escurça els quatre enllaços carboni-fluor, proporcionant caràcter iònic addicional.\\nIgual que altres fluorocarbonis, és molt estable a causa de la fortalesa dels seus enllaços carboni-fluor. Els enllaços a tetrafluorometà tenen una energia d'enllaç de 515 kJ ⋅ mol-1. Com a resultat, és inert als àcids i als hidròxids. No obstant això, reacciona de forma explosiva amb metalls alcalins. I la descomposició tèrmica o la combustió de CFC 14 produeix gasos tòxics.\\nDe vegades s'utilitza com a refrigerant de baixa temperatura. També, s'utilitza en l'electrònica de microfabricació o, en combinació amb l'oxigen, com un reactiu d'atac de plasma per al silici, diòxid de silici i nitrur de silici. Per últim, té usos en detectors de neutrons."},{"page_url":"https://en.wikipedia.org/wiki/Bishop_Dunbar%27s_Hospital","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Dunbar_Hospital_Spalding.jpg","page_title":"Bishop Dunbar's Hospital","context_page_description":"Bishop Dunbar's Hospital was founded in 1531 by Bishop Gavin Dunbar, the Elder. The hospital was endowed by a mortification just before his death. Dunbar petitioned the King, James V of Scotland, and the charter, signed on 24 February 1531 records the King’s approval that ‘[Dunbar shall] ... found an hospital near the cathedral church, but outside the cemetery...’ It was also known as St Mary's Hospital. In the mortification, Dunbar's charitable purpose is recorded. Bedesmen were supported by a charitable foundation that emerged from the original church control until the twenty-first century. Bedesmen drew their name from the word \\"bede\\" - a prayer. The residents of Dunbar's Hospital said prayers in a cycle of Divine Office. The Bede House, Old Aberdeen was used by the Bedesmen from the hospital from 1789 to the end of the nineteenth century. The only remains of the 1531 building can be seen in a perimeter wall for Seaton Park in Old Aberdeen. The last Bedesman died in 1988. The Managers of the Hospital constituted a Charity, Bishop Dunbar Hospital Trust. The Charity ceased active operation in 2012."},{"page_url":"https://de.wikipedia.org/wiki/Taylor-Couette-Str%C3%B6mung","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Taylor_Wirbel_02.jpg","page_title":"Taylor-Couette-Strömung","context_page_description":"Taylor-Couette-Strömung bezeichnet die Strömung einer inkompressiblen viskosen Flüssigkeit, die sich im Raum zwischen zwei koaxialen, relativ zueinander rotierenden Zylindern befindet. Die Strömung zwischen den Zylindern ist dabei nicht nur von der Rotationsgeschwindigkeit abhängig, sondern auch davon, ob der innere oder der äußere Zylinder rotiert.\\nIst die Relativgeschwindigkeit der Zylinder gering und der Spalt zwischen ihnen klein gegenüber ihren Durchmessern, so kann die Strömung als ebene laminare Strömung behandelt werden. Das Geschwindigkeitsprofil ist ähnlich dem idealisierten Fall einer ebenen Strömung zwischen zwei Platten, von denen die eine relativ zur anderen langsam bewegt wird. Dabei kann eine Platte als feststehend und die andere als bewegt betrachtet werden.\\nDie Strömung wurde nach Maurice Couette benannt, der Ende des 19. Jahrhunderts das erste funktionierende Rotationsviskosimeter konstruierte und dazu die laminare Grundströmung nutzte, und nach Geoffrey Ingram Taylor, der die Instabilitäten bei höherer Rotationsgeschwindigkeit untersuchte und theoretisch erklärte. Couette suchte Wirbel zu vermeiden und drehte nur den äußeren Zylinder."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Jefferson_County,_Kentucky","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/John_T._Bate_House%2C_Woodside.jpg","page_title":"National Register of Historic Places listings in Jefferson County, Kentucky","context_page_description":"The table below includes sites listed on the National Register of Historic Places in Jefferson County, Kentucky except those in the following neighborhoods/districts of Louisville: Anchorage, Downtown, The Highlands, Old Louisville, Portland and the West End. Links to tables of listings in these other areas are provided below.\\nThere are 490 properties and districts in the county listed on the National Register, including 8 National Historic Landmarks and 2 National Cemeteries. Latitude and longitude coordinates of the 221 sites listed on this page may be displayed in a map or exported in several formats by clicking on one of the links in the box below the map of Kentucky to the right.\\nThis National Park Service list is complete through NPS recent listings posted July 17, 2020."},{"page_url":"https://en.wikipedia.org/wiki/Benjamin_Wittes","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Benjamin_Wittes_%2811934044386%29_%28cropped%29.jpg","page_title":"Benjamin Wittes","context_page_description":"Benjamin Wittes is a Senior Fellow in Governance Studies at the Brookings Institution, where he is the Research Director in Public Law, and Co-Director of the Harvard Law School – Brookings Project on Law and Security. He works principally on issues related to American law and national security. Along with Robert M. Chesney and Jack Goldsmith, Wittes cofounded the Lawfare Blog, which is devoted to the discussion of U.S. national security choices. Wittes is also a member of the Hoover Institution's Task Force on National Security and Law. Wittes is a frequent speaker on topics of detention, interrogation, and national security, before academic, government, policy, and military audiences. He is also a co-host of the Rational Security podcast."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%B8%8D%E5%8F%97%E6%AD%A1%E8%BF%8E%E4%BA%BA%E7%89%A9%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Vargas_Losa_G%C3%B6teborg_Book_Fair_2011b.jpg","page_title":"不受歡迎人物列表","context_page_description":"本表為不受歡迎人物的名單。 不受歡迎人物是一個外交法律術語，指的是禁止進入或留在這個國家的外國人。因為外交官受到外交豁免的保護，能夠免於逮捕和正常起訴程序，所以宣布為不受歡迎的人是一個國家可以對外國外交官所能採取的最嚴正的制裁形式。"},{"page_url":"https://pt.wikipedia.org/wiki/Chris_Jericho","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Kurt_Angle_and_Chris_Jericho_-_King_of_the_Ring_2000.jpg","page_title":"Chris Jericho","context_page_description":"Christopher Keith Irvine, mais conhecido por seu nome de ringue Chris Jericho, é um lutador de luta livre profissional, músico, empresário, apresentador de televisão, escritor e ator américo-canadense. Atualmente trabalha para a All Elite Wrestling onde foi o 1º Campeão Mundial da AEW, e também é o líder da facção \\"The Inner Circle\\".\\nJericho também atuou nas promoções Extreme Championship Wrestling e World Championship Wrestling, bem como em empresas do Canadá, Alemanha, Japão e México. Entre WWE, WCW e ECW – as três maiores empresas de luta livre profissional americanas durante a década de 1990, ele ganhou 38 campeonatos. Jericho foi o primeiro Undisputed WWF Champion e o último lutador a ganhar o WCW World Championship, tendo unificado ambos os títulos após derrotar Stone Cold Steve Austin e The Rock na mesma noite em 2001. Ele também foi o nono lutador a completar a tríplice coroa da WWE e o quarto a realizar o Grand Slam. Além disso, conquistou o Slammy Award de lutador do ano em 2008."},{"page_url":"https://pl.wikipedia.org/wiki/Dirk_Verhofstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Dirk_Verhofstadt.jpg","page_title":"Dirk Verhofstadt","context_page_description":"Dirk Verhofstadt – belgijski teoretyk liberalizmu, zwolennik Rawlsa, jest doradcą wicepremiera i ministra spraw zagranicznych, Patricka Dewaela, i bratem byłego premiera Guya Verhofstadta. Studiował prawo i komunikację medialną na Uniwersytecie Gentyńskim. Pracował w mediach. Działa w niezależnym think tanku ruchu liberalnego – Liberales – którego jest jednym z najaktywniejszych członków.\\nW swych wystąpieniach i publikacjach broni liberalizmu przed krytykami antyglobalistów i krytykuje fanatyzm religijny."},{"page_url":"https://nl.wikipedia.org/wiki/Aristobulus_I","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Judea_Aristobulus_I.PNG","page_title":"Aristobulus I","context_page_description":"Aristobulus I volgde in 104 v.Chr. zijn vader Johannes Hyrcanus op als koning en hogepriester van de Joodse Hasmonese staat. Zijn Hebreeuwse naam is Juda of Judas, maar in de geschiedenis is hij vrijwel uitsluitend onder zijn Griekse naam Aristobulus bekend. Hij was getrouwd met Salome Alexandra.\\nEigenlijk was het de bedoeling van zijn vader geweest dat hij na zijn dood door zijn vrouw opgevolgd zou worden en dat Aristobulus alleen het ambt van hogepriester zou bekleden. Aristobulus nam daar echter geen genoegen mee en zette zijn moeder en drie van zijn broers gevangen. Zijn moeder overleed tijdens deze gevangenschap. Alleen zijn broer Antigonus, de oudste van zijn vier jongere broers, op wie hij zeer gesteld was, behield zijn vrijheid.\\nAristobulus legde zich, evenals zijn vader gedaan had, toe op de uitbreiding van het Hasmonese rijk. Hij voegde Galilea en Iturea toe aan de Joodse staat. Voor zover de bevolking van deze gebieden uit heidenen bestond, dwong hij hen zich te laten besnijden zo het Jodendom aan te hangen. Ook hierin volgde hij het voorbeeld van zijn vader, hoewel een dergelijk optreden in de Joodse geschiedenis niet eerder was voorgekomen."},{"page_url":"https://fr.wikipedia.org/wiki/Guillotine","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Bi%C3%A8re_des_vivants.jpg","page_title":"Guillotine","context_page_description":"La guillotine est une machine de conception française, inspirée d’anciens modèles de machines à décapitation, et qui fut utilisée en France pour l’application officielle de la peine de mort par décapitation, puis dans certains cantons de Suisse, en Grèce, en Suède, en Belgique et en Allemagne. En France, une guillotine fonctionna à la prison des Baumettes pour la dernière fois en septembre 1977, et fut remisée définitivement, après l’abolition de la peine de mort en 1981, au Centre pénitentiaire de Marseille.\\nElle tient son nom du docteur Guillotin qui la fait adopter à l'assemblée nationale constituante dans les tout premiers temps de la Révolution française. Son concepteur est le docteur Antoine Louis.\\nSelon les experts médicaux, la section de la moelle épinière entraîne une perte de connaissance instantanée."},{"page_url":"https://sv.wikipedia.org/wiki/Svart_frankolin","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Francolinus_francolinus_qtl1.jpg","page_title":"Svart frankolin","context_page_description":"Svart frankolin är en vanlig men tillbakadragen hönsfågel i familjen fasanfåglar som förekommer från östra Medelhavsområdet till Indien."},{"page_url":"https://en.wikipedia.org/wiki/Crosby_Villa","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Crosby_Villas_-_geograph.org.uk_-_49543.jpg","page_title":"Crosby Villa","context_page_description":"Crosby Villa is a hamlet in the civil parish of Crosscanonby in Cumbria, United Kingdom. It is located on the A596 road, 3.75 miles north-east of Maryport and 3.75 miles south-west of Aspatria. The village of Crosby is 1.5 miles to the south-west, and the hamlet of Oughterside is 2.25 miles to the north-east. Cumbria's county town, Carlisle, is 24 miles to the north-east.\\nCrosby Villa lies on the Solway Plain, less than 1 mile from the boundary of the Solway Coast Area of Outstanding Natural Beauty, and approximately 1.5 miles s from the shore of Allonby Bay, an inlet of the Solway Firth. Historically, the name may have been spelled Crosby Villas."},{"page_url":"https://es.wikipedia.org/wiki/Instituto_Interuniversitario_de_Filolog%C3%ADa_Valenciana","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Esuni.GIF","page_title":"Instituto Interuniversitario de Filología Valenciana","context_page_description":"El Instituto Interuniversitario de Filología Valenciana, se creó en el año 1987 como tal por un Decreto de la Generalidad Valenciana del año 1994. Lo integran la Universidad de Valencia, la Universidad de Alicante y la Universidad Jaime I, de Castellón de la Plana, es decir, las tres universidades valencianas con estudios superiores de filología."},{"page_url":"https://bs.wikipedia.org/wiki/Sarajevski_tramvaji","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Sarajevo_Tram-816_Line-3_2011-10-05_%282%29.jpg","page_title":"Sarajevski tramvaji","context_page_description":"Sarajevski tramvaji su tramvajski sistem u glavnom gradu Bosne i Hercegovine Sarajevu. Vlasnik tramvaja je Javno komunalno preduzeće – Gradski saobraćaj Sarajevo, koje ujedno i organizuje javni promet u Sarajevu."},{"page_url":"https://fr.wikipedia.org/wiki/Couvent_des_Capucins_de_Ch%C3%A2teau-Thierry","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Coll%C3%A8ge_Jean_Racine_-_Ch%C3%A2teau-Thierry_-_Chapelle.jpg","page_title":"Couvent des Capucins de Château-Thierry","context_page_description":"Le couvent des Capucins est un ancien couvent situé à Château-Thierry, en France.\\nIl forme le cœur historique du collège des capucins, qui deviendra collège et lycée Jean de La Fontaine de Château-Thierry, puis collège Jean Racine lorsque le lycée a été déplacé dans des bâtiments modernes sur les hauteurs de la ville."},{"page_url":"https://fr.wikipedia.org/wiki/Enceinte_de_Philippe_Auguste","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/F3355_Paris_VI_Passage_Dauphine_panneau_rwk.jpg","page_title":"Enceinte de Philippe Auguste","context_page_description":"L’enceinte de Philippe Auguste est un système de fortification urbaine construit à Paris, à partir de la fin du XIIᵉ siècle. Cette deuxième enceinte médiévale est la plus ancienne dont on connaisse le tracé avec précision.\\nTrès partiellement intégrée dans les constructions ultérieures, cette enceinte a laissé plus de vestiges que les fortifications suivantes, notamment l'enceinte de Charles V et l'enceinte des Fossés Jaunes remplacés par les grands boulevards après 1670, le mur des Fermiers Généraux et l'enceinte de Thiers également à l'origine de ceintures de boulevards au XIXᵉ siècle et au XXᵉ siècle.\\nSon empreinte sur le plan de Paris, moins visible, n'en est pas moins importante :\\nen rive droite, par l'ouverture de rues adossées au rempart à partir desquelles s'est développée l'urbanisation des quartiers centraux de la rive droite au Moyen-Âge ce que révèle l'orientation du réseau, en biais de la rue Jean-Jacques-Rousseau et voies parallèles, par rapport à la rue Saint-Honoré, s'infléchissant de la rue Tiquetonne à la rue des Francs-Bourgeois, puis perpendiculaire à Seine, rue des Jardins-Saint-Paul où l'ancienne muraille est visible."},{"page_url":"https://en.wikipedia.org/wiki/Giambellino-Lorenteggio","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4a/Oratorio_di_San_Protaso_vescovo.jpg","page_title":"Giambellino-Lorenteggio","context_page_description":"Giambellino and Lorenteggio are two historical and populous residential neighborhoods of Milan, Italy. Together, they form a district, part of the Zone 6 administrative division of Milan.\\nThe district is centered along two parallel streets, Via Giambellino and Via Lorenteggio, that extend from the south-west of Milan outwards to the border of the comune of Corsico. These two main streets house a number of shops and stores, and together form a peripheral shopping district. The area is nevertheless mainly residential, with both high-income housing and low-income housing."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AD%D0%BA%D1%81%D1%86%D0%B5%D0%BD%D1%82%D1%80%D0%B8%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/M.N.Savoiarov_otkrytka_1914.jpg","page_title":"Эксцентрика","context_page_description":"Эксцéнтрика:\\nжанр театрального, циркового, музыкального или эстрадного представления, построенный на использовании художественных эксцентрических приёмов;\\nв театре, цирке, кинематографе, на эстраде — художественный приём остро-комедийного и пародийного изображения действительности, основанный на «умышленном» нарушении логики и причинно-следственных связей в действиях или событиях, как бы причудливом смещении привычных понятий, а также использовании предметов в несвойственных им функциях, — в результате чего обыденные, привычные действия и жизненные явления получают неожиданное переосмысление.\\nЭксцентрика таким образом раскрывает мир в его новых качествах и по-своему участвует в процессе обновления «застарелых» образов, понятий и представлений, — выходя из пределов обычного и принимая порой крайне странные, нелепые, чудаковатые, смешные, саркастические и даже эпатажные формы выражения."},{"page_url":"https://en.wikipedia.org/wiki/Thomas_Villiers,_1st_Earl_of_Clarendon","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/ThomasVilliersEarlClarendon.jpg","page_title":"Thomas Villiers, 1st Earl of Clarendon","context_page_description":"Thomas Villiers, 1st Earl of Clarendon, PC was a British politician and diplomat from the Villiers family.\\nClarendon was the second son of William Villiers, 2nd Earl of Jersey, and his wife Judith Herne, daughter of Frederick Herne."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%A2%D5%A1%D5%B7%D5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Abasha_main_street.jpg","page_title":"Աբաշա","context_page_description":"Աբաշա, քաղաք Վրաստանի Սամեգրելո և Զեմո-Սվանեթի մարզում՝ 4941 բնակչությունով։ Գտնվում է Թբիլիսիից 283 կմ դեպի արևմուտք։\\nՎրաստանի կոմունիստական կուսակցության առաջնորդ Էդուարդ Շևարդնաձե 1970-ական թվականներին այստեղ միավորել է շրջանային բոլոր գյուղատնտեսական հաստատությունները, կոլխոզները ևս, միասնական կառավարմամբ մի վարչության մեջ, խրարուսել անհատ ձեռներեցությունը, ինչը նպաստել է Աբաշայի չքավոր շրջանի բարգավաճմանը և գյուղատնտեսական արտադրության ավելացմանը։ Սա եղել է առաջին անհատական ձեռնարկատիրությունը Խորհրդային Միությունում Լենինի օրերից ի վեր: «Աբաշայի փորձը» 1980-ական թվականներին տարածվել է Վրաստանի այլ շրջաններում ևս:"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Atsinanana_Khu","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Madagascar-Atsinanana_Region.png","page_title":"Atsinanana Khu","context_page_description":"Atsinanana sī Madagascar ê chi̍t ê khu; khah-chá sio̍k tī Toamasina Séng."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%B8%E0%A7%8D%E0%A6%96%E0%A6%BE%E0%A6%B0%E0%A6%BF%E0%A6%A8%E0%A6%B8%E0%A7%8D%E0%A6%95%E0%A6%BE_%E0%A6%AD%E0%A6%BF%E0%A6%B2%E0%A6%BE%E0%A6%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Scharinska_Villan.jpg","page_title":"স্খারিনস্কা ভিলান","context_page_description":"স্খারিনস্কা ভিলান ডলবেনস পার্কের পরে উমিয়া, সুইডেনের ৬৩-৬৫ স্টোরগাটান -এ অবস্থিত একটি গোলাপি ভবন। স্খারিনস্কা ভিলান-এর নকশা করেন স্থপতি র‍্যাগনার ওস্টবার্গ এবং ১৯০৪-১৯০৫ সালে এগিল উনান্ডার-স্খারিন ও তার পরিবারের এর পরিকল্পনা করেন। ১৯৫০ সালের দিকে ভবনটি এবি স্খারিনস সোনার এর পারিবারিক ব্যবসাকে ধারণ করত।"},{"page_url":"https://sv.wikipedia.org/wiki/Metsamor_(antik_stad)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/%D5%84%D5%A5%D5%AE%D5%A1%D5%B4%D5%B8%D6%80_03.JPG","page_title":"Metsamor (antik stad)","context_page_description":"Metsamor är en tidigare ort i provinsen Armawir. Platsen var bebyggd från bronsåldern till 1600-talet efter Kristus.\\nDet forntida Metsamor ligger omkring 35 kilometer sydväst om Jerevan inom byn Taroniks område på stranden av floden Metsamor i närheten av den moderna staden Metsamor. Den anlades vid en knutpunkt av handelsvägar, vilka löpte över Araratslätten och som förband Centralasien med norra Kaukasus. Runtom staden sträcker sig en bördig och vattenrik trakt."},{"page_url":"https://en.wikipedia.org/wiki/List_of_lighthouses_in_Ukraine","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/%D0%9C%D0%B5%D0%B3%D0%B0%D0%BD%D0%BE%D0%BC%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B0%D1%8F%D0%BA.jpg","page_title":"List of lighthouses in Ukraine","context_page_description":"This is a list of lighthouses in Ukraine. All lighthouses are controlled by the Ukrainian state institution Derzhhidrohrafiya. There are over 100 lighthouses in Ukraine, five of them were taken over by Russia during the 2014 Russian intervention in Ukraine.\\nThe Derzhhidrohrafiya divides its area of responsibilities over the lighthouses into several districts. There are four existing raions, operations two of which is temporarily suspended. In 2017 there was an additional raion created along Dnieper, Dnieper Raion."},{"page_url":"https://fi.wikipedia.org/wiki/Polkupy%C3%B6r%C3%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/William_Cameron_McCool-Bike.jpg","page_title":"Polkupyörä","context_page_description":"Polkupyörä on lihasvoimalla toimiva ajoneuvo, jonka rakenne perustuu yleensä kahteen peräkkäiseen pyörään, jotka yhdistää runko. Polkupyörää liikutetaan pyörittämällä polkimia jaloilla. Polkimista voima siirtyy ketjun välityksellä takapyörään. Voimansiirrossa on käytetty myös nivelakselia ja polkimet voidaan asentaa suoraan pyörän akselille. Kuljettaja joko istuu polkupyörän satulalla, istuimella tai seisoo polkimilla. Polkupyörää ohjataan kääntämällä ohjaustankoa sekä kallistamalla koko pyörää. On olemassa myös yksi- ja kolmipyöräisiä, sekä käsikammista liikevoimansa saavia polkupyöriä.\\nPolkupyörän hyötysuhde on hyvä koska kaikki käytettävä voima ohjataan renkaan pyörittämiseen ja liikekitka on pieni. Pyöräily kuluttaa matkaan nähden huomattavasti vähemmän energiaa kuin esimerkiksi juokseminen tai kävely. Kilometrin matkalla vauhdilla 16 km/h pyöräilevä kuluttaa 0,9 kilojoulea energiaa jokaista kehon kilogrammaa kohti, kun vastaavasti juoksija kuluttaa 4,0 kilojoulea.\\nVuonna 1995 polkupyöriä tuotettiin 107 miljoonaa kappaletta. Samana vuonna autoja valmistettiin noin 37 miljoonaa kappaletta."},{"page_url":"https://cs.wikipedia.org/wiki/Pompeius_Trogus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Justin%2C_L%E2%80%99histoire_de_Trogue_Pomp%C3%A9e%2C_impression_Jehan_Olivier%2C_1519_seul_exemplaire_connu.jpg","page_title":"Pompeius Trogus","context_page_description":"Gnaeus Pompeius Trogus byl římský historik keltského původu z konce 1. století př. n. l. Je považován za oficiálního historika Augustovy doby."},{"page_url":"https://en.wikipedia.org/wiki/Rochefort-en-Terre","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Maisons_class%C3%A9es_-_Rochefort-en-Terre.jpg","page_title":"Rochefort-en-Terre","context_page_description":"Rochefort-en-Terre is a commune in the Morbihan department of Brittany in north-western France.\\nRochefort-en-Terre is a designated “Petite Cité de Caractère”.\\nThe medieval chateau located in the town was the home of American painter Alfred Klots. He purchased the chateau in the early 1900s and oversaw its restoration. His son Trafford Klots inherited the chateau and continued to paint there and entertain other visiting artists. After his death his wife donated the building to the French government. In the grounds of the building is the NAIA museum, named after an early twentieth century witch who lived in the town. It houses a small collection of fantasy and kinetic art and sculpture."},{"page_url":"https://fr.wikipedia.org/wiki/Ir%C3%A8ne_N%C3%A9mirovsky","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/BotGardenFomin_DSC_0201-1.jpg","page_title":"Irène Némirovsky","context_page_description":"Irène Némirovsky est une romancière russe d'expression française, née à Kiev le 11 février 1903 et morte le 19 août 1942 à Auschwitz. Auteur à succès dans la France des années 1930 mais oubliée après la Seconde Guerre mondiale, elle est le seul écrivain à qui le prix Renaudot ait été décerné à titre posthume, en 2004, pour son roman inachevé Suite française.\\nIssue d'une famille juive fortunée mais désunie, Irène Némirovsky reçoit une éducation imprégnée de culture française. Lorsque ses parents, fuyant la Révolution russe, s'installent à Paris, elle y mène une vie mondaine et insouciante, avant d'épouser Michel Epstein, émigré russe juif dont elle a deux filles, Denise et Élisabeth. Sa vocation s'affirme précocement. Après le succès de David Golder en 1929, elle ne cesse plus d'écrire, tant par passion que par nécessité financière. Elle tarde à se rendre compte que son amour pour la France et sa place dans le paysage littéraire ne la préserveront pas des lois antijuives du régime de Vichy et de l'occupant allemand : arrêtée en juillet 1942 dans le Morvan, elle meurt du typhus après quelques semaines de détention à Auschwitz ; son mari y est déporté et assassiné en novembre."},{"page_url":"https://de.wikipedia.org/wiki/Bundesnachrichtendienst","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Berlin-Mitte%2C_BND-Zentrale%2C_2012_-_ELB_0002A1AF.jpg","page_title":"Bundesnachrichtendienst","context_page_description":"Der Bundesnachrichtendienst mit Sitz in Berlin ist neben dem Bundesamt für Verfassungsschutz und dem Militärischen Abschirmdienst einer der drei deutschen Nachrichtendienste des Bundes und als einziger deutscher Nachrichtendienst zuständig für die zivile und militärische Auslandsaufklärung. Er unterliegt wie das BfV und der MAD der Kontrolle der Nachrichtendienste. Seit 1990 ist seine Tätigkeit durch das BND-Gesetz geregelt.\\nDer BND ist die einzige dem Bundeskanzleramt unmittelbar nachgeordnete Bundesoberbehörde und beschäftigt etwa 6.500 Mitarbeiter. Innerhalb des Bundeskanzleramtes ist für die Fachaufsicht über den BND sowie für die Koordinierung der drei Nachrichtendienste des Bundes die Abteilung 7 zuständig. Deren Leiter, seit 2018 Bernhard Kotsch, ist der Koordinator der Nachrichtendienste des Bundes. Der BND entstand am 1. April 1956 durch die Übernahme der Organisation Gehlen in den Bundesdienst."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Stendal","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Stendal_Blumenthalstra%C3%9Fe_48_09476308.jpg","page_title":"Liste der Kulturdenkmale in Stendal","context_page_description":"In der Liste der Kulturdenkmale in Stendal sind alle Kulturdenkmale der Hansestadt Stendal und ihrer Ortsteile aufgelistet. Grundlage ist das Denkmalverzeichnis des Landes Sachsen-Anhalt, das auf Basis des Denkmalschutzgesetzes vom 21. Oktober 1991 durch das Landesamt für Denkmalpflege und Archäologie Sachsen-Anhalt erstellt und seither laufend ergänzt wurde."},{"page_url":"https://fr.wikipedia.org/wiki/La_B%C3%A2tie-Neuve","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6a/Map_commune_FR_insee_code_05017.png","page_title":"La Bâtie-Neuve","context_page_description":"La Bâtie-Neuve est une commune française située dans le département des Hautes-Alpes, en région Provence-Alpes-Côte d'Azur.\\nSes habitants sont appelés les Bastidons."},{"page_url":"https://nl.wikipedia.org/wiki/Hongaarse_minderheid_in_Servi%C3%AB","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e6/Vojvodina-Ethnic-2011-op.GIF","page_title":"Hongaarse minderheid in Servië","context_page_description":"De Hongaarse minderheid in Servië woont voornamelijk in de autonome provincie Vojvodina. Deze provincie behoorde tot 1920 tot het Koninkrijk Hongarije binnen de dubbelmonarchie Oostenrijk-Hongarije. Ook tussen 1941 en 1944 behoorde Vojvodina tot Hongarije, waarna het weer onderdeel werd van Joegoslavië.\\nDe Hongaren wonen met name in het noordelijk deel van de provincie en vormen hier in meerdere gemeenten de meerderheid van de bevolking. In de overige delen van Vojvodina komen ook dorpen voor met een Hongaarse meerderheid. Verder zijn er veel steden waar Hongaren een minderheid vormen. Dit is bijvoorbeeld het geval in Novi Sad waar 13.272 Hongaren wonen."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9C%B0%E7%90%83%E3%81%AE%E6%A7%8B%E9%80%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Mohomap.png","page_title":"地球の構造","context_page_description":"地球の構造では、主に地球内部の組成構造について説明する。\\n地球の内部は、球状の層が幾重にも積み重なった構造となっている。外側はケイ酸塩の固体からなる地殻。その下が、高い粘性を持つアセノスフェアとマントル、続いてマントルより粘性がはるかに低い液体の外核、そして中心部は固体で内核と呼ばれる。\\n地球の内部構造の科学的理解は、地形および海底の観測をはじめ、露頭の岩石の観察、火山や火山活動により大深部から地表に出てきたマグマなどのサンプル、地球を通過する地震波の分析、 地球の重力および磁場の測定、地球内深部に固有の圧力と温度における結晶性固体の実験など、さまざまな研究に基づいている。"},{"page_url":"https://sv.wikipedia.org/wiki/Emomalii_Rahmon","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Emomali_Rahmon_%282017-02-27%29.jpg","page_title":"Emomalii Rahmon","context_page_description":"Emomalii Rahmon, tidigare Emomali Sjarifovitj Rahmonov, stundom även stavat Emomalij Rachmonov eller Imomalij Rahmonov, född 5 oktober 1952 i Kulob, är Tadzjikistans president sedan 1994, då den tidigare presidenten, Rahmon Nabijev, avsattes. Rahmon står på god fot med Ryssland och fick rysk hjälp i inbördeskriget 1992 till 1997.\\nI mars 2007 bytte han officiellt namn från det ryskklingande Emomali Rahmonov till Emomalii Rahmon, som uppfattas som mer traditionellt, och uppmanade invånarna i landet att göra detsamma."},{"page_url":"https://sv.wikipedia.org/wiki/Iguala_de_la_Independencia_(kommun)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/89/Iguala_de_la_Independencia_vista_2005.JPG","page_title":"Iguala de la Independencia (kommun)","context_page_description":"Iguala de la Independencia är en kommun i Mexiko. Den ligger i delstaten Guerrero, i den södra delen av landet, 130 km söder om huvudstaden Mexico City. Antalet invånare är 140 363. Arean är 567 kvadratkilometer.\\nTerrängen i Iguala de la Independencia är kuperad åt sydost, men åt nordväst är den bergig.\\nFöljande samhällen finns i Iguala de la Independencia:\\nIguala de la Independencia\\nFermín Rabadán Cervantes\\nColonia 15 de Septiembre\\nColonia Francisco Villa\\nColonia Rancho del Cura\\nColonia Loma de los Coyotes\\nColonia California\\nColonia Renacimiento\\nColonia Vista Hermosa\\nEl Mezquite\\nOlea\\nColonia Santa Elena\\nI övrigt finns följande i Iguala de la Independencia:\\nKullar:\\nCerro del Pueblo\\nCerro El Chirimio\\nCerro Tranca Vieja\\nLa Cruz\\nBerg:\\nCerro El Jumil\\nCerro El Mapache\\nCerro El Toro\\nCerro El Uchal\\nCerro Grande\\nCerro Grande\\nCerro La Campana\\nCerro La Cruz\\nCerro La Gavia\\nCerro Las Azucenas\\nCerro Las Lagunas\\nCerro Las Uvas\\nCerro León\\nCerro Prieto\\nCerro Redondo\\nCerro Rosa Colorada\\nEl Tehuehue\\nSavannklimat råder i trakten. Årsmedeltemperaturen i trakten är 26 °C. Den varmaste månaden är april, då medeltemperaturen är 33 °C, och den kallaste är augusti, med 22 °C."},{"page_url":"https://es.wikipedia.org/wiki/T%C3%ADmpano_(arquitectura)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/ParthenonFrise1.jpg","page_title":"Tímpano (arquitectura)","context_page_description":"En arquitectura, se denomina tímpano, palabra proveniente del griego τύμπανον y del latín tympanum, ​ al espacio delimitado entre el dintel y las arquivoltas de la fachada de una iglesia o el arco de una puerta o ventana. También es el espacio cerrado delimitado dentro del frontón en los templos clásicos.\\nSe encuentra en el Antiguo Egipto en la primera mitad del siglo III a.C. Más tarde se encuentra en la arquitectura griega, luego en la cristiana y en la arquitectura islámica.​\\nEl tímpano se presenta decorado con relieves como ocurre en los templos griegos, donde solía contener escenas religioso-mitológicas, o en las iglesias y catedrales del románico y del gótico, en las que solía mostrar escenas y motivos de la fe cristiana.​\\nEn el caso del románico y el gótico, aparece delimitado por el dintel y las arquivoltas.​ Puede aparecer también en un gablete.​"},{"page_url":"https://fi.wikipedia.org/wiki/Les_Indes_galantes","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/PaiviPylvanainenHebeLesIndesGalantesHelsinki2013.JPG","page_title":"Les Indes galantes","context_page_description":"Les Indes galantes on Jean-Philippe Rameaun säveltämä balettiooppera, joka koostuu prologista ja neljästä näytöksestä. Jokainen näytös on erillinen pikku tarina, jolla ei ole juonellista yhteyttä muihin näytöksiin. Teoksen libreton on kirjoittanut Louis Fuzelier. Les Indes galantes kantaesitettiin Pariisin Kuninkaallisessa musiikkiakatemiassa 23. elokuuta 1735."},{"page_url":"https://en.wikipedia.org/wiki/Romuva_(temple)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Romuva_sanctuary.jpg","page_title":"Romuva (temple)","context_page_description":"Romuva or Romowe was an alleged pagan worship place in the western part of Sambia, one of the regions of pagan Prussia. In contemporary sources the temple is mentioned only once, by Peter von Dusburg in 1326. According to his account, Kriwe-Kriwajto, the chief priest or \\"pagan pope\\", lived at Romuva and ruled over the religion of all the Balts. According to Simon Grunau, the temple was central to Prussian mythology. Even though there are considerable doubts whether such a place actually existed, the Lithuanian neo-pagan movement Romuva borrowed its name from the temple."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B8%E3%82%A2%E3%83%BC%E3%83%89%E9%83%A1%E5%8C%BA_(%E3%82%A2%E3%82%A4%E3%82%AA%E3%83%AF%E5%B7%9E%E3%82%AF%E3%83%AC%E3%82%A4%E3%83%88%E3%83%B3%E9%83%A1)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/02/Map_highlighting_Giard_Township%2C_Clayton_County%2C_Iowa.svg","page_title":"ジアード郡区 (アイオワ州クレイトン郡)","context_page_description":"ジアード郡区 は、アメリカ合衆国アイオワ州クレイトン郡にある郡区。2000年国勢調査では、人口は463人。"},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_biens_class%C3%A9s_de_la_Communaut%C3%A9_fran%C3%A7aise","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/La_Vierge.jpg","page_title":"Liste des biens classés de la Communauté française","context_page_description":"La liste des biens classés de la Communauté française de Belgique est une liste de biens considérés comme exceptionnels situés en Région wallonne et en Région de Bruxelles-Capitale."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%8D%A1%E7%88%BE%E5%8D%A1%E6%8B%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Sudika_Kalkara_church.jpg","page_title":"卡爾卡拉","context_page_description":"卡爾卡拉是馬爾他東南區的一個村莊，2014年3月時有人口3,014人。該村名字出自拉丁語的「石灰」，人們認為該地自羅馬時期以來就一直存在有一處石灰窯。卡爾卡拉也是內灣區的一部分，毗鄰卡爾卡拉谷。該村有著自己的地方委員會，與比爾古市、扎巴爾市和Xgħajra鎮接壤。"},{"page_url":"https://ceb.wikipedia.org/wiki/Bodonci","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/O%C5%A0_in_cerkev_Bodonci.jpg","page_title":"Bodonci","context_page_description":"Lungsod ang Bodonci sa Esklobeniya. Nahimutang ni sa munisipyo sa Puconci, sa amihanan-sidlakang bahin sa nasod, 140 km sa amihanan-sidlakan sa Ljubljana ang ulohan sa nasod. 312 metros ibabaw sa dagat kahaboga ang nahimutangan sa Bodonci, ug adunay 431 ka molupyo.\\nAng yuta palibot sa Bodonci kay kasagaran medyo bungtoron. Bodonci nahimutang sa usa ka gitas-on. Ang kinahabogang dapit sa palibot dunay gihabogon nga 352 ka metro ug 1.7 km sa amihanan sa Bodonci. Dunay mga 476 ka tawo kada kilometro kwadrado sa palibot sa Bodonci nga hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Murska Sobota, 10.7 km sa habagatan-sidlakan sa Bodonci. Hapit nalukop sa kaumahan ang palibot sa Bodonci.\\nAng klima hemiboreal. Ang kasarangang giiniton 10 °C. Ang kinainitan nga bulan Hulyo, sa 22 °C, ug ang kinabugnawan Enero, sa -5 °C. Ang kasarangang pag-ulan 1,207 milimetro matag tuig. Ang kinabasaan nga bulan Septiyembre, sa 165 milimetro nga ulan, ug ang kinaugahan Disyembre, sa 54 milimetro."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BE%D0%BB%D0%BE%D0%B4%D0%BE%D0%B2%D0%BA%D0%B0_(%D0%A1%D1%83%D0%BC%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Burynskij_rajon.PNG","page_title":"Молодовка (Сумская область)","context_page_description":"Молодовка — село,\\nСнежковский сельский совет,\\nБурынский район,\\nСумская область,\\nУкраина.\\nКод КОАТУУ — 5920986403. Население по переписи 2001 года составляло 37 человек."},{"page_url":"https://fr.wikipedia.org/wiki/Chapelle-Voland","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/%C3%89glise_Assomption_Bienheureuse_Vierge_Marie_Chapelle_Voland_3.jpg","page_title":"Chapelle-Voland","context_page_description":"Chapelle-Voland est une commune française située dans le département du Jura, en région Bourgogne-Franche-Comté."},{"page_url":"https://pl.wikipedia.org/wiki/Aleksy_II_(patriarcha_Moskwy)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/P%C3%BChtitsa_Jumalaema_Uinumise_peakirik.jpg","page_title":"Aleksy II (patriarcha Moskwy)","context_page_description":"Aleksy II, imię świeckie Aleksiej Michajłowicz Ridigier – piętnasty patriarcha moskiewski i całej Rusi, zwierzchnik Rosyjskiego Kościoła Prawosławnego w latach 1990–2008.\\nUrodził się w rodzinie rosyjskich emigrantów żyjących w Estonii, jego ojciec od 1942 był prawosławnym duchownym. W 1949 ukończył seminarium duchowne w Leningradzie, a następnie podjął wyższe studia teologiczne na Leningradzkiej Akademii Duchownej. 11 kwietnia 1950 ożenił się z Wierą Aleksiejewą, po czym 16 kwietnia 1950 przyjął święcenia kapłańskie i został proboszczem parafii w Jõhvi. Jeszcze w tym samym roku małżeństwo Ridigierów zostało rozwiązane. W 1959, będąc proboszczem parafii w Tartu, złożył wieczyste śluby mnisze, przyjmując imię Aleksy. Dwa lata później został wyświęcony na biskupa tallińskiego i estońskiego, w 1964 został podniesiony do godności arcybiskupiej, zaś w 1968 – do godności metropolity. Od 1961 do 1985 pełnił ponadto obowiązki kanclerza Kościoła.\\nW 1985 objął katedrę leningradzką. Pięć lat później, po śmierci patriarchy Pimena, został wybrany na jego następcę."},{"page_url":"https://en.wikipedia.org/wiki/Rudolf_John_Gorsleben","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2e/Rudolf_John_Gorsleben.jpg","page_title":"Rudolf John Gorsleben","context_page_description":"Rudolf John Gorsleben was a German Ariosophist, Armanist, journal editor and playwright."},{"page_url":"https://de.wikipedia.org/wiki/Costic%C4%83_Dafinoiu","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Costica_Dafinoiu.jpg","page_title":"Costică Dafinoiu","context_page_description":"Costică Dafinoiu ist ein ehemaliger rumänischer Boxer. Dafinoiu war Europameister 1974 und Bronzemedaillengewinner der Olympischen Spiele 1976."},{"page_url":"https://nl.wikipedia.org/wiki/Ganzenvoet","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f4/Chenopodium_quinoa0.jpg","page_title":"Ganzenvoet","context_page_description":"Ganzenvoet is een geslacht uit de Amarantenfamilie. Het geslacht telt zo'n honderd soorten, die voornamelijk in gematigde streken voorkomen. De naam ganzenvoet refereert aan de bladvorm van sommige soorten. Chenopodium is een samenstelling van χήν, 'chēn' en πόδιον, podion."},{"page_url":"https://fr.wikipedia.org/wiki/Ligne_4_du_m%C3%A9tro_de_Paris","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Paris_-_Les_travaux_du_Metropolitain_place_Saint-Michel.jpg","page_title":"Ligne 4 du métro de Paris","context_page_description":"La ligne 4 du métro de Paris est l'une des seize lignes du réseau métropolitain de Paris. Entièrement située dans les limites de la capitale durant plus d'un siècle depuis sa création, elle relie désormais le terminus nord Porte de Clignancourt au terminus sud Mairie de Montrouge et traverse le cœur de Paris. Longue de 12,1 kilomètres, elle est en correspondance avec toutes les autres lignes de métro et toutes les lignes de RER. Elle est également la deuxième ligne la plus fréquentée du réseau après la ligne 1, avec 172 millions de voyageurs en 2010. La ligne 4 est la première à relier la rive droite à la rive gauche de la Seine par une traversée sous-fluviale, occasionnant de 1905 à 1907 au cœur même de la capitale des travaux spectaculaires.\\nElle est la ligne du métro de Paris où il faisait le plus chaud car les rames sur pneus, les MP 59 anciennement en service sur la ligne, plus puissantes que les anciennes rames sur fer, gaspillaient de l'énergie au démarrage en raison de l'utilisation d'un rhéostat dissipant beaucoup de chaleur. En outre, le parcours entièrement souterrain contribue à la non-dissipation de la chaleur."},{"page_url":"https://en.wikipedia.org/wiki/Red-rumped_woodpecker","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Red-Rumped_Woodpecker_%28Veniliornis_kirkii%29.jpg","page_title":"Red-rumped woodpecker","context_page_description":"The red-rumped woodpecker is a resident breeding bird from Costa Rica south and east to Ecuador, Venezuela, Trinidad and Tobago.\\nThe habitat of this small woodpecker is forests, more open woodland, and cultivation. Two or three white eggs are laid in a nest hole in a dead tree.\\nThe red-rumped woodpecker is 16.5 cm long and weighs 28g. Adults are mainly golden-olive above with a few buff spots on the wings, and a red rump. Their buff-white underparts are finely barred with dark brown, and the tail is blackish brown. The bill is black.\\nAdult males have a red crown and yellow nape. In adult females, the crown is dark brown and the nape orange-brown.\\nRed-rumped woodpeckers mainly eat insects. The call of this bird is a repeated quee-quee-quee. Both sexes drum rapidly."},{"page_url":"https://pl.wikipedia.org/wiki/Cesarze_bizanty%C5%84scy","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Solidus-Leo_III_and_Constantine_V-sb1504.jpg","page_title":"Cesarze bizantyńscy","context_page_description":"Dynastia Laskarysów panowała tylko w Cesarstwie Nicejskim"},{"page_url":"https://en.wikipedia.org/wiki/List_of_Tamil_film_actors","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Prabhu_at_Wagah_Audio_Launch.jpg","page_title":"List of Tamil film actors","context_page_description":"This list outlines the names of popular lead film actors, who previously worked or are currently working in the Tamil film industry, based in Chennai, Tamil Nadu, India. The list is ordered by the year of their debut as a leading actor or the year of their landmark film. Actors who have starred in at least five films as lead are included in the list."},{"page_url":"https://it.wikipedia.org/wiki/Turchia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Orhan_pamuk_u01_72.jpg","page_title":"Turchia","context_page_description":"La Turchia è uno Stato transcontinentale il cui territorio si estende per la maggior parte nella penisola anatolica, nell'Asia occidentale, e comprende anche una parte europea: l'estrema parte orientale della Tracia, detta anche Turchia europea. È cinta a sud dal Mar di Levante, ad ovest dal Mar Egeo e a nord dal Mar Nero; il Mar di Marmara separa la Turchia europea dalla penisola anatolica. Confina a nord-ovest con la Grecia e la Bulgaria, a nord-est con la Georgia, ad est con l'Armenia, l'Azerbaigian e l'Iran, a sud-est con l'Iraq e a sud con la Siria. In Turchia si trova l'estremità più occidentale del continente asiatico.\\nL'attuale territorio turco, specialmente la parte occidentale, ponte naturale tra oriente e occidente, è stato sede di una ricca varietà di popolazioni e civiltà. Fin dal 6500 a.C. si sono succeduti Hatti, Ittiti, Frigi, Urartici, Lici, Lidi, Ioni, Persiani, Macedoni, i regni ellenistici, Romani, Parti, Sasanidi, Bizantini, i crociati e le repubbliche marinare di Venezia e Genova, Selgiuchidi ed Ottomani, i quali hanno assunto un importante posto nella storia della Turchia moderna."},{"page_url":"https://br.wikipedia.org/wiki/Jorge_Oteiza","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/Ayuntamiento-bilbao1.jpg","page_title":"Jorge Oteiza","context_page_description":"Jorge Oteiza Enbil zo ur c'hizeller hag ur skrivagner euskarek, ganet en Orio. E 1935 ez eas da Amerika ar Su, ma chomas 14 vloaz, hep gwelout ar brezel-diabarzh eta.\\nE 1963 ec'h embannas Quosque tandem!, un arnodskrid diwar-benn kenedouriezh un arz euskarat gwriziennet en ene euskarat, emezañ, ha diazezet war an arz ragistorel.\\nMervel a reas e Donostia ma voe digoret ur mirdi, miz war-lerc'h, dediet d'e oberenn, ar Museo Oteiza."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E7%81%AB%E6%98%9F%E6%B0%A3%E5%80%99%E6%8E%A2%E6%B8%AC%E8%80%85%E8%99%9F","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/19/Mars_Climate_Orbiter_2.jpg","page_title":"火星氣候探測者號","context_page_description":"火星气候探测者号是美国国家航空航天局的火星探测卫星，也是火星探测98计划的一部分，于1998年发射升空。天文学家计划利用火星气候探测者号来研究火星大气层、火星气候及火星地表，并帮助火星极地着陆者号与地球来通讯。不过火星气候探测者号后来在1999年9月23日在进入火星轨道的过程中失去联络，最终任务失败。"},{"page_url":"https://gl.wikipedia.org/wiki/Ben_Ainslie","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Sir_Charles_Benedict_Ainslie_in_2014.jpg","page_title":"Ben Ainslie","context_page_description":"Charles Benedict Ainslie, nado en Macclesfield o 5 de febreiro de 1977, é un deportista británico que competiu en vela nas clases Laser, Laser Radial e Finn.\\nParticipou en cinco Xogos Olímpicos, en que obtivo en total cinco medallas: prata en Atlanta 1996, ouro en Sydney 2000, ouro en Atenas 2004, ouro en Pekín 2008 e ouro en Londres 2012.\\nEn catro ocasión foi nomeado Regatista Mundial do Ano pola Federación Internacional de Vela."},{"page_url":"https://pt.wikipedia.org/wiki/Lamas_de_Mouro","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Lamas_de_Mouro_-_panoramio_%284%29.jpg","page_title":"Lamas de Mouro","context_page_description":"Lamas de Mouro é uma antiga freguesia portuguesa do concelho de Melgaço, com 17,31 km² de área e 117 habitantes. A sua densidade populacional era de 6,8 h/km². Como freguesia foi extinta e agregada pela reorganização administrativa de 2012/2013, sendo o seu território integrado na União de Freguesias de Castro Laboreiro e Lamas de Mouro."},{"page_url":"https://hu.wikipedia.org/wiki/R%C3%B3zsasz%C3%ADn_zaj","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Pink_noise_spectrum.png","page_title":"Rózsaszín zaj","context_page_description":"A pink zaj, vagy más néven 1/f zaj, olyan zaj, melynek a teljesítményspektrum sűrűsége fordítottan arányos a frekvenciával. Minden oktáv egyenlő mértékű teljesítménnyel rendelkezik. Az elnevezés a látható fény pink spektrumából származik.\\nKissé lazább megfogalmazásban az 1/f zajt a következő formában is kifejezik:\\nahol f a frekvencia, és 0 < α < 2, ahol α általában közel 1. Az α 1 közeli értéke kvázi-egyensúlyi rendszereknél figyelhető meg, míg α szélesebb értékei a nem egyensúlyban lévő dinamikus rendszerek jellemzője.\\nAz 1/f zajt szokták flickerzajnak is hívni, habár a flickerzaj elnevezést általában elektronikus készülékeknél használják, ahol az egyenáram okozza ezt a zajt. Ritkábban fraktális zajnak is hívják, mely arra utal, hogy a spektrum kitevője nem egész értékeket is felvehet, és kapcsolatban van a fraktális Brown-mozgással.\\nÁllandó sávszélességen, a pink zajt az jellemzi, hogy energiája 3 dB-lel csökken oktávonként. Magasabb frekvenciákon nem domináns."},{"page_url":"https://pt.wikipedia.org/wiki/Hagensia","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/64/Pachycondyla_havilandi_sam-hym-c005378a_profile_1.jpg","page_title":"Hagensia","context_page_description":"Hagensia é um pequeno gênero de formigas na subfamília Ponerinae. Suas duas espécies foram observadas somente em áreas costeiras da África do Sul. Operários possuem de 10,3 a 13 mm de comprimento; as rainhas nunca foram observadas, mas gamergates foram observadas nas duas espécies."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%AE%E0%B5%81%E0%B4%9F%E0%B5%8D%E0%B4%9F%E0%B4%BE%E0%B4%A3%E0%B4%BF%E0%B4%B6%E0%B5%8D%E0%B4%B6%E0%B5%87%E0%B4%B0%E0%B4%BF%E0%B5%BD_%E0%B4%8E%E0%B4%82._%E0%B4%95%E0%B5%8B%E0%B4%AF%E0%B4%BE%E0%B4%95%E0%B5%8D%E0%B4%95%E0%B5%81%E0%B4%9F%E0%B5%8D%E0%B4%9F%E0%B4%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Muttanisseriyil_Koyakkutty3.jpg","page_title":"മുട്ടാണിശ്ശേരിൽ എം. കോയാക്കുട്ടി","context_page_description":"കേരളത്തിലെ ഒരു ഇസ്ലാമിക പണ്ഡിതനും എഴുത്തുകാരനുമാണ്‌ മുട്ടാണിശ്ശേരിൽ എം. കോയാക്കുട്ടി. ഖുർആൻ ശാസ്ത്ര ഗവേഷണത്തിലൂടെയും പ്രഭാഷണങ്ങളിലൂടെയും ഗ്രന്ഥരചനകളിലൂടെയും മഹത്തായ സംഭാവനകൾ നല്കിയിട്ടുണ്ട്. ഭൗതികശാസ്ത്രത്തിൽ ബിരുദം നേടിയ ഇദ്ദേഹത്തിന് ഇസ്ലാമിക വിഷയങ്ങളിലും പാണ്ഡിത്യമുണ്ട്.1967ൽ കേരള സാഹിത്യ അക്കാദമിയുടെ മികച്ച തർജമക്കുള്ള അവാർഡ് കരസ്ഥമാക്കിയ ഇദ്ദേഹം വാർദ്ധക്യത്തിലും കർമ്മനിരതനായിരുന്നു 2013 മെയ് 27 ന് അന്തരിച്ചു‌."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%96%E3%83%AB%E3%82%AF%E5%8A%87%E5%A0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Michaelerplatz_altes_Burgtheater.jpg","page_title":"ブルク劇場","context_page_description":"ブルク劇場は、オーストリアのウィーンにある、ドイツ語圏で重要な劇場である。"},{"page_url":"https://de.wikipedia.org/wiki/Skulpturensammlung_(Dresden)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Rodin_Denker.jpg","page_title":"Skulpturensammlung (Dresden)","context_page_description":"Die Skulpturensammlung in Dresden ist eine Sammlung von Bildhauerwerken aus fünf Jahrtausenden. Die Antikensammlung ist eine der größten und ältesten Antikensammlungen außerhalb Italiens. Neben den Skulpturen gehören auch Vasen, Terrakotten, Bronzen, assyrische Relieftafeln und ägyptische Mumien zur Sammlung.\\nDie Skulpturensammlung gehört zu den Staatlichen Kunstsammlungen Dresden. Sie ist seit 1894 im Albertinum untergebracht."},{"page_url":"https://en.wikipedia.org/wiki/Kure,_Hiroshima","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Yamato_Museum_Exterior.jpg","page_title":"Kure, Hiroshima","context_page_description":"Kure is a port and major shipbuilding city situated on the Seto Inland Sea in Hiroshima Prefecture, Japan. With a strong industrial heritage, Kure hosts the second-oldest naval dockyard in Japan and remains an important base for the Japan Maritime Self-Defence Force.\\nAs of 1 May 2015, the city has an estimated population of 228,030 and a population density of 646 persons per km². The total area is 352.80 km²."},{"page_url":"https://es.wikipedia.org/wiki/Parroquia_Atahualpa_(Santa_Elena)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Iglesia_Atahualpa.jpg","page_title":"Parroquia Atahualpa (Santa Elena)","context_page_description":"Atahualpa es una de las 6 parroquias rurales que conforman el cantón Santa Elena perteneciente a la provincia del mismo nombre, conocida también como la ‘Capital o Imperio del Mueble’, ​ La cabecera parroquial está ubicada a 17 km de Santa Elena y a 5 km de la vía Salinas - Guayaquil. La parroquia athahualpa de santa elena era antes un recinto \\"Engabao\\" el 11 de febrero de 1941 mediante ordenanza municipal; tiene una extensión territorial de 94.14 km², su densidad poblacional es de 108.84 hab. Por km² y tiene una sola comuna conocido como Entre Ríos.​"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D0%BA%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D1%84%D0%B8%D1%86%D0%B5%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D1%88%D0%BA%D0%BE%D0%BB%D0%B0_%D0%BC%D0%BE%D1%80%D1%81%D0%BA%D0%BE%D0%B9_%D0%B0%D0%B2%D0%B8%D0%B0%D1%86%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Antonenko_Pilot.jpg","page_title":"Бакинская офицерская школа морской авиации","context_page_description":"Баки́нская офице́рская шко́ла морско́й авиа́ции — второе учебное заведение Российской империи, предназначенное для подготовки офицеров по специальности «морской лётчик» и относящееся к системе специализированной подготовки офицеров военно-морского флота.\\nНачала свою работу в 1915 году как филиал Офицерской школы морской авиации, впервые открытой несколькими месяцами раньше в Петрограде. Получила самостоятельность в 1917 году."},{"page_url":"https://fr.wikipedia.org/wiki/Moridae","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/PZSL1889Plate34.png","page_title":"Moridae","context_page_description":"Les Moridae sont une famille de poissons osseux à nageoires rayonnées appartenant à l'ordre des Gadiformes."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9D%CE%B1%CE%B6%CE%B1%CF%81%CE%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Nazare.sitio.from.pederneira.jpg","page_title":"Ναζαρέ","context_page_description":"Η Ναζαρέ είναι πόλη της Κεντρικής Πορτογαλίας και ανήκει διοικητικά στο Δήμο της Ναζαρέ. Έχει συνολική έκταση 82.4 km² και πληθυσμό 15.158 κατοίκων. Βρίσκεται στην πορτογαλική υποπεριφέρεια Oeste.\\nΗ πόλη αποτελείται από τρεις περιοχές: την Πράια, το Σίτιου και την Πεδερνέιρα. Οι περιοχές Πράια και Σίτιου ενώνονται με το τελεφερίκ της Ναζαρέ."},{"page_url":"https://pl.wikipedia.org/wiki/Niederschlesischer_Oberlausitzkreis","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1a/Lage_des_Niederschlesischen_Oberlausitzkreises_in_Deutschland.png","page_title":"Niederschlesischer Oberlausitzkreis","context_page_description":"Niederschlesischer Oberlausitzkreis – były powiat w rejencji Drezno w niemieckim kraju związkowym Saksonia. Siedzibą Niederschlesischer Oberlausitzkreis było Niska. Od 1 sierpnia 2008 obszar powiatu wchodzi do nowo powstałego powiatu Görlitz."},{"page_url":"https://fi.wikipedia.org/wiki/Fekalooma","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/X-ray_showing_fecalith_which_has_caused_appendicitis.jpg","page_title":"Fekalooma","context_page_description":"Fekalooma on suoliston ulostekivettymä, joka voi kehittyä esimerkiksi ummetuksen aiheuttaman ulostetukkeuman eli -impaktion kovettuessa. Fekalooma voi aiheuttaa suolistossa haavauman tai puhkeuman; sen ja ulostetukkeuman mahdollisia komplikaatioita ovat myös tulehdus peräsuolessa, peräpukamien paheneminen ja peräsuolen esiinluiskahtaminen. Erilaisia virtsateihin liittyviä oireita voi esiintyä niihin kohdistuvan painevaikutuksen johdosta. Tuntuessaan vatsan päällä fekalooma voi aiheuttaa epäilyn kasvaimesta.\\nFekaloomasta käytetään myös nimityksiä koprooma, skatooma, ulostepahka, fekaliitti ja koproliitti."},{"page_url":"https://de.wikipedia.org/wiki/Zentralkordillere_(Kolumbien)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Paramosonson.JPG","page_title":"Zentralkordillere (Kolumbien)","context_page_description":"Die Cordillera Central in Kolumbien ist eine der drei wichtigen Bergketten vulkanischen Ursprungs in Südamerika und ein Zweig der Andenkordillere die sich im Süden Kolumbiens zwischen die westliche und östliche Kordillere schiebt. Die Zentralkordillere ist die mit den höchsten Erhebungen. Ihre Berge können bis zu 5000 m ü. NN liegen und waren für Kolumbien schon immer ein historisches Hindernis für die wirtschaftliche Entwicklung und die kulturelle Verbindung der Nation."},{"page_url":"https://sh.wikipedia.org/wiki/Tiger_II","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3f/88x822-mm-R_Granatpatrone_Munster.jpg","page_title":"Tiger II","context_page_description":"Tiger II ili službenim nazivom Panzerkampfwagen Tiger Ausf. B je bio njemački teški tenk u Drugom svjetskom ratu. Poznat je i pod nazivom Königstiger što se kod Saveznika često prevodilo kao Kraljevski Tigar.\\nDizajn tenka slijedi isti koncept kao i kod njegovog prethodnika Tiger I, ali s ciljem da bude još teži. Tako Tiger II kombinira osobine debelog oklopa Tiger I tenka sa nakošenim oklopom Panther tenka. Njegova težina doseže gotovo 70 tona, što je bio i njegov najveći problem jer je malo koji most mogao izdržati toliku težinu. Time je transport do bojišta bio vrlo kompliciran. Šasija Tigera II je poslužila za konstruiranje lovca tenkova Jagdtigera koji je bio najteže njemačko oklopno vozilo korišteno u borbama u Drugom svjetskom ratu.\\nDebljina oklopa sprijeda je bila do 180 mm, a glavno oružje je činio 88 mm Kampfwagenkanone 43 L/71 top koji je zapravo bio produžena verzija topa sa Tigera I. Tiger II tenkovi su se nalazili u sastavu teških oklopnih bojni i u jedinicama Waffen SS. Prvi puta su korišteni u borbi u sklopu 503. teške oklopne bojne prilikom savezničkog iskrcavanja u Normandiji 11. 7. 1944."},{"page_url":"https://en.wikipedia.org/wiki/Three_Crowns","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Three_crowns_emblem.jpg","page_title":"Three Crowns","context_page_description":"Three Crowns is the national emblem of Sweden, present in the coat of arms of Sweden, and composed of three yellow or gilded coronets ordered two above and one below, placed on a blue background.\\nThe emblem is often used as a symbol of official State authority by the Monarchy, the Riksdag, the Government of Sweden and by Swedish embassies around the world, but also appears in other less formal contexts, such as the Sweden men's national ice hockey team, who wear the symbol on their sweaters and hence are called \\"Three Crowns\\", and atop the Stockholm City Hall. The Three Crowns are also used as the roundel on military aircraft of the Swedish Air Force and as a sign on Swedish military equipment in general, and also on the uniforms and vehicles of the Swedish Police Authority.\\nBecause of their Scandinavian origin, the Three Crowns are also lesser-known features in the royal coat of arms of Denmark where they might be referred to as the \\"union mark\\"."},{"page_url":"https://da.wikipedia.org/wiki/Live_(musikgruppe)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Live_Chili_Cookoff_2008.jpg","page_title":"Live (musikgruppe)","context_page_description":"LIVE er et amerikansk rockband fra York i Pennsylvania i USA."},{"page_url":"https://en.wikipedia.org/wiki/2020_Libertarian_Party_presidential_primaries","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Sam_Robb_Campaign_Logo_for_2020_candidacy.png","page_title":"2020 Libertarian Party presidential primaries","context_page_description":"The 2020 Libertarian Party presidential primaries and caucuses were a series of electoral contests to indicate non-binding preferences for the Libertarian Party's presidential candidate in the 2020 United States presidential election. These differ from the Republican or Democratic presidential primaries and caucuses in that they do not appoint delegates to represent a candidate at the party's convention to select the party's presidential nominee.\\nThe party's nominee was subsequently chosen directly by registered delegates at the 2020 Libertarian National Convention, held through an online convention from May 22 to May 24. Jo Jorgensen was chosen as the party's presidential nominee, becoming the first woman to receive the Libertarian nomination, after four rounds of voting. Spike Cohen was nominated for vice president."},{"page_url":"https://be.wikipedia.org/wiki/%D0%AF%D0%BD_%D0%9A%D1%88%D0%B0%D0%BF%D1%82%D0%BE%D1%9E%D1%81%D0%BA%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Sabala-S.Bizanski.jpg","page_title":"Ян Кшаптоўскі","context_page_description":"Ян Кшаптоўскі ці Саба́ла, Саба́лік — польскі паэт, гуральскі пясняр, расказчык і музыкант, горны праваднік. Прозвішча «Кшаптоўскі» Ян узяў сабе ў сталым узросце. Ян, як і многія гуралі таго часу, жыў пад мянушкай «Сабала, Сабалік» і паходзіў з гуральскага роду Гансяніцаў."},{"page_url":"https://en.wikipedia.org/wiki/Owens_pupfish","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Owens_pupfish_%28Cyprinodon_radiosus%29.jpg","page_title":"Owens pupfish","context_page_description":"The Owens pupfish is a rare species of fish in the family Cyprinodontidae, the pupfish. It is endemic to California in the United States, where it is limited to the Owens Valley. It is a federally listed endangered species of the United States. This pupfish is up to 5 centimetres long, the largest males sometimes longer. The male is blue-gray, turning bright blue during spawning. The female is greenish brown with a silvery or whitish belly.\\nThe pupfish tolerates a wide range of water conditions. Its native habitat includes desert marshes with water temperatures up to 33 °C in the summer and layers of ice during the winter. The water in some areas has four times the salt content of the ocean, as well as low oxygen.\\nThis fish was once common in the Owens Valley of California, occurring in most water bodies between Fish Slough and Lone Pine, which are 70 miles apart. It occurred in the Owens River and associated sloughs and marshes. At that time the Paiute people scooped them out of the water and dried them for the winter."},{"page_url":"https://en.wikipedia.org/wiki/Guy_Lalibert%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Guy_Laliberte_WPT.jpg","page_title":"Guy Laliberté","context_page_description":"Guy Laliberté, OC CQ is a Canadian billionaire businessman, and poker player. Along with Gilles Ste-Croix, he is the co-founder of Cirque du Soleil. In January 2018, Laliberté was ranked by Forbes as the 11th wealthiest Canadian.\\nFollowing an announcement from Cirque du Soleil in April 2015 concerning a change in ownership, Laliberté will maintain a stake in the business and will continue to provide strategic and creative input to the company.\\nIn 1984, Laliberté founded Cirque du Soleil. The Canadian circus company's shows have since been seen by more than 90 million people worldwide. Prior, he busked, performing as an accordion player, stiltwalker and fire-eater. In 2006, Laliberté was named the Ernst & Young Canadian Entrepreneur of the Year. In 2007, he was named Ernst & Young World Entrepreneur Of The Year."},{"page_url":"https://ko.wikipedia.org/wiki/63%EC%8B%9D_%EB%B3%91%EB%A0%A5%EC%88%98%EC%86%A1%EC%9E%A5%EA%B0%91%EC%B0%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Type_63_APC_at_the_Beijing_Military_Museum_-_above.jpg","page_title":"63식 병력수송장갑차","context_page_description":"63식 병력수송장갑차는 1960년 말부터 배치된 중화인민공화국의 병력 수송 장갑차이다. K-63, M1967, M1970의 명칭으로도 알려져 있다.\\n63식은 소련의 도움을 받지 않고 독자적으로 설계한 최초의 기갑차량이다. 동시대의 M113과 같이 간단한 구조로 신뢰성이 높다.\\n약 3,000대가 중국북방공업공사에 의해 생산되었고, 아직도 2,300대 정도가 배치되어 있다. 세계 각지에서 운용중이며, 베트남 전쟁, 중월 전쟁, 이란-이라크 전쟁, 걸프 전쟁 등의 분쟁에서 사용되었다."},{"page_url":"https://fr.wikipedia.org/wiki/Grand_Palais_(Paris)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/The_Great_Nave_-_Wounded_Soldiers_Performing_Arms_Drill_at_the_End_of_Their_Medical_Treatment.jpg","page_title":"Grand Palais (Paris)","context_page_description":"Le Grand Palais est un monument parisien situé en bordure des Champs-Élysées, face au Petit Palais, dont il est séparé par l'avenue Winston-Churchill dans le 8ᵉ arrondissement. Ses 77 000 m² abritent régulièrement salons et expositions prestigieuses."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D0%BB%D0%B8%D1%86%D0%B0_%D0%A1%D0%B8%D0%BC%D0%BE%D0%BD%D0%BE%D0%B2%D0%B0_(%D0%9A%D0%B0%D0%B7%D0%B0%D0%BD%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/%D0%A3%D0%BB._%D0%A1%D0%B8%D0%BC%D0%BE%D0%BD%D0%BE%D0%B2%D0%B0_%28%D0%B3._%D0%9A%D0%B0%D0%B7%D0%B0%D0%BD%D1%8C%29_-_3.JPG","page_title":"Улица Симонова (Казань)","context_page_description":"Улица Симонова — улица в Авиастроительном районе города Казани. Находится в микрорайонах сначала Караваево, затем Новое Караваево.\\nПроходит с востока на запад от улицы Годовикова до улицы Челюскина переходом в улицу Шатурскую. Пересекается с улицами Годовикова, Малой Печерской, Лукина, Ленинградской, Чапаева, Челюскина и Шатурской."},{"page_url":"https://ko.wikipedia.org/wiki/%EA%B2%8C%ED%8B%B0_%EC%84%BC%ED%84%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Getty_Center_%28July_18_2008%29.jpg","page_title":"게티 센터","context_page_description":"게티 센터는 미국 캘리포니아주 로스앤젤레스에 위치한 건물로, J. 폴 게티 미술관이 있다. 게티 재단이 행하는 여러 행사나 프로그램이 이 센터에서 진행된다."},{"page_url":"https://cs.wikipedia.org/wiki/Almirante_%C3%93scar_Viel_(AP-46)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Chilean_icebreaker.jpg","page_title":"Almirante Óscar Viel (AP-46)","context_page_description":"Almirante Óscar Viel (AP-46) je ledoborec chilského námořnictva. Původně byl v letech 1969–1993 provozován Kanadskou pobřežní stráží jako CCGS Norman McLeod Rogers. Roku 1994 jej koupilo Chile. Ledoborec se stal hlavním chilským zásobovacím plavidlem pro oblast Antarktidy."},{"page_url":"https://en.wikipedia.org/wiki/Gojslav_of_Croatia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Europe_1000.jpg","page_title":"Gojslav of Croatia","context_page_description":"Gojslav was a monarch who co-ruled the Kingdom of Croatia with his brother Krešimir III from 1000 to his death in 1020. He was the youngest son of the former Croatian King Stjepan Držislav and a member of royal House of Trpimirović."},{"page_url":"https://lv.wikipedia.org/wiki/Sergijevposada","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Coat_of_Arms_of_Sergiev_Posad_%28Moscow_oblast%29.png","page_title":"Sergijevposada","context_page_description":"Sergijevposada ir pilsēta Krievijā, Maskavas apgabalā. Tajā dzīvo 109 252 iedzīvotāji. Sergijevposada atrodas Krievijas Eiropas daļas vidusdaļā, Maskavas apgabala ziemeļaustrumos, 72 km no Maskavas, Končuras upes krastos. Pilsētas mikrorajoni Ugļiča un Severnija pilsētas rietumos un ziemeļos ir dzīvojamie rajoni. Severnijā atrodas liela dzīvojamā māja ar 1000 dzīvokļiem."},{"page_url":"https://no.wikipedia.org/wiki/Gravity","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/29/Sandra_Bullock_by_Gage_Skidmore.jpg","page_title":"Gravity","context_page_description":"Gravity er en amerikansk-britisk thriller fra 2013 med handling i det nære verdensrom. Filmen er regissert av Alfonso Cuarón, som også skrev manuset med sin sønn Jonás. Sandra Bullock og George Clooney spiller hovedrollene som astronautene Ryan og Matt, under en ødeleggelse av romfergen og deres reise tilbake til jorden.\\nDen er i forkant blitt beskrevet som sci-fi-film, noe som vanligvis impliserer både et fjernt framtidsscenario og/eller foreløpig ikke-eksisterende teknologi, men ettersom romfartsforutsetningene for alle bærende elementer i filmen har eksistert i virkeligheten siden 2011/2012, er dette ingen god klassifisering. Filmen har sterke symbolsk ladede elementer.\\nFilmen skulle egentlig produseres hos Universal Pictures, men det endte i stedet med at Warner Bros. Pictures plukket den opp. Ved den 86. Oscar-utdelingen fikk Gravity sju Oscar-priser."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D1%8B%D0%BA%D0%BE%D0%B2%D0%BE_(%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Zykovo_8.JPG","page_title":"Зыково (Московская область)","context_page_description":"Зыково — деревня, расположенная в Бужаровском сельском поселении Истринского района Московской области. Население — 40 чел. С Истрой деревня связана автобусным сообщением.\\nНаходится примерно в 19 км на северо-запад от Истры, на левом, высоком берегу реки Раменки, высота над уровнем моря 204 м. Соседние населённые пункты: Граворново — на восточной стороне шоссе, Никитское — примерно в 2 км севернее, Верхуртово — в 2 км восточнее и Малое Ушаково в 500 м на юг."},{"page_url":"https://da.wikipedia.org/wiki/Liam_Cosgrave","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Taoiseach_Liam_Cosgrave-Patricks_Day_1976.jpg","page_title":"Liam Cosgrave","context_page_description":"Liam Cosgrave var en irsk politiker, og var premierministeren i Republikken Irland fra 1973-1977."},{"page_url":"https://en.wikipedia.org/wiki/Deschutes_River_(Oregon)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Drift_boat_aka_Mckenzie_River_dory.jpg","page_title":"Deschutes River (Oregon)","context_page_description":"The Deschutes River in central Oregon is a major tributary of the Columbia River. The river provides much of the drainage on the eastern side of the Cascade Range in Oregon, gathering many of the tributaries that descend from the drier, eastern flank of the mountains. The Deschutes provided an important route to and from the Columbia for Native Americans for thousands of years, and then in the 19th century for pioneers on the Oregon Trail. The river flows mostly through rugged and arid country, and its valley provides a cultural heart for central Oregon. Today the river supplies water for irrigation and is popular in the summer for whitewater rafting and fishing.\\nThe river flows generally north, as do several other large Oregon tributaries of the Columbia River, including the Willamette and John Day."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%BB%91%E9%A0%AD%E7%99%BD%E9%B9%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Black-headed_Ibis_Threskiornis_melanocephalus.jpg","page_title":"黑頭白鹮","context_page_description":"黑頭白䴉為䴉科白䴉屬的鳥類，主要分布於北緯30度以南的南亞、東南亞靠近沿海地區，以及中國東北的鶴崗、佳木斯一帶。"},{"page_url":"https://en.wikipedia.org/wiki/%C5%A0koda_ForCity","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Prague_07-2016_tram_at_Andel_img1.jpg","page_title":"Škoda ForCity","context_page_description":"Škoda ForCity is a family of low-floor trams built by Škoda Transportation. This includes Finnish-made Artic trams branded as ForCity Smart. ForCity trams were ordered by transport companies of Bonn, Bratislava, Chemnitz, Eskişehir, Espoo/Helsinki, Heidelberg/Ludwigshafen/Mannheim, Konya, Miskolc, Ostrava, Prague, Riga, Schöneiche\\nand Tampere. As of December 2019, 756 units were ordered."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Sites_of_Special_Scientific_Interest_in_West_Sussex","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Two_Tracks%2C_Pound_Common_-_geograph.org.uk_-_864807.jpg","page_title":"List of Sites of Special Scientific Interest in West Sussex","context_page_description":"West Sussex is in south-east England and it has a population of approximately 780,000. The county town is Chichester. In the north of the county are the heavy clays and sands of the Weald. The chalk of the South Downs runs across the centre from east to west and in the south a coastal plain runs down to the English Channel.\\nIn England, Sites of Special Scientific Interest are designated by Natural England, which is responsible for protecting England's natural environment. The most important wildlife and geological sites are designated as SSSIs in order to give them legal protection.\\nAs of July 2019 there are 77 SSSIs in West Sussex, of which 53 are biological, 18 are geological and 6 are both biological and geological. Twenty-four are Geological Conservation Review sites, fifteen are Nature Conservation Review sites, ten are Special Areas of Conservation, six are Special Protection Areas, five are internationally important Ramsar wetland sites, two are National Nature Reserves, seven are Local Nature Reserves, parts of six are Scheduled Monuments, ten are managed by the Sussex Wildlife Trust and one, which is partly in Surrey, is managed by the Surrey Wildlife Trust."},{"page_url":"https://de.wikipedia.org/wiki/Kabinett_Ludovic_Orban_I","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Florin_C%C3%AE%C8%9Bu_-_jan_2020.jpg","page_title":"Kabinett Ludovic Orban I","context_page_description":"Das Kabinett Ludovic Orban I war die von Ludovic Orban am 4. November 2019 gebildete Regierung Rumäniens. Am 5. Februar 2020 wurde sie per Misstrauensvotum abgewählt und am 14. März 2020 aufgelöst. Es folgte das aus den identischen Ministern bestehende Kabinett Ludovic Orban II"},{"page_url":"https://en.wikipedia.org/wiki/Grade_II*_listed_buildings_in_Brighton_and_Hove","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/26%E2%80%9337_Regency_Square%2C_Brighton_%28IoE_Code_481129%29.jpg","page_title":"Grade II* listed buildings in Brighton and Hove","context_page_description":"There are 72 Grade II* listed buildings in the city of Brighton and Hove, England. The city, on the English Channel coast approximately 52 miles south of London, was formed as a unitary authority in 1997 by the merger of the neighbouring towns of Brighton and Hove. Queen Elizabeth II granted city status in 2000.\\nIn England, a building or structure is defined as \\"listed\\" when it is placed on a statutory register of buildings of \\"special architectural or historic interest\\" by the Secretary of State for Culture, Media and Sport, a Government department, in accordance with the Planning Act 1990. English Heritage, a non-departmental public body, acts as an agency of this department to administer the process and advise the department on relevant issues. There are three grades of listing status. Grade I, the highest, is defined as being of \\"exceptional interest\\"; Grade II* is used for \\"particularly important buildings of more than special interest\\"; and Grade II, the lowest, is used for buildings of \\"special interest\\".\\nBrighton was founded on top of the sea-facing cliffs where the South Downs meet the English Channel."},{"page_url":"https://en.wikipedia.org/wiki/Austro-Hungarian_gulden","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/AHG_10_1880_obverse.jpg","page_title":"Austro-Hungarian gulden","context_page_description":"The Gulden or forint was the currency of the lands of the House of Habsburg between 1754 and 1892, when it was replaced by the krone/korona as part of the introduction of the gold standard. In Austria, the Gulden was initially divided into 60 Kreuzer, and in Hungary, the forint was divided into 60 krajczár. The currency was decimalized in 1857, using the same names for the unit and subunit."},{"page_url":"https://vi.wikipedia.org/wiki/Poranopsis_paniculata","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Starr_990105-2927_Poranopsis_paniculata.jpg","page_title":"Poranopsis paniculata","context_page_description":"Poranopsis paniculata là một loài thực vật có hoa trong họ Bìm bìm. Loài này được Roberty miêu tả khoa học đầu tiên năm 1953."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%9E%D7%A8%D7%9B%D7%96_%D7%94%D7%90%D7%A7%D7%93%D7%9E%D7%99_%D7%9C%D7%A2%D7%99%D7%A6%D7%95%D7%91_%D7%95%D7%9C%D7%97%D7%99%D7%A0%D7%95%D7%9A_%D7%95%D7%99%D7%A6%D7%95_%D7%97%D7%99%D7%A4%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/WIZO.jpg","page_title":"המרכז האקדמי לעיצוב ולחינוך ויצו חיפה","context_page_description":"המרכז האקדמי לעיצוב ולחינוך ויצו חיפה על שם נרי בלומפילד היא מכללה אקדמית להכשרת מעצבים, המשלבת במסגרת זו את מקצוע החינוך. המרכז שוכן במושבה הגרמנית שבחיפה."},{"page_url":"https://pt.wikipedia.org/wiki/Lago_artificial","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Embalse_dos_Peares_Galiza.jpg","page_title":"Lago artificial","context_page_description":"Um lago artificial, albufeira ou açude é um lago de origem artificial, normalmente concebido para armazenar água numa região seca, para dar mais vida a um ambiente ou que resulta da construção de uma represa ou uma hidrelétrica, cobrindo as áreas costeiras às margens de um rio.\\nOs lagos artificiais são também feitos para a criação de peixes e outros organismos aquáticos, em regime de aquacultura extensiva."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9C%CF%80%CE%B1%CE%B8%CF%83%CE%AE%CE%BC%CF%80%CE%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Bathsheba%2C_Barbados_32.jpg","page_title":"Μπαθσήμπα","context_page_description":"Η Μπαθσήμπα είναι μια κωμόπολη του Μπαρμπάντος. Είναι η τρίτη μεγαλύτερη πόλη μετά την Μπρίτζταουν και την Σπάιτσταουν. Είναι η πρωτεύουσα της ενορίας του Αγίου Ιωσήφ. Έχει πληθυσμό περίπου 5.000 κατοίκων."},{"page_url":"https://sk.wikipedia.org/wiki/Michal_IV._(Byzantsk%C3%A1_r%C3%AD%C5%A1a)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Michael_IV_histamenon.jpg","page_title":"Michal IV. (Byzantská ríša)","context_page_description":"Michal IV. Paflagónsky bol byzantský cisár v rokoch 1034 – 1041. Cisárom sa stal po smrti cisára Romana III., keď sa oženil s jeho ženou, svojou milenkou, cisárovnou Zoe. Podľa dobových správ bol Michal bol veľmi krásny, štedrý a šikovný, ale trpel epilepsiou a bol nevzdelaný, čo viedlo k tomu, že mnohé oblasti vlády prenechal na svojho brata, ministra Jána Orfanotrofa. Ten finančnými a vojenskými reformami navrátil ríši stratenú silu, ale získal aj mnohých nepriateľov. Na východnej hranici bolo Georgiom Maniakom dobyté mesto Edessa a aspoň spočiatku boli úspešné aj boje na Sicílii. Podarilo sa mu taktiež potlačiť bulharské Deljanovo povstanie, naopak úplnú nezávislosť získala srbská Duklja. Obdobie jeho vlády je spojené aj s rozsiahlymi čistkami vedenými proti aristokratickým rodinám.\\nMichal IV. pochádzal z rodiny roľníkov z provincie Paflagónia. V mladosti sa mal podľa dobových správ živiť falšovaním mincí. Na cisársky dvor sa dostal prostredníctvom svojho brata, eunucha a vysokého štátneho úradníka Jána Orfanotrofa. Stal sa cisárovým komorníkom a masérom, následne aj milencom cisárovej manželky Zoe."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%93%D0%BB%D0%B8%D0%B2%D0%B8%D1%86%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Gliwice%2C_Budynek_Poczty_G%C5%82%C3%B3wnej_01.JPG","page_title":"Гливице","context_page_description":"Гливице [ɡlʲiˈvʲit͡sɛ] — Польшаның оңтүстігіндегі, Жоғарғы Силезия аймағындағы қала. Қала Силезия қыратында, Клодница өзенінің (Одра саласы) бойында жайғасқан. Силезия воеводствосының жергілікті орталығы Катовице қаласынан 25 км жерде орналасқан.\\nГливице - бұл Жоғарғы Силезия мегаполисінің (1,9 миллион тұрғыны бар) ең батыс қаласы және осы аймақтың үшінші ірі қаласы, 2018 жылғы дерек бойынша 179 806 тұрақты тұрғыны бар. Ол сондай-ақ бұдан да үлкен, халқы 5,3 миллион және аумағы шығыс Жоғарғы Силезия, Кіші Польша аймағы мен Чехиядағы Моравия-Силезия аймағынан құралған Жоғарғы Силезия метрополитен аймағы құрамына кіреді. Гливице - Польшаның маңызды өндірістік орталығы. 1990-шы жылдардағы экономикалық өзгерістен кейін Гливице металлургиялық зауыттар мен көмір өндіруден автокөлік және машина жасау саласына ауысты. Гливицедегі соңғы көмір шахтасы 2021 жылға дейін жабылды; алайда жақсы экономикалық нәтижелерге байланысты бұл шешім кейінге қалдырылды.\\n13 ғасырда негізі қаланған Гливице - Жоғарғы Силезияның ең ежелгі қоныстарының бірі."},{"page_url":"https://sv.wikipedia.org/wiki/Skellefte%C3%A5_kommun","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Distrikt_Skellefte%C3%A5.jpg","page_title":"Skellefteå kommun","context_page_description":"Skellefteå kommun är en kommun i Västerbottens län i landskapet Västerbotten i Sverige. Centralort är Skellefteå.\\nKommunen, som är Sveriges till ytan största kustkommun, gränsar till Norrbottenskommunerna Piteå och Arvidsjaur samt Västerbottenskommunerna Norsjö, Vindeln, Umeå och Robertsfors."},{"page_url":"https://de.wikipedia.org/wiki/Karl_Keck_(Maler)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Badenburg_in_M%C3%BCnchen.jpg","page_title":"Karl Keck (Maler)","context_page_description":"Karl Keck war ein deutscher Landschafts- und Veduten-Maler."},{"page_url":"https://es.wikipedia.org/wiki/Cyrtonyx_ocellatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Cyrtonyx_ocellatus_-_1820-1863_-_Print_-_Iconographia_Zoologica_-_Special_Collections_University_of_Amsterdam_-_UBA01_IZ17100215_detail.png","page_title":"Cyrtonyx ocellatus","context_page_description":"El colín ocelado, ​ también denominado codorniz enmascarada o codorniz arlequín centroamericana, ​​ es una especie de ave galliforme de la familia Odontophoridae que habita en bosques de montaña de clima templado en el sur de México y en América Central, desde el Istmo de Tehuantepec hasta Nicaragua. Es considerada una especie vulnerable por la Unión Internacional para la Conservación de la Naturaleza. No se conocen subespecies.​"},{"page_url":"https://en.wikipedia.org/wiki/Orangeville_Northmen_Jr._B","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Orangeville_Northmen_Jr._B_players_away_2014.jpg","page_title":"Orangeville Northmen Jr. B","context_page_description":"The Orangeville Northmen are Junior \\"B\\" box lacrosse team from Orangeville, Ontario, Canada. The Northmen play in the OLA Junior B Lacrosse League."},{"page_url":"https://fr.wikipedia.org/wiki/Amm%C3%A9lide","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f7/Ammelide.png","page_title":"Ammélide","context_page_description":"L'ammélide, ou 6-amino-2,4-dihydroxy-1,3,5-triazine, est un dérivé de triazine résultant de l'hydrolyse de l'amméline, elle-même produite par hydrolyse de la mélamine. Il peut être obtenu en chauffant du dicyandiamide dans l'ammoniaque à 160 à 170 °C. Il peut également être produit en chauffant brièvement une heptazine avec de l'acide sulfurique concentré à 190 °C.\\nL'ammélide forme des sels avec les acides et les bases. Il se décompose à 170 °C en présence d'eau pour former de l'ammoniac et du dioxyde de carbone. Il peut être converti en acide cyanurique par des oxydants tels que le permanganate de potassium ou à ébullition avec des acides forts ou des bases fortes."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%BE%D1%82%D0%B0%D0%BD%D1%96%D1%87%D0%BD%D0%B8%D0%B9_%D1%81%D0%B0%D0%B4_%D0%91%D1%83%D0%B5%D0%BD%D0%BE%D1%81-%D0%90%D0%B9%D1%80%D0%B5%D1%81%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Jard%C3%ADn_Bot%C3%A1nico_Buenos_Aires_Invernadero.jpg","page_title":"Ботанічний сад Буенос-Айреса","context_page_description":"Ботанічний сад Буенос-Айреса або Ботанічний сад «Карлос Тейс» — ботанічний сад у Буенос-Айресі.\\nКод ботанічного саду: BAJ. Директор ботанічного саду — Грасіела Баррейро."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D8%A7%D8%AE_%D9%85%DB%8C%D8%A7%D9%86%E2%80%8C%D9%BE%D8%B4%D8%AA%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Front_view_of_Mianposhte_palace.jpg","page_title":"کاخ میان‌پشته","context_page_description":"کاخ، موزه میان پشته در استان گیلان، شهرستان انزلی، شهر بندر انزلی و در منطقه میان پشته بین دو پل انزلی و پل غازیان در محوطه و سیعی واقع شده‌است."},{"page_url":"https://en.wikipedia.org/wiki/Grade_II*_listed_buildings_in_Cambridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Clare_College_Memorial_Court_01.JPG","page_title":"Grade II* listed buildings in Cambridge","context_page_description":"There are 47 Grade II* listed buildings in Cambridge, England. In the United Kingdom, a listed building is a building or structure of special historical or architectural importance. These buildings are legally protected from demolition, as well as from any extensions or alterations that would adversely affect the building's character or destroy historic features. Listed buildings in England are divided into three categories—Grade II buildings are buildings of special interest; Grade II* buildings are buildings of particular importance; and Grade I buildings, which are those of \\"exceptional\\" interest. Around four per cent of listed buildings are given Grade II* status.\\nCambridge is a university town located in East Anglia, England. It is home to the University of Cambridge, founded in 1209, and many of the listed buildings are part of the university or its constituent colleges."},{"page_url":"https://fr.wikipedia.org/wiki/USS_Powhatan","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Kurofune_3.jpg","page_title":"USS Powhatan","context_page_description":"Le premier USS Powhatan était une frégate à vapeur de la United States Navy propulsée par deux roues à aubes, qui fut utilisée entre autres contre la piraterie en mer de Chine et durant la guerre de Sécession. Ce fut l'un des plus grands, et l'un des derniers vaisseaux de guerre à aubes américains. Son nom est celui d'un cacique amérindien de Virginie orientale."},{"page_url":"https://de.wikipedia.org/wiki/Intercity_(Niederlande)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Interieur_DDM1_eerste_klas_beneden.jpg","page_title":"Intercity (Niederlande)","context_page_description":"Der Intercity in den Niederlanden ist eine international verwendete Zuggattung.\\nIn den Niederlanden fahren Intercity-Züge der Nederlandse Spoorwegen. Es besteht ein sehr dichtes Netz, welches auf allen Strecken im Halbstundentakt bedient wird, in der Randstad und nach Eindhoven Centraal/Sittard sowie Arnhem Centraal/Nijmegen sogar zum Viertelstundentakt verdichtet, ein besonderer Zuschlag wird nicht erhoben.\\nVielfach bestehen bahnsteiggleiche Direktanschlüsse, beispielsweise in Zwolle, Amersfoort Centraal und Utrecht, so dass abwechselnd Verbindungen mit und ohne Umstieg angeboten werden.\\nDie Qualität und Durchschnittsgeschwindigkeit der Züge entspricht eher dem ehemaligen deutschen Interregio oder den heutigen Regional-Express-Zügen. Die Halteabstände sind relativ dicht, die Züge werden wie Schnellbahnen häufig von Pendlern genutzt. Speise- oder Bistrowagen gibt es im nationalen IC-Netz nicht, stattdessen sind auf einzelnen Linien Verkäufer in den Zügen, die durch die Wagen laufen und Kaffee, Tee sowie Kuchen anbieten. Eingesetzt werden lokbespannte Züge und Triebzüge. Die Triebzüge werden sukzessive mit WLAN und optischer Fahrgastinformation ausgestattet."},{"page_url":"https://fr.wikipedia.org/wiki/Runes_scandinaves","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Long-branch_m_rune.png","page_title":"Runes scandinaves","context_page_description":"Les runes scandinaves, aussi appelées Futhark récent, constituent un alphabet runique issu du vieux Futhark, en usage à partir du IXᵉ siècle. De taille réduite par rapport à son ancêtre, ce système d’écriture naît pourtant au moment où le proto-norrois évolue en vieux norrois, faisant ainsi apparaître de nouveaux phonèmes.\\nAinsi, la langue orale comportait des sons distincts et des paires minimales qui demeuraient identiques à l’écrit. De plus, la coutume exigeant de ne pas écrire deux fois la même rune d’affilée, la distinction entre voyelles courtes et longues s’est perdue à l’écrit. Toutefois, il était possible d’écrire la même rune consécutivement lorsqu’elle représentait plusieurs sons différents successifs, comme dans le nom Gunvor, représenté par kunuur."},{"page_url":"https://en.wikipedia.org/wiki/Adolphe_Deledda","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Adolphe_Deledda_%281954%29.jpg","page_title":"Adolphe Deledda","context_page_description":"Adolphe Deledda was an Italian/French professional road bicycle racer."},{"page_url":"https://de.wikipedia.org/wiki/Herisau","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/65/Karte_Gemeinde_Herisau_2010.png","page_title":"Herisau","context_page_description":"Herisau ist eine Einwohnergemeinde im Bezirk Hinterland im Schweizer Kanton Appenzell Ausserrhoden. Es ist Sitz des Kantonsparlaments, der Kantonsregierung und der Kantonspolizei von Appenzell Ausserrhoden und gilt neben Trogen de facto als Hauptort des Kantons.\\nHerisau wurde zur Alpenstadt des Jahres 2003 gekürt."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%98%D0%B0_%D0%BD%D0%B0_%D0%95%D0%B2%D1%80%D0%BE%D0%B2%D0%B8%D0%B7%D0%B8%D1%98%D0%B0_2010","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Lena_Meyer-Landrut_at_PC_after_2010_Eurovision_2.jpg","page_title":"Германија на Евровизија 2010","context_page_description":"Германија е победникот за натпреварот за песна на Евровизија 2010, кој се одржа во мај 2010 година во Баерум, Норвешка. Влезот на земјата беше избран во серија натпреварувачки топки и национално финале – Ѕвездите на Осло 2010 – кој беше организиран заеднички од јавните радиодифузери AРД и НДР и приватниот телевизиски канал ПроСиебен, заедно со трикратниот Евровизиски учесник за Германија и музички продуцент, Стефан Рааб."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D8%A7%D9%86%D9%88%D8%A6%D9%84_%D9%81%D8%B1%D9%86%D8%A7%D9%86%D8%AF%D8%B2_(%D8%A8%D8%A7%D8%B2%DB%8C%DA%A9%D9%86_%D9%81%D9%88%D8%AA%D8%A8%D8%A7%D9%84%D8%8C_%D8%B2%D8%A7%D8%AF%D9%87_%DB%B1%DB%B9%DB%B8%DB%B6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Manuel_Fernandes_2012-13.jpg","page_title":"مانوئل فرناندز (بازیکن فوتبال، زاده ۱۹۸۶)","context_page_description":"مانوئل فرناندز بازیکن فوتبال اهل پرتغال است.\\nاز باشگاه‌هایی که در آن بازی کرده‌است می‌توان به باشگاه فوتبال بشیکتاش، باشگاه فوتبال بنفیکا، باشگاه فوتبال والنسیا، باشگاه فوتبال اورتون، باشگاه فوتبال پورتسموث و باشگاه فوتبال لوکوموتیو مسکو اشاره کرد.\\nوی سابقه ۱۱ بازی برای تیم ملی فوتبال پرتغال در کارنامه دارد."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9D%B4%EB%AF%B8%ED%84%B0-%EA%B2%B0%ED%95%A9_%EB%85%BC%EB%A6%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/ECL.svg","page_title":"이미터-결합 논리","context_page_description":"이미터-결합 논리 고속 동작하는 논리 소자로 BJT 집적회로이다. 이미터-결합 논리 소자는 차동 증폭기 구조를 이용하며, 차동 증폭기의 쌍입력 중 한쪽은 외부 논리 입력으로 사용하고 반대쪽 한개는 제한적 전류를 되도록 내부에서 입력된다. 이것은 BJT가 완전한 포화모드로 동작하지 않도록 이미터 전류를 제한하여 빠른 논리 전환이 가능하게 한다.\\n차동증폭기를 이용하므로 전원은 양전압과 음전압 전원 2개가 필요하다."},{"page_url":"https://fr.wikipedia.org/wiki/Stade_San_Siro","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/SanSiroStadioConcertoVascoRossi.jpg","page_title":"Stade San Siro","context_page_description":"Le stade Giuseppe-Meazza, plus communément appelé le stade San Siro, est un stade de football situé dans la ville italienne de Milan. L’enceinte est le lieu de résidence des deux clubs de la ville : le Milan AC et l'Inter. Bien que le stade ait été officiellement renommé en l'honneur de Giuseppe Meazza, il est toujours désigné par son ancienne appellation : Stadio San Siro. Grâce à des tribunes proches du terrain, une forte inclinaison des gradins et un large toit, l’enceinte bénéficie d’une atmosphère qui en fait l’un des stades les plus mythiques du monde du football.\\nLe stade a une capacité totale de 80 018 places ce qui en fait le plus grand stade italien.\\nLa cérémonie d’ouverture des Jeux olympiques d'hiver de 2026 s’y déroulera."},{"page_url":"https://cy.wikipedia.org/wiki/Hialeah,_Florida","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Western_Union_building_in_Hialeah%2C_Florida_%289362912763%29.jpg","page_title":"Hialeah, Florida","context_page_description":"Dinas yn Miami-Dade County, yn nhalaith Florida, Unol Daleithiau America yw Hialeah, Florida. ac fe'i sefydlwyd ym 1925."},{"page_url":"https://fr.wikipedia.org/wiki/Principe_fondamental_de_la_statique","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Elevateur_manege_nautilus_profil_schema_cinematique_et_graphe_liaisons.svg","page_title":"Principe fondamental de la statique","context_page_description":"Le principe fondamental de la statique, ou théorème de l'équilibre, exprime les conditions d'équilibre d'un solide indéformable dans un référentiel galiléen.\\nUn objet est à l'équilibre lorsqu'il a un mouvement rectiligne uniforme. Souvent, on considère le cas d'un objet immobile."},{"page_url":"https://de.wikipedia.org/wiki/Geschichte_der_italienischen_Luftstreitkr%C3%A4fte","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Caproni_Ca.33_-_Cannoncino.jpg","page_title":"Geschichte der italienischen Luftstreitkräfte","context_page_description":"Die Geschichte der italienischen Luftstreitkräfte beginnt 1884 mit der Erprobung von Fesselballonen in Rom. Dort wurden 1910 auch die ersten Flugzeuge in Dienst gestellt und noch in jenem Jahr zu einem selbständigen Pionier-Bataillon zusammengefasst. Der weitere Ausbau führte 1915 zur Gründung des Corpo Aeronautico Militare. Zusammen mit den 1913 aufgestellten Marinefliegern nahm es am Ersten Weltkrieg teil, auch in Frankreich, auf dem Balkan und in Nordafrika.\\nAus den Luftstreitkräften von Heer und Marine ging 1923 die „Königliche Luftwaffe“ Italiens hervor. In den Jahren danach stellte sie zahlreiche fliegerische Rekorde auf, deren internationale Beachtung für die faschistische Propagandapolitik Vorrang vor militärischen Erwägungen hatte. Die seit 1922 geführten Kolonialkriege in Nord- und Ostafrika, die Beteiligung am Spanischen Bürgerkrieg und der damit einhergehende Verschleiß, mangelnde Anstrengungen bei der Modernisierung des Flugzeugbestandes und die Fixierung auf nebensächliche internationale Wettbewerbe bewirkten, dass die Regia Aeronautica Ende der 1930er Jahre den Anschluss an die technische und operative Entwicklung der Luftstreitkräfte anderer Großmächte verlor."},{"page_url":"https://ro.wikipedia.org/wiki/Le_Chesnay","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Map_commune_FR_insee_code_78158.png","page_title":"Le Chesnay","context_page_description":"Le Chesnay este un oraș în Franța, sîn departamentul Yvelines, în regiunea Île-de-France."},{"page_url":"https://en.wikipedia.org/wiki/List_of_listed_buildings_in_Edinburgh/8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Edinburgh%2C_44%2C_46%2C_48_Marchmont_Crescent_-_20170917163008.jpg","page_title":"List of listed buildings in Edinburgh/8","context_page_description":"This is a list of listed buildings in Edinburgh, Scotland."},{"page_url":"https://en.wikipedia.org/wiki/Knowsley_Road","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Knowsley_Road.JPG","page_title":"Knowsley Road","context_page_description":"Knowsley Road in Eccleston, St Helens, Merseyside, was the home ground of St. Helens from 1890 until its closure in 2010. St Helens Town FC played their home fixtures at Knowsley Road from 2002 until 2010. For a period, the venue also hosted Liverpool F.C. Reserves. The stadium was demolished during spring 2011 and a new construction then known as Cunningham Grange, named after club legend Keiron Cunningham, was built on the site."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Hamburg-Neustadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Stolperstein_Peterstra%C3%9Fe_33_%28Erwin_Grossmeyer%29_in_Hamburg-Neustadt.JPG","page_title":"Liste der Stolpersteine in Hamburg-Neustadt","context_page_description":"Die Liste der Stolpersteine in Hamburg-Neustadt enthält alle Stolpersteine, die im Rahmen des gleichnamigen Kunst-Projekts von Gunter Demnig in Hamburg-Neustadt verlegt wurden. Mit ihnen soll Opfern des Nationalsozialismus gedacht werden, die in Hamburg-Neustadt lebten und wirkten.\\nDiese Seite ist Teil der Liste der Stolpersteine in Hamburg, da diese mit insgesamt 5897 Steinen zu groß würde und deshalb je Stadtteil, in dem Steine verlegt wurden, eine eigene Seite angelegt wurde."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B9%E3%82%B3%E3%83%83%E3%83%88%E3%83%A9%E3%83%B3%E3%83%89%E5%9B%BD%E7%AB%8B%E8%82%96%E5%83%8F%E7%94%BB%E7%BE%8E%E8%A1%93%E9%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/David_Hume_and_Adam_Smith_statues%2C_Edinburgh.jpg","page_title":"スコットランド国立肖像画美術館","context_page_description":"スコットランド国立肖像画美術館は、スコットランドのエディンバラ、クイーン通りに面した美術館である。所蔵する肖像画のコレクションは、すべてスコットランド人を描いたものだが、必ずしもスコットランド人の手によるものとは限らない。また、絵画だけではなく写真コレクションも所蔵している。\\n赤い砂岩で出来たネオ・ゴシック様式の美術館は1889年に一般公開された。建設にあたってはスコッツマン新聞社のオーナーであったジョン・リッチー・フィンドレイが寄付を行い、設計はロバート・ローワンド・アンダーソンが行った。建設期間は1885年から1890年までの間であった。完成以来初の大規模改装により2009年4月から閉館となっていたが、2011年12月1日より再び開館された。改装は、ページ・パーク・アーキテクツにより行われた。"},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%AC%E1%83%9A%E1%83%98%E1%83%A1_%E1%83%95%E1%83%98%E1%83%99%E1%83%98%E1%83%9B%E1%83%94%E1%83%93%E1%83%98%E1%83%94%E1%83%9A%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Susanna_at_Google_Opening_Reception.jpg","page_title":"წლის ვიკიმედიელი","context_page_description":"წლის ვიკიმედიელი — ყოველწლიური ჯილდო, რომელიც 2011 წელს ვიკიპედიის თანადამფუძნებლის ჯიმი უელსის მიერ დაარსდა, რომელიც ტრადიციულად გადაეცემა ვიკიმანიაზე, ვიკიმედიის მოძრაობაში ძირითადი მიღწევების ხაზგასმისთვის. 2017 წლამდე ჯილდოს „წლის ვიკიპედიელი“ ეწოდებოდა.\\nჯილდოს მფლობელები არიან: რაუან კენჟეჰანული, „დემი“, რემი მატისი, იჰორ კოსტენკო, ემილი ტემპლ-ვუდი, როუზ სტივენსონ-გუდნაითი, ფელიქს ნარტი, ფარჰად ფატკულინი და ემნა მიზოუნი, ასევე სხვა ანონიმური ავტორი.\\nმთავარი ჯილდოს გარდა, ასევე გადაეცა შვიდი „საპატიო მოხსენიება“."},{"page_url":"https://ca.wikipedia.org/wiki/2019","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Montserrat_Minobis.jpg","page_title":"2019","context_page_description":"2019 fou un any normal, que va començar en dimarts en el calendari gregorià. Les Nacions Unides el van designar com a Any Internacional de les Llengües Indígenes i Any Internacional de la Taula Periòdica dels Elements Químics."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%9D%8E%E6%9D%91_(%E5%BB%BA%E5%BE%B7)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Former_Residence_of_Li_Zhanzhong_01_2014-10.JPG","page_title":"李村 (建德)","context_page_description":"李村為位於中國浙江省杭州建德市大慈岩鎮的一個李姓聚居村落，背靠玉華山，東北接上吳方村。2019年1月被公布為中國歷史文化名村。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%92%D7%99%D7%A0%D7%A1_(%D7%91%D7%99%D7%A8%D7%94)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Guinness_at_factory.jpg","page_title":"גינס (בירה)","context_page_description":"גינס היא בירה כהה מסוג סטאוט המבושלת במבשלת סנט ג'יימס גייט בדבלין, אירלנד, על ידי חברה בעלת אותו שם שנוסדה על ידי ארתור גינס, בשנת 1759.\\nבירה גינס מכילה חנקן, בנוסף לפחמן דו-חמצני, במטרה להפחית את טעמה החומצי של החומצה הפחמתית, תוצר ההמסה של הפחמן הדו-חמצני במים. בזאת שונה גינס מבירות \\"אקסטרה סטאוט\\" אחרות.\\nלמרות התדמית של \\"ארוחה שלמה בכוס\\" שהודבקה לעיתים לבירה גינס, היא מכילה רק 198 קלוריות לפיינט, פחות מאשר חלב רזה או מיץ תפוזים.\\nהחברה נמצאת כיום בבעלות יצרנית האלכוהול הבריטית דיאג'יו, שמאפשרת גם לזכיינים בארצות אחרות לייצר אותה, אך מבקרים רבים טוענים כי במקרים אלו טעמה שונה]. ניגריה היא השוק השלישי בגודלו, והצומח מהר מכולם, בו משווקת בירה גינס.\\nבשנת 2017 המבשלה שינתה את הדרך בה היא מסננת את השמרים מהבירה. לפני כן, הסינון היה נעשה בעזרת \\"דבק דגים\\". השיטה החדשה נעשית בעזרת קרניים אולטרה-סגולות ואיננה כוללת שימוש בבעלי חיים."},{"page_url":"https://cy.wikipedia.org/wiki/Monroe,_Pennsylvania","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Monroe%28ton%29_PA_United_Methodist.jpg","page_title":"Monroe, Pennsylvania","context_page_description":"Bwrdeisdref yn Bradford County, yn nhalaith Pennsylvania, Unol Daleithiau America yw Monroe, Pennsylvania. ac fe'i sefydlwyd ym 1828."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%84%9B%E5%BE%B7%E8%8F%AF%C2%B7%E5%93%88%E5%85%8B%E5%B0%BC%E6%96%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/St_Andrews_-_St_Salvator%27s_Hall_04.JPG","page_title":"愛德華·哈克尼斯","context_page_description":"爱德华·史蒂芬·哈克尼斯，美国知名慈善家。二十世纪初，爱德华以私人名义透过由其家族掌握的英联邦基金会向众多位于美国东北部的私人医院、艺术博物馆以及教育机构提供大量的资金和实物支持。 因其慷慨无私的巨额馈赠，爱德华成为哥伦比亚大学、耶鲁大学、哈佛大学、菲利普斯埃克塞特学院、圣保罗学校、大都会博物馆和苏格兰圣安德鲁斯大学最主要的捐赠人。\\n爱德华从其父亲史蒂芬·V·哈克尼斯和兄长查尔斯·W·哈克尼斯手上继承了早年因投资美孚石油公司成功而产生的巨额资产。在1918年公布的《福布斯财富排行榜》上，爱德华·哈克尼斯名列第六位“美国最富有的人”，紧随石油大亨约翰·戴维森·洛克菲勒、亨利·弗里克、钢铁大王安德鲁·卡内基、乔治·贝克、威廉·洛克菲勒之后。"},{"page_url":"https://sv.wikipedia.org/wiki/Sn%C3%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Snow_over_treetops.jpg","page_title":"Snö","context_page_description":"Snö är nederbörd i form av iskristaller, enstaka eller sammanfogade, som faller från ett moln men kan även referera till snö som ligger på marken. Snöfall betecknar specifikt nederbörden och snötäcke betecknar snö på marken. Snö som virvlar upp från marken av tillräckligt kraftig och byig vind kallas snödrev. Snö är vanligast på vintern, men kan förekomma andra årstider om temperaturen medger detta, till exempel i subarktiska områden eller områden på hög höjd. De nedfallande iskristallerna kallas snöstjärnor och i de fall de klumpas ihop blir det snöflingor. Dessa är ett granulärt material och har därmed en mjuk struktur, men snömassor blir mer kompakta om de pressas samman.\\nNär utomhustemperaturen är över 0 °C brukar snö som ligger på marken normalt smälta."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BB%D0%BB%D0%B8%D0%B2%D0%B0%D0%BD,_%D0%90%D1%80%D1%82%D1%83%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/IvanhoeGraphic1.JPG","page_title":"Салливан, Артур","context_page_description":"Сэр А́ртур Се́ймур Са́лливан, также Са́лливен — британский композитор ирландско-итальянского происхождения, органист, дирижёр и педагог.\\nАртур Салливан является автором 23 опер и оперетт, 12 крупных оркестровых произведений, 10 произведений для хора и оркестра, музыки к семи пьесам драматического театра, двух балетов и одного вокального цикла, 72 гимнов, произведений церковной музыки, песен и салонных романсов и баллад, фортепианной музыки и произведений для камерного ансамбля. Наибольшую известность получили 14 его оперетт, написанных в соавторстве с Уильямом Гилбертом, в том числе «Корабль Её Величества „Пинафор“», «Пираты Пензанса», «Иоланта» и «Микадо». Среди известных сочинений в других жанрах — хоры «Вперед, Христово воинство» и «Потерянный аккорд». Хотя некоторые из серьёзных сочинений Салливана при его жизни имели успех, большинство из них сейчас забыто, в отличие от оперетт, которые по-прежнему ставятся в англоязычных странах."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%BA%E3%82%B0%E3%83%AD%E3%83%A2%E3%82%BA%E3%83%A2%E3%83%89%E3%82%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Black-capped_Vireo_-_Texas_-_Usa_H8O1970_%2822978591836%29.jpg","page_title":"ズグロモズモドキ","context_page_description":"ズグロモズモドキ は、鳥綱スズメ目モズモドキ科モズモドキ属に分類される鳥類。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9B%E3%83%B3%E3%82%B7%E3%83%A3%E3%83%8E%E3%82%B5%E3%82%A6%E3%83%AB%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Hongshanosaurus_BW.jpg","page_title":"ホンシャノサウルス","context_page_description":"ホンシャノサウルスは東アジアの白亜紀前期より知られる角竜類プシッタコサウルス科の恐竜の属である。記載された化石資料は2つの頭骨のみであるが、近縁種との比較の結果、小型で上下の顎の先がとがったくちばしになった二足歩行の草食動物であることが示唆される。この化石は中国遼寧省義縣累層から発掘された多くの特別保存状態のよい化石の一つである。"},{"page_url":"https://is.wikipedia.org/wiki/Kj%C3%B6rnir_al%C3%BEingismenn_1987","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Islands_halsominister%2C_Jon_Kristjansson.jpg","page_title":"Kjörnir alþingismenn 1987","context_page_description":"Árið 1989 kom Benedikt Bogason inn fyrir Albert Guðmundsson.\\nÁrið 1989 kom Ásgeir Hannes Eiríksson inn fyrir Benedikt Bogason.\\nÁrið 1991 kom Sólveig Pétursdóttir inn fyrir Birgi Ísleif Gunnarsson.\\nÁrið 1991 kom Guðrún J. Halldórsdóttir inn fyrir Guðrúnu Agnarsdóttur."},{"page_url":"https://sk.wikipedia.org/wiki/Salon-de-Provence","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Porte_%C3%A0_Salon-de-Provence_5.JPG","page_title":"Salon-de-Provence","context_page_description":"Salon-de-Provence je mesto na juhu Francúzska v Provensálsku v departemente Bouches-du-Rhône, v regióne Provence-Alpes-Côte d’Azur. Má asi 40 000 obyvateľov."},{"page_url":"https://de.wikipedia.org/wiki/Buchanan_Motor","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/1958_Buchanan_Body.jpg","page_title":"Buchanan Motor","context_page_description":"Die N. H. Buchanan Motor Co. Pty. Ltd. war ein australischer Hersteller von Kit-Cars aus Lidcombe in New South Wales. Die Produktion von Sportwagen lief von 1956 bis 1961."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B4%D0%B5%D0%BC%D0%BE%D0%BA%D1%80%D0%B0%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F_(%D0%9F%D0%BE%D1%80%D1%82%D1%83%D0%B3%D0%B0%D0%BB%D0%B8%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Logo_PSD_cor.PNG","page_title":"Социалдемократическа партия (Португалия)","context_page_description":"Социалдемократическата партия е дясноцентристка либералконсервативна политическа партия в Португалия.\\nТя е създадена след Революцията на карамфилите през 1974 година и първоначално има социалдемократическа ориентация, но след като Социалистическата партия блокира приемането ѝ в Социалистическия интернационал, постепенно се препозиционира надясно, превръщайки се в основната дясноцентристка партия в страната.\\nСоциалдемократическата партия участва в правителството, самостоятелно или в коалиция, през 1979 – 1995, 2002 – 2005 и 2011 – 2015 година. На изборите през 2015 година участва в коалицията „Португалия напред“ и печели най-голям брой депутатски места, 89 от 230, но остава в опозиция."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%81%D9%88%D8%AA%D9%8A%D9%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Photek_photo_by_Faria_Raji.jpg","page_title":"فوتيك","context_page_description":"فوتيك ملحن مزيكا من المملكه المتحده."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AC%E0%A6%B0%E0%A7%8D%E0%A6%B7%E0%A6%B8%E0%A7%87%E0%A6%B0%E0%A6%BE_%E0%A6%89%E0%A6%87%E0%A6%95%E0%A6%BF%E0%A6%AE%E0%A6%BF%E0%A6%A1%E0%A6%BF%E0%A6%AF%E0%A6%BC%E0%A6%BE%E0%A6%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Rauan_Kenzhekhanuly-3_%28cropped%29.jpg","page_title":"বর্ষসেরা উইকিমিডিয়ান","context_page_description":"বর্ষসেরা উইকিমিডিয়ান হলো একটি বার্ষিক পুরস্কার যা ২০১১ সাল থেকে উইকিপিডিয়ার প্রতিষ্ঠাতা জিমি ওয়েলস কর্তৃক প্রদান করা হচ্ছে। পুরস্কারটি প্রতি বছর ঐতিহ্যগতভাবে উইকিপিডিয়ার বার্ষিক সম্মেলন উইকিম্যানিয়াতে ‘উইকিমিডিয়া আন্দোলনে বিশেষ সাফল্যের স্বীকৃতি স্বরুপ’ প্রদান করা হয়। ২০১৭ সালের পূর্বে এটি ‘বর্ষসেরা উইকিপিডিয়ান’ নামে পরিচিত ছিল। প্রথমদিকে শুধুমাত্র ‘প্রধান পুরস্কার’ প্রদান করা হলেও ২০১৫ সাল থেকে প্রধান পুরস্কারের পাশাপাশি ‘বিশেষ সম্মাননা’ নামে মোট দুটি বিষয়শ্রেনীতে পুরস্কারটি প্রদান করা হয়।"},{"page_url":"https://en.wikipedia.org/wiki/Nise-e","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Zuishin_Teiki_handscroll.jpg","page_title":"Nise-e","context_page_description":"Nise-e, or \\"likeness pictures,\\" were a style of portraiture popular in the court circles of Japan's Kamakura period. Prior to the 12th century Japanese art was purely religious in character, but nise-e introduced the realistic depiction of lay figures such as courtiers and samurai. The popularity of nise-e even helped to end the taboo against artistic depictions of the emperor, with one of earliest nise-e to depict a living emperor being a portrait of Emperor Hanazono by Gōshin. The aim of a nise-e portrait was to capture a man's character with a few simple lines; and the work served as a veneration of his accomplishments.\\nFujiwara Takanobu is generally considered to have originated the nise-e style and technique. He innovated the use of jutting, angular outlines and dense swaths of color which came to characterize nise-e portraiture as a whole. Takanobu's influence is seen in the works of his son Fujiwara Nobuzane, and descendants Tametsugu, Korenobu, Tamenobu, and Gōshin, who continued to develop the nise-e school alongside others such as Shinkai and Tametaga."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%88%D9%84%D8%A7%D8%B1%D9%88%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Bularros.png","page_title":"بولاروس","context_page_description":"بلدية بولاروس هي بلدية تقع في مقاطعة آبلة التابعة لمنطقة قشتالة وليون وسط إسبانيا."},{"page_url":"https://en.wikipedia.org/wiki/Human_uses_of_living_things","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Kerbau_Jawa.jpg","page_title":"Human uses of living things","context_page_description":"Human uses of living things, including animals plants, fungi, and microbes, take many forms, both practical, such as the production of food and clothing, and symbolic, as in art, mythology, and religion. The skills and practices involved are transmitted by human culture through social learning.\\nPlants provide the greater part of the food for people and their domestic animals: much of human culture and civilisation came into being through agriculture. While many plants have been used for food, a small number of staple crops including wheat, rice, and maize provide most of the food in the world today. In turn, animals provide much of the meat eaten by the human population, whether farmed or hunted, and until the arrival of mechanised transport, terrestrial mammals provided a large part of the power used for work and transport. A variety of living things serve as models in biological research, such as in genetics, and in drug testing. Until the 19th century, plants yielded most of the medicinal drugs in common use, as described in the 1st century by Dioscorides. Plants are the source of many psychoactive drugs, some such as coca known to have been used for thousands of years."},{"page_url":"https://ja.wikipedia.org/wiki/9%E6%9C%8812%E6%97%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/William_Walker_by_Brady.jpg","page_title":"9月12日","context_page_description":"9月12日はグレゴリオ暦で年始から255日目にあたり、年末まであと110日ある。"},{"page_url":"https://pt.wikipedia.org/wiki/Allo","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Allo%2C_Navarra1.jpg","page_title":"Allo","context_page_description":"Allo é um município da Espanha na província e comunidade autónoma de Navarra. Tem 37,03 km² de área e em 2016 tinha 1 003 habitantes."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AA%E0%A6%BE%E0%A6%B0%E0%A7%81%E0%A6%B2%E0%A6%BF_%E0%A6%A8%E0%A6%A6%E0%A7%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Paruli_River_at_Ijjatpur_Rail_Station.jpg","page_title":"পারুলি নদী","context_page_description":"পারুলি নদী বা পারুলি খাল বাংলাদেশের উত্তর-কেন্দ্রীয় অঞ্চলের গাজীপুর জেলার একটি নদী। নদীটির দৈর্ঘ্য ২৩ কিলোমিটার, গড় প্রস্থ ৫২ মিটার এবং নদীটির প্রকৃতি সর্পিলাকার। বাংলাদেশ পানি উন্নয়ন বোর্ড বা \\"পাউবো\\" কর্তৃক পারুলি খাল নদীর প্রদত্ত পরিচিতি নম্বর উত্তর-কেন্দ্রীয় অঞ্চলের নদী নং ৩৪।"},{"page_url":"https://sv.wikipedia.org/wiki/Generalitetshuset","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/%C3%96stermalmsgatan_87_maj_2018_%2810%29.jpg","page_title":"Generalitetshuset","context_page_description":"Generalitetshuset är en byggnad på Östermalm i centrala Stockholm med adress Östermalmsgatan 87."},{"page_url":"https://de.wikipedia.org/wiki/Hans_Otto_Theater","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Hans-Otto-Theater4.jpg","page_title":"Hans Otto Theater","context_page_description":"Hans Otto Theater, benannt nach dem Schauspieler Hans Otto, ist das Potsdamer Stadttheater. Es wird in der Rechtsform einer GmbH geführt. Seit September 2006 spielt sein Ensemble im Großen Haus am Tiefen See, das als Sitz des Hauses synonym unter Hans Otto Theater verstanden wird und auf dem Gelände der Schiffbauergasse liegt. Eine weitere Spielstätte des Theaters ist die benachbarte historische Reithalle. Außerdem tritt es regelmäßig im Schlosstheater im Neuen Palais auf."},{"page_url":"https://tr.wikipedia.org/wiki/Papa%C4%9Fans%C4%B1lar_listesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Trichoglossus_haematodus_weberi_-New_Port_Aquarium-8.jpg","page_title":"Papağansılar listesi","context_page_description":"Papağansılar, tropikal ve subtropikal bölgelerin büyük bir bölümünde bulunan, Psittaciformes takımını oluşturan, 387 türü günümüzde yaşayan 402 tür kuştur. Takım üç üst familyaya ayrılır: Psittacoidea, Cacatuoidea ve Strigopoidea. Genel olarak pantropikal bir dağılıma sahip olan papağanların bazı türleri Güney yarımkürede ılıman bölgelerde de yaşar. Papağanlarda en büyük çeşitlilik Güney Amerika ve Avustralasya'da görülür.\\nCacatuoidea üst familyası hareket edebilen kafa ibikleri, karotid arterlerin farklı düzeni, safra kesesi, kafatası kemiklerinde farklılıklar Psittacoidea üyelerinde ışığı saçarak canlı renklerde görünmesini sağlayan Dyck dokulu tüylerin eksikliği gibi oldukça farklılıklar içerir. Önceleri kendilerine ait Loriidae familyasında sınıflandırılan lori ve loriketler artık Psittaculidae familyası içinde yer alan Loriinae alt familyasının Loriini oymağını oluşturur. Porto Riko papağanı bazı türler popülasyon darboğazına maruz kalmıştır ve dolayısıyla düşük genetik değişkenlik ve düşük üreme başarısı sonucu koruma durumlarında zorluklar ortaya çıkmıştır.\\nPsittaciformes takımının taksonomisi üzerine son zamanlara kadar bir görüş birliği yoktu."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8A%E3%83%84%EF%BC%9D%E3%82%B7%E3%83%A3%E3%83%BC%E3%83%B4%E3%82%A7%E3%82%B9","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8b/Cartina_Comune_BZ_Naz-Sciaves.png","page_title":"ナツ＝シャーヴェス","context_page_description":"ナツ＝シャーヴェスは、イタリア共和国トレンティーノ＝アルト・アディジェ州ボルツァーノ自治県にある、人口約2900人の基礎自治体。\\nリンゴの栽培が盛ん。イザルコ渓谷地域共同体の一部である。"},{"page_url":"https://fy.wikipedia.org/wiki/Transfiguraasjekleaster_(Moerom)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/%D0%9F%D0%B0%D0%BD%D0%BE%D1%80%D0%B0%D0%BC%D0%B0_%D0%A1%D0%BF%D0%B0%D1%81%D0%BE%D0%BF%D1%80%D0%B5%D0%BE%D0%B1%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%BC%D1%83%D0%B6%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%BC%D0%BE%D0%BD%D0%B0%D1%81%D1%82%D1%8B%D1%80%D1%8F.jpg","page_title":"Transfiguraasjekleaster (Moerom)","context_page_description":"It Transfiguraasje- of Ferlossserkleaster of it Kleaster fan de Transfiguraasje fan de Ferlosser is in kleaster foar muontsen fan de Russysk-Otterdokse Tsjerke yn it bisdom Moerom. It kleaster stiet op de linker kant fan de Oka yn Moerom, Ruslân."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%99%BA%E9%85%B5%E9%A3%9F%E5%93%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Swiss_cheese_cubes.jpg","page_title":"発酵食品","context_page_description":"発酵食品とは、食材を微生物などの作用で発酵させることによって加工した食品である。\\n冷蔵庫などが存在する以前から保存食として、または風味を改良したり食品の硬さを柔らかくしたりするといった目的でも行われる。日本の伝統的な食品では納豆、醤油、味噌、漬物、鰹節など、世界ではパンやヨーグルト、紅茶、キムチなどの形で利用されてきた。また、穀物や果物を発酵させて製造される酒は、アルコールが殺菌作用を持つと同時に精神作用を持つ飲料である。\\n近代における微生物学など科学の発達により、発酵作用が主に微生物などの働きであることが理解されるようになってきた。しかしながら以前は「理由はわからないが所定の工程を行うことでおおむね同じような状態に変化する」という現象を利用することで、連綿と行われてきた。このため、一概に発酵食品とはいっても微生物の存在が理解される以前から行われていることにも絡み、微生物の作用以外に酵素の働きによるものや生物の自己消化作用による変化などもその類型に収まる。"},{"page_url":"https://de.wikipedia.org/wiki/Domaso","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Map_of_comune_of_Domaso_%28province_of_Como%2C_region_Lombardy%2C_Italy%29.svg","page_title":"Domaso","context_page_description":"Domàso ist eine Gemeinde mit 1479 Einwohnern in der italienischen Provinz Como in der Region Lombardei."},{"page_url":"https://it.wikipedia.org/wiki/Casa_in_via_dello_Sprone","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Casa_in_via_dello_sprone_03.JPG","page_title":"Casa in via dello Sprone","context_page_description":"La Casa in via dello Sprone è un edificio polifunzionale situato in via dello Sprone 1a-1c, angolo via Guicciardini, a Firenze, opera dell'architetto Giovanni Michelucci."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%85%B9%E8%B6%B3%E9%A1%9E%E3%81%AE%E5%88%86%E9%A1%9E_(%E3%83%96%E3%82%B7%E3%82%A7%26%E3%83%AD%E3%82%AF%E3%83%AD%E3%83%AF2005%E5%B9%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Phyllidia_babai_%28Nudibranch%29.jpg","page_title":"腹足類の分類 (ブシェ&ロクロワ2005年)","context_page_description":"腹足類の分類は、パリ自然史博物館のフィリップ・ブシェとジャン＝ピエール・ロクロワによって2005年に公表された、軟体動物のうちの腹足類の分類体系である。\\n21世紀初頭前後に急速に進展した腹足類の系統分研究の結果を踏まえたもので、「Classification and Nomenclator of Gastropoda Families」の表題で軟体動物研究の専門雑誌『Malacologia』47巻1-2号の合併号として出版された。真の系統関係の反映に近づくための新たな一歩で、これ以降の修正・変更などは電子出版のかたちでアップデートするとしている。\\nなお実際の分類体系の著者はブシェと他の5人の専門家らであり、ロクロワ自身は入っていないが、彼は文献調査と編集とをブシェとともに行った。"},{"page_url":"https://it.wikipedia.org/wiki/Monetazione_da_Nerva_ad_Adriano","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/TRAIANUS_RIC_II_461-84001016.jpg","page_title":"Monetazione da Nerva ad Adriano","context_page_description":"Per monetazione da Nerva ad Adriano si intende l'insieme delle monete emesse da Roma durante il principato dei primi tre imperatori adottivi: Nerva, Traiano ed Adriano."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%97%D0%B0%D0%BB%D0%B0_%D0%BD%D0%B0_%D1%81%D0%BB%D0%B0%D0%B2%D0%B0%D1%82%D0%B0_%D0%BD%D0%B0_WWE","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/10.2.10TammyLynnSytchByLuigiNovi1.jpg","page_title":"Зала на славата на WWE","context_page_description":"Залата на славата на WWE е зала на славата за кеч личности, поддържани от WWE. Беше официално създадена на 22 март 1993 в епизод на Първична сила където Андре Гиганта, който умря два месеца по-рано, беше провъзгласен за единственото въведение. Церемониите през 1994 и 1995 в съчетание с pay-per-view турнирите Крал на ринга. През 1996, церемонията беше с турнира Сървайвър, за първи път пред платила публика, както кечистите, след което Залата на славата направи прекратяване.\\nПрез 2004, WWE възобновиха Залата на славата и се съчета с КечМания 20. Тази церемония, като предишните, небеше излъчена по телевизията, но беше пусната на DVD на 1 юни 2004. Започвайки с церемонията 2005, редактирана версия на Залата на славата беше излъчена по Spike TV и по USA Network; те бяха излъчени на запис. От 2005, цялата церемония Залата на славата беше част от КечМания DVD записа, и от 2014, се излъчва пряко по WWE Network. През 2015, Историческите церемонии Зала на славата на WWE стана на разположение по WWE Network.\\nВъпреки че сграда никога не е била построена за представяне на Залата на славата, WWE е поглеждала назад за изграждането на съоръжението."},{"page_url":"https://en.wikipedia.org/wiki/Tijuana","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Maquiladora.JPG","page_title":"Tijuana","context_page_description":"Tijuana is the largest city of both Baja California State and the Baja California Peninsula. It is part of the San Diego–Tijuana transborder urban agglomeration and the larger Southern California megalopolis. As the 6th-largest city in Mexico and center of the 6th-largest metro area in Mexico, Tijuana exerts a strong influence in education and politics – across Mexico, in transportation, culture and art – across all three Californias, and in manufacturing and as a migration hub – across the North American continent. Currently one of the fastest-growing metropolitan areas in Mexico, Tijuana maintains GaWC 'sufficiency city' status. As of 2015, the city of Tijuana had a population of 1,641,570.\\nTijuana is located on the Pacific coast of Baja California, and is the municipal seat and the cultural and commercial center of Tijuana Municipality. Tijuana covers 70% of the territory of the municipality and contains 80% of its population. A dominant manufacturing center of the North American continent, the city maintains facilities of many multinational conglomerate companies. In the early 21st century, Tijuana became the medical-device manufacturing capital of North America."},{"page_url":"https://es.wikipedia.org/wiki/Arquitectura_de_las_catedrales_y_las_grandes_iglesias","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Pisa-duomo01_adjusted.jpg","page_title":"Arquitectura de las catedrales y las grandes iglesias","context_page_description":"La arquitectura de las catedrales y las grandes iglesias —basílicas, colegiatas e iglesias abaciales— se caracteriza por la gran escala de los edificios, y tipológica y estilicamente, su diseño sigue alguna de las tradiciones de forma, función y estilo que derivan todas, en última instancia, de las tradiciones arquitectónicas paleocristianas establecidas en el período constantiniano.\\nLas catedrales, en particular, así como muchas iglesias abaciales y basílicas, tienen formas edificatorias complejas que se encuentran con menos frecuencia en las iglesias parroquiales. También tienden a mostrar el estilo arquitectónico imperante en su época y en ellas trabajaron los mejores arquitectos, maestros de obras y artesanos ocupando un estatus, tanto eclesiástico como social, que una iglesia parroquial ordinaria no tiene. Dado que las catedrales y grandes iglesias solían ser los mejores edificios de cada región, fueron una expresión de orgullo local."},{"page_url":"https://en.wikipedia.org/wiki/Bass_guitar","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/62/Precision_Bass_pickup.jpg","page_title":"Bass guitar","context_page_description":"The bass guitar, electric bass, or simply bass, is the lowest-pitched member of the guitar family. It is a plucked string instrument similar in appearance and construction to an electric or an acoustic guitar, but with a longer neck and scale length, and typically four to six strings or courses. Since the mid-1950s, the bass guitar has largely replaced the double bass in popular music.\\nThe four-string bass is usually tuned the same as the double bass, which corresponds to pitches one octave lower than the four lowest-pitched strings of a guitar. It is played primarily with the fingers or thumb, or by striking with a pick. The electric bass guitar has pickups and must be connected to an amplifier and speaker."},{"page_url":"https://pt.wikipedia.org/wiki/San_Benedetto_in_Piscinula","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Trastevere_-_s_Benedetto_in_Piscinula_pavimento_1040040.JPG","page_title":"San Benedetto in Piscinula","context_page_description":"San Benedetto in Piscinula é uma igreja muito antiga e muito pequena localizada no rione Trastevere de Roma, Itália, e dedicada a São Bento. A igreja está hoje sob os cuidados dos Arautos do Evangelho."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B8%E3%83%BC%E3%82%AF%E3%83%A0%E3%83%B3%E3%83%88%E3%83%BB%E3%83%95%E3%83%AD%E3%82%A4%E3%83%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Une_le%C3%A7on_clinique_%C3%A0_la_Salp%C3%AAtri%C3%A8re_02.jpg","page_title":"ジークムント・フロイト","context_page_description":"ジークムント・フロイトは、オーストリアの精神科医。神経病理学者を経て精神科医となり、神経症研究、自由連想法、無意識研究を行った。精神分析学の創始者として知られる。"},{"page_url":"https://ru.wikipedia.org/wiki/Extreme_40","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Extreme_Sailing_Series_on_Neva_river.JPG","page_title":"Extreme 40","context_page_description":"Экстрим-40 — класс гоночных парусных катамаранов. Корпус имеет длину 40 футов и делается из углеволокна. Развивает скороcть до 40 узлов и способен идти со скоростью в 35 узлов при ветре в 20-25 узлов. С точки соотношений размеров корпуса и нагрузки парусами Экстрим-40 является сильно увеличенной версией гоночного катамарана Торнадо, в прошлом олимпийского класса. Разработан французским яхтсменом и дизайнером Ивом Лодэ, олимпийским чемпионом 1992 года в классе Торнадо. Впервые представлен в 2005 году. На катамаранах этого типа с 2007 по 2015 гг. проводили серию парусных регат Extreme Sailing Series, в прошлом известную как iShares Cup."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B0%D0%BB%D0%B5%D0%BD%D1%82%D0%B8%D0%BD%D0%B8%D0%B0%D0%BD_I","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Valens_Honorius_Musei_Capitolini_MC494.jpg","page_title":"Валентиниан I","context_page_description":"Фла́вий Валентиниа́н — римский император в 364—375 годах, часто именуемый просто Валентиниа́н I. 26 февраля 364 года провозглашён войском в Никее преемником императора Иовиана, но принял на себя лишь управление западной частью империи, а восточную предоставил своему младшему брату Валенту. Он был способным правителем, одинаково заботившимся о внутренних и внешних делах, в религиозных вопросах обнаруживал необыкновенную терпимость, несмотря на свою приверженность к никеизму, и вообще был человеком справедливым, хотя нередко, под влиянием вспыльчивости доходил до жестокости. Скончался от инсульта во время переговоров с вождём племени квадов. Является основателем династии Валентиниана.\\nИмел титулы: Август — с 26 февраля 364 года; Германский Величайший — с 366 или 368 года; Аламаннский Величайший и Франкский Величайший — с 368 года; Готский Величайший — с 369 года. Власть трибуна получил 26 февраля 364 года."},{"page_url":"https://fr.wikipedia.org/wiki/Uroplatus_lineatus","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a0/Uroplatus_Lineatus.jpg","page_title":"Uroplatus lineatus","context_page_description":"Uroplatus lineatus est une espèce de geckos de la famille des Gekkonidae."},{"page_url":"https://fr.wikipedia.org/wiki/Aincourt","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Beautiful_Aincourt_in_Spring.JPG","page_title":"Aincourt","context_page_description":"Aincourt est une commune française située dans le département du Val-d'Oise en région Île-de-France."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%9B%D7%91%D7%99_%D7%97%D7%93%D7%A8%D7%94_(%D7%9B%D7%93%D7%95%D7%A8%D7%92%D7%9C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Maccabi_hadera_soccer.jpg","page_title":"מכבי חדרה (כדורגל)","context_page_description":"מכבי חדרה הייתה קבוצת כדורגל ישראלית מהעיר חדרה, שהייתה קיימת בין השנים 1914–2004. הקבוצה שיחקה בתחילה בליגות מחוזיות של ארץ ישראל בזמן תקופת המנדט הבריטי, ולאחר מכן השתלבה בליגות הנמוכות בישראל עד לפירוקה בשנות האלפיים המוקדמות. הקבוצה הגיעה לשיאה בשנת 1986 כאשר העפילה לחצי גמר גביע המדינה, ובכך הפכה לקבוצה הראשונה מהליגה השלישית שעולה לחצי גמר גביע המדינה."},{"page_url":"https://da.wikipedia.org/wiki/Heinrich_Sch%C3%BCtz","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Heinrich_Sch%C3%BCtz_2.jpg","page_title":"Heinrich Schütz","context_page_description":"Heinrich Schütz var en tysk komponist og organist. Den tyske musiks fader, som han blev kaldt, var sin tids betydeligste tyske tonekunstner. Schütz kom viden om i sit liv med ophold i Kassel, Venedig, København, Hannover, Wolfenbüttel, Gera, Weimar og Zeitz.\\nMusikalsk placeres Schütz som overgangsfigur mellem den tidlige og den sene barokmusik. Store dele af hans musik var vokal, men desuden skrev han en hel del musik beregnet for særlige begivenheder, således til festlighederne i anledning af den udvalgte prins Christians bryllup med den sachsiske prinsesse Magdalene Sibylle i 1634. Selv var han inspireret af blandt andre Giovanni Gabrieli og Claudio Monteverdi, og han var selv inspiration for den nordtyske orgelskole, der kulminerede med Johann Sebastian Bach.\\nVed siden af sin komponistvirksomhed fungerede Schütz som organist og kapelmester."},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_di_San_Martino_(Campi_Bisenzio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Campi_bisenzio-san_martino-campanile.jpg","page_title":"Chiesa di San Martino (Campi Bisenzio)","context_page_description":"La chiesa di San Martino è un luogo di culto cattolico di Campi Bisenzio situato nel quartiere San Lorenzo, nella parte occidentale del comune, oltre il fiume Bisenzio."},{"page_url":"https://oc.wikipedia.org/wiki/Islam","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/Kairouan._Minbar_und_Maqsura.jpg","page_title":"Islam","context_page_description":"L'islam es una religion abraamica s'apiejant sul dògma del monoteïsme absolut e prenent sa font dins l'Alcoran, considerat coma lo recuèlh de la paraula de Dieu, Allà revelada a Maomet, proclamat per aqueles qu'aderisson a l'islam coma essent lo darrièr profèta de Dieu, al sègle VII en Arabia. Un adèpte de l'islam se nomena un musulman. L'islam revendica per fondament e ensenhament màger le tawhid, es a dire lo monoteïsme mai epurat ont lo culte es vodat sonque a Dieu, sens li atribuir pas cap filh.\\nLos musulmans creson que Dieu es un e incomparable e que la tòca de l'existéncia es d'adorar Dieu. Los musulmans creson tanben que l'islam es la version complèta e universala d'una fe primordiala que foguèt revelada mai d'un còp pel passat mejans los profètas, coma Adam, Noè, Abraam, Moïses e Jèsus. Atal, se presenta coma un retorn sus la dralha d'Abraam del punt de vita de la cresença, l'Alcoran lo definissant coma essent l'escandilh-pè, la lèga de la Kaaba, lo mila d'Abraham, es a dire una somission exclusiva a la volontat d'Allà."},{"page_url":"https://en.wikipedia.org/wiki/York_and_Doncaster_branch","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Selby_bascule_railway_bridge.jpg","page_title":"York and Doncaster branch","context_page_description":"The York and Doncaster branch was a railway line that opened in 1871 connecting Doncaster with York via Selby in Yorkshire, England. This line later became part of the East Coast Main Line and was the route that express trains took between London King's Cross, the north of England and Scotland. It was opened by the North Eastern Railway between York and Shaftholme Junction, some 4.5 miles north of Doncaster railway station. Between its opening in 1871 and the grouping in 1923, the line was used by both the NER, and the Great Northern Railway. All of the intermediate local stations that had opened with the line in 1871 closed down in the 1950s and 1960s leaving just Selby open between the town of Doncaster and the city of York.\\nIn the 1970s, a plan for extracting the coal from underneath the northern section of the line between Selby and York, led to British Rail building an avoiding line, the Selby Diversion, which fully opened to traffic in October 1983. The southern section of the line between Doncaster and Selby is still open to enable trains from Doncaster to access the East Riding of Yorkshire and Lincolnshire."},{"page_url":"https://ca.wikipedia.org/wiki/2016_en_el_domini_p%C3%BAblic","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Le_commandant_d%E2%80%99Ollone_offrant_l%E2%80%99%C3%A9charpe_de_f%C3%A9licit%C3%A9_au_Dala%C3%AF-Lama.png","page_title":"2016 en el domini públic","context_page_description":"Aquesta llista l'actualitza periòdicament un bot. Els canvis manuals es perdran en la propera actualització!"},{"page_url":"https://en.wikipedia.org/wiki/Nikon_Coolpix_series","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Nikon_Coolpix_S9700_Front_01.JPG","page_title":"Nikon Coolpix series","context_page_description":"The Nikon Coolpix series are digital compact cameras in many variants produced by Nikon. It includes superzoom, bridge, travel-zoom, miniature compact and waterproof/rugged cameras."},{"page_url":"https://sv.wikipedia.org/wiki/Pleuronichthys_decurrens","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/75/Curlfi_sole_distribution_map.png","page_title":"Pleuronichthys decurrens","context_page_description":"Pleuronichthys decurrens är en fiskart som beskrevs av David Starr Jordan och Charles Henry Gilbert, 1881. Pleuronichthys decurrens ingår i släktet Pleuronichthys och familjen flundrefiskar. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D1%80%D0%BE%D0%BB%D0%B8%D0%BD%D0%B3%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/843-870_Europe.jpg","page_title":"Каролингская империя","context_page_description":"Каролингская империя — европейское государство, существовавшее в IX веке. В его состав входили территории Франции, Германии и Италии, а также ряда других современных государств Европы. Официально государство называлось «Империя Запада» фр. Empire d’Occident, однако в историографии его называют Франкская или Каролингская империя. Правители империи носили обычно титул «император Римлян» или «император Римской империи», позиционируя себя наследниками Западной Римской империи. Столицей был Ахен.\\nИмперия возникла 25 декабря 800 года, когда король Франкского государства Карл Великий был коронован папой Львом III в Риме императорской короной. В 840—843 годах империя фактически распалась на 3 королевства — Западно-Франкское, Восточно-Франкское и Срединное, правитель которого сохранил императорский титул. Срединное королевство в свою очередь в 855 году распалось на 3 части — Италию, Лотарингию и Прованс. В 884 году Карлу III Толстому удалось на время восстановить единую Каролингскую империю, но объединение оказалось недолговечным, и уже в конце 887 года Карл был смещён, а империя окончательно распалась на несколько королевств."},{"page_url":"https://en.wikipedia.org/wiki/Leon_Collins","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Leon_Collins.jpg","page_title":"Leon Collins","context_page_description":"Leon Collins was an American tap dancer.\\nCollins was born Leandre Kollins in Chicago, Illinois to a father of West Indian descent. He began tap dancing at an early age, but he wanted to be a prizefighter. As a teenager, Collins performed with worked with Count Basie's orchestra, the bands of Erksine Hawkins, Earl Hines, and Tito Puente. By the age of seventeen he relocated to Detroit, where he married blues singer Tina Dixon. The couple moved to New York City where Dixon, who was signed to perform with the Jimmie Lunceford Orchestra, recommended that Collins perform with the orchestra when the opening act called out sick. Impressed by his performance, Lunceford signed Collins to a five-year contract.\\nAs work opportunities dried out when rock and roll became popular and big bands became less in demand, he learned to play the guitar, and attended the Berklee School of Music in Boston. By the early 1960s, he was forced to give up dance entirely and during this interim, restored cars for fourteen years until tap dance began to experience a revival. At the urging of people like Tina Pratt and Stanley Brown, he came out of retirement and began to teach."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%83%D0%BF%D0%B5%D1%80%D1%81%D0%BE%D0%BE%D1%80%D1%83%D0%B6%D0%B5%D0%BD%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Macao_Casino_Lisboa_at_night_small.jpg","page_title":"Суперсооружения","context_page_description":"Суперсооружения - документальный телевизионный сериал канала National Geographic, освещающий вопросы строительства, функционирования и уничтожения крупнейших сооружений построенных человеком. Каждая серия даёт краткий экскурс в историю создания каждого суперсооружения, его применения и кратко рассказывает о перспективах развития.\\nРяд серий позднее были выделены в отдельные сериалы, такие как: Суперсооружения древности, Боевые машины, Мегаслом, Мегазаводы, Супермосты, Грандиозные переезды."},{"page_url":"https://en.wikipedia.org/wiki/Chilliwack_Lake_Provincial_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Chilliwack_Lake.png","page_title":"Chilliwack Lake Provincial Park","context_page_description":"Chilliwack Lake Provincial Park is a provincial park in British Columbia, Canada. Covering 92.58 km², the park is located 150 km east of Vancouver in the Chilliwack River Valley."},{"page_url":"https://lv.wikipedia.org/wiki/P%C4%81lmera","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/PalmerFromGlaciar.JPG","page_title":"Pālmera","context_page_description":"Pālmera ir Amerikas Savienoto Valstu polārstacija Antarktīdā. Izvietota Anveras salas dienvidu galā Artura līča krastā. Vienīgā ASV Antarktikas stacija, kas izvietota ziemeļos no Dienvidu polārā loka. Nosaukta par godu Natenjelam Pālmeram, kurš, kā tiek uzskatīts, bija pirmais amerikānis, kas ieraudzījis Antarktīdu."},{"page_url":"https://pl.wikipedia.org/wiki/Autosegment_F","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Bentley_Continental_Flying_Spur_02.JPG","page_title":"Autosegment F","context_page_description":"Autosegment F – najwyższa, luksusowa klasa samochodów osobowych. Są to najczęściej najdroższe limuzyny oferowane przez producentów, najlepiej wyposażone i napędzane najmocniejszymi silnikami.\\nCzasami z tego segmentu są dodatkowo wyróżniane samochody ultraluksusowe, zazwyczaj produkowane przez wyspecjalizowane firmy na indywidualne zamówienie klienta.\\nPrzykładowi przedstawiciele segmentu F:\\nMercedes-Benz klasy S\\nBMW serii 7\\nAudi A8\\nVolkswagen Phaeton\\nHyundai Equus\\nLexus LS\\nJaguar XJ\\nPorsche Panamera\\nCadillac DeVille\\nLincoln Town Car\\nMercury Grand Marquis\\nFisker Karma\\nNissan President\\nMaserati Quattroporte\\nRolls-Royce Phantom\\nCadillac Eldorado\\nMaybach 57/Maybach 62\\nBentley Continental\\nToyota Century."},{"page_url":"https://pl.wikipedia.org/wiki/Che%C5%82m","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Che%C5%82m_Nowe_Miasto_P-1088_1926_Zeszyt6_s19b.jpg","page_title":"Chełm","context_page_description":"Chełm – miasto na prawach powiatu we wschodniej Polsce, w województwie lubelskim. Leży 42 km od granicy z Białorusią i 27 km od granicy z Ukrainą w pobliżu przejścia granicznego w Dorohusku. Leży nad rzeką Uherką, lewym dopływem Bugu, jest trzecim co do liczby ludności miastem w województwie.\\nChełm położony jest na terenie historycznej Rusi Czerwonej. Miasto królewskie lokowane w 1392 roku, do czasu rozbiorów położone w województwie ruskim. Należało do starostwa chełmskiego w 1570 roku. Chełm uzyskał prawo składu w 1541 roku. Miasto rządowe Królestwa Kongresowego, położone było w 1827 roku w powiecie chełmskim, obwodzie krasnostawskim województwa lubelskiego. Stolica historycznej ziemi chełmskiej, guberni chełmskiej, województwa chełmskiego 1975–1998 i kilkakrotnie powiatu.\\nMiasto wyróżnia się bogatą historią dawnego styku trzech kultur: polskiej, ruskiej i żydowskiej.\\nWedług danych GUS z 31 grudnia 2019 r. Chełm liczył 61 932 mieszkańców."},{"page_url":"https://de.wikipedia.org/wiki/Hann._M%C3%BCnden","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Altetr_Packhof_6_2008.jpg","page_title":"Hann. Münden","context_page_description":"Hann. Münden ist eine Stadt und selbständige Gemeinde im Landkreis Göttingen, Südniedersachsen, an der Grenze zu Hessen sowie unweit von Thüringen. Der Kernort ist ein staatlich anerkannter Erholungsort.\\nDie Ortschaft befindet sich am Zusammenfluss von Werra und Fulda zur Weser. Deshalb wird die Stadt auch „Drei-Flüsse-Stadt“ genannt. Bekannt ist die Stadt außerdem durch die Grabstätte des deutschen Handwerkschirurgen und Starstechers Johann Andreas Eisenbarth, der verstarb, als er in Münden Station machte. Von der Lage der Stadt im Weserdurchbruchstal soll auch Alexander von Humboldt angetan gewesen sein. Über das oft verwendete Humboldt-Zitat, Münden sei „eine der sieben schönstgelegenen Städte der Welt“, gibt es allerdings keine schriftlichen Aufzeichnungen."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AA%E3%82%B9%E3%83%88%E3%83%AB%E3%83%95%E3%83%BB%E3%83%B4%E3%82%A3%E3%82%A8%E3%83%AB%E3%82%B3%E3%83%9D%E3%83%AB%E3%82%B9%E3%82%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Ostrow_Wlkp-fasada_boznicy_noca.jpg","page_title":"オストルフ・ヴィエルコポルスキ","context_page_description":"オストルフ・ヴィエルコポルスキは、ポーランド中央部のヴィエルコポルスカ県にある都市。オストルフ・ヴィエルコポルスキ郡の郡庁所在地で、県内ではポズナニ、カリシュ、コニン、ピワに次ぐ第五の都市である。人口は7万2364人。かつては単にオストルフと呼ばれていた。ドイツ語名はオストロヴォ 、ラテン語名はオストロヴィア 。"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A0%D0%B8%D0%BD%D0%B3%D1%81%D0%B1%D0%B5%D1%80%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Ringsberg_Wappen.png","page_title":"Рингсберг","context_page_description":"Рингсберг општина је у њемачкој савезној држави Шлезвиг-Холштајн. Једно је од 134 општинска средишта округа Шлезвиг-Фленсбург. Према процјени из 2010. у општини је живјело 515 становника. Посједује регионалну шифру 1059157."},{"page_url":"https://hr.wikipedia.org/wiki/Carsko_selo","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Catherine_Palace_in_Tsarskoe_Selo%2C_grille.jpg","page_title":"Carsko selo","context_page_description":"Carsko selo je muzejski kompleks u gradu Puškinu koji je nekada bio prigradska ljetna rezidencija ruske carske obitelji i gostujućeg plemstva, 24 km južno od središta Sankt-Peterburga. Carsko selo je jedno od zaštićenih mjesta svjetske baštine Sankt Peterburga. Muzejski kompleks uključuje: Katarinin park s palačom i paviljonima, Aleksandrov park s palačom i paviljonima i Babolovski park s palačom"},{"page_url":"https://de.wikipedia.org/wiki/Das_neue_Wiesbaden","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/S%C3%B6hnlein-Villa.JPG","page_title":"Das neue Wiesbaden","context_page_description":"Unter dem Titel „Das neue Wiesbaden: Städtebau ist kein Zustand, sondern ein Vorgang!“ veröffentlichte der Architekt Ernst May 1963 eine städtebauliche Planung für die hessische Landeshauptstadt Wiesbaden.\\nDas Buch beschreibt den Bau der Siedlungen Klarenthal, Parkfeld, Schelmengraben und die Pläne der Neubebauung des Bergkirchenviertels. Enthalten ist auch die Gesamtplanung von May, der Gesamtverkehrsplan von R. Schaaf und ein Auszug aus dem Wirtschaftsgutachten von W. Bosch.\\nZiel des Projekts war die Beseitigung des akuten Wohnungsmangels mit dem Bau hochwertiger Siedlungen; es sah aber anfangs auch den Abriss vieler historistischer Villen am Bierstadter Hang vor. Dieser Punkt wurde später stark kritisiert und gilt einigen als abschreckendes Beispiel im Umgang mit Altbauten, die in diesem Fall heute unter Denkmalschutz stehen."},{"page_url":"https://de.wikipedia.org/wiki/Graben_(Lechfeld)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Graben%2C_A_-_Kirche_v_W.JPG","page_title":"Graben (Lechfeld)","context_page_description":"Graben ist eine Gemeinde und eine Ortschaft im schwäbischen Landkreis Augsburg. Es ist der Heimatort der Familie Fugger."},{"page_url":"https://de.wikipedia.org/wiki/Maripipi","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Ph_locator_biliran_maripipi.png","page_title":"Maripipi","context_page_description":"Maripipi ist eine philippinische Stadtgemeinde in der Provinz Biliran. Sie hat 7159 Einwohner. Die Stadtgemeinde liegt auf der gleichnamigen Insel Maripipi Island. Zum Verwaltungsgebiet der Gemeinde gehört Sambawan Island, das von der Touristikbehörde als ein attraktives Tauchgebiet beworben wird."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%A4%A7%E6%AC%96%E9%83%8A%E9%87%8E%E5%85%AC%E5%9C%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Tai_Lam_Country_Park.jpg","page_title":"大欖郊野公園","context_page_description":"大榄郊野公园是香港新界的一座郊野公园，占地达5,370公顷，于1979年2月23日划定，地区行政上大部分属于元朗区。公园毗邻锦上路、屯门、深井及青龙头，园内有田夫仔和清快塘两个乡村，是香港面积第二大的郊野公园。公园范围东至荃锦公路，南面为屯门公路以北一带，北面至石岗、河背水塘引水道及大棠等地，而西面为屯门及蓝地水塘。"},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_de_lemn_din_B%C4%83i%C8%99oara","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Biserica_de_lemn_din_Baisoara10.JPG","page_title":"Biserica de lemn din Băișoara","context_page_description":"Biserica de lemn din Băișoara, reprezintă un caz aparte în lunga listă a disputelor între ortodocși și greco-catolici privind proprietatea lăcașelor de cult. Mediatizarea cazului, încetul cu încetul a deviat atenția publicului de la soarta bisericii de lemn, concentrându-se asupra problemei patrimoniale în ansamblul ei. Azi, lemnele care altădată formau biserica de lemn se află stivuite departe de Băișoara, în satul Pădurenii din comuna Tritenii de Jos, județul Cluj. Biserica era construită în anul 1852 și avea hramul „Sfinții Arhangheli Mihail și Gavriil”."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AA%E3%82%B5%E3%83%BB%E3%83%A9%E3%83%BC%E3%82%BD%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Lindberg_Larson.jpg","page_title":"リサ・ラーソン","context_page_description":"インガ・リサ・ラーソンはスウェーデンの世界的な陶芸家、デザイナー。有名な彫刻に Small Zoo, ABC-girls, Africa Children of the World などがある。"},{"page_url":"https://sh.wikipedia.org/wiki/Sergej_Birjuzov","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/The_Soviet_Union_1967_CPA_3490_stamp_%28World_War_II_Hero_Marshal_Sergey_Biryuzov%29.jpg","page_title":"Sergej Birjuzov","context_page_description":"Sergej Semjonovič Birjuzov sovjetski maršal, Heroj Sovjetskog Saveza i narodni heroj Jugoslavije."},{"page_url":"https://en.wikipedia.org/wiki/Amy_Perez","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Amy_Perez_Paynauen_in_2015.jpg","page_title":"Amy Perez","context_page_description":"Maria Armida Parale Perez, known as Amy Perez, is a Filipino TV and radio presenter and occasional actress who is best known for hosting the now-defunct Philippine noontime show Magandang Tanghali Bayan on ABS-CBN and the reality tabloid talk show, Face to Face on TV5. In 2013, she co-hosts The Singing Bee with Roderick Paulate. In 2016, Perez is set to be one of the main host of It's Showtime on ABS-CBN to make her comeback as a noontime show host."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%A0%D1%8D%D0%B3%D1%96%D1%91%D0%BD%D1%8B_%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D1%8B%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Regions_France_2016.svg","page_title":"Рэгіёны Францыі","context_page_description":"Рэгіёны Францыі — адміністрацыйна-тэрытарыяльная адзінка верхняга ўзроўню ў Францыі. Рэгіён уяўляе сабой пэўную тэрыторыю, якая характарызуецца ўласнай культурай ці сацыяльнай ідэнтычнасьцю. Краіна падзеленая на 18 рэгіёнаў, 12 зь іх разьмешчаныя на кантынэнтальнай частцы краіны, яшчэ адзін - у Міжземным моры, а астатнія — на заморскіх тэрыторыях. Рэгіёны падзяляюцца на дэпартамэнты."},{"page_url":"https://cs.wikipedia.org/wiki/Stona%C5%99ov","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Stona%C5%99ov%2C_house_No_17.jpg","page_title":"Stonařov","context_page_description":"Městys Stonařov se nachází v okrese Jihlava v Kraji Vysočina. Žije zde přibližně 1 100 obyvatel. Leží na rušné trase E59.\\nSousedními obcemi sídla jsou Cerekvička-Rosice, Otín, Suchá, Dlouhá Brtnice, Brtnice a Brtnička."},{"page_url":"https://es.wikipedia.org/wiki/Sal%C3%B3n_de_la_Fama_de_la_WWE","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Mike_Tyson_Portrait.jpg","page_title":"Salón de la Fama de la WWE","context_page_description":"WWE Hall of Fame es un salón de la fama de la lucha libre profesional creado por la empresa WWE. Oficialmente fue creado el 1 de febrero de 1993 durante un episodio del programa de la WWE Monday Night Raw.​​ Durante un episodio de Raw se anunció que André the Giant sería el único hombre introducido al \\"Hall of Fame\\". De hecho, la creación del Salón de la Fama se debió a la muerte de André.​\\nLas ceremonias de 1994 y 1995 fueron realizadas durante el pago por evento King of the Ring, y la de 1996 fue realizada en Survivor Series. En 2004 la ceremonia del Salón de la Fama volvió a realizarse pero esta vez un día antes de WrestleMania.​ A difererencia de sus predecesoras está ceremonia fue lanzada junto al DVD de WrestleMania.​\\nExiste una fuerte crítica debido a que la forma de elegir a algunos miembros no es transparente. A veces no se privilegia una gran trayectoria o grandes logros, ya que gente como Pete Rose, Drew Carey, Mike Tyson, Donald Trump o Snoop Dogg, que no son luchadores, fueron introducidos en el Salón. Esto se debe a que firman un contrato con la World Wrestling Entertainment para permitir emitir mercancía de ellos."},{"page_url":"https://fi.wikipedia.org/wiki/Sete_Gibernau","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Sete_Gibernau_2005.jpg","page_title":"Sete Gibernau","context_page_description":"Manuel ”Sete” Gibernau Bultó on uransa päättänyt espanjalainen ratamoottoripyöräilijä. Hän sijoittui parhaimillaan kausilla 2003 ja 2004 MotoGP:n yhteispisteissä toiseksi häviten molemmilla kerroilla Valentino Rossille, jonka kanssa Gibernau kävi tiukan taiston kauden 2004 voitosta, häviten mestaruuden kuitenkin 47 pisteellä. Gibernau lopetti uransa kauden 2006, mutta palasi MotoGP:hen vielä kaudelle 2009 ollen parhaimmillaan yhdestoista kotikilpailussaan. Aiemmalla urallaan Gibernau kilpaili 250-kuutioisissa ja MotoGP:n edeltäjäluokassa 500-kuutioisissa ilman suurempaa menestystä. Kaudella 2001 hän voitti yhden kilpailun 500-kuutioisissa. Koko urallaan Gibernau saavutti yhdeksän voittoa, 30 palkintokorokesijaa ja 13 paalupaikkaa.\\nGibernau on 177 senttimetriä pitkä ja painaa 70 kilogrammaa."},{"page_url":"https://he.wikipedia.org/wiki/%D7%95%D7%A8%D7%99%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/The_Synagogue_in_Veria-the_Torah_ark.jpg","page_title":"וריה","context_page_description":"וריה היא עיר במקדוניה שביוון, כ-60 ק\\"מ מערבית לסלוניקי. ידועה בעיקר בזכות הקבר המפואר המיוחס לפיליפוס השני מלך מוקדון, הנמצא ברובע ורגינה."},{"page_url":"https://nds.wikipedia.org/wiki/Fadenw%C3%B6rmer","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Wuchereria_bancrofti_1_DPDX.JPG","page_title":"Fadenwörmer","context_page_description":"De Fadenwörmer oder, je na Dialekt, ok Fadenwurms, Fadenpieren oder Fadenwörm nömmt, oder ok Nematoden sünd en Stamm binnen dat Riek vun de Deerter. Dor höört unbannig veel Aarden to. Bitherto sünd dor mehr, as 20.000 Aarden vun beschreven wurrn. Wohrschienlich sünd se mank de Veelzellers de Grupp mit de meisten Individuen. Dat warrt taxeert, datt to de Fadenwörmer 81 % vun all Organismen mank de Deerter tohören doot. Dor hannelt sik dat meist um man lüttje, fadenhaftige Wörmer bi, de in en fuchtig Umto leven doot. Se sünd witt oder hefft gor keen Farv. Allerhand Aarden leevt as Parasiten, dormank ok en Reeg vun Aarden, de den Minschen befallen doot."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9A%D1%80%D1%83%D0%BF%D0%B0%D1%98%D1%81%D0%BA%D0%B8_%D0%B8%D0%B7%D0%B2%D0%BE%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/%D0%9A%D1%80%D1%83%D0%BF%D0%B0%D1%98%D1%81%D0%BA%D0%BE_%D0%B2%D1%80%D0%B5%D0%BB%D0%BE_%D1%88%D1%83%D0%BC%D1%81%D0%BA%D0%B0_%D1%81%D1%82%D0%B0%D0%B7%D0%B0.jpg","page_title":"Крупајски извор","context_page_description":"Крупајскиот извор се наоѓа во источна Србија под западниот дел на варовничката планина Бељаница, од десната страна на Крупајската река, на надморска височина од 220 метри. Изворот се наоѓа во атарот на селото Милановац оддалечено од Жагубица околу 35 километри."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%87%8D%E5%A4%8D%E7%8B%AC%E7%AB%8B%E5%8F%91%E7%8E%B0%E5%8F%91%E6%98%8E%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Marie_Curie_1903.jpg","page_title":"重复独立发现发明列表","context_page_description":"歷史學及社會學上對於科學界「重複獨立發現發明」的現象各有評論。羅伯特·金·莫頓將「重複發現」定義為各自獨立開展研究的科學家得出相似的發現的情況。「有些發現是同時的，或者幾乎同時的；而有些科學家得出的新發現早在幾年前就有人在他不知情的情況下捷足先登。」\\n重複獨立發現發明最常見的例子是微積分、氧氣和演化論的發現及發明。微積分於17世紀由牛頓、萊布尼茨等人各自獨立發明；氧氣於18世紀由舍勒、普里斯特里、拉瓦節各自獨立發現；演化論則是於19世紀，由達爾文和華萊士分別獨立提出。\\n然而，重複獨立發現發明並非只限於科學研究的巨頭之間。莫頓認為科學發現的常態應該是由多人獨立發現，而不是由一個個人或團體獨一無二地發現。\\n莫頓還對比了「重複發現」與「獨特發現」，「獨特發現」是指單一的一位科學家或一組合作的科學家得出的發現。"},{"page_url":"https://sv.wikipedia.org/wiki/Lamont,_Alberta","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Church_lamont_alberta.jpg","page_title":"Lamont, Alberta","context_page_description":"Lamont är en ort i Kanada. Den ligger i provinsen Alberta, i den centrala delen av landet, 2 800 km väster om huvudstaden Ottawa. Lamont ligger 643 meter över havet och antalet invånare är 1 779.\\nTerrängen runt Lamont är platt. Den högsta punkten i närheten är 700 meter över havet, 2,5 km sydväst om Lamont. Trakten runt Lamont är nära nog obefolkad, med mindre än två invånare per kvadratkilometer. Lamont är det största samhället i trakten.\\nTrakten runt Lamont består till största delen av jordbruksmark. Trakten ingår i den hemiboreala klimatzonen. Årsmedeltemperaturen i trakten är 3 °C. Den varmaste månaden är juli, då medeltemperaturen är 18 °C, och den kallaste är december, med -14 °C."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%83%91%E5%B7%9E%E5%85%AC%E4%BA%A4%E7%BA%BF%E8%B7%AF%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/ZZBRT_B67_20200618.jpg","page_title":"郑州公交线路列表","context_page_description":"郑州公交目前共有300余条公共汽车线路正在运营，其主要运营者为郑州市公共交通总公司，亦有绿城巴士公司等公司。除日间线路外还运营有Y开头的夜班线路，市区夜班线路运营到凌晨24点，港区夜班线路Y636则运营到次日凌晨3点。同时还运营有开往市区外景区的专用旅游线路。"},{"page_url":"https://hu.wikipedia.org/wiki/Parabola_(g%C3%B6rbe)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Parabola_shape_in_rotating_layers_of_fluid.jpg","page_title":"Parabola (görbe)","context_page_description":"A parabola egy kúpszelet, amit úgy kaphatunk, ha a körkúp-felületet egy, a kúp alkotójával párhuzamos síkkal metsszük. Másik definíciója szerint a síkban egy adott ponttól és egy, ezen a ponton át nem menő egyenestől egyenlő távolságra levő pontok mértani helye.\\nKülönleges eset az, amikor a metszősík a kúpfelület érintősíkja. Ebben az esetben a parabola metszésvonal egyenessé fajul."},{"page_url":"https://ceb.wikipedia.org/wiki/Notharchus_macrorhynchos","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Zoological_Illustrations_Volume_II_Plate_99.jpg","page_title":"Notharchus macrorhynchos","context_page_description":"Espesye sa langgam nga una nga gihulagway ni Gmelin ni adtong 1788 ang Notharchus macrorhynchos. Ang Notharchus macrorhynchos sakop sa kahenera nga Notharchus sa kabanay nga Bucconidae. Giklaseklase sa IUCN ang espesye sa kinaminosang kalabotan."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Monuments_historiques_in_Dinan","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Dinan_-_6_rue_Haute-Voie_02.JPG","page_title":"Liste der Monuments historiques in Dinan","context_page_description":"Die Liste der Monuments historiques in Dinan führt die Monuments historiques in der französischen Stadt Dinan auf."},{"page_url":"https://en.wikipedia.org/wiki/AN_Tasrail","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Tgr_za_bell_bay.jpg","page_title":"AN Tasrail","context_page_description":"AN Tasrail was an Australian railway operator that operated the Tasmanian rail network from March 1978 until November 2009. It was a subsidiary of the Federal Government's Australian National until November 1997 when sold to Australian Transport Network."},{"page_url":"https://it.wikipedia.org/wiki/Baronia_(Italia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Mappa_Baronia.jpg","page_title":"Baronia (Italia)","context_page_description":"La Baronia è un comprensorio storico-geografico dell'Irpinia."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%92%D0%BE%D0%BB%D1%8E%D0%B1%D0%B8%D0%BB%D0%B8%D1%81","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7f/Volubilis-basilica.jpg","page_title":"Волюбилис","context_page_description":"Волюбилис — Рим империяһының көньяҡ-көнбайышында урынлашҡан ҡала. Уның харабалары Марокконың Мулай-Иҙрис ҡалаһында, Фес һәм Рабат араһындағы автомагистралдән төньяҡҡа ҡарай 35 км алыҫлыҡта ята. 1997 йылдан Бөтә донъя мираҫы ҡомартҡыһы булараҡ ЮНЕСКО-ның яҡлауы аҫтына алынған. Волюбилистың барлыҡҡа килеүе быуаттар төпкөлөнә китә. Уның урынындағы тораҡ неолит ваҡыттарынан алып булған. Беҙҙең эраға тиклем III быуатта округта карфагендар хужа була. Мең йыллыҡтар сигендә Волюбилис Юба II хакимлыҡ иткән Мавретан батшалығының эллинистик мәҙәниәтенең ҙур үҙәге була. 40-сы йылда батша Птоломей үлтерелгәндән һуң ҡала Мавретания провиницияһының үҙәге булараҡ империя составына инә.\\nИсеме латин телендә исеме, тупраҡтың уңдырышлылығына ишара яһап, «йомартлыҡ» тигәнде аңлата. Төп төҙөлөш эштәре Волюбилиста II быуатта барған. Шул саҡта форумы менән базилик төҙөлгән һәм һыу үткәргестәр һалынған. Эдикт Каракалла хөрмәтенә триумфаль арка яҡшы һаҡланған. Уның төҙөлөшөнән һуң бер аҙҙан рим магистраттары Танжерға күсә. Волюбилистың артабанғы тарихы боронғо боронғо авторҙар тарафынан насар яҡтыртылған."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9B%BD%E9%89%84%E3%82%B9%E3%83%8F43%E7%B3%BB%E5%AE%A2%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Ohafu46-18-198508.JPG","page_title":"国鉄スハ43系客車","context_page_description":"国鉄スハ43系客車とは、日本国有鉄道が1951年から製造した客車の形式群である。\\n本形式は急行列車等の優等列車運用に供する目的で投入され、その目的から資料によっては急行形車両に分類されることがある。一方後年は普通列車にも使用されており、国鉄の現場などでは一般形客車と呼ばれ、一般形車両に分類されることもあるが、本形式は正式な意味で急行形や一般形に分類される車両ではない。\\n在来設計の発展型ではあるが、台車構造や車内設備などに多くの新機軸を採り入れ、従来の客車と比較して居住性を大幅に改善した、画期的な客車であった。\\n本項では、当形式と設計の基本を同じくする、特急列車で使用することを目的に投入された客車であるスハ44系客車についても記述する。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Hamburg-Winterhude","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Stolperstein_hudtwalcker_stra%C3%9Fe_23_-_fritz_nathansen.jpg","page_title":"Liste der Stolpersteine in Hamburg-Winterhude","context_page_description":"Die Liste der Stolpersteine in Hamburg-Winterhude enthält alle Stolpersteine, die im Rahmen des gleichnamigen Kunst-Projekts von Gunter Demnig in Hamburg-Winterhude verlegt wurden. Mit ihnen soll Opfern des Nationalsozialismus gedacht werden, die in Hamburg-Winterhude lebten und wirkten.\\nDiese Seite ist Teil der Liste der Stolpersteine in Hamburg, da diese mit insgesamt 5897 Steinen zu groß würde und deshalb je Stadtteil, in dem Steine verlegt wurden, eine eigene Seite angelegt wurde."},{"page_url":"https://en.wikipedia.org/wiki/Ralf_Marc_Walker","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/RMWalker.JPG","page_title":"Ralf Marc Walker","context_page_description":"Ralf Marc Walker was an American department store executive.\\nIn his native Bellevue, Michigan, Walker worked in a grocery store for a certain Mr. C. D. Kimberley. He would later spend time in Wisconsin and Detroit before heading to Los Angeles where Arthur Letts trained him at Letts' Broadway department store, Walker was the co-founder/co-worker owner of the 125,000-square-foot department store known as the Fifth Street Store at Fifth and Broadway in downtown Los Angeles, established in 1905. Walker also owned what would later become known as the Houdini Mansion in Laurel Canyon. He died six months before the opening in San Diego of the first Walker Scott store – which would go on to become a regional chain – on October 3, 1935."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D1%96%D1%94%D0%BD%D1%81%D1%8C%D0%BA%D0%B5_%D0%9F%D0%B0%D0%BB%D1%96%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Siena_Piazza_del_Campo_20030815-375.jpg","page_title":"Сієнське Паліо","context_page_description":"Сіє́нське Па́ліо — традиційні кінні перегони, що відбуваються в італійському місті Сієна."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%92%D1%8D%D0%BD%D1%8D%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Coat_of_Arms_of_Veneto.png","page_title":"Вэнэта","context_page_description":"Вэнэта — адміністрацыйны рэгіён у Італіі."},{"page_url":"https://sv.wikipedia.org/wiki/Vaudelnay","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Vaudelnay_-_Eglise.jpg","page_title":"Vaudelnay","context_page_description":"Vaudelnay är en kommun i departementet Maine-et-Loire i regionen Pays de la Loire i nordvästra Frankrike. Kommunen ligger i kantonen Montreuil-Bellay som tillhör arrondissementet Saumur. År 2009 hade Vaudelnay 1 238 invånare."},{"page_url":"https://pt.wikipedia.org/wiki/3_de_outubro","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Fred_final_copa_confederacoes_2013.jpg","page_title":"3 de outubro","context_page_description":"3 de outubro é o 276.º dia do ano no calendário gregoriano. Faltam 89 para acabar o ano."},{"page_url":"https://no.wikipedia.org/wiki/%C2%ABNR-1%C2%BB","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/21/NR-1_986.jpg","page_title":"«NR-1»","context_page_description":"«NR-1» er en unik atomdrevet undervannsbåt i den amerikanske marinen. Den er et forskningsfartøy på 45 meter lengde og 400 tonn. Den har en besetning på 13, av dem tre offiserer og to vitenskapsfolk.\\nUoffisielt kalles den gjerne «Nerwin»; den har aldri fått noe offisielt navn. Den ble bygget av General Dynamics og sjøsatt 25. januar 1969.\\nDen har en atomreaktor, to eksterne motorer, to propeller og fire beskyttede trustere for bedre manøvreringsevne. Maksimal fart er 4,5 knop ved overflaten, 3,5 knop under vann. Den kan gå ned til en dybde på 725 meter. Den har kapasitet til å holde seg under vann i 16 dager med 13 personer ombord.\\nOppdragene har bestått av søk, opphenting av objekter, geologiske undersøkelser, oseanografisk forskning og installasjon og vedlikehold av utstyr under vann. «NR-1» fungerer godt for å holde seg på ett sted og kartlegge det fullstendig, eller søke et område med stor nøyaktighet.\\nEtter at romfergen Challenger eksploderte i 1986, ble NR-1 brukt til å søke, identifisere, og hente opp vrakdeler. Da den kan holde seg på havbunnen uten å komme opp til overflaten med hyppige mellomrom, var «NR-1» uvurderlig i den delen av søket som foregikk på dypt vann."},{"page_url":"https://pt.wikipedia.org/wiki/Avro_Canada_CF-105","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Avro_Arrow_3-view.jpg","page_title":"Avro Canada CF-105","context_page_description":"O Avro Canada CF-105 Arrow foi um caça supersônico canadense, seu primeiro voo ocorreu em 25 de março de 1958. O projeto foi cancelado em 1959 por uma decisão controversa do governo, apenas protótipos foram fabricados.\\nCom o sucesso alcançado pelo Avro CF-100 Canuck, a Avro Canada iniciou o desenvolvimento de um interceptador de alto desempenho. Durante os testes, a aeronave mostrou-se promissora, porém o desenvolvimento foi abruptamente interrompido, gerando debates e especulações até os dias de hoje.\\nEm 1961, 66 aeronaves McDonnell F-101 Voodoo fabricadas sob licença como CF-101, foram encomendadas pela Força Aérea do Canadá."},{"page_url":"https://de.wikipedia.org/wiki/Tom_Cooper_(Radsportler)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Tom_Cooper_1899.jpg","page_title":"Tom Cooper (Radsportler)","context_page_description":"Tom Cooper war ein US-amerikanischer Rad- und Autorennfahrer."},{"page_url":"https://fr.wikipedia.org/wiki/David_Ross_McCord","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/David_Ross_McCord.jpg","page_title":"David Ross McCord","context_page_description":"David Ross McCord, né à Montréal en 1844 et mort à Guelph en 1930, était un avocat et collectionneur canadien.\\nÀ l’importante collection rassemblée par sa famille dès son établissement au Canada, David Ross McCord entreprend vers 1880 d’ajouter ses propres acquisitions. Ne ménageant ni son temps ni sa fortune, il cherche à travers le Canada les objets les plus beaux et les plus significatifs sur le plan historique. Peu à peu, un projet s’échafaude dans son esprit : fonder un musée d’histoire canadienne à Montréal.\\nDavid Ross McCord consacra donc a peu près toute sa vie et sa fortune au profit de cette cause. Il collectionna les artefacts qui en sont représentatifs et s'intéressa particulièrement aux trois peuples fondateurs du pays : les Français, les Britanniques et les Autochtones.\\nIl légua en 1919 quelque 15 000 objets, images et manuscrits à l'Université McGill, dont une remarquable collection dédiée aux Premières nations. Cette collection sera l'élément principal amenant la naissance du Musée McCord de Montréal en 1921."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%B2%DB%8C%D9%86%D8%B1_%DA%88%D8%A7%D8%A6%DB%8C%D9%88%DA%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/WaveClipper2.png","page_title":"زینر ڈائیوڈ","context_page_description":"زینر ڈائیوڈ ایک دو ٹانگوں والا سادہ الیکٹرونی پُرزہ ہے جو عام ڈائیوڈ کی طرح ہوتا ہے۔ عام ڈائیوڈ میں کرنٹ اینوڈ سے کیتھوڈ کی جانب بہتا ہے۔ لیکن زینر ڈائیوڈ اس طرح بنائے جاتے ہیں کہ ان میں کرنٹ الٹی سمت میں بھی بہہ سکے یعنی کیتھوڈ سے اینوڈ کی طرف۔ اس لیے زینر ڈائیوڈ سرکٹ میں ہمیشہ الٹے لگائے جاتے ہیں۔ عام ڈائیوڈ کے برعکس زینر ڈائیوڈ اس طرح بنائے جاتے ہیں کہ ایک مخصوص وولٹیج پر الٹی سمت میں کرنٹ رواں کر سکیں۔ مثلاً 5 وولٹ کا زینر ڈائیوڈ جب الٹا لگایا گیا ہوتا ہے تو وہ 4 وولٹ پر کرنٹ نہیں گزرنے دیتا مگر 5 وولٹ پر اچانک کرنٹ گزارنے لگتا ہے کیونکہ اس کی بریک ڈاون وولٹیج 5 ہے۔ اس طرح وولٹیج کو 5 وولٹ پر برقرار رکھنے میں مدد ملتی ہے۔ چونکہ زینر ڈائیوڈ زیادہ کرنٹ گزرنے سے جل جاتا ہے اس لیے اس کے ساتھ ہمیشہ سیریز میں ایک رزسٹر لگایا جاتا ہے جو کرنٹ کو قابو کرتا ہے تاکہ زینر ڈائیوڈ جل نہ جائے۔\\nزینر ڈائیوڈ کا نام Clarence Zener کے نام پر رکھا گیا ہے۔ کم بریک ڈاون وولٹیج کے زینر ڈائیوڈ میں Zener effect نمایاں ہوتا ہے جبکہ زیادہ بریک ڈاون وولٹیج کے زینر ڈائیوڈ میں avalanche breakdown زیادہ نمایاں ہوتا ہے۔ بہت زیادہ وولٹیج پر کرنٹ جاری کرنے والے پُرزے عموماً ٹی وی ایس ڈائیوڈ کہلاتے ہیں۔"},{"page_url":"https://af.wikipedia.org/wiki/Omar_Mateen","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Omar_Mateen.jpg","page_title":"Omar Mateen","context_page_description":"Omar Mateen, gebore as Omar Mir Seddique, was 'n Amerikaanse Islamitiese terroris.\\nHy het in 'n gewapende aanval op die Pulse homoklub in Orlando, Florida in die Verenigde State 50 mense gedood en 53 gewond. Hy het eers die 911-nommer van die polisie gebel om 'n eed van trou aan ISIS af te lê en sy naam te gee. Hy het toe die nagklub om 2 uur die oggend binnegegaan en met 'n outomatiese wapen begin skiet. Later het hy gyselaars gevangegeneem. Drie uur later het veiligheidsmagte hom gedood. Omar was 'n Amerikaanse burger van Afgaanse afkoms. Die FBI het hom vroeër ondersoek vanweë kontakte met Moner Mohammed Abusalha, 'n terroris wat in Sirië 'n selfmoordaanslag gepleeg het. Abusalha en Mateen het in dieselfde dorp Fort Pierse gewoon, maar kontak was minimaal."},{"page_url":"https://is.wikipedia.org/wiki/S%C3%A6tbj%C3%B6rk","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Betula_lenta_subsps_lenta_01-10-2005_14.53.56.JPG","page_title":"Sætbjörk","context_page_description":"Sætbjörk er lauftré af birkiætt. Það verður allt að 25 m hátt í heimkynnum sínum og er upprétt og mjóslegið. Litur á berki er dökkrauðbrúnn eða næstum svartur þegar hann er fullþroskaður og flagnar ekki."},{"page_url":"https://sk.wikipedia.org/wiki/La_Roche-Blanche_(Loire-Atlantique)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/W1309-RocheBlanche_StMichelDuBois_1150_21711.JPG","page_title":"La Roche-Blanche (Loire-Atlantique)","context_page_description":"La Roche-Blanche je francúzska obec, ktorá sa nachádza v departemente Loire-Atlantique, v regióne Pays-de-la-Loire."},{"page_url":"https://de.wikipedia.org/wiki/NGC_4874","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/NGC_4874_HST.jpg","page_title":"NGC 4874","context_page_description":"NGC 4874 ist eine sehr große elliptische Galaxie vom Hubble-Typ cD im Sternbild Haar der Berenike am Nordsternhimmel, die schätzungsweise 321 Millionen Lichtjahre von der Milchstraße entfernt ist. Die Galaxie ist etwa zehnmal größer als die Milchstraße und befindet sich im Zentrum des Coma-Galaxienhaufens, in ihrem Halo finden sich über 30.000 Kugelsternhaufen.\\nSie ist vom Typus der cD-Galaxien und dominiert – zusammen mit einer zweiten Riesengalaxie namens NGC 4889 – das Schwerefeld des Galaxienhaufens. Die beiden Sternsysteme haben hohes Alter und sind wahrscheinlich aus der Verschmelzung mehrerer kleiner Spiralgalaxien entstanden.\\nDas Objekt wurde am 5. Mai 1864 von dem deutsch-dänischen Astronomen Heinrich Ludwig d'Arrest entdeckt."},{"page_url":"https://sv.wikipedia.org/wiki/Elymus_virginicus","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Elymus_virginicus_%286181469182%29.jpg","page_title":"Elymus virginicus","context_page_description":"Elymus virginicus är en gräsart som beskrevs av Carl von Linné. Enligt Catalogue of Life ingår Elymus virginicus i släktet elmar och familjen gräs, men enligt Dyntaxa är tillhörigheten istället släktet elmar och familjen gräs. Arten har ej påträffats i Sverige. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://id.wikipedia.org/wiki/Balai_Pustaka","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/COLLECTIE_TROPENMUSEUM_%27Kiosk_van_%27Balai_Poestaka%27_te_Poerwokerto.%27_TMnr_10000591.jpg","page_title":"Balai Pustaka","context_page_description":"Balai Pustaka adalah sebuah perusahaan penerbitan dan percetakan milik negara."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%A5%D0%B8%D0%BC%D0%B0%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Map_of_ancient_Epirus_and_environs_%28P%D1%83%D1%81%D1%81%D0%BA%D0%B8%D0%B9%29.svg","page_title":"Химара","context_page_description":"Химара — Албанияның көньяҡ-көнбайышындағы ҡала, Ион диңгеҙе яры буйында урынлашҡан. Влёра өлкәһенә һәм Влёра округына ҡарай."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9F%E3%83%A9%E3%83%BC%E3%82%B8%E3%83%A5F1_(%E6%88%A6%E9%97%98%E6%A9%9F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/SAAF_Mirage_III_at_AFB_Swartkop.jpg","page_title":"ミラージュF1 (戦闘機)","context_page_description":"ミラージュF1はフランスのダッソー社製の戦闘機である。\\"\\"はフランス語で“幻影”や“蜃気楼”を意味する。表記通りに読めばミラージになる。\\n1970年代を代表する戦闘機の一つであり、多くの国で使用されている。ダッソー社が世に送り出した戦闘機ミラージュ・シリーズにおいて唯一、通常の水平尾翼を備えている。"},{"page_url":"https://pl.wikipedia.org/wiki/Dalia_(ro%C5%9Blina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Dahlia_%27Bishop_of_Auckland.JPG","page_title":"Dalia (roślina)","context_page_description":"Dalia, georginia – rodzaj roślin nasiennych należących do rodziny astrowatych. Pochodzi z Ameryki Środkowej i liczy 15 gatunków. Niektóre są uprawiane w wielu krajach jako rośliny ozdobne. Nazwa wywodzi się od nazwiska szwedzkiego botanika Andersa Dahla. Znana również pod nazwami ludowymi: giergonia, giergona, wielgonia i wielgoń. Gatunkiem typowym jest Dahlia pinnata Cav."},{"page_url":"https://es.wikipedia.org/wiki/A%C3%AFn_Chouhada","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Dz_-_17_-_A%C3%AFn_Chouhada.svg","page_title":"Aïn Chouhada","context_page_description":"Aïn Chouhada es un municipio de la provincia o valiato de Djelfa en Argelia. En abril de 2008 tenía una población censada de 4549 habitantes.​\\nSe encuentra ubicado en el centro-norte del país, en la cordillera del Atlas sahariano y al sur de la capital del país, Argel."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%B3%95%E5%85%B0%E8%A5%BF%E5%B2%9B%E5%A4%A7%E5%8C%BA%E8%A1%8C%E6%94%BF%E5%8C%BA%E5%88%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Locator_map_of_Arrondissement_Le_Raincy_2019.png","page_title":"法兰西岛大区行政区划","context_page_description":"法國法蘭西島大區共有8個省。"},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_%C3%A9glises_de_la_Savoie","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/%C3%89glise_Saint-Barth%C3%A9l%C3%A9my_de_Montsapey-Peintures_4.JPG","page_title":"Liste des églises de la Savoie","context_page_description":"Cette liste des églises de la Savoie recense les édifices religieux - églises, basiliques et cathédrales - situés dans le département de la Savoie. Tous sont situés dans l'archidiocèse de Chambéry, Maurienne et Tarentaise, exception faite des édifices situés dans les paroisses d'Ugine et du Val d'Arly qui appartiennent au diocèse d'Annecy."},{"page_url":"https://it.wikipedia.org/wiki/Imerio_di_Bosto","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0b/Sainthimerius.jpg","page_title":"Imerio di Bosto","context_page_description":"Sant'Imerio di Bosto è venerato come santo e martire della Chiesa cattolica. Viene ricordato assieme a San Gemolo il 4 febbraio.\\nLa tradizione agiografica vuole che attorno all'anno 1000, Imerio, assieme a Gemolo e ad un vescovo, zio di quest'ultimo, si stesse recando in pellegrinaggio a Roma, a San Pietro e a San Paolo fuori le Mura. Una notte, fermatisi a riposare in Valceresio, subirono un furto da parte di alcuni briganti di Uboldo o Seprio; Gemolo e Imerio si lanciarono all'inseguimento dei ladri fino in Valganna, ma questi, nonostante i due avessero invocato loro pietà in nome di Dio, li trucidarono: Gemolo morì nei pressi di Ganna, dove nel 1095 sorse un'abbazia a lui dedicata per volere di Attone di Milano, col beneplacito di Arnolfo III.\\nImerio, ferito gravemente, riuscì a fuggire e arrivò fino a Varese, più precisamente nell'attuale castellanza di Bosto, dove il giorno seguente fu trovato morto. Il corpo del santo è oggi custodito nella chiesa di Sant'Imerio a Bosto.\\nUn tempo il santo era patrono del comune di Imer, in Trentino.\\nUna tradizione risalente all'XI secolo vuole che Imerio fosse di origine nordica."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Members_of_the_Order_of_the_Companions_of_Honour","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Somerset_Maugham_%281934%29.jpg","page_title":"List of Members of the Order of the Companions of Honour","context_page_description":"Below is a list of Members of the Order of the Companions of Honour from the order's creation in 1917 until the present day:"},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_chefes_de_Estado_da_Gr%C3%A9cia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Constantine1_Greece.jpg","page_title":"Lista de chefes de Estado da Grécia","context_page_description":"Esta é uma lista dos chefes de estado da Grécia, a partir do reconhecimento internacional da autonomia do moderno Estado-nação em 1828, durante as últimas fases da Guerra da Independência Grega, até os dias atuais."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9F%D0%BB%D0%B8%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Mail-envelope.svg","page_title":"Плик","context_page_description":"Плик, плико или коверт – хартија превиткана и залепена со капак, да може да се стави во неа друга хартија, пари, писмо и сл. Тоа е вид амбалажа за пишани пратки. Вообичаено се изработуваат машински, но може и рачно, најчесто со виткање и лепење на хартија во облик на ромбоид."},{"page_url":"https://fi.wikipedia.org/wiki/Hy%C5%ABga_(Miyazaki)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Umagase_Hyuga_2010.JPG","page_title":"Hyūga (Miyazaki)","context_page_description":"Hyūga on Japanin kaupunki Kyūshūn saarella Miyazakin prefektuurissa. Se sijaitsee Tyynenmeren Hyūganmeren rannikolla prefektuurin pohjoisosassa. Kaupungin ydinalue on Shiomijoen suulle muodostuneella alluviaalitasangolla. Etelämpänä kaupungin halki Tyyneenmereen virtaa myös Mimijoki. Sisämaassa kaupunki käsittää pääosin metsäisiä vuoristoalueita ja ulottuu Osuzuvuorelle saakka. Hyūgassa on 61 296 asukasta ja sen pinta-ala on 336,29 neliökilometriä.\\nHyūgan kaupunki perustettiin vuonna 1951, kun Tomishiman maaseutukaupunki ja Iwawakin kyläkunta liitettiin yhteen. Kaupunki sai nimensä aiemmalta Hyūgan provinssilta. Vuonna 1955 kaupunkiin liitettiin vielä Mimitsun maaseutukaupunki ja vuonna 2006 Tōgōn maaseutukaupunki. Kaupungin historiallista ydinaluetta on Tomitakan kaupunginosa, joka toimi Edo-kaudella vuodesta 1692 lähtien Hitalle alisteisena hallinnollisena keskuksena suoraan Tokugawa-bakufun omistuksessa. Sen itäpuolella sijaitseva Hososhima kehittyi vilkkaana kauppasatamana ja myöhemmin 1900-luvun puolivälistä lähtien teollisuussatamana, jonka läheisyyteen kehittyi muun muassa sokeri-, tekstiili- ja metalliteollisuutta."},{"page_url":"https://cy.wikipedia.org/wiki/Charles_de_Gaulle","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/De_Gaulle-OWI.jpg","page_title":"Charles de Gaulle","context_page_description":"Gwleidydd a chadfridog o Ffrainc oedd Charles André Joseph Marie de Gaulle. Fe'i ganwyd yn Lille. Fe'i ystyrir yn un o ffigurau gwleidyddol pwysicaf yr 20g."},{"page_url":"https://es.wikipedia.org/wiki/Ca%C3%B1%C3%B3n_de_Garni","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Sinfon%C3%ADa_de_las_Piedras%2C_valle_de_Garni%2C_Armenia%2C_2016-10-02%2C_DD_15.jpg","page_title":"Cañón de Garni","context_page_description":"El cañón de Garni está situado a 23 km al este de Ereván, Armenia, justo bajo el pueblo homónimo. El cañón está situado bajo el templo de Garni, que data del siglo I d.C.. A ambos lados del cañón hay acantilados con paredes bien conservadas de columnas de basalto, que han surgido debido a la erosión del río Goght. A esta sección del cañón se le conoce popularmente como \\"Sinfonía de las Piedras.\\" Se puede acceder a esta sección gracias a un camino que comienza en el pueblo de Garni, poco antes de llegar al templo. El camino transcurre también por un puente medieval del siglo XI."},{"page_url":"https://id.wikipedia.org/wiki/Hyde_Park,_Sydney","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Hyde_Park_Obelisk.JPG","page_title":"Hyde Park, Sydney","context_page_description":"Hyde Park adalah sebuah taman besar di Sydney, New South Wales, Australia. Hyde Park terletak di sisi timur distrik bisnis pusat Sydney. Merupakan taman paling selatan dari sejaringan taman yang memanjang dari utara ke pesisir Port Jackson. Membentuk sebuah bujur sangkar sembarang, persegi di ujung selatan dan bulat di ujung utara, berbatasan di barat dengan Elizabeth Street, di timur dengan College Street, di utara dengan St. James Road dan Prince Albert Road dan di selatan dengan Liverpool Street.\\nDi sekitar taman terletak Supreme Court of New South Wales, St. James Church, Hyde Park Barracks dan Sydney Hospital di utara, St Mary's Cathedral, Australian Museum dan Sydney Grammar School di timur, Downing Centre di selatan, toko David Jones Limited dan CBD di barat. Taman ini dibelah di tengah oleh Park Street yang membentang timur-barat."},{"page_url":"https://pt.wikipedia.org/wiki/Corymbia_citriodora","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Corymbia_citriodora.jpg","page_title":"Corymbia citriodora","context_page_description":"Corymbia citriodora, conhecido pelos nomes comuns de eucalipto-cidró, eucalipto-limão ou eucalipto-cheiroso, é uma espécie pertencente ao grupo dos eucaliptos caracterizados por produzir árvores de médio a grande porte, ocasionalmente podendo atingir 35-50 metros de altura e 1,2 metro de diâmetro à altura do peito, com excelente forma do tronco e folhagem rala. A espécie tem distribuição natural nas regiões de clima temperado e subtropical do nordeste da Austrália. O epíteto específico citriodora deriva do latim citriodorus, que significa odor a limão."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Arlington_K%C5%ABn_(Virginia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Seal_of_Arlington_County%2C_Virginia_%281983%E2%80%932007%29.png","page_title":"Arlington Kūn (Virginia)","context_page_description":"Arlington Kūn sī Bí-kok Virginia chiu ê kūn, ū jîn-kháu 224906."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D1%83%D0%B9%D1%8F%D0%BD_(%D0%A7%D1%8D%D0%BD%D1%8C%D1%87%D0%B6%D0%BE%D1%83)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/%E9%98%B3%E5%B1%B1%E6%9D%91%E5%8F%A4%E5%BB%BA%E7%AD%91%E7%BE%A4%E6%AD%A3%E9%9D%A2.JPG","page_title":"Гуйян (Чэньчжоу)","context_page_description":"Гуйя́н — уезд городского округа Чэньчжоу провинции Хунань."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9B%CE%BF%CF%80%CE%B1%CE%B4%CE%BF%CF%84%CE%B5%CE%BC%CE%B1%CF%87%CE%BF%CF%83%CE%B5%CE%BB%CE%B1%CF%87%CE%BF%CE%B3%CE%B1%CE%BB%CE%B5%CE%BF%CE%BA%CF%81%CE%B1%CE%BD%CE%B9%CE%BF%CE%BB%CE%B5%CE%B9%CF%88%CE%B1%CE%BD%CE%BF%CE%B4%CF%81%CE%B9%CE%BC%CF%85%CF%80%CE%BF%CF%84%CF%81%CE%B9%CE%BC%CE%BC%CE%B1%CF%84%CE%BF%CF%83%CE%B9%CE%BB%CF%86%CE%B9%CE%BF%CE%BA%CE%B1%CF%81%CE%B1%CE%B2%CE%BF%CE%BC%CE%B5%CE%BB%CE%B9%CF%84%CE%BF%CE%BA%CE%B1%CF%84%CE%B1%CE%BA%CE%B5%CF%87%CF%85%CE%BC%CE%B5%CE%BD%CE%BF%CE%BA%CE%B9%CF%87%CE%BB%CE%B5%CF%80%CE%B9%CE%BA%CE%BF%CF%83%CF%83%CF%85%CF%86%CE%BF%CF%86%CE%B1%CF%84%CF%84%CE%BF%CF%80%CE%B5%CF%81%CE%B9%CF%83%CF%84%CE%B5%CF%81%CE%B1_...","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Silphium.jpg","page_title":"Λοπαδοτεμαχοσελαχογαλεοκρανιολειψανοδριμυποτριμματοσιλφιοκαραβομελιτοκατακεχυμενοκιχλεπικοσσυφοφαττοπεριστερα ...","context_page_description":"Η λέξη λοπαδοτεμαχοσελαχογαλεοκρανιολειψανοδριμυποτριμματοσιλφιοκαραβομελιτοκατακεχυμενοκιχλεπικοσσυφοφαττοπεριστεραλεκτρυονοπτοκεφαλλιοκιγκλοπελειολαγῳοσιραιοβαφητραγανοπτερύγων είναι γεύμα που αναφέρεται στην κωμωδία Εκκλησιάζουσες του Αριστοφάνη. Με τη λέξη αυτή ο Αριστοφάνης ήθελε να περιγράψει μονολεκτικά μια μαγειρική συνταγή."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D0%B8%D1%81%D1%82%D0%BA%D0%BE%D0%B2%D0%B5_%D1%82%D1%96%D1%81%D1%82%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Baklava.jpg","page_title":"Листкове тісто","context_page_description":"Листкове тісто може бути дріжджове та без дріжджів, прісне або скороспіле. Особливістю листкового тіста є те, що воно досить пружне та еластичне та не містить цукру. Готові вироби з листкового тіста мають шарувату структуру, зовнішні шари — тверді, внутрішні — м'які."},{"page_url":"https://mn.wikipedia.org/wiki/%D0%A1%D0%BE%D0%BA%D1%80%D0%B0%D1%82%D0%B8%D1%81_%D0%9F%D0%B0%D0%BF%D0%B0%D1%81%D1%82%D0%B0%D1%82%D0%BE%D0%BF%D1%83%D0%BB%D0%BE%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/20130814_AT-GR_Sokratis_Papastathopoulos_2368.jpg","page_title":"Сократис Папастатопулос","context_page_description":"Сократис Папастатопулос — Грекийн хөлбөмбөгчин бөгөөд германы Боруссиа Дортмунд болон Грекийн шигшээд тоглодог."},{"page_url":"https://en.wikipedia.org/wiki/Grade_II*_listed_buildings_in_South_Yorkshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Noon_at_Doncaster%27s_Christ_Church_-_geograph.org.uk_-_1753341.jpg","page_title":"Grade II* listed buildings in South Yorkshire","context_page_description":"There are over 20,000 Grade II* listed buildings in England. This list includes those in South Yorkshire."},{"page_url":"https://eu.wikipedia.org/wiki/Somalia_Italiarra","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Italian_Somaliland.png","page_title":"Somalia Italiarra","context_page_description":"Somalia Italiarra Italiak gaur egun Somalia dagoen lekuan eta Benadirren ordez 1905eko martxoaren 16an sortu zuen kolonia izan zen. Herrialdea sortzerakoan bertako sultanatoak kenduak izan ziren.\\n1908an Abisiniako tratatuarekin mugak ezarri ziren, 1915ean Britaniar Somaliarekin mugak zehaztu ziren eta 1925an Erresuma Batuak Trans Juba eskualdea eman zien. 1936an Italiar kolonietako probintzia batean eraldatu zuten. 1936n Ogaden eta Britaniar Somaliland gehitu ziren, baina 1941eko martxoaren 16an Bigarren Mundu Gerraren ondorioz Ogaden bereiztu eta Etiopiara gehitu zuten aliatuek.\\n1960ko Uztailaren 1ean Somalia independizatu zen eta lau egun lehenago independiente egin zen Britaniar Somaliarekin batu."},{"page_url":"https://tr.wikipedia.org/wiki/I._%C4%B0oannis","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Lebedev_Svyatoslavs_meeting_with_Emperor_John.jpg","page_title":"I. İoannis","context_page_description":"I. İoannis Çimiskes, Bizans imparatoru. 969-976 yılları arasında hüküm süren Çimiskes Balkanlar ve Suriye'yi egemenliği altına alarak imparatorlukta düzeni sağlamıştır."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%BE%D0%BA%D0%BF%D0%BE%D1%80%D1%82_(%D0%9C%D0%B0%D1%81%D1%81%D0%B0%D1%87%D1%83%D1%81%D0%B5%D1%82%D1%81)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Rockport_MA_Beach_Houses_DSC_0092_AD.JPG","page_title":"Рокпорт (Массачусетс)","context_page_description":"Рокпорт — місто в США, в окрузі Ессекс на північному сході штату Массачусетс, на узбережжі Атлантичного океану — на самому східному краю мису Кейп-Енн. Населення — 6952 особи."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%93%D1%80%D0%BE%D1%81%D0%BD%D0%BE%D1%98%D1%85%D0%B0%D1%83%D0%B7%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Gro%C3%9Fneuhausen_in_S%C3%96M.png","page_title":"Гроснојхаузен","context_page_description":"Гроснојхаузен — општина во округот Земерда, во Тирингија, Германија."},{"page_url":"https://es.wikipedia.org/wiki/Bethlehem_Steel","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/35/USS_Massachusetts_%28BB-59%29_San_Diego_%28CL-53%29_and_San_Juan_%28CL-54%29_at_Fore_River_Shipyard_1941.jpg","page_title":"Bethlehem Steel","context_page_description":"Bethlehem Steel Corporation fue una empresa de Estados Unidos que llegó a convertirse en el segundo mayor productor de acero y el mayor constructor naval del país. Bethlehem Steel y su filial, Bethlehem Shipbuilding Corporation, fueron dos de los símbolos más representativos del poder y liderazgo estadounidense en la manufactura y el sector industrial a nivel mundial. La desaparición de la empresa es a menudo citada como uno de los ejemplos más significativos de los cambios en la economía estadounidense y mundial en las últimas y primeras décadas de los siglos XX y XXI respectivamente, en las que se ha impuesto la deslocalización industrial, en el marco de la globalización y la incapacidad de muchas empresas y sectores de competir con mano de obra barata y generar beneficios a corto plazo.\\nDespués de un descenso en la industria del acero estadounidense y otra serie de problemas internos, la empresa se declaró en quiebra en 2001 y finalmente fue disuelta en 2003 con la venta de sus activos a International Steel Group. Actualmente sus activos son parte de Arcelor Mittal."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%9C%D7%97%D7%99%D7%9E%D7%94_%D7%91%D7%A8%D7%A6%D7%95%D7%A2%D7%AA_%D7%A2%D7%96%D7%94_%D7%91%D7%99%D7%9F_%D7%9E%D7%91%D7%A6%D7%A2_%D7%A2%D7%9E%D7%95%D7%93_%D7%A2%D7%A0%D7%9F_%D7%9C%D7%9E%D7%91%D7%A6%D7%A2_%D7%A6%D7%95%D7%A7_%D7%90%D7%99%D7%AA%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Apartment_building_in_the_Israeli_town_of_Kiryat_Malachi_that_took_a_direct_hit_from_a_Hamas_rocket._3_residents_were_killed%2C_and_several_others_seriously_wounded_including_a_1.5_year_old_baby.jpg","page_title":"הלחימה ברצועת עזה בין מבצע עמוד ענן למבצע צוק איתן","context_page_description":"מבצע עמוד ענן הביא לתקופת רגיעה של כשנה, אשר לאחריה חמאס וארגוני הטרור ברצועת עזה חזרו לירות על ישראל. צה\\"ל הגיב באופן נקודתי."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89nergie_%C3%A9olienne_en_Su%C3%A8de","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Sund_mpazdziora.JPG","page_title":"Énergie éolienne en Suède","context_page_description":"L'énergie éolienne en Suède est devenue une source d'énergie importante, grâce à un potentiel éolien parmi les meilleurs au monde ; l'éolien fournissait 15 % de la production d'électricité du pays en 2019 et couvrait 11,2 % de la consommation électrique suédoise en 2017-18.\\nLa Suède était en 2018 au 6ᵉ rang européen pour la production d'électricité éolienne et au 6ᵉ rang européen et au 11ᵉ rang mondial pour la puissance installée, qui a progressé de 21,5 % en 2019 ; la plupart de ses parcs éoliens sont terrestres ; sur le segment offshore, elle tient le 6ᵉ rang européen et le 7ᵉ rang mondial, loin derrière le Royaume-Uni et l'Allemagne.\\nLa Suède se situe en 2017 au 3ᵉ rang européen pour la puissance installée par habitant, derrière le Danemark et l'Irlande."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%8B%A0%EC%B9%B8%EC%84%BC_E2%EA%B3%84_%EC%A0%84%EB%8F%99%EC%B0%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/JRE_Shinkansen_Series_E2_E226-300.jpg","page_title":"신칸센 E2계 전동차","context_page_description":"신칸센 E2계 전동차는 동일본 여객철도의 신칸센 차량으로 E4계 차량과 마찬가지로 400계, E3계 차량과 중련 운행이 가능하다.\\n1997년 3월 22일 도호쿠 신칸센에서 고마치와 연결하는 속달 야마비코 등급으로 영업운전을 개시했다. 같은 해 10월 1일, 나가노 신칸센 개업에 맞추어 아사마의 영업 운전을 개시했다. 현재 나스노, 야마비코, 하야테, 다니가와, 도키 열차를 운행하고 있다."},{"page_url":"https://eu.wikipedia.org/wiki/La_Maternitat_i_Sant_Ramon","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Esgl%C3%A9sia_de_Sant_Ramon_Nonat_%28Barcelona%29_5.jpg","page_title":"La Maternitat i Sant Ramon","context_page_description":"La Maternitat i Sant Ramon, Kataluniako Bartzelona hiriburuko Les Corts barrutian dagoen auzo bat da, L'Hospitalet de Llobregat udalerriarekin muga egiten du. Barruti hau hiru eremutan banaturik dago: mendebaldean, Sant Ramon, eta ekialdean berriz, Maternitat eta Can Bacardí.\\nSant Ramon izena Sant Ramon Nonat elizatik datorkio, eremu honi Collblanc ere deitu ohi zaio. Maternitat delakoa bertan dagoen amatasun ospitale bat da.\\nBestalde, auzo honen erdigunean hiru instalakuntza handi daude: Futbol Club Barcelona taldearen kirol instalakuntzak"},{"page_url":"https://hu.wikipedia.org/wiki/Feh%C3%A9rv%C3%A1r_AV19","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Alba_Volan_19_111009_2.jpg","page_title":"Fehérvár AV19","context_page_description":"A Fehérvár AV19 Székesfehérvár jégkorongcsapata.\\nTizenháromszoros magyar bajnok. Az első vidéki csapat, amely megszerezte a magyar bajnoki címet. A Fehérvár AV19 csapata a 2007/2008-as idénytől kezdve az osztrák bajnokságban szerepel, míg a Fehérvári Titánok, a szintén a Fehérvár AV19 kötelékébe tartozó együttes az Erste Liga küzdelmeiben vesz részt."},{"page_url":"https://hu.wikipedia.org/wiki/Metallura_iracunda","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Metallura_iracunda_%2815635161565%29.jpg","page_title":"Metallura iracunda","context_page_description":"A Metallura iracunda a madarak osztályának sarlósfecske-alakúak rendjébe és a kolibrifélék családjába tartozó faj."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%8F%AF%E7%9B%9B%E9%A0%93%E5%B1%B1%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Mt_Washington_light_rail_station%2C_June_2006.jpg","page_title":"華盛頓山站","context_page_description":"华盛顿山站为巴尔的摩轻轨的车站之一，也是巴尔的摩市范围内最北端的轻轨车站。本站位于华盛顿山史迹区内，车辆仅能沿一条狭窄的单行道抵达本站。\\n有83个停车位供通勤旅客使用。先前曾有关于邻近的购物中心顾客可能使用本站停车场以规避收费停车的讨论，但平常日在购物中心开始营业前停车场通常就已经停满了。\\n本站附近有27、58、60号线行经。\\n站址先前是北方中央铁路的华盛顿山站。本站于1992年开始营业时只有单线，2005年轻轨的双线化工程完工以后才有双线。"},{"page_url":"https://de.wikipedia.org/wiki/Wasserburg_Rohr","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Wasserburg_Rohr%2C_005.jpg","page_title":"Wasserburg Rohr","context_page_description":"Die Wasserburg Rohr ist eine abgegangene Burg im Stadtteil Rohr des Stuttgarter Stadtbezirks Vaihingen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B5%D1%82%D0%B0%D1%80%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/China_b%C3%B6ller.jpg","page_title":"Петарда","context_page_description":"Пета́рда\\nсигнальный подрывной заряд для остановки поезда;\\nвзрывное пиротехническое изделие небольшой мощности.\\nНиже речь идёт о петардах развлекательного назначения, относящимся к 2 и 3 классам опасности."},{"page_url":"https://fr.wikipedia.org/wiki/Fayette_Township_(Pennsylvanie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/McAlisterville_Post_Office.jpg","page_title":"Fayette Township (Pennsylvanie)","context_page_description":"Fayette Township est un township situé au nord du comté de Juniata, en Pennsylvanie, aux États-Unis. En 2010, il comptait une population de 3 478 habitants."},{"page_url":"https://lt.wikipedia.org/wiki/Baltosios_ro%C5%BE%C4%97s_tiltas","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Budowa_mostu_na_rzece_Niemen_-_11.jpg","page_title":"Baltosios rožės tiltas","context_page_description":"Baltosios rožės tiltas – 2013–2015 m. pastatytas pėsčiųjų ir dviratininkų tiltas Alytuje per Nemuną, jungiantis Pirmąjį Alytų ir senamiesčio kurortinę dalį su Alytaus piliakalniu, stūksančiu priešingoje upės pusėje. Naujasis tiltas sujungia dvi svarbias rekreacines zonas, yra patogus pėstiesiems ir dviratininkams, norintiems aplankyti kitoje Nemuno pusėje esančius objektus. Iki šiol jiems teko keliauti per Antano Juozapavičiaus arba Kaniūkų tiltus.\\nTilto pradžioje, nuo Dainų slėnio pusės, pastatyta atnaujinta 21 m aukš­čio skulp­tū­ra „Žie­das“. Aukščiausias Lietuvoje pėsčiųjų ir dviratininkų tiltas yra 38,10 m aukščio nuo vidutinio vandens lygio, jo ilgis – 240,53 m, plotis – 6,71 m. Statinį sudaro metalinės konstrukcijos, jo dvi atramos stovi krantuose ir dvi – vandenyje. Didžiausias tarpatraminis atstumas – 92 m. Aukštesnis yra tik Lyduvėnų tiltas, tačiau juo eiti draudžiama, jis skirtas traukinių eismui.\\nObjekte siūlomos paslaugos: ekstremali pramoga – šuoliai nuo tilto su virve, apžvalginis žygis."},{"page_url":"https://de.wikipedia.org/wiki/Ajimez","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Mouzens_Monsec_fa%C3%A7ade_ouest.jpg","page_title":"Ajimez","context_page_description":"Unter dem vor allem in Spanien gebräuchlichen Begriff Ajimez versteht man ein für den Maurischen Stil typisches Zwillingsfenster, bei dem zwei gleich große, nebeneinander liegende und von einer Mittelstütze getrennte Fenster oder Fensteröffnungen durch eine gemeinsame Rahmung oder Bekrönung zu einer Einheit zusammengefasst werden. Bei vielen Ajimeces tritt die eigentliche Belichtungsfunktion gegenüber einer dekorativen bzw. ornamentalen Außen- und/oder Innenwirkung zurück."},{"page_url":"https://lt.wikipedia.org/wiki/BT-42","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Bt42_parola_3.jpg","page_title":"BT-42","context_page_description":"BT-42 - suomiška savaeigė haubica, gaminta perdirbant trofėjinius tarybinius tankus BT-7 ir 1908 m. modelio angliškas 4,5 colių kalibro haubicas. Buvo pagaminta 18 šių savaeigių. Ši saveigė turėjo besisukiojantį bokštelį, todėl kartais vadinama tanku. Perdirbant BT-7 buvo paliktas senas bokštelio sukiojimo ir vertikalaus taikymo mechanizmai, kurie buvo per silpni 114 mm haubicai.\\nBT-42 buvo Suomijos tankų divizijos ginkluotėje. Pirmą kartą panaudoti jie buvo 1943 m. prie Svirės upės. Savaeigės apšaudė tarybinę kariuomenę kitame upės krante ir sunaikino kelius taikinius. Savaeigių įgulos nebuvo patenkintos šia mašina, kadangi ji dažnai gesdavo, o jo pabūklas buvo efektyvus tik prieš nešarvuotus taikinius.\\nDar kartą nesėkmingai savaeigės buvo panaudotos 1944 m. priešinantis Tarybinės Armijos puolimui Vyborgo apylinkėse."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9E%E3%82%AF%E3%83%A9%E3%83%BC%E3%83%AC%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Mika_H%C3%A4kkinen_McLaren-Mercedes_MP4-13_Techno_Classica_Essen_2018_%283%29.jpg","page_title":"マクラーレン","context_page_description":"マクラーレン・レーシング・リミテッドは、1963年にブルース・マクラーレンにより設立されたイギリスのレーシング・チーム。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%99%E3%83%AB%E3%83%AA%E3%83%B3%E3%83%9E%E3%83%A9%E3%82%BD%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Berlin_marathon_schwarzer_rolli.JPG","page_title":"ベルリンマラソン","context_page_description":"ベルリンマラソン は、毎年9月の最終日曜日にドイツのベルリンで開催される、ワールドアスレティックスプラチナラベルのフルマラソン大会であり、ワールドマラソンメジャーズの一つである。"},{"page_url":"https://ro.wikipedia.org/wiki/Paolo_Rossi","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/600px_V_Bianca_e_Rossa.png","page_title":"Paolo Rossi","context_page_description":"Paolo Rossi este un fost jucător italian de fotbal. În 1982 a condus naționala Italiei către câștigarea Campionatului Mondial din 1982 înscriind șase goluri și astfel primind Gheata și Balonul de Aur. Este unul din cei trei jucători care au câștigat de-a lungul timpului toate cele trei trofee acordate în cadrul unui Campionat Mondial, alături de Garrincha în 1962 și Mario Kempes în 1978."},{"page_url":"https://vi.wikipedia.org/wiki/M%C3%B9a_b%C3%A3o_T%C3%A2y_B%E1%BA%AFc_Th%C3%A1i_B%C3%ACnh_D%C6%B0%C6%A1ng_2010","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/JMATD17_Aug_30_2010.jpg","page_title":"Mùa bão Tây Bắc Thái Bình Dương 2010","context_page_description":"Mùa bão Tây Bắc Thái Bình Dương 2010 là một sự kiện mà theo đó các xoáy thuận nhiệt đới hình thành ở vùng phía tây bắc của Thái Bình Dương. Mùa bão sẽ kéo dài trong suốt năm 2010 với phần lớn các cơn bão hình thành từ tháng 5 đến tháng 11. Bài viết này chỉ đề cập đến các cơn bão hình thành trong phạm vi của Thái Bình Dương ở Bắc Bán Cầu và từ kinh tuyến 100 đến 180 độ. Trong khu vực tây bắc Thái Bình Dương, có 2 cơ quan khí tượng hoạt động độc lập nhau, nên một cơn bão có thể có 2 tên gọi khác nhau. JMA sẽ đặt tên cho một cơn bão khi sức gió duy trì trong vòng 10 phút đạt ít nhất 65 km/h, bất kỳ nơi đây trong vùng đã đề cập trên. Trong Khi đó, PAGASA sẽ đặt tên cho một cơn bão khi nó hình thành từ một áp thấp nhiệt đới trong phạm vi giám sát của họ giữa 135°Đ và 115°Đ và giữa 5°B-25°B thậm chí JMA đã đặt tên cho nó. Các áp thấp nhiệt đới được JTWC theo dõi và đặt tên có ký tự \\"W\\" phía trước một con số."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9F%D0%BB%D0%BE%D0%B2%D0%B4%D0%B8%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Old_town14.jpg","page_title":"Пловдив","context_page_description":"Пло̀вдив е вторият по големина град в България с население 347 851 души по настоящ адрес. Намира се в западната част на Горнотракийската низина, на двата бряга на река Марица. Отстои на 15 km северно от Родопите и на 50 km южно от Стара планина. Градът е застроен в подножията на шест сиенитни хълма, поради което често е наричан „Градът под тепетата“. Пловдив е управленски център на област Пловдив, община Пловдив, община Марица, община Родопи и е най-голямото стопанско ядро на Южния централен район.\\nПловдив е град на над 8000 години, чието минало може да се проследи от праисторията до наши дни. Първите неолитни поселения в границите на днешния град започват от VI хилядолетие пр.н.е, а от каменно-медната епоха животът в града не е прекъсвал, което го нарежда сред най-древните постоянно обитавани градове в света. Запазени и консервирани са древни паметници като античния театър, римския одеон, агората, римския стадион, късноантична сграда „Ейрене“, епископската базилика, малката базилика и други.\\nГрадът е най-динамично развиващият се център в Южна България. Икономиката му се крепи на добре развитата многопрофилна индустрия, на услугите, туризма и информационните технологии."},{"page_url":"https://cy.wikipedia.org/wiki/Lot_(d%C3%A9partement)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Cahors_-_Pr%C3%A9fecture_du_Lot_-417.jpg","page_title":"Lot (département)","context_page_description":"Un o départements Ffrainc, yn rhanbarth Ocsitania yn ne'r wlad, yw Lot. Prifddinas y département yw Cahors. Mae'n ffinio â départements Tarn-et-Garonne, Lot-et-Garonne, Dordogne, Corrèze, Cantal ac Aveyron.\\nMae'r prif drefi yn cynnwys:\\nCahors\\nFigeac\\nGourdon"},{"page_url":"https://en.wikipedia.org/wiki/Kelenf%C3%B6ld_vas%C3%BAt%C3%A1llom%C3%A1s_metro_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Metro_4%2C_M4%2C_Line_4_%28Budapest_Metro%29%2C_Kelenf%C3%B6ld_vas%C3%BAt%C3%A1llom%C3%A1s_station.jpg","page_title":"Kelenföld vasútállomás metro station","context_page_description":"Kelenföld vasútállomás is the western terminus of Line 4 of the Budapest Metro. The station was opened on 28 March 2014 as part of the inaugural section of the line, from Keleti pályaudvar to Kelenföld vasútállomás.\\nThe station, located under Kelenföld railway station and across some of the busiest railroad tracks in Budapest, can be reached through an underpass. This was the former terminus of express bus lines 7E and 107E, which allowed passengers arriving by train to continue traveling to Pest or southern Buda. Since Metro service started on 28 March 2014, passengers traveling by train are able to transfer to Budapest Keleti railway station by Metro without having to take Line 2 from Budapest Déli railway station."},{"page_url":"https://eu.wikipedia.org/wiki/Urkixo_zumarkalea","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Bilbao_-_Calle_Lutxana_esquina_Alameda_de_Urquijo_%28Abando%29.jpg","page_title":"Urkixo zumarkalea","context_page_description":"Urkixo zumarkalea Bizkaiko Bilbo hiriburuko erdigunean dagoen kalea da. Abando, Indautxu eta Basurtu auzoetan barna luzatzen da. Ekialdean, On Diego Lopez Haroko kale nagusian hasi eta mendebaldean San Mames estadioan amaitzen da."},{"page_url":"https://no.wikipedia.org/wiki/Versjoner_av_Fedora","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Fedora_18_with_GNOME.png","page_title":"Versjoner av Fedora","context_page_description":"Versjoner av Fedora er en presentasjon av ulike versjoner av operativsystemet og linuxdistribusjonen Fedora. Fedora blir utviklet av Fedora Project og blir sponset Red Hat, som siden 2019 er en underavdeling av IBM. Den er etterfølgeren til Red Hat Linux. Den er også den frie og åpne versjonen av det kommersielle operativsystemet Red Hat Enterprise Linux, som er selskapets offisielle operativsystem.\\nDen 31. august 2020 var Fedora den niende mest utbredte Linuxdistribusjonen ifølge nettstedet DistroWatch, overgått av MX Linux, Manjaro Linux, Linux Mint, Ubuntu, Debian, elementary OS, Pop!OS og Solus Operating System. Den 26. februar 2016 estimerte PC World at Fedora hadde 1.2 millioner brukere. Blant brukerne var Linus Torvalds, skaperen av Linuxkjernen.\\nFørste versjon ble lansert den 6. november 2003. Den 32. versjon ble lansert den 28. april 2020."},{"page_url":"https://en.wikipedia.org/wiki/James_William_Boggs_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/James_William_Boggs_House.JPG","page_title":"James William Boggs House","context_page_description":"The James William Boggs House is a historic house on Austin Street in Pangburn, Arkansas. Located on the east side, between Torrence and South McKee Streets, it is a 1-1/2 story rambling wood frame structure with a variety of gables, porches and projecting sections. Its front facade is dominated by a single-story hip-roofed porch supported by tapered square columns, and shelters a pair of entrances. To the rear of the main block a shotgun house was moved and attached. It was built in 1908 and is one of a small number of houses surviving from the period in White County.\\nThe house was listed on the National Register of Historic Places in 1991."},{"page_url":"https://es.wikipedia.org/wiki/Sarracenia_rubra","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Sarracenia_rubra%2C_by_Mary_Vaux_Walcott.jpg","page_title":"Sarracenia rubra","context_page_description":"Sarracenia rubra, también conocido como la planta carnívora dulce, es una planta carnívora del género Sarracenia. Como todos los Sarracenia, es nativa del nuevo mundo."},{"page_url":"https://en.wikipedia.org/wiki/List_of_State_Protected_Monuments_in_Madhya_Pradesh","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/The_main_shaft.jpg","page_title":"List of State Protected Monuments in Madhya Pradesh","context_page_description":"This is a list of State Protected Monuments as officially reported by and available through the website of the Archaeological Survey of India in the Indian state Madhya Pradesh. The monument identifier is a combination of the abbreviation of the subdivision of the list and the numbering as published on the website of the ASI. 326 State Protected Monuments have been recognized by the ASI in Madhya Pradesh. Besides the State Protected Monuments, also the Monuments of National Importance in this state might be relevant."},{"page_url":"https://la.wikipedia.org/wiki/Psychologia_socialis","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Gordon_Allport.gif","page_title":"Psychologia socialis","context_page_description":"Psychologia socialis est studium scientificum modorum quibus cogitationes, sensus, moresque hominum praesentia aliorum moventur, sive vera sive animo ficta vel solum indicata. Per hanc definitionem, vocabulum scientificum investigationem empiricam per rationem scientificam attingit; vocabula praeterea cogitationes, sensus, moresque psychologica attingunt variabilia quorum mensurae in hominibus fieri possunt. Dictum quod praesentia aliorum animo ficta vel indicata potest significat homines etiam soli exemplaria socialia respondent cum pelliculas vel programmata televisifica spectent, vel pelliculas musicas audiant, quia suaderi possunt ut mores visos vel internas normas culturales sequantur. Psychologi sociales usitate dicunt mores humanos esse exitum interactionum statuum mentis et rerum socialium.\\nPsychologia socialis psychologiam sociologiamque usitate coniungebat. Sub bellum mundanum secundum, annos 1940 exeuntibus, psychologi sociologique saepe adiutores erant. Quae autem disciplinae magis magisque discrepant, sociologis magna variabilia sicut structuram socialem magis exprimentibus."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B5%D1%80%D0%B1%D1%81%D0%BA%D0%B8%D0%B9_%D0%B8%D0%BF%D0%BF%D0%BE%D0%B4%D1%80%D0%BE%D0%BC_(%D1%80%D0%B8%D0%BC%D1%81%D0%BA%D0%BE%D0%B5_%D0%BF%D0%BE%D1%81%D0%B5%D0%BB%D0%B5%D0%BD%D0%B8%D0%B5)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Green_glazed_jug_Derby.jpg","page_title":"Дербский ипподром (римское поселение)","context_page_description":"Дербский ипподром — третье поселение в Дерби, небольшой город римской провинции в Британии. Он располагался в 600 метрах на восток от форта Дервентио в Литл Честер, в современном Дербишире. Из Дервентио в Соули через поселение проходила римская дорога — Икнилдская дорога. Поселение внесено в список национальных памятников под номером 13236. Раскопки местности проводились с 1968 по 1974 годы.\\nПервый римский форт в этой местности, римский форт парка Стратт, был построен на другом берегу реки Деруэнт в парке Стратт; около 80 года он был заменён фортом в Литл Честере. Форт был позже повторно оккупирован и использовался в последующие двадцать пять лет, затем освобождён, пока в III веке вокруг города не была построена каменная стена. Существуют свидетельства обширной деятельности римлян в Литл-Честере.\\nДербский ипподром был основан около 90 года нашей эры. Он относится к английскому наследию как важный пример fort-vicus. Это было гражданское поселение при римском военном форте, в данном случае — Дервентио. Это означает, что корновии принимали римский образ жизни и интегрировались в римскую экономику, то есть романизировались."},{"page_url":"https://et.wikipedia.org/wiki/Lumelinn","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Schneemann_haag.jpg","page_title":"Lumelinn","context_page_description":"Lumelinn on lumest või ka jääst tehtud \\"kindlusehitis\\", mida ehitatakse tavaliselt talvel laste mänguväljakutele, aga teinekord ka suurema ettevõtmisena linnade meelelahutusparkide atraktsioonide juurde. Kõige kergem on seda ehitada 0 kraadi juures, kui lumi hakkab kõige paremini kokku. Veeretatakse silinderjad lumepallid, mis siis üksteise kõrvale lükatuna ja peale tõstetuna moodustavad müüre ja torne. Lumelinna saab ehitada ka madalamate temperatuuride juures, kui õnnestub vanemast kokkuvajunud lumest lõigata välja plokke või \\"telliseid\\", või kasutada lume kokkupressimiseks siis spetsiaalseid rakiseid-vorme. Sellisel juhul on hea piserdada valminud \\"lõigule\\" vett, mis jäätub ja müüri tugevamaks muudab.\\nLumelinn ei tähenda ainult mingi kindlusehitise jäljendamist, vaid see võib olla ka lõbustuspark, mis koosneb mitmetest eriilmelistest lumest objektidest: linnu, looma, või mõne eseme kujutistest. Kodus ehitatud lumekindluse juures saavad lapsed talviti \\"lumesõda\\" pidada ja see on olnud paljude Põhjala rahvaste talvisi meelelahutusi. Lõunamaa rahvastele on olemas isegi lumelinna ehitamise õpetusi.\\nEskimod e. innuiidid on lumest elamuid ehk iglusid ehitanud juba aastatuhandeid."},{"page_url":"https://en.wikipedia.org/wiki/Concho_Lake","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Concho_Lake-_Concho_Valley.jpg","page_title":"Concho Lake","context_page_description":"Concho Lake is an irrigation reservoir situated in the town of Concho, in the eastern Arizona grasslands at 6,300 feet. Much of the surrounding land is privately owned; the rest is owned by the Bureau of Land Management, but is managed for sport fisheries and wildlife resources by the Arizona Game and Fish."},{"page_url":"https://ht.wikipedia.org/wiki/Eagle_Grove,_Iowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/IAMap-doton-EagleGrove.PNG","page_title":"Eagle Grove, Iowa","context_page_description":"Eagle Grove, Iowa se yon vil Etazini. Li sitye nan leta Iowa.\\nChèf-lye li se?."},{"page_url":"https://hu.wikipedia.org/wiki/Atapaszka-t%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Lake_Athabasca.png","page_title":"Atapaszka-tó","context_page_description":"Az Atapaszka-tó nagy tó Kanada Saskatchewan tartományának északnyugati részében, illetve Alberta északkeleti részében, az északi szélesség 58° és 60° közt.\\nTerülete 7850 km², legnagyobb hosszúsága 283, legnagyobb szélessége 50 kilométer, partvonalának hossza mintegy 1900 kilométer. Átlagos mélysége 20 méter, legnagyobb mélysége 124 méter. A tó mellett található legfontosabb települések Fort Chipewyan és Uranium City."},{"page_url":"https://sl.wikipedia.org/wiki/Salers","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d9/Eglise_st_Matthieu_Salers.jpg","page_title":"Salers","context_page_description":"Salers je naselje in občina v osrednjem francoskem departmaju Cantal regije Auvergne. Leta 2012 je naselje imelo 345 prebivalcev."},{"page_url":"https://vi.wikipedia.org/wiki/Montivipera_wagneri","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/Vipera_wagneri_%286%29.jpg","page_title":"Montivipera wagneri","context_page_description":"Vipera wagneri là một loài rắn trong họ Rắn lục. Loài này được Nilson & Andrén mô tả khoa học đầu tiên năm 1984."},{"page_url":"https://da.wikipedia.org/wiki/Templet_i_Jerusalem","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Jerusalem_Dome_of_the_rock_BW_1.JPG","page_title":"Templet i Jerusalem","context_page_description":"Templet i Jerusalem var jødernes vigtigste helligdom i antikken og det primære opholdssted for Gud på jorden. Det lå på Tempelbjerget i Jerusalem og blev ifølge Bibelen opført i det 10. århundrede f.Kr. af kong Salomo. Salomos Tempel blev ødelagt af babylonerne i 586 f.Kr. Det blev genopbygget som \\"Det Andet Tempel\\" i 515 f.Kr. og blev flere hundrede år senere renoveret og udvidet af Herodes den Store. Templet stod til 70 e.Kr., hvor det blev ødelagt af romerne. Tempelpladsens vestmur, Grædemuren, er i dag den eneste rest af jødernes tempel og regnes for jødedommens helligste sted.\\nI dag ligger Klippehelligdommen og Al-Aqsa-moskéen på området, der regnes for islams tredje helligste sted efter Mekka og Medina. Tempelområdet er helligt for katolske og ortodokse kristne."},{"page_url":"https://fr.wikipedia.org/wiki/Parc_Dominion","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Myth_City_Dominion_Park_Montreal_1910.jpg","page_title":"Parc Dominion","context_page_description":"Le Parc Dominion est un parc d'attractions situé jadis dans l’est de Montréal, au Québec, entre le fleuve Saint-Laurent et la rue Notre-Dame. Il a ouvert ses portes le 2 juin 1906 et a été visité jusqu'en 1937."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9F%D0%BE%D0%BD%D0%B8_%D0%BA%D0%B0%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/69MustangPassengerSide.JPG","page_title":"Пони кар","context_page_description":"Пони кар е клас американски автомобили, вдъхновен от модела Форд Мустанг."},{"page_url":"https://en.wikipedia.org/wiki/Trocka_metro_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Stacja_metra_Trocka_w_Warszawie_2019.jpg","page_title":"Trocka metro station","context_page_description":"Trocka is a subway station in Warsaw's Targówek district. It is part of the extension of the subway line M2 from Dworzec Wileński to Targówek, with construction started in 2016. All three stations opened on September 15, 2019."},{"page_url":"https://de.wikipedia.org/wiki/42nd-Street-Shuttle","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Times_Square_-_42nd_Street_-_Shuttle_Track_3.jpg","page_title":"42nd-Street-Shuttle","context_page_description":"Der 42nd-Street-Shuttle ist eine von drei Linien, die als Shuttle bezeichnet werden, und mit 1,3 Kilometern die kürzeste Linie der New Yorker U-Bahn. Sie verkehrt zwischen 6 Uhr und Mitternacht, die Fahrzeit zwischen den beiden einzigen Stationen beträgt eine Minute. Nachts reicht der Betrieb auf der parallelen Linie 7 aus.\\nBei der MTA wird die Linie auch als „Linie 0“ bezeichnet, um sie von den anderen Shuttles, des Rockaway- und des Franklin-Avenue-Shuttles zu unterscheiden. Sie ist die einzige Linie des einstigen Betreibers IRT, die auf ihrem ganzen Weg unterirdisch verläuft."},{"page_url":"https://hu.wikipedia.org/wiki/Seychelle-szigeteki_rep%C3%BCl%C5%91kutya","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Seychelles_Fruit_Bat_area.png","page_title":"Seychelle-szigeteki repülőkutya","context_page_description":"A Seychelle-szigeteki repülőkutya az emlősök osztályának a denevérek rendjéhez, ezen belül a nagydenevérek alrendjéhez és a repülőkutyafélék családjához tartozó faj."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A8%D0%B0%D1%80%D0%BE%D0%B2%D0%B8%D0%BA%D0%B8_(%D0%B8%D0%B3%D0%BB%D0%BE%D0%BA%D0%BE%D0%B6%D0%B8%D0%B5)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/57/GraptoliteEchinosphaerites.jpg","page_title":"Шаровики (иглокожие)","context_page_description":"Шаровики — класс вымерших иглокожих. Известны с ордовика. Вымерли, по разным данным, в каменноугольном либо в пермском периоде. От других иглокожих отличаются наличием в панцире поровых отверстий треугольной формы.\\nВнешне напоминали морских лилий, с тем различием, что у шаровиков тело было овальным, а не в форме чаши, как у лилий. Ротовое отверстие располагалось на верхнем конце тела. Нижним концом шаровики крепились к морскому дну, часто с помощью стебельков. Анальное отверстие открывалось вбок. Поверхность тела делилась на пять, реже на три амбулакральные области, которые сходились ко рту. Небольшие щупальца либо окружали рот, либо располагались рядами по телу, в зависимости от вида.\\nПоровые отверстия служили, скорее всего, для циркуляции воды, чтобы обеспечить дыхание. У одних видов они сосредоточены в определённой области, тогда как у других распределены по всей поверхности тела."},{"page_url":"https://en.wikipedia.org/wiki/Anaea_aidea","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Anaea_aidea.jpg","page_title":"Anaea aidea","context_page_description":"Anaea aidea, the tropical leafwing, is a species of brush-footed butterfly in the subfamily Charaxinae. Its native range extends from Mexico to northwestern Costa Rica, with strays sometimes seen in southern Texas, Arizona, and California in the United States. Some authors consider Anaea aidea to be a subspecies of Anaea troglodyta.\\nIt has a wingspan of 57–78 mm. The larvae feed on Croton species."},{"page_url":"https://ur.wikipedia.org/wiki/%D9%BE%D8%A7%D9%86%DB%8C-%D9%84-%D8%B4%D8%A7%D8%AA%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Pagny_technoport.jpg","page_title":"پانی-ل-شاتو","context_page_description":"پانی-ل-شاتو ایک فرانسیسی کمیون ہے جو فرانس میں واقع ہے۔ اس کی مجموعی آبادی 501 افراد پر مشتمل ہے، یہ Canton of Seurre میں واقع ہے۔"},{"page_url":"https://fr.wikipedia.org/wiki/Jos%C3%A9_Antonio_Rodr%C3%ADguez_(football,_1992)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Jose_de_Jesus_Corona_Rodriguez.jpg","page_title":"José Antonio Rodríguez (football, 1992)","context_page_description":"José Antonio Rodríguez, né le 4 juillet 1992 à Guadalajara, est un footballeur mexicain qui évolue au poste de gardien de but au Club León. Il remporte en 2012 la médaille d'or aux Jeux olympiques d'été de Londres."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%94%D0%BE%D1%9A%D0%B8_%D0%9B%D0%B8%D0%BF%D0%BE%D0%B2%D0%B0%D1%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Donji_Lipovac_%28Brus%29_%2872%29.jpg","page_title":"Доњи Липовац","context_page_description":"Доњи Липовац је насеље у Србији у општини Брус у Расинском округу. Према попису из 2011. било је 152 становника."},{"page_url":"https://lv.wikipedia.org/wiki/Baldone","image_url":"https://upload.wikimedia.org/wikipedia/lv/9/9d/Baldones_autobusa_pietura.jpg","page_title":"Baldone","context_page_description":"Baldone ir pilsēta Baldones novadā, 33 km no Rīgas, novada centrs. Uz Baldoni no galvaspilsētas ved valsts nozīmes autoceļš P89, no kura atzarojas autoceļš P91 tieši uz pilsētu. Cauri Baldonei tek Ķekaviņas upīte. Vēsturiski Baldone ietilpusi Zemgalē, bet kopš 1923. gada, kad Baldones pagastu iekļāva Rīgas apriņķī — Vidzemē. Pilsēta ir viena no divām novada teritoriālajām vienībām, izvietojusies tā vidusdaļā un no visām pusēm to iekļauj Baldones pagasts."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_grecque-catholique_roumaine","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/CathoRomania.jpg","page_title":"Église grecque-catholique roumaine","context_page_description":"L'Église grecque-catholique roumaine, Église gréco-catholique roumaine ou Église roumaine unie à Rome, gréco-catholique est une des Églises catholiques orientales. Le chef de l'Église porte le titre d'archevêque majeur d'Alba Iulia et Făgăraș, avec résidence à Blaj. Depuis 1994, son titulaire actuel est son excellence monseigneur Lucian Mureșan.\\nElle ne doit pas être confondue avec l'Église romano-catholique de Roumanie, également catholique mais appartenant à l'Église latine.\\nSelon le recensement de 2011, l'Église grecque-catholique roumaine compte 150 593 membres, soit 0,7 % de la population."},{"page_url":"https://da.wikipedia.org/wiki/Mindeparken_(Aarhus)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Mindeparken_%28Monumentet%29.JPG","page_title":"Mindeparken (Aarhus)","context_page_description":"Mindeparken er et parkområde på ca 27 hektar lidt syd for Aarhus centrum. Parken blev indviet 5. juli 1925 af kong Christian 10.. Parken ligger på et område mellem Marselisborg Slot og Aarhus-bugten. Knyttet til parken er arboretet Forstbotanisk Have."},{"page_url":"https://de.wikipedia.org/wiki/Meerfeld","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Meerfeldermaar01.jpg","page_title":"Meerfeld","context_page_description":"Meerfeld ist eine Ortsgemeinde im Landkreis Bernkastel-Wittlich in Rheinland-Pfalz. Sie gehört der Verbandsgemeinde Wittlich-Land an. Meerfeld ist ein staatlich anerkannter Erholungsort."},{"page_url":"https://de.wikipedia.org/wiki/Spider-Man","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/WonderCon_2015_-_Spider-Man%2C_Gwen_Stecy%2C_and_Mary_Jane_%2817048763441%29.jpg","page_title":"Spider-Man","context_page_description":"Spider-Man ist eine Comicfigur und eine Comicreihe von Marvel Comics. Spider-Man wurde von Stan Lee und Steve Ditko geschaffen. Sein erster Auftritt war in Amazing Fantasy Nr. 15 im August 1962.\\nSpider-Man ist eine der wichtigsten Comicfiguren des Marvel Verlags. Im deutschsprachigen Raum war Spider-Man seit seiner Einführung die meiste Zeit der erfolgreichste Marvel-Charakter.\\nAuf der einen Seite ist er ein Superheld mit speziellen Fähigkeiten, andererseits hat er mit den Mühen und Problemen des Alltags zu kämpfen. Peter Benjamin Parker, alias Die Spinne, wird als Waisenkind von seinem Onkel Ben und seiner Tante May aufgenommen."},{"page_url":"https://oc.wikipedia.org/wiki/Chiatra","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Chiatra70.jpg","page_title":"Chiatra","context_page_description":"Chjatra en còrs es una comuna corsa, situada dins lo departament de Nauta Corsega‎ e la region de Corsega."},{"page_url":"https://pl.wikipedia.org/wiki/I_Korpus_Polski_(PSZ)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Patka_piechota.png","page_title":"I Korpus Polski (PSZ)","context_page_description":"I Korpus – wyższy związek taktyczny Polskich Sił Zbrojnych w latach 1940–1947."},{"page_url":"https://af.wikipedia.org/wiki/Spaanse_verowering_van_die_Asteekse_Ryk","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/TlaxcalaGlyph.jpg","page_title":"Spaanse verowering van die Asteekse Ryk","context_page_description":"Die Spaanse verowering van die Asteekse Ryk / Meksiko was 'n baie belangrike onderdeel van die Spaanse kolonisering van die Amerikas. Die koms van die Spanjaarde het die einde vir die Asteekse Ryk beteken. Die veldtogte teen die Asteekse Driebond is deur die conquistador Hernán Cortés gelei."},{"page_url":"https://en.wikipedia.org/wiki/San_Fernando_Pastoral_Region","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Bishop_Alemany_High_School.JPG","page_title":"San Fernando Pastoral Region","context_page_description":"The San Fernando Pastoral Region is a pastoral region of the Archdiocese of Los Angeles in the Roman Catholic Church. It covers the San Fernando, Santa Clarita, and Antelope Valleys. The current regional auxiliary bishop is Bishop Alejandro D. Aclan. The Region has 54 parishes, 12 high schools, 2 hospitals, and 1 Spanish Mission."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0_%D0%A2%D0%B5%D1%81%D0%BB%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Telegram_Tesla_Macek_0108.JPG","page_title":"Никола Тесла","context_page_description":"Никола Тесла — српски научник, и истражувач и пронаоѓач на полето на електротехниката и радиотехниката, познат е како татко на наизменичната струја и бројни футуристички пронајдоци.\\nРоден е во Смилјан, Австроунгарија, Србин по потекло, подоцна добива американско државјанство и станува граѓанин на САД. Тесла е најпознат по своите револуционерни откритија во областа на електромагнетизмот кон крајот на XIX и почетокот на XX век. Патентите на Тесла и неговата теориска работа стануваат основа за формирањето на целокупниот систем на наизменичната струја, вклучувајќи го и конструирањето на полифазните системи, како и на индукциониот мотор, со кој се претвора во предводник на Втората индустриска револуција.\\nПо неговата демонстрација на безжичната комуникација во 1893 година и откако е прогласен за неспорен победник во „Војната на струите“, тој станува најпочитуваниот и најголемиот американски и светски научник.\\nГолем дел од неговата најрана работа ќе стане основа за модерното инженерство, а многу од неговите откритија се од непроценлива важност за развитокот на модерната цивилизација."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%A6%99%E6%B8%AF%E4%B8%89%E7%B4%9A%E6%AD%B7%E5%8F%B2%E5%BB%BA%E7%AF%89%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/HK_No_2_York_Road.JPG","page_title":"香港三級歷史建築列表","context_page_description":"香港三級歷史建築是香港古物古蹟辦事處評級的香港歷史建築的第三個級別。在這個級別的建築物，被認為具若干價值， 並宜於以某種形式予以保存的建築物；如保存並不可行則可以考慮其他方法。\\n2005年，當局選取了1444幢歷史建築物，由專家小組進行深入評估，並向古物諮詢委員會提交擬定評級，供委員會考慮及審議。截至2020年6月11日，全港有495幢建築物被確定為三級歷史建築；另有74幢不屬於上述名單的建築物，獲評為三級歷史建築，兩者合共569幢。"},{"page_url":"https://en.wikipedia.org/wiki/Xikou_Suspension_Bridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/2019_New_Xikou_Suspension_Bridge_Fuxing_District.jpg","page_title":"Xikou Suspension Bridge","context_page_description":"The Xikou Suspension Bridge is a suspension bridge in Fuxing District, Taoyuan City, Taiwan. It crosses the Dahan River."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%93%9C%E7%BF%85%E9%B8%A0%E6%97%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/PhlegoenasKeulemans.jpg","page_title":"铜翅鸠族","context_page_description":"銅翅鳩族是鴿形目鳩鴿科的一族，是一個包含了約9個屬的演化支，其成員大多為中小型鳩類，主要分布於澳大拉西亞及周邊地區。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2,_%D0%92%D0%B8%D0%BA%D1%82%D0%BE%D1%80_%D0%90%D1%84%D0%B0%D0%BD%D0%B0%D1%81%D1%8C%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Returning_Russia_book_cover.jpg","page_title":"Петров, Виктор Афанасьевич","context_page_description":"Виктор Афанасьевич Петров — советский, российский кинооператор и режиссёр документальных, научно-популярных и рекламных фильмов, реставратор иконописи."},{"page_url":"https://es.wikipedia.org/wiki/Blaverismo","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/269157064_7c90a1cf5f_o.jpg","page_title":"Blaverismo","context_page_description":"El blaverismo es la denominación con que se conoce al movimiento político regionalista y anticatalanista -antipancatalanista- surgido durante la Transición española en la Comunidad Valenciana.​ Debe su denominación, originalmente despectiva, ​​​ a la ferviente defensa por parte de este movimiento de la franja azul de la bandera de la Comunidad Valenciana.​​ Actualmente, el término blaverismo y derivados se encuentra recogido en diferentes diccionarios de la lengua valenciana, entre ellos el normativo de la Acadèmia Valenciana de la Llengua.\\nEl blaverismo es un movimiento originalmente popular y heterogéneo​ que aglutina sectores, en su mayoría, situados en la derecha regionalista valenciana, y apareció como reacción al discurso fusteriano del nacionalismo valenciano.​ Entre las características de su discurso, se encuentran elementos como el populismo, ​​ el regionalismo​ y el provincialismo, ​ el conservadurismo​​ y sobre todo el anticatalanismo, ​​ hecho que les llevará a practicar el secesionismo lingüístico del valenciano respecto al catalán, ​ y algunos autores también incluyen entre sus características el fascismo, ​ reaccionarismo​ o vinculaciones con estos."},{"page_url":"https://de.wikipedia.org/wiki/Cantois","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Cantois_%C3%89glise_Saint-Seurin_01.jpg","page_title":"Cantois","context_page_description":"Cantois ist eine Ortschaft und eine ehemalige französische Gemeinde im Département Gironde in der Region Nouvelle-Aquitaine. Sie gehörte zum Arrondissement Langon und zum Kanton L’Entre-deux-Mers. Die Einwohner werden Cantoisiens genannt.\\nZum 1. Januar 2019 schloss sich Cantois mit Arbis zur Commune nouvelle Porte-de-Benauge zusammen. Cantois besitzt hierbei keinen Status einer Commune déléguée."},{"page_url":"https://eu.wikipedia.org/wiki/Sighi%C8%99oara","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/ROU_MS_Sighisoara_CoA1.jpg","page_title":"Sighișoara","context_page_description":"Sighișoara Errumania erdialdeko hiri bat da, Mureș konderriko hiriburua. Târnava Mare ibaiaren ertzean.\\nTransilvanian kokaturik, 2011n 28,102 biztanle zituen eta 1999an UNESCOk bere Alde Zaharra Gizateriaren Ondare izendatu zuen."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E4%B9%9D%E9%BE%8D%E5%8D%8A%E5%B3%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/HK_Kowloon_View_2006.jpg","page_title":"九龍半島","context_page_description":"九龍半島是香港境內的一個半島。九龍半島和新九龍地區統稱為九龍。\\n在地理上，「九龍半島」一詞也指筆架山、獅子山、大老山、飛鵝山等山脈以南的地區。香港十八個區中有五個位於九龍半島。九龍灣位於九龍半島東北。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A8%D0%BD%D0%B5%D0%B9%D0%B4%D0%B5%D1%80,_%D0%9E%D1%80%D1%82%D0%B0%D0%BD%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Plaque_Hortense_Schneider%2C_123_avenue_de_Versailles%2C_Paris_16.jpg","page_title":"Шнейдер, Ортанс","context_page_description":"Ортанс Шнейдер, также Гортензия Шнейдер, настоящее имя Катрин-Жанна или Каролина-Жанна Шнейдер — французская артистка оперетты, известная своими ролями в опереттах Оффенбаха. Ряд заглавных партий композитор создал специально для неё."},{"page_url":"https://ro.wikipedia.org/wiki/Engayrac","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/09/Map_commune_FR_insee_code_47087.png","page_title":"Engayrac","context_page_description":"Engayrac este o comună în departamentul Lot-et-Garonne din sud-vestul Franței. În 2009 avea o populație de 146 de locuitori."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Monuments_historiques_in_La_Sauve","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/LaSauveEgliseSaint-Pierre01.JPG","page_title":"Liste der Monuments historiques in La Sauve","context_page_description":"Die Liste der Monuments historiques in La Sauve führt die Monuments historiques in der französischen Gemeinde La Sauve auf."},{"page_url":"https://la.wikipedia.org/wiki/Marcus_Wallenberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Marcus_Wallenberg_1774_1833.jpg","page_title":"Marcus Wallenberg","context_page_description":"Marcus Wallenberg, die 24 Iunii anno 1774 Lincopiae natus et die 22 Septembris anno 1833 ibidem mortuus, fuit episcopus Suecicus Lutheranus et interpres. In Universitate Upsaliensi educatus, ab anno 1819 usque ad mortem Lincopiae episcopus fuit. Homeri Iliadem et Odysseam Suecice hexametris vertit. Annis 1814 et 1815 volumina duo Iliadis et annis 1819 et 1821 Odysseae edita sunt."},{"page_url":"https://eo.wikipedia.org/wiki/Riethnordhausen_(apud_Erfurto)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Kirche_Riethnordhausen2.JPG","page_title":"Riethnordhausen (apud Erfurto)","context_page_description":"Riethnordhausen [ri:tNORThaŭz'n] estas komunumo en Germanio. Ĝi troviĝas en la distrikto Sömmerda de la federacia lando Turingio, kaj apartenas al administra komunumaro Straußfurt. Fine de decembro 2015 la komunumo havis 981 loĝantojn."},{"page_url":"https://ast.wikipedia.org/wiki/Dactylorhiza_maculata","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/38/Dactylorhiza_maculata2.jpg","page_title":"Dactylorhiza maculata","context_page_description":"la Orquídea motuda de los banzaos o Dactylorhiza maculata Soó 1962, ye una especie d'orquídees, del xéneru Dactylorhiza, de la subfamilia Orchidoideae de la familia de les Orchidaceae estrechamente rellacionaes col xéneru Orchis. Distribúise per toa Europa, llegando al Noroeste d'África y por Siberia. Son de vezos terrestres y tienen tubérculos."},{"page_url":"https://fr.wikipedia.org/wiki/Casse-t%C3%AAte_ferroviaire","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/O-14_inglenook.jpg","page_title":"Casse-tête ferroviaire","context_page_description":"Les casse-tête ferroviaires sont des jeux de logique et de déduction issus du monde des chemins de fer, utilisant des trains miniatures. Il s'agit alors de résoudre un problème donné en un minimum de temps ou de manœuvres. Il existe un certain nombre de casse-têtes ferroviaires, plus ou moins célèbres."},{"page_url":"https://en.wikipedia.org/wiki/Ahmed_Zabana_National_Museum","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Mus%C3%A9e_national_d%27Oran.jpg","page_title":"Ahmed Zabana National Museum","context_page_description":"The Ahmed Zabana National Museum is a museum located in Oran, Algeria and is named after the Algerian national hero Ahmed Zabana executed by the French on May 19, 1956, in Algiers."},{"page_url":"https://pl.wikipedia.org/wiki/Szlak_Piastowski","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Cathedral_in_Gniezno.September_2007.JPG","page_title":"Szlak Piastowski","context_page_description":"Szlak Piastowski – trasa turystyczna w Polsce, przebiegająca przez województwo wielkopolskie i województwo kujawsko-pomorskie. Szlak funkcjonuje przede wszystkim jako trasa wycieczek autokarowych i samochodowych oraz szlak rowerowy. W 2012 otrzymał Certyfikat Polskiej Organizacji Turystycznej za najlepszy produkt turystyczny, jako unikatowy i wyjątkowo ważny dla polskiego dziedzictwa."},{"page_url":"https://en.wikipedia.org/wiki/Three_Steps","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/North_face_marked.png","page_title":"Three Steps","context_page_description":"The Three Steps are three prominent rocky steps on the northeast ridge of Mount Everest. They are located at altitudes of 8,564 metres, 8,610 metres, and 8,710 metres. The Second Step is especially significant both historically and in mountaineering terms. Any climber who wants to climb on the normal route from the north of the summit must negotiate these three stages.\\nThe First Step consists of large boulders that pose a serious obstacle, even for experienced climbers, because of their height above sea level. Many mountaineers have died near the First Step, among them \\"Green Boots\\", a corpse wearing neon green climbing boots and a red coat, which serves as a somber landmark for climbers to gauge their distance to the top, and which has now been possibly identified as Tsewang Paljor. His fellow climbers, who also perished on the same day as he in 1996, are Tsewang Smanla and Dorje Morup. Other climbers have died under that rock as well, namely David Sharp and Francys Arsentiev.\\nThe Second Step is the best known of the rocky steps. The steep section, at an altitude of 8,610 m, has a climbing height of 40 metres, of which the last five are almost vertical."},{"page_url":"https://en.wikipedia.org/wiki/Centenary_Square","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/ForwardRaymondMason.jpg","page_title":"Centenary Square","context_page_description":"Centenary Square is a public square on the north side of Broad Street in Birmingham, England, named in 1989 to commemorate the centenary of Birmingham achieving city status. The area was an industrial area of small workshops and canal wharves before it was purchased by the council in the 1920s for the creation of a grand civic centre scheme to include museums, council offices, cathedral and opera house. The scheme was abandoned after the arrival of World War II with only the Hall of Memory and half of the planned Baskerville House complete. After the war the scheme was revived in a simpler form however the council never managed to implement the design.\\nIn 1991 the square was redesigned to complement the new International Convention Centre with new paving, railings and lamps designed by artist Tess Jaray, a fountain and several sculptures. During the construction and opening of the Library of Birmingham on the square in 2013 several of the elements of the 1991 design were removed and a library amphitheatre was built into the square. In 2014 a design competition was held to redesign the square. Construction of the redesigned square began in 2017 and was largely complete in 2019."},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_presidentene_for_det_tyske_Forbundsr%C3%A5det","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/98/KAS-Althaus%2C_Dieter-Bild-23432-1.jpg","page_title":"Liste over presidentene for det tyske Forbundsrådet","context_page_description":"Presidenten for Forbundsrådet er leder for overhuset i Tysklands parlament."},{"page_url":"https://bar.wikipedia.org/wiki/Hudspeth_County,_Texas","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Hudspeth_county_courthouse_2009.jpg","page_title":"Hudspeth County, Texas","context_page_description":"Hudspeth County is a County im Bundesstoot Texas vo da USA. Da Sitz vo da County-Vawoitung is z Sierra Blanca."},{"page_url":"https://it.wikipedia.org/wiki/Salame","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Salame_friulano_01.jpg","page_title":"Salame","context_page_description":"Il salame è un tipo di salume insaccato, crudo e stagionato, ottenuto a partire da una miscela di macinato di carne e grasso. Il nome deriva dall'operazione di salatura che si rende necessaria per assicurarne la conservazione.\\nAlla carne e al grasso vengono aggiunti sale e spezie che variano localmente."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Ramsar_sites_in_Japan","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Anparu.jpg","page_title":"List of Ramsar sites in Japan","context_page_description":"The Ramsar Convention is an international treaty for the conservation and sustainable use of wetlands. Adopted in 1971, it entered into force in 1975 and as of December 2015 has 169 Contracting Parties. Japan was the twenty-fourth party to accede, on 17 October 1980. Kushiro-shitsugen was the first of Japan's fifty-two Ramsar Sites as of the thirteenth Conference of the Contracting Parties, with a total surface area of 1,547 square kilometres."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D0%B2%D0%BE%D1%80%D0%B5%D1%86%D1%8C%D0%BA%D0%B8%D0%B9_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/V_F_Dvorecky.JPG","page_title":"Дворецький Василь","context_page_description":"Василь Дворецький герба Слонина — військовий та політичний діяч, полковник Війська Запорозького, промосковської орієнтації."},{"page_url":"https://de.wikipedia.org/wiki/Stanislaw_Gustawowitsch_Strumilin","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Peter_Mikhailovich_StrumiloPetrushkevich.jpg","page_title":"Stanislaw Gustawowitsch Strumilin","context_page_description":"Stanislaw Gustawowitsch Strumilin war ein sowjetischer Statistiker und Ökonom.\\nStrumilin war ab 1899 Mitglied der Sozialdemokratischen Arbeiterpartei. Er wurde mehrmals verhaftet und floh aus der Verbannung. Bis 1920 war er Menschewik, ab 1923 Mitglied der Kommunistischen Partei. Ab 1921 arbeitete er auf Vorschlag Lenins in der Staatlichen Plankommission. Strumilin gilt als einer der Begründer der sowjetrussischen Statistik."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%8C%97%E4%B8%89%E7%8E%AF%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Zhengzhou_Metro_Beisanhuan_Station_20200427.jpg","page_title":"北三环站","context_page_description":"北三環站是鄭州地鐵2號線的一座車站，位於河南省鄭州市金水區花園路與廣電南路交叉口，於2016年8月19日隨鄭州地鐵2號線一期開通運營。"},{"page_url":"https://it.wikipedia.org/wiki/Associazione_Calcio_Milan_1956-1957","image_url":"https://upload.wikimedia.org/wikipedia/it/9/90/Associazione_Calcio_Milan_1956-57.jpg","page_title":"Associazione Calcio Milan 1956-1957","context_page_description":"Questa voce raccoglie le informazioni riguardanti l'Associazione Calcio Milan nelle competizioni ufficiali della stagione 1956-1957."},{"page_url":"https://de.wikipedia.org/wiki/LADR","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Mikrobio-wiki7.jpg","page_title":"LADR","context_page_description":"Der LADR Laborverbund Dr. Kramer & Kollegen ist ein ärztlich und inhabergeführter Zusammenschluss unabhängiger laborärztlicher medizinischer Versorgungszentren und Labore. Sie führen jeweils das Kürzel LADR in ihrem Namen. Dieses ist auf die 1974 erstmals verwendete Formulierung Laborärztliche Arbeitsgemeinschaft für Diagnostik und Rationalisierung zurückzuführen.\\nDer LADR Laborverbund ist nicht operativ tätig, sondern dient der Repräsentation seiner Mitgliedslabore, der regionalen LADR Laborgesellschaften sowie als fachlich-ärztliches Konsiliarnetzwerk aus Experten. Die LADR Laborzentren erbringen Leistungen in verschiedenen Bereichen. Dazu zählen die Patientenversorgung durch Laboratoriumsmedizin, Hygiene, Infektiologie und medizinische Mikrobiologie sowie Humangenetik, Pathologie und Transfusionsmedizin. Ferner gehören dazu Leistungen im naturwissenschaftlichen Bereich mit Lebensmittelchemie und Lebensmittelmikrobiologie sowie Wasser- und Umweltanalytik. Zum Portfolio gehört auch Spezialanalytik im Bereich Tiergenetik und Abstammungsanalyse bei Menschen."},{"page_url":"https://es.wikipedia.org/wiki/Historia_numism%C3%A1tica_de_Ecuador","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/2_cent_1872.jpg","page_title":"Historia numismática de Ecuador","context_page_description":"La historia económica y política de un país se puede contar a través de su moneda, ​ antes de la llegada de los conquistadores españoles a los territorios ecuatorianos, las tribus locales usaban conchas y hachas de cobres como medio de pagos y como muestra de poder espiritual del cacique que las ostentaba.​ Mientras duró el dominio español en tierras ecuatorianas la población utilizó la moneda conocida como macuquinas y posteriormente las columnarias de los distintos reyes españoles."},{"page_url":"https://en.wikipedia.org/wiki/Telewizja_Polsat","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Polsat_news_HD_logo.png","page_title":"Telewizja Polsat","context_page_description":"Telewizja Polsat is a Polish media company and broadcaster of television channels mainly under the Polsat brand.\\nIn November 2010 Cyfrowy Polsat announced that it is buying 100% of the Telewizja Polsat shares."},{"page_url":"https://ja.wikipedia.org/wiki/VAIO%E3%81%AE%E6%A9%9F%E7%A8%AE%E4%B8%80%E8%A6%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Sony_VAIO_FJ76.JPG","page_title":"VAIOの機種一覧","context_page_description":"VAIOの機種一覧とはソニー、およびVAIOのパーソナルコンピュータ・VAIOの現行モデル並びに過去に発売されたモデルを列挙した一覧である。"},{"page_url":"https://es.wikipedia.org/wiki/Halszkaraptorinae","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Sinornithosaurus_%28flipped%29.jpg","page_title":"Halszkaraptorinae","context_page_description":"Halszkaraptorinae es una subfamilia extinta de dinosaurios terópodos dromeosáuridos, los cuales muestran evidencia de un estilo de vida semiacuático.​ Se incluyen los géneros Halszkaraptor, Mahakala y Hulsanpes, los cuales son situados como una rama muy basal de dromeosáuridos.​\\nEl cladograma mostrado a continuación se basa en el análisis filogenético presentado por Cau et al., 2017, usando datos actualizados del Theropod Working Group.​"},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D8%A7%D9%86_%D8%A8%D9%88%D9%84_%D8%AC%D9%88%D8%AA%D9%8A%D9%8A%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Jean-Paul_Gaultier_bustier_Montreal_expo_2011.jpg","page_title":"جان بول جوتييه","context_page_description":"جان بول جوتييه وهو مصمم هدوم و ملابس جاهزة."},{"page_url":"https://fr.wikipedia.org/wiki/Banque_d%27Amsterdam","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Banque_Amsterdam01.jpg","page_title":"Banque d'Amsterdam","context_page_description":"La Banque d’Amsterdam est une des premières banques de dépôt européennes. Créée en 1609 avec la garantie et l’accord des États de Hollande, c'est une banque publique placée sous le contrôle de la municipalité de la ville dotée du monopole du change. Entre 1609 et 1820, année de sa liquidation, la banque sera un des éléments qui feront d'Amsterdam une des premières places financières du monde avant de décliner face notamment à la montée de Londres. Si la banque d’Amsterdam influera sur l’évolution économique et sociale du pays et sa place en Europe, le déclin relatif des Provinces-Unies scellera également celui de la Wisselbank.\\nFondée au départ pour faciliter les transactions financières des Provinces-Unies des espèces obérées par des monnaies de mauvais aloi, elle va instaurer après une période de tâtonnements une monnaie de banque au cours stable, basée sur sa contrepartie en monnaies ou en métaux précieux entreposés dans ses coffres. Grâce à une politique libérale de circulation des capitaux, ce « florin banco » va devenir un instrument de paiement respecté dans toute l'Europe qui lui apportera des agios importants."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Palais_in_%C5%81%C3%B3d%C5%BA","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0e/Pa%C5%82ac_Jakuba_Hertza_w_%C5%81odzi.jpg","page_title":"Liste der Palais in Łódź","context_page_description":"Die Liste der Stadtschlösser und Palais in Łódź umfasst bestehende Stadtschlösser und Palais in der polnischen Stadt Łódź. Eine Liste mit Burgen und Schlössern in der Woiwodschaft Łódź befindet sich hier:\\nListe der Burgen und Schlösser in der Woiwodschaft Łódź"},{"page_url":"https://de.wikipedia.org/wiki/Bahnstrecke_Berlin%E2%80%93Dresden","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c5/Bahnuebergang-Berlin-Lichtenrade-S-Bahn_LWS0405.jpg","page_title":"Bahnstrecke Berlin–Dresden","context_page_description":"Die Bahnstrecke Berlin–Dresden ist eine zweigleisige, elektrifizierte Hauptbahn in Berlin, Brandenburg und Sachsen, die ursprünglich von der Berlin-Dresdener Eisenbahn-Gesellschaft erbaut und betrieben wurde.\\nSie verläuft vom westlichen Berliner Stadtzentrum südlich durch den Teltow, die Niederlausitz und den Fläming nach Elsterwerda. Weiter südlich wird die Großenhainer Pflege durchquert und der nordwestliche Rand des Elbtalkessels erreicht. Von dort steigt die Strecke relativ kurvenreich nach Weinböhla ab, verläuft auf der Coswiger Heidesand-Terrasse Richtung Niederwartha, wo nach der Elbüberquerung Dresden auf dem linken Elbufer in Friedrichstadt erreicht wird."},{"page_url":"https://en.wikipedia.org/wiki/List_of_beaches","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Varkala_beach.jpg","page_title":"List of beaches","context_page_description":"This is a list of beaches of the world, sorted by country. A beach is a landform along the shoreline of an ocean, sea, lake, or river. It usually consists of loose particles, which are often composed of rock, such as sand, gravel, shingle, pebbles, or cobblestones. Beaches typically occur in areas along the coast where wave or current action deposits and reworks sediments. The particles comprising a beach are occasionally biological in origin, such as mollusc shells or coralline algae."},{"page_url":"https://en.wikipedia.org/wiki/Kadesh_inscriptions","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/%C3%84gypten_1999_%28134%29_Assuan-_Im_Gro%C3%9Fen_Tempel_von_Abu_Simbel_%2827595822585%29.jpg","page_title":"Kadesh inscriptions","context_page_description":"The Kadesh inscriptions or Qadesh inscriptions are a variety of Egyptian hieroglyphic inscriptions describing the Battle of Kadesh. The combined evidence in the form of texts and wall reliefs provide the best documented description of a battle in all of ancient history.\\nThe Egyptian version of the battle of Kadesh is recorded in two primary accounts, known as the Bulletin and the Poem. These inscriptions exist in multiple locations. Some scholars divide these accounts into three. The Bulletin is repeated seven times and the Poem eight times, spread across temples in Abydos, Temple of Luxor, Karnak, Abu Simbel and the Ramesseum, and two hieratic papyri."},{"page_url":"https://pl.wikipedia.org/wiki/Ceratopsinae","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Triceratops_Struct.jpg","page_title":"Ceratopsinae","context_page_description":"Ceratopsinae – jedna z dwóch, obok centrozaurów, podrodzin ceratopsów. Według definicji filogenetycznej przedstawionej w 2005 roku przez Paula Sereno, należą do niej zwierzęta bliżej spokrewnione z Triceratops horridus niż z Centrosaurus apertus.\\nTriceratopsini to najszerszy klad zawierający Triceratops horridus, ale nie Anchiceratops ornatus ani Arrhinoceratops brachyops.\\nDo podrodziny tej należały:\\nAgujaceratops\\nAnchiceratops\\nArrhinoceratops\\nBravoceratops\\nCeratops\\nChasmosaurus\\nCoahuilaceratops\\nJudiceratops\\nKosmoceratops\\nMercuriceratops\\nMojoceratops\\nNavajoceratops\\nPentaceratops\\nSpiclypeus\\nTatankaceratops\\nTerminocavus\\nUtahceratops\\nVagaceratops\\nklad Triceratopsini:\\nEotriceratops\\nNedoceratops\\nOjoceratops\\nRegaliceratops\\nTitanoceratops\\nTorosaurus\\nTriceratops"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8B%E3%83%A5%E3%83%BC%E3%81%99%E3%81%9A%E3%82%89%E3%82%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/ANEK_Lines_Kriti_I_01.JPG","page_title":"ニューすずらん","context_page_description":"ニューすずらんは、新日本海フェリーが運航していたフェリー。"},{"page_url":"https://zh.wikipedia.org/zh-my/%E8%BB%8D%E4%BA%8B%E5%B7%A5%E7%A8%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Grondplan_citadel_Lille.JPG","page_title":"軍事工程","context_page_description":"军事工程可以大致定义为设计及建立军事设施及设备，维持军事运输及通讯的艺术、工程及实务。军事工程也要负责军事战术的后勤。现代的军事工程和土木工程不同。二十世纪及二十一世纪的军事工程也要包括机械工程以及电机工程的相关技术。\\n依照北约的定义：“军事工程是塑造实际作战环境的工程活动。军事工程整合了对机动和整体力量的支持，军事工程机能包括有工程师支持的部队防护、反简易爆炸装置、环境保护、工程智能以及军事搜索。军事工程不包括维护、修理及操作军车、船舶，飞机，武器系统和设备等由“工程师”进行的工作。”\\n军事工程是军校中的一个学术领域。和与军事工程相关的建设和拆迁工作通常由军事工程师进行，包括专门训练的工兵。在现代的部队中，若士兵受过训练，可以在炮火下进行上述工作，会称为战斗工兵。\\n有些国家的军事工程师也会在平时执行一些非军事的任务，例如防洪或河道工程等，不过这些不算在军事工程中。"},{"page_url":"https://zh.wikipedia.org/zh-tw/SAP%E5%85%AC%E5%8F%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/SAP_AG_Headquarter_1200.jpg","page_title":"SAP公司","context_page_description":"SAP公司是德國一家軟體企業，總部位於德國巴登符騰堡州瓦爾多夫，主營企業資源管理軟體，在130個國家設有辦事處，在190個國家擁有超過335,000名客戶。該公司股票是歐洲Stoxx 50股票市場指數的成分股。"},{"page_url":"https://de.wikipedia.org/wiki/Garnisonen_der_Landstreitkr%C3%A4fte_%C3%96sterreich-Ungarns","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Gro%C3%9F-Enzersdorf_Dragoner_Kaserne.jpg","page_title":"Garnisonen der Landstreitkräfte Österreich-Ungarns","context_page_description":"Im Vielvölkerstaat Österreich-Ungarn waren im Gegensatz zu Ländern mit ethnischer Einheit die Garnisonen der Armee nicht größtenteils entlang der Grenzen angelegt, sondern über das ganze Land verstreut. Dies, um mögliche Unruhen oder gar Aufstände unverzüglich im Keim ersticken zu können. Aus diesem Grunde wurden die einzelnen Einheiten in den meisten Fällen fernab der Heimat stationiert. Um mögliche Fraternisierungen mit der Bevölkerung zu unterbinden wurden die einzelnen Regimenter der gemeinsamen Armee in kurzen Abständen verlegt. Erst ab etwa 1912 ließ diese Praxis etwas nach. Auch war es Standard, die Regimenter nicht komplett in eine Stadt zu legen, sondern die einzelnen Bataillone zu verteilen, um eine größtmögliche Flächendeckung zu erreichen.\\nIn weit geringerem Umfang betraf diese Praxis jedoch die Einheiten der k.k. Landwehr und der k.u. Honvéd.\\nAngegeben ist nur der Standort des Regimentsstabes und/oder des Bataillonsstabes. Es war durchaus gängige Praxis, einzelne Kompanien, Batterien oder Schwadronen in anderen Orten der jeweils näheren Umgebung unterzubringen. Hierzu wurden geeignete Liegenschaften verwendet"},{"page_url":"https://de.wikipedia.org/wiki/WTA_Madrid","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Kirilenko_on_blue_clay.jpg","page_title":"WTA Madrid","context_page_description":"Das WTA-Turnier von Madrid ist ein Tennisturnier der WTA Tour.\\nDer Sandplatzwettbewerb wird seit 2009 in Madrid ausgetragen und gehört zu den Premier-Mandatory-Turnieren, nach den Grand-Slam-Turnieren und dem Saisonfinale die höchstdotierten Veranstaltungen im Damentennis.\\nIn den Jahren 1996 bis 2003 fanden in Madrid die International Championships of Spain statt, die seit 2007 wieder in Barcelona ausgetragen werden.\\nIm Jahr 2012 wurde das Turnier einmalig auf einem umstrittenen blauen Sand ausgetragen."},{"page_url":"https://sl.wikipedia.org/wiki/1341","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Gedimin_grav_xvii.jpg","page_title":"1341","context_page_description":"1341 je bilo navadno leto, ki se je po julijanskem koledarju začelo na ponedeljek."},{"page_url":"https://he.wikipedia.org/wiki/%D7%99%D7%A9%D7%A8%D7%90%D7%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Jerusalem_Chords_Bridge.JPG","page_title":"ישראל","context_page_description":"יִשְׂרָאֵל היא מדינה במזרח התיכון, השוכנת על החוף הדרום-מזרחי של הים התיכון. ישראל הוקמה בשטחי ארץ ישראל, ביתו הלאומי וארץ מולדתו של העם היהודי. המדינה, שהכריזה על עצמאותה בה' באייר תש\\"ח, 14 במאי 1948, היא בעלת משטר של דמוקרטיה פרלמנטרית.\\nשטחה של המדינה הוא 22,072 קמ\\"ר, ואוכלוסייתה מנתה באפריל 2020, על-פי נתוני הלשכה המרכזית לסטטיסטיקה, 9,190,000 תושבים. מבחינה דמוגרפית, רוב הישראלים הם יהודים, אך יש בה מיעוט ערבי גדול וקבוצות מיעוט אחרות. ישראל גובלת בים התיכון ובמצרים במערב, בים האדום בדרום, בירדן במזרח, בסוריה בצפון-מזרח ובלבנון בצפון. בין ישראל ומצרים, לחוף הים התיכון, נמצאת רצועת עזה, שבשליטת חמאס. באזור ההר המרכזי שבין ישראל לירדן נמצאים הרי יהודה ושומרון, המוחזקים בידי ישראל תחת תפיסה לוחמתית.\\nב-1917, במהלך מלחמת העולם הראשונה, כבשה האימפריה הבריטית מידי העות'מאנים את ארץ ישראל. המנדט הבריטי במקום קיבל המשך תוקף מטעם חבר הלאומים. מאבקים ממושכים בין האוכלוסיות היהודיות והערביות בארץ ישראל הביאו את בריטניה למסור את שאלת המנדט בארץ לאו\\"ם, שבכ\\"ט בנובמבר 1947 המליץ לחלק את ארץ ישראל לשתי מדינות, יהודית וערבית. בעוד שהתוכנית התקבלה על ידי הסוכנות היהודית, היא נדחתה על ידי ההנהגה הערבית שהחלה לתקוף את היישוב, עימות שהתפתח למלחמת העצמאות."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%B5%D0%BC%D0%B5%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%82%D0%BE%D0%BD%D0%BA%D0%BE%D1%82%D0%B5%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Portrait_of_a_Douc.jpg","page_title":"Немейский тонкотел","context_page_description":"Немейский тонкотел — вид приматов из семейства мартышковых."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D1%82%D0%BE%D0%BB%D1%8F%D1%80_%D0%90%D0%B1%D1%80%D0%B0%D0%BC_%D0%AF%D0%BA%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Stolyar_AYa.jpg","page_title":"Столяр Абрам Якович","context_page_description":"Абрам Якович Столяр — радянський державний і партійний діяч, 1-й секретар Кіровського крайкому і обкому ВКП, 1-й секретар Свердловського обкому ВКП. Член ЦВК СРСР 8-го скликання. Депутат Верховної Ради СРСР 1-го скликання."},{"page_url":"https://en.wikipedia.org/wiki/Orto_Botanico_dell%27Universit%C3%A0_di_Pavia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Orto_Botanico_Universit%C3%A0_di_Pavia.jpg","page_title":"Orto Botanico dell'Università di Pavia","context_page_description":"The Orto Botanico dell'Università di Pavia also known as the Orto Botanico di Pavia, is a botanical garden maintained by the University of Pavia. It is located at Via S. Epifanio, 14, Pavia, Italy, and open weekdays.\\nThe botanical garden covers an area of about two hectares and has approximately two thousand different species of plants, that are organized in sections. The current director is Francesco Sartori.\\nThe garden was begun in 1773 as a successor to Pavia's earlier Orto dei Semplici. By 1775 the garden was in use, with its first wooden greenhouses constructed in 1776. Nocca Domenico organized and expanded the garden 1797–1826, adding collections to exchange seeds and plants, and building a masonry greenhouse to replace the earlier wooden structures. The garden was extensively damaged in World War II, after which its greenhouses were relocated to the main building's south side.\\nToday the garden contains about 2000 taxa, with major collections of aquatic plants, conifers, hosta, hydrangea, magnolia, medical plants, peat bog plants, and a rose garden. Its four greenhouses are as follows:"},{"page_url":"https://en.wikipedia.org/wiki/Narayanpet_district","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/India_-_Telangana_-_Narayanpet.svg","page_title":"Narayanpet district","context_page_description":"Narayanpet district is a district in the Indian state of Telangana. Narayanapet is the district headquarters. The district shares boundaries with Mahbubnagar district, Vikarabad, Wanaparthy, Jogulamba Gadwal districts and with Karnataka state. This district formed on 17 February 2019 after bifurcation of Mahbubnagar district."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%96%AF%E5%A8%81%E7%89%B9_(%E6%84%9B%E9%81%94%E8%8D%B7%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Sweet_ID_-_fire_station.jpg","page_title":"斯威特 (愛達荷州)","context_page_description":"斯威特是位於美國愛達荷州傑姆郡的一個非建制地區。該地的面積和人口皆未知。"},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D9%88%D8%A8_%D8%B4%D8%AA%D8%A7%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Bob_Stein_.jpg","page_title":"بوب شتاين","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nبوب شتاين لاعب كورة القدم الامريكيه من امريكا."},{"page_url":"https://sk.wikipedia.org/wiki/5._december","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Monet_by_Greiner_Amsterdam_1871.jpg","page_title":"5. december","context_page_description":"5. december je 339. deň roka v gregoriánskom kalendári. Do konca roka zostáva 26 dní. Meniny má Oto.\\nMedzinárodný deň dobrovoľníkov"},{"page_url":"https://de.wikipedia.org/wiki/Jakob_der_L%C3%BCgner_(1974)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Bundesarchiv_Bild_183-P0417-0017%2C_Berlin%2C_Kinopremiere_%22Jakob_der_L%C3%BCgner%22%2C_Simon%2C_Brodsky%2C_Beyer%2C_Lamberz.jpg","page_title":"Jakob der Lügner (1974)","context_page_description":"Jakob der Lügner ist ein DEFA-Spielfilm der „Gruppe Johannisthal“ aus dem Jahr 1974 unter der Regie von Frank Beyer. Es handelt sich um eine Verfilmung von Jurek Beckers Roman Jakob der Lügner. Eine weitere Verfilmung stammt aus dem Jahr 1999."},{"page_url":"https://sv.wikipedia.org/wiki/Uhl%C3%AD%C5%99ov","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Uhl%C3%AD%C5%99ov%2C_domy.jpg","page_title":"Uhlířov","context_page_description":"Uhlířov är en ort i Tjeckien. Den ligger i den östra delen av landet, 250 km öster om huvudstaden Prag. Uhlířov ligger 300 meter över havet och antalet invånare är 360.\\nTerrängen runt Uhlířov är platt åt nordväst, men åt sydost är den kuperad. Den högsta punkten i närheten är 422 meter över havet, 2,1 km söder om Uhlířov. Runt Uhlířov är det ganska tätbefolkat, med 111 invånare per kvadratkilometer. Närmaste större samhälle är Opava, 6,4 km nordost om Uhlířov. Trakten runt Uhlířov består till största delen av jordbruksmark.\\nTrakten ingår i den hemiboreala klimatzonen. Årsmedeltemperaturen i trakten är 7 °C. Den varmaste månaden är juli, då medeltemperaturen är 19 °C, och den kallaste är januari, med -6 °C. Genomsnittlig årsnederbörd är 1 031 millimeter. Den regnigaste månaden är juni, med i genomsnitt 146 mm nederbörd, och den torraste är mars, med 50 mm nederbörd."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Burgen_und_Schl%C3%B6ssern_im_Vereinigten_K%C3%B6nigreich","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Brereton_-_Brereton_Hall.jpg","page_title":"Liste von Burgen und Schlössern im Vereinigten Königreich","context_page_description":"Diese Liste führt Burgen und Schlösser im Vereinigten Königreich Großbritannien und Nordirland auf."},{"page_url":"https://en.wikipedia.org/wiki/Bishop_of_Lincoln","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Arms_displayed_by_Hugh_de_Wells%2C_Bishop_of_Lincoln%2C_at_the_signing_of_Magna_Charta.png","page_title":"Bishop of Lincoln","context_page_description":"The Bishop of Lincoln is the ordinary of the Church of England Diocese of Lincoln in the Province of Canterbury.\\nThe present diocese covers the county of Lincolnshire and the unitary authority areas of North Lincolnshire and North East Lincolnshire. The bishop's seat is located in the Cathedral Church of the Blessed Virgin Mary in the city of Lincoln. The cathedral was originally a minster church founded around 653 and refounded as a cathedral in 1072. Until the 1530s the bishops were in full communion with the Roman Catholic Church.\\nThe historic medieval Bishop's Palace lies immediately to the south of the cathedral in Palace Yard; managed by English Heritage, it is open to visitors. A later residence on the same site was converted from office accommodation to reopen in 2009 as a 16-bedroom conference centre and wedding venue. It is now known as Edward King House and provides offices for the bishops, archdeacons and diocesan staff. A 14-bedroom house on Eastgate was the official residence in use from 1948 until 2011, when the bishop's office staff and home were separated, allowing the incoming bishop, Christopher Lowson, to live in a modern five-bedroom house."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%B3%D9%B9%D8%A7%D8%B1_%D9%81%D9%84%D8%A7%D8%A6%D8%B1","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cc/Star_Flyer_%281%29.JPG","page_title":"سٹار فلائر","context_page_description":"سٹار فلائر جاپان کی ہوائی کمپنی ہے ۔ سٹار فلائر کا مرکزی دفتر جاپان کے ائیر پورٹ ہانیدا ہوائی اڈا پر واقع ہے۔"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AA%D8%B1%DB%8C%D9%86%DB%8C%D8%AF%D8%A7%D8%AF_%D9%88_%D8%AA%D9%88%D8%A8%D8%A7%DA%AF%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Karibik_Trinidad_und_Tobago_Position.png","page_title":"ترینیداد و توباگو","context_page_description":"ترینیداد و توباگو با نام رسمی جمهوری ترینیداد و توباگو کشوری جزیره‌ای است در دریای کارائیب واقع در شمال آمریکای جنوبی است. پایتخت آن پورت آو اسپین است. ترینیداد و توباگو جنوبی‌ترین کشور جزیره‌ای در دریای کارائیب است و به خاطر ذخایر نفت و گاز خود معروف است.\\nجمعیت این کشور یک میلیون و ۳۶۴ هزار نفر، زبان رسمی آن انگلیسی و واحد پول آن دلار ترینیداد و توباگو است. این کشور جزو مستعمرات بریتانیا بود و در سال ۱۹۶۲ توانست استقلال خود را به دست آورد. ۵۵ درصد از مردم این کشور مسیحی، ۱۸ درصد هندو و ۵ درصد مسلمان هستند.\\nاین کشور از دو جزیره اصلی ترینیداد، و توباگو و جزایر بسیار کوچکتر دیگری تشکیل شده‌است. بزرگترین جزیره آن ترینیداد است. جزیره اصلی دیگر یعنی توباگو بسیار کوچکتر و کم‌جمعیت‌تر از ترینیداد می‌باشد. هر دوی این جزیره‌ها بخشی از جزایر بادگیر در آنتیل کوچک به‌شمار می‌آیند.\\nبر خلاف اکثر کشورها و سرزمین‌های کارائیب، که به گردشگری تکیه می‌کنند، تأکید اقتصاد ترینیداد و توباگو در درجه اول بر نفت و پتروشیمی است. بخش اعظم ثروت این کشور از ذخایر عظیم نفت و گاز طبیعی آن ناشی می‌شود."},{"page_url":"https://fr.wikipedia.org/wiki/Ligne_Meitetsu_Takehana","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/No.7_bridge_for_relief_open_4.JPG","page_title":"Ligne Meitetsu Takehana","context_page_description":"La ligne Meitetsu Takehana est une ligne ferroviaire de la compagnie privée Meitetsu située dans la préfecture de Gifu au Japon. Elle relie la gare de Kasamatsu à Kasamatsu à la gare d'Egira à Hashima."},{"page_url":"https://it.wikipedia.org/wiki/Lycodon_capucinus","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/Lyco_capuc_080129-4131_ipb.jpg","page_title":"Lycodon capucinus","context_page_description":"Lycodon capucinus F.Boie, 1827 è un serpente appartenente alla famiglia Colubridae, noto con il nome di serpente lupo comune."},{"page_url":"https://de.wikipedia.org/wiki/Talwar","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Indian_tulwar_-_talwar_sword.jpg","page_title":"Talwar","context_page_description":"Ein Talwar ist ein indischer Säbel."},{"page_url":"https://fr.wikipedia.org/wiki/Am%C3%A9n%C3%A9mop%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Mask_of_Amenemope_by_John_Campana.jpg","page_title":"Aménémopé","context_page_description":"Aménémopé est un pharaon de la XXIᵉ dynastie de Tanis."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D0%BB%D0%B0%D0%B2%D0%B5%D0%B7%D0%BE%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Claveisolles_-_Vue_du_bourg.jpg","page_title":"Клавезол","context_page_description":"Клавезол насеље је и општина у источној Француској у региону Рона-Алпи, у департману Рона која припада префектури Вилфранш сир Саон.\\nПо подацима из 2011. године у општини је живело 632 становника, а густина насељености је износила 22,31 становника/km². Општина се простире на површини од 28,33 km². Налази се на средњој надморској висини од 483 метара."},{"page_url":"https://it.wikipedia.org/wiki/Kemijoki","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Kemijoki_river_by_Muurola.jpg","page_title":"Kemijoki","context_page_description":"Il Kemijoki, con i suoi 550 km di lunghezza, è il fiume più lungo della Finlandia. Passando attraverso le città di Kemijärvi e Rovaniemi, sfocia nel Golfo di Botnia nei pressi di Kemi. Il bacino del Kemijoki interessa una grande parte della Finlandia settentrionale, e si estende fino ai confini con la Norvegia e la Russia. L'ampiezza del bacino è di 51.000 km². La portata del fiume alla foce è di circa 556 m³ al secondo.\\nGli affluenti del Kemijoki sono l'Ounasjoki, che si immette nel Kemijoki a Rovaniemi e il Kitinen, che si immette nel Kemijoki a Pelkosenniemi, il Vuotos e il Tenniöjoki.\\nGli affluenti del Kitinen sono il Luiro, il Sattanen ed il Jeesiöjoki. Nel corso superiore del Kitinen c'è il lago artificiale e la centrale idroelettrica di Porttipahta. Il Luiro inizia dal lago Luirojärvi nei pressi di Saariselkä e scorre attraverso il lago artificiale di Lokan verso il Kitinen. L'Ounasjoki, che si origina come emissario del lago Ounasjärvi nei pressi di Enontekiön è stato calmato nel 1983, e non vi sono state costruite centrali elettriche.\\nIl Tenniöjoki inizia in territorio russo e, passando attraverso Salla affluisce nel Kemijoki a Savukoski."},{"page_url":"https://hu.wikipedia.org/wiki/Kitee-i_Evang%C3%A9likus_N%C3%A9pf%C5%91iskola","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Kansanopisto_1.jpg","page_title":"Kitee-i Evangélikus Népfőiskola","context_page_description":"A kitee-i Evangélikus Népfőiskola Kelet-Finnországban található, Joensuutól megközelítőleg 60 kilométerre délre és Savonlinnától hozzávetőlegesen 80 kilométerre keletre.\\nAz iskola széleskörű oktatást kínál a felnőttek számára. Rendelkezésre állnak például finn nyelvtanfolyamok bevándorlók számára, alapszintű iskolai képzés és szakképzés felnőttek részére, mindemellett nyári táborok gyerekeknek és idősödő embereknek is.\\nMinden évben csaknem 200 diák vesz részt a hosszú tanfolyamokon és mintegy 2500 hallgató működik közre a rövid tanfolyamokon.\\nA rövid tanfolyamokat túlnyomórészt nyáron tartják meg, ennek értelmében iskolánk egész évben tevékenykedik. A rövid tanfolyamok tartalmai közé tartozik például a nemzetközi tudományos táborok, a nyelvtanfolyamok, a sport- és jóléti, továbbá a társadalmi tanulmányok.\\nA kitee-i Evangélikus Népfőiskolát a Finn Oktatási és Kulturális Minisztérium elismeri, valamint az iskola betartja a rendelkezéseket.\\nMint bentlakásos iskola, a népfőiskola támogatja a közösségérzetet és egy életképes választást óhajt kínálni, hogy hozzásegíthesse az egyéneket a lehetőségeik eleget tevéséhez."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%93%D0%B0%D1%80%D0%B0%D0%B4%D0%B7%D0%B5%D0%BD%D1%81%D0%BA%D1%96_%D0%BF%D0%B0%D0%B2%D0%B5%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Horadnia%2C_Pahonia._%D0%93%D0%BE%D1%80%D0%B0%D0%B4%D0%BD%D1%8F%2C_%D0%9F%D0%B0%D0%B3%D0%BE%D0%BD%D1%8F_%28XVII%29.jpg","page_title":"Гарадзенскі павет","context_page_description":"Гарадзе́нскі паве́т — адміністрацыйна-тэрытарыяльная адзінка ў складзе Троцкага ваяводзтва Вялікага Княства Літоўскага. Плошча 11,7 тыс. км². Сталіца — места Горадня."},{"page_url":"https://fr.wikipedia.org/wiki/Pozde%C5%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Pozde%C5%88%2C_kostel.JPG","page_title":"Pozdeň","context_page_description":"Pozdeň est une commune du district de Kladno, dans la région de Bohême-Centrale, en Tchéquie. Sa population s'élevait à 471 habitants en 2020."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E9%A6%99%E6%B8%AF%E9%83%B5%E6%94%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/HongkongPostVendingMachine.jpg","page_title":"香港郵政","context_page_description":"香港邮政成立于1841年，现在是香港特别行政区政府的邮政部门，原本隶属于经济发展及劳工局，于2007年7月1日决策局重组后，被划入新成立的商务及经济发展局。\\n邮政署于1995年开始转型为以“营运基金模式”运作，财政自主，以比较商业的手法经营邮政业务，邮政署的收入来自售卖特殊邮票、传统邮递、特快专递及缴费服务等。邮政署亦为香港人提供办理电子证书服务。"},{"page_url":"https://pt.wikipedia.org/wiki/Companhia_de_Saneamento_B%C3%A1sico_do_Estado_de_S%C3%A3o_Paulo","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/SABESP_Avar%C3%A9_REFON.jpg","page_title":"Companhia de Saneamento Básico do Estado de São Paulo","context_page_description":"A Companhia de Saneamento Básico do Estado de São Paulo - Sabesp é uma empresa brasileira que detém a concessão dos serviços públicos de saneamento básico no Estado de São Paulo. Seu principal acionista é o governo do Estado de São Paulo, que controla a gestão da companhia.\\nNa edição 2004/2005 da Masons Water Yearbook a Sabesp foi considerada a sexta maior operadora de serviços de água e esgoto do mundo. A edição 2008/2009 destacou a atuação da empresa para que seus serviços sejam oferecidos a toda população do Estado de São Paulo até o ano de 2018 e também garantir a sustentabilidade econômica e financeira da empresa.\\nA atuação da Sabesp na Crise hídrica de 2014 em São Paulo tem sido muito criticada. Um artigo baseado em dados fornecidos pela própria Sabesp demonstra a responsabilidade da gestão da empresa na crise, que empurrou o Sistema Cantareira em mudança catastrófica."},{"page_url":"https://es.wikipedia.org/wiki/7,92_%C3%97_57_mm","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/8x57.jpg","page_title":"7,92 × 57 mm","context_page_description":"7,92x57 mm es un cartucho de fusil diseñado por la Gewehr-Prüfungskommission alemana para el fusil Gewehr 88 y luego utilizado en los fusiles de cerrojo Mauser, como el Gewehr 98 y el K98k. Este cartucho fue originalmente adoptado por Alemania en 1888 bajo la designación M/88 7.92x57mm I. Alemania adoptó una nueva versión del cartucho M/88 en 1905 que se denominó 7,92x57 mm IS. El cartucho de 1905 fue el estándar de la infantería alemana en ambas Guerras Mundiales y hoy se conoce en Europa como 7,92x57mm IS o 8x57mm IS y en Estados Unidos como 8x57mm JS o 8 mm Mauser."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B0%D1%80%D0%B0_%D0%91%D0%B5%D1%80%D0%BD%D0%B0%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Damala.jpg","page_title":"Сара Бернар","context_page_description":"Са́ра Берна́р — французька акторка, вважається еталоном акторської майстерності, її часто називають Божественною Сарою. Займалася також скульптурою та літературною творчістю, авторка кількох п'єс і мемуарів. Бернар стала першою видатною театральною акторкою, що звернулася до кінематографу."},{"page_url":"https://sv.wikipedia.org/wiki/Tingst%C3%A4de_kyrka","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Tingst%C3%A4de_church%2C_2009-08-11.jpg","page_title":"Tingstäde kyrka","context_page_description":"Tingstäde kyrka är en kyrkobyggnad i Tingstäde på Gotland. Kyrkan, som tidigare tillhörde Tingstäde församling, är en av de största medeltida landsbygdskyrkorna på ön. Den syns vida omkring, och det 55 meter höga tornet har fungerat som sjömärke, trots att kyrkan ligger tio kilometer från närmaste kust.\\nKyrkans äldsta delar dateras till cirka 1200 med hjälp av de av mästaren Calcarius I utförda skulpturerna."},{"page_url":"https://de.wikipedia.org/wiki/Mie-gun","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Mie_Mie-gun_1889.png","page_title":"Mie-gun","context_page_description":"Mie ist der namensgebende Landkreis der japanischen Präfektur Mie. Er liegt im Norden der Präfektur zwischen dem Suzuka-Gebirge und der Ise-Bucht. Seit 2005 besteht der Kreis Mie noch aus drei Gemeinden: den Städten Komono im Westen am Fuß der Berge und Asahi und Kawagoe im Osten an der Bucht."},{"page_url":"https://ca.wikipedia.org/wiki/La_Clapa","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Massif_de_la_Clape03.JPG","page_title":"La Clapa","context_page_description":"La Clapa és un massís que dóna nom a una comarca natural de la regió històrica del Narbonès, al departament de l'Aude, a l'actual regió d'Occitània.\\nL'home va aparèixer a la Clapa fa uns cent mil anys, en el període de l'home de Neandertal. Durant l'època romana, el riu Aude, llavors anomenat Àtax, desembocava en un golf on hi havia algunes illes, i una era la de la Clapa, que els romans anomenaven Insula Laci, nom que es va conservar a l'edat mitjana, quan es va ajuntar amb la costa i hi va aparèixer el conreu de la vinya. Més tard es va anomenar en occità la Clapa, amb un significat semblant al del mot català homònim, en el sentit d'un muntet de pedres destacat de la resta. Toulouse-Lautrec va pintar a la comarca al castell de Celeiran, que era de sa mare. Als darrers anys, la Clapa s'ha especialitzat en la producció de vins amb denominació d'origen\\nMunicipis de la comarca:\\nArmissan\\nFluris; antigament, Perinhan\\nSalas d'Aude\\nVinaçan\\nEstrictament, els termes veïns de Corçan, la Platja de Narbona, la Platja de Gruissan i Sant Pèire de la Mar no formen part de la comarca."},{"page_url":"https://cs.wikipedia.org/wiki/U_zabit%C3%A9ho_ml%C3%A1dence","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/U_zabit%C3%A9ho_ml%C3%A1dence.jpg","page_title":"U zabitého mládence","context_page_description":"U zabitého mládence je jeden z nejstarších pomníčků na území Jizerských hor. Nachází se při železniční trati mezi Oldřichovem v Hájích a Raspenavou, v katastrálním území Raspenava. Připomíná vraždu patnáctiletého kovářského učně Antonína Neumanna, který byl v jeho blízkosti 18. července 1825 ubit a oloupen nikdy nevypátraným pachatelem.\\nAntonín Neumann se narodil v hejnické kovárně Gottfrieda Mäussela 16. listopadu 1809. Tuto živnost měl po svém dědečkovi později také převzít, proto k němu roku 1824 nastoupil do učení. Když však jeho dědeček zemřel, musel přejít do jiné kovářské dílny – a nejbližší tehdy byla až v Liberci, na Šibeničním vrchu. Své rodiče v Hejnicích navštěvoval pouze přes soboty a neděle. V den své smrti šel pěšky přes Mníšek a Oldřichov v Hájích, kde v sedle Hemmrichu se vydal Starou poutní cestou ke svému cíli. Při této cestě, v jámě pod malinovým keřem, jeho tělo s rozbitou hlavou a smyčkou kolem krku našly druhý den raspenavské děti. Chlapec byl pohřben 21. července 1825 na starém hejnickém hřbitově.\\nPozději se na místě jeho skonu objevil kamenný pomník s obrázkem a křížem."},{"page_url":"https://bs.wikipedia.org/wiki/Svjetsko_prvenstvo_u_ko%C5%A1arci_1978.","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Araneta_Coliseum_1960s.jpg","page_title":"Svjetsko prvenstvo u košarci 1978.","context_page_description":"Svjetsko prvenstvo u košarci 1978 je međunarodno košarkaško takmičenje održano u Filipinima od 1. do 14. oktobra 1978. Rizal Memorial Coliseum u Manili i Araneta Coliseum u Quezon City, su bile dvorane prvenstva."},{"page_url":"https://sr.wikipedia.org/wiki/Spisak_galaksija","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/NGC_0023_2MASS.jpg","page_title":"Spisak galaksija","context_page_description":"Mesjejev katalog, SEDS\\nBenetov katalog, SEDS\\nZunajgalaktična podatkovna baza NASA/IPAC\\nCDS baza astronomskih podatkov"},{"page_url":"https://fa.wikipedia.org/wiki/%D9%86%D9%82%D8%B4_%D8%B1%D8%B3%D8%AA%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Naghsh-e_rostam%2C_Ir%C3%A1n%2C_2016-09-24%2C_DD_14.jpg","page_title":"نقش رستم","context_page_description":"نقش رستم نام مجموعه‌ای باستانی در روستای زنگی‌آباد واقع در شمال شهرستان مرودشت استان فارس ایران است که در فاصلهٔ ۶ کیلومتری از تخت جمشید قرار دارد. این محوطهٔ باستانی یادمان‌هایی از ایلامیان، هخامنشیان و ساسانیان را در خود جای داده است و از حدود سال ۱۲۰۰ پیش از میلاد تا ۶۲۵ میلادی همواره مورد توجه بوده است زیرا آرامگاه چهار تن از شاهنشاهان هخامنشی، نقش برجسته‌های متعددی از وقایع مهم دوران ساسانیان، بنای کعبه زرتشت و نقش‌برجستهٔ ویران شده‌ای از دوران ایلامیان در این مکان قرار دارند و در دورهٔ ساسانی، محوطهٔ نقش رستم از نظر دینی و ملی نیز اهمیت بسیار داشته است.\\nدر گذشته، نام این مکان سه‌گنبدان یا دوگنبدان بوده است که در بین مردم منطقه، به نام‌های کوه حاجی‌آباد،کوه استخر یا کوه نِفِشت نیز خوانده می‌شد و احتمالاً نام نقش رستم پس از آنکه ایرانیان بین رستم، پهلوان شاهنامه و سنگ نگاره‌های شاهان ساسانی ارتباط برقرار کردند به این مکان داده شد.\\nقدیمی‌ترین نقش موجود در نقش رستم مربوط به دورهٔ ایلام است که نقش دو ایزد و ایزدبانو و شاه و ملکه را به تصویر کشیده بود ولی بعدها در دورهٔ ساسانی، بهرام دوم بخش‌هایی از آن را پاک کرد و نقش خود و درباریانش را به جای آن تراشید."},{"page_url":"https://nl.wikipedia.org/wiki/Station_Sneek_Noord","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/80/Sneek_noord_2011.JPG","page_title":"Station Sneek Noord","context_page_description":"Station Sneek Noord is een van de twee stations in de Friese stad Sneek en werd op 3 juni 1973 in gebruik genomen.\\nSneek Noord is gelegen aan de spoorlijn van Leeuwarden naar Stavoren en wordt bediend door Arriva. Het station kent geen stationsgebouw maar wel twee glazen wachtruimtes, van het zogenaamde type abri.\\nHet station werd in 2010 uitgebreid met een tweede spoor en perron om een extra kruisingsmogelijkheid te creëren. Daardoor kon de frequentie tussen Leeuwarden en Sneek worden verhoogd van twee naar drie treinen per uur. Deze uitbreiding kwam eind 2010 gereed."},{"page_url":"https://eu.wikipedia.org/wiki/Labrazako_harresiak","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Labraza_-_Portal_principal_de_la_muralla_4.JPG","page_title":"Labrazako harresiak","context_page_description":"Labrazako harresia eta gaztelua Oion udalerriko hiribildu harresiduna da. Oiondik gertu dago eta Nafarroarekin egiten du muga. Defentsarako erakin multzoa da, mendixka baten gainean eraikia; ekialdean defentsa-dorreak ditu, iparraldean eliza eta dorre bat, eta hego-ekialdean harresia. Harresian jendea bizi da egun, eta horregatik jaso zuen 2008an Harresidun Hirien Zirkuluaren munduko saria. 1984tik Arabako kultura ondasunaren izendapena du."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%91%9E%E5%A3%AB%E5%9F%8E%E5%A0%A1%E5%88%97%E8%A1%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0e/Zwingen-Wohngeb%C3%A4ude-Verwaltung.jpg","page_title":"瑞士城堡列表","context_page_description":"本表列舉瑞士聯邦各州現存的各類城堡建築。"},{"page_url":"https://en.wikipedia.org/wiki/Aubervilliers","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/INCONNU_-_AUBER_-_Rue_Pasteur_-_Soci%C3%A9t%C3%A9_coop%C3%A9rative_Le_Progr%C3%A8s.jpg","page_title":"Aubervilliers","context_page_description":"Aubervilliers is a commune in the Seine-Saint-Denis department in the Île-de-France region in the north-eastern suburbs of Paris, France. The inhabitants of the commune are known as Albertivillariens or Albertivillariennes."},{"page_url":"https://de.wikipedia.org/wiki/Volksgarten_(Wien)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Wien_01_Volksgarten_Einfriedung_c.jpg","page_title":"Volksgarten (Wien)","context_page_description":"Der Volksgarten ist eine öffentliche Parkanlage an der Ringstraße im 1. Wiener Gemeindebezirk Innere Stadt."},{"page_url":"https://ceb.wikipedia.org/wiki/Libocedrus_bidwillii","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/LibocedrusBidwillii.jpg","page_title":"Libocedrus bidwillii","context_page_description":"Espesye sa tanom nga pino ang Libocedrus bidwillii. Una ning gihulagway ni Joseph Dalton Hooker. Ang Libocedrus bidwillii sakop sa kahenera nga Libocedrus sa kabanay nga Cupressaceae. Giklaseklase sa IUCN ang espesye sa kinaminosang kalabotan. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://zh.wikipedia.org/zh-my/%E4%BF%9D%E6%9F%A5%C2%B7%E8%B7%AF%E6%AF%94%E9%98%BF%E5%BA%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Borja_Rubiato.JPG","page_title":"保查·路比阿度","context_page_description":"保查·路比阿度·马天尼斯，生于西班牙马德里，西班牙足球运动员，司职前锋，现时效力西班牙足球乙二级联赛球会门萨杰罗。"},{"page_url":"https://fr.wikipedia.org/wiki/Michele_Fanoli","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Michel_Fanoli_-_Politics_in_an_Oyster_House_Dedicated_To_HB_Latrobe_Esq_-_Walters_93145.jpg","page_title":"Michele Fanoli","context_page_description":"Michele Fanoli, né le 9 juillet 1807 à Cittadella et mort le 19 septembre 1876 à Milan, est un peintre, lithographe et graveur et italien, principalement de sujets religieux et de portraits dans un style Néoclassique."},{"page_url":"https://de.wikipedia.org/wiki/Aoraki/Mount_Cook","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Mt_Cook_LC0247.jpg","page_title":"Aoraki/Mount Cook","context_page_description":"Der Aoraki/Mount Cook, häufig nur Mount Cook, ist Teil der Neuseeländischen Alpen und der höchste Berg Neuseelands."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%93%D1%80%D0%B5%D1%98%D0%B5%D0%B2_%D0%BA%D0%BE%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Encoder_Disc_%283-Bit%29.svg","page_title":"Грејев код","context_page_description":"Рефлектовани бинарни код, такође познат као Грејев код након Франк Греја, је систем бинарних цифара у којем се две узастопне вредности разликују у само једном биту. Рефлектовани бинарни код је првобитно пројектован да спречи лажни излаз из електромеханичких прекидача. Данас, Грејеви кодови се широко користе да олакшају исправљање грешака у дигиталним комуникацијама, као што су дигиталне земаљске телевизије и неки кабловски системи."},{"page_url":"https://hu.wikipedia.org/wiki/Primetime_Emmy-d%C3%ADj_a_legjobb_n%C5%91i_mell%C3%A9kszerepl%C5%91nek_(v%C3%ADgj%C3%A1t%C3%A9ksorozat)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Kristin_Chenoweth_by_Gage_Skidmore_2.jpg","page_title":"Primetime Emmy-díj a legjobb női mellékszereplőnek (vígjátéksorozat)","context_page_description":"A Primetime Emmy-díj a legjobb női mellékszereplőnek (vígjátéksorozat) elismerést az Emmy-díjátadó gálán adják át, 1954 óta.\\nKezdetben a mellékszereplő kategóriát még nem bontották szét műfaj, illetve nemek szerint sem. A 22. díjátadótól versenyeznek a női mellékszereplők külön kategóriában. A díjazottak között azonban sokáig együttesen értékelték a minisorozatok és tévéfilmek szereplőit, továbbá a vendégszereplőket is.\\nA legtöbb győzelmet Rhea Perlman és Doris Roberts szerezte. A legtöbb, tíz-tíz jelölést Perlman és Loretta Swit kapta. a Saturday Night Live női mellékszereplőit összesen tizenöt alkalommal jelölték a kategóriában, ebből két alkalommal bizonyultak a legjobbnak."},{"page_url":"https://en.wikipedia.org/wiki/Bal%C8%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Bals_jud_Olt.png","page_title":"Balș","context_page_description":"Balș is a town in Olt County, Oltenia, Romania. The town administers three villages: Corbeni, Româna and Teiș."},{"page_url":"https://it.wikipedia.org/wiki/Vicer%C3%A9_di_Napoli","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Retrato_de_Francisco_Remolines.jpg","page_title":"Viceré di Napoli","context_page_description":"Nei primi anni del XVI secolo, a causa delle guerre d'Italia, il Regno di Napoli, a partire dal tentativo della discesa di Carlo VIII re di Francia, perse la sua indipendenza e fu sottoposto, fino al 1734, a diverse potenze straniere che ne affidavano il governo ad un viceré."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%A8%81%C2%B7%E9%82%A6%E5%BE%B7%E7%8E%AF%E5%BD%A2%E5%B1%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Normal_W_Bond_LO_iv_116_h2.jpg","page_title":"威·邦德环形山","context_page_description":"威·邦德環形山是月球正面位於冷海北部一座巨大的古老撞擊坑，約形成於45.5-39.2億年前的前酒海紀，其名稱取自美國天文學家威廉·克蘭奇·邦德，1935年被國際天文學聯合會批准接受。"},{"page_url":"https://pt.wikipedia.org/wiki/Joaquim_Filipe_Nery_da_Encarna%C3%A7%C3%A3o_Delgado","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Nery-Delgado.jpg","page_title":"Joaquim Filipe Nery da Encarnação Delgado","context_page_description":"Joaquim Filipe Nery da Encarnação Delgado, conhecido como General Nery Delgado, filho do tenente-coronel José Miguel Delgado, foi um general de engenharia do Exército Português e um dos pioneiros da geologia em Portugal."},{"page_url":"https://it.wikipedia.org/wiki/Fontana_di_piazza_della_Rotonda","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Fontana_di_piazza_della_Rotonda_-_particolare1.JPG","page_title":"Fontana di piazza della Rotonda","context_page_description":"La fontana di piazza della Rotonda si trova al centro dell'omonima piazza di Roma, di fronte al Pantheon."},{"page_url":"https://en.wikipedia.org/wiki/Trapezoid_line","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Gray201.png","page_title":"Trapezoid line","context_page_description":"From the conoid tubercle an oblique ridge, the trapezoid line, runs forward and lateralward, and affords attachment to the trapezoid ligament on inferior surface of clavicle"},{"page_url":"https://fr.wikipedia.org/wiki/Soignies","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Intra_muros_Plan_Popp_-_Soignies_-_1865_%28light%29.svg","page_title":"Soignies","context_page_description":"Soignies est une ville francophone de Belgique, située en Région wallonne, chef-lieu d'arrondissement en province de Hainaut. La ville de Soignies est une cité millénaire fondée au VIIᵉ siècle par Vincent Madelgaire. L'entité de Soignies est composée depuis la fusion des communes en 1977 des villages d'Horrues, de Naast, de Thieusies, de Casteau, de Neufvilles et de Chaussée-Notre-Dame-Louvignies. Soignies est considérée comme le centre européen de la pierre de taille."},{"page_url":"https://ca.wikipedia.org/wiki/Petorrera_de_riu","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Western_shore_of_Lough_Carrowmore%2C_County_Mayo_-_geograph.org.uk_-_66091.jpg","page_title":"Petorrera de riu","context_page_description":"La petorrera de riu, Erica erigena, és una espècie de bruc que viu en els penya-segats i brugueres d'Irlanda, sud-oest de França, la península Ibèrica i Tànger."},{"page_url":"https://sk.wikipedia.org/wiki/Bonz%C3%A9e","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d3/Map_commune_FR_insee_code_55060.png","page_title":"Bonzée","context_page_description":"Bonzée je francúzska obec, ktorá sa nachádza v departemente Meuse, v regióne Lotrinsko."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%8A%A0%E8%92%82%E5%A5%88%E5%9C%B0%E5%8C%BA%E8%BF%88%E6%9D%BE%E5%A1%9E%E5%8B%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Map_commune_FR_insee_code_77271.png","page_title":"加蒂奈地区迈松塞勒","context_page_description":"加蒂奈地區邁松塞勒是法國法蘭西島大區塞納-馬恩省的一個市鎮。"},{"page_url":"https://vi.wikipedia.org/wiki/Ferula","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Alcal%C3%A1_de_Henares_-_Madrid_-_050.jpg","page_title":"Ferula","context_page_description":"Ferula là chi thực vật có hoa trong họ Apiaceae."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D0%B5%D1%80%D0%B1_%D0%A1%D0%BB%D1%83%D1%86%D1%8C%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/S%C5%82ucak%2C_Pahonia._%D0%A1%D0%BB%D1%83%D1%86%D0%B0%D0%BA%2C_%D0%9F%D0%B0%D0%B3%D0%BE%D0%BD%D1%8F_%281840-49%29_%282%29.jpg","page_title":"Герб Слуцька","context_page_description":"Герб Слуцька - геральдичний символ Слуцька, наданий місту королем польським і великим князем литовським Яном Казимиром 27 серпня 1652: \\"в блакитному полі срібний кінь з крилами; на червоній попоні під князівською короною монограма R[adivil] D[ux]\\"."},{"page_url":"https://en.wikipedia.org/wiki/Cinema_1:_The_Movement_Image","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Rear_Window_film_poster.png","page_title":"Cinema 1: The Movement Image","context_page_description":"Cinema 1: The Movement Image is the first of two books on cinema by the philosopher Gilles Deleuze, the second being Cinema 2: The Time Image. Together Cinema 1 and Cinema 2 have become known as the Cinema books, the two volumes both complementary and interdependent. In these books the author combines philosophy and cinema, explaining in the preface to the French edition of Cinema 1 that \\"[t]his study is not a history of cinema. It is a taxonomy, an attempt at the classifications of images and signs\\"; and that the \\"first volume has to content itself with […] only one part of the classification\\". To make this division between the movement-image and the time-image Deleuze draws upon the work of the French philosopher Henri Bergson’s theory of matter and mind.\\nIn Cinema 1, Deleuze specifies his classification of the movement-image through both Bergson’s theory of matter and the philosophy of the American pragmatist C. S. Peirce. The cinema covered in the book ranges from the silent era to the late 1970s, and includes the work of D. W. Griffith, G. W."},{"page_url":"https://ro.wikipedia.org/wiki/Weil_am_Rhein","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Rathaus_Weil_am_Rhein.JPG","page_title":"Weil am Rhein","context_page_description":"Weil am Rhein este un oraș din landul Baden-Württemberg, Germania."},{"page_url":"https://ms.wikipedia.org/wiki/%C3%96tisheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Wappen_Oetisheim.png","page_title":"Ötisheim","context_page_description":"Ötisheim merupakan sebuah kota terletak di munisipaliti Enzkreis, Baden-Württemberg, Jerman."},{"page_url":"https://fr.wikipedia.org/wiki/Henri_Menier","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/HenriMenier.JPG","page_title":"Henri Menier","context_page_description":"Henri Émile Anatole Menier, né le 14 juillet 1853 à Paris et mort le 6 septembre 1913 à Vauréal, était un industriel et aventurier français, membre de la famille de chocolatiers Menier.\\nIl est le fils d'Émile-Justin Menier et le petit-fils d'Antoine Brutus Menier, fondateur de la chocolaterie Menier."},{"page_url":"https://pt.wikipedia.org/wiki/Estado_Livre_do_Congo","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Monument_au_G%C3%A9n%C3%A9ral_Thys_03.JPG","page_title":"Estado Livre do Congo","context_page_description":"O Estado Livre do Congo foi um reino privado, propriedade pessoal de Leopoldo II da Bélgica entre 1877 e 1908. Ocupava a maior parte da área da bacia do rio Congo, incluindo o território da atual República Democrática do Congo. Sua economia se baseava na intensa exploração do trabalho africano, nas condições mais degradantes, para extração de borracha e marfim.\\nEm 1908, depois da brutalidade deste tipo de colonização ter por fim sido exposta na imprensa ocidental, esta propriedade privada passou a ser uma colónia da Bélgica - o Congo Belga.\\nAs estimativas do total de mortos no Congo pelos homens de Leopoldo II varia de 1 milhão a 15 milhões, devido a fome, doenças, privações e assassinatos em massa. Milhares de outras pessoas foram mutiladas."},{"page_url":"https://es.wikipedia.org/wiki/Iglesia_de_San_Juan_Bautista_(Ja%C3%A9n)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Jaen-torreconcejo01m.jpg","page_title":"Iglesia de San Juan Bautista (Jaén)","context_page_description":"La iglesia de San San Juan Bautista, es sede de la Parroquia de San Juan y San Pedro, situada en la ciudad española de Jaén, es uno de los templos más antiguos de la misma, los investigadores lo vienen datando en la segunda mitad del siglo XIV.\\nEn este templo es sede canónica de la Real e Insigne Congregación del Santo Sepulcro y de Siervos de la Orden Tercera de Nuestra Señora de los Dolores, que realiza su estación de penitencia en el Viernes santo de la Semana Santa de Jaén, y de la Primitiva, Muy Ilustre y Real Cofradía de Nuestra Señora del Carmen, así como, de los grupos parroquiales de la Santísima Trinidad y la Obra Pía de Nuestra Señora del Tránsito."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%86%D1%88%D0%BA%D1%96_%D0%BE%D1%80%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Vladimir_Putin_in_Saint_Petersburg-58.jpg","page_title":"Ішкі орта","context_page_description":"Ішкі орта – түрлі тауарлар алмасу операцияларының жиынтығы. Ішкі ортаға баспа-бас айырбас, өтемақылық келісімдер, бай-бек, екі жақты клиринг жатады. Халықаралық тауар айналымының ширегі ыңғайласпа сауданың үлесіне тиеді. Көптеген дамушы елдер өз импортының шарты ретінде өз тауарларын сатып алуды талап етеді."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A8%D0%B0%D1%84%D1%80%D0%B0%D0%BD_%D0%B0%D0%BD%D0%BA%D0%B0%D1%80%D1%81%D1%8C%D0%BA%D0%B8%D0%B9","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c2/Crocus_chrysanthus_-_dorothy.jpg","page_title":"Шафран анкарський","context_page_description":"Крокус або шафран анкарський — відноситься до багаторічніх бульбоцибулевих трав'янистих рослин, сім'ї Півникові. Їхній рід нараховує близько 80-ти підвидів. Золотистий шафран анкарський відноситься до весняноквітучого виду."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Bourbon_County,_Kentucky","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Cane_Ridge_Meeting_House%2C_Little_Rock_Road%2C_Paris_vicinity_%28Bourbon_County%2C_Kentucky%29.jpg","page_title":"National Register of Historic Places listings in Bourbon County, Kentucky","context_page_description":"This is a list of the National Register of Historic Places listings in Bourbon County, Kentucky.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Bourbon County, Kentucky, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in a map.\\nThere are 61 properties and districts listed on the National Register in the county.\\nThis National Park Service list is complete through NPS recent listings posted July 2, 2020."},{"page_url":"https://pl.wikipedia.org/wiki/Kopalnia_torfu_Karaska","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Kopalnia_torfu_Karaska_%2812%29.jpg","page_title":"Kopalnia torfu Karaska","context_page_description":"Kopalnia torfu Karaska - obecnie Zakład Torfowy \\"Karaska\\" – odkrywkowa kopalnia torfu wysokiego działająca od połowy lat 50. XX w. znajdująca się na terenie Torfowiska Karaska w gminie Kadzidło, powiecie ostrołęckim, województwie mazowieckim. Od północno wschodniej strony graniczy z nią Rezerwat przyrody Torfowisko Karaska. Kopalnia zajmuje powierzchnię ponad 300 ha Jest największą kopalnią torfu w Polsce. Torf jest wydobywany metodą frezowania.\\nZasoby tofu kopalni Karaska:\\nKaraska I - 1 661 600 m³\\nKaraska II - 5 001 010 m³\\nWydobycie w 2012 r. wyniosło 158 000 m³\\nKopalnia posiada wąskotorową linie kolejową służącą do przewozu torfu z terenu urobiska do zakładu przetwórczego. Wagony z urobkiem ciągnięte są przez lokomotywę spalinową typu LS-600."},{"page_url":"https://ru.wikipedia.org/wiki/Spatz","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Victoria-Spatz.jpg","page_title":"Spatz","context_page_description":"Spatz, Victoria 250 — микролитражный автомобиль с кузовом из стеклопластика, выпускавшийся с июля 1956 по конец того же года предприятием Bayerische Autowerke GmbH в Траунройте, ФРГ, а также заводом Victoria Werke в Нюрнберге с конца 1956 по май 1958 года.\\nПрототип этого автомобиля — Dreirad-Dreisitzer или Brütsch Typ 200 Spatz — был разработан и изготовлен независимым инженером Эгоном Брютшем, владельцем фирмы Egon Brütsch Fahrzeugbau из Штутгарта, за свою жизнь создавшим множество конструкций микроавтомобилей и мотоколясок-«кабиненроллеров». Он был трёхколёсным, с двумя колёсами на передней оси, имевшими мягкую подвеску, и одним задним, через подрамник жёстко закреплённым на стеклопластиковом кузове-монококе вместе с силовым агрегатом.\\nБрютш начал искать крупное предприятие, готовое наладить выпуск его конструкции, и в конечном итоге сумел продать лицензию Харальду Фридриху, промышленнику из Верхней Баварии и совладельцу машиностроительной фирмы Alzmetall P. Meier & Friedrich GmbH, а также — швейцарской фирме A. Grünhut & Co."},{"page_url":"https://sh.wikipedia.org/wiki/William-Adolphe_Bouguereau","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/William-Adolphe_Bouguereau_%281825-1905%29_-_A_Portrait_of_Amelina_Dufaud_Bouguereau_%281850%29.jpg","page_title":"William-Adolphe Bouguereau","context_page_description":"William-Adolphe Bouguereau je bio francuski slikar. U svoje je vrijeme bio slavan, ali danas su njegove slike zasjenjene djelima impresionista."},{"page_url":"https://es.wikipedia.org/wiki/M%C3%A9lanie_Calvat","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Boms_Pfarrkirche_Mariengruppe.jpg","page_title":"Mélanie Calvat","context_page_description":"Melanie Calvat fue una joven pastorcita que relató haber sido testigo, junto con el joven Maximin Giraud, de la aparición de la Santísima Virgen de La Salette en Isère el 19 de septiembre de 1846."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D8%B1%D8%A9_%D8%A7%D9%84%D9%82%D8%AF%D9%85_%D9%81%D9%8A_%D8%A5%D9%86%D8%AC%D9%84%D8%AA%D8%B1%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Meeting_of_the_Sheffield_Football_Association_%28Sheffield_Independent%29_1877_04_24.png","page_title":"كرة القدم في إنجلترا","context_page_description":"كرة القدم في إنجلترا تعتبر كرة القدم الرياضة الأكثر شعبية في إنجلترا، حيث تم إنشاء أول مجموعة من القواعد للعبة في عام 1863، والتي كانت لها تأثير كبير على تطوير قوانين اللعبة الحديثة. يوجد الآن في إنجلترا أكثر من 40000 نادي لكرة القدم، تمتلك إنجلترا عددًا كبير من الأندية المشاركة في الاسم أكثر من أي دولة أخرى بالإضافة إلى أول نادي تم إنشائه في العالم هو، بالإضافة إلي أقدم نادي كرة قدم محترف في العالم نادي، أقدم هيئة وطنية لكرة القدم، وتم إنشاء أقدم منتحب لكرة القدم وهو منتخب إنجلترا لكرة القدم، ويوجد في إنجلترا أقدم مسابقة كأس بنظام خروج المغلوب وأقدم دوري وطني لكرة القدم. يعتبر الدوري الإنجليزي الممتاز أحد أشهر الدوريات الرياضية الأكثر ثراءً في العالم، يوجد في الدوري الإنجليزي الممتاز ستة من أغنى عشرة أندية كرة قدم في العالم اعتبارًا من عام 2019.\\nيعتبر منتخب إنجلترا لكرة القدم هو واحد من ثمانية منتخبات أستطاعت فقط الفوز بكأس العالم، بعد أن فعل ذلك مرة واحدة في عام 1966. وحصلت خمسة فرق إنجليزية بالفوز بدوري أبطال أوروبا."},{"page_url":"https://ca.wikipedia.org/wiki/Marieta_de_14_punts","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Propylea_quatuordecimpunctata_%282128083528%29.jpg","page_title":"Marieta de 14 punts","context_page_description":"La marieta de catorze punts és un coleòpter present als camps de cítrics."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D0%BB%D0%B0%D1%88%D0%BE%D0%B2,_%D0%90%D0%B1%D1%80%D0%B0%D0%BC_%D0%90%D0%B1%D1%80%D0%B0%D0%BC%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Repin_groznuy_vandalizm.gif","page_title":"Балашов, Абрам Абрамович","context_page_description":"Абра́м Абра́мович Балашо́в — человек, прославившийся актом вандализма, совершённым им 29 января 1913 года в Третьяковской галерее в Москве в отношении картины Репина «Иван Грозный и сын его Иван 16 ноября 1581 года»."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%BE%D0%BA%D0%BC%D0%B0%D0%BA_(%D0%BA%D0%B0%D1%82%D0%B5%D1%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/%D0%A0%D0%B5%D0%B9%D0%B4%D0%BE%D0%B2%D0%B8%D0%B9_%D0%B2%D0%BE%D0%B4%D0%BE%D0%BB%D0%B0%D0%B7%D0%BD%D0%B8%D0%B9_%D0%BA%D0%B0%D1%82%D0%B5%D1%80_%C2%AB%D0%A2%D0%BE%D0%BA%D0%BC%D0%B0%D0%BA%C2%BB.jpg","page_title":"Токмак (катер)","context_page_description":"Токмак — рейдовий водолазний катер проекту 1415 Військово-морських сил України. Має бортовий номер U-733."},{"page_url":"https://en.wikipedia.org/wiki/Frankenberg,_Hesse","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/St._Georgenberg_2.jpg","page_title":"Frankenberg, Hesse","context_page_description":"Frankenberg an der Eder is a town in Waldeck-Frankenberg district, Hesse, Germany.\\nThe mountain at a ford over the Eder north of the Burgwald range was for a long time a fortified place, playing an especially important rôle under the Franks in the Saxon Wars. The town was built in 1233-1234 by the Thuringian Landgrave at the junction of two trade routes. The renovated Old and New Town have many half-timbered houses."},{"page_url":"https://es.wikipedia.org/wiki/Lee_Beom-seok_(Primer_ministro)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/%EC%9D%B4%EB%B2%94%EC%84%9D.JPG","page_title":"Lee Beom-seok (Primer ministro)","context_page_description":"Lee Beom-seok fue un activista por la independencia de Corea y el primer Primer Ministro de Corea del Sur desde 1948 hasta 1950.​ Su apodo fue Cheolgi."},{"page_url":"https://pl.wikipedia.org/wiki/No_Direction_Home","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Bob_Dylan_June_23_1978.jpg","page_title":"No Direction Home","context_page_description":"No Direction Home - film dokumentalny w reżyserii Martina Scorsese o karierze amerykańskiego piosenkarza i autora tekstów Boba Dylana."},{"page_url":"https://it.wikipedia.org/wiki/Monumento_agli_Eroi_dell%27Armata_Rossa_(Vienna)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Hochstrahlbrunnen_Blau_20120824.jpg","page_title":"Monumento agli Eroi dell'Armata Rossa (Vienna)","context_page_description":"Il Memoriale di guerra sovietico di Vienna, più formalmente conosciuto come Heldendenkmal der Roten Armee si trova a Schwarzenbergplatz. Il colonnato semicircolare in marmo bianco che racchiude parzialmente una figura di dodici metri di un soldato dell'Armata Rossa è stato inaugurato nel 1945. Il monumento degli eroi dell'Armata Rossa a Vienna fu costruito per commemorare i 17.000 soldati sovietici uccisi in azione durante l'offensiva di Vienna durante la seconda guerra mondiale."},{"page_url":"https://de.wikipedia.org/wiki/Schenkeldecke_(Insekt)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/83/Lacon_punctatus_detail.jpg","page_title":"Schenkeldecke (Insekt)","context_page_description":"Schenkeldecken oder auch Schenkelplatten nennt man bei Insekten die Erweiterungen der Hinterhüften, die die Hinterschenkel ganz oder teilweise abdecken. Bei vollständigen Schenkeldecken ist der Schenkel nicht mehr sichtbar. In diesem Fall nennt man die Schenkelplatten Hinterhüftplatten.\\nSchenkeldecken sind bei vielen Familien der Käfer ausgebildet, beispielsweise bei Aaskäfern, Prachtkäfern, Speckkäfern, Nagekäfern und Moorweichkäfern. Besonders bei den Schnellkäfern stellt die Form der Schenkeldecken ein wichtiges Merkmal für die Bestimmung der Art dar.\\nDie Hinterhüften schließen auf der Körperunterseite an die Hinterbrust an und stehen häufig quer zur Körperlängsachse. Bei den Schnellkäfern sind sie lang und erreichen in der Regel den Körperseitenrand. Sie überbrücken den Niveauunterschied zwischen Hinterbrust und Hinterleib und sind rinnenförmig ausgehöhlt. Die Schenkeldecken bilden den äußeren Rand der Rinne und schließen niveaugleich an die Hinterbrust an. Beim Anziehen der Beine wird der Vorderrand der Schenkel in die Rinne eingelegt und die Schenkel mehr oder weniger von den Schenkeldecken bedeckt."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%87%D8%A7%D8%B1%D9%88%DB%8C_%D9%BE%DA%A9%D8%A7%D8%B1","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6b/Pekar_small.jpg","page_title":"هاروی پکار","context_page_description":"هاروی پکار آمریکالی ادبیات تنقیدچی و یازیچی - .۸ اوْکتوبر ۱۹۳۹ تاریخیندا دۆنیایا گؤز آچیب. اوْ، اثرلرینی اینگیلیس دیلینده یازیب."},{"page_url":"https://en.wikipedia.org/wiki/Tajuria_isaeus","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Tajuria_isaeus1.JPG","page_title":"Tajuria isaeus","context_page_description":"Tajuria isaeus is a butterfly in the family Lycaenidae. It is found in South-East Asia."},{"page_url":"https://en.wikipedia.org/wiki/Washington_J._McCormick","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/W_J_McCormick.jpg","page_title":"Washington J. McCormick","context_page_description":"Washington Jay Mccormick, Jr. was a U.S. Representative from Montana.\\nBorn in Missoula, Montana, Mccormick attended the University of Montana and the University of Notre Dame in Indiana. He is named after his father, Washington J. McCormick, a prominent Missoula citizen. He graduated from Harvard University in 1906 and from the law department of Columbia University, New York City, in 1910. He was admitted to the New York bar the same year. He returned to Missoula, Montana and admitted to the Montana bar in 1911, engaging in the practice of law. He served as member of the Montana House of Representatives from 1918 to 1920.\\nMccormick was elected as a Republican to the Sixty-seventh Congress, but was unsuccessful in his reelection bid in 1922 to the Sixty-eighth Congress. He continued the practice of law until his retirement, when he devoted his time to writing.\\nMcCormick allowed his family ranch at Fort Owen to become a state park. He resided in the Bitter Root Valley, near Stevensville, Montana, until his death in Missoula, Montana, March 7, 1949.\\nHe was interred in Missoula Cemetery."},{"page_url":"https://es.wikipedia.org/wiki/Mandazi","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Mandazi.jpg","page_title":"Mandazi","context_page_description":"El mandazi ​​ es un tipo de pan frito originario del África Oriental, concretamente de las zonas costeras swahili de Kenia y Tanzania.​ Sigue siendo popular en la región, y como resulta cómodo de preparar, puede tomarse con casi cualquier comida o salsa para mojar, o bien solo como aperitivo, y puede conservarse y recalentarse para consumirse más tarde.​​"},{"page_url":"https://en.wikipedia.org/wiki/Great_Paris_Exhibition_Telescope_of_1900","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Great_Ex_Telescope_Complete.jpg","page_title":"Great Paris Exhibition Telescope of 1900","context_page_description":"The Great Paris Exhibition Telescope of 1900, with an objective lens of 1.25 m in diameter, was the largest refracting telescope ever constructed. It was built as the centerpiece of the Paris Universal Exhibition of 1900. Its construction was instigated in 1892 by François Deloncle, a member of the French Chambre des Députés. Since it was built for exhibit purposes within a large metropolis, and its design made it difficult to aim at astronomical objects, it was not suited for scientific use. When the year-long exposition was over, its builders were unable to sell it. It was ultimately broken up for scrap; the lenses are still stored away at the Paris Observatory."},{"page_url":"https://cy.wikipedia.org/wiki/Ceudod_y_trwyn","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Nasal_cavity.jpg","page_title":"Ceudod y trwyn","context_page_description":"Mae'r ceudod trwynol yn ofod mawr o aer uwchben a thu ôl i'r trwyn yng nghanol yr wyneb. Mae pob ceudod yn barhad o un o'r ddwy ffroen."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AA%D9%8A%D8%B1%D9%89_%D8%B3%D8%B2%D9%88%D9%BE%D9%8A%D9%86%D8%B3%D9%83%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/The_Warlord_2016.jpg","page_title":"تيرى سزوپينسكى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nتيرى سزوپينسكى مصارع محترف من امريكا."},{"page_url":"https://nl.wikipedia.org/wiki/Anastasia_(1956)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Anastasia_trailer1.jpg","page_title":"Anastasia (1956)","context_page_description":"Anastasia is een Amerikaanse film uit 1956 van Anatole Litvak met in de hoofdrollen Ingrid Bergman, Yul Brynner en Helen Hayes.\\nDe film is gebaseerd op de Engelse vertaling van Guy Bolton van het Franse toneelstuk Anastasia van Marcelle Maurette. De Engelstalige versie werd opgevoerd op Broadway in het Lyceum Theatre van 29 december 1954 tot 24 september 1955. Het stuk haalde 272 voorstellingen. Het werk van Maurette is losjes gebaseerd op het waargebeurde verhaal van een Duitse vrouw, die later bekend zou worden als 'Anna Anderson' die beweerde de grootvorstin Anastasia Nikolajevna van Rusland te zijn.\\n20th Century Fox besteedde 3,5 miljoen aan Anastasia. De film werd een succes in de bioscopen en bracht in 1957 5 miljoen dollar op. Ingrid Bergman kreeg een Oscar en een Golden Globe voor haar rol."},{"page_url":"https://ms.wikipedia.org/wiki/Gunnar_Gren","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Gunnar_Gren-1957.jpg","page_title":"Gunnar Gren","context_page_description":"Johan Gunnar Gren merupakan seorang bekas pemain dan pengurus bola sepak Sweden. Beliau dikenali secara meluas apabila menjadi pemain untuk kelab IFK Gothenburg dan A.C. Milan. Seorang pemain bola sepak yang kreatif, beliau turut dikenali dengan gaya permainan, visi, kemahiran menghantar bola serta merupakan sebahagian daripada trio \\"Gre-No-Li\\" di Milan dan pasukan kebangsaan Sweden. Beliau mampu beraksi sebagai seorang playmaker dan penggempur utama pasukan lawan. Gren telah meraih beberapa pencapaian pasukan termasuklah pingat emas dalam Sukan Olimpik 1948, Guldbollen pada 1946 dan sebahagian daripada pasukan Sweden yang melangkah ke final Piala Dunia. Gren dianggap sebagai salah satu pemain bola sepak Sweden yang terhebat dan berprolifik. Sebuah tugu untuk mengabadikan kehebatan beliau telah didirikan di perkarangan stadium Gamla Ullevi."},{"page_url":"https://da.wikipedia.org/wiki/YPG","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Rojava_june_2015.png","page_title":"YPG","context_page_description":"Folkets forsvarsenheder, også kendt som YPG, er den bevæbnede gren af det Demokratiske unionsparti i Rojava. I den syriske borgerkrig indtog YPG oprindelig en defensiv holdning, men senere er gruppen også gået ind i territorier kontrollerede af Islamisk Stat. I YPG indgår tillige Kvindernes forsvarsenheder. Forsvarsenhederne har under sin eksistens også tiltrukket sig et stort antal frivillige fra udlandet, blandt andet amerikanere, tyskere, og svenskere. Også tyrkiske anarkister og kommunister har deltaget i kampene på YPGs side."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Budila","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Budila_jud_Brasov.png","page_title":"Budila","context_page_description":"Budila sī Romania Braşov Koān ê chi̍t ê chū-tī-thé."},{"page_url":"https://en.wikipedia.org/wiki/Kibaale_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Kibale_District_in_Uganda.svg","page_title":"Kibaale District","context_page_description":"Kibaale District, is a district in the Western Region of Uganda. The district headquarters are in the town of Kibaale."},{"page_url":"https://en.wikipedia.org/wiki/Luther_Brooks_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Luther_Brooks_House_in_Cambridge_Ma.jpg","page_title":"Luther Brooks House","context_page_description":"The Luther Brooks House is a historic house located at 34 Kirkland Street in Cambridge, Massachusetts."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Paunsdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Apelstein_nr40.jpg","page_title":"Liste der Kulturdenkmale in Paunsdorf","context_page_description":"Die Liste der Kulturdenkmale in Paunsdorf enthält die Kulturdenkmale des Leipziger Stadtteils Paunsdorf, die in der Denkmalliste vom Landesamt für Denkmalpflege Sachsen mit Stand 2017 erfasst wurden."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%81%D8%B1%D9%8A%D8%AF%D9%88%D9%85_(%D9%85%D9%82%D8%A7%D8%B7%D8%B9%D8%A9_%D8%A3%D9%88%D8%AA%D8%A7%D8%BA%D8%A7%D9%85%D9%8A)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/FreedomWisconsinStNicholas.jpg","page_title":"فريدوم (مقاطعة أوتاغامي)","context_page_description":"فريدوم، مقاطعة أوتاغامي ‏ هي بلدة تقع بولاية ويسكونسن في الولايات المتحدة. تبلغ مساحتها 92.6، وترتفع عن سطح البحر 224 م، بلغ عدد سكانها 5842 نسمة في عام 2010 حسب إحصاء مكتب تعداد الولايات المتحدة وتصل الكثافة السكانية فيها 56.6 نسمة/كم²."},{"page_url":"https://ceb.wikipedia.org/wiki/Oricola_(kapital_sa_munisipyo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Oricola0.jpg","page_title":"Oricola (kapital sa munisipyo)","context_page_description":"Kapital sa munisipyo ang Oricola sa Italya. Nahimutang ni sa lalawigan sa Provincia dell' Aquila ug rehiyon sa Abruzzo, sa sentro nga bahin sa nasod, 50 km sa sidlakan sa Rome ang ulohan sa nasod. 810 metros ibabaw sa dagat kahaboga ang nahimutangan sa Oricola, ug adunay 417 ka molupyo.\\nAng yuta palibot sa Oricola kay kabungtoran sa amihang-kasadpan, apan sa habagatang-sidlakan nga kini mao ang kabukiran. Ang kinahabogang dapit sa palibot dunay gihabogon nga 1,772 ka metro ug 10.0 km sa sidlakan sa Oricola. Dunay mga 120 ka tawo kada kilometro kwadrado sa palibot sa Oricola medyo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Marcellina, 19.6 km sa kasadpan sa Oricola. Hapit nalukop sa kaumahan ang palibot sa Oricola. Sa rehiyon palibot sa Oricola, kabukiran talagsaon komon.\\nAng klima mediteranyo. Ang kasarangang giiniton 12 °C. Ang kinainitan nga bulan Agosto, sa 22 °C, ug ang kinabugnawan Enero, sa 2 °C. Ang kasarangang pag-ulan 1,372 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 199 milimetro nga ulan, ug ang kinaugahan Agosto, sa 41 milimetro."},{"page_url":"https://hr.wikipedia.org/wiki/B-58_Hustler","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Convair_B-58_under_construction.jpg","page_title":"B-58 Hustler","context_page_description":"Convair B-58 Hustler je bio prvi operativni bombarder koji je mogao dostići brzinu od Mach 2. Razvijen je za potrebe američkog ratnog zrakoplovstva kako bi djelovao s velikih visina pri velikim brzinama, no zbog uvođenja u službu preciznih sovjetskih raketa zemlja-zrak, počinje se koristiti za prodor unutar neprijateljskog zračnog prostora na malim visinama."},{"page_url":"https://pt.wikipedia.org/wiki/Ces%C3%A1rio_Cec%C3%ADlio_de_Assis_Coimbra","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Aristides_Cecilio_de_Assis_Coimbra_e_a_sua_senhora%2C_Elvira_Augusta%2C_filha_dos_Viscondes_de_Caldas-2.jpg","page_title":"Cesário Cecílio de Assis Coimbra","context_page_description":"Cesário Cecílio de Assis Coimbra, mais conhecido por Coronel Cesário Coimbra, foi um coronel da Guarda Nacional, empresário, político e um dos principais fundadores da cidade mineira de Muzambinho."},{"page_url":"https://en.wikipedia.org/wiki/List_of_stadiums_in_Spain","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Panor_mica_de_Son_Moix_%28569234728%29.jpg","page_title":"List of stadiums in Spain","context_page_description":"The following is a list of Stadiums in Spain, ordered by capacity.\\nOnly stadiums with a capacity of 10,000 or more are included in this list."},{"page_url":"https://hu.wikipedia.org/wiki/Nardodipace","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Nardodipace.jpg","page_title":"Nardodipace","context_page_description":"Nardodipace község Olaszország Calabria régiójában, Vibo Valentia megyében."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A3%D1%85%D0%BE%D1%80%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Uhorna11Slovakia.jpg","page_title":"Ухорна","context_page_description":"Ухорна насељено је мјесто са административним статусом сеоске општине у округу Гелњица, у Кошичком крају, Словачка Република."},{"page_url":"https://ast.wikipedia.org/wiki/Ana_Bautista","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/La_escultura_de_Ana_Bautista%2C_vista_desde_atr%C3%A1s.JPG","page_title":"Ana Bautista","context_page_description":"Ana Bautista Reyes ye una ex ximnasta rítmica española que foi componente de la seleición nacional de ximnasia rítmica d'España en modalidá individual. En 1989 llogró la primer medaya d'oru oficial pa la ximnasia rítmica española, al ser oru en cuerda na Final de la Copa d'Europa d'Hanóver, ente otres preseas. Foi campeona d'España en categoría d'honor en 1989."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%80%D0%BE%D0%BF%D0%B8%D0%B2%D0%BD%D0%B8%D1%86%D0%BA%D0%B8%D0%B9,_%D0%9C%D0%B0%D1%80%D0%BA_%D0%9B%D1%83%D0%BA%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/%D0%93%D0%B5%D1%80%D0%B1_%D1%80%D0%BE%D0%B4%D1%83_%D0%9A%D1%80%D0%BE%D0%BF%D0%B8%D0%B2%D0%BD%D0%B8%D1%86%D1%8C%D0%BA%D0%B8%D1%85.jpg","page_title":"Кропивницкий, Марк Лукич","context_page_description":"Марк Луки́ч Кропивни́цкий — украинский театральный деятель, актёр, режиссер, певец, драматург, прославившийся как один из ярчайших знатоков и выразителей жизни украинского села. Отец оперной певицы Александры Кропивницкой."},{"page_url":"https://pt.wikipedia.org/wiki/T%C3%B3quio","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Tokyo_Dome_night.jpg","page_title":"Tóquio","context_page_description":"Tóquio, oficialmente Metrópole de Tóquio, é a capital do Japão e uma das 47 prefeituras do país. Situa-se em Honshu, a maior ilha do arquipélago. Em 2015, Tóquio possuía mais de 13,4 milhões de habitantes, cerca de 11% da população do país, e a Região Metropolitana de Tóquio possui mais de 37 milhões de habitantes, o que torna a aglomeração de Tóquio, independentemente de como se define, como a área urbana mais populosa do mundo. Um de seus monumentos mais famosos é a Torre de Tóquio. Foi fundada em 1457, com o nome de Edo ou Yedo. Tornou-se a capital do Império em 1868 com a atual designação. Sofreu grande destruição duas vezes; uma em 1923, quando foi atingida por um terremoto; e outra em 1944 e 1945, quando bombardeios americanos destruíram grande parte da cidade, sendo que no total foi destruída 51% de sua área e mortas mais de 80 mil pessoas.\\nEmbora seja considerada um dos maiores centros financeiros do mundo, e uma \\"Cidade Global Alfa+\\", ela não é, tecnicamente, uma cidade. Não há no Japão uma cidade chamada \\"Tóquio\\"."},{"page_url":"https://en.wikipedia.org/wiki/Black_Tape_for_a_Blue_Girl","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Black_Tape_For_A_Blue_Girl-2010w.jpg","page_title":"Black Tape for a Blue Girl","context_page_description":"Black Tape for a Blue Girl is an American dark wave band formed in 1986 by Projekt Records' founder Sam Rosenthal. Their music takes on elements of dark wave, ethereal, ambient, neoclassical, and dark cabaret music. Their 12th album, To touch the milky way, was released on October 26, 2018 on Projekt Records."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AC%E0%A5%83%E0%A4%B9%E0%A4%B8%E0%A5%8D%E0%A4%AA%E0%A4%A4%E0%A4%BF_(%E0%A4%97%E0%A5%8D%E0%A4%B0%E0%A4%B9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/NASA14135-Jupiter-GreatRedSpot-Shrinks-20140515.jpg","page_title":"बृहस्पति (ग्रह)","context_page_description":"बृहस्पति सूर्य से पाँचवाँ और हमारे सौरमंडल का सबसे बड़ा ग्रह है। यह एक गैस दानव है जिसका द्रव्यमान सूर्य के हजारवें भाग के बराबर तथा सौरमंडल में मौजूद अन्य सात ग्रहों के कुल द्रव्यमान का ढाई गुना है। बृहस्पति को शनि, अरुण और वरुण के साथ एक गैसीय ग्रह के रूप में वर्गीकृत किया गया है। इन चारों ग्रहों को बाहरी ग्रहों के रूप में जाना जाता है।\\nयह ग्रह प्राचीन काल से ही खगोलविदों द्वारा जाना जाता रहा है तथा यह अनेकों संस्कृतियों की पौराणिक कथाओं और धार्मिक विश्वासों के साथ जुड़ा हुआ था। रोमन सभ्यता ने अपने देवता जुपिटर के नाम पर इसका नाम रखा था। इसे जब पृथ्वी से देखा गया, बृहस्पति -2.94 के सापेक्ष कांतिमान तक पहुँच सकता है, छाया डालने लायक पर्याप्त उज्जवल, जो इसे चन्द्रमा और शुक्र के बाद आसमान की औसत तृतीय सर्वाधिक चमकीली वस्तु बनाता है। ।\\nबृहस्पति एक चौथाई हीलियम द्रव्यमान के साथ मुख्य रूप से हाइड्रोजन से बना हुआ है और इसका भारी तत्वों से युक्त एक चट्टानी कोर हो सकता है।अपने तेज घूर्णन के कारण बृहस्पति का आकार एक चपटा उपगोल है। इसके बाहरी वातावरण में विभिन्न अक्षांशों पर कई पृथक दृश्य पट्टियां नजर आती है जो अपनी सीमाओं के साथ भिन्न भिन्न वातावरण के परिणामस्वरूप बनती है।"},{"page_url":"https://hu.wikipedia.org/wiki/R%C3%B3ma","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Statue-Augustus.jpg","page_title":"Róma","context_page_description":"Róma Olaszország fővárosa, Lazio régió központja, a hajdani Római Birodalom központja. Az ország legnagyobb és legnépesebb városa 1285,3 km²-en mintegy 2,6 millió lakossal. Területébe ékelve található a Vatikán, a római katolikus egyház központja, a pápa székhelye, a világ legkisebb független állama.\\nTörténete több mint két és fél ezer évet ölel fel. A Római Királyság, a Római Köztársaság és a Római Birodalom fővárosa volt. Utóbbi Nyugat-Európa és a Földközi-tenger-menti országok hatalmi központja volt az i. e. 1. századtól az i. sz. 7. századig. 2007-ben Róma volt a világon a 11. és az Európai Unióban a 3. leglátogatottabb város, továbbá a turisták legnépszerűbb olaszországi célpontja. Központját az UNESCO a Világörökség részének nyilvánította. Múzeumai és műemlékei, mint pl. a Vatikán múzeumai és a Colosseum a világ 50 leglátogatottabb turisztikai célpontjai között vannak."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D9%87%D8%B3%D8%AA%D8%A7%D9%86_%D8%A8%D8%B1%D8%BA%D8%A7%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/91/Vardeh_village-_Rural_House.jpeg","page_title":"دهستان برغان","context_page_description":"دهستان بَرَغان نام دهستانی در بخش چندار شهرستان ساوجبلاغ، استان البرز در ایران است. براساس سرشماری مرکز آمار ایران در سال ۱۳۸۵، جمعیت آن ۱۴۲۴ نفر بوده‌است.امامزاده عبدالقهار روستای ورده از مهمترین زیارتگاه‌های دهستان برغان است و حسینیه اعظم برغان از مهم‌ترین مراکز تاریخی دهستان برغان است. آلوهای این دهستان به نام آلوی برغانی در تهران و اطراف معروف است."},{"page_url":"https://nl.wikipedia.org/wiki/Serie_A_2005/06","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/600px_Amaranto_con_R_bianca.png","page_title":"Serie A 2005/06","context_page_description":"De Serie A 2005/06 was het 103de voetbalkampioenschap in Italië en het 75ste seizoen van de Serie A. In eerste instantie werd Juventus kampioen maar dan kwam het Italiaans omkoopschandaal aan het licht. Juventus manipuleerde al twee seizoenen de competitie door omkoping. De titels van 2005 en 2006 werden afgenomen. De Scudetto werd in 2005 ook aan geen andere club toegekend, maar wel in 2006 aan Internazionale dat eigenlijk op de derde plaats eindigde achter Juventus en rivaal AC Milan die ook betrokken was bij het omkoopschandaal, net als SS Lazio en AC Fiorentina.\\nNa een eerste proces werden Juventus, Lazio en Fiorentina naar de Serie B verwezen, terwijl AC Milan 44 strafpunten kreeg voor seizoen 2005/06 waardoor de club nog steeds op een goede plaats eindigde. Door de strafpunten maakten de clubs ook geen aanspraak op Europees voetbal in 2006/07.\\nAlle vier de clubs gingen in beroep en dit werkte al bleef men voor Juventus niet mals. Juve degradeerde naar de Serie B en moest daar beginnen met 17 strafpunten. Fiorentina en Lazio mochten in de Serie A blijven spelen maar begonnen het seizoen wel met respectievelijk 19 en 11 strafpunten."},{"page_url":"https://vec.wikipedia.org/wiki/Samsung_Galaxy_A8/A8%2B_(2018)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Samsung_Galaxy_A8_%282018%29.png","page_title":"Samsung Galaxy A8/A8+ (2018)","context_page_description":"Samsung Galaxy A8 (2018) e Samsung Galaxy A8+ (2018) i xé la cuarta jenerasion, del smartphone Android prodoto da la Samsung Electronics, Samsung Galaxy A8. I xé stai lansai n'tel 2018. La xé sta fata anca na seconda jenerasion, ciamada Samsung Galaxy A8, chel fa anca elo parte de la serie Samsung Galaxy A. No xé sta prodota la segonda jenerasion n'tel 2017."},{"page_url":"https://en.wikipedia.org/wiki/Dalkeith","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Dalkeith%2C_Cemetery_Rd%2C_Water_Tower_-_Rooms_with_a_view_-_geograph.org.uk_-_1035567.jpg","page_title":"Dalkeith","context_page_description":"Dalkeith is a town in Midlothian, Scotland, on the River Esk. It was granted a burgh of barony in 1401 and a burgh of regality in 1540. The settlement of Dalkeith grew southwestwards from its 12th-century castle.\\nDalkeith has a population of 12,342 people according to the 2011 census.\\nThe town is divided into four distinct areas: Dalkeith proper with its town centre and historic core; Eskbank to its west; Woodburn to its east; and Newbattle to the south.\\nDalkeith is the main administrative centre for Midlothian. It is twinned with Jarnac, France. In 2004, Midlothian Council re-paved Jarnac Court in honour of Dalkeith and Jarnac's long standing link.\\nOn the north-eastern edge of Dalkeith at Woodburn is the Dalkeith Campus – housing both Dalkeith High School and St David's Roman Catholic High School plus community leisure facilities."},{"page_url":"https://ca.wikipedia.org/wiki/Paulo_Assun%C3%A7%C3%A3o_da_Silva","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Paulo_Assun%C3%A7%C3%A3o.jpg","page_title":"Paulo Assunção da Silva","context_page_description":"Paulo Assunção da Silva, més conegut com a Paulo Assunção és un futbolista brasiler.\\nEl 27 d'agost de 2009 jugà com a titular el partit de la Supercopa d'Europa 2010 en què l'Atlético de Madrid es va enfrontar a l'Inter de Milà, i va guanyar el títol, per 2 a zero."},{"page_url":"https://ce.wikipedia.org/wiki/1514_%D1%88%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Roma_Statue_Bramante.JPG","page_title":"1514 шо","context_page_description":"1514 шо Юлианан рузманца — високосан доцу шо, долалуш долу кӀирандийнахь. Иза вайн эран 1514 шо ду, 514 шо 2 эзарлагӀа шерашкахь, 14 шо бӀешеран, 4 шо 2-гӀа иттаннаш шерашкахь XVI бӀешеран, 5 шо 1510-гӀа шерийн."},{"page_url":"https://cs.wikipedia.org/wiki/Soumost%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Spalov_bridges_1938.jpg","page_title":"Soumostí","context_page_description":"Soumostí tvoří dva i více na sebe vzájemně navazující mosty nebo jejich části, překonávající různé druhy překážek. Soumostím se nazývají také blízko sebe stojící, vzájemně nenavazující mosty, které překonávají stejnou.\\nNaopak soumostím se nenazývá most se samostatnými, oddělenými, protisměrnými jízdními pruhy."},{"page_url":"https://es.wikipedia.org/wiki/Benito_Mussolini","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/FourFavorites1101.jpg","page_title":"Benito Mussolini","context_page_description":"Benito Amilcare Andrea Mussolini fue un político, militar y dictador italiano, Presidente del Consejo de Ministros Reales de Italia desde 1922 hasta 1943 y Duce —guía— de la República Social Italiana desde 1943 hasta 1945. Llevó al poder al Partido Nacional Fascista y posterior Partido Fascista Republicano, y estableció un régimen totalitario durante el período conocido como fascismo italiano del Reino de Italia, bajo el beneplácito de Víctor Manuel III, hasta su colapso en la Segunda Guerra Mundial.\\nAfiliado al Partido Socialista Italiano, en 1914 fue expulsado de dicha organización por sostener posturas nacionalistas irredentistas contrarias al internacionalismo de los principales líderes socialistas. En 1922, ya como líder oficial del Partido Nacional Fascista, organizó la Marcha sobre Roma, tras cuya victoria fue nombrado presidente del Consejo de Ministros. Mussolini obtuvo creciente apoyo popular mediante la exaltación del panitalianismo, el expansionismo y el anticomunismo, sirviéndose de su influencia militar apoyado por la eficiente propaganda fascista y las concentraciones de masas cargadas de simbolismo."},{"page_url":"https://de.wikipedia.org/wiki/Christian_Heinrich_Burckhardt","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Willer-sur-Thur_Saint-Didier_couronnement_247.JPG","page_title":"Christian Heinrich Burckhardt","context_page_description":"Christian Heinrich Burckhardt war ein deutscher Glasmaler, der mit seinem Bruder Heinrich und seinem Sohn Christian in München eine Glasmalereiwerkstatt betrieb."},{"page_url":"https://de.wikipedia.org/wiki/Eine_Dummheit_macht_auch_der_Gescheiteste","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Stanislavski_as_Krutitski_1910.jpg","page_title":"Eine Dummheit macht auch der Gescheiteste","context_page_description":"Eine Dummheit macht auch der Gescheiteste ist eine Komödie in fünf Aufzügen von Alexander Ostrowski. Sie erschien 1868 und wurde im selben Jahr auch uraufgeführt."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%B4%D0%BC%D1%96%D0%BD%D1%96%D1%81%D1%82%D1%80%D0%B0%D1%82%D0%B8%D0%B2%D0%BD%D0%B8%D0%B9_%D1%83%D1%81%D1%82%D1%80%D1%96%D0%B9_%D0%97%D0%B0%D0%BA%D0%B0%D1%80%D0%BF%D0%B0%D1%82%D1%81%D1%8C%D0%BA%D0%BE%D1%97_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Blank_map_of_Zakarpattia_region12_by_Helgi.png","page_title":"Адміністративний устрій Закарпатської області","context_page_description":"Адміністративний поділ Закарпатської області\\nІсторична дата утворення Закарпатської області: 22 січня 1946 року. Закарпатська область складається з 13 сільських районів і 5 міст обласного підпорядкування. Міст з районним поділом нема. Всього в області 11 міст, 19 селища міського типу, 579 сільських населених пунктів, селищ нема, тому відповідно сіл 579. Державну й адміністративну владу забезпечують обласна рада й ОДА, у системі місцевого самоврядування 19 селищних рад, 11 міських рад, 13 районних рад і 307 сільських рад."},{"page_url":"https://oc.wikipedia.org/wiki/Raffaello_Sanzio","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Raphael_-_Saint_George_and_the_Dragon_-_Google_Art_Project.jpg","page_title":"Raffaello Sanzio","context_page_description":"Raffaello Sanzio, pus conegut coma Rafèl, foguèt un pintre e arquitècte italian de la Renaissença. Es tanben nomenat Raffaello Santi, Raffaello da Urbino, Raffaello Sanzio da Urbino."},{"page_url":"https://en.wikipedia.org/wiki/Mexico,_Indiana","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Miami_County_Indiana_Incorporated_and_Unincorporated_areas_Mexico_Highlighted_1848636.svg","page_title":"Mexico, Indiana","context_page_description":"Mexico is a census-designated place in Jefferson Township, Miami County, in the U.S. state of Indiana. The population was 836 at the 2010 census."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%BA%8C%E6%88%98%E6%97%B6%E8%8B%B1%E5%9B%BD%E7%9A%84%E5%8F%8D%E5%85%A5%E4%BE%B5%E6%88%98%E5%A4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Anti-tank_cylinder%2C_Moor_Park_College.JPG","page_title":"二战时英国的反入侵战备","context_page_description":"二戰時英國的反入侵戰備是英國為了抵抗可能發生的德軍入侵，而於1940年和1941年間做出的準備。在這期間，英國政府建立了英國國土警衛隊，並在英國全境修建了防禦工事。在缺少重型裝備的情況下，英軍需要將手中的一切可用資源運用到極致。\\n由於在不列顛空戰中戰敗，德國為入侵英國而開展的海獅計劃遭到了無限期的推延。英國也就沒能在其本土與德國陸軍展開戰鬥。今天，英國修建的大部分防禦工事都已消失，只有一些加固過的混凝土工事還較常見。"},{"page_url":"https://sl.wikipedia.org/wiki/Grad_%C5%BDebnik","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Poskus_rekonstrukcije_gradu_%C5%BDebnik.jpg","page_title":"Grad Žebnik","context_page_description":"Grad Žebnik je bil srednjeveški grad, ki je stal na Žebniški gori zahodno nad zaselkom Njivice pri Radečah. Skromne ruševine gradu se nahajajo na kopi nekaj deset metrov zahodno od cerkve sv. Žalostne Matere Božje, ki je bila nekoč grajska kapela."},{"page_url":"https://en.wikipedia.org/wiki/Richard_Redgrave","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/TheOutcastRichardRedgrave.jpg","page_title":"Richard Redgrave","context_page_description":"Richard Redgrave RA was an English landscape artist, genre painter and administrator."},{"page_url":"https://en.wikipedia.org/wiki/List_of_nobles_and_magnates_of_England_in_the_13th_century","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Coat_of_arms_of_Roger_de_Montbegon%2C_Lord_of_Hornby_Castle.png","page_title":"List of nobles and magnates of England in the 13th century","context_page_description":"During the 13th century England was partially ruled through Archbishops, Bishops, Earls, Barons, marcher Lords, and knights. All of these except for the knights would always hold most of their fiefs as tenant in chief. Although the kings maintained control of huge tracts of lands through judges, constables, castles, and sheriffs, the nobles of England were still powerful. This is a list of the various different nobles and magnates including both lords spiritual and lords secular. It also includes nobles who were vassals of the king but were not based in England. Additionally nobles of lesser rank who appear to have been prominent in England at the time. The nobles are listed categorically by rank starting with the Archbishops and going down to the nobles who did not hold titles."},{"page_url":"https://cs.wikipedia.org/wiki/Ky%C5%A1ice_(okres_Plze%C5%88-m%C4%9Bsto)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Ky%C5%A1ice_PM_CoA.jpg","page_title":"Kyšice (okres Plzeň-město)","context_page_description":"Obec Kyšice se nachází v okrese Plzeň-město v Plzeňském kraji. Žije v ní přibližně 1 000 obyvatel. Kyšice jsou nejvíce známé těžbou hrnčířské hlíny a kaolinu."},{"page_url":"https://pl.wikipedia.org/wiki/Nieuil-l%E2%80%99Espoir","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Nieuil-L%27Espoir%2C_mairie_%282%29.jpg","page_title":"Nieuil-l’Espoir","context_page_description":"Nieuil-l’Espoir – miejscowość i gmina we Francji, w regionie Nowa Akwitania, w departamencie Vienne.\\nWedług danych na rok 2017 gminę zamieszkiwały 2 718 osoby, a gęstość zaludnienia wynosiła 130 osób/km²."},{"page_url":"https://en.wikipedia.org/wiki/Fiske_Warren","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/86/FiskeWarren.jpg","page_title":"Fiske Warren","context_page_description":"Frederick Fiske Warren was a successful paper manufacturer, fine arts denizen, United States tennis champion of 1893, and major supporter of Henry George's single tax system which he helped develop in Harvard, Massachusetts, United States, in the 1930s. Fiske Warren established Georgist single-tax colonies and a social experiment in Andorra to disprove Malthus's population theory."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_G%C3%B6da","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Seitschen_Villa_Bahnhofstr_1_AB_2017.jpg","page_title":"Liste der Kulturdenkmale in Göda","context_page_description":"In der Liste der Kulturdenkmale in Göda sind die Kulturdenkmale der sächsischen Gemeinde Göda verzeichnet, die bis August 2017 vom Landesamt für Denkmalpflege Sachsen erfasst wurden. Die Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale im Landkreis Bautzen."},{"page_url":"https://pt.wikipedia.org/wiki/Castelo_de_Germanelo","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/ff/Castelo_de_Germanelo.JPG","page_title":"Castelo de Germanelo","context_page_description":"O Castelo de Germanelo localiza-se na Freguesia de Rabaçal, Concelho de Penela, Distrito de Coimbra, em Portugal.\\nNos arredores de Coimbra, a curta distância de Penela, no alto de uma colina, tal como o Castelo de Penela tinha a função genérica de defesa daquela então capital, pela linha do rio Mondego, das frequentes razias dos mouros na região Crónica dos Godos, por volta de 1180."},{"page_url":"https://es.wikipedia.org/wiki/Congregaci%C3%B3n_de_la_Misi%C3%B3n","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/27/CMPaul.png","page_title":"Congregación de la Misión","context_page_description":"La Congregación de la Misión es una Sociedad de vida apostólica fundada por Vicente de Paúl para la evangelización de los pobres y la formación del clero. A sus miembros se los conoce popularmente como padres paúles, vicencianos, vicentinos o lazaristas, debido este último sobrenombre a que en 1632 la casa matriz se trasladó al Priorato de Saint-Lazare, en París. No obstante, únicamente paúl está recogido por el Diccionario de la Real Academia Española. Los miembros de esta sociedad añaden a sus nombres las siglas: C.M.​"},{"page_url":"https://cs.wikipedia.org/wiki/K%C5%99ivka_S","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/TheWave.JPG","page_title":"Křivka S","context_page_description":"Křivka ve tvaru S, serpentinata se s oblibou používá v umělecké kompozici a je tradiční již od dob starověkého řeckého a románského umění. Tehdejší sochaři zobrazovali lidskou postavu tak, aby držení těla připomínalo vlnovku písmene \\"S\\". Přenesení váhy člověka a tím i jeho těžiště na jednu stranu se značuje jako kontrapost. Křivka S se využívá v různých oblastech umění, ať už se jedná o malbu, sochařství nebo fotografii."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9D%CE%B1%CE%BD%CE%BF%CE%B2%CE%BF%CF%85%CF%84%CE%B7%CF%87%CF%84%CE%AC%CF%81%CE%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Zwergtaucher_060319_3.jpg","page_title":"Νανοβουτηχτάρι","context_page_description":"Το νανοβουτηχτάρι ή νανοβουτηχτάρα είναι είδος πτηνών της οικογένειας των Πυγοποδιδών. Αυτό το πτηνό είναι μικρότερο των μελών της οικογένειας των βουτηχτάρων, και η μόνη βουτηχτάρα της Ευρώπης που ωοτοκεί τακτικά δύο φορές ετησίως.\\nΣτην Ελλάδα φωλιάζει σε υγρότοπους, ταμιευτήρες, λίμνες σε πάρκα κλπ., όπου αναπαράγονται αρκετές δεκάδες ζευγάρια."},{"page_url":"https://sk.wikipedia.org/wiki/Ve%C4%BEk%C3%BD_Meder","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Nagymegyer088.JPG","page_title":"Veľký Meder","context_page_description":"Veľký Meder je mesto na Slovensku ležiace v okrese Dunajská Streda v Trnavskom kraji."},{"page_url":"https://es.wikipedia.org/wiki/Mecanismo_sincronizador","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Synchronised_gun_-_catastrophic_failure.svg","page_title":"Mecanismo sincronizador","context_page_description":"Un mecanismo sincronizador o sincronizador de ametralladora, a veces llamado imprecisamente interruptor, está acoplado al armamento de un avión monomotor con configuración tractora, de tal modo que pueda disparar a través del arco de la hélice en movimiento sin que las balas impacten en sus palas. La idea presupone un armamento fijo que es apuntado al dirigir el avión hacia el blanco, en lugar de apuntar el arma de forma independiente.\\nHay muchos problemas prácticos, la mayoría de ellos surgiendo de la inherente imprecisión del disparo de un arma automática, la gran velocidad de las palas de una hélice en movimiento y la altísima velocidad a la que cualquier mecanismo debe operar para sincronizar las dos.\\nEl diseño y experimentación con sincronización de ametralladoras se llevó a cabo en Francia y Alemania en 1913-1914, siguiendo las ideas de August Euler, quien por lo visto fue el primero en sugerir la instalación de armamento fijo que disparase en la dirección del vuelo en 1910."},{"page_url":"https://ceb.wikipedia.org/wiki/Kollmar_(munisipyo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Kollmar_Kirche.jpg","page_title":"Kollmar (munisipyo)","context_page_description":"Munisipyo ang Kollmar sa Alemanya. Nahimutang ni sa estado pederal sa Schleswig-Holstein, sa amihanang bahin sa nasod, 290 km sa amihanan-kasadpan sa Berlin ang ulohan sa nasod. Adunay 1,697 ka molupyo.\\nHapit nalukop sa lasang nga dagomkahoy ang palibot sa Kollmar. Dunay mga 442 ka tawo kada kilometro kwadrado sa palibot sa Kollmar nga hilabihan populasyon. Ang klima klima sa kontinente. Ang kasarangang giiniton 8 °C. Ang kinainitan nga bulan Agosto, sa 18 °C, ug ang kinabugnawan Enero, sa -3 °C."},{"page_url":"https://it.wikipedia.org/wiki/Tim_Kelly","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/TimothyPatrickKelly_1990-04.jpg","page_title":"Tim Kelly","context_page_description":"Timothy Patrick \\"Tim\\" Kelly è stato un chitarrista statunitense, noto per la sua militanza negli Slaughter."},{"page_url":"https://fi.wikipedia.org/wiki/Dynamo_Dresden","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Bundesarchiv_Bild_183-1990-0524-014%2C_Dynamo_Dresden_DDR-Fu%C3%9Fballmeister.jpg","page_title":"Dynamo Dresden","context_page_description":"Sportgemeinschaft Dynamo Dresden on saksalainen jalkapalloseura Dresdenistä. Se on voittanut historiansa aikana Saksan demokraattisen tasavallan mestaruuden kahdeksan kertaa ja DDR:n cup-mestaruuden seitsemän kertaa. Seura perustettiin virallisesti vuonna 1953 ja se voitti ensimmäisen maansa mestaruuden samana vuonna. Vuonna 1954 valtiojohto siirrätti seuran Berliiniin ja perusti SC Dynamo Berlinin, jolloin Dynamo Dresden joutui aloittamaan toiselta sarjatasolta. Saksojen yhdistyttyä Dresden pelasi Bundesliigassa neljä kautta, ennen kuin se putosi taloudellisten syiden takia kolmannelle sarjatasolle. Kaudella 2019–2020 seura pelaa 2. Bundesliigassa.\\nDresden on pelannut vuodesta 1957 saakka Rudolf-Harbig-Stadionilla, ja seuran värit ovat olleet vuodesta 1968 saakka keltainen ja musta. Dresdenillä on ollut aina erityinen kilpailutilanne Berliner FC Dynamon kanssa. DDR-aikana Dresden oli kuitenkin maan suosituin joukkue, ja sen katsojaluvut olivat maan suurimmat."},{"page_url":"https://hu.wikipedia.org/wiki/Ortalis_wagleri","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Chachalaca_Vientre_Casta%C3%B1o_%2815954400939%29_%28cropped%29.jpg","page_title":"Ortalis wagleri","context_page_description":"Az Ortalis wagleri a madarak osztályának tyúkalakúak rendjébe és a hokkófélék családjába tartozó faj."},{"page_url":"https://sv.wikipedia.org/wiki/Baphuon","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Cambodia_08_-_125_-_Angkor_Thom_%283228091931%29.jpg","page_title":"Baphuon","context_page_description":"Baphuon är ett tempel i Angkor, Kambodja, beläget i ruinstaden Angkor Thom, nordväst om Bayon. Templet, som är dedikerat till hinduistiska guden Shiva, byggdes som statstempel i Angkor under senare hälften av 1000-talet på order av kung Udayadityavarman II vilken regerade 1050-1066.\\nDet 34 meter höga templet, som gränsar till den södra delen av det kungliga palatset, är vid grunden 120 meter i öst-västlig riktning, och 100 meter i nord-sydlig.\\nBaphuon är också är känt som känt som tempelberget, för att det påminner om ett mindre berg, har branta trappsteg upp till toppen, och varje möjlighet att försköna stenarna som användes till bygget, har använts till sitt yttersta, varför nästan varje möjlig stenyta är utsirad med ornament.\\nUnder 1400-talet konverterades Baphuon till att utgöra ett buddhistiskt tempel, och en 9 meter hög, och 70 meter lång staty av liggande Buddha, byggdes upp längs den västra sidan, varför ett av tornen måste avlägsnas."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Grabow_(Elde)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/GrabowM%C3%BChlenstr8.jpg","page_title":"Liste der Baudenkmale in Grabow (Elde)","context_page_description":"In der Liste der Baudenkmale in Grabow sind alle Baudenkmale der Stadt Grabow und ihrer Ortsteile aufgelistet."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Washington_County,_Kansas","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Washington_County%2C_Kansas_old_jail_from_E_1.JPG","page_title":"National Register of Historic Places listings in Washington County, Kansas","context_page_description":"This is a list of the National Register of Historic Places listings in Washington County, Kansas. It is intended to be a complete list of the properties and districts on the National Register of Historic Places in Washington County, Kansas, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in an online map.\\nThere are 8 properties and districts listed on the National Register in the county.\\nThis National Park Service list is complete through NPS recent listings posted February 2, 2018."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%AD%D0%BD%D0%B3%D0%B5%D0%BB%D1%8C%D1%81,_%D0%A4%D1%80%D0%B8%D0%B4%D1%80%D0%B8%D1%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Stamp_Soviet_Union_1954_CPA_1793.jpg","page_title":"Энгельс, Фридрих","context_page_description":"Фри́дрих Э́нгельс — немцойн философ, марксизман бухбиллинчарах цхьаъ, Карл Марксан доттагӀа а, ойла цхьанайогӀург а, соавтор а."},{"page_url":"https://de.wikipedia.org/wiki/Kloster_Sch%C3%B6nau_(Gem%C3%BCnden_am_Main)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ea/Kloster-Schoenau-11.jpg","page_title":"Kloster Schönau (Gemünden am Main)","context_page_description":"Das Kloster Schönau ist ein Kloster der Minoriten im Kirchdorf Schönau in der fränkischen Gemeinde Gemünden am Main in der Diözese Würzburg."},{"page_url":"https://nl.wikipedia.org/wiki/Thomas_Sankara","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Siege_UNIR_PS_Ouaga.jpg","page_title":"Thomas Sankara","context_page_description":"Thomas Sankara was president van Burkina Faso van 1983 tot 1987.\\nSankara was Peul van vaderskant en Mossi van moederskant.\\nSankara volgde een militaire opleiding en was kapitein in het leger van Opper-Volta. In 1981 werd hij minister van Informatie.\\nOp 7 november 1982 nam hij deel aan de militaire staatsgreep die kolonel Jean-Baptiste Ouédraogo als president aan de macht bracht. Deze zogenaamde 'revolutie' was een monsterverbond van conservatieve en progressieve militairen. Thomas Sankara behoorde bij de progressieve, extreem-linkse groep. In 1983 werd hij premier en maakte vele reizen, onder andere naar Cuba en de Sovjet-Unie.\\nIn augustus 1983 behoorde hij bij de groep militairen die president Ouédraogo en de groep van rechtse officieren ten val bracht. Er werd een Nationaal Revolutionaire Raad gevormd en Sankara werd voorzitter van de raad, president van de republiek en minister van Binnenlandse Zaken. In de Nationaal Revolutionaire Raad namen ook burgers zitting.\\nSankara betoonde zich een voorstander van een radicale koers en introduceerde het marxisme-leninisme als officiële leer."},{"page_url":"https://it.wikipedia.org/wiki/Cattedrale_di_Coventry","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Coventry_Cathedral_Baptistry_window.jpg","page_title":"Cattedrale di Coventry","context_page_description":"La cattedrale di Coventry, o Cattedrale di San Michele è un edificio di culto anglicano che si trova a Coventry, nel Regno Unito.\\nEssa è sede del vescovado e della diocesi omonima.\\nL'edificio della cattedrale attuale risale ai primi anni cinquanta del XX secolo a opera di Basil Spence, l'architetto che ne guidò la ricostruzione dopo i bombardamenti che la città dovette subìre per mano nazista durante la seconda guerra mondiale,\\nLe due precedenti costruzioni erano un monastero intitolato a Maria, del quale rimangono solo ruderi, e una chiesa gotica del XIV secolo intitolata a Michele Arcangelo, semidistrutta dai citati bombardamenti."},{"page_url":"https://pl.wikipedia.org/wiki/Shigella","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Shigella_stool.jpg","page_title":"Shigella","context_page_description":"Shigella – rodzaj bakterii Gram-ujemnych.\\nBakterie te powodują zatrucia pokarmowe. Jedynymi rezerwuarami bakterii są człowiek oraz małpy.\\nPo raz pierwszy bakterie z tego rodzaju zostały wyizolowane i opisane w roku 1897 przez japońskiego mikrobiologa Kiyoshiego Shigę."},{"page_url":"https://es.wikipedia.org/wiki/San_Diego_(California)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/USS_Midway_Museum..jpg","page_title":"San Diego (California)","context_page_description":"San Diego es una ciudad estadounidense. Ubicada en el condado de San Diego, California; en la costa del Océano Pacífico en el Sur de California, aproximadamente 190 kilómetros al sur de Los Ángeles e inmediatamente adyacente a la frontera con México.\\nCon una población estimada de 1 394 928 al 1.º de julio de 2015, ​ San Diego es la octava ciudad más grande de los Estados Unidos y la segunda más grande de California. Es parte de la conurbación San Diego-Tijuana, la segunda más grande aglomeración urbana entre los Estados Unidos y un país fronterizo, después de Detroit-Windsor, con una población de 4 922 723 habitantes. San Diego ha sido llamada «el lugar de nacimiento de California». Es conocida por su clima estable y cálido a lo largo del año, puertos naturales de aguas profundas, largas playas, larga cooperación con la Marina de los Estados Unidos y un reciente crecimiento de la industria de salud y biotecnología.\\nHogar histórico del pueblo Kumiai, San Diego fue el primer sitio visitado por los europeos en lo que hoy es la Costa Oeste de los Estados Unidos."},{"page_url":"https://en.wikipedia.org/wiki/24th_TVyNovelas_Awards","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Lucero_in_2017_%282%29.jpg","page_title":"24th TVyNovelas Awards","context_page_description":"The 24th TVyNovelas Awards, is an Academy of special awards to the best of soap operas and TV shows. The awards ceremony took place on May 13, 2006 in the Forum Mundo Imperial, Acapulco, Guerrero. The ceremony was televised in the Mexico by Canal de las estrellas.\\nEduardo Santamarina and Joana Benedek hosted the show. Alborada won 7 awards including Best Telenovela of the Year, the most for the evening. Other winners La Madrastra and Rebelde won 2 awards and La esposa virgen, Piel de otoño and Pablo y Andrea won one each."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%B5%D1%81%D1%8C%D1%94%D1%80_(%D0%92%D0%B5%D1%80%D1%85%D0%BD%D1%8F_%D0%93%D0%B0%D1%80%D0%BE%D0%BD%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Bessi%C3%A8res_La_halle.jpg","page_title":"Бесьєр (Верхня Гаронна)","context_page_description":"Бесьє́р — муніципалітет у Франції, у регіоні Південь-Піренеї, департамент Верхня Гаронна. Населення — 3322 осіб.\\nМуніципалітет розташований на відстані близько 570 км на південь від Парижа, 26 км на північний схід від Тулузи."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%B5%D1%81%D0%BB%D0%BC%D0%B0%D0%BD%D1%96%D1%8F_31","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bd/Rusev_United_States_Champion.jpg","page_title":"Реслманія 31","context_page_description":"Реслманія 31 — це найголовніше супершоу від американського промоушену WWE, яке пройшло 29 березня 2015 року у Леві Стедіум в місті Санта-Клара, Каліфорнія, США. Це супершоу стало тридцять першим щорічним супершоу Реслманія і трейтім по рахунку у 2015 році.\\nЦе перша Реслманія, яка пройшла в області затоки Сан-Франциско, і шоста по рахунку, яка відбулась у штаті Каліфорнія."},{"page_url":"https://de.wikipedia.org/wiki/Alt-Friedrichsfelde","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Alt-Friedrichsfelde_48.jpg","page_title":"Alt-Friedrichsfelde","context_page_description":"Die Straße Alt-Friedrichsfelde ist ein Teilstück der auf gemeinsamer Trasse verlaufenden Bundesstraßen B 1 und B 5 im Bezirk Lichtenberg. Sie verläuft in West-Ost-Richtung und liegt bis auf vier Hausnummern vollständig im Ortsteil Berlin-Friedrichsfelde. An der Straße und in ihrer Umgebung befinden sich sowohl Zeugnisse aus der Erstbebauungszeit im 18. und 19. Jahrhundert als auch ganze Quartiere aus den 1970er und 1990er Jahren wie die Wohnbauten um den Rosenfelder Ring oder das Gensinger Viertel. Die Straße Alt-Friedrichsfelde bildet mit den umgebenden Flächen den nördlichsten Bereich von Friedrichsfelde."},{"page_url":"https://ro.wikipedia.org/wiki/Meadow_Lane","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/MeadowLane2.jpg","page_title":"Meadow Lane","context_page_description":"Meadow Lane Stadium sau simplu Meadow Lane este un stadion de fotbal din Nottingham, Anglia. Acesta este stadionul de casă al clubului Notts County, care joacă pe el din 1910. De asemenea stadionul găzduiește și meciurile de acasă ale echipei de rugby Nottingham R.F.C., începând cu 2006.\\nCapacitatea curentă a stadionului e de 19.841 de locuri pentru fotbal și 20.211 pentru rugby. Recordul de audiență este 47.310 de spectatori, la meciul pe care Notts l-a pierdut cu 1–0 în fața lui York City în runda a 6-a a FA Cup, pe 12 martie 1955.\\nMeadow Lane este amplasat la doar 275 de metri depărtare de City Ground, stadionul lui Nottingham Forest. Cele două stadioane fiind cele mai apropiate stadioane de fotbal profesionist din Anglia și a doilea cele mai apropiate din Marea Britanie după stadioanele lui Dundee și Dundee United. Tribuna Trent End din City Ground este vizibilă din unele părți ale tribunelor Jimmy Sirrel și Spion Kop de pe Meadow Lane."},{"page_url":"https://de.wikipedia.org/wiki/B%C3%BCrgerablage","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/25/Gastst%C3%A4tte_Jagdhaus_an_der_B%C3%BCrgerablage_2.jpg","page_title":"Bürgerablage","context_page_description":"Die Bürgerablage ist eine Badestelle im Berliner Ortsteil Hakenfelde des Bezirks Spandau. Bereits um die Wende zum 20. Jahrhundert erfreute sich die Badestelle an der Havel großer Beliebtheit. Lange Zeit befand sie sich unmittelbar an der Berliner Mauer, wobei der Zuspruch der Badegäste bis heute ungetrübt ist. Von der Landseite ist die Badestelle an der Grenze zu Brandenburg über die Niederneuendorfer Allee zu erreichen. Zudem führt der Havelradweg, der hier Teil des Radfernwegs Berlin–Kopenhagen ist, am Strand vorbei.\\nAn der Badestelle befindet sich eine Wasserrettungsstation der DLRG Berlin. Die Station befindet sich auf der rechten Seite des Sandstrandes direkt am Wasser. Direkt oberhalb des Strands liegt die Gaststätte Jagdhaus an der Bürgerablage."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%88%D8%A7%DB%8C%D8%B3%D9%86%D9%81%D9%84%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Weissenfels_Luftbild.jpg","page_title":"وایسنفلس","context_page_description":"شهر وایسنفلس در ایالت زاکسن-آنهالت در کشور آلمان واقع شده است."},{"page_url":"https://sv.wikipedia.org/wiki/Parlamentsvalet_i_Portugal_2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Portuguese_districts_legislatives_2015.svg","page_title":"Parlamentsvalet i Portugal 2015","context_page_description":"Parlamentsvalet i Portugal 2015 hölls söndagen den 4 oktober 2015 för att utse 230 platser i det portugisiska parlamentet - Assembleia da República.\\nDen borgerliga koalitionen Portugal Först fick flest röster, utan att ha nått egen majoritet."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B5%D1%80%D0%B5%D0%B9%D1%81%D0%BA%D0%B8%D0%B9,_%D0%93%D0%B5%D0%BE%D1%80%D0%B3%D0%B8%D0%B9_%D0%A1%D0%B5%D0%BC%D1%91%D0%BD%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/VEREYSKIY-2.jpg","page_title":"Верейский, Георгий Семёнович","context_page_description":"Гео́ргий Семёнович Вере́йский — советский график и живописец. Народный художник РСФСР. Лауреат Сталинской премии второй степени.\\nОдин из художников ленинградской пейзажной школы."},{"page_url":"https://en.wikipedia.org/wiki/San_Fernando,_Bol%C3%ADvar","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Iglesia_San_Fernando_Rey_del_municipio_de_San_Fernando_de_Occidente_-_Bol%C3%ADvar_%28Colombia%29.JPG","page_title":"San Fernando, Bolívar","context_page_description":"San Fernando is a town and municipality located in the Bolívar Department, northern Colombia."},{"page_url":"https://pt.wikipedia.org/wiki/Tage_Erlander","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Tage_Erlander_1949.jpg","page_title":"Tage Erlander","context_page_description":"Tage Fritiof Erlander foi um político social-democrata da Suécia. Ocupou o lugar de primeiro-ministro da Suécia de 11 de Outubro de 1946 a 14 de Outubro de 1969.\\nDurante o seu mandato, viram a luz do dia as importantes reformas sociais da segurança social na doença e a pensão geral complementar."},{"page_url":"https://de.wikipedia.org/wiki/Kurtheater_Bad_Kissingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Theater_Kissingen_Zuschauerraum.JPG","page_title":"Kurtheater Bad Kissingen","context_page_description":"Das Kurtheater in Bad Kissingen wurde 1904 von dem Münchner Architekten Max Littmann im Barockstil fränkischer Art gebaut und am 25. Juni 1905 zur Kursaison in Betrieb genommen."},{"page_url":"https://hu.wikipedia.org/wiki/P%C3%A1d%C3%A1r_Anita","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/P%C3%A1d%C3%A1r_Anita_2012.JPG","page_title":"Pádár Anita","context_page_description":"Pádár Anita válogatott magyar labdarúgó, csatár. Sorozatban 15-szörös bajnoki gólkirály, az év női labdarúgója 1999-ben és 2011-ben, válogatottsági rekorder."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A0%CE%B5%CE%BB%CE%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Selo_Pel%C3%A9_1000_gols_10_cts.jpg","page_title":"Πελέ","context_page_description":"Ο Έντσον Αράντες ντο Νασιμέντο, γνωστός ως Πελέ, είναι Βραζιλιάνος πρώην διεθνής ποδοσφαιριστής. Έχει ανακηρυχθεί ως ο καλύτερος ποδοσφαιριστής του 20ού αιώνα από την ΦΙΦΑ και τη Διεθνή Ομοσπονδία Ιστορίας και Στατιστικής Ποδοσφαίρου και ευρέως θεωρείται ο κορυφαίος όλων των εποχών. Γνωστός και ως ο \\"Βασιλιάς του Ποδοσφαίρου\\" κατέχει τους τίτλους \\"Ποδοσφαιριστής του Αιώνα\\" από τη ΦΙΦΑ, \\"Αθλητής του Αιώνα\\" από την Διεθνή Ολυμπιακή Επιτροπή και είναι μέλος του ποδοσφαιρικού Hall of Fame. Το 2000, σε παγκόσμια δημοσκόπηση της ΦΙΦΑ στο διαδίκτυο για την ανάδειξη του καλύτερου ποδοσφαιριστή όλων των εποχών, ήρθε δεύτερος με 18,5%, ενώ πρώτος με 53,6% ήρθε ο Ντιέγκο Μαραντόνα, ενώ αντίθετα, στην ψηφοφορία της FIFA \\"Football family\\" και των αναγνωστών του περιοδικού FIFA Magazine ο Πελέ ήρθε πρώτος με 72,7% των ψήφων.\\nΤα ατομικά του επιτεύγματα και οι διακρίσεις του τον κατατάσσουν ως τον πιο διάσημο και δημοφιλή όχι μόνο στην παγκόσμια ποδοσφαιρική ιστορία αλλά και στο σύνολο του κόσμου των σπορ.\\nΣτην ψηφοφορία των ειδικών αθλητικογράφων, το «Μαύρο Μαργαριτάρι» ήρθε πρώτο με 1.705 πόντους, με δεύτερο το Γιόχαν Κρόιφ με 1.303, ενώ την πρώτη θέση ως κορυφαίος του αιώνα κατέλαβε και"},{"page_url":"https://sv.wikipedia.org/wiki/Gunnar_Olof_Hylt%C3%A9n-Cavallius","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Gunnar_Olof_Hylten-Cavallius.jpg","page_title":"Gunnar Olof Hyltén-Cavallius","context_page_description":"Gunnar Olof Hyltén-Cavallius, född 18 maj 1818 i Vislanda, död 5 juli 1889 i Skatelöv, var en svensk diplomat, folklivsforskare och etnolog."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AF%E3%83%83%E3%83%88%E3%83%BB%E3%83%81%E3%82%A7%E3%83%BC%E3%83%87%E3%82%A3%E3%83%BC%E3%83%AB%E3%83%AF%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Wat_Chedi_Luang_14.jpg","page_title":"ワット・チェーディールワン","context_page_description":"ワット・チェーディールワンは、タイの北部、チエンマイの歴史的な旧市街の中心部にある仏教寺院である。現在の寺院の敷地は、もともとワット・チェーディールワン、ワット・ホータム 、ワット・スックミン の3寺院で構成されていた。"},{"page_url":"https://es.wikipedia.org/wiki/Matema","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/M%C3%A9taphore_Sch%C3%A9ma_Lacan.gif","page_title":"Matema","context_page_description":"El término matema designa un concepto introducido en 1971 por Jacques Lacan para denominar el tipo de formalización con la que algunos conceptos psicoanalíticos centrales podrían ser descritos a través de un lenguaje formal. Se trata de fórmulas que representan de manera simbólica los términos de una estructura y las relaciones de sus componentes entre sí.​"},{"page_url":"https://ro.wikipedia.org/wiki/Nod_lunar","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Lunar_eclipse_diagram-ro.svg","page_title":"Nod lunar","context_page_description":"Nodurile lunare sunt punctele orbitei Lunii în care ea traversează ecliptica, traiectoria Soarelui pe cer. Punctul în care ea traversează ecliptica din emisfera cerească sudică spre emisfera nordică se numește nod ascendent; cel în care ea o traversează din emisfera nordică spre cea sudică se numește nod descendent."},{"page_url":"https://sv.wikipedia.org/wiki/Mour%C3%A8ze","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d5/Map_commune_FR_insee_code_34175.png","page_title":"Mourèze","context_page_description":"Mourèze är en kommun i departementet Hérault i regionen Occitanien i södra Frankrike. Kommunen ligger i kantonen Clermont-l'Hérault som tillhör arrondissementet Lodève. År 2009 hade Mourèze 170 invånare."},{"page_url":"https://lt.wikipedia.org/wiki/Lietuvos_bankas","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Lietuvos_bankas_totori%C5%B3_g..JPG","page_title":"Lietuvos bankas","context_page_description":"Lietuvos bankas yra Lietuvos Respublikos centrinis bankas, Europos Centrinių Bankų Sistemos narys."},{"page_url":"https://de.wikipedia.org/wiki/Gasteig","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6f/Gasteig_Philharmonie.jpg","page_title":"Gasteig","context_page_description":"Der Gasteig in München ist eines der größten Kulturzentren Europas. Er umfasst den großen Konzertsaal Philharmonie mit 2.572 Sitzplätzen, zahlreiche Veranstaltungsräumlichkeiten und den Sitz der Münchner Philharmoniker, der Münchner Volkshochschule, der Münchner Stadtbibliothek und der Hochschule für Musik und Theater München.\\nDer Gasteig liegt am östlichen Hochufer der Isar in Sichtweite zum Deutschen Museum und Müllerschen Volksbad am S-Bahnhof Rosenheimer Platz, im Stadtteil Haidhausen.\\nDer Bau wurde ab 1978 nach Plänen der Architektengemeinschaft Raue, Rollenhagen, Lindemann und Grossmann erbaut und 1984/85 eröffnet. Im Gebäudekomplex befinden sich auf 23.000 m² Fläche unter anderem der Konzertsaal der Münchner Philharmoniker, die Stadtbibliothek und die Volkshochschule. Die Einrichtungen haben täglich mehrere tausend Nutzer; die Veranstaltungen werden von 750.000 Menschen jährlich besucht. Wegen andauernder Kritik an Räumlichkeiten und Akustik stimmte der Münchner Stadtrat im April 2017 einer Generalsanierung zu. Das Gebäude wird von der Gasteig München GmbH verwaltet, die eine 100%ige Beteiligungsgesellschaft der Landeshauptstadt München ist."},{"page_url":"https://de.wikipedia.org/wiki/Opuntia_cochenillifera","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Starr_031108-0183_Opuntia_cochenillifera.jpg","page_title":"Opuntia cochenillifera","context_page_description":"Opuntia cochenillifera ist eine Pflanzenart in der Gattung der Opuntien aus der Familie der Kakteengewächse. Das Artepitheton cochenillifera bedeutet ‚Scharlach- oder Nopal-Schildlaus tragend‘."},{"page_url":"https://it.wikipedia.org/wiki/Isole_Kerguelen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Kerguelen_-_Manchots.jpg","page_title":"Isole Kerguelen","context_page_description":"Le Isole Kerguelen sono un arcipelago dell'Oceano Indiano meridionale. Appartengono alla Francia e costituiscono uno dei cinque distretti delle Terre australi e antartiche francesi con le Isole Crozet, le isole Saint Paul e Amsterdam, le isole sparse nell'Oceano Indiano, e la Terra Adelia, rivendicata dalla Francia nel continente antartico."},{"page_url":"https://eu.wikipedia.org/wiki/Enonteki%C3%B6","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/Lappland_Lapin_Enonteki%C3%B6_Saana_Kilpisj%C3%A4rvi.jpg","page_title":"Enontekiö","context_page_description":"Eanodat edo Enontekiö Finlandia iparraldeko Lappi eskualdean dagoen udalerria da; zehazki, Finlandia, Norvegia eta Suedia herrialdeen arteko muga hirukoitzean dago, mendien ugaritasunagatik Tunturi Lappi deitzen den lurraldean. Utsjoki eta Inari ondoren, Europar Batasunean iparren dagoen udalerria da eta, hauekin eta Sodankylä udalerriarekin batera, Finlandiako Samien Lurraldea osatzen du. Enontekiök 1.900 bizilagun inguru ditu 8.391,35 km²-ko azaleran, eta horregatik, biztanle dentsitate txikiena duen herrialdeko bigarren udalerria da. Azken urteotan, gainera, biztanleria gutxinaka jaisten ari da, batik bat Rovaniemi hirira lan bila doazen herritarrek bultzatuta. Bestetik, nabarmentzekoa da azalera guztiaren %80 baino gehiago babestutako eremuek osatzen dutela; hauen artean, aipatzekoak dira Käsivarsiko Eremu Basatia, Mallako Natura Erreserba Hertsia eta, batez ere, Pallas-Yllästunturiko Parke Nazionala.\\nHizkuntza ofizialak finlandiera eta ipar samiera dira eta herritar gehienak elebidunak badira ere, hizkuntza nagusia lehenengoa da, ipar samiera jatorrizko hizkuntza duten herritarrak ez baitira berrehunera ere iristen."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A7%D9%88%D8%B1%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/Uren_Lenin_street.jpg","page_title":"اورن","context_page_description":"اورن روسیه اؤلکه‌سینده یئر آلان بیر شهردیر و نیژنی نووقورود اوبلاستینده یئرلشیب. ۲۰۱۰-جی ایلین نۆفوس ساییمی اساسیندا ۱۲۳۰۴ نفر دیر."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%A1%D6%80%D5%A1%D5%B2%D5%A1%D5%B5%D5%AB_%D5%AF%D5%B8%D5%BF%D5%B8%D6%80%D5%A1%D5%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Nor_Maragha006.JPG","page_title":"Մարաղայի կոտորած","context_page_description":"Մարաղայի կոտորած, կոտորած է, որ իրականացրել են ադրբեջանական զինված ուժերը 1992 թվականի ապրիլի 10-ին Լեռնային Ղարաբաղի Մարտակերտի շրջանի Մարաղա գյուղում։ Զոհվել է մոտ հինգ տասնյակ հայ բնակիչ:"},{"page_url":"https://es.wikipedia.org/wiki/Dicaeum_concolor","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Dicaeum_concolor.jpg","page_title":"Dicaeum concolor","context_page_description":"El picaflores de los Nilgiri es una especie de ave paseriforme de la familia Dicaeidae endémico del suroeste de la India.​\\n​ Anteriormente se consideraba conespecífico del picaflores sencillo."},{"page_url":"https://af.wikipedia.org/wiki/Breekwater-vuurtoring,_Kaapstadse_Hawe","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Cape_Town_Breakwater_Light.JPG","page_title":"Breekwater-vuurtoring, Kaapstadse Hawe","context_page_description":"Die Breekwater-vuurtoring by die Kaapstadse Hawe is 'n 10 meter hoë vierkantige tralietoring met 'n fokale vlak van 13 meter. Die toring was eers groen met 'n wit lanterndak, maar nou is die hele toring groen geverf. Die toring is geleë aan die punt van die breekwater, teen die noordwestekant van die hawe, en verskaf 'n groen flits elke 10 sekondes."},{"page_url":"https://lmo.wikipedia.org/wiki/Maurizio_Malvestiti","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/BISHOP_Malvestiti_Lodi_02.jpg","page_title":"Maurizio Malvestiti","context_page_description":"Maurizio Malvestiti l'è el vesc de Lod dal 26 d'agùst 2014."},{"page_url":"https://fr.wikipedia.org/wiki/Anna_Van_Ghell","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Anna_Van_Ghell.jpg","page_title":"Anna Van Ghell","context_page_description":"Céline Anna Van Ghell dite Anna Vanghel ou Vanghell en France, est une artiste lyrique belge."},{"page_url":"https://pl.wikipedia.org/wiki/World_Waterpark","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/The_World_Waterpark_-_Edmonton.jpg","page_title":"World Waterpark","context_page_description":"World Waterpark – aquapark, powszechnie uważany za pierwszy oraz jeden z największych na świecie. Położony jest na terenie centrum handlowego West Edmonton Mall w Edmonton. Posiada 23 zjeżdżalnie, najwyższe o wysokości 25 m.\\nAquapark posiada największy na świecie kryty basen z falami, o objętości 12,3 mln l wody."},{"page_url":"https://en.wikipedia.org/wiki/Germany%E2%80%93Turkey_relations","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/2364246_%C4%B0smet_Y%C4%B1lmaz_und_Ursula_von_der_Leyen_im_Januar_2016.jpg","page_title":"Germany–Turkey relations","context_page_description":"German–Turkish relations have their beginnings in the times of the Ottoman Empire and have culminated in the development of strong bonds with many facets that include economic, military, cultural and social relations. With Turkey as a candidate for the European Union, of which Germany is the 2nd biggest member, and the existence of a huge Turkish diaspora in Germany, these relations have become more and more intertwined over the decades. Relations with Turkey significantly deteriorated after the 2016–17 Turkish purges including the arrest of journalists such as Die Welt's Deniz Yücel."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%A7%E9%98%AA%E5%BA%9C%E7%AB%8B%E5%A4%A7%E5%AD%A6%E5%86%9C%E4%B8%9A%E7%9F%AD%E6%9C%9F%E5%A4%A7%E5%AD%A6%E9%83%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Osakafuritsu_Nogei_Kotogakko.jpg","page_title":"大阪府立大学农业短期大学部","context_page_description":"大阪府立大学农业短期大学部，简称农短，是过去一所位于日本大阪府南河内郡美原町即现在的堺市美原区的公立短期大学。"},{"page_url":"https://de.wikipedia.org/wiki/Wilhelm_B%C3%B6lsche_(Schriftsteller)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Athenaeum_k%C3%B6nyvt%C3%A1r.png","page_title":"Wilhelm Bölsche (Schriftsteller)","context_page_description":"Wilhelm Karl Eduard Bölsche war ein deutscher Schriftsteller."},{"page_url":"https://es.wikipedia.org/wiki/Montgazin","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Map_commune_FR_insee_code_31379.png","page_title":"Montgazin","context_page_description":"Montgazin es una población y comuna francesa, en la región de Mediodía-Pirineos, departamento de Alto Garona, en el distrito de Muret y cantón de Carbonne."},{"page_url":"https://hu.wikipedia.org/wiki/Tachov","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Tachov1.jpg","page_title":"Tachov","context_page_description":"Tachov kisváros Csehországban, a Plzeňi kerületben."},{"page_url":"https://cs.wikipedia.org/wiki/Zbojn%C3%ADcke_ples%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Zbojnickie_Stawy.jpg","page_title":"Zbojnícke plesá","context_page_description":"Zbojnícke plesá je soustava šesti ples ve Vysokých Tatrách, nacházející se u Zbojnické chaty v nadmořské výši okolo 1 960 m."},{"page_url":"https://pt.wikipedia.org/wiki/Feminismo_radical","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Woman-power-logo.png","page_title":"Feminismo radical","context_page_description":"O feminismo radical é uma perspectiva dentro do feminismo que propõe um reordenamento radical da sociedade em que a supremacia masculina é eliminada em todos os contextos sociais e econômicos. As feministas radicais procuram abolir o patriarcado ao desafiar normas e instituições sociais existentes, em vez de através de um processo puramente político. Isso inclui desafiar a noção de papéis tradicionais de gênero, opondo-se a objetificação sexual das mulheres e procurar sensibilizar a opinião pública sobre o estupro e a violência contra as mulheres.\\nO feminismo radical surgiu dentro da Segunda onda do feminismo na década de 1960, e considerava o patriarcado como um \\"fenômeno trans-histórico\\" anterior ou ainda mais profundo do que outras fontes de opressão e \\"não só a forma mais antiga e universal de dominação, mas a principal forma de dominação\\" e o modelo de todas as outras dominações. As políticas posteriores derivadas do feminismo radical variavam desde o feminismo cultural até políticas mais sincréticas que colocavam questões de classe, economia, etc em igualdade com o patriarcado como origens da opressão."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturg%C3%BCter_in_Biel-Benken","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/B-Benken-Muehle.jpg","page_title":"Liste der Kulturgüter in Biel-Benken","context_page_description":"Die Liste der Kulturgüter in Biel-Benken enthält alle Objekte in der Gemeinde Biel-Benken im Kanton Basel-Landschaft, die gemäss der Haager Konvention zum Schutz von Kulturgut bei bewaffneten Konflikten, dem Bundesgesetz vom 20. Juni 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten sowie der Verordnung vom 29. Oktober 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten unter Schutz stehen.\\nObjekte der Kategorie A sind im Gemeindegebiet nicht ausgewiesen, Objekte der Kategorie B sind vollständig in der Liste enthalten, Objekte der Kategorie C fehlen zurzeit."},{"page_url":"https://es.wikipedia.org/wiki/Municipio_de_Wolf_(condado_de_Lycoming,_Pensilvania)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2f/Map_of_Lycoming_County_Pennsylvania_Highlighting_Wolf_Township.png","page_title":"Municipio de Wolf (condado de Lycoming, Pensilvania)","context_page_description":"El municipio de Wolf es un municipio ubicado en el condado de Lycoming en el estado estadounidense de Pensilvania. En el año 2000 tenía una población de 2.707 habitantes y una densidad poblacional de 53.4 personas por km².​"},{"page_url":"https://de.wikipedia.org/wiki/Taifun_Tokage","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b3/Tokage_2004_track.png","page_title":"Taifun Tokage","context_page_description":"Taifun Tokage war ein Taifun, der am 20. und 21. Oktober 2004 über Japan hinwegzog und eine Spur der Verwüstung hinterließ. Er war der stärkste tropische Wirbelsturm im nordwestlichen Pazifischen Ozean seit Taifun Tip. Seinen tiefsten Luftdruck erreichte er bei 940 hPa.\\nDieser tropische Wirbelsturm war der 23. Taifun des Jahres 2004 und traf direkt die japanischen Inseln. Besonders betroffen war die Hauptinsel Honshū mit der Präfektur Kyōto. Tokage richtete Schäden in Höhe von über fünf Milliarden Euro an. 99 Tote, 704 Verletzte und drei Vermisste gingen auf sein Konto."},{"page_url":"https://en.wikipedia.org/wiki/Acacia_hyaloneura","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Acacia_hyaloneuraDistMap447.png","page_title":"Acacia hyaloneura","context_page_description":"Acacia hyaloneura is a shrub or tree belonging to the genus Acacia and the subgenus Juliflorae that is native to north eastern Australia."},{"page_url":"https://en.wikipedia.org/wiki/Taiwan_barbet","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Taiwan_Barbet.jpg","page_title":"Taiwan barbet","context_page_description":"The Taiwan barbet is a species of bird endemic to the country of Taiwan."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%99%D7%97%D7%95%D7%93_%D7%93%D7%A8%D7%95%D7%9D_%D7%90%D7%A4%D7%A8%D7%99%D7%A7%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Lange_diercke_sachsen_afrika_ehemalige_schutzgebiete_suedwestafrika.jpg","page_title":"איחוד דרום אפריקה","context_page_description":"איחוד דרום אפריקה הייתה מדינה עצמאית שהתקיימה במהלך המאה ה-20 בשטחי דרום אפריקה של ימינו. היא היוותה איחוד של ארבע מושבות בריטיות לשעבר: מושבת הכף, מושבת טרנסוואל, מושבת נהר האורנג' ומושבת נטאל. איחוד דרום אפריקה הייתה אחת מממלכות חבר העמים הבריטי, ורשמית הייתה כפופה למלך בריטניה היושב בלונדון. בשנת 1961, לאחר משאל עם בנושא הפכה דרום אפריקה לרפובליקה, והחל מאותה העת ועד ימינו מתקיימת הרפובליקה של דרום אפריקה. עם זאת, דרום אפריקה בתקופת האפרטהייד שימרה מאפיינים רבים מתקופת האיחוד, והרפובליקה של ימינו הוקמה למעשה בתצורתה הנוכחית רק בשנת 1994, עם ביטול האפרטהייד."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B9%9D%E9%BE%8D%E5%B7%B4%E5%A3%AB73B%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/ATENU1351_KMB_73B_21-09-2018.jpg","page_title":"九龍巴士73B線","context_page_description":"九龍巴士73B線是一條香港巴士路線，循環來往大埔那打素醫院及上水站，途經大埔中心、太和、祥華邨、聯和墟及天平邨，到達上水後直接取道粉嶺公路折返太和，於每天日間離峰時段提供北區直達大埔中心和那打素醫院之服務。"},{"page_url":"https://es.wikipedia.org/wiki/Ada_Thilen","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Ada_Thilen_-_Small_Chores.jpg","page_title":"Ada Thilen","context_page_description":"Ada Maria Thilen fue una pintora finlandesa conocida por sus paisajes."},{"page_url":"https://sv.wikipedia.org/wiki/Hermann_Dessau","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Hermann_Dessau.jpg","page_title":"Hermann Dessau","context_page_description":"Hermann Dessau, född 6 april 1856 i Frankfurt am Main, död 12 april 1931 i Berlin, var en tysk klassisk filolog.\\nDessau var tjänsteman vid Akademie der Wissenschaften i Berlin 1900–22 och professor vid universitetet där. Han ägnade sig främst åt latinska inskrifter, och medverkade i Corpus Inscriptionum Latinarum och Prosopographia Imperii Romani. Dessau utgav Inscriptiones Latinæ Selectæ och Geschichte der römischen Kaiserzeit."},{"page_url":"https://lv.wikipedia.org/wiki/Enkurs","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Radeffekt_Sog.png","page_title":"Enkurs","context_page_description":"Enkurs ir daļa no enkura ierīces. Tas ir kā saite enkurķēdei ar grunti, tā nodrošinot kuģa stāvēšanu uz enkura, kā arī tā atdošanu un pacelšanu. Enkuru masa un to daudzums atkarīgs no kuģa tipa, garuma, platuma, borta augstuma un tā kuģošanas rajona, un to nosaka Kuģu klasifikācijas un uzraudzības inspekcija. Jūras kuģi apgādāti ar diviem darba un vienu rezerves enkuru, kuriem ir vienāda masa un tips, kā arī ar vairākiem palīgenkuriem. Lielākais no palīgenkuriem ir stopenkurs, kura masa veido trešdaļu no darba enkura masas.\\nDarba enkurus izmanto, lai noliktu kuģi uz enkura, bet palīgenkurus - lai noņemtu kuģi no sēkļa vai lai kopā ar darba enkuriem noturētu kuģi noteiktā stāvoklī pret vēju, piemēram, kravas operācijās reidā, lai samazinātu viļņošanos vienā borta pusē.\\nKuģim aizliegts iziet jūrā, ja enkurklīzēs trūkst kaut viena darba enkura."},{"page_url":"https://de.wikipedia.org/wiki/Drusen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Drooz_EA143.jpg","page_title":"Drusen","context_page_description":"Die Drusen sind eine arabischsprachige Religionsgemeinschaft im Nahen Osten, die im frühen 11. Jahrhundert in Ägypten als Abspaltung der ismailitischen Schia entstand. Angehörige dieser Gemeinschaft leben heute vor allem in Syrien, im Libanon, in Israel sowie in sehr geringer Zahl auch in Jordanien.\\nDas Drusentum wird offiziell meist Madhhab at-Tauhīd genannt."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E9%B1%B7%E5%BD%A2%E8%B6%85%E7%9B%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Protosuchus_BW.jpg","page_title":"鱷形超目","context_page_description":"鳄形超目是群重要的主龙类演化支，包括鳄鱼与它们的已灭绝近亲。\\n在中生代与第三纪早期期间，鳄形超目远比现代鳄鱼还要多样化。三叠纪时期的物种是小型、轻型、活跃的陆生动物。它们在侏罗纪早期演变成多样性的水生与海生爬行动物。在侏罗纪晚期、白垩纪、第三纪，鳄形超目演化成更多样性的陆生与半水生支系。现代鳄鱼出现于晚白垩纪。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Pforzheim-Eutingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Wappen_PF-Eutingen.svg","page_title":"Liste der Kulturdenkmale in Pforzheim-Eutingen","context_page_description":"In der Liste der Kulturdenkmale in Pforzheim-Eutingen werden alle unbeweglichen Bau- und Kunstdenkmale in Eutingen an der Enz aufgelistet, die in der städtischen „Liste der Kulturdenkmale“ geführt sind."},{"page_url":"https://de.wikipedia.org/wiki/Fahrkartenautomat","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/DR_Fahrkartenautomat._Deutsche_Reichsbahn_ticket_issuing_machine%2C_July_1993_Leipzig-2.jpg","page_title":"Fahrkartenautomat","context_page_description":"Fahrkartenautomaten, Fahrscheinautomaten oder schweizerisch Billettautomaten sind Selbstbedienungsautomaten und werden sowohl im öffentlichen Personenverkehr, insbesondere bei S-, U- und Stadtbahnen, als auch bei Eisenbahngesellschaften zum Verkauf von Fahrscheinen und gegebenenfalls Bahnsteigkarten eingesetzt. Moderne Fahrkartenautomaten erlauben im Regelfall die Zahlung mit Münzen oder mit Geldscheinen sowie häufig mit GeldKarte, Kreditkarte oder Debitkarte. Prinzipiell wird zwischen stationären Automaten an den Haltestellen und mobilen Automaten in den Fahrzeugen unterschieden."},{"page_url":"https://es.wikipedia.org/wiki/The_Blind_Man","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/The_Blind_Man%2C_issue_1%2C_April_1917.jpg","page_title":"The Blind Man","context_page_description":"The Blind Man fue una revista artística publicada en Nueva York en 1917."},{"page_url":"https://eu.wikipedia.org/wiki/Abenduaren_25","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Humphrey_Bogart_1945.JPG","page_title":"Abenduaren 25","context_page_description":"Abenduaren 25a gregoriotar egutegiaren urteko hirurehun eta berrogeita hemeretzigarren eguna da, 360.a bisurteetan. 6 egun falta dira urtea amaitzeko."},{"page_url":"https://en.wikipedia.org/wiki/FeesMustFall","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Second_day_of_the_FeesMustFall_protests_at_the_University_of_Cape_Town_04.JPG","page_title":"FeesMustFall","context_page_description":"#FeesMustFall was a student-led protest movement that began in mid-October 2015 in South Africa. The goals of the movement were to stop increases in student fees as well as to increase government funding of universities. The movements were started and led by the SRC leader of the University of Witwatersrand of 2015, Shaeera Kalla. On 2 October Kalla attended her last council meeting as SRC president, she is accompanied by Nompendulo as an observer heading towards being the incoming SRC President of 2016. Protests started at the University of Witwatersrand and spread to the University of Cape Town and Rhodes University before rapidly spreading to other universities across the country.\\nThe 2015 protest ended when it was announced by the South African government that there would be no tuition fee increases for 2016. The protest in 2016 began when the South African Minister of Higher Education announced that there would be fee increases capped at 8% for 2017; however, each institution was given the freedom to decide by how much their tuition would increase."},{"page_url":"https://simple.wikipedia.org/wiki/National_symbols_of_India","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/2005-malabar-parkeet-p.jpg","page_title":"National symbols of India","context_page_description":"The modern Republic of India; has several official National symbols including a historical document, a flag, an emblem, an anthem, a memorial tower as well as several national heroes. All the symbols were picked up at various times. The design of the national flag was officially adopted by the Constituent Assembly just 21 days before Independence, on the 24th of July in 1947. There are also several other patriotic symbols including the national animal, bird, fruit, flower and tree... have all been selected carefully to project the image of India at its best. They are chosen to reflect Indian culture and beliefs and also the positive at - tributes often associated with Indian traditions respectively."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%89%E9%B6%AF%E4%BA%A4%E6%B5%81%E9%81%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/%E4%B8%89%E9%B6%AF%E4%BA%A4%E6%B5%81%E9%81%93%E5%A4%9C%E6%99%AF%E8%88%87%E9%80%B1%E9%82%8A%E9%81%93%E8%B7%AF.JPG","page_title":"三鶯交流道","context_page_description":"三鶯交流道為台灣國道三號的交流道，位於台灣新北市三峽區，指標為50.0K，為一單葉型交流道，出口銜接市道110號。\\n南向兩出口分為A、B兩個出口，分別為鶯歌50A、三峽50B；北向兩出口分為50A出口，下匝道後往東至三峽區，往西則往鶯歌區、50C出口下匝道後銜接三峽區文化路，並可直接由文化路轉中山路進入三峽老街，紓解復興路長期壅塞情況。"},{"page_url":"https://en.wikipedia.org/wiki/Harrij_Notenboom","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Notenboom%2C_H.C.A.M._-_SFA008007348.jpg","page_title":"Harrij Notenboom","context_page_description":"Henricus Antonius Cornelis Marie \\"Harrij\\" Notenboom is a Dutch retired politician. He served as member of the House of Representatives from 1963 to 1979 and in the European Parliament from 1971 to 1984. Notenboom was a member of the Catholic People's Party and later the Christian Democratic Appeal when the former had merged into it in 1980.\\nAs financial specialist of the Catholic People's Party he was influential in the Nacht van Schmelzer, which led to the fall of the Cals cabinet. Notenboom criticized the budget as proposed by Cals."},{"page_url":"https://en.wikipedia.org/wiki/Desert_Tech_SRS","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/13/SRS_338.jpg","page_title":"Desert Tech SRS","context_page_description":"The Desert Tech Stealth Recon Scout is a bolt-action sniper rifle developed by the Utah-based firearm manufacturer Desert Tech. It was unveiled at the 2008 SHOT Show. It is known for its bullpup design.\\nA shorter variant of the SRS, called the SRS Covert, shares all the same features of the SRS, but uses shorter barrels and therefore a shorter handguard."},{"page_url":"https://en.wikipedia.org/wiki/New_England_Tablelands_(biogeographic_region)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Point_Lookout%2C_New_England.jpg","page_title":"New England Tablelands (biogeographic region)","context_page_description":"New England Tablelands, an interim Australian bioregion, is located mainly in New South Wales, comprising 3,002,213 hectares, of which 2,860,758 hectares or 95.23 per cent of the bioregion lies within New South Wales; and the residual within Queensland. This bioregion is one of the smaller bioregions in NSW, occupying 3.57 per cent of the state.\\nThe New England Tableland Bioregion is a stepped plateau of hills and plains with elevations between 600 and 1,500 metres on Permian sedimentary rocks, intrusive granites and extensive Tertiary basalts. Rainfall varies considerably from 653 to 1,765 millimetres and mean temperatures range from −3 to 17 °C, based on changes with topography. In terms of plants, the region is dominated by stringy bark/box/peppermint species, including Eucalyptus caliginosa, E. nova-anglica, E. melliodora and E. blakelyi."},{"page_url":"https://id.wikipedia.org/wiki/Pablo_Ib%C3%A1%C3%B1ez","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Pablo_Ib%C3%A1%C3%B1ez.jpg","page_title":"Pablo Ibáñez","context_page_description":"Pablo Ibáñez Tébar adalah seorang pemain sepak bola asal Spanyol yang saat ini tidak memiliki klub terakhir bermain untuk Birmingham City pada posisi bek tengah.\\nIbáñez memulai karier sebagai pemain sepak bola profesional di Albacete. Ia berhasil membawa Albacete promosi ke La Liga pada tahun 2003. Pada tahun 2004, Ibáñez bergabung ke Atlético Madrid. Selama enam musim dengan Atlético, ia membuat hampir 200 kali penampilan. Ia kemudian pindah ke Inggris untuk bergabung ke West Bromwich Albion pada tahun 2010, sebelum bergabung ke Birmingham City pada tahun 2011.\\nIbáñez memperkuat tim nasional senior Spanyol dari tahun 2004 hingga 2008. Ia termasuk dalam skuat Spanyol pada Piala Dunia FIFA 2006."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Eintr%C3%A4ge_im_National_Register_of_Historic_Places_im_San_Jacinto_County","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/San_jacinto_tx_county_courthouse_2014.jpg","page_title":"Liste der Einträge im National Register of Historic Places im San Jacinto County","context_page_description":"Die Liste der Registered Historic Places im San Jacinto County führt alle Bauwerke und historischen Stätten im texanischen San Jacinto County auf, die in das National Register of Historic Places aufgenommen wurden."},{"page_url":"https://en.wikipedia.org/wiki/Pierre-Antoine_Lebrun","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Pierre-Antoine_Lebrun.jpg","page_title":"Pierre-Antoine Lebrun","context_page_description":"Pierre-Antoine Lebrun was a French poet."},{"page_url":"https://en.wikipedia.org/wiki/Kisco_River","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Kisco_River_Stream_Shot.jpg","page_title":"Kisco River","context_page_description":"The Kisco River is a creek that runs through the Mount Kisco, New York area. It is formed by the forks of Chappaqua Brook and an unnamed stream. It follows a 3.3-mile winding course before emptying into the New Croton Reservoir at Lake Road Bridge in the town of New Castle near the hamlet of Stanwood and eventually into the Atlantic Ocean via the Croton River, the Hudson River, and New York Harbor.\\nIts name is derived from the village of Mount Kisco, which the river flows through. The name of Mount Kisco is further derived from \\"seesquee\\", which may also be written as \\"cisqua\\", which is the Algonquin word for \\"muddy place\\", referring to the marshlands in the area."},{"page_url":"https://es.wikipedia.org/wiki/Jos%C3%A9_Alonso_y_Trelles","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/62/Jos%C3%A9_Alonso_y_Trelles.jpg","page_title":"José Alonso y Trelles","context_page_description":"José María Alonso y Trelles Jarén, conocido como «El Viejo Pancho», fue un escritor y poeta gauchesco uruguayo de origen español.\\nRadicado en su juventud en la localidad uruguaya de Tala, tuvo a su cargo las publicaciones satíricas El Tala Cómico y Momentáneas. Sus aportes literarios más importantes se dieron en el campo de la lírica, que cultivó en la forma de poesía gauchesca y a la que contribuyó ampliamente a través de los semanarios tradicionalistas El Terruño, El Fogón y El Ombú. En 1915 publicó su obra maestra, Paja brava, en la cual recopiló la mayoría de sus textos del mencionado género. Hacia el final de sus días ocupó una banca como diputado por el departamento de Canelones."},{"page_url":"https://vi.wikipedia.org/wiki/Xe_t%C4%83ng_Centurion","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Centurion-Bridgelayer-latrun-1.jpg","page_title":"Xe tăng Centurion","context_page_description":"Xe tăng Centurion, được giới thiệu năm 1945, là xe tăng chủ lực của quân đội Anh giai đoạn sau Thế chiến thứ hai. Nó được xem là một trong những thiết kế tăng thành công nhất sau chiến tranh, tiếp tục được sản xuất đến những năm 60 và chiến đấu ở mặt trận những năm 80 của thế kỉ 20. Khung gầm xe cũng được sử dụng trong những vai trò khác và vẫn còn phục vụ cho đến ngày nay.\\nViệc phát triển tăng Centurion được bắt đầu từ năm 1943 và việc chế tạo bắt đầu từ tháng 1 năm 1945, 6 nguyên mẫu được gửi đến Bỉ chỉ trước một tháng chiến tranh kết thúc ở châu Âu, tháng 5 năm 1945. Tăng Centurion lần đầu tham chiến cùng quân Anh trong chiến tranh Triều Tiên năm 1950 bên phe Liên Hiệp Quốc. Sau này nó còn tham chiến trong cuộc chiến tranh Ấn Độ - Pakistan năm 1965, nơi mà đối thủ của Centurion là tăng M47 và M48 Patton do Mĩ viện trợ. Trong chiến tranh Việt Nam, Centurion phục vụ cho tập đoàn tăng Hoàng gia Úc.\\nIsrael sử dụng Centurion trong Chiến tranh Sáu ngày năm 1967, Chiến tranh Yom Kippur năm 1973, và trong cuộc xâm lược Lebanon năm 1978 và 1982. Centurion được sửa đổi để biến thành xe chuyên chở nhân viên khi phục vụ ở Gaza, Bờ Tây và biên giới Lebanon."},{"page_url":"https://it.wikipedia.org/wiki/Lingua_ebraica","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Maimonides%2C_at_Rambam_Medical_Center.jpg","page_title":"Lingua ebraica","context_page_description":"Con lingua ebraica si intende sia l'ebraico biblico sia l'ebraico moderno, lingua ufficiale dello Stato di Israele e dell’oblast autonoma ebraica in Russia, che conta circa 7 milioni di locutori; l'ebraico moderno, cresciuto in un contesto sociale e tecnologico molto diverso da quello antico, contiene molti elementi lessicali presi in prestito da altre lingue. L'ebraico è una lingua semitica e quindi parte della stessa famiglia che comprende anche le lingue araba, aramaica, amarica, tigrina, maltese e altre. Per numero di locutori, l'ebraico è la terza lingua di tale ceppo dopo l'arabo e l'amarico."},{"page_url":"https://de.wikipedia.org/wiki/San_Diego_(Venezuela)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Sandiegovenezuela.jpg","page_title":"San Diego (Venezuela)","context_page_description":"San Diego ist eine Stadt im Bundesstaat Carabobo im Norden Venezuelas.\\nSie ist Sitz des gleichnamigen Bezirks. San Diego befindet sich nordwestlich vom Valenciasee und ist, zusammen mit Los Guayos, Naguanagua, Tocuyito und Valencia, Teil des Großraums Valencia."},{"page_url":"https://en.wikipedia.org/wiki/Igel","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a2/Roman_tomb_at_Igel_2011.JPG","page_title":"Igel","context_page_description":"Igel is a municipality in the Trier-Saarburg district, in Rhineland-Palatinate, Germany. Igel is known for the Igel Column, a 23 m high Roman decorated tomb. The Igel Column is a UNESCO World Heritage Site."},{"page_url":"https://en.wikipedia.org/wiki/Joan_Botam","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/El_Pare_Botam_i_l%E2%80%99Associaci%C3%B3_Juvenil_Esquitx%2C_guardonats_a_la_IV_edici%C3%B3_del_Memorial_%C3%80lex_Seglers_%28cropped%29.jpg","page_title":"Joan Botam","context_page_description":"Joan Botam i Casals is a Catalan priest and Capuchin, whose religious name is Fra Salvador de les Borges. When he finished his studies, he worked in the Registry Office and as administrator in the Les Borges Blanques town hall. In 1944 he entered as a novice in the Capuchin Order in Arenys de Mar. In 1955 he got his PhD in Theology in the Pontifical University of Salamanca and in the Pontifical Gregorian University of Rome, and in 1957 he was appointed vice-director of the College of Philosofy and Theology of the Capuchin Friars. In 1952 he became a priest.\\nHe was interested in the Catalan culture, and his work Arnau de Vilanova, moralista received the Jaume Serra i Húnter prize, which is given by the Institute of Catalan Studies. He has also been interested in hiking. In 1963 he was appointed vicar provincial of the Capuchin Friars of Catalonia, and he was at the same time chaplain of the ecumenical institution Pax Christi. From this position, he was engaged in several initiatives that were linked to pacifism and ecumenism."},{"page_url":"https://pt.wikipedia.org/wiki/Sarjeta","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Street_gutter_in_Old_Town_Stockholm.jpg","page_title":"Sarjeta","context_page_description":"Sarjeta ou valeta refere-se ao escoadouro das águas pluviais em estradas, ruas e avenidas que beiram o meio-fio das calçadas. Idealmente, a sarjeta deve estar num nível mais baixo que o leito carroçável para conduzir a água até os bueiros ou bocas-de-lobo."},{"page_url":"https://en.wikipedia.org/wiki/M%C3%A9zi%C3%A8res,_Vaud","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/M%C3%A9zi%C3%A8res_vaud.jpg","page_title":"Mézières, Vaud","context_page_description":"Mézières is a former municipality in the district of Lavaux-Oron in the canton of Vaud in Switzerland. On 1 July 2016, the former municipalities of Mézières, Carrouge, and Ferlens merged into the new municipality of Jorat-Mézières."},{"page_url":"https://az.wikipedia.org/wiki/%C4%B0ran_az%C9%99rbaycanl%C4%B1lar%C4%B1n%C4%B1n_siyah%C4%B1s%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Mirkarimi2.JPG","page_title":"İran azərbaycanlılarının siyahısı","context_page_description":"İran azərbaycanlıları və ya cənubi azərbaycanlılar — İran Azərbaycanında yaşayan və ya əslən İran Azərbaycanından olan azərbaycanlılar. İran azərbaycanlılarının sayı müxtəlif mənbələrə görə 15 - 22 milyondur. Bu isə İran əhalisinin 18% - 30%-ni təşkil edir.\\nAzərbaycanlılar əsasən İranın şimalında, qərbində və şərqində yaşayırlar, aborigen xalqdır və əhalinin əsas hissəsini təşkil edirlər. Ərdəbil, Urmiya, Təbriz, Zəncan ostanlarında əhalinin əsas hissəsidirlər.\\nBütünlükdə isə farslardan sonra İranda yaşayan xalqlar içində sayca ən çoxdurlar.\\nŞərqi Azərbaycan ostanı: 3,750,000\\nQərbi Azərbaycan ostanı: 3,062,000\\nƏrdəbil ostanı: 1,262,000\\nZəncan ostanı: 1,000,000\\nQəzvin ostanı: 1,230,000\\nƏlburz ostanı: 2,325,000\\nHəmədan ostanı: 1,726,000\\nTehran ostanı: 12,700,000\\nGilan ostanı: 2,490,000\\nMərkəzi ostanı: 1,413,000\\n10 əyalətin toplam əhali sayı: 30,958,000\\n10 əyalətin toplam azərbaycanlı əhali sayı: 22,000,000"},{"page_url":"https://vi.wikipedia.org/wiki/Diego_Schwartzman","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Schwartzman_WM16_%2813%29_%2827801639234%29.jpg","page_title":"Diego Schwartzman","context_page_description":"Diego Sebastián Schwartzman là một vận động viên quần vợt người Argentina chơi ở ATP Tour. Anh vô địch 2 danh hiệu đơn ATP, và đạt được vị trí cao nhất trong sự nghiệp của anh là vị trí số 11 vào ngày 11 tháng 6 năm 2018. Anh sở trường mặt sân đất nện, và đó là thành tích tốt nhất của anh."},{"page_url":"https://fr.wikipedia.org/wiki/Phare_de_Racine_Reef","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Racinereef.JPG","page_title":"Phare de Racine Reef","context_page_description":"Le phare de Racine Reef, est un phare du lac Michigan situé à environ 3 km à l'est du port de Racine dans le Comté de Racine, Wisconsin. Il a été démoli en 1961 et remplacé par une tourelle à claire-voie sur la même fondation."},{"page_url":"https://en.wikipedia.org/wiki/Franklin_D._Roosevelt","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/ElectoralCollege1932.svg","page_title":"Franklin D. Roosevelt","context_page_description":"Franklin Delano Roosevelt, often referred to by his initials FDR, was an American politician who served as the 32nd President of the United States from 1933 until his death in 1945. A member of the Democratic Party, he won a record four presidential elections and became a central figure in world events during the first half of the 20th century. Roosevelt directed the federal government during most of the Great Depression, implementing his New Deal domestic agenda in response to the worst economic crisis in U.S. history. As a dominant leader of his party, he built the New Deal Coalition, which realigned American politics into the Fifth Party System and defined modern liberalism in the United States throughout the middle third of the 20th century. His third and fourth terms were dominated by World War II, which ended shortly after he died in office.\\nRoosevelt was born in Hyde Park, New York, to the Roosevelt family made well known by the reputation of Theodore Roosevelt, the 26th president of the United States, as well as businessman William Henry Aspinwall."},{"page_url":"https://ru.wikipedia.org/wiki/Cygnus_CRS_OA-7","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Cygnus_CRS_OA-7_in_Kennedy_PHSF_%28KSC-20170224-PH_KLS01_0043%29.jpg","page_title":"Cygnus CRS OA-7","context_page_description":"Cygnus CRS OA-7 — седьмая миссия грузового космического корабля снабжения Cygnus компании Orbital ATK к Международной космической станции по контракту Commercial Resupply Services с NASA.\\nКораблю дано имя S.S. John Glenn — в честь Джона Гленна, первого астронавта США, совершившего орбитальный космический полёт."},{"page_url":"https://da.wikipedia.org/wiki/Gemma_Gili","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/2019-05-18_Fu%C3%9Fball%2C_Frauen%2C_UEFA_Women%27s_Champions_League%2C_Olympique_Lyonnais_-_FC_Barcelona_StP_0059_LR10_by_Stepro_%28cropped%29.jpg","page_title":"Gemma Gili","context_page_description":"Gemma Gili er en spansk fodboldspiller, der spiller som midtbane for FC Barcelona i Primera División og Spaniens kvindefodboldlandshold. Hun har tidligere spillet for Valencia CF Femenino."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D9%8A%D9%83%D8%A7_%D8%B3%D8%A7%D9%84%D9%88%D9%85%D8%A7%D9%83%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Miika_Salomaki.jpg","page_title":"ميكا سالوماكى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nميكا سالوماكى لاعب هوكى الجليد من فينلاندا."},{"page_url":"https://ca.wikipedia.org/wiki/Stanis%C5%82aw_Le%C5%9Bniewski","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Stanis%C5%82aw_Le%C5%9Bniewski.jpg","page_title":"Stanisław Leśniewski","context_page_description":"Stanisław Leśniewski va ser un matemàtic i lògic polonès, que va desenvolupar un sistema lògic poc ortodox que, malgrat el seu poc èxit, va influir en les corrents contemporànies de la lògica."},{"page_url":"https://eu.wikipedia.org/wiki/Monasa_atra","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Monasa_atra_-_Black_nunbird.JPG","page_title":"Monasa atra","context_page_description":"Monasa atra Monasa generoko animalia da. Hegaztien barruko Bucconidae familian sailkatua dago."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%95%D0%B1%D0%B5_%D0%9A%D0%B0%D0%BC%D0%B0%D1%80%D0%B3%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Hebe_Camargo_3.jpg","page_title":"Ебе Камарго","context_page_description":"Ебе Марија Камарго — бразилска глумица, водителка и пејачка."},{"page_url":"https://nl.wikipedia.org/wiki/Bank_Du_Jardin","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Poort_Bank_Dujardin_-_Garenmarkt_-_Brugge.jpg","page_title":"Bank Du Jardin","context_page_description":"De Bank Du Jardin was een bank in de Belgische stad Brugge. Ze dankt haar blijvende bekendheid onder meer aan haar faillissement in 1874. De bank verzamelde spaargelden uit de hele provincie en herbelegde die in landbouwgronden en in eigen industriële projecten. Zij financierde ook andere bedrijven en grote openbare werken, meestal in de eigen regio, maar ook in Frankrijk."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%9D%92%E9%B1%BC%E5%98%B4%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Qingyuzui_Station_Sign.jpg","page_title":"青鱼嘴站","context_page_description":"青魚嘴站是武漢地鐵4號線一座車站，位於武漢市武昌區。"},{"page_url":"https://en.wikipedia.org/wiki/29P/Schwassmann%E2%80%93Wachmann","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/29P_Schwassmann_Wachmann.jpg","page_title":"29P/Schwassmann–Wachmann","context_page_description":"Comet 29P/Schwassmann–Wachmann, also known as Schwassmann–Wachmann 1, was discovered on November 15, 1927, by Arnold Schwassmann and Arno Arthur Wachmann at the Hamburg Observatory in Bergedorf, Germany. It was discovered photographically, when the comet was in outburst and the magnitude was about 13. Precovery images of the comet from March 4, 1902, were found in 1931 and showed the comet at 12th magnitude.\\nThe comet is unusual in that while normally hovering at around 16th magnitude, it suddenly undergoes an outburst. This causes the comet to brighten by 1 to 5 magnitudes. This happens with a frequency of 7.3 outbursts per year, fading within a week or two. The magnitude of the comet has been known to vary from 18th magnitude to 10th magnitude, a more than thousand-fold increase in brightness, during its brightest outbursts. Outbursts are very sudden, rising to maximum in about 2 hours, which is indicative of their cryovolcanic origin; and with the times of outburst modulated by an underlying 57-day periodicity possibly suggesting that its large nucleus is an extremely slow rotator."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B8%D1%81%D1%82%D0%B5%D1%86%D1%8C%D0%BA%D0%B0_%D0%BA%D0%BE%D0%BF%D1%96%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Lely_Venus_BM_1963.jpg","page_title":"Мистецька копія","context_page_description":"Копія у мистецтві — точне відтворення оригінального твору мистецтва з метою розкриття авторських композиційних засобів, художньої манери та його художньої техніки. Близькою до цих завдань буває і авторська копія з популярного або досить вдалого твору, де автоматично присутні художня манера і використана автором художня техніка."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%A6%8F%E4%BA%95%E7%9C%8C%E9%81%93141%E5%8F%B7%E7%AB%B9%E6%B3%A2%E7%AB%8B%E7%9F%B3%E7%B8%84%E9%96%93%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Fukui_Prefectural_Road_Route_141_001.JPG","page_title":"福井県道141号竹波立石縄間線","context_page_description":"福井県道141号竹波立石縄間線は福井県三方郡美浜町と同県敦賀市を結ぶ一般県道である。別名「敦賀半島周回道路」。"},{"page_url":"https://zh.wikipedia.org/zh-mo/%E5%A5%A7%E5%85%A7%E4%BB%80%E8%92%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Onesti_vazut_din_Hotel_Trotus.jpg","page_title":"奧內什蒂","context_page_description":"奧內什蒂是羅馬尼亞的城市，位於該國西部，距離首府巴克烏60公里，由巴克烏縣負責管轄，始建於1458年12月14日，面積90.17平方公里，海拔高度210米，2007年人口50,820。"},{"page_url":"https://en.wikipedia.org/wiki/Diocese_of_Kotayk","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/ALAPARS_SAINT_HOLY_MOTHER_%D4%B5%D5%AF%D5%A5%D5%B2%D5%A5%D6%81%D5%AB_%D5%8D%D5%A2._%D4%B1%D5%BD%D5%BF%D5%BE%D5%A1%D5%AE%D5%A1%D5%AE%D5%AB%D5%B6_11.JPG","page_title":"Diocese of Kotayk","context_page_description":"Diocese of Kotayk, is a diocese of the Armenian Apostolic Church covering the Kotayk Province of Armenia. The name is derived from the historic Kotayk canton of Ayrarat province of Armenia Major.\\nThe diocese was officially founded on May 30, 1996, upon a kontakion issued by Catholicos Karekin I. The diocesan headquarters are located in the provincial capital Hrazdan, while the cathedral of the diocese is the Kecharis Monastery in the nearby town of Tsaghkadzor."},{"page_url":"https://es.wikipedia.org/wiki/Estandarte_imperial","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Vexilloid_of_the_Roman_Empire.svg","page_title":"Estandarte imperial","context_page_description":"El término estandarte imperial hace referencia al estandarte empleado para indicar la presencia de la persona de un monarca con el título imperial. Aunque frecuentes en el pasado en la actualidad sólo se conserva uno, el estandarte imperial de Japón, que pertenece al único monarca reinante que continúa ostentando el título de emperador."},{"page_url":"https://fi.wikipedia.org/wiki/Georg_Wilhelm_Pabst","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Pabst_Prejean_1931.jpg","page_title":"Georg Wilhelm Pabst","context_page_description":"Georg Wilhelm Pabst oli itävaltalainen elokuvaohjaaja. Pabstin myötä 1920-luvulla realistisesti yhteiskunnallisia teemoja käsittelemään pyrkinyt uusasiallinen suuntaus tuli tunnetuksi saksalaisessa elokuvassa. Pabst kuoli 82-vuotiaana Wienissä."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AA%E3%83%B3%E3%83%BB%E3%82%B6%E3%83%BB%E3%83%AB%E3%83%BC%E3%83%95%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/%D0%A0%D1%83%D1%81%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%BE%D1%81%D1%82_-_Russky_Bridge_%288503356392%29.jpg","page_title":"オン・ザ・ルーフス","context_page_description":"オン・ザ・ルーフスは、ウクライナのヴィタリー・ラスカロフとロシアのヴァディム・マコロフによる2人組のフリークライミングチームおよび写真家集団。世界有数の高層建築物やランドマークを命綱・ハーネス無しで登り、非常に高い場所からの写真撮影を行い、登頂時の動画を記録している。このような活動はロシアの若者の間で人気となった「スカイウォーキング」と呼ばれるもので、ラスカロフとマコロフの2人はその先駆者として位置づけられている。アップロードされた動画作品はネット上で話題を呼ぶバイラル動画となっており、オン・ザ・ルーフスの行動についてはネットユーザからの否定的な声もあるが、アップロードされた動画を賞賛する学術研究者も存在する。"},{"page_url":"https://de.wikipedia.org/wiki/Marine_Le_Pen","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Le_Pen%2C_Marine-9586.jpg","page_title":"Marine Le Pen","context_page_description":"Marine Le Pen ist eine französische Juristin und Politikerin der rechtsextremen Sammlungsbewegung Rassemblement National, die bis Juni 2018 unter dem Namen Front National auftrat. Am 16. Januar 2011 wurde sie die Nachfolgerin ihres Vaters Jean-Marie Le Pen als Vorsitzende des FN. Sie kandidierte bei den französischen Präsidentschaftswahlen der Jahre 2012 und 2017, 2017 gelangte sie in die Stichwahl gegen Emmanuel Macron. Darüber hinaus war sie langzeitige Abgeordnete im Europäischen Parlament, seit Juni 2017 ist sie Abgeordnete der französischen Nationalversammlung."},{"page_url":"https://vi.wikipedia.org/wiki/Grace_Kelly","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Grace_Kelly_Signature.jpg","page_title":"Grace Kelly","context_page_description":"Grace Kelly hay Thân vương phi Grace là nữ minh tinh điện ảnh người Mỹ. Sau này bà trở thành Thân vương phi của Monaco sau khi kết hôn với Thân vương Rainier III của Monaco vào tháng 4 năm 1956.\\nBắt đầu sự nghiệp diễn xuất vào năm 1950, ở tuổi 20, Kelly trong các tác phẩm kịch nghệ tại New York và hơn 40 tập trong các bộ phim truyền hình trực tiếp phát sóng trong \\"Thời đại vàng của truyền hình\\" vào đầu thập niên 50. Tháng 10 năm 1953, bà đã trở thành ngôi sao của bộ phim Mogambo, đã giúp Kelly giành được 1 giải Quả Cầu Vàng và đề cử cho giải Oscar năm 1954. Tiếp đó, Kellly vào vai chính trong 5 phim điện ảnh có The Country Girl, sự thể hiện diễn xuất được tán dương đã giúp Kelly nhận một Giải Oscar cho nữ diễn viên chính xuất sắc nhất. Các phim khác là High Noon đóng cùng Gary Cooper, Dial M for Murder với Ray Milland, Rear Window với James Stewart, To Catch a Thief với Cary Grant và High Society cùng Frank Sinatra và Bing Crosby.\\nKelly từ bỏ sự nghiệp diễn xuất ở tuổi 26 khi nhận lời cầu hôn của Thân vương Rainier và trở thành Thân vương phi Monaco. Cặp đôi có ba con: Caroline - Công chúa xứ Monaco/Vương phi xứ Hanover, Thân vương Albert II và Stéphanie."},{"page_url":"https://en.wikipedia.org/wiki/List_of_monuments_in_Victoria,_Gozo","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Citadella_walk_2016_09.jpg","page_title":"List of monuments in Victoria, Gozo","context_page_description":"This is a list of monuments in Victoria, Gozo, Malta, which are listed on the National Inventory of the Cultural Property of the Maltese Islands."},{"page_url":"https://de.wikipedia.org/wiki/Kubanischer_Milit%C3%A4reinsatz_in_Angola","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Fidelcastro1978.jpg","page_title":"Kubanischer Militäreinsatz in Angola","context_page_description":"Beim kubanischen Militäreinsatz in Angola intervenierte Kuba zwischen Herbst 1975 und Mai 1991 auf Seiten der angolanischen Befreiungsfront Movimento Popular de Libertação de Angola. Dieses Eingreifen war ausschlaggebend dafür, dass sich die MPLA gegenüber den konkurrierenden Befreiungsbewegungen FNLA und UNITA durchsetzte, die erste Regierung des unabhängigen Angola stellte und sich anschließend im angolanischen Bürgerkrieg behauptete.\\nDes Weiteren förderte Kubas Einsatz die Unabhängigkeit Namibias und beschleunigte den Niedergang des Apartheidregimes in Südafrika.\\nDas kubanische Engagement in Angola umfasste neben dem militärischen auch noch einen bedeutenden zivilen Teil."},{"page_url":"https://cs.wikipedia.org/wiki/Honor%C3%A9_de_Balzac","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Hanska_Holz_Sowgen_1825.jpg","page_title":"Honoré de Balzac","context_page_description":"Honoré de Balzac [onoré d balzak], byl francouzský spisovatel, představitel realismu a romantismu. Bývá považován za zakladatele kriticko-realistického románu. Balzacovým magnum opus je cyklus devadesáti pěti románů a povídek pod souborným názvem Lidská komedie. Napsal však i řadu románů s dobrodružnou či fantastickou tematikou, např. Šagrénová kůže, rovněž součást Lidské komedie – v cyklu Filosofických studií."},{"page_url":"https://en.wikipedia.org/wiki/List_of_fossil_species_in_the_London_Clay","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/Exuvia_of_Hoploparia.jpg","page_title":"List of fossil species in the London Clay","context_page_description":"A list of prehistoric and extant species whose fossils have been found in the London Clay, which underlies large areas of southeast England.\\nPlant fossils, especially seeds and fruits, are found in abundance and have been collected from the London Clay for almost 300 years. Some 350 named species of plant have been found, making the London Clay flora one of the world's most diverse for fossil seeds and fruits. The flora includes plant types found today in tropical forests of Asia and demonstrates the much warmer climate of the Eocene epoch, with plants such as Nypa and other palms being frequently encountered. The following plants list is incomplete and is based on the research by Marjorie Chandler. and research works done by the paleobotanist Steven R. Manchester and by professor of plant palaeobiology Margaret Collinson."},{"page_url":"https://en.wikipedia.org/wiki/1961_Ndola_United_Nations_DC-6_crash","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Ndolaflightpath.png","page_title":"1961 Ndola United Nations DC-6 crash","context_page_description":"The Ndola United Nations DC-6 crash occurred on 18 September 1961 in Northern Rhodesia. The crash resulted in the deaths of all people onboard including Dag Hammarskjöld, the second Secretary-General of the United Nations, and 15 others. Hammarskjöld had been en route to cease-fire negotiations with Moise Tshombe during the Congo Crisis. Three official inquiries failed to determine conclusively the cause of the crash, which set off a succession crisis at the United Nations."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%8B%B1%E5%9B%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/British_Empire.svg","page_title":"英国","context_page_description":"大不列顛暨北愛爾蘭聯合王國，國際間的標準簡稱為聯合王國或者不列顛，漢字文化圈通稱「英國」，是本土位於西歐並具有海外領地的主權國家。英國位於歐洲大陸西北面，由大不列顛島、愛爾蘭島東北部分及一系列較小島嶼組成。英國和另一國家唯一的陸上國境線位於北愛爾蘭，和愛爾蘭共和國相鄰。英國由大西洋所環繞，東為北海，南為英吉利海峽，西南偏南為克亞爾特海，與愛爾蘭隔愛爾蘭海相望。該國總面積達243,610平方公里，為世界面積第80大的主權國家及歐洲面積第11大的主權國家，人口約6636萬，為全球第21名及歐洲第3名。\\n英國為君主立憲制國家，採用議會制進行管轄。其首都倫敦為全球城市A++級別城市和國際金融中心，大都會區人口達1380萬，為歐洲第三大。現任英國君主為女王伊莉莎白二世，1952年2月6日即位。英國由四個構成國組成，分別為英格蘭、蘇格蘭、威爾斯和北愛爾蘭，其中後三者在權力下放體系之下，各自擁有一定的權力。三地首府分別為愛丁堡、卡地夫和貝爾法斯特。附近的曼島、耿西行政區及澤西行政區並非聯合王國的一部分，而為皇家属地，英國政府負責其國防及外交事務。\\n英國的構成國之間的關係在歷史上經歷了一系列的發展。英格蘭王國通過1535年和1542年的聯合法令將威爾斯納入領土。1707年聯合法令使英格蘭王國和蘇格蘭王國共組大不列顛王國，1801年大不列顛王國和愛爾蘭王國共組大不列顛及愛爾蘭聯合王國。1922年愛爾蘭中南部26個郡脫離英國組成愛爾蘭自由邦，最終造就了當今的大不列顛暨北愛爾蘭聯合王國。大不列顛暨北愛爾蘭聯合王國亦有14塊海外領地，為往日帝國的遺留部分。大英帝國在1921年達到其巔峰，擁有全球22%的領土，是有史以來面積最大的帝國。英國在語言、文化和法律體系上對其前殖民地保留了一定的影響，因而吸引許多以前大英國協的移民前來居住。\\n英國為已開發國家，以名義GDP為量度是世界第五大經濟體，以購買力平價為量度是世界第九大經濟體。英國是世界首個工業化國家，工業革命使英國人的生產力大大提高，商業與財富極大的增長，更憑藉著工業時代的船堅炮利，1763年—1945年英國為世界第一強國，其鼎盛時期的19世紀還被稱作英國的世紀，當今英國仍是世界強國之一，在經濟、文化、軍事、科技、教育和政治上均有全球性的顯著影響力。英國為國際公認的有核國家，其軍事開支位列全球第五。1945年以來英國即為聯合國安全理事會常任理事國。1973年—2020年英國是歐洲聯盟及其前身歐洲經濟共同體的成員國。英國還是大英國協、歐洲理事會、七國財長峰會、七國集團、二十國集團、北大西洋公約組織、經濟合作與發展組織和世界貿易組織成員國。"},{"page_url":"https://es.wikipedia.org/wiki/Idioma_occitano","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Can%C3%A7%C3%B3_de_Santa_Fe.jpg","page_title":"Idioma occitano","context_page_description":"El occitano o lengua de oc es una lengua romance de Europa. Es hablada por unos dos millones de personas, mientras que diez millones tienen cierta competencia en el idioma, casi todas ellas en el sur de la actual Francia —al sur del río Loira—, así como en Italia —en los Valles Occitanos— y en España —en el Valle de Arán en el Pirineo leridano—. El Estatuto de Autonomía de Cataluña de 2006 estableció la oficialidad de la lengua occitana en toda Cataluña, ​ y fue ratificada mediante la ley aprobada en el Parlamento de Cataluña en 2010, por la que el occitano, en su variante aranesa, se declaró lengua cooficial en Cataluña, aunque de uso preferente en el Valle de Arán.​"},{"page_url":"https://war.wikipedia.org/wiki/Amaurornis_olivacea","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Plain_Bush-hen.jpg","page_title":"Amaurornis olivacea","context_page_description":"Amaurornis olivacea in uska species han Aves nga syahan ginhulagway ni Meyen hadton 1834. An Amaurornis olivacea in nahilalakip ha genus nga Amaurornis, ngan familia nga Rallidae. Ginklasipika han IUCN an species komo diri gud kababarak-an."},{"page_url":"https://lt.wikipedia.org/wiki/Viklou_kalnai","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/IMGTonelageeR756_4975cw.jpg","page_title":"Viklou kalnai","context_page_description":"Viklou kalnai yra kalnynas pietrytinėje Airijos dalyje, Airijos Respublikoje. Ši kalnų grandinė tęsiasi nuo pietinės Dublino grafystės, visa Viklou grafyste ir užsibaigia Veksfordo grafystėje. Kalnai priklausantys, Viklou kalnynui, pasauliniu mastu nėra labai dideli ir neviršyja 1000 m, tačiau Airijoje jie vieni didžiausių. Viklou kalnais teka Sleinis, kurioje pastatyta hidroelektrinė.\\nDėl žvejybos, gražių peizažų ir plaukiojimo upe Viklou slėniai pamėgti turistų.\\nKalnuose įsikūręs Glendalo vienuolynas."},{"page_url":"https://nl.wikipedia.org/wiki/Da-Wen_Sun","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/DA_WEN_SUN.jpg","page_title":"Da-Wen Sun","context_page_description":"Sun Dawen, beter bekend als Da-Wen Sun, is professor in ‘Food and Biosystems Engineering’ aan het University College Dublin."},{"page_url":"https://pl.wikipedia.org/wiki/Kaiane_Aldorino","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Missworld09air.jpg","page_title":"Kaiane Aldorino","context_page_description":"Kaiane Aldorino – specjalistka do spraw zasobów ludzkich, amatorska tancerka, wybrana 12 grudnia 2009 na uroczystej gali w Johannesburgu Miss Świata 2009."},{"page_url":"https://cs.wikipedia.org/wiki/Edward_Joseph_Adams","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/S.E.R._Mons._Edward_Joseph_Adams.JPG","page_title":"Edward Joseph Adams","context_page_description":"Mons. Edward Joseph Adams je americký římskokatolický kněz, arcibiskup a apoštolský nuncius."},{"page_url":"https://hr.wikipedia.org/wiki/Makarska","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Makarska_banner.jpg","page_title":"Makarska","context_page_description":"Makarska je priobalni grad u Splitsko-dalmatinskoj županiji, smješten podno planine Biokovo. Središte je Makarskog primorja, mikroregije koja se proteže od Brela na zapadu do Gradca na istoku. Makarska s gradskim naseljem Veliko Brdo ima 13.834 stanovnika.\\nPovijesno je Makarska značajna kao nekadašnje sjedište Makarske biskupije, a i današnja Splitsko-makarska nadbiskupija nosi makarsko ime u sebi."},{"page_url":"https://de.wikipedia.org/wiki/Meta_Forkel-Liebeskind","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Meta_Forkel-Liebeskind.jpg","page_title":"Meta Forkel-Liebeskind","context_page_description":"Sophie Margarethe „Meta“ Forkel-Liebeskind, geb. Sophie Margarethe Dorothea Wedekind war eine deutsche Schriftstellerin und Übersetzerin."},{"page_url":"https://hu.wikipedia.org/wiki/P%C3%AEtres","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Eglise_P%C3%AEtres3.jpg","page_title":"Pîtres","context_page_description":"Pîtres település Franciaországban, Eure megyében. Pîtres Amfreville-sous-les-Monts, Le Manoir, Poses, Romilly-sur-Andelle, Boos, La Neuville-Chant-d'Oisel és Quévreville-la-Poterie községekkel határos."},{"page_url":"https://fr.wikipedia.org/wiki/Claude_Gay","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Portrait_de_Claude_Gay_%C3%A0_Draguignan.JPG","page_title":"Claude Gay","context_page_description":"Claude Gay, souvent nommé Claudio Gay Mouret dans les textes en espagnol, est un naturaliste et historien français, né le 18 mars 1800 à Draguignan et mort le 29 novembre 1873 au Deffens, près de Flayosc.\\nExplorateur et savant, il a fait les premières études approfondies de la flore, de la faune, de la géologie et de la géographie chiliennes."},{"page_url":"https://pt.wikipedia.org/wiki/Registro_Nacional_de_Lugares_Hist%C3%B3ricos_na_Carolina_do_Norte","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Wilkesboro_NC_Old_Courthouse.jpg","page_title":"Registro Nacional de Lugares Históricos na Carolina do Norte","context_page_description":"Edifícios, locais, distritos e objetos no Registro Nacional de Lugares Históricos na Carolina do Norte. Desde 14 de março de 2014 existem 2 849 propriedades e distritos do Registro Nacional de Lugares Históricos listados nos 100 condados da Carolina do Norte, incluindo os 38 nomeados no Marco Histórico Nacional.\\nO condado de Wake é o que contem a maior quantidade de registros, enquanto os condados de Alexander e Pamlico contem apenas um registro cada um. Os primeiros NRHPs na Carolina do Norte foram designados em 15 de outubro de 1966 e o mais recente em 5 de fevereiro de 2014."},{"page_url":"https://en.wikipedia.org/wiki/2009_Norwegian_parliamentary_election","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Siv_Jensen-14.jpg","page_title":"2009 Norwegian parliamentary election","context_page_description":"The 2009 parliamentary election was held in Norway on 13 and 14 September 2009. Elections in Norway are held on a Monday in September, usually the second or third Monday, as determined by the king. Early voting was possible between 10 August and 11 September 2009, while some municipalities also held open voting on 13 September. Voters elected 169 members for the Storting, each for a four-year term. Voter turn-out in the 2009 general elections was 76.4%.\\nCandidates were elected on party lists in each of the 19 counties. The political parties nominated candidates for these lists during late 2008 and early 2009. The party lists had to be registered by 31 March 2009.\\nAlthough the opposition received more votes, the governing Red-Green Coalition obtained more seats in parliament. This allowed Jens Stoltenberg to continue as prime minister. Further to the right, both the Conservative Party and Progress Party increased their number of seats in parliament. The centrist Liberal Party failed to meet the electoral threshold of 4.0%, and were reduced to two representatives in Parliament."}]`),T={name:"App",components:{PoemCard:P},data(){return{searchQuery:"",visibleCount:4,poemsData:M,isLoading:!1}},computed:{filteredPoems(){const a=this.searchQuery.trim().toLowerCase();return a?this.poemsData.filter(e=>e.page_title&&e.page_title.toLowerCase().includes(a)||e.context_page_description&&e.context_page_description.toLowerCase().includes(a)):this.poemsData},displayedPoems(){return this.searchQuery.trim()?this.filteredPoems:this.filteredPoems.slice(0,this.visibleCount)},hasMorePoems(){return!this.searchQuery.trim()&&this.visibleCount<this.poemsData.length}},methods:{async loadMore(){this.isLoading=!0,await new Promise(a=>setTimeout(a,1e3)),this.visibleCount+=4,this.isLoading=!1}}},L={class:"search-container"},F={class:"card-container"},G={key:0,class:"empty-state"},I=["disabled"],R={key:0},N={key:1};function H(a,e,s,m,o,r){const d=h("PoemCard");return t(),n("section",null,[e[4]||(e[4]=i("div",{class:"top-banner"},[i("div",{class:"top-banner-title"},[i("div",{class:"top-banner-title-text"},"🤔AI Techniques🧠")])],-1)),i("div",L,[e[3]||(e[3]=i("span",{class:"search-icon"},"🔍",-1)),_(i("input",{type:"text",class:"search-input","onUpdate:modelValue":e[0]||(e[0]=l=>o.searchQuery=l),placeholder:"Search..."},null,512),[[k,o.searchQuery]]),o.searchQuery?(t(),n("button",{key:0,class:"clear-search",onClick:e[1]||(e[1]=l=>o.searchQuery="")}," ✕ ")):p("",!0)]),i("div",F,[(t(!0),n(w,null,b(r.displayedPoems,(l,c)=>(t(),v(d,{key:c,poem:l},null,8,["poem"]))),128)),r.displayedPoems.length===0?(t(),n("div",G,' No results found for "'+u(o.searchQuery)+'". ',1)):p("",!0)]),r.hasMorePoems?(t(),n("button",{key:0,class:"load-more-button",disabled:o.isLoading,onClick:e[2]||(e[2]=(...l)=>r.loadMore&&r.loadMore(...l))},[o.isLoading?(t(),n("span",N,"Loading...")):(t(),n("span",R,"See more"))],8,I)):p("",!0)])}con